var zhuan_map_def ={'27.4E00': '《說文》：“一，惟初太始，道立於一，造分天地，化成萬物。弌，古文一。”', '27.F510': '《說文》：“丨，上下通也。引而上行，讀若囟；引而下行，讀若𨓆。”', '27.F600': '《說文》：“厷，臂上也。从又，从古文。厶，古文厷，象形。肱，厷或从肉。”', '27.F4DB': '《說文》：“丶，有所絕止，丶而識之也。”', '27.F69C': '《說文》：“𡿨，水小流也。《周禮》：‘匠人為溝洫，耜廣五寸，二耜為耦，一耦之伐，廣尺深尺謂之𡿨。’倍𡿨謂之遂，倍遂曰溝，倍溝曰洫，倍洫曰巜。甽，古文𡿨从田，从川；畎，篆文𡿨从田，犬聲。六畎為一畂。”', '27.F488': '《說文》：“乙，玄鳥也。齊魯謂之乙，取其鳴自呼，象形。鳦，乙或从鳥。”', '27.F4E1': '《說文》：“丿，右戾也。象左引之形。”', '27.F472': '《說文》：“乀，左戾也。从反丿，讀與弗同。”', '27.F52C': '《說文》：“𠂆，抴也，明也。象抴引之形。”', '27.F43A': '《說文》：“乁，流也。从反𠂆，讀若移。”', '27.F46C': '《說文》：“亅，鉤逆者謂之亅。象形。讀若橜。”', '27.F486': '《說文》：“𠄌，鉤識也。从反亅。讀若捕鳥罬。”', '27.F5B2': '《說文》：“𠃊，匿也。象𨒅曲隱蔽形。讀若隱。”', '27.4E59': '《說文》：“乙，象春艸木冤曲而出，陰氣尚彊，其出乙乙也。與丨同意，乙承甲，象人頸。”', '27.F3F2': '《說文》：“丄，高也。此古文上，指事也。上，篆文丄。”', '27.F407': '《說文》：“丅，底也。指事。下，篆文丅。”', '27.516B': '《說文》：“八，別也。象分別相背之形。”', '27.51F5': '《說文》：“凵，張口也。象形。”', '27.F51B': '《說文》：“丩，相糾繚也。一曰瓜瓠結丩起。象形。”', '27.5341': '《說文》：“十，數之具也。一為東西，丨為南北，則四方中央備矣。”', '27.53C8': '《說文》：“又，手也，象形。三指者，手之列多略不過三也。”', '27.F4F9': '《說文》：“𠂇，𠂇手也。象形”', '27.F489': '《說文》：“几，鳥之短羽飛𠘧𠘧也。象形。”', '27.535C': '《說文》：“卜，灼剥龜也。象灸龜之形。一曰象龜兆之從橫也。𠁡，古文卜。”', '27.6B84': '《說文》：“殄，盡也。从歺，㐱聲。𠂈，古文殄如此。”', '27.5200': '《說文》：“刀，兵也。象形。”', '27.4E43': '《說文》：“ 乃，曳詞之難也。象气之出難。𢎧，古文乃。𠄕，籀文乃。”', '27.F545': '《說文》：“丂，气欲舒出，勹上礙於一也。丂，古文以為亏字，又以為巧字。”', '27.F2FA': '《說文》：“𠀀，反丂也。讀若呵。”', '27.F48A': '《說文》：“𠙴，𠙴盧，飯器。𥬔，𠙴或从竹，去聲。”', '27.5165': '《說文》：“入，內也。象从上俱下也。”', '27.F4E0': '《說文》：“冂，邑外謂之郊，郊外謂之野，野外謂之林，林外謂之冂，象遠界也。冋，古文冂。从囗，象國邑。坰，冋或从土。”', '27.F334': '《說文》：“𢎘，嘾也。艸木之華未發圅然，象形。”', '27.F4DA': '《說文》：“冖，覆也。从一下垂也。”', '27.4EBA': '《說文》：“人，天地之性最貴者也。此籀文，象臂脛之形。”', '27.F532': '《說文》：“𠤎，變也。从到人。”', '27.5315': '《說文》：“匕，相與比叙也。从反人。匕，亦所以用比取飯。一名柶。”', '27.513F': '《說文》：“儿，仁人也。古文奇字人也。象形。孔子曰：在人下，故詰屈。”', '27.F4F4': '《說文》：“卪，瑞信也。守國者用玉卪，守都鄙者用角卪，使山邦者用虎卪，土邦者用人卪，澤邦者用龍卪，門關者用符卪，貨賄用璽卪，道路用旌卪。象相合之形。”', '27.F4F1': '《說文》：“勹，裹也。象人曲形，有所包裹。”', '27.F4D8': '《說文》：“厶，姦衺也。韓非曰：‘蒼頡作字，自營為厶。’”', '27.5382': '《說文》：“厂，山石之厓巖，人可居。象形。厈，籀文从干。”', '27.F3D8': '《說文》：“巜，水流澮澮也，方百里為巜，廣二尋，深二仞。”', '27.F083': '《說文》：“仌，凍也。象水凝之形。”', '27.4E42': '《說文》：“乂，芟艸也。从丿，从乁相交。刈，乂或从刀。”', '27.F46D': '《說文》：“匸，衺徯，有所俠藏也。从𠃊，上有一覆之。讀與傒同。”', '27.531A': '《說文》：“匚，受物之器。象形。讀若方。𠥓，籀文匚。”', '27.4E8C': '《說文》：“二，地之數也。从偶一。弍，古文。”', '27.529B': '《說文》：“力，筋也。象人筋之形。治功曰力，能圉大災。”', '27.51E0': '《說文》：“几，踞几也。象形。”', '27.4E94': '《說文》：“五，五行也。从二。陰陽在天地間交午也。㐅，古文五省。”', '27.4E03': '《說文》：“七，陽之正也。从一，微陰从中衺出也。”', '27.4E5D': '《說文》：“九，陽之變也。象其屈曲究盡之形。”', '27.4E01': '《說文》：“丁，夏時萬物皆丁實。象形。丁承丙，象人心。”', '27.4E86': '《說文》：“了，尦也。从子無臂，象形。”', '27.4E09': '《說文》：“三，天地人之道也。从三數。弎，古文三从弋。”', '27.58EB': '《說文》：“士，事也。數始於一，終於十。从一，从十。孔子曰：‘推十合一為士。’”', '27.5C6E': '《說文》：“屮，艸木初生也。象丨出形，有枝莖也。古文或以為艸字。讀若徹。”', '27.5C0F': '《說文》：“小，物之微也。从八，丨見而分之。”', '27.53E3': '《說文》：“口，人所以言食也。象形。”', '27.F553': '《說文》：“𣥂，蹈也。从反止。讀若撻。”', '27.5F73': '《說文》：“彳，小步也。象人脛三屬相連也。”', '27.4E8D': '《說文》：“亍，步止也。从反彳。”', '27.F54C': '《說文》：“廴，長行也。从彳引之。”', '27.5E72': '《說文》：“干，犯也。从反入，从一。”', '27.4E08': '《說文》：“丈，十尺也。从又持十。”', '27.5343': '《說文》：“千，十百也。从十，从人。”', '27.5EFE': '《說文》：“廾，竦手也。从𠂇，從又。𢪒，楊雄說廾从兩手。”', '27.53C9': '《說文》：“叉，手指相錯也。从又，象叉之形。”', '27.5BF8': '《說文》：“寸，十分也。人手卻一寸動𧖴，謂之寸口。从又，从一。”', '27.F4DE': '《說文》：“幺，小也。象子初生之形。”', '27.5203': '《說文》：“刃，刀堅也。象刀有刃之形。”', '27.4E0C': '《說文》：“丌，下基也，薦物之丌。象形。讀若箕同。”', '27.5DE5': '《說文》：“工，巧飾也。象人有規榘也。與巫同意。𢀚，古文工从彡。”', '27.4E8E': '《說文》：“于，於也。象气之舒于。从丂，从一。一者，其气平之也。”', '27.F4D7': '《說文》：“亼，三合也。从入、一，象三合之形。讀若集。”', '27.F46E': '《說文》：“夊，行遲曳夊夊，象人兩脛有所躧也。”', '27.F4DF': '《說文》：“夂，从後至也。象人兩脛後有致之者。讀若黹。”', '27.F337': '《說文》：“𡕒，跨步也。从反夂。𩰫从此。”', '27.4E45': '《說文》：“久，以後灸之，象人兩脛後有距也。”', '27.624D': '《說文》：“才，艸木之初也。从丨上貫一，將生枝葉。一，地也。”', '27.4E47': '《說文》：“乇，艸葉也。从垂穗，上貫一，下有根，象形。”', '27.56D7': '《說文》：“囗，回也。象回帀之形。”', '27.5915': '《說文》：“夕，莫也。从月半見。”', '27.F4D3': '《說文》：“宀，交覆深屋也。象形。”', '27.F3AA': '《說文》：“𠔼，重覆也。从冂、一。讀若艸苺苺。”', '27.5DFE': '《說文》：“巾，佩巾也。从冂，丨象系也。”', '27.5C38': '《說文》：“尸，陳也。象卧之形。”', '27.5140': '《說文》：“兀，高而上平也。从一在人上。”', '27.F50B': '《說文》：“彡，毛飾畫文也。象形。”', '27.F298': '《說文》：“㔿，卪也。闕。”', '27.5C71': '《說文》：“山，宣也。宣气𢿱，生萬物，有石而高。象形。”', '27.F4EA': '《說文》：“广，因广為屋，象對刺高屋之形。”', '27.4E38': '《說文》：“丸，圜，傾側而轉者。从反仄。”', '27.F58A': '《說文》：“彑，豕之頭，象其銳而上見也。讀若罽。”', '27.72AC': '《說文》：“犬，狗之有縣蹏者也。象形。孔子曰：‘視犬之字如畫狗也。’”', '27.5927': '《說文》：“大，天大、地大、人亦大，故大象人形。”', '27.5C22': '《說文》：“𡯁，㝿，曲脛也。从大，象偏曲之形。𡯪，古文从𡉚。”', '27.5FC3': '《說文》：“心，人心。土藏，在身之中。象形。博士說以為火藏。”', '27.6C34': '《說文》：“水，準也。北方之行。象眾水並流，中有微陽之气也。”', '27.5DDD': '《說文》：“川，貫穿通流水也。《虞書》曰：‘濬𡿨巜距川’，言深𡿨巜之水會為川也。”', '27.F619': '《說文》：“卂，疾飛也。从飛而羽不見。”', '27.624B': '《說文》：“手，拳也。象形。𠂿，古文手。”', '27.5973': '《說文》：“女，婦人也。象形。王育說。”', '27.5F0B': '《說文》：“弋，橜也，象折木衺銳著形。从𠂆，象物挂之也。”', '27.4E5F': '《說文》：“也，女陰也。象形。𠃟，秦刻石也字。”', '27.4EA1': '《說文》：“亡，逃也。从入，从𠃊。”', '27.5F13': '《說文》：“弓，以近窮遠。象形。”', '27.51E1': '《說文》：“凡，最括也。从二。二，偶也。从ㄋ。ㄋ，古文及。”', '27.571F': '《說文》：“土，地之吐生物者也。二象地之下、地之中物出形也。”', '27.52FA': '《說文》：“勺，挹取也。象形。中有實，與包同意。”', '27.961C': '《說文》：“𨸏，大陸，山無石者。”', '27.5DF1': '《說文》：“己，中宮也，象萬物辟藏詘形也。己承戊，象人腹，𢀒，古文己。”', '27.5B50': '《說文》：“子，十一月陽气動，萬物滋，人以為偁。象形。㜽，古文子，从巛，象髮也。𢀈，籀文子，囟有髮，臂、脛在几上也。”', '27.5B51': '《說文》：“孑，無右臂也。从了，。象形。”', '27.5B53': '《說文》：“孓，無左臂也。从了，。象形。”', '27.F518': '《說文》：“𠫓，不順忽出也。从到子。《易》曰：‘突如其來如。’不孝子突出，不容於內也。𡿮，或从到古文子，即《易》突字。”', '27.5DF3': '《說文》：“巳，巳也，四月陽气巳出，陰气巳藏，萬物見，成文章，故巳為蛇。象形。”', '27.5143': '《說文》：“元，始也。从一，从兀。”', '27.5929': '《說文》：“天，顛也。至高无上，从一、大。”', '27.793A': '《說文》：“示，天垂象，見吉凶，所以示人也。从二；三垂，日、月、星也。觀乎天文以察時變，示，神事也。𥘅，古文示。”', '27.738B': '《說文》：“王，天下所歸往也。董仲舒曰：‘古之造文者，三畫而連其中謂之王。三者，天、地、人也；而參通之者，王也。’孔子曰：‘一貫三為王。’𠙺，古文王。”', '27.6C14': '《說文》：“气，雲气也。象形。”', '27.4E2D': '《說文》：“中，內也。从口、丨，上下通。𠁧，古文中。𠁩，籀文中。”', '27.5C6F': '《說文》：“屯，難也。象艸木之初生，屯然而難。从中貫一，一，地也。尾曲。《易》曰：‘屯，剛柔始交而難生’。”', '27.8278': '《說文》：“艸，百芔也。从二屮。”', '27.5C11': '《說文》：“少，不多也。从小，丿聲。”', '27.5C10': '《說文》：“尐，少也。从小，乀聲。”', '27.5206': '《說文》：“分，別也。从八，从刀，刀以分別物也。”', '27.4ECB': '《說文》：“介，畫也。从八，从人。人各有介。”', '27.EDF2': '《說文》：“𠔁，分也。从重八。八，別也，亦聲。《孝經說》曰：‘故上下有別’。”', '27.516C': '《說文》：“公，平分也。从八、从厶。八，猶背也。韓非曰：‘背厶為公’。”', '27.725B': '《說文》：“牛，大牲也，牛件也。件，事理也。象角頭三，封尾之形。”', '27.6B62': '《說文》：“止，下基也。象艸木出有址，故以止為足。”', '27.F471': '《說文》：“辵，乍行乍止也。从彳，从止。讀若《春秋公羊傳》曰：‘辵階而走’。”', '27.7259': '《說文》：“牙，牡齒也。象上下相錯之形。𤘈，古文牙。”', '27.E0C8': '《說文》：“㔹，材十人也。从十，力聲。”', '27.5EFF': '《說文》：“廿，二十并也。古文省。”', '27.5345': '《說文》：“𠦃，三十并也。古文省。”', '27.F399': '《說文》：“𠬜，引也。从反廾。𢸅，𠬜或从手从樊。”', '27.722A': '《說文》：“爪，𠃨也。覆手曰爪，象形。”', '27.F31F': '《說文》：“𤓯，亦𠃨也。从反爪。闕。”', '27.4E2E': '《說文》：“丮，持也。象手有所𠃨據也。”', '27.F68C': '《說文》：“㕚，手足甲也。从又，象㕚形。”', '27.7236': '《說文》：“父，矩也，家長率教者。从又舉杖。”', '27.592C': '《說文》：“夬，分決也。从又；，象決形。”', '27.5C39': '《說文》：“尹，治也。从又、丿，握事者也。𦥱，古文尹。”', '27.53CA': '《說文》：“及，逮也。从又，从人。乁，古文及，《秦刻石》及如此。𢎜，亦古文及。𨕤，亦古文及。”', '27.53CD': '《說文》：“反，覆也。从又、厂。反形。𠬡，古文。”', '27.F539': '《說文》：“𠬝，治也。从又，从卪。卪，事之節也。”', '27.F519': '《說文》：“𠬸，入水有所取也。从又在囘下。囘，古文回。回，淵水也。”', '27.53CB': '《說文》：“友，同志為友。从二又，相交友也。𠬺，古文友。𦐮。亦古文友。”', '27.652F': '《說文》：“支，去竹之枝也。从手持半竹。𠦙，古文支。”', '27.6BB3': '《說文》：“殳，以杸殊人也。《禮》：‘殳以積竹，八觚，長丈二尺，建於兵車，車旅賁以先驅。’从又，几聲。”', '27.F654': '《說文》：“攴，小擊也。从又，卜聲。”', '27.723B': '《說文》：“爻，交也。象《易》六爻頭交也。”', '27.4E88': '《說文》：“予，推予也。象相予之形。”', '27.5E7B': '《說文》：“幻，相詐惑也。从反予。《周書》曰：‘無或譸張為幻。’”', '27.6B79': '《說文》：“歹，𠛱骨之殘也。从半冎。讀若櫱岸之櫱。𡰮，古文歺。”', '27.8089': '《說文》：“肉，胾肉。象形。”', '27.5207': '《說文》：“切，刌也。从刀，七聲。”', '27.525D': '《說文》：“剝，裂也。从刀，从彔。彔，刻割也。彔亦聲。𠚩，剝或从卜。”', '27.F11E': '《說文》：“刅，傷也。从刃，从一。創，或从刀，倉聲。”', '27.F48B': '《說文》：“丯，艸蔡也。象艸生之散亂也。”', '27.F0FA': '《說文》：“䇘，可以收繩也。从竹，象形，中象人手所推握也。互，䇘或省。”', '27.5DE8': '《說文》：“巨，規巨也。从工，象手持之。榘，巨或从木、矢，矢者，其中正也。𢀑，古文巨。”', '27.66F0': '《說文》：“曰，詞也。从口，乙聲，亦象口气出也。”', '27.516E': '《說文》：“兮，語所稽也。从丂、八，象气越亏也。”', '27.4E39': '《說文》：“丹，巴越之赤石也。象采丹井，一象丹形。𠁿，古文丹。㣋，亦古文丹。”', '27.4E95': '《說文》：“井，八家一井。象構韓形。‧，𦉥之象也。古者伯益初作井。”', '27.4ECA': '《說文》：“今，是時也。从亼，从乁。乁，古文及。”', '27.5167': '《說文》：“內，入也。从口，自外而入也。”', '27.E492': '《說文》：“𠓜，二入也。兩从此。闕。”', '27.5198': '《說文》：“冘，淫淫，行貌。从人出冂。”', '27.5903': '《說文》：“夃，秦以市買多得為夃。从𠄎，从夂，益至也。从乃。《詩》曰：‘我夃酌彼金罍。’”', '27.6728': '《說文》：“木，冒也，冒地而生。東方之行。从屮，下象其根。”', '27.EDF7': '《說文》：“𣡌，伐木餘也，从木獻聲。《商書》曰：‘若顛木之有甹𣡌。’櫱，𣡌或从木辥聲。𣎴，古文𣡌，从木無頭。㮆，亦古文𣡌。”', '27.4E4B': '《說文》：“之，出也。象艸過屮，枝莖益大有所之。一者，地也。”', '27.F54F': '《說文》：“帀，周也。从反之而帀也。”', '27.4E30': '《說文》：“丰，艸盛丰丰也。从生，上下達也。”', '27.65E5': '《說文》：“日，實也，太陽之精不虧。从囗、一，象形。，古文，象形。”', '27.6708': '《說文》：“月，闕也，大陰之精，象形。”', '27.6BCC': '《說文》：“毌，穿物持之也。从一橫貫，象寶貨之形。讀若冠。”', '27.E5C1': '《說文》：“𢎙，艸木𢎘盛也。从二𢎘。”', '27.7247': '《說文》：“片，判木也。从半木。”', '27.51F6': '《說文》：“凶，惡也。象地穿交陷其中也。”', '27.F3A8': '《說文》：“𣎵，分枲莖皮也。从屮，八象枲之皮莖也。讀若髕。”', '27.5B84': '《說文》：“宄，姦也。外為盗，內為宄。从宀，九聲。”', '27.F394': '《說文》：“冃，小兒、蠻夷頭衣也。从冂，二其飾也。”', '27.5DFF': '《說文》：“巿，韠也。上古衣蔽前而已，巿以象之。天子朱巿，朱矦赤巿，大夫葱衡。从巾，象連帶之形。韍，篆文巿从韋，从犮。”', '27.4EC1': '《說文》：“仁，親也。从人，从二。忎，古文仁从千、心。𡰥，古文仁或从尸。”', '27.4ECD': '《說文》：“仍，因也。从人，乃聲。”', '27.4EC0': '《說文》：“什，相什保也。从人、十。”', '27.4EC6': '《說文》：“仆，頓也。从人，卜聲。”', '27.4EC7': '《說文》：“仇，讎也。从人，九聲。”', '27.5F14': '《說文》：“弔，問終也。古之葬者，厚衣之以薪，从人持弓，會敺禽。”', '27.5316': '《說文》：“化，教行也。从𠤎，从人，𠤎亦聲。”', '27.F48C': '《說文》：“𠤏，相次也。从匕，从十。鴇从此。”', '27.536C': '《說文》：“卬，望欲有所庶及也。从匕，从卪。”', '27.F121': '《說文》：“从，相聽也。从二人。”', '27.6BD4': '《說文》：“比，密也。二人為从，反从為比。夶，古文比。”', '27.F534': '《說文》：“𡈼，善也。从人士；士，事也。一曰象物出地挺生也。”', '27.6BDB': '《說文》：“毛，眉髮之屬及獸毛也。象形。”', '27.5C3A': '《說文》：“尺，十寸也。人手卻十分動脈為寸口。十寸為尺。尺，所以指尺䂓榘事也。从尸，从乙，乙所識也。周制寸、尺、咫、尋、常、仞諸度量，皆以人之體為法。”', '27.65B9': '《說文》：“方，併船也。象兩舟省緫頭形。汸，方或从水。”', '27.5141': '《說文》：“允，信也。从儿，㠯聲。”', '27.F3FE': '《說文》：“兂，首筓也。从人、匕，象簪形。簪，俗兂。从竹，从朁。”', '27.6B20': '《說文》：“欠，張口气悟也。象气从人上出之形。”', '27.65E1': '《說文》：“㒫，㱃食气屰不得息曰㒫。从反欠。●，古文㒫。”', '27.4E0F': '《說文》：“丏，不見也。象壅蔽之形。”', '27.6587': '《說文》：“文，錯畫也。象交文。”', '27.5384': '《說文》：“厄，科厄，木節也。从卪，厂聲。賈侍中說以為厄，裹也。一曰：厄，蓋也。”', '27.F07A': '《說文》：“𠨎，二卪也。巽从此。闕。”', '27.F090': '《說文》：“𠨍，事之制也。从卩、𠂈。闕。”', '27.52FB': '《說文》：“勻，少也。从勹、二。”', '27.52FC': '《說文》：“勼，聚也。从勹，九聲。讀若鳩。”', '27.4EC4': '《說文》：“仄，側傾也。从人，在厂下。𠨮，籀文从夨，夨亦聲。”', '27.F591': '《說文》：“厃，仰也。从人在厂上。一曰屋梠也，秦謂之桷，齊謂之厃。”', '27.78FA': '《說文》：“磺，銅鐵樸石也。从石，黃聲。讀若穬。卝，古文磺。《周禮》有卝人。”', '27.52FF': '《說文》：“勿，州里所建旗。象其柄，有三游。雜帛，幅半異。所以趣民，故遽稱勿勿。𣃦，勿或从㫃。”', '27.5189': '《說文》：“冄，毛冄冄也。象形。”', '27.706B': '《說文》：“火，燬也。南方之行，炎而上，象形。”', '27.F4C8': '《說文》：“夨，傾頭也。从大，象形。”', '27.592D': '《說文》：“夭，屈也。从大，象形。”', '27.4EA2': '《說文》：“亢，人頸也。从大省，象頸脈形。頏，亢或从頁。”', '27.F05F': '《說文》：“亣，籀文大，改古文，亦象人形。”', '27.592B': '《說文》：“夫，丈夫也。从大，一以象簪也。周制以八寸為尺，十尺為丈，人長八尺，故曰丈夫。”', '27.56DF': '《說文》：“囟，頭會匘蓋也。象形。𦞤，或从肉、宰。𠙷，古文囟字。”', '27.6CF0': '《說文》：“泰，滑也。从廾，从水，大聲。夳，古文泰。”', '27.F69F': '《說文》：“𡿧，害也。从一雝川。《春秋傳》曰：‘川雝為澤凶。’”', '27.5DDE': '《說文》：“州，水中可居曰州。周遶其旁，从重川。昔堯遭洪水，民居水中高土，或曰九州。《詩》曰：‘在河之州’。一曰：州，疇也。各疇其土而生之。𠃕，古文州。”', '27.51AC': '《說文》：“冬，四時盡也。从仌，从夂。夂，古文終字。𣆼，古文冬从日。”', '27.96F2': '《說文》：“雲，山川气也。从雨，云象雲回轉形。云，古文省雨。，亦古文雲。”', '27.5B54': '《說文》：“孔，通也。从乙，从子。乙，請子之候鳥也。乙至而得子，嘉美之也。古人名嘉，字子孔。”', '27.4E0D': '《說文》：“不，鳥飛上翔不下來也。从一，一猶天也。象形。”', '27.6236': '《說文》：“戶，護也。半門曰戶，象形。㦿，古文戶从木。”', '27.6BCB': '《說文》：“毋，止之也。从女，有奸之者。”', '27.6C0F': '《說文》：“氏，巴蜀山名岸脅之旁箸欲落𡐦者曰氏。氏崩聲聞數百里。象形，乀聲。”', '27.6208': '《說文》：“戈，平頭𢧢也。从弋，一横之，象形。”', '27.4E4D': '《說文》：“乍，止也。一曰亡也。从亡，从一。”', '27.E0BE': '《說文》：“𣠮，亡也，从亡無聲；无，奇字无，通於元者，王育說：‘天屈西北為无。’”', '27.5339': '《說文》：“匹，四丈也。从八、匸，八揲一匹，八亦聲。”', '27.5F15': '《說文》：“引，開弓也。从弓、丨。”', '27.7CF8': '《說文》：“糸，細絲也。象束絲之形。讀若覛。𢆯，古文糸。”', '27.4E0E': '《說文》：“与，賜予也。一勺為与。此与與同。”', '27.65A4': '《說文》：“斤，斫木也。象形。”', '27.6597': '《說文》：“斗，十升也。象形，有柄。”', '27.5347': '《說文》：“升，十龠也。从斗，亦象形。”', '27.516D': '《說文》：“六，《易》之數，陰變於六，正於八。从入，从八。”', '27.79B8': '《說文》：“禸，獸足蹂地也。象形，九聲。《尔疋》曰：‘狐貍貛貉醜其足，𨆌其迹厹。’蹂，篆文从足，柔聲。”', '27.5C24': '《說文》：“尤，異也。从乙，又聲。”', '27.5DF4': '《說文》：“巴，蟲也。或曰食象蛇。象形。”', '27.58EC': '《說文》：“壬，位北方也。陰極陽生，故《易》曰：‘龍戰于野。’戰者，接也。象人褢妊之形。承亥壬以子，生之敘也。與巫同意。壬承辛，象人脛。脛，任體也。”', '27.4E11': '《說文》：“丑，紐也。十二月，萬物動，用事。象手之形。時加丑，亦舉手時也。”', '27.5348': '《說文》：“午，啎也。五月陰氣午逆陽，冒地而出。此予矢同意。”', '27.4E15': '《說文》：“丕，大也。从一，不聲。”', '27.79AE': '《說文》：“禮，履也，所以事神致福也。从示、从豊，豊亦聲。𠃞，古文禮。”', '27.7389': '《說文》：“玉，石之美。有五德：潤澤以溫，仁之方也；䚡理自外，可以知中，義之方也；其聲舒揚，專以遠聞，智之方也；不橈而折，勇之方也；銳廉而不技，絜之方也。象三玉之連，丨，其貫也。𤣪，古文玉。”', '27.5349': '《說文》：“卉，艸之總名也。从艸、屮。”', '27.5C12': '《說文》：“尒，詞之必然也。从入、丨、八，八象气之分散。”', '27.5FC5': '《說文》：“必，分極也。从八、弋，弋亦聲。”', '27.91C6': '《說文》：“釆，辨別也。象獸指爪分別也。讀若辨。𠂠，古文釆。”', '27.534A': '《說文》：“半，物中分也。从八，从牛。牛為物大，可以分也。”', '27.53EC': '《說文》：“召，𧦝也。从口，刀聲。”', '27.53F0': '《說文》：“台，說也。从口，㠯聲。”', '27.53F3': '《說文》：“右，手口相助也。从又，从口。”', '27.EC0F': '《說文》：“叴，高气也。从口，九聲。臨淮有叴猶縣。”', '27.53F1': '《說文》：“叱，訶也。从口，七聲。”', '27.53EB': '《說文》：“叫，嘑也。从口，丩聲。”', '27.F575': '《說文》：“㕣，山閒陷泥地。从口，从水敗皃。讀若沇州之沇。九州之渥地也，故以沇名焉。𧮲，古文㕣。”', '27.F508': '《說文》：“癶，足剌癶也。从止、𣥂。”', '27.6B63': '《說文》：“正，是也。从止，一以止。㱏，古文正，从二，二，古上字。𣥔，古文正，从一、足，足者，亦止也。”', '27.4E4F': '《說文》：“乏，《春秋傳》曰：‘反正為乏。’”', '27.758B': '《說文》：“疋，足也。上象腓腸，下从止。《弟子職》曰：‘問疋何止﹖’古文以為《詩．大疋》字，亦以為足字，或曰胥字。一曰疋記也。”', '27.518A': '《說文》：“冊，符命也，諸矦進受于王也。象其札一長一短，中有二編之形。笧，古文𠕋从竹。”', '27.F50F': '《說文》：“𢆉，㨖也。从干，入一為干，入二為𢆉。讀若能，言稍甚也。”', '27.53EA': '《說文》：“只，語已詞也。从口，象氣下引之形。”', '27.53E5': '《說文》：“句，曲也。从口，丩聲。”', '27.53E4': '《說文》：“古，故也。从十口。識前言者也。𠖠，古文古。”', '27.4E16': '《說文》：“世，三十年為一世，从卉而曳長之，亦取其聲也。”', '27.4FE1': '《說文》：“信，誠也。从人，从言，會意。㐰，古文从言省。訃，古文信。”', '27.EE0D': '《說文》：“𠨭，拖持也。从反𠃨。闕。”', '27.F12B': '《說文》：“𠬢，滑也。《詩》云：‘𠬢兮達兮。’从又、屮。一曰取也。段玉裁注：“從屮，未詳其意。”', '27.53F2': '《說文》：“史，記事者也。从又持中；中，正也。”', '27.F39C': '《說文》：“𦘒，手之疌巧也。从又持巾。”', '27.E2AE': '《說文》：“𠘱，新生羽而飛也。从𠘧，从彡。”', '27.76AE': '《說文》：“皮，剝取獸革者謂之皮。从又，為省聲。𥬖，古文皮。𠰎，籀文皮。”', '27.E2D7': '《說文》：“卟，卜以問疑也。从口、卜。讀與稽同。《書》云：‘卟疑’。”', '27.5360': '《說文》：“占，視兆問也。从卜，从口。”', '27.7528': '《說文》：“用，可施行也。从卜，从中。衛宏說。𤰆，古文用。”', '27.76EE': '《說文》：“目，人眼。象形。重童子也。𡇡，古文目。”', '27.F478': '《說文》：“𦫳，羊角也。象形。讀若乖。”', '27.5E7C': '《說文》：“幼，少也。从幺，从力。”', '27.7384': '《說文》：“玄，幽遠也。黑而有赤色者為玄。象幽而入覆之也。𢆯，古文玄。”', '27.808A': '《說文》：“肊，胷骨也。从肉，乙聲。臆，肊或从意。”', '27.520C': '《說文》：“刌，切也。从刀，寸聲。”', '27.5209': '《說文》：“刏，劃傷也。从刀，气聲。一曰斷也。又讀若㱯。一曰刀不利，於瓦石上刏之。”', '27.520A': '《說文》：“刊，剟也。从刀，干聲。”', '27.5DE6': '《說文》：“左，手相左助也。从𠂇、工。”', '27.5DE7': '《說文》：“巧，技也。从工，丂聲。”', '27.7518': '《說文》：“甘，美也。从口含一。一，道也。”', '27.53EF': '《說文》：“可，肎也。从口、丂，丂亦聲。”', '27.53F5': '《說文新附》：“叵，不可也。从反可。”', '27.4E4E': '《說文》：“乎，語之餘也。从𠔃，象聲上越揚之形也。”', '27.F583': '《說文》：“号，痛聲也。从口，在丂上。”', '27.5E73': '《說文》：“平，語平舒也。从亏，从八。八，分也。”', '27.76BF': '《說文》：“皿，飯食之用器也。象形，與豆同意。讀若猛。”', '27.53BB': '《說文》：“去，人相違也。从大，凵聲。”', '27.4E3B': '《說文》：“主，鐙中火主也。从，象形；从丶，丶亦聲。”', '27.9955': '《說文》：“饕，貪也。从食，號聲。叨，饕或从口，刀聲。號，籀文饕从號省。”', '27.E490': '《說文》：“㞥，入山之深也。从山，从入。闕。”', '27.4EDD': '《說文》：“㒰，完也。从入，从工。全，篆文㒰从玉。純玉曰全。𠌆，古文仝。”', '27.77E2': '《說文》：“矢，弓弩矢也。从入，象鏑栝羽之形。古者夷牟初作矢。”', '27.5E02': '《說文》：“市，買賣所之也。市有垣，从冂，从乁。乁，古文及，象物相及也。之省聲。”', '27.592E': '《說文》：“央，中央也。从大在冂之內。大，人也。央、旁同意。一曰久也。”', '27.5F1F': '《說文》：“弟，韋束之次弟也。从古字之象。𠂖，古文弟，从古文韋省，丿聲。”', '27.672C': '《說文》：“本，木下曰本。从木，一在其下。楍，古文。”', '27.672B': '《說文》：“末，木上曰末。从木，一在其上。”', '27.672D': '《說文》：“札，牒也。从木，乙聲。”', '27.51FA': '《說文》：“出，進也。象艸木益滋上出達也。”', '27.F479': '《說文》：“𣎵，艸木盛𣎵𣎵然。象形。八聲。”', '27.F637': '《說文》：“𠂔，止也。从𣎵，盛而一橫止之也。”', '27.751F': '《說文》：“生，進也。象艸木生出土上。”', '27.F3A4': '《說文》：“𥝌，木之曲頭，止不能上也。”', '27.56DE': '《說文》：“回，轉也。从囗，中象回轉形。囘，古文。”', '27.EF0F': '《說文》：“㘝，下取物縮藏之。从囗，从又。”', '27.56DA': '《說文》：“囚，繫也。从人在囗中。”', '27.6248': '《說文》：“扈，夏后同姓所封，戰於甘者。在鄠，有扈谷、甘亭。从邑，戶聲。𡴱，古文扈从山𢎘。”', '27.E584': '《說文》：“䢳，地名。从邑，几聲。”', '27.65E6': '《說文》：“旦，明也。从日見一上。一，地也。”', '27.5917': '《說文》：“夗，轉卧也。从夕，从卪。卧有卪也。”', '27.5916': '《說文》：“外，遠也。卜尚平旦，今夕卜，於事外矣。𡖄，古文外。”', '27.79BE': '《說文》：“禾，嘉穀也。二月始生，八月而孰，得時之中，故謂之禾。禾，木也。木王而生，金王而死。从木，从𠂹省，𠂹象其穗。”', '27.79EB': '《說文》：“秫，稷之黏者。从禾、术，象形。术，秫或省禾。”', '27.74DC': '《說文》：“瓜，㼌也。象形。”', '27.F0BF': '《說文》：“宂，𢽳也。从宀，人在屋下，無田事。”', '27.7A74': '《說文》：“穴，土室也。从宀，八聲。”', '27.F544': '《說文》：“疒，倚也。人有疾病，象倚箸之形。”', '27.7F51': '《說文》：“网，庖犧所結繩以漁。从冂，下象网交文。𦉸，网或从亡；𦋟，网或从糸；𠕃，古文网；𦉯，籀文网。”', '27.E686': '《說文》：“㠲，㡜裂也。从巾，匕聲。”', '27.5E03': '《說文》：“布，枲織也。从巾，父聲。”', '27.767D': '《說文》：“白，西方色也。陰用事，物色白。从入合二。二，陰數。𦣺，古文白。”', '27.4EDE': '《說文》：“仞，伸臂一尋，八尺。从人，刃聲。”', '27.4ED5': '《說文》：“仕，學也。从人，从士。”', '27.4EDC': '《說文》：“仜，大腹也。从人，工聲。”', '27.4EE1': '《說文》：“㐹，勇壯也。《正字通》：“㐹，仡本字。”', '27.E6B3': '《說文》：“仢，約也。从人，勺聲。”', '27.4ED8': '《說文》：“付，與也。从寸，持物對人。”', '27.4EE3': '《說文》：“代，更也。从人，弋聲。”', '27.4ED4': '《說文》：“仔，克也。从人，子聲。”', '27.4EDA': '《說文》：“仚，人在山上。从人，从山。”', '27.5317': '《說文》：“北，𦮃也。从二人相背。”', '27.4E18': '《說文》：“丘，土之高也，非人所為也。从北，从一。一，地也。人居在丘南，故从北。中邦之居在崐崘東南。一曰四方高中央下為丘。象形。㘳，古文从土。”', '27.8863': '《說文》：“衣，依也。上曰衣，下曰裳。象覆二人之形。”', '27.5C3B': '《說文》：“尻，𦞠也。从尸，九聲。”', '27.5C3C': '《說文》：“尼，從後近之。从尸，匕聲。”', '27.5145': '《說文》：“充，長也；高也。从儿，育省聲。”', '27.5144': '《說文》：“兄，長也。从儿，从口。”', '27.F077': '《說文》：“㝸，冕也。周曰㝸，殷曰吁，夏曰收。从皃，象形。𢍘，籀文㝸从廾，上象形。弁，或㝸字。”', '27.F574': '《說文》：“㐱，禂髮也。从彡，从人。《詩》曰：‘㐱髮如雲。’鬒，㐱或从髟，眞聲。”', '27.53F8': '《說文》：“司，臣司事於外者。从反后。”', '27.F493': '《說文》：“巵，圜器也。一名觛。所以節飲食。象人，卪在其下也。《易》曰：‘君子節飲食’。”', '27.4EE4': '《說文》：“令，發號也。从亼、卪。”', '27.5305': '《說文》：“包，象人褢妊，巳在中，象子未成形也。”', '27.E7C6': '《說文》：“㞦，山也。或曰：弱水之所出。从山，几聲。”', '27.5C8A': '《說文》：“陬隅高山之節，从山从卪。”', '27.F3AF': '《說文》：“屵，岸高也。从山、厂，厂亦聲。”', '27.E7EE': '《說文》：“𠨲，岸上見也。从厂，从之省。讀若躍。”', '27.77F3': '《說文》：“石，山石也。在厂之下，口象形。”', '27.9577': '《說文》：“長，久遠也。从兀，从匕。兀者，高遠意也。久則變化。亾聲。●者倒亾也。𠑷，古文長；𨱗，亦古文長。”', '27.8C55': '《說文》：“豕，彘也，竭其尾，故謂之豕，象毛足而後有尾，讀與豨同。按：今世字誤以豕為彘，以彘為豕，何以明之？為𤥨从豕，蟸从彘，皆取其聲，以是明之。𢁓，古文。”', '27.72AF': '《說文》：“犯，侵也。从犬，巳聲。”', '27.72AE': '《說文》：“犮，走犬皃。从犬而丿之。曳其足則剌犮也。”', '27.4EA6': '《說文》：“亦，人之臂亦也。从大，象兩亦之形。”', '27.F48E': '《說文》：“夲，進趣也。从大，从十。大十，猶兼十人也。讀若滔。”', '27.F48F': '《說文》：“夰，放也。从大而八分也。”', '27.7ACB': '《說文》：“立，住也。从大，立一之上。”', '27.6C43': '《說文》：“汃，西極之水也。从水，八聲。《爾雅》曰：‘西至汃國，謂四極。’”', '27.6C3E': '《說文》：“氾，濫也。从水，㔾聲。”', '27.6C3F': '《說文》：“氿，水厓枯土也。从水，九聲。《爾雅》曰：‘水醮曰氿。’”', '27.6DBF': '《說文》：“涿，流下滴也。从水，豖聲。上谷有涿縣。𣄻，奇字涿。从日、乙。”', '27.6C40': '《說文》：“汀，平也。从水，丁聲。𢆊，汀或从平。”', '27.6C41': '《說文》：“汁，液也。从水，十聲。”', '27.6C38': '《說文》：“永，長也，象水巠理之長。《詩》曰：‘江之永矣’。”', '27.9712': '《說文》：“𩃬，雲覆日也。从雲，今聲。侌，古文或省。𠆭，亦古文𩃬。”', '27.F110': '《說文》：“戹，隘也。从戶，乙聲。”', '27.5931': '《說文》：“失，縱也。从手，乙聲。”', '27.6254': '《說文》：“扔，因也。从手，乃聲。”', '27.6250': '《說文》：“扐，《易》筮，再扐而後卦。从手，力聲。”', '27.6253': '《說文新附》：“打，擊也。从手，丁聲。”', '27.6BCD': '《說文》：“母，牧也。从女，象褱子形。一曰象乳子也。”', '27.59A3': '《說文》：“妣，歿母也。从女，比聲。𡚧，籀文妣省。”', '27.5974': '《說文》：“奴，奴、婢，皆古之辠人也。《周禮》曰：‘其奴，男子入于辠隸，女子入于舂藁。’从女，从又。㚢，古文奴，从人。”', '27.6C11': '《說文》：“民，眾萌也。从古文之象。”', '27.5F17': '《說文》：“弗，撟也。从丿，从，从韋省。”', '27.6C10': '《說文》：“氐，至也。从氏下箸一。一，地也。林義光《文源》：“當與‘氐’同字。氏、氐音稍變，故加‘一’以別之。‘一’，實非地。氏象根。根在地下，非根之下復有地也。”', '27.6209': '《說文》：“戉，斧也。从戈，𠄌聲。”', '27.F5B7': '《說文》：“匄，气也。逯安說，亡人為匄。”', '27.531C': '《說文》：“匜，似羹魁，柄中有道，可以注水。从匚，也聲。”', '27.753E': '《說文》：“甾，東楚名缶曰甾。象形。𠙾，古文。”', '27.74E6': '《說文》：“瓦，土器已燒之總名。象形。”', '27.5F18': '《說文》：“弘，弓聲也。从弓，厶聲。厶，古文肱字。”', '27.5B83': '《說文》：“它，虫也。从虫而長，象冤曲垂尾形。上古艸居患它，故相問無它乎。蛇，它或从虫。”', '27.58A3': '《說文》：“墣，塊也。从土，菐聲。圤，墣或从卜。”', '27.F679': '《說文》：“凷，墣也。从土，一屈象形。塊，凷或从鬼。”', '27.5723': '《說文》：“圣，汝潁之閒，謂致力於地曰圣。从土，从又。”', '27.7530': '《說文》：“田，陳也，樹穀曰田。象四口，十，阡陌之制也。”', '27.529F': '《說文》：“功，以勞定國也。从力，从工，工亦聲。”', '27.52A0': '《說文》：“加，語相增加也。从力，从口。”', '27.EE3B': '《說文》：“凥，處也。从尸得几而止。《孝經》曰：‘仲尼凥。’凥，謂閒居如此。”', '27.F55C': '《說文》：“処，止也，得几而止。从几，从夂。處，処或从虍聲。”', '27.4E14': '《說文》：“且，薦也。从几，足有二橫，一其下地也。”', '27.77DB': '《說文》：“矛，酋矛也。建於兵車，長二丈。象形。𢦧，古文矛，从戈。”', '27.961E': '《說文》：“阞，地理也。从𨸏，力聲。”', '27.EC58': '《說文》：“䦺，丘名。从𨸏，丁聲。讀若丁。”', '27.56DB': '《說文》：“四，陰數也。象四分之形。𦉭，古文四。亖，籀文四。”', '27.5B81': '《說文》：“宁，辨積物也。象形。”', '27.7532': '《說文》：“甲，東方之孟，陽气萌動。从木戴孚甲之象。一曰人頭宜為甲，甲象人頭。𠇚，古文甲，始於十，見於千，成於木之象。”', '27.4E19': '《說文》：“丙，位南方，萬物成炳然。陰气初起，陽气將虧，从一入冂。一者，陽也。丙承乙，象人肩。”', '27.620A': '《說文》：“戊，中宮也，象六甲五龍相拘絞也。戊承丁，象人脅。”', '27.5B55': '《說文》：“孕，褢子也。从子，从几。”', '27.536F': '《說文》：“卯，冒也。二月萬物冒地而出，象開門之形。故二月為天門。𩇨，古文卯。”', '27.4EE5': '《說文》：“㠯，用也。从反已。賈侍中說，已，意已實也。象形。”', '27.672A': '《說文》：“未，味也，六月滋味也。五行，木老於未，象木重枝葉也。”', '27.7533': '《說文》：“申，神也。七月，陰气成，體自申束。从臼，自持也。吏臣餔時聽事，申旦政也。𤱓，古文申。𢑚，籀文申。”', '27.540F': '《說文》：“吏，治人者也。从一，从史，史亦聲。”', '27.738E': '《說文》：“玎，玉聲也。从玉，丁聲。齊太公子伋謚曰玎公。”', '27.E03B': '《說文》：“㺨，石之似玉者。从玉，厶聲。讀與私同。”', '27.827E': '《說文》：“艾，冰臺也。从艸，乂聲。”', '27.8280': '《說文》：“芀，葦華也。从艸，刀聲。”', '27.827C': '《說文》：“艼，艼熒，胊也。从艸，丁聲。”', '27.8562': '《說文》：“蕢，艸器也。从艸，貴聲。臾，古文蕢。象形。《論語》曰：‘有荷臾而過孔氏之門。’”', '27.827D': '《說文》：“艽，遠荒也。从艸，九聲。《詩》曰：‘至于艽野。’”', '27.827F': '《說文》：“艿，艸也。从艸，乃聲。”', '27.725D': '《說文》：“牝，畜母也。从牛，匕聲。《易》曰：‘畜牝牛，吉。’”', '27.725F': '《說文》：“牟，牛鳴也。从牛，象其聲气从口出。”', '27.540D': '《說文》：“名，自命也。从口，从夕。夕者，冥也。冥不相見，故以口自名。”', '27.5409': '《說文》：“吉，善也。从士、口。”', '27.5410': '《說文》：“吐，寫也。从口，土聲。”', '27.5403': '《說文》：“吃，言蹇難也。从口，气聲。”', '27.5412': '《說文》：“吒，噴也，叱怒也。从口，乇聲。”', '27.5401': '《說文》：“吁，驚也。从口，于聲。”', '27.E101': '《說文》：“㕧，唸㕧，呻也。从口，尸聲。”', '27.5404': '《說文》：“各，異辭也。从口、夂。夂者，有行而止之，不相聽也。”', '27.F0FE': '《說文》：“吅，驚嘑也。从二口，讀若讙。”', '27.6B64': '《說文》：“此，止也。从止，从匕。匕，相比次也。”', '27.884C': '《說文》：“行，人之步趨也。从彳，从亍。”', '27.820C': '《說文》：“舌，在口所以言也，別味也。从千，从口，千亦聲。”', '27.F66F': '《說文》：“屰，不順也。从干，下屮，屰之也。”', '27.F47D': '《說文》：“㐁，舌皃。从𧮫省，象形。𠀬，古文㐁，讀若三年導服之導。一曰竹上皮。讀若沾。一曰讀若誓，弼字从此。”', '27.F47A': '《說文》：“䇂，辠也。从干、二。二，古文上字。讀若愆，張林說。”', '27.4E1E': '《說文》：“丞，翊也。从廾，从卩，从山。山高，奉承之義。”', '27.5F02': '《說文》：“异，舉也。从廾，㠯聲。”', '27.5171': '《說文》：“共，同也。从廿、廾。𦱹，古文共。”', '27.EDF0': '《說文》：“𢀜，袌也。从𠃨，工聲。㧬，𢀜或加手。”', '27.807F': '《說文》：“聿，所以書也。楚謂之聿，吳謂之不律，燕謂之弗。从𦘒，一聲。”', '27.81E3': '《說文》：“臣，牽也，事君也。象屈服之形。”', '27.5F79': '《說文》：“役，戍邊也。从殳，从彳。𠈧，古文役从人。”', '27.6BBA': '《說文》：“殺，戮也。从殳，杀聲。𤔮，古文殺；𢽅，古文殺；𢁛，古文殺。”', '27.5BFA': '《說文》：“寺，廷也，有法度者也。从寸，之聲。”', '27.6536': '《說文》：“收，捕也。从攴，丩聲。”', '27.6537': '《說文》：“攷，敂也。从攴，丂聲。”', '27.E2DA': '《說文》：“𠧞，灼龜坼也。从卜、兆，象形。兆，古文兆省。”', '27.81EA': '《說文》：“自，鼻也。象鼻形。𦣼，古文自。”', '27.F1F4': '《說文》：“此亦自字也。省自者，詞言之气从鼻出，與口相助也。”', '27.767E': '《說文》：“百，十十也。从一、白。數，十百為一貫，相章也。𦣻，古文百从自。”', '27.7FBD': '《說文》：“羽，鳥長毛也。象形。”', '27.7F8A': '《說文》：“羊，祥也。从𦫳，象頭角足尾之形。孔子曰：牛羊之字，以形舉也。”', '27.518D': '《說文》：“再，一舉而二也。从冓省。”', '27.F120': '《說文》：“𢆶，微也。从二幺。”', '27.F088': '《說文》：“叀，專小謹也。从幺省；屮，財見也；屮亦聲。𡴗，古文叀。𠧢，亦古文叀。”', '27.F3A0': '《說文》：“𠬪，物落；上下相付也。从爪，从又。”', '27.E37C': '《說文》：“㱙，腐也。从歺，丂聲。朽，㱙或从木。”', '27.6B7B': '《說文》：“死，澌也，人所離也。从歺，从人。𠒁，古文死如此。”', '27.F513': '《說文》：“冎，剔人肉置其骨也。象形，頭隆骨也。”', '27.808C': '《說文》：“肌，肉也。从肉，几聲。”', '27.808B': '《說文》：“肋，脅骨也。从肉，力聲。”', '27.F0DE': '《說文》：“䏌，振䏌也。从肉，八聲。”', '27.E3A3': '《說文》：“肍，孰肉醬也。从肉，九聲。讀若舊。”', '27.E3B4': '《說文》：“肎，骨間肉肎肎箸也。从肉，从冎省。”', '27.5217': '《說文》：“列，分解也。从刀，𣧄聲。”', '27.5216': '《說文》：“刖，絕也。从刀，月聲。”', '27.5213': '《說文》：“刓，剸也。从刀，元聲。一曰齊也。”', '27.5211': '《說文》：“𠛬，剄也。仌刀，幵聲。”', '27.520E': '《說文新附》：“刎，剄也。从刀，勿聲。”', '27.F5FE': '《說文》：“㓞，巧㓞也。从刀，丰聲。”', '27.8012': '《說文》：“耒，手耕曲木也。从木推丰。古者垂作耒㭒，以振民也。”', '27.7AF9': '《說文》：“竹，冬生艸也。象形。下垂者，箁箬也。”', '27.7C0B': '《說文》：“簋，黍稷方器也。从竹、从皿、从皀。㔳，古文簋，从匚、飢。匭，古文簋或从軌。朹，亦古文簋。”', '27.7C20': '《說文》：“簠，黍稷圜器也。从竹，从皿，甫聲。𠤱，古文簠从匚，从夫。”', '27.7B95': '《說文》：“箕，簸也。从竹；𠀠，象形；下其丌也。𠀠，古文箕省。𠔛，亦古文箕。𠔋，亦古文箕。，籀文箕。𠥊，籀文箕。”', '27.5F0F': '《說文》：“式，法也。从工，弋聲。”', '27.65E8': '《說文》：“旨，美也。从甘，匕聲。𣅌，古文旨。”', '27.864D': '《說文》：“虍，虎文也。象形。”', '27.8840': '《說文》：“血，祭所薦牲血也。从皿，一象血形。”', '27.9752': '《說文》：“青，東方色也。木生火，从生丹，丹青之信言象然。𡗡，古文青。”', '27.F10C': '《說文》：“㓝，罰辠也。从井，从刀。《易》曰：‘井，法也。’井亦聲。”', '27.5408': '《說文》：“合，合口也。从亼，从口。”', '27.5009': '《說文》：“倉，穀藏也，倉黃取而藏之，故謂之倉。从食省，口象倉形。仺，奇字倉。”', '27.7F36': '《說文》：“缶，瓦器，所以盛酒漿；秦人鼓之以節謌。象形。”', '27.826F': '《說文》：“良，善也。从畗省，亡聲。”', '27.821B': '《說文》：“舛，對卧也。从夂㐄相背。踳，揚雄說，舛從足春。”', '27.F633': '《說文》：“夅，服也。从夂、𡕒，相承不敢竝也。”', '27.E4DE': '《說文》：“㭁，木也。从木，乃聲。讀若仍。”', '27.673A': '《說文》：“机，木也。从木，几聲。”', '27.6731': '《說文》：“朱，赤心木，松柏屬。从木，一在其中。”', '27.6734': '《說文》：“朴，木皮也。从木，卜聲。”', '27.6735': '《說文》：“朵，樹木垂朵朵也。从木，象形。此與采同意。”', '27.673B': '《說文》：“朻，高木也。从木，丩聲。”', '27.6738': '《說文》：“朸，木之理也。从木，力聲。平原有朸縣。”', '27.686E': '《說文》：“桮，㔶也。从木，否聲。𠤯，籀文桮。”', '27.673E': '《說文》：“朾，橦也。从木，丁聲。”', '27.4F11': '《說文》：“休，息止也。从人依木。庥，休或从广。”', '27.E52D': '《說文》：“㮓，竟也。从木，恆聲。𠄣，古文㮓。”', '27.F11B': '《說文》：“叒，日初出東方湯谷所登榑桑，叒木也。象形……𠭚，籀文。”', '27.56E0': '《說文》：“因，就也。从囗、大。”', '27.E55C': '《說文》：“𨙫，京兆藍田鄉。从邑，口聲。”', '27.9099': '《說文》：“邙，河南洛陽北亡山上邑。从邑，亡聲。”', '27.9098': '《說文》：“邘，周武王子所封，在河內野王是也。从邑，于聲。又讀若區。”', '27.9094': '《說文》：“邔，南陽縣。从邑，己聲。”', '27.909B': '《說文》：“邛，邛地在濟陰縣。从邑，工聲。”', '27.9097': '《說文》：“邗，國也。今屬臨淮。从邑，干聲。一曰邗本屬吳。”', '27.E590': '《說文》：“邖，地名。从邑，山聲。”', '27.65E9': '《說文》：“早，晨也。从日在甲上。”', '27.65ED': '《說文》：“旭，日旦出皃。从日，九聲。若勖。一曰明也。”', '27.F492': '《說文》：“㫐，望遠合也。从日、匕。匕，合也。”', '27.F47B': '《說文》：“㫃，旌旗之游，㫃蹇之皃。从中曲而下，垂㫃。相出入也。讀若偃。古人名㫃字子游。㫃，古文㫃字象形，及象旌旗之游。”', '27.6709': '《說文》：“有，不宜有也。《春秋傳》曰：‘日月有食之。’从月，又聲。”', '27.5919': '《說文》：“𡖊，早敬也。从丮。持事雖夕不休，早敬者也。𠉦，古文夙，从人、𠀬。𠈇，亦古文夙，从人、㐁。宿从此。”', '27.591A': '《說文》：“多，重也。从重夕。夕者，相繹也，故為多。重夕為多，重日為㬪。𡖇，古文多。”', '27.673F': '《說文》：“朿，木芒也。象形。讀若刺。”', '27.5E74': '《說文》：“年，穀孰也。从禾，千聲。”', '27.7C73': '《說文》：“米，粟實也。象禾實之形。”', '27.81FC': '《說文》：“臼，舂也。古者掘地為臼，其後穿木石。象形，中米也。”', '27.5147': '《說文》：“兇，擾恐也，从人在凶下。”', '27.F5BC': '《說文》：“尗，豆也。象尗豆生之形也。”', '27.5B85': '《說文》：“宅，所託也。从宀，乇聲。𡧪，古文宅。㡯，亦古文宅。”', '27.5411': '《說文》：“向，北出牖也。从宀，从口。”', '27.5B87': '《說文》：“宇，屋邊也。从宀，于聲。《易》曰：‘上棟下宇’。㝢，籀文宇从禹。”', '27.5B89': '《說文》：“安，靜也。从女在宀下。”', '27.5BB9': '《說文》：“容，盛也。从宀、谷。㝐，古文容从公。”', '27.5B88': '《說文》：“守，守官也。从宀，从寸。寺府之事者。从寸，寸，法度也。”', '27.E628': '《說文》：“㝌，貧；病也。从宀，久聲。”', '27.7A75': '《說文》：“穵，空大也。从穴，乙聲。”', '27.540C': '《說文》：“同，合會也。从𠔼，从口。”', '27.F04D': '《說文》：“𡉉，幬帳之象。从𠔼，㞢其飾也。”', '27.897E': '《說文》：“襾，覆也。从冂，上下覆之。讀若𣇩。”', '27.E67C': '《說文》：“㠴，枕巾也。从巾，刃聲。”', '27.4F01': '《說文》：“企，舉踵也。从人，止聲。𠈮，古文企从足。”', '27.4F0B': '《說文》：“伋，人名。从人，及聲。”', '27.4F09': '《說文》：“伉，人名。从人，亢聲。《論語》有陳伉。”', '27.4EF2': '《說文》：“仲，中也。从人，从中，中亦聲。”', '27.4F0A': '《說文》：“伊，殷聖人阿衡，尹治天下者。从人，从尹。”', '27.E6A8': '《說文》：“伃，婦官也。从人，予聲。”', '27.4F00': '《說文》：“伀，志及眾也。从人，公聲。”', '27.4EFD': '《說文》：“份，文質僣也。从人，分聲。《論語》曰：‘文質份份。’彬，古文份从彡、林。林者，从焚省聲。”', '27.4EFF': '《說文》：“仿，相似也。从人，方聲。㑂，籀文仿从丙。”', '27.4EF0': '《說文》：“仰，舉也。从人，从卬。”', '27.4F0D': '《說文》：“伍，相參伍也。从人，从五。”', '27.4EFB': '《說文》：“任，符也。从人，壬聲。”', '27.4EF7': '《說文》：“价，善也。从人，介聲。”', '27.4F0E': '《說文》：“伎，與也。从人，支聲。《詩》曰：‘𥷚人伎忒。’”', '27.4F0F': '《說文》：“伏，司也。从人，从犬。”', '27.4F10': '《說文》：“伐，擊也。从人持戈。一曰敗也。”', '27.4EF3': '《說文》：“仳，別也。从人，比聲。”', '27.4EF6': '《說文》：“件，分也。从人，从牛。牛，大物，故可分。”', '27.E6CF': '《說文》：“𢺵，頃也。从匕，支聲。匕，頭頃也。《詩》曰：‘𢺵彼織女。’”', '27.826E': '《說文》：“艮，很也。从匕目。匕目，猶目相匕，不相下也。《易》曰：‘艮其限。匕目為艮，匕目為真也。’”', '27.5E76': '《說文》：“幷，相從也。从从，幵聲。一曰从持二為幷。”', '27.F3AB': '《說文》：“㐺，眾立也。从三人。”', '27.F2DD': '《說文》：“𠂣，歸也。从反身。”', '27.8001': '《說文》：“老，考也。七十曰老。从人、毛、匕。言須髮變白也。”', '27.8003': '《說文》：“考，老也。从老省，丂聲。”', '27.F490': '《說文》：“𡰫，柔皮也，从申尸之後，尸或从又。”', '27.821F': '《說文》：“舟，船也。古者共鼓、貨狄刳木為舟，剡木為楫，以濟不通。象形。”', '27.670D': '《說文》：“服，用也。一曰車右騑，所以舟旋。从舟，𠬝聲。𣍞，古文服，从人。”', '27.F47C': '《說文》：“𠑹，廱蔽也。从人，象左右皆蔽形。楊樹達《積微居小學述林》：“𠑹者，瞽之初字也，字从儿，象左右二目有所蔽而不見形。”', '27.5148': '《說文》：“先，前進也。从儿，从之。”', '27.6B21': '《說文》：“次，不前不精也。从欠，二聲。𦮏，古文次。”', '27.540E': '《說文》：“后，繼體君也。象人之形。施令以告四方，故厂之，从一、口。發號者，君后也。”', '27.E7AA': '《說文》：“𠨒，輔信也。《虞書》曰：‘𠨒成五服。’”', '27.5370': '《說文》：“印，執政所持信也。从爪，从卪。”', '27.F05D': '《說文》：“𢑏，按也。从反‘印’。抑，俗从手。”', '27.8272': '《說文》：“色，顏气也。从人，从卪。𢒸，古文。”', '27.65EC': '《說文》：“旬，徧也。十日為旬。从勹、日。𠣙，古文。”', '27.5308': '《說文》：“匈，聲也。从勹，凶聲。𦙄，匈或从肉。”', '27.F47F': '《說文》：“甶，鬼頭也。象形。”', '27.5C7A': '《說文》：“屺，山無草木也。从山，己聲。”', '27.5C7E': '《說文》：“屾，二山也。”', '27.597F': '《說文》：“奿，闕。”', '27.5371': '《說文》：“危，在高而懼也。从厃，自卪止之。”', '27.800C': '《說文》：“而，頰毛也。象毛之形。《周禮》曰：‘作其鱗之而。’”', '27.8C7B': '《說文》：“豻，胡地野狗。从豸，干聲。犴，豻或从犬。《詩》曰：‘宜犴宜獄。’”', '27.9E97': '《說文》：“麗，旅行也。鹿之性見食急則必旅行。从鹿，丽聲。《禮》‘麗皮納聘’，蓋鹿皮也。𠀙，古文；𠧥，篆文麗字。”', '27.7070': '《說文》：“灰，死火餘㶳也。从火，从又。又，手也。火既滅，可以執持。”', '27.5149': '《說文》：“光，明也。从火在人上，光明意也。𤐥，古文。炗，古文。”', '27.56EA': '《說文》：“囱，在牆曰牖，在屋曰囱。象形。窗，或从穴，𡆧，古文。”', '27.5938': '《說文》：“夸，奢也。从大，于聲。”', '27.5937': '《說文》：“夷，平也。从大，从弓。東方之人也。”', '27.4EA4': '《說文》：“交，交脛也。从大，象交形。”', '27.5C25': '《說文》：“尥，行脛相交也。从尢，勺聲。牛行腳相交為尥。”', '27.E8C6': '《說文》：“㝼，股㝼也。从𡯁，于聲。”', '27.E8F9': '《說文》：“忓，極也。从心，干聲。”', '27.E914': '《說文》：“𢖫，怒也。从心，刀聲。讀若顡。”', '27.E922': '《說文》：“𢖳，憂也。从心，于聲。讀若吁。”', '27.E930': '《說文》：“㣻，懲也。从心，乂聲。”', '27.5FD6': '《說文新附》：“忖，度也。从心，寸聲。”', '27.6C5F': '《說文》：“江，水。出蜀湔氐徼外崏山，入海。从水，工聲。”', '27.6C5D': '《說文》：“汝，水。出弘農盧氏還歸山，東入淮。从水，女聲。”', '27.E939': '《說文》：“㲽，水也。从水，刃聲。”', '27.E93E': '《說文》：“汷，水也。从水，夂聲。夂，古文終。”', '27.E940': '《說文》：“汘，水也。从水，千聲。”', '27.6C4E': '《說文》：“汎，浮皃。从水，凡聲。”', '27.6C4B': '《說文》：“汋，激水聲也。从水，勺聲。井一有水一無水謂之瀱汋。”', '27.6C5C': '《說文》：“汜，水別復入水也。一曰汜，窮瀆也。从水，巳聲。《詩》曰：‘江有汜。’”', '27.6C55': '《說文》：“汕，魚游水皃。从水，山聲。《詩》曰：‘蒸然汕汕’。”', '27.F491': '《說文》：“汓，浮行水上也。从水，从子。古或以汓為没。泅，汓或从囚聲。”', '27.E958': '《說文》：“㲻，沒也。从水，从人。”', '27.6C59': '《說文》：“汙，薉也。一曰小池為汙。一曰涂也。从水，于聲。”', '27.6C4F': '《說文》：“汏，淅㶕也。从水，大聲。”', '27.6C5B': '《說文》：“汛，灑也。从水，卂聲。”', '27.6C57': '《說文》：“汗，人液也。从水，干聲。”', '27.6C4D': '《說文新附》：“汍，泣淚皃。从水，丸聲。”', '27.5DDF': '《說文》：“巟，水廣也。从川，亡聲。”', '27.F07B': '《說文》：“𡿩，水流𡿪𡿪也。从川，列省聲。”', '27.51B0': '《說文》：“冰，水堅也。从仌，从水。凝，俗冰从疑。”', '27.81F3': '《說文》：“至，鳥飛从高下至地也。从一，一猶地也。象形。不，上去。而至，下來也。𦤳，古文至。”', '27.897F': '《說文》：“西，鳥在巢上，象形。日在西方而鳥棲，故因以為東西之西。”', '27.8033': '《說文》：“耳，主聽也。象形。”', '27.625B': '《說文》：“扛，橫關對舉也。从手，工聲。”', '27.EA17': '《說文》：“扟，从上挹也。从手，卂聲。讀若莘。”', '27.6264': '《說文》：“扤，動也。从手，兀聲。”', '27.625A': '《說文》：“扚，疾擊也。从手，勺聲。”', '27.625E': '《說文》：“扞，忮也。从手，干聲。”', '27.625C': '《說文》：“扜，指麾也。从手，于聲。”', '27.6263': '《說文》：“扣，牽馬也。从手，口聲。”', '27.597C': '《說文》：“奼，少女也。”', '27.5981': '《說文》：“妁，酌也。斟酌二姓也。从女，勺聲。”', '27.5983': '《說文》：“妃，匹也。从女，己聲。”', '27.EA3B': '《說文》：“㚤，婦官也。从女，弋聲。”', '27.5980': '《說文》：“妀，女字也。从女，己聲。”', '27.EA41': '《說文》：“𡚮，女字也。从女，久聲。”', '27.597D': '《說文》：“好，美也。从女、子。”', '27.5982': '《說文》：“如，从隨也。从女，从口。”', '27.5984': '《說文》：“妄，亂也。从女，亡聲。”', '27.5978': '《說文》：“奸，犯婬也。从女，从干，干亦聲。”', '27.597B': '《說文》：“奻，訟也。从二女。”', '27.F129': '《說文》：“氒，木本，从氏，大於末。”', '27.620E': '《說文》：“戎，兵也。从戈，从甲。”', '27.620D': '《說文》：“戍，守邊也。从人持戈。”', '27.F557': '《說文》：“𢦒，傷也。从戈，才聲。”', '27.5320': '《說文》：“匠，木工也。从匚，从斤。斤，所以作器也。”', '27.5321': '《說文》：“匡，飲器，筥也。从匚，𡉚聲。筐，匡或从竹。”', '27.66F2': '《說文》：“曲，象器曲受物之形。或說，曲，蠶薄也。，古文曲。”', '27.EAA7': '《說文》：“弙，滿弓有所鄉也。从弓，于聲。”', '27.5F1B': '《說文》：“弛，弓解也。从弓，从也。”', '27.5F48': '《說文》：“彈，行丸也。从弓，單聲。𢎫，或从弓持丸。”', '27.F151': '《說文》：“弜，彊也。从二弓。”', '27.866B': '《說文》：“虫，一名蝮，博三寸，首大如擘指。象其卧形。物之微細，或行，或毛，或蠃，或介，或鱗，以虫為象。”', '27.F603': '《說文》：“亘，求亘也。从二，从囘。囘，古文回，象囘回形。上下，所求物也。”', '27.5730': '《說文》：“地，元气初分，輕、清、陽為天；重、濁、陰為地。萬物所陳列也。从土，也聲。墬，籀文地从䧘。”', '27.572A': '《說文》：“𡉛，牆高也。《詩》曰：‘崇墉𡉛𡉛。’从土，气聲。”', '27.5728': '《說文》：“在，存也。从土，才聲。”', '27.577B': '《說文》：“坻，小渚也。《詩》曰：‘宛在水中坻。’从土，氐聲。汷，坻或从水，从攵。𣹡，坻或从水，从耆。”', '27.572E': '《說文》：“圮，毀也。《虞書》曰：‘方命圮族。’从土，己聲。䤏，圮或从手，从非，配省聲。”', '27.572D': '《說文》：“圭，瑞玉也，上圜下方。公執桓圭，九寸；侯執信圭，伯執躬圭，皆七寸；子執穀璧，男執蒲璧，皆五寸。以封諸侯。从重土。楚爵有執圭。珪，古文圭从玉。”', '27.572F': '《說文》：“圯，東楚謂橋為圯。从土，巳聲。”', '27.52A3': '《說文》：“劣，弱也。从力，少聲。”', '27.52A6': '《說文》：“劦，同力也。从三力。《山海經》曰：‘惟號之山，其風若劦’。”', '27.5354': '《說文》：“協，眾之同和也。从劦，从十。旪，古文協，从曰、十。叶，或从口。”', '27.5E75': '《說文》：“幵，平也。象二干對構，上平也。”', '27.F533': '《說文》：“𠂤，小𨸏也。象形。”', '27.9624': '《說文》：“阤，小崩也。从𨸏，也聲。”', '27.9622': '《說文》：“阢，石山戴土也。从𨸏，从兀，兀亦聲。”', '27.9620': '《說文新附》：“阠，陵名。从𨸏，卂聲。”', '27.9621': '《說文新附》：“阡，路東西為陌，南北為阡。从𨸏，千聲。”', '27.E5AF': '《說文》：“曑，商星也。从晶，㐱聲。參，曑或省。”', '27.6210': '《說文》：“成，就也。从戊，丁聲。𢦩，古文成从午。”', '27.5B57': '《說文》：“字，乳也。从子在宀下，子亦聲。”', '27.5B5F': '《說文》：“孟，長也。从子，皿聲。𣎼，古文孟。”', '27.5B58': '《說文》：“存，恤問也。从子，才聲。”', '27.8FB0': '《說文》：“震也。三月陽气動，雷電振，民農時也。物皆生。从乙、匕，象芒達，厂聲也。辰，房星，天時也。从二。二，古文上字。𠨷，古文辰。”', '27.66F3': '《說文》：“曳，臾曳也。从申，丿聲。”', '27.620C': '《說文》：“戌，滅也。九月陽氣微，萬物畢成，陽下入地也。五行，土生於戊，盛於戌，从戊含一。”', '27.4EA5': '《說文》：“亥，荄也。十月微陽起，接盛陰。从𠄞，𠄞，古文上字，一人男，一人女也。从乙，象褢子咳咳之形。《春秋傳》曰：‘亥有二首六身’。 𢁓，古文。亥為豕，與豕同。亥而生子，復從一起。”', '27.65C1': '《說文》：“旁，溥也。从二，闕，方聲。𣃟，古文㫄；𣃙，亦古文㫄；雱，籀文。”', '27.7392': '《說文》：“玒，玉也。从玉，工聲。”', '27.7396': '《說文》：“玖，石之次玉黑色者。从玉，久聲。《詩》曰：‘貽我佩玖。’讀若芑。或曰若人句脊之句。”', '27.7397': '《說文》：“玗，石之似玉者。从玉，于聲。”', '27.7393': '《說文》：“玓，玓瓅，明珠色。从玉，勺聲。”', '27.7395': '《說文》：“玕，琅玕也。从玉，干聲。《禹貢》：‘雝州，球、琳、琅玕。’ 𤥚，古文玕。”', '27.E044': '《說文新附》：“玘，玉也。从玉，己聲。”', '27.58EF': '《說文》：“壯，大也，从士，爿聲。”', '27.E048': '《說文》：“𣃘，旌旗杠皃。从丨，从㫃。㫃亦聲。”', '27.6BCF': '《說文》：“𡴋，艸盛上出也。从屮，母聲。”', '27.F0EE': '《說文》：“𡵳，艸初生，其香分布。从屮，从分，分亦聲。芬，𡵳或从艸。”', '27.F041': '《說文》：“𡴆，菌𡴆，地蕈，叢生田中。从屮，六聲。𡴫，籀文𡴆，从三𡴆。”', '27.8293': '《說文》：“芓，麻母也。从艸，子聲。一曰芓即枲也。”', '27.828B': '《說文》：“芋，大葉實根，駭人，故謂之芌也。从艸，亏聲。”', '27.E05A': '《說文》：“𦵡，𦵡藭，香草也。从艸，宮聲。芎，司馬相如說：𦵡或从弓。”', '27.8284': '《說文》：“芄，芄蘭，莞也。从艸，丸聲。《詩》曰：‘芄蘭之枝’。”', '27.829E': '《說文》：“芞，芞輿也。从艸，气聲。”', '27.8290': '《說文》：“芐，地黃也。从艸，下聲。《禮記》：‘鈃毛：牛，藿；羊，芐；豕，薇。’是。”', '27.828D': '《說文》：“芍，鳧茈也。从艸，勺聲。”', '27.8292': '《說文》：“芒，艸耑。从艸，亾聲。”', '27.8283': '《說文》：“芃，艸盛也。从艸，凡聲。《詩》曰：‘芃芃黍苗。’”', '27.EE61': '《說文》：“折，斷也。从斤斷艸，譚長說。𣂲，籀文折，从艸在仌中，仌寒，故折。𣂚，篆文折，从手。”', '27.8291': '《說文》：“芑，白苗，嘉穀。从艸，己聲。”', '27.828A': '《說文新附》：“芊，艸盛也。从艸，千聲。”', '27.4F59': '《說文》：“余，語之舒也。从八，舍省聲。𠎳，二余也，讀與余同。”', '27.7261': '《說文》：“牡，畜父也。从牛，土聲。”', '27.7262': '《說文》：“牢，閑，養牛馬圈也。从牛，冬省，取其四周帀也。”', '27.7263': '《說文》：“牣，牣滿也。从牛，刃聲。《詩》曰：‘於牣魚躍。’”', '27.544A': '《說文》：“告，牛觸人，角箸橫木，所以告人也。从口，从牛。《易》曰：‘僮牛之告。’”', '27.543B': '《說文》：“吻，口邊也。从口，勿聲。𦝮，吻或从肉，从昬。”', '27.541E': '《說文》：“吞，咽也。从口，天聲。”', '27.542E': '《說文》：“吮，欶也。从口，允聲。”', '27.542B': '《說文》：“含，嗛也。从口，今聲。”', '27.5438': '《說文》：“吸，內息也。从口，及聲。”', '27.5439': '《說文》：“吹，噓也。从口，从欠。”', '27.543E': '《說文》：“吾，我自稱也。从口，五聲。”', '27.541B': '《說文》：“君，尊也。从尹；發號，故从口。𠱭，古文象君坐形。”', '27.542C': '《說文》：“听，笑皃。从口，斤聲。”', '27.F498': '《說文》：“启，開也。从戶，从口。”', '27.5448': '《說文》：“呈，平也。从口，𡈼聲。”', '27.5468': '《說文》：“周，密也。从用、口。𠄗，古文周字从古文及。”', '27.E0FD': '《說文》：“吺，讘吺，多言也。从口，投省聲。”', '27.541F': '《說文》：“吟，呻也。从口，今聲。䪩，吟或从音。訡，或从言。”', '27.542A': '《說文》：“吪，動也。从口，化聲。”', '27.541D': '《說文》：“吝，恨惜也。从口，文聲。《易》曰：‘以往吝。’呅，古文吝从彣。”', '27.5426': '《說文》：“否，不也。从口，从不，不亦聲。”', '27.F49A': '《說文》：“𠯑，塞口也。从口，氒省聲。𤯁，古文从甘。”', '27.5420': '《說文》：“吠，犬鳴也。从犬、口。”', '27.5C40': '《說文》：“局，促也。从口在尺下，復局之。一曰博所以行棊。象形。”', '27.5440': '《說文新附》：“呀，張口皃。从口，牙聲。”', '27.8D70': '《說文》：“走，趨也。从夭、止，夭止者，屈也。”', '27.8D77': '《說文》：“起，能立也。从走，巳聲。𢀽，古文起，从辵。”', '27.6B65': '《說文》：“步，行也。从止，𣥂相背。”', '27.5DE1': '《說文》：“巡，延行皃。从辵，川聲。”', '27.5F92': '《說文》：“𨑡，步行也。从辵，土聲。”', '27.8FC5': '《說文》：“迅，疾也。从辵，卂聲。”', '27.5F99': '《說文》：“𨑭，迻也。从辵，止聲。𢓊，徙或从彳。𡲴，古文徙。”', '27.8FD4': '《說文》：“返，還也。从辵，从反，反亦聲。《商書》曰：‘祖甲返。’𢓉，《春秋傳》返从彳。”', '27.8FC6': '《說文》：“迆，衺行也。从辵，也聲。”', '27.9054': '《說文》：“達，行不相遇也。从辵，羍聲。《詩》曰：‘挑兮達兮’。达，達或从大。或曰迭。”', '27.E17F': '《說文》：“迀，進也。从辵，干聲。讀若干。”', '27.8FC2': '《說文》：“迂，避也。从辵，于聲。”', '27.8FC4': '《說文新附》：“迄，至也。从辵，气聲。”', '27.5F76': '《說文》：“彶，急行也。从彳，及聲。”', '27.E197': '《說文》：“𢓴，卻也。一曰行遲也。从彳，从日，从夂。”', '27.E19C': '《說文》：“𢓈，行示也。从彳，勻聲。《司馬法》：‘斬以𢓈。’”', '27.5EF7': '《說文》：“廷，朝中也。从廴，𡈼聲。”', '27.F395': '《說文》：“㢟，安步㢟㢟也。从廴，从止。”', '27.8DB3': '《說文》：“足，人之足也，在下。从止、囗。”', '27.F396': '《說文》：“𧮫，口上阿也。从口，上象其理。𠶸，𧮫或如此。臄，或从肉，从豦。”', '27.F397': '《說文》：“㕯，言之訥也。从口，从內。”', '27.8A00': '《說文》：“言，直言曰言，論難曰語。从口，䇂聲。”', '27.5F04': '《說文》：“弄，玩也。从廾持玉。”', '27.F100': '《說文》：“𢌳，持弩拊。从廾，肉聲。”', '27.6212': '《說文》：“戒，警也。从廾持戈，以戒不虞。”', '27.5175': '《說文》：“𠦛，械也。从廾持斤，并力之兒。𠈯，古文兵从人、廾、干。兵，籀文。”', '27.8207': '《說文》：“與，黨與也。从舁，从与。𢌱，古文與。”', '27.F47E': '《說文》：“𦥑，叉手也。从、。”', '27.97AD': '《說文》：“鞭，驅也。从革，便聲。𠓥，古文鞭。”', '27.5B5A': '《說文》：“孚，卵孚也。从爪，从子。一曰信也。𤓽，古文孚从𣎼，𣎼，古文𠈃。”', '27.E282': '《說文》：“𢦚，擊踝也。从丮，从戈。讀若踝。”', '27.F39D': '《說文》：“㼱，柔韋也。从北，从皮省，从敻省。讀若耎。一曰若嶲。𡰺，古文㼱；𤭀，籀文㼱从敻省。”', '27.E2B7': '《說文》：“𢻫，𢾭也。从攴，也聲。讀與施同。”', '27.5B5C': '《說文》：“孜，汲汲也。从攴，子聲。《周書》曰：‘孜孜無怠。’”', '27.6539': '《說文》：“改，更也。从攴、己。”', '27.66F4': '《說文》：“㪅，改也。从攴，丙聲。”', '27.6538': '《說文》：“攸，行水也，从攴，从人，水省。𣲏，秦刻石繹山文攸字如此。”', '27.E2C1': '《說文》：“𢻬，撫也。从攴，亡聲。讀與撫同。”', '27.653B': '《說文》：“攻，擊也。从攴，工聲。”', '27.E2D0': '《說文》：“攺，㱾攺。大剛卯，以逐鬼鬽也。从攴，巳聲。”', '27.E2D9': '《說文》：“𠧙，卜問也。从卜，召聲。”', '27.752B': '《說文》：“甫，男子美稱也。从用、父，父亦聲。”', '27.F125': '《說文》：“䀏，目搖也。从目，勻省聲。眴，䀏或从旬。”', '27.E305': '《說文》：“䀺，眣也。从目，攸聲。𥃧，䀺或从丩。”', '27.E32F': '《說文》：“芇，相當也。闕，讀若宀。”', '27.F39F': '《說文》：“𠦒，箕屬，所以推棄之器也。象形。”', '27.68C4': '《說文》：“棄，捐也。从廾推𠦒棄之，从𠫓，𠫓，逆子也。弃，古文棄。”', '27.F11F': '《說文》：“寽，五指持也。从𠬪，一聲。”', '27.F65F': '《說文》：“𣦼，殘穿也。从又，从歺。讀若殘。”', '27.5225': '《說文》：“𠛰，分解也。从冎，从刀。”', '27.8093': '《說文》：“肓，心上鬲下也。从肉，亡聲。《春秋傳》曰：‘病在肓之下。’”', '27.809D': '《說文》：“肝，木藏也。从肉，干聲。”', '27.8098': '《說文》：“肘，臂節也。从肉，从寸。寸，手寸口也。”', '27.8096': '《說文》：“肖，骨肉相似也。从肉，小聲。不似其先故曰不肖也。”', '27.8092': '《說文》：“肒，搔生創也。从肉，丸聲。”', '27.8099': '《說文》：“肙，小蟲也。从肉，口聲。一曰空也。”', '27.E3BA': '《說文》：“𥭖，手足指節鳴也。从筋省，勺聲。肑，𥭖或省竹。”', '27.E3BF': '《說文》：“𠛎，鎌也。从刀，句聲。”', '27.5229': '《說文》：“利，銛也。从刀；和然後利，从和省。《易》曰：‘利者，義之和也。’”', '27.525B': '《說文》：“剛，彊，斷也。从刀，岡聲。”', '27.5224': '《說文》：“判，分也。从刀，半聲。”', '27.522A': '《說文》：“刪，剟也。从刀、冊。冊，書也。”', '27.521C': '《說文》：“刜，擊也。从刀，弗聲。”', '27.5236': '《說文》：“制，裁也。从刀，从未。未，物成，有滋味，可裁斷。一曰止也。𠝁，古文制如此。”', '27.E3CB': '《說文》：“㓠，缺也。从刀，占聲。”', '27.89D2': '《說文》：“角，獸角也。象形，角與刀魚相似。”', '27.E41B': '《說文》：“䢋，古之遒人以木鐸記詩言。从辵，从丌，丌亦聲。讀與記同。”', '27.5DEB': '《說文》：“巫，祝也。女能事無形，以舞降神者也。象人兩褎舞形，與工同意。古者巫咸初作巫。𢍮，古文巫。”', '27.751A': '《說文》：“甚，尤安樂也。从甘，从匹。耦也。𠯕，古文甚。”', '27.66F6': '《說文》：“曶，出气詞也。从曰，象气出形。《春秋傳》曰：‘鄭太子曶。’ ，籀文曶。一曰佩也。象形。”', '27.EE05': '《說文》：“𠧟，驚聲也。从乃省，西聲。籀文𠧟，不省。或曰：𠧟，往也。讀若仍。𠨅，古文𠧟。”', '27.7539': '《說文》：“甹，亟詞也。从丂，从由。或曰：甹，俠也。（三輔）謂輕財者為甹。”', '27.8C46': '《說文》：“豆，古食肉器也。从口，象形。𣅣，古文豆。”', '27.5F64': '《說文》：“彤，丹飾也。从丹，从彡。彡其畫也。”', '27.9631': '《說文》：“阱，陷也。从𨸏，从井，井亦聲。穽，阱或从穴。汬，古文阱从水。”', '27.F499': '《說文》：“皀，穀之馨香也。象嘉穀在裹中之形，匕所以扱之。或說，皀，一粒也。又讀若香。”', '27.5373': '《說文》：“卽，即食也。从皀，卪聲。”', '27.4FAF': '《說文》：“矦，春饗所䠶矦也。从人，从厂，象張布，矢在其下。”', '27.77E3': '《說文》：“矣，語已詞也。从矢，以聲。”', '27.F480': '《說文》：“亯，獻也。从高省。曰：象進孰物形。《孝經》曰：‘祭則鬼亯之。’享，篆文亯。”', '27.F638': '《說文》：“夋，行夋夋也。一曰倨也。从夂，允聲。”', '27.E4C6': '《說文》：“𡕗，相遮要害也。从夂，丯聲。南陽新野有𡕗亭。”', '27.5906': '《說文》：“夆，牾也。从夊，𡴀聲。讀若縫。”', '27.674F': '《說文》：“杏，果也。从木，可省聲。”', '27.674E': '《說文》：“李，果也。从木，子聲。杍，古文。”', '27.675C': '《說文》：“杜，甘棠也。从木，土聲。”', '27.6759': '《說文》：“杙，劉，劉杙。从木，弋聲。”', '27.675E': '《說文》：“杞，枸杞也。从木，己聲。”', '27.E4EC': '《說文》：“杒，桎杒也。从木，刃聲。”', '27.6748': '《說文》：“杈，枝也。从木，叉聲。”', '27.E4FB': '《說文》：“㭂，相高也。从木，小聲。”', '27.6755': '《說文》：“杕，樹皃。从木，大聲。《詩》曰：‘有杕之杜。’”', '27.6750': '《說文》：“材，木梃也。从木，才聲。”', '27.6757': '《說文》：“杗，棟也。从木，亡聲。”', '27.6747': '《說文》：“杇，所以涂也。秦謂之杇，關東謂之槾。从木，亏聲。”', '27.675D': '《說文》：“杝，落也。从木，也聲。讀若他。”', '27.6760': '《說文》：“杠，牀前橫木也。从木，工聲。”', '27.675A': '《說文》：“𣏙，平也。从木，气聲。”', '27.6753': '《說文》：“杓，枓柄也。从木，从勺。”', '27.6756': '《說文》：“杖，持也。从木，丈聲。”', '27.EEE1': '《說文》：“杘，籆柄也。从木，尸聲。柅，杘或从木，尼聲。”', '27.F496': '《說文》：“𡉚，艸木妄生也。从之在土上。”', '27.5B5B': '《說文》：“孛，𢍚也，从𣎵；人色也，从子。《論語》曰：‘色孛如也’。”', '27.F484': '《說文》：“𠂹，艸木華葉。𠂹，象形。𠣔，古文。”', '27.675F': '《說文》：“束，縛也。从囗、木。”', '27.E544': '《說文》：“囩，回也。从囗，云聲。”', '27.56F0': '《說文》：“困，故廬也。从木在囗中。𣏔，古文困。”', '27.56EE': '《說文》：“囮，譯也，从囗化聲。率鳥者繫生鳥以來之，名曰囮。讀若譌。囮，或从繇。”', '27.8C9D': '《說文》：“貝，海介蟲也。居陸名猋，在水名蜬。象形。古者貨貝而寶龜，周而有泉，至秦廢貝行錢。”', '27.8CA7': '《說文》：“貧，財分少也。从貝，从分，分亦聲。𡧋，古文从宀、分。”', '27.9091': '《說文》：“邑，國也。从口。先王之制，尊卑有大小，从卪。”', '27.90A6': '《說文》：“邦，國也。从邑，丰聲。𤰫，古文。”', '27.E556': '《說文》：“𨙸，周文王所封，在右扶風美陽中水鄉。从邑，支聲。岐，𨙸或从山，支聲。因岐山以名之也。㟚，古文𨙸从枝，从山。”', '27.90A0': '《說文》：“邠，周太王國。在右扶風美陽。从邑，分聲。豳，美陽亭即豳也。民俗以夜市有豳山。从山、从豩。闕。”', '27.90A2': '《說文》：“邢，周公子所封，地近河內懷。从邑，幵聲。”', '27.E566': '《說文》：“𨙷，鄭地𨙷亭。从邑，井聲。”', '27.909F': '《說文》：“邟，潁川縣。从邑，亢聲。”', '27.90E2': '《說文》：“郢，故楚都。在南郡江陵北十里。从邑，呈聲。𨙼，郢或省。”', '27.90A1': '《說文》：“邡，什邡，廣漢縣。从邑，方聲。”', '27.90A3': '《說文》：“𨙻，西夷國。从邑，冄聲。安定有朝𨙻縣。”', '27.E576': '《說文》：“𨙶，沛郡。从邑，市聲。”', '27.E578': '《說文》：“𨙹，地名。从邑，少聲。”', '27.90A7': '《說文》：“邧，鄭邑也。从邑，元聲。”', '27.90AA': '《說文》：“邪，琅邪郡。从邑，牙聲。”', '27.909E': '《說文》：“邞，琅邪縣。一名純德。从邑，夫聲。”', '27.E583': '《說文》：“𨙺，地名。从邑，丑聲。”', '27.E58A': '《說文》：“邩，地名。从邑，火聲。”', '27.E58B': '《說文》：“邨，地名。从邑，屯聲。”', '27.F3B5': '《說文》：“𨙨，从反邑。𨛜字从此。闕。”', '27.65F3': '《說文》：“旳，明也。从日，勺聲。《易》曰：‘為的顙。’”', '27.65F0': '《說文》：“旰，晚也。从日，干聲。”', '27.65F1': '《說文》：“旱，不雨也。从日，干聲。”', '27.660C': '《說文》：“昌，美言也。从日，从曰。一曰日光也。《詩》曰：‘東方昌矣。’𣅊，籀文昌。”', '27.671F': '《說文》：“期，會也。从月，其聲。𣅆，古文期，从日、丌。”', '27.56E7': '《說文》：“囧，窗牖麗廔闓明。象形。讀若獷。賈侍中說讀與明同。”', '27.E5C0': '《說文》：“㽕，木生條也。从𢎘，由聲。《商書》曰：‘若顛木之有㽕枿。’古文言‘由枿。’”', '27.752C': '《說文》：“甬，艸木華甬甬然也。从𢎘，用聲。”', '27.514B': '《說文》：“克，肩也。象屋下刻木之形。𡱀，古文克。𠧹，亦古文克。”', '27.79C0': '《說文》：“秀，上諱。”', '27.79C1': '《說文》：“私，禾也。从禾，厶聲。北道名禾主人曰私主人。”', '27.5B8F': '《說文》：“宏，屋深響也，从宀，厷聲。”', '27.5B8C': '《說文》：“完，全也。从宀，元聲。古文以為寬字。”', '27.F116': '《說文》：“𡧍，冥合也。从宀，丏聲。”', '27.5B8B': '《說文》：“宋，居也。从宀，从木。”', '27.5442': '《說文》：“呂，脊骨也。象形。昔太嶽為禹心呂之臣，故封呂侯。膂，篆文呂，从肉，从旅。”', '27.7A76': '《說文》：“究，窮也。从穴，九聲。”', '27.E644': '《說文》：“㽱，腹中急也。从疒，丩聲。”', '27.7595': '《說文》：“疕，頭瘍也。从疒，匕聲。”', '27.E64E': '《說文》：“𤴨，顫也。从疒，又聲。”', '27.F497': '《說文》：“㒳，再也。《易》曰：‘參天㒳地。’”', '27.7F55': '《說文》：“䍑，网也。从网，干聲。”', '27.E67A': '《說文》：“𢁥，楚謂大巾曰𢁥。从巾，分聲。”', '27.E695': '《說文》：“㠷，蒲席𤲑也。从巾，及聲。”', '27.5E0A': '《說文新附》：“帊，帛三幅曰帊。从巾，巴聲。”', '27.F5BF': '《說文》：“㡀，敗衣也。从巾，象衣敗之形。”', '27.4F2F': '《說文》：“伯，長也。从人，白聲。”', '27.4F56': '《說文》：“佖，威儀也。从人，必聲。”', '27.4F34': '《說文》：“伴，大皃。从人，半聲。”', '27.4F3E': '《說文》：“伾，有力也。从人，丕聲。”', '27.4F5B': '《說文》：“佛，見不審也。从人，弗聲。”', '27.4F57': '《說文》：“佗，負何也。从人，它聲。”', '27.4F55': '《說文》：“何，儋也。从人，可聲。”', '27.4F4D': '《說文》：“位，列中庭之左右謂之位。从人、立。”', '27.4F5C': '《說文》：“作，起也。从人，从乍。”', '27.4F3C': '《說文》：“似，象也。从人，㠯聲。”', '27.4F36': '《說文》：“伶，弄也。从人，令聲。益州有建伶縣。”', '27.4F38': '《說文》：“伸，屈伸。从人，申聲。”', '27.E6BB': '《說文》：“伹，拙也。从人，且聲。”', '27.4F43': '《說文》：“佃，中也。从人，田聲。《春秋傳》曰：‘乘中佃，一轅車。’”', '27.4F2D': '《說文》：“伭，很也。从人，弦省聲。”', '27.4F41': '《說文》：“佁，癡皃。从人，台聲。讀若騃。”', '27.4F3F': '《說文》：“伿，隋也。从人，只聲。”', '27.4F5D': '《說文》：“佝，務也。从人，句聲。”', '27.4F5A': '《說文》：“佚，佚民也。从人，失聲。一曰：佚，忽也。”', '27.4FAE': '《說文》：“侮，傷也。从人，每聲。㑄，古文从母。”', '27.4F46': '《說文》：“但，裼也。从人，旦聲。”', '27.E6CA': '《說文》：“佋，廟佋穆，父為佋，南面；子為穆，北面。从人，召聲。”', '27.4F4E': '《說文新附》：“低，下也。从人、氐，氐亦聲。”', '27.4F3A': '《說文新附》：“伺，𠊱望也。从人，司聲。”', '27.4F47': '《說文新附》：“佇，久立也。从人，从宁。”', '27.8EAB': '《說文》：“身，躳也。象人之身。从人，𠂆聲。”', '27.88D8': '《說文》：“裘，皮衣也。从衣，求聲。一曰象形，與衰同意。求，古文省衣。”', '27.5B5D': '《說文》：“孝，善事父母者。从老省，从子，子承老也。”', '27.5C3E': '《說文》：“尾，微也。从到毛在尸後。古人或飾系尾，西南夷亦然。”', '27.5C3F': '《說文》：“尿，人小便也。从尾，从水。”', '27.514C': '《說文》：“兌，說也。从儿，㕣聲。”', '27.F655': '《說文》：“皃，頌儀也。从人，白象人面形。䫉，皃或从頁，豹省聲。貌，籀文皃，从豹省。”', '27.79BF': '《說文》：“禿，無髮也。从人，上象禾粟之形，取其聲。王育說，蒼頡出見禿人伏禾中，因以制字。未知其審。”', '27.898B': '《說文》：“見，視也。从儿，从目。”', '27.E732': '《說文》：“弞，笑不壞顏曰弞。从欠，引省聲。”', '27.6B60': '《說文》：“歠，㱃也。从㱃省，叕聲。吷，歠或从口从夬。”', '27.F62C': '《說文》：“㳄，慕欲口液也。从欠，从水。”', '27.5F62': '《說文》：“形，象形也。从彡，幵聲。”', '27.F3AE': '《說文》：“彣，㦽也。从彡，从文。”', '27.E7AC': '《說文》：“𠨘，宰之也。从卪，必聲。”', '27.5372': '《說文》：“卲，高也。从卪，召聲。”', '27.5DBD': '《說文》：“嶽，東岱、南靃、西華、北恒、中泰室，王者之所以巡狩所至。从山，獄聲。岳，古文象高形。”', '27.5C91': '《說文》：“岑，山小而高。从山，今聲。”', '27.5C8C': '《說文新附》：“岌，山高皃。从山，及聲。”', '27.5E89': '《說文》：“庉，樓牆也。从广，屯聲。”', '27.5E8C': '《說文》：“庌，廡也。从广，牙聲。《周禮》曰：‘夏庌馬。’”', '27.5E8F': '《說文》：“序，東西牆也。从广，予聲。”', '27.E7DB': '《說文》：“㡲，屋牝瓦下。一曰維綱也。从广，𨳮省聲。”', '27.5E87': '《說文》：“庇，蔭也。从广，比聲。”', '27.538E': '《說文》：“厎，柔石也。从厂，氐聲。砥，厎或从石。”', '27.E7E9': '《說文》：“㕆，美石也。从厂，古聲。”', '27.E7EA': '《說文》：“㕇，石聲也。从厂，立聲。”', '27.F0B8': '《說文》：“𢑓，豕也。从彑，下象其足。讀若瑕。”', '27.8C78': '《說文》：“豸，獸長脊，行豸豸然，欲有所司殺形。”', '27.5C28': '《說文》：“尨，犬之多毛者。从犬，从彡。”', '27.F33C': '《說文》：“㹞，犬吠聲。从犬，斤聲。”', '27.72C3': '《說文》：“狃，犬性驕也。从犬，丑聲。”', '27.72BA': '《說文》：“犺，健犬也。从犬，亢聲。”', '27.E85F': '《說文》：“犻，過弗取也。从犬，市聲。讀若孛。”', '27.72C2': '《說文》：“狂，狾犬也。从犬，㞷聲。忹，古文从心。”', '27.72C4': '《說文》：“狄，赤狄，本犬種。狄之為言淫辟也。从犬，亦省聲。”', '27.F106': '《說文》：“㹜，兩犬相齧也。从二犬。”', '27.F0BB': '《說文》：“㶣，小熱也。从火，干聲。《詩》曰：‘憂心㶣㶣。’”', '27.7078': '《說文》：“灸，灼也。从火，久聲。”', '27.707C': '《說文》：“灼，炙也。从火，勺聲。”', '27.707A': '《說文》：“灺，燭㶳也。从火，也聲。”', '27.F108': '《說文》：“烖，天火曰烖。从火，𢦏聲。灾，或从宀、火；𤆎，古文从才；災，籀文从𡿧。”', '27.8D64': '《說文》：“赤，南方色也。从大、从火。烾，古文从炎、土。”', '27.593E': '《說文》：“夾，持也。从大，俠二人。”', '27.E8B7': '《說文》：“夽，大也。从大，云聲。”', '27.E8B9': '《說文》：“𡗦，大也。从大，介聲。”', '27.E8BC': '《說文》：“𡗥，大也。从大，屯聲。”', '27.F681': '《說文》：“㚒，盗竊褱物也。从亦，有所持。俗謂蔽人俾㚒是也。弘農㚒陝字从此。”', '27.5433': '《說文》：“吳，姓也，亦郡也。一曰吳，大言也。从夨、口。𡗾，古文如此。”', '27.5C2C': '《說文》：“𡰉𡯗也，从尣介聲。”', '27.5FD7': '《說文》：“志，意也。从心，之聲。”', '27.5FEB': '《說文》：“快，喜也。从心，夬聲。”', '27.5FFB': '《說文》：“忻，闓也。从心，斤聲。《司馬法》曰：‘善者，忻民之善，閉民之惡。’”', '27.E8E4': '《說文》：“忼，慨也。从心，亢聲。一曰，《易》：‘忼龍有悔。’”', '27.6055': '《說文》：“恕，仁也。从心，如聲。㣽，古文省。”', '27.5FEF': '《說文》：“忯，愛也。从心，氏聲。”', '27.5FF1': '《說文》：“忱，誠也。从心，冘聲。《詩》曰：‘天命匪忱’。”', '27.5FD2': '《說文》：“忒，更也。从心，弋聲。”', '27.5FEE': '《說文》：“忮，很也。从心，支聲。”', '27.5FD8': '《說文》：“忘，不識也。从心，从亡，亡亦聲。”', '27.5FE8': '《說文》：“忨，貪也。从心，元聲。《春秋傳》：‘忨歲而㵣日。’”', '27.5FCC': '《說文》：“忌，憎惡也。从心，己聲。”', '27.E913': '《說文》：“㤄，恨怒也。从心，巿聲。《詩》曰：‘視我㤄㤄。’”', '27.E91A': '《說文》：“忧，不動也。从心，尤聲。讀若祐。”', '27.E91D': '《說文》：“忦，憂也。从心，介聲。”', '27.5FE1': '《說文》：“忡，憂也。从心，中聲。《詩》曰：‘憂心忡忡。’”', '27.6050': '《說文》：“恐，懼也。从心，巩聲。𢖶，古文。”', '27.5FCD': '《說文》：“忍，能也。从心，刃聲。”', '27.6C85': '《說文》：“沅，水。出牂牁故且蘭，東北入江。从水，元聲。”', '27.6C94': '《說文》：“沔，水。出武都沮縣東狼谷，東南入江。或曰入夏水。从水，丏聲。”', '27.6C67': '《說文》：“汧，水。出扶風汧縣西北，入渭。从水，幵聲。”', '27.6C7E': '《說文》：“汾，水。出太原晉陽山，西南入河。从水，分聲。或曰出汾陽北山，冀州浸。”', '27.6C81': '《說文》：“沁，水。出上黨羊頭山，東南入河。从水，心聲。”', '27.6C87': '《說文》：“沇，水。出河東東垣王屋山，東為泲。从水，允聲。沿，古文沇。”', '27.6C68': '《說文》：“汨，長沙汨羅淵，屈原所沈之水。从水，冥省聲。”', '27.6C73': '《說文》：“汳，水。受陳畱浚儀陰溝，至蒙為雝水，東入于泗。”', '27.6C82': '《說文》：“沂，水。出東海費東，西入泗。从水，斤聲。一曰沂水出泰山蓋，青州浸。”', '27.6C76': '《說文》：“汶，水。出琅邪朱虛東泰山，東入濰。从水，文聲。桑欽說，汶水出泰山萊蕪，西南入泲。”', '27.6C9B': '《說文》：“沛，水。出遼東番汗塞外，西南入海。从水，市聲。”', '27.6C8B': '《說文》：“沋，水也。从水，尤聲。”', '27.6C6D': '《說文》：“汭，水相入也。从水，从內，內亦聲。”', '27.6C6A': '《說文》：“汪，深廣也。从水，𡉚聲。一曰汪，池也。”', '27.6C96': '《說文》：“沖，涌搖也。从水、中。讀若動。”', '27.6C84': '《說文》：“沄，轉流也。从水，云聲。讀若混。”', '27.6C86': '《說文》：“沆，莽沆，大水也。从水，亢聲。一曰大澤皃。”', '27.6DF5': '《說文》：“淵，回水也。从水，象形，左右岸也，中象水皃。𣶒，淵或省水。囦，古文从囗、水。”', '27.6C99': '《說文》：“沙，水𢿨石也。从水，从少，水少沙見。楚東有沙水。譚長說，沙，或从尐。”', '27.6C7B': '《說文》：“汻，水厓也。从水，午聲。”', '27.6C9A': '《說文》：“沚，小渚曰沚。从水，止聲。《詩》曰：‘于沼于沚。’”', '27.6C65': '《說文》：“汥，水都也。从水，支聲。”', '27.6C7A': '《說文》：“決，行流也。从水，从夬。廬江有決水，出於大別山。”', '27.6C83': '《說文》：“𣵽，溉灌也。从水，芺聲。”', '27.6DE6': '《說文》：“淦，水入船中也。一曰泥也。从水，金聲。汵，淦或从今。”', '27.6C92': '《說文》：“沒，沈也。从水，从𠬸。”', '27.6C88': '《說文》：“沈，陵上滈水也。从水，冘聲。一曰濁黕也。”', '27.6C66': '《說文》：“汦，著止也。从水，氏聲。”', '27.6C7D': '《說文》：“汽，水涸也。或曰泣下。从水，气聲。《詩》曰：‘汽可小康。’”', '27.E961': '《說文》：“沑，水吏也。又溫也。从水，丑聲。”', '27.6C90': '《說文》：“沐，濯髮也。从水，木聲。”', '27.6C72': '《說文》：“汲，引水於井也。从水，从及，及亦聲。”', '27.6C69': '《說文》：“汩，治水也。从水，曰聲。”', '27.5DE0': '《說文》：“巠，水脈也。从川在一下，一，地也。𡈼省聲。一曰水冥巠也。𡿱，古文巠不省。”', '27.F091': '《說文》：“𡿯，水流也。从川，曰聲。”', '27.8C37': '《說文》：“谷，泉出通川為谷。从水半見，出於口。”', '27.51B6': '《說文》：“冶，銷也。从仌，台聲。”', '27.51B7': '《說文》：“冷，寒也。从仌。令聲。”', '27.51B9': '《說文》：“冹，一之日㓖冹。从仌，犮聲。”', '27.E9DA': '《說文》：“戻，輜車旁推戶也。从戶，大聲。讀與釱同。”', '27.8034': '《說文》：“耴，耳垂也。从耳下垂，象形。《春秋傳》曰：‘秦公子輒者，其耳下垂，故以為名。’”', '27.F68D': '《說文》：“𦣞，𩔞也。象形。頤，篆文𦣞。𩠡，籀文从首。”', '27.F0A4': '《說文》：“巸，廣𦣞也。从𦣞，巳聲。戺，古文巸。从戶。”', '27.6276': '《說文》：“扶，左也。从手，夫聲。𢻳，古文扶。”', '27.62A9': '《說文》：“𢪈，并持也。从手，冄聲。”', '27.628A': '《說文》：“把，握也。从手，把聲。”', '27.6439': '《說文》：“搹，把也。从手，鬲聲。㧖，搹或从戹。”', '27.EA0B': '《說文》：“㧊，㨷也。从手，巿聲。”', '27.64AB': '《說文》：“撫，安也。从手，無聲。一曰循也。𨑟，古文从辵、亡。”', '27.6295': '《說文》：“投，擿也。从手，从殳。”', '27.6274': '《說文》：“扴，刮也。从手，介聲。”', '27.6289': '《說文》：“抉，挑也。从手，夬聲。”', '27.628E': '《說文》：“抎，有所失也。《春秋傳》曰：‘抎子辱矣。’从手，云聲。”', '27.EA16': '《說文》：“抍，上舉也。从手，升聲。《易》曰：‘抍馬壯吉。’撜，抍或從登。”', '27.626E': '《說文》：“扮，握也。从手，分聲。讀若粉。”', '27.6292': '《說文》：“抒，挹也。从手，予聲。”', '27.6280': '《說文》：“技，巧也。从手，支聲。”', '27.6288': '《說文》：“抈，折也。从手，月聲。”', '27.6271': '《說文》：“扱，收也。从手，及聲。”', '27.627A': '《說文》：“扺，側擊也。从手，氏聲。”', '27.628C': '《說文》：“抌，深擊也。从手，冘聲。讀若告。言不正曰抌。”', '27.6297': '《說文》：“抗，扞也。从手，亢聲。杭，抗或从木。”', '27.5998': '《說文》：“妘，祝融之後，姓也。从女，云聲。𪔈，籀文妘从員。”', '27.EA30': '《說文》：“𡚽，人姓也。从女，丑聲。《商書》曰：‘無有作𡚽’。”', '27.598A': '《說文》：“妊，孕也。从女，从壬，壬亦聲。”', '27.59FC': '《說文》：“姼，美女也。从女，多聲。𡚼，姼或从氏。”', '27.EA46': '《說文》：“𡚾，好也。从女，殳聲。《詩》曰：‘靜女其𡚾。’”', '27.59CC': '《說文》：“㚩，弱長皃。从女，冄聲。”', '27.EA4A': '《說文》：“㛂，婐㛂也。一曰弱也。从女，𠂬聲。”', '27.5997': '《說文》：“妗，𡝫妗也。一曰，善笑皃。从女，今聲。”', '27.EA4E': '《說文》：“妌，靜也。从女，井聲。”', '27.F684': '《說文》：“妟，安也。从女、日。《詩》曰：‘以妟父母。’”', '27.5993': '《說文》：“妓，婦人小物也。从女，支聲。讀若跂行。”', '27.599D': '《說文》：“妝，飾也。从女，牀省聲。”', '27.598E': '《說文》：“妎，妒也。从女，介聲。”', '27.5992': '《說文》：“妒，婦妒夫也。从女，戶聲。”', '27.EA5F': '《說文》：“𡝩，巧也。一曰女子笑皃。《詩》曰：‘桃之𡝩𡝩。’从女，芺聲。”', '27.4F5E': '《說文》：“佞，巧讇高材也。从女，信省。”', '27.59A8': '《說文》：“妨，害也。从女，方聲。”', '27.598D': '《說文》：“妍，技也。一曰不省錄事。一曰難侵也。一曰惠也。一曰安也。从女，幵聲。讀若研。”', '27.EA69': '《說文》：“妜，鼻目閒皃。讀若煙火炔炔。从女，決省聲。”', '27.6BD0': '《說文》：“毐，人無行也。从士，从母。賈侍中說。秦始皇母與嫪毐淫，坐誅，故世罵淫曰嫪毐。讀若娭。”', '27.6211': '《說文》：“我，施身自謂也。或說我，頃頓也。从戈，从𠄒。𠄒，或說古垂字。一曰古殺字。𢦠，古文我。”', '27.F07C': '《說文》：“㔷，側逃也。从匸，丙聲。一曰箕屬。”', '27.F5E8': '《說文》：“医，盛弓弩矢器也。从匸，从矢。”', '27.5323': '《說文》：“匣，匱也。从匚，甲聲。”', '27.5F26': '《說文》：“弦，弓弦也，从弓，象絲軫之形。”', '27.7CFB': '《說文》：“系，繫也。从糸，丿聲。𣫦，系或从𣪠、處。𦃟，籀文系从爪、絲。”', '27.7DB1': '《說文》：“綱，維紘繩也。从糸，岡聲。㭃，古文綱。”', '27.98A8': '《說文》：“風，八風也。東方曰明庶風；東南曰清明風；南方曰景風；西南曰涼風；西方曰閶闔風；西北曰不周風；北方曰廣莫風；東北曰融風。風動蟲生，故蟲八日而化。从虫，凡聲。凬，古文風。”', '27.5375': '《說文》：“卵，凡物無乳者卵生。象形。”', '27.5747': '《說文》：“均，平，徧也。从土，从勻，勻亦聲。”', '27.EB56': '《說文》：“坄，陶竈䆫也。从土，役省聲。”', '27.F048': '《說文》：“𡊎，止也。从土，从留省，土，所止也。此與留同意。坐，古文坐。”', '27.5741': '《說文》：“坁，箸也。从土，氏聲。”', '27.5752': '《說文》：“坒，地相次比也。衛大夫貞子名坒。从土，比聲。”', '27.574E': '《說文》：“坎，陷也。从土，欠聲。”', '27.57A0': '《說文》：“垠，地垠也。一曰岸也。从土，艮聲。圻，垠或从斤。”', '27.574B': '《說文》：“坋，塵也。从土，分聲。一曰大防也。”', '27.574F': '《說文》：“坏，丘再成者也。一曰瓦未燒。从土，不聲。”', '27.574A': '《說文新附》：“坊，邑里之名。从土，方聲。古通用埅。”', '27.91CC': '《說文》：“里，居也。从田，从土。”', '27.753A': '《說文》：“町，田踐處曰町。从田，丁聲。”', '27.7538': '《說文》：“甸，天子五百里地。从田，包省。”', '27.7537': '《說文》：“男，丈夫也。从田，从力，言男用力於田也。”', '27.52A9': '《說文》：“助，左也。从力，且聲。”', '27.52AD': '《說文》：“劭，勉也。从力，召聲。”', '27.52AB': '《說文》：“劫，人欲去以力脅止曰劫。或曰：以力止去曰劫。”', '27.52AC': '《說文新附》：“劬，勞也。从力，句聲。”', '27.8ECA': '《說文》：“車，輿輪之總名。夏后時奚仲所造。象形。𨏖，籀文車。”', '27.962A': '《說文》：“阪，坡者曰阪。一曰澤障。一曰山脅也。从𨸏，反聲。”', '27.962D': '《說文》：“阭，高也。一曰石也。从𨸏，允聲。”', '27.962C': '《說文》：“阬，門也。从𨸏，亢聲。”', '27.9632': '《說文》：“防，隄也。从𨸏，方聲。埅，防或从土。”', '27.962F': '《說文》：“阯，基也。从𨸏，止聲。址，阯或从土。”', '27.962E': '《說文》：“阮，代郡五阮關也。从𨸏，元聲。”', '27.8F9B': '《說文》：“辛，秋時萬物成而孰。金剛味辛，辛痛即泣出。从一，从䇂。䇂，辠也。辛承庚，象人股。”', '27.F0D4': '《說文》：“𡥈，放也。从子，爻聲。”', '27.80B2': '《說文》：“育，養子使作善也。从𠫓，肉聲。《虞書》曰：‘教育子。’毓，育或从每。”', '27.9149': '《說文》：“酉，就也。八月黍成，可為酎酒。象古文酉之形。丣，古文酉，从卯。卯為春門，萬物已出。酉為秋門，萬物已入。一，閉門象也。”', '27.5E1D': '《說文》：“帝，諦也。王天下之號也。从丄，朿聲。𢂇，古文帝。古文諸丄字皆从一，篆文皆从𠄞，𠄞，古文上字。”', '27.7940': '《說文》：“祀，祭無已也。从示，巳聲。禩，祀或从異。”', '27.793F': '《說文》：“礿，夏祭也。从示，勺聲。”', '27.793E': '《說文》：“社，地主也。从示、土。《春秋傳》曰：‘共工之子句龍為社神。’《周禮》：‘二十五家為社，各樹其土所宜之木。’𥙭，古文社。”', '27.73A0': '《說文》：“玠，大圭也。从玉，介聲。《周書》曰：‘稱奉介圭。’”', '27.73A6': '《說文》：“玦，玉佩也。从玉，夬聲。”', '27.748A': '《說文》：“璊，玉䞓色也。从玉，㒼聲。禾之赤苗謂之虋，言璊玉色如之。玧，璊或从允。”', '27.73A9': '《說文》：“玩，弄也。从玉，元聲。貦，玩或从貝。”', '27.73A4': '《說文》：“玤，石之次玉者，以為系璧。从玉，丰聲。讀若《詩》曰‘瓜瓞菶菶’。一曰若𧊧蚌。”', '27.E02A': '《說文》：“玪，玪𤨙，石之次玉者。从玉，今聲。”', '27.E03C': '《說文》：“𤣻，玉屬。从玉，𠬸聲。讀若𣴬。”', '27.73AD': '《說文》：“玭，珠也。从玉，比聲。宋弘云，淮水中出玭珠。玭，珠之有聲。蠙，《夏書》玭从虫、賓。”', '27.739F': '《說文》：“火齊玫瑰也，一曰石之美者。从玉文聲。”', '27.73A8': '《說文》：“玨，二玉相合為一玨。瑴，玨或从㱿。”', '27.6C1B': '《說文》：“氛，祥气也。从气，分聲。雰，氛或从雨。”', '27.829D': '《說文》：“芝，神艸也。从艸，从之。”', '27.82A7': '《說文》：“芧，艸也。从艸，予聲。可以為繩。”', '27.82A8': '《說文》：“芨，堇艸也。从艸，及聲。讀若急。”', '27.E06F': '《說文》：“𦬕，艸也。从艸，中聲。”', '27.82BA': '《說文》：“芺，艸也。味苦，江南食以下气。从艸，夭聲。”', '27.82B9': '《說文》：“芹，楚葵也。从艸，斤聲。”', '27.82B8': '《說文》：“芸，艸也，似目宿。从艸，云聲。淮南子說，芸艸可以死復生。”', '27.82A9': '《說文》：“芩，艸也。从艸，今聲。《詩》曰：‘食野之芩。’”', '27.82B0': '《說文》：“芰，蔆也。从艸，支聲。杜林說：芰从多。”', '27.82A1': '《說文》：“芡，雞頭也。从艸，欠聲。”', '27.E083': '《說文》：“䒢，昌蒲也。从艸，卬聲。益州云。”', '27.E088': '《說文》：“䒞，艸也。从艸，冘聲。”', '27.E089': '《說文》：“芪，芪母也。从艸，氏聲。”', '27.82AB': '《說文》：“芫，魚毒也。从艸，元部。”', '27.8298': '《說文》：“芘，艸也。一曰芘茮木。从艸，比聲。”', '27.82BD': '《說文》：“芽，萌芽也。从艸，牙聲。”', '27.82A3': '《說文》：“芣，華盛。从艸，不聲。一曰芣苢。”', '27.829B': '《說文》：“芛，艸之葟榮也。从艸，尹聲。”', '27.82AE': '《說文》：“芮，芮芮，艸生皃。从艸，內聲，讀若汭。”', '27.82BC': '《說文》：“芼，艸覆蔓。从艸，毛聲。《詩》曰：‘左右芼之。’”', '27.82B3': '《說文》：“芳，香艸也。从艸，方聲。”', '27.829F': '《說文》：“芟，刈艸也。从艸，从殳。”', '27.82A5': '《說文》：“芥，菜也。从艸，介聲。”', '27.82B4': '《說文》：“芴，菲也。从艸，勿聲。”', '27.8299': '《說文新附》：“芙，芙蓉也。从艸，夫聲。”', '27.5C1A': '《說文》：“尚，曾也，庶幾也。从八，向聲。”', '27.756A': '《說文》：“番，獸足謂之番。从采，田象其掌。𨆌番或从足、从煩。𥸨，古文番。”', '27.E0D1': '《說文》：“㸬，二歲牛。从牛，市聲。”', '27.E0E3': '《說文》：“𤘡，牛舌病喔。从牛，今聲。”', '27.7269': '《說文》：“物，萬物也。牛為大物，天地之數，起於牽牛，故从牛，勿聲。”', '27.5471': '《說文》：“呱，小兒嗁聲。从口，瓜聲。《詩》曰：‘后稷呱矣。’”', '27.5480': '《說文》：“咀，含味也。从口，且聲。”', '27.5473': '《說文》：“味，滋味也。从口，未聲。”', '27.546C': '《說文》：“呬，東夷謂息為呬。从口，四聲。《詩》曰：‘犬夷呬矣。’”', '27.547C': '《說文》：“呼，外息也。从口，乎聲。”', '27.547D': '《說文》：“命，使也。从口，从令。”', '27.548C': '《說文》：“咊，相譍也。从口，禾聲。”', '27.E0F2': '《說文》：“呭，多言也。从口，世聲。”', '27.5484': '《說文》：“咄，相謂也。从口，出聲。”', '27.5477': '《說文》：“呷，吸呷也。从口，甲聲。”', '27.5488': '《說文》：“咈，違也。从口，弗聲。”', '27.5467': '《說文》：“呧，苛也。从口，氐聲。”', '27.5476': '《說文》：“呶，讙聲也。从口，奴聲。”', '27.547B': '《說文》：“呻，吟也。从口，申聲。”', '27.5486': '《說文》：“咆，噑也。从口，包聲。”', '27.E10D': '《說文》：“呝，喔也。”', '27.5466': '《說文》：“呦，鹿鳴聲也。从口，幼聲。𣢜，呦或从欠。”', '27.548D': '《說文新附》：“咍，蚩笑也。从口，从台。”', '27.758C': '《說文》：“疌，疾也。从止，从又。又，手也。屮聲。”', '27.4E9B': '《說文新附》：“些，語辭也，見《楚辭》。从此，从二。其義未詳。”', '27.E15D': '《說文》：“𨒌，正行也。从辵，正聲。征，𨒌或从彳。”', '27.8FCB': '《說文》：“迋，往也。从辵，王聲。《春秋傳》曰：‘子無我迋。’”', '27.E15F': '《說文》：“䢐，往也。从辵，且聲。䢐，齊語。徂，䢐或从彳。𨖆，籀文从虘。”', '27.8FCE': '《說文》：“迎，逢也。从辵，卬聲。”', '27.8FD1': '《說文》：“近，附也。从辵，斤聲。𣥍，古文近。”', '27.E182': '《說文》：“䢌，行皃。从辵，巿聲。”', '27.8FD2': '《說文》：“迒，獸迹也。从辵，亢聲。𨁈，迒或从足，从更。”', '27.E18A': '《說文》：“𨑩，至也。从辵，弔聲。”', '27.5F80': '《說文》：“往，之也。从彳，𡉚聲。𨓏，古文从辵。”', '27.5F7C': '《說文》：“彼，往有所加也。从彳，皮聲。”', '27.E195': '《說文》：“㣙，行㣙㣙也。从彳，由聲。”', '27.5F97': '《說文》：“得，行有所得也。从彳，㝵聲。䙷，古文省彳。”', '27.E19D': '《說文》：“𢌛，行也。从廴，正聲。”', '27.5EF6': '《說文》：“延，長行也。从㢟，丿聲。”', '27.55E3': '《說文》：“嗣，諸侯嗣國也。从𠕋，从口，司聲，孠，古文嗣从子。”', '27.62D8': '《說文》：“拘，止也。从句，从手，句亦聲。”', '27.7CFE': '《說文》：“糾，繩三合也。从糸、丩。”', '27.80B8': '《說文》：“肸響，布也。从十，从䏌。”', '27.8B00': '《說文》：“謀，慮難曰謀。从言，某聲。𠰔古文謀，𧦥亦古文。”', '27.8A60': '《說文》：“詠，歌也。从言，永聲。詠或从口。”', '27.8A1D': '《說文》：“訝，相迎也。从言，牙聲。《周禮》曰：‘諸侯有卿訝發。’訝，或从辵。”', '27.59BE': '《說文》：“妾，有辠女子，給事之得接於君者。从䇂，从女。《春秋》云：‘女為人妾，妾不娉也。’”', '27.5949': '《說文》：“奉，承也。从手，从廾，丰聲。”', '27.EDFD': '《說文》：“𢍉，舉也。从廾，甶聲。《春秋傳》曰：‘晉人或以廣墜，楚人𢍉之。’黃顥說，廣車陷，楚人為舉之。杜林以為騏麟字。”', '27.E233': '《說文》：“𢌻，兩手盛也。从廾，𡴆聲。”', '27.5F08': '《說文》：“弈，圍棊也。从廾，亦聲。《論語》曰：‘不有博弈者乎？’”', '27.5177': '《說文》：“具，共置也。从廾，从貝省。古以貝為貨。”', '27.F49E': '《說文》：“㕞，拭也。从又持巾在尸下。”', '27.79C9': '《說文》：“秉，禾束也。从又，持禾。”', '27.53D4': '《說文》：“叔，拾也。从又，尗聲。汝南名收芋為叔。𡬧，叔或从寸。”', '27.53D6': '《說文》：“取，捕取也。从又，从耳。《周禮》：‘獲者取左耳。’《司馬法》曰：‘載獻聝。’聝者，耳也。”', '27.5351': '《說文》：“卑，賤也，執事也。从𠂇、甲。”', '27.4E8B': '《說文》：“事，職也。从史，之省聲。𡷮，古文事。”', '27.F5E5': '《說文》：“隶，及也。从又，从㞑省。又持㞑者，从後及之也。”', '27.F593': '《說文》：“臤，堅也。从又，臣聲。讀若‘鏗鏘’之‘鏗’。古文以為賢字。”', '27.6778': '《說文》：“杸，軍中士所持殳也。从木，从殳。《司馬法》曰：‘執羽从杸。’”', '27.E2A4': '《說文》：“㱽，下擊上也。从殳，冘聲。”', '27.76AF': '《說文》：“皯，面黑气也。从皮，干聲。”', '27.653D': '《說文》：“攽，分也。从攴，分聲。”', '27.6549': '《說文》：“敉，撫也。从攴，米聲。《周書》曰：‘亦未克敉公功。’讀若弭。侎，敉或从人。”', '27.7267': '《說文》：“牧，養牛人也。从攴，从牛。《詩》曰：‘牧人乃夢。’”', '27.6559': '《說文》：“教，上所施下所效也。从攴，从𡥉。𧧿，古文教；𤕝，亦古文教。”', '27.5366': '《說文》：“卦，筮也。从卜，圭聲。”', '27.F0F4': '《說文》：“㸚，二爻也。”', '27.76F0': '《說文》：“盰，目多白也。一曰張目也。从目，干聲。”', '27.76F1': '《說文》：“盱，張目也。从目，于聲。一曰朝鮮謂盧童子曰盱。”', '27.76F2': '《說文》：“盲，目無牟子。从目，亡聲。”', '27.8005': '《說文》：“者，別事詞也。从白，聲。，古文旅字。”', '27.96B9': '《說文》：“隹，鳥之短尾緫名也。象形。”', '27.4E56': '《說文》：“𦮃，戾也。从𦫳而兆；兆，古文別。”', '27.7F8B': '《說文》：“羋，羊鳴也。从羊，象聲气上出，與牟同意。”', '27.7F8D': '《說文》：“羍，小羊也。从羊，大聲。讀若達。𦍐，羍或省。”', '27.7F8C': '《說文》：“羌，西戎牧羊人也。从人，从羊，羊亦聲。南方蠻閩从虫，北方狄从犬，東方貉从豸，西方羌从羊，此六種也。西南𤏡人、僬僥从人，蓋在坤地，頗有順理之性。唯東夷从大，大，人也。夷俗仁，仁者壽，有君子不死之國。孔子曰：‘道不行，欲之九夷，乘桴浮於海，有以也。’𡸓，古文羌如此。”', '27.9CF3': '《說文》：“鳳，神鳥也。天老曰：鳳之象也，鴻前麐後，蛇頸魚尾，鸛顙鴛思，龍文虎背，燕頷雞喙，五色備舉。出於東方君子之國，翺翔四海之外，過崐崘，飲砥柱，濯羽弱水，莫宿風穴，見則天下大安寧。从鳥，凡聲。𠤈，古文鳳，象形。鳳飛羣鳥從以萬數，故以為朋黨字。𪆍，亦古文鳳。”', '27.70CF': '《說文》：“烏，孝鳥也。象形。孔子曰：‘烏，𥃳呼也。’取其助气，故以為烏呼。𤚶，古文烏，象形。於，象古文烏省。”', '27.653E': '《說文》：“放，逐也。从攴，方聲。”', '27.53D7': '《說文》：“受，相付也。从𠬪，舟省聲。”', '27.722D': '《說文》：“爭，引也。从𠬪、厂。”', '27.6B7E': '《說文》：“歾，終也。从歺，勿聲。𣨏，歾或从𠬸。”', '27.E380': '《說文》：“𣧻，禽獸所食餘也，从歺从肉。”', '27.E38E': '《說文》：“肧，婦孕一月也。从肉，不聲。”', '27.80AB': '《說文》：“肫，面頯也。从肉，屯聲。”', '27.80BA': '《說文》：“肺，金藏也。从肉，巿聲。”', '27.80AA': '《說文》：“肪，𦘺也。从肉，方聲。”', '27.F0AA': '《說文》：“𦙪，髆也。从肉，象形。肩，俗肩从戶。”', '27.E392': '《說文》：“䏐，孔也。从肉，決省聲。讀若決水之決。”', '27.80A1': '《說文》：“股，髀也。从肉，殳聲。”', '27.80D1': '《說文》：“胑，體四胑也。从肉，只聲。肢，胑或从支。”', '27.E398': '《說文》：“肬，贅也。从肉，尤聲。𪐤，籀文肬从黑。”', '27.E39B': '《說文》：“䏖，瘢也。从肉，引聲。一曰遽也。”', '27.80B4': '《說文》：“肴，啖也。从肉，爻聲。”', '27.818D': '《說文》：“膍，牛百葉也。从肉，𣬉聲。一曰鳥膍胵。肶，膍或从比。”', '27.F063': '《說文》：“肰，犬肉也。从犬、肉。讀若然。𦝸，古文肰。𦛡，亦古文肰。”', '27.F0CB': '《說文》：“䏙，肉汁滓也。从肉，冘聲。”', '27.80A5': '《說文》：“肥，多肉也。从肉，从卪。”', '27.E3BC': '《說文》：“㓡，刀握也。从刀，缶聲。”', '27.521D': '《說文》：“初，始也。从刀，从衣。裁衣之始也。”', '27.523B': '《說文》：“刻，鏤也。从刀，亥聲。”', '27.5233': '《說文》：“刳，判也。从刀，夸聲。”', '27.5237': '《說文》：“刷，刮也。从刀，㕞省聲。《禮》：‘布刷巾。’”', '27.522E': '《說文》：“刮，掊把也。从刀，𠯑聲。”', '27.5232': '《說文》：“刲，刺也。从刀，圭聲。”', '27.5235': '《說文》：“刵，斷耳也。从刀，从耳。”', '27.5238': '《說文》：“券，契也。从刀，聲。券別之書，以刀判契其旁，故曰契券。”', '27.523A': '《說文》：“刺，君殺大夫曰刺。刺，直傷也。从刀，从朿，朿亦聲。”', '27.5178': '《說文》：“典，五帝之書也。从𠕋在丌上，尊閣之也。莊都說：“典，大𠕋也。’𥮏，古文典从竹。”', '27.7540': '《說文》：“畀，相付與之，約在閣上也。从丌，甶聲。”', '27.6C93': '《說文》：“沓，語多沓沓也。从水，从曰。遼東有沓縣。”', '27.F0E3': '《說文》：“𠧴，气行皃。从乃，𠧪聲。”', '27.5947': '《說文》：“奇，異也。一曰不耦。从大，从可。”', '27.864E': '《說文》：“虎，山獸之君。从虍，虎足象人足，象形……虝，古文虎。𧇂，亦古文虎。”', '27.76C2': '《說文》：“盂，飯器也。从皿，亏聲。”', '27.E458': '《說文》：“𧖨，定息也。从血，甹省聲。讀若亭。”', '27.5379': '《說文》：“卹，憂也。从血，卩聲。一曰鮮少也。”', '27.F547': '《說文》：“咅，相與語唾而不受也。从丶，从否，否亦聲。㰯，咅或从豆，从欠。”', '27.5231': '《說文》：“刱，造法刱業也。从井，刅聲。讀若創。”', '27.98DF': '《說文》：“食，一米也。从皀，亼聲。或說亼皀也。”', '27.98EA': '《說文》：“飪，大熟也。从食，壬聲。䏕，古文飪。恁，亦古文飪。”', '27.4F96': '《說文》：“侖，思也。从亼，从冊。𠎚，籀文侖。”', '27.820D': '《說文》：“舍，市居曰舍。从亼、屮，象屋也。口象築也。”', '27.530B': '《說文》：“匋，瓦器也。从缶，包省聲。古者昆吾作匋。”', '27.F0F5': '《說文》：“䠶，弓弩發於身而中於遠也。从矢，从身。射，篆文䠶从寸。寸，法度也，亦手也。”', '27.77E5': '《說文》：“知，詞也。从口，从矢。”', '27.4EAC': '《說文》：“京，人所為絕高丘也。从高省，丨象高形。”', '27.F55D': '《說文》：“㐭，穀所振入，宗廟粢盛，倉黃㐭而取之，故謂之㐭。从入，回象屋形，中有戶牖。廩，㐭或从广，从禾。”', '27.4F86': '《說文》：“來，周所受瑞麥來麰，一來二縫。象芒朿之形。天所來也，故為行來之來。”', '27.590C': '《說文》：“夌，越也。从夂，从𡴆；𡴆，高也。一曰夌也。”', '27.E4B8': '《說文》：“𡰿，行𡰿𡰿也。从攵，闕，讀若僕。”', '27.F040': '《說文》：“𡕢，瑙蓋也。象皮包覆瑙下，有兩臂而夂在下。讀若范。”', '27.E4C8': '《說文》：“枾，赤實果。从木，聲。”', '27.67DF': '《說文》：“枏，梅也。”', '27.6776': '《說文》：“杶，木也。从木，屯聲。《夏書》曰：‘杶榦栝柏。’櫄，或从熏。，古文杶。”', '27.E4DB': '《說文》：“𣏗，栩也。从木，予聲。讀若杼。”', '27.6787': '《說文》：“枇，枇杷，木也。从木，比聲。”', '27.678B': '《說文》：“枋，木。可作車。从木，方聲。”', '27.6792': '《說文》：“枒，木也。从木，牙聲。一曰車𨊾會也。”', '27.678C': '《說文》：“枌，榆也。从木，分聲。”', '27.677E': '《說文》：“松，木也。从木，公聲。㮤，松或从容。”', '27.679C': '《說文》：“果，木實也。象果形在木之上。”', '27.679D': '《說文》：“枝，木別生條也。从木，支聲。”', '27.679A': '《說文》：“枚，榦也，可為杖。从木，从攴。”', '27.E4F7': '《說文》：“枖，木少盛皃。从木，夭聲。《詩》曰：‘桃之枖枖。’”', '27.676A': '《說文》：“杪，木標末也。从木，少聲。”', '27.6789': '《說文》：“𣒈，衺曲也。从木，𡉚聲。”', '27.678E': '《說文》：“枎，枎疏，四布也。从木，夫聲。”', '27.6772': '《說文》：“杲，明也。从日在木上。”', '27.6773': '《說文》：“杳，冥也。从日在木下。”', '27.6785': '《說文》：“枅，屋櫨也。从木，幵聲。”', '27.F10F': '《說文》：“牀，安身之坐者。从木，爿聲。”', '27.6795': '《說文》：“枕，卧所薦首者。从木，冘聲。”', '27.F102': '《說文》：“㭉，兩刃臿也。从木、𦫳，象形。宋魏曰㭉也。釫，或从金、从于。”', '27.6777': '《說文》：“杷，收麥器。从木，巴聲。”', '27.6775': '《說文》：“杵，舂杵也。从木，午聲。”', '27.6793': '《說文》：“枓，勺也。从木，从斗。”', '27.677C': '《說文》：“杼，機之持緯者。从木，予聲。”', '27.6791': '《說文》：“枑，行馬也。从木，互聲。”', '27.6781': '《說文》：“极，驢上負也。从木，及聲。或讀若急。”', '27.E524': '《說文》：“枊，馬柱。从木，卬聲。一曰堅也。”', '27.91C7': '《說文》：“采，捋取也。从木，从爪。”', '27.E528': '《說文》：“杮，削木札樸也。从木，巿聲。陳楚謂櫝為杮。”', '27.6790': '《說文》：“析，破木也。一曰折也。从木，从斤。”', '27.677D': '《說文》：“杽，械也。从木，从手，手亦聲。”', '27.6771': '《說文》：“東，動也。从木。官溥說，从日在木中。”', '27.6797': '《說文》：“林，平土有叢木曰林。从二木。”', '27.56F7': '《說文》：“囷，廪之圜者。从很在囗中。圜謂之囷，方謂之京。”', '27.56F9': '《說文》：“囹，獄也。从囗，令聲。”', '27.56FA': '《說文》：“固，四塞也。从囗，古聲。”', '27.90B8': '《說文》：“邸，屬國舍。从邑，氐聲。”', '27.90B0': '《說文》：“邰，炎帝之後，姜姓所封，周棄外家國。从邑，台聲。商扶風斄縣是也。《詩》曰：‘有邰家室。’”', '27.E55B': '《說文》：“䢸，右扶風鄠鄉。从邑，且聲。”', '27.E55F': '《說文》：“邮，左馮翊高陵。从邑，由聲。”', '27.90B6': '《說文》：“邶，故商邑，自河內朝歌以北是也。从邑，北聲。”', '27.90B5': '《說文》：“邵，晉邑也。从邑，召聲。”', '27.90B2': '《說文》：“邲，晉邑也。从邑，必聲。《春秋傳》曰：‘晉楚戰于邲。’”', '27.7941': '《說文》：“祁，太原縣。从邑，示聲。”', '27.90AF': '《說文》：“邯，趙邯鄲縣。从邑，甘聲。”', '27.E568': '《說文》：“𨚙，南陽淯陽鄉。从邑，号聲。”', '27.E574': '《說文》：“𨚔，地名。从邑，包聲。”', '27.90B4': '《說文》：“邴，宋下邑。从邑，丙聲。”', '27.90B3': '《說文》：“邳，奚仲之後，湯左相仲虺所封國，在魯薛縣。从邑，丕聲。”', '27.E57F': '《說文》：“邭，地名。从邑，句聲。”', '27.90B1': '《說文》：“邱，地名。从邑，丘聲。”', '27.65FB': '《說文》：“旻，秋天也。从日，文聲。”', '27.6642': '《說文》：“時，四時也。从日，寺聲。旹，古文時，从之、日。”', '27.6612': '《說文》：“昒，尚冥也。从日，勿聲。”', '27.6603': '《說文》：“𣅛，日在西方時，側也。从日，仄聲。《易》曰：‘日𣅛之離。’”', '27.660F': '《說文》：“昏，日冥也。从日，氐省。氐者，下也。一曰民聲。”', '27.6604': '《說文》：“昄，大也。从日，反聲。”', '27.6614': '《說文》：“昔，乾肉也。从殘肉，日以晞之，與俎同意。腊，籀文从肉。”', '27.E5A3': '《說文》：“㫘，不見也。从日，否省聲。”', '27.6606': '《說文》：“昆，同也。从日，从比。”', '27.6615': '《說文》：“昕，旦明，日將出也。从日，斤聲。”', '27.6608': '《說文新附》：“昈，明也。从日，戶聲。”', '27.6609': '《說文新附》：“昉，明也。从日，方聲。”', '27.6602': '《說文新附》：“昂，舉也。从日，卬聲。”', '27.6607': '《說文新附》：“昇，日上也。从日，升聲。古只用升。”', '27.65C5': '《說文》：“旅，軍之五百人為旅。从㫃，从从；从，俱也。𣥏，古文旅。古文以為魯、衛之魯。”', '27.80AD': '《說文》：“肭，朔而月見東方謂之縮肭。从月，內聲。”', '27.F062': '《說文》：“朙，照也。从月，从囧。明，古文朙，从日。”', '27.591C': '《說文》：“夜，舍也。天下休舍也。从夕，亦省聲。”', '27.E5B9': '《說文》：“夝，雨而夜除星見也。从夕，生聲。”', '27.51FD': '《說文》：“圅，舌也。象形，舌體𢎘𢎘。从𢎘，𢎘亦聲。肣，俗圅从肉、今。”', '27.7248': '《說文》：“版，判也。从片，反聲。”', '27.5F54': '《說文》：“彔，刻木彔彔也。象形。”', '27.E5D4': '《說文》：“䄪，禾危穗也。从禾，勺聲。”', '27.E5DA': '《說文》：“秄，壅禾本。从禾，子聲。”', '27.E5DD': '《說文》：“𥝖，𥞸也。从禾，气聲。”', '27.7A08': '《說文》：“稈，禾莖也。从禾，旱聲。《春秋傳》曰：‘或投一秉稈。’秆，稈或从干。”', '27.79C5': '《說文》：“秅，二秭為秅。从禾，乇聲。”', '27.8200': '《說文》：“舀，抒臼也。从爪、臼。《詩》曰：‘或簸或舀。’抭，舀或从手，从宂。，舀或从臼、宂。”', '27.F64B': '《說文》：“臽，小阱也。从人在臼上也。”', '27.F10D': '《說文》：“𣏟，葩之總名也。𣏟之為言微也，微纖為功。象形。”', '27.5B9B': '《說文》：“宛，屈艸自覆也。从宀，夗聲。惌，宛或从心。徐灝注箋：“夗者，屈曲之義，宛从宀，蓋謂宮室窈然深曲，引申為凡圓曲之偁，又為屈折之偁。屈草自覆未詳其恉。”', '27.E618': '《說文》：“宖，屋響也。从宀，弘聲。”', '27.5B9A': '《說文》：“定，安也。从宀，从正。”', '27.5B93': '《說文》：“宓，安也。从宀，必聲。”', '27.E61F': '《說文》：“𡧖，藏也。从宀，𡥀聲。𡥀，古文𠈃。《周書》曰：‘陳𡧖赤刀。’”', '27.5B9C': '《說文》：“宜，所安也。从宀之下，一之上，多省聲。𡪀，古文宜。𡨆，亦古文宜。”', '27.5B95': '《說文》：“宕，過也。一曰洞屋。从宀，碭省聲。汝南項有宕鄉。”', '27.5B97': '《說文》：“宗，尊祖廟也。从宀，从示。”', '27.E62F': '《說文》：“宔，宗廟宔祏。从宀，主聲。”', '27.5B99': '《說文》：“宙，舟輿所極覆也。从宀，由聲。”', '27.7A7A': '《說文》：“空，竅也。从穴，工聲。”', '27.7A79': '《說文》：“穹，窮也。从穴，弓聲。”', '27.7A78': '《說文》：“穸，窀穸也。从穴，夕聲。”', '27.759D': '《說文》：“疝，腹痛也。从疒，山聲。”', '27.E64F': '《說文》：“疛，小腹病。从疒，肘省聲。”', '27.5169': '《說文》：“兩，二十四銖為一兩。从一；㒳，平分，亦聲。”', '27.5E17': '《說文》：“帗，一幅巾也。从巾，犮聲。”', '27.5E14': '《說文》：“帔，弘農謂帬帔也。从巾，皮聲。”', '27.5E16': '《說文》：“帖，帛書署也。从巾，占聲。”', '27.5E19': '《說文》：“帙，書衣也。从巾，失聲。袠，帙或从衣。”', '27.E68D': '《說文》：“㠾，幡也。从巾，夗聲。”', '27.5E1A': '《說文》：“帚，糞也。从又持巾埽冂內。”', '27.5E11': '《說文》：“帑，金幣所藏也。从巾，奴聲。”', '27.E69A': '《說文新附》：“帒，囊也。或从衣。”', '27.5E1B': '《說文》：“帛，繒也。从巾，白聲。”', '27.4FDD': '《說文》：“保，養也。从人，从𤔍省。𤔍，古文孚。𣎼，古文保。𠊻，古文保不省。”', '27.4F7C': '《說文》：“佼，交也。从人、交。”', '27.4F69': '《說文》：“佩，大帶佩也。从人，从凡，从巾。佩必有巾，巾謂之飾。”', '27.4F9A': '《說文》：“徇，疾也。从人，旬聲。”', '27.4F73': '《說文》：“佳，善也。从人，圭聲。”', '27.4F85': '《說文》：“侅，奇侅，非常也。从人，亥聲。”', '27.4F97': '《說文》：“侗，大皃。从人，同聲。”', '27.4F76': '《說文》：“佶，正也。从人，吉聲。”', '27.4F9B': '《說文》：“供，設也。从人，共聲。一曰供給。”', '27.5099': '《說文》：“備，慎也。从人，䓒聲。𠈍，古文備。”', '27.4F7A': '《說文》：“佺，偓佺，仙人也。从人，全聲。”', '27.4F94': '《說文》：“侔，齊等也。从人，牟聲。”', '27.4F75': '《說文》：“併，並也。从人，并聲。”', '27.E6B4': '《說文》：“侙，惕也。从人，式聲。”', '27.4F9D': '《說文》：“依，倚也。从人，衣聲。”', '27.4F7D': '《說文》：“佽，便利也。从人，次聲。《詩》曰：‘決拾既佽。’一曰遞也。”', '27.4F74': '《說文》：“佴，佽也。从人，耳聲。”', '27.4F8D': '《說文》：“侍，承也。从人，寺聲。”', '27.4F92': '《說文》：“侒，宴也。从人，安聲。”', '27.4F90': '《說文》：“侐，靜也。从人，血聲。”', '27.4F81': '《說文》：“侁，行皃。从人，先聲。”', '27.4F70': '《說文》：“佰，相什佰也。从人、百。”', '27.4F78': '《說文》：“佸，會也。从人，𠯑聲。《詩》曰：‘曷其有𠈲。’一曰：𠈲𠈲，力皃。”', '27.4F6E': '《說文》：“佮，合也。从人，合聲。”', '27.4F7F': '《說文》：“使，伶也。从人，吏聲。”', '27.F07F': '《說文》：“㑞，送也。从人，灷聲。”', '27.4F9C': '《說文》：“侜，有廱蔽也。从人，舟聲。”', '27.E6BF': '《說文》：“𠈈，小皃。《詩》曰：‘𠈈𠈈彼有屋。’”', '27.E6C0': '《說文》：“侊，小皃。从人，光聲。”', '27.4F7B': '《說文》：“佻，愉也。从人，兆聲。”', '27.4F88': '《說文》：“侈，掩脅也。从人，多聲。一曰奢也。”', '27.4F89': '《說文》：“侉，𢞎詞。从人，夸聲。”', '27.4F8B': '《說文》：“例，比也。从人，𠛱聲。”', '27.548E': '《說文》：“咎，災也。从人，从各。各者，相違也。”', '27.4F82': '《說文》：“侂，寄也。从人，㡯聲。”', '27.4F7E': '《說文新附》：“佾，舞行列也。从人，䏌聲。”', '27.5353': '《說文》：“㔬，高也。早匕為㔬，匕卪為卬，皆同義。卓，古文㔬。”', '27.5F9E': '《說文》：“從，隨行也。从辵，从从，从亦聲。”', '27.F49B': '《說文》：“㸒，近求也。从爪、壬。壬，徼幸也。”', '27.81E5': '《說文》：“臥，休也。从人、臣，取其伏也。”', '27.8868': '《說文》：“表，上衣也。从衣，从毛‧古者衣裘，以毛為表。𧞧，古文表从麃。”', '27.88D4': '《說文》：“裔，衣裾也。从衣，㕯聲。𧘉，古文裔。”', '27.5352': '《說文》：“卒，隸人給事者衣為卒。卒，衣有題識者。”', '27.E6FB': '《說文》：“𦒸，老人行才相逮。從老省，易省。行象。讀若樹。”', '27.5C45': '《說文》：“居，蹲也。从尸，古者居从古。踞，俗居从足。”', '27.5C46': '《說文》：“屆，行不便也。一曰極也。从尸，凷聲。”', '27.F104': '《說文》：“𡱂，髀也。从尸下丌居几。”', '27.E707': '《說文》：“㞏，㞚㞏也。从尸，乏聲。”', '27.5C48': '《說文》：“屈，無尾也。从尾，出聲。”', '27.EEAE': '《說文》：“𦨉，船行不安也。从舟，从刖省。讀若兀。”', '27.65BB': '《說文》：“斻，方舟也。从方，亢聲。《禮》：‘天子造舟，諸矦維舟，大夫方舟，士特舟。’”', '27.5152': '《說文》：“兒，孺子也。从儿，象小兒頭囟未合。”', '27.F0D9': '《說文》：“兓，朁朁，銳意也。从二兂。”', '27.6B23': '《說文》：“欣，笑喜也。从欠，斤聲。”', '27.E734': '《說文》：“㰟，𡴘也。从欠，气聲。一曰口不便言。”', '27.E738': '《說文》：“欦，含笑也。从欠，今聲。”', '27.E739': '《說文》：“𣢑，𣢑𣢑，戲笑皃。从欠，之聲。”', '27.6B25': '《說文》：“欥，詮詞也。从欠，从曰，曰亦聲。《詩》曰：‘欥求厥寧。’”', '27.F3AC': '《說文》：“㱃，歠也。从欠，酓聲。”', '27.E7AB': '《說文》：“卶，有大度也。从卩，多聲。讀若侈。”', '27.5377': '《說文》：“卷，厀曲也。从卪，聲。”', '27.5378': '《說文》：“卸，舍車解馬也。从卪、止、午。”', '27.530A': '《說文》：“匊，在手曰匊。从勹、米。”', '27.E7B4': '《說文》：“𠣘，帀徧也。从勹，舟聲。”', '27.E7B5': '《說文》：“匌，帀也。从勹，从合，合亦聲。”', '27.754F': '《說文》：“畏，惡也。从甶，虎省。鬼頭而虎爪，可畏也。𤰣，古文省。”', '27.5CB1': '《說文》：“岱，太山也。从山，代聲。”', '27.5CB5': '《說文》：“岵，山有草木也。从山，古聲。”', '27.5CA8': '《說文》：“岨，石戴土也。从山，且聲。”', '27.5CA1': '《說文》：“岡，山骨也。从山，网聲。”', '27.5CAB': '《說文》：“岫，山穴也。从山，由聲。𥥉，籀文从穴。”', '27.5CAA': '《說文》：“岪，山脅道也。从山，弗聲。”', '27.5CB8': '《說文》：“岸，水厓而高者。从屵，干聲。”', '27.5E9C': '《說文》：“府，文書藏也。从广，付聲。”', '27.5E96': '《說文》：“庖，𢊍也。从广，包聲。”', '27.5E95': '《說文》：“底，山居也。一曰下也。从广，氐聲。”', '27.E7DF': '《說文》：“𢇷，舍也。从广，犮聲。《詩》曰：‘召伯所𢇷。’”', '27.E7E2': '《說文》：“㡹，人相依㡹也。从广，且聲。”', '27.F389': '《說文》：“厓，山邊也。从厂，圭聲。”', '27.8C56': '《說文》：“豖，豕絆足行豖豖。从豕繫二足。”', '27.F3B0': '《說文》：“㣇，脩豪獸。一曰河內名豕也。从彑，下象毛足。讀若弟。𧱈，籀文。𡱃，古文。”', '27.F3B1': '《說文》：“𤉡，如野牛而青，象形。與禽、离頭同。兕，古文从儿。”', '27.6613': '《說文》：“易，蜥易，蝘蜓，守宮也。象形。《秘書》說，日月為易，象陰陽也。一曰从勿。”', '27.E83C': '《說文》：“灋，刑也。平之如水，从水；廌，所以觸不直者，去之，从去。法，今文省。佱，古文。”', '27.F5E6': '《說文》：“㲋，獸也。似兔，青色而大。象形。頭與兔同，足與鹿同。”', '27.5154': '《說文》：“兔，獸名。象踞，後其尾形，兔頭與㲋頭同。”', '27.72D7': '《說文》：“狗，孔子曰：‘狗，叩也，叩气吠以守。’从犬，句聲。”', '27.E853': '《說文》：“㹥，黃犬黑頭。从犬，主聲。讀若注。”', '27.72E6': '《說文》：“狦，惡健犬也。从犬，𠜂省聲。”', '27.72CB': '《說文》：“狋，犬怒皃。从犬，示聲。一曰犬難得。代郡有狋氏縣。讀又若銀。”', '27.72C0': '《說文》：“狀，犬形也。从犬，爿聲。”', '27.72CE': '《說文》：“狎，犬可習也。从犬，甲聲。”', '27.E85D': '《說文》：“㹤，多畏也。从犬，去聲。怯，杜林說，㹤从心。”', '27.623E': '《說文》：“戾，曲也。从犬出戶下。戾者，身曲戾也。”', '27.72D9': '《說文》：“狙，玃屬。从犬，且聲。一曰狙犬也暫齧人者。一曰犬不齧人也。”', '27.E867': '《說文》：“狛，如狼，善驅羊。从犬，白聲。讀若蘗，甯嚴讀之若淺泊。”', '27.72D0': '《說文》：“狐，䄏獸也，鬼所乘之。有三德：其色中和，小前大後，死則丘首。从犬，瓜聲。”', '27.72D8': '《說文新附》：“狘，獸走皃。从犬，戉聲。”', '27.708A': '《說文》：“炊，爨也。从火，吹省聲。”', '27.7085': '《說文》：“炅，見也。从火、日。”', '27.7095': '《說文》：“炕，乾也。从火，亢聲。”', '27.708E': '《說文》：“炎，火光上也。从重火。”', '27.7099': '《說文》：“炙，炮肉也。从肉在火上。𤐬，籀文。”', '27.6D7E': '《說文》：“浾，䞓，棠棗之汁。或从水。泟，浾或从正。”', '27.5944': '《說文》：“奄，覆也。大有餘也。又欠也。从大，从申。申，展也。”', '27.E8B5': '《說文》：“𡗷，大也。从大，瓜聲。”', '27.5945': '《說文》：“奅，大也。从大，卯聲。”', '27.E8B8': '《說文》：“奃，大也。从大，氐聲。”', '27.E8BB': '《說文》：“㚕，大也。从大，弗聲。讀若‘予違汝弼。’”', '27.5E78': '《說文》：“𡴘，吉而免凶也。从屰，从夭。夭死之事，故死謂之不𡴘。”', '27.5954': '《說文》：“奔，走也。从夭，賁省聲。與走同意，俱从夭。”', '27.E8C0': '《說文》：“𤿑，蹇也。从尣，皮聲。”', '27.E8C1': '《說文》：“㝾，㝾㝾，行不正。从𡯁，左聲。”', '27.F495': '《說文》：“㚔，所以驚人也。从大，从𢆉。一曰大聲也。一曰讀若瓠。一曰俗語以盜不止為㚔。㚔，讀若籋。”', '27.660A': '《說文》：“昦，春為昦天，元气昦昦。从日、夰，夰亦聲。”', '27.E8CE': '《說文》：“㚖，大白；澤也。从大，从白。古文以為‘澤’字。”', '27.F0B5': '《說文》：“㚘，並行也。从二夫。輦字从此。讀若伴侶之伴。”', '27.E8D2': '《說文》：“竢，待也。从立，矣聲。䇃，或从巳。”', '27.4E26': '《說文》：“竝，併也。从二立。”', '27.6027': '《說文》：“性，人之陽气性善者也。从心，生聲。”', '27.5FE0': '《說文》：“忠，敬也。从心，中聲。”', '27.5FF5': '《說文》：“念，常思也。从心，今聲。”', '27.6021': '《說文》：“怡，和也。从心，台聲。”', '27.6019': '《說文》：“怙，恃也。从心，古聲。”', '27.F094': '《說文》：“㤅，惠也。从心，旡聲。𢟪，古文。”', '27.601E': '《說文》：“怞，朗也。从心，由聲。《詩》曰：‘憂心且怞。’”', '27.5FDE': '《說文》：“忞，彊也。从心，文聲。《周書》曰：‘在受德忞。’讀若旻。”', '27.6015': '《說文》：“怕，無為也。从心，白聲。”', '27.6025': '《說文》：“㤂，褊也。从心，及聲。”', '27.601A': '《說文》：“怚，驕也。从心，且聲。”', '27.602A': '《說文》：“怪，異也。从心，圣聲。”', '27.602B': '《說文》：“怫，鬱也。从心，弗聲。”', '27.E908': '《說文》：“𢗊，忽也。从心，介聲。《孟子》曰：‘孝子之心不若是𢗊。’”', '27.5FFD': '《說文》：“忽，忘也。从心，勿聲。”', '27.6033': '《說文》：“怳，狂之皃。从心，況省聲。”', '27.600B': '《說文》：“怋，怓也。从心，民聲。”', '27.6013': '《說文》：“怓，亂也。从心，奴聲。《詩》曰：‘以謹怋怓。’”', '27.5FE5': '《說文》：“忥，癡皃。从心，气聲。”', '27.5FFF': '《說文》：“忿，悁也。从心，分聲。”', '27.6028': '《說文》：“怨，恚也。从心，夗聲。𢘖，古文。”', '27.600F': '《說文》：“怏，不服懟也。从心，央聲。”', '27.601B': '《說文》：“怛，憯也。从心，旦聲。𢘇，怛或从心在旦下。《詩》曰：‘信誓𢘇𢘇。’”', '27.602E': '《說文》：“怮，憂皃。从心，幼聲。”', '27.6032': '《說文》：“怲，憂也。从心，丙聲。《詩》曰：‘憂心怲怲。’”', '27.6035': '《說文》：“怵，恐也。从心，术聲。”', '27.E929': '《說文》：“悑，惶也。从心，甫聲。怖，或从布聲。”', '27.5FDD': '《說文》：“忝，辱也。从心，天聲。”', '27.600D': '《說文》：“怍，慙也。从心，作省聲。”', '27.6029': '《說文新附》：“怩，衂怩，慙也。从心，尼聲。”', '27.600A': '《說文新附》：“怊，悲也。从心，召聲。”', '27.6CB3': '《說文》：“河，水。出焞煌塞外昆侖山，發原注海。从水，可聲。”', '27.6CD1': '《說文》：“泑，澤。在昆侖下。从水，幼聲。讀與𣢜同。”', '27.6CB1': '《說文》：“沱，江別流也，出㟭山東，別為沱。从水，它聲。”', '27.6CAB': '《說文》：“沫，水。出蜀西徼外，東南入江。从水，末聲。”', '27.6CAE': '《說文》：“沮，水。出漢中房陵，東入江。从水，且聲。”', '27.6CBE': '《說文》：“沾，水。出壺關，東入淇。一曰沾，益也。从水，占聲。”', '27.6CBF': '《說文》：“沿，緣水而下也。从水，㕣聲。《春秋傳》曰：‘王沿夏。’”', '27.6CF2': '《說文》：“泲，沇也，東入于海。从水，𠂔聲。”', '27.6CE0': '《說文》：“泠，水。出丹陽宛陵，西北入江。从水，令聲。”', '27.6CB9': '《說文》：“油，水。出武陵孱陵西，東南〔北〕入江。从水，由聲。”', '27.6CC4': '《說文》：“泄，水。受九江博安洵波，北入氐。从水，世聲。”', '27.6CE1': '《說文》：“泡，水。出山陽平樂，東北入泗。从水，包聲。”', '27.6CD7': '《說文》：“泗，受泲水，東入淮。从水，四聲。”', '27.6CAD': '《說文》：“沭，水。出青州浸。从水，术聲。”', '27.6CBB': '《說文》：“治，水。出東萊曲城陽丘山，南入海。从水，台聲。”', '27.6CDC': '《說文》：“泜，水。在常山。从水，氐聲。”', '27.6CBD': '《說文》：“沽，水。出漁陽塞外，東入海。从水，古聲。”', '27.6CD2': '《說文》：“泒，水。起鴈門葰人戍夫山，東北入海。从水，瓜聲。”', '27.6CE5': '《說文》：“泥，水。出北地郁郅北蠻中。从水，尼聲。”', '27.6CCC': '《說文》：“泌，俠流也。从水，必聲。”', '27.6CEB': '《說文》：“泫，湝流也。从水，玄聲。上黨有泫氏縣。”', '27.6CC1': '《說文》：“況，寒水也。从水，兄聲。”', '27.6CEC': '《說文》：“泬，水从孔穴疾出也。从水，从穴，穴亦聲。”', '27.6CE2': '《說文》：“波，水涌流也。从水，皮聲。”', '27.6CD3': '《說文》：“泓，下深皃。从水，弘聲。”', '27.6CD9': '《說文》：“泙，谷也。从水，平聲。”', '27.6CCF': '《說文》：“泏，水皃。从水，出聲。讀若窋。”', '27.6CC6': '《說文》：“泆，水所蕩泆也。从水，失聲。”', '27.6CB4': '《說文》：“沴，水不利也。从水，㐱聲。《五行傳》曰：‘若其沴作。’”', '27.6CB8': '《說文》：“沸，畢沸，濫泉。从水，弗聲。”', '27.6CBC': '《說文》：“沼，池水。从水，召聲。”', '27.6CE8': '《說文》：“注，灌也。从水，主聲。”', '27.6CED': '《說文》：“泭，編木以渡也。从水，付聲。”', '27.6CDD': '《說文》：“㴑，逆流而上曰㴑洄。㴑，向也，水欲下，違之而上也。从水，㡿聲。遡，㴑或从朔。”', '27.6CF3': '《說文》：“泳，潛行水中也。从水，永聲。”', '27.6CDB': '《說文》：“泛，浮也。从水，乏聲。”', '27.6CF1': '《說文》：“泱，滃也。从水，央聲。”', '27.6CD0': '《說文》：“泐，水石之理也。从水，从阞。《周禮》曰：‘石有時而泐。’”', '27.6CE7': '《說文》：“泧，瀎泧也。从水，戉聲。讀若椒樧之樧。”', '27.6CD4': '《說文》：“泔，周謂潘曰泔。从水，甘聲。”', '27.6F3F': '《說文》：“𤖅，酢𤖅也。从水，將省聲。𤕯，古文𤖅省。”', '27.6CC2': '《說文》：“泂，滄也。从水，冋聲。”', '27.6CAC': '《說文》：“沬，洒面也。从水，未聲。湏，古文沬从頁。”', '27.6CE3': '《說文》：“泣，無聲出涕曰泣。从水，立聲。”', '27.6CEE': '《說文》：“泮，諸矦鄉射之宮，西南為水，東北為牆。从水，从半，半亦聲。”', '27.6CEF': '《說文新附》：“泯，滅也。从水，民聲。”', '27.6C9D': '《說文》：“沝，二水也。闕。”', '27.4F83': '《說文》：“侃，剛直也。从㐰，㐰，古文信；从川，取其不舍晝夜。《論語》曰：‘子路侃侃如也。’”', '27.96E8': '《說文》：“雨，水从雲下也。一象天，冂象雲，水霝其間也。𠕲，古文。”', '27.975E': '《說文》：“非，違也。从飛下翄，取其相背。”', '27.4E73': '《說文》：“乳，人及鳥生子曰乳，獸曰產。从孚，从乙。乙者，玄鳥也。《明堂》、《月令》：‘玄鳥至之日，祠于高禖以請子。’故乳从乙。請子必以乙至之日者，乙春分來，秋分去，開生之候鳥，帝少昊司分之官也。”', '27.5230': '《說文》：“到，至也。从至，刀聲。”', '27.623F': '《說文》：“房，室在旁也。从戶，方聲。”', '27.9580': '《說文》：“門，聞也。从二戶，象形。”', '27.62C7': '《說文》：“拇，將指也。从手，母聲。”', '27.62B5': '《說文》：“抵，擠也。从手，氐聲。”', '27.62C9': '《說文》：“拉，摧也。从手，立聲。”', '27.E9FD': '《說文》：“𢪇，扶也。从手，爿聲。”', '27.62D1': '《說文》：“拑，脅持也。从手，甘聲。”', '27.62AA': '《說文》：“抪，捫持也。从手，布聲。”', '27.62C8': '《說文》：“拈，𢬴也。从手，占聲。”', '27.62CA': '《說文》：“拊，揗也。从手，付聲。”', '27.634A': '《說文》：“捊，引取也。从手，孚聲。抱，捊或从包。”', '27.627F': '《說文》：“承，奉也，受也。从手，从卪，从𠬞。”', '27.62DB': '《說文》：“招，手呼也。从手，召聲。”', '27.EA0E': '《說文》：“抧，開也。从手，只聲。讀若抵掌之抵。”', '27.62AB': '《說文》：“披，从旁持曰披。从手，皮聲。”', '27.62DA': '《說文》：“拚，拊手也。从手，弁聲。”', '27.62AF': '《說文》：“抯，挹也。从手，且聲。”', '27.62D3': '《說文》：“拓，拾也。陳、宋語。从手，石聲。摭，拓或从庶。”', '27.EDEC': '《說文》：“㩅，引也。从手，畱聲。抽，㩅或从由。𢭆，㩅或从秀。”', '27.62D4': '《說文》：“拔，擢也。从手，犮聲。”', '27.EA20': '《說文》：“抲，抲撝也。从手，可聲。《周書》曰：‘盡執抲。’”', '27.62D9': '《說文》：“拙，不巧也。从手，出聲。”', '27.62A8': '《說文》：“抨，撣也。从手，平聲。”', '27.62B6': '《說文》：“抶，笞擊也。从手，失聲。”', '27.62B0': '《說文》：“抰，以車鞅擊也。从手，央聲。”', '27.62C2': '《說文》：“拂，過擊也。从手，弗聲。”', '27.EA2B': '《說文》：“拕，曳也。从手，它聲。”', '27.62B4': '《說文》：“抴，捈也。从手，世聲。”', '27.62D7': '《說文新附》：“拗，手拉也。从手，幼聲。”', '27.62CB': '《說文新附》：“拋，棄也。从手，从尤〔尢〕，从力；或从手，𠠵聲。”', '27.59D3': '《說文》：“姓，人所生也。古之神聖母，感天而生子，故稱天子。从女，从生，生亦聲。《春秋傳》曰：‘天子因生以賜姓。’”', '27.59BB': '《說文》：“妻，婦與夫齊者也。从女，从屮，从又。又，持事，妻職也。𡜈，古文妻从𡭙、女。𡭙，古文貴字。”', '27.59C1': '《說文》：“姁，嫗也。从女，句聲。”', '27.59D0': '《說文》：“姐，蜀謂母曰姐，淮南謂之社。从女，且聲。”', '27.59D1': '《說文》：“姑，夫母也。从女，古聲。”', '27.59CA': '《說文》：“姊，女兄也。从女，𠂔聲。”', '27.59B9': '《說文》：“妹，女弟也。从女，未聲。”', '27.EA35': '《說文》：“妿，女師也。从女，加聲。杜林說。加教於女也，讀若阿。”', '27.EA38': '《說文》：“妭，婦人美也。从女，犮聲。”', '27.EA3D': '《說文》：“妸，女字也。从女，可聲。讀若阿。”', '27.59B5': '《說文》：“妵，女字也。从女，主聲。”', '27.59CB': '《說文》：“始，女之初也。从女，台聲。”', '27.59B4': '《說文》：“妴，婉也。从女，夗聲。”', '27.59D4': '《說文》：“委，委隨也。从女，从禾。”', '27.EA4B': '《說文》：“㚲，小弱也。一曰女輕薄善走也。一曰多技藝也。从女，占聲。或讀若占。”', '27.EA4F': '《說文》：“姂，婦人皃。从女，乏聲。”', '27.59F7': '《說文》：“姷，耦也。从女，有聲。讀若祐。侑，姷或从人。”', '27.EA5A': '《說文》：“𡛝，三女為𡛝。𡛝，美也。从女，𡛝省聲。”', '27.59AF': '《說文》：“妯，動也。从女，由聲。”', '27.EA6C': '《說文》：“𡛟，輕也。从女，戉聲。”', '27.59CE': '《說文》：“姎，女人自偁，我也。从女，央聲。”', '27.59CD': '《說文》：“姍，誹也。一曰翼便也。从女，刪省聲。”', '27.59C5': '《說文》：“姅，婦人污也。从女，半聲。《漢律》曰：‘見姅變不得侍祠。’”', '27.59B2': '《說文新附》：“妲，女字。妲己，紂妃。从女，旦聲。”', '27.6C13': '《說文》：“氓，民也。从民，亡聲。讀若盲。”', '27.6216': '《說文》：“或，邦也。从囗，从戈以守一。一，地也。域，或又从土。”', '27.EA86': '《說文》：“𢦟，殺也。从戈，今聲。《商書》曰：‘西伏既𢦟黎。’”', '27.6215': '《說文》：“戕，槍也。他國臣來弒君曰戕。从戈，爿聲。”', '27.F67E': '《說文》：“㦰，絕也。一曰田器。从从持戈。古文讀若咸，讀若《詩》云：‘攕攕女手。’”', '27.6B66': '《說文》：“武，楚莊王曰：夫武，定功戢兵。故止戈為武。”', '27.6214': '《說文》：“戔，賊也。从二戈。《周書》曰：‘戔戔巧言。’”', '27.76F4': '《說文》：“直，正見也。从𠃊，从十，从目。𣓟，古文直。”', '27.74E8': '《說文》：“瓨，似罌，長頸。長十升。讀若洪。从瓦，工聲。”', '27.5F27': '《說文》：“弧，木弓也。从弓，瓜聲。一曰往體寡、來體多曰弧。”', '27.5F28': '《說文》：“弨，弓反也。从弓，召聲。”', '27.5F22': '《說文》：“弢，弓衣也。从弓，从𠬢。𠬢，垂飾，與𡔷同意。”', '27.5F29': '《說文》：“弩，弓有臂者。《周禮》四弩：夾弩、庾弩、唐弩、大弩。从弓，奴聲。”', '27.5F3C': '《說文》：“𢐀，輔也，重也。从弜，㐁聲。”', '27.866F': '《說文》：“虯，龍子有角者。从虫，丩聲。”', '27.7AFA': '《說文》：“竺，厚也。从二，竹聲。”', '27.5764': '《說文》：“坤，地也，《易》之卦也。从土，从申。土位在申。”', '27.5776': '《說文》：“坶，朝歌南七十里地。《周書》：‘武王與射戰于坶野。’从土，母聲。”', '27.5761': '《說文》：“坡，阪也。从土，皮聲。”', '27.576A': '《說文》：“坪，地平也。从土，从平，平亦聲。”', '27.5774': '《說文》：“坴，土塊坴坴也。从土，圥聲。讀若逐。一曰坴梁。”', '27.EB55': '《說文》：“坺，治也。一曰𦥛土謂之坺。《詩》曰：‘武王載坺。’一曰塵貌。从土，犮聲。”', '27.5802': '《說文》：“堂，殿也。从土，尚聲。坣，古文堂。㙶，籀文堂从高。”', '27.576B': '《說文》：“坫，屏也。从土，占聲。”', '27.EB5D': '《說文》：“𡊄，埽除也。从土，弁聲。讀若糞。”', '27.5766': '《說文》：“坦，安也。从土，旦聲。”', '27.EB68': '《說文》：“坿，益也。从土，付聲。”', '27.5777': '《說文》：“坷，坎坷也。从土，可聲。”', '27.577C': '《說文》：“𡍩，裂也。《詩》曰：‘不𡍩不疈。’”', '27.5771': '《說文》：“坱，塵埃也。从土，央聲。”', '27.EB78': '《說文》：“坥，益州部謂螾場曰坥。从土，且聲。”', '27.5773': '《說文新附》：“坳，地不平也。从土，幼聲。”', '27.753F': '《說文》：“甿，田民也。从田，亡聲。”', '27.52BC': '《說文》：“劼，慎也。《周書》曰：‘汝劼毖殷獻臣’。从力，吉聲。”', '27.F5AC': '《說文》：“劵，勞也。从力，卷省聲。”', '27.52BE': '《說文》：“劾，法有辠也。从力，亥聲。”', '27.91D1': '《說文》：“金，五色金也。黄為之長，久薶不生衣，百鍊不輕，从革不違。西方之行，生於土，从土，左右注象金在土中形，今聲。𠊍，古文金。”', '27.9215': '《說文》：“鈕，印鼻也。从金，丑聲。㺲，古文鈕，从玉。”', '27.EBC3': '《說文》：“凭，依几也。从几，从任。《周書》：‘凭玉几。’”', '27.65A7': '《說文》：“斧，斫也。从斤，父聲。”', '27.65A8': '《說文》：“斨，方銎斧也。从斤，爿聲。《詩》曰：‘又缺我斨。’ ”', '27.6240': '《說文》：“所，伐木聲也。从斤，戶聲。”', '27.F0C4': '《說文》：“斦，二斤也。从二斤。”', '27.8ECB': '《說文》：“軋，𨋚也。从車，乙聲。”', '27.5B98': '《說文》：“官，吏事君也。从宀，从𠂤。𠂤猶眾也，此與師同意。”', '27.963F': '《說文》：“阿，大陵也。一曰曲𨸏也。从𨸏，可聲。”', '27.9642': '《說文》：“陂，阪也。一曰沱也。从𨸏，皮聲。”', '27.963B': '《說文》：“阻，險也。从𨸏，且聲。”', '27.9644': '《說文》：“附，附婁，小土山也。从𨸏，付聲。《春秋傳》曰：‘附婁無松柏。’”', '27.963A': '《說文》：“阺，秦謂陵阪曰阺。从𨸏，氐聲。”', '27.EC02': '《說文》：“阸，塞也。从𨸏，戹聲。”', '27.9673': '《說文》：“陳，宛丘，舜後媯滿之所封。从𨸏，从木，申聲。𨸬，古文陳。”', '27.963D': '《說文》：“阽，壁危也。从𨸏，占聲。”', '27.963C': '《說文》：“阼，主階也。从𨸏，乍聲。”', '27.9639': '《說文》：“阹，依山谷為牛馬圈也。从𨸏，去聲。”', '27.F0F8': '《說文》：“叕，綴聯也。象形。”', '27.4E9E': '《說文》：“亞，醜也。象人局背之形。賈侍中說以為次弟也。”', '27.5E9A': '《說文》：“庚，位西方，象秋時萬物庚庚有實也。庚承己，象人𪗇。”', '27.5B63': '《說文》：“季，少偁也。从子，从稚省，稚亦聲。”', '27.5B64': '《說文》：“孤，無父也。从子，瓜聲。”', '27.EC2A': '《說文》：“䏔，食肉也。从丑，从肉。”', '27.81FE': '《說文》：“臾，束縛捽抴為臾。从申，从乙。”', '27.7949': '《說文》：“祉，福也。从示，止聲。”', '27.7947': '《說文》：“祇，地祇，提出萬物者也。从示，氏聲。”', '27.E00A': '《說文》：“𥛱，門內祭先祖所以徬徨。从示，彭聲。《詩》曰：‘祝祭于𥛱’。祊，𥛱或从方。”', '27.E00B': '《說文》：“䃾，以豚祠司命。从示，比聲。漢律曰：‘祠䃾司命。’”', '27.7948': '《說文》：“祈，求福也。从示，斤聲。”', '27.E014': '《說文》：“䄏，地反物為䄏也。从示，芺聲。”', '27.7946': '《說文新附》：“祆，胡神也。从示，天聲。”', '27.7687': '《說文》：“皇，大也。从自，自，始也，始皇者，三皇大君也。自，讀若鼻，今俗以始生子為鼻子。”', '27.7441': '《說文》：“瑁，諸侯執圭朝天子，天子執玉以冒之，似犁冠。《周禮》曰：‘天子執瑁，四寸。’从玉、冒，冒亦聲。㺺，古文省。”', '27.73CC': '《說文》：“珌，佩刀下飾，天子以玉。从玉，必聲。”', '27.73C7': '《說文》：“珇，琮玉之瑑。从玉，且聲。”', '27.73CD': '《說文》：“珍，寶也。从玉，㐱聲。”', '27.73B2': '《說文》：“玲，玉聲。从玉，令聲。”', '27.E036': '《說文》：“玽，石之次玉者。从玉，句聲。讀若苟。”', '27.E03F': '《說文》：“珉，石之美者。从玉，民聲。”', '27.73CA': '《說文》：“珊，珊瑚，色赤，生於海，或生於山。从玉，𠜂省聲。”', '27.73CB': '《說文》：“𤥗，石之有光，璧𤥗也，出西胡中。从玉，丣聲。”', '27.73C8': '《說文》：“珈，婦人首飾。从玉，加聲。《詩》曰：‘副笄六珈。’”', '27.73C2': '《說文新附》：“珂，玉也。从玉，可聲。”', '27.6BD2': '《說文》：“毒，厚也，害人之艸，往往而生。从屮，从毐。𦸕，古文毒，从刀、葍。”', '27.E04F': '《說文》：“䒨，菜也。从艸，矢聲。”', '27.82F9': '《說文》：“苹，蓱也，無根，浮水而生者。从艸，平聲。”', '27.82FA': '《說文》：“苺，馬苺也。从艸，母聲。”', '27.E05E': '《說文》：“苷，甘艸也。从艸，从甘。”', '27.82E6': '《說文》：“苦，大苦，苓也。从艸，古聲。”', '27.8305': '《說文》：“茅，菅也。从艸，矛聲。”', '27.82E1': '《說文》：“苢，芣苢，一名馬舄。其實如李，令人宜子。从艸，㠯聲。《周書所說》。”', '27.82D3': '《說文》：“苓，卷耳也。从艸，令聲。”', '27.82D6': '《說文》：“苖，蓨也。从艸，由聲。”', '27.82DE': '《說文》：“苞，艸也。南陽以為麤履。从艸，包聲。”', '27.8304': '《說文》：“茄，芙蕖莖。从艸，加聲。”', '27.E08A': '《說文》：“𦬸，山薊也。从艸，朮聲。”', '27.82F5': '《說文》：“苵，蕛苵也。从艸，失聲。”', '27.E08D': '《說文》：“苽，雕苽，一名蔣。从艸，瓜聲。”', '27.8301': '《說文》：“茁，艸初生出地皃。从艸，出聲。《詩》曰：‘彼茁者葭。’”', '27.82F1': '《說文》：“英，艸榮而不實者。一曰黃英。从艸，央聲。”', '27.8307': '《說文》：“茇，艸根也。从艸，犮聲。春艸根枯引之而發土為撥，故謂之茇。一曰艸之白華為茇。”', '27.8302': '《說文》：“茂，艸豐盛。从艸，戊聲。”', '27.82D7': '《說文》：“苗，艸生於田者。从艸，从田。”', '27.82DB': '《說文》：“苛，小艸也。从艸，可聲。”', '27.E0A1': '《說文》：“䒦，艸浮水中皃。从艸，乏聲。”', '27.82D1': '《說文》：“苑，所以養禽獸也。从艸，夗聲。”', '27.83D1': '《說文》：“葘，不耕田地。从艸、甾。《易》曰：‘不葘，畬。’甾，葘或省艸。”', '27.8300': '《說文》：“茀，道多草不可行。从艸，弗聲。”', '27.82FE': '《說文》：“苾，馨香也。从艸，必聲。”', '27.82EB': '《說文》：“苫，蓋也。从艸，占聲。”', '27.82E5': '《說文》：“若，擇菜也。从艸、右。右，手也。一曰杜若，香艸。”', '27.82F4': '《說文》：“苴，履中艸。从艸，且聲。”', '27.82E3': '《說文》：“苣，束葦燒。从艸，巨聲。”', '27.82DF': '《說文》：“苟，艸也。从艸，句聲。”', '27.8303': '《說文》：“范，艸也。从艸，氾聲。”', '27.82F3': '《說文》：“苳，艸也。从艸，冬聲。”', '27.82D5': '《說文》：“苕，艸也。从艸，召聲。”', '27.8306': '《說文》：“茆，鳧葵也。从艸，卯聲。《詩》曰：‘言釆其茆。’”', '27.6625': '《說文》：“萅，推也。从艸，从日，艸，春時生也，屯聲。”', '27.F5A7': '《說文》：“㒸，从意也。从八，豕聲。”', '27.80D6': '《說文》：“胖，半體肉也。一曰廣肉。从半，从肉，半亦聲。”', '27.53DB': '《說文》：“叛，半也。从半，反聲。”', '27.E0D3': '《說文》：“牭，四歲牛。从牛，从四，四亦聲。㹑，籀文牭，从貳。”', '27.E0D8': '《說文》：“𤘾，牛駁如星。从牛，平聲。”', '27.E0DB': '《說文》：“𤘸，牛徐行也。从牛，𠬢聲。讀若滔。”', '27.7272': '《說文》：“牲，牛完全。从牛，生聲。”', '27.7274': '《說文》：“牴，觸也。从牛，氐聲。”', '27.54BD': '《說文》：“咽，嗌也。从口，因聲。”', '27.54C6': '《說文》：“哆，張口也。从口，多聲。”', '27.54BA': '《說文》：“咺，朝鮮謂兒泣不止曰咺。从口，宣省聲。”', '27.54B7': '《說文》：“咷，楚謂兒泣不止曰噭咷。从口，兆聲。”', '27.54B3': '《說文》：“咳，小兒笑也。从口，亥聲。孩，古文咳从子。”', '27.54A6': '《說文》：“咦，南陽謂大呼曰咦。从口，夷聲。”', '27.54A8': '《說文》：“咨，謀事曰咨。从口，次聲。”', '27.54A5': '《說文》：“咥，大笑也。从口，至聲。”', '27.54C9': '《說文》：“哉，言之閒也。从口，𢦒聲。”', '27.54A0': '《說文》：“咠，聶語也。从口，从耳。”', '27.54B8': '《說文》：“咸，皆也，悉也。从口，从戌。戌，悉也。”', '27.54C7': '《說文》：“哇，諂聲也。从口，圭聲。”', '27.E0FC': '《說文》：“𠱫，語相訶歫也。从口，歫䇂。䇂，惡聲也。讀若櫱。”', '27.5470': '《說文》：“呰，苛也。从口，此聲。”', '27.54C0': '《說文》：“哀，閔也。从口，衣聲。”', '27.54BC': '《說文》：“咼，口戾不正也。从口，咼聲。”', '27.54AE': '《說文》：“咮，鳥口也。从口，朱聲。”', '27.E748': '《說文》：“𣢜，愁皃。从欠，幼聲。徐鉉注：“《口部》‘呦’字或作‘𣢜’，此重出。”', '27.54A2': '《說文》：“㖾，譁訟也。”', '27.8D74': '《說文》：“赴，趨也。从走，仆省聲。”', '27.8D73': '《說文》：“赳，輕勁有才力也。从走，丩聲。讀若鐈。”', '27.E14A': '《說文》：“歫，止也。从止，巨聲。一曰搶也。一曰超歫。”', '27.524D': '《說文》：“歬，不行而進謂之歬。从止在舟上。”', '27.E14E': '《說文》：“𤴘，機下足所履者。从止，从又，入聲。”', '27.7679': '《說文》：“癹，以足蹋夷艸。从癶、从殳。《春秋傳》曰：‘癹夷蘊崇之。’”', '27.662F': '《說文》：“是，直也。从日、正。昰，籀文是，从古文正。”', '27.E156': '《說文》：“迹，步處也。从辵，亦聲。蹟，或从足、責。𨒪，籀文迹从朿。”', '27.E15E': '《說文》：“䢌，前頡也。从辵，巿聲。賈侍中說，一讀若㭘又若郅。”', '27.8FF0': '《說文》：“述，循也。从辵，朮聲。䢤，籀文从秫。”', '27.8FEE': '《說文》：“迮，迮迮，起也。从辵，作省聲。”', '27.8FEA': '《說文》：“迪，道也。从辵，由聲。”', '27.9077': '《說文》：“遷，登也。从辵，𠨧聲。拪，古文遷从手、西。”', '27.9072': '《說文》：“遲，徐行也。从辵，犀聲。《詩》曰：‘行道遲遲。’𨒈，遲或从𡰥。遟，籀文遲从屖。”', '27.E173': '《說文》：“𨒅，曲行也。从辵，只聲。”', '27.E174': '《說文》：“䢑，怒不進也。从辵，氐聲。”', '27.8FED': '《說文》：“迭，更迭也。从辵，失聲。一曰达。”', '27.8FEB': '《說文》：“迫，近也。从辵，白聲。”', '27.9087': '《說文》：“邇，近也。从辵，爾聲。迩，古文邇。”', '27.8FE3': '《說文》：“迣，迾也。晉趙曰迣。从辵，世聲。讀若寘。”', '27.E184': '《說文》：“𨒋，踰也。从辵，戉聲。《易》曰：‘雜而不𨒋。’”', '27.8FE5': '《說文》：“迥，遠也。从辵，冋聲。”', '27.8FE2': '《說文新附》：“迢，迢遰也。从辵，召聲。”', '27.E191': '《說文》：“𢓡，行平易也。从彳，夷聲。”', '27.5F85': '《說文》：“待，竢也。从彳，寺聲。”', '27.5F8C': '《說文》：“後，遲也。从彳幺夊者，後也。𨒥，古文後从辵。”', '27.5F88': '《說文》：“很，不聽从也。一曰行難也。一曰盭也。从彳，𥃩聲。”', '27.5F8B': '《說文》：“律，均布也。从彳，聿聲。”', '27.5EFA': '《說文》：“建，立朝律也。从聿，从廴。”', '27.884E': '《說文》：“衎，行喜皃。从行，干聲。”', '27.E1BD': '《說文》：“䟔，趣越皃。从足，卜聲。”', '27.E1D4': '《說文》：“𤕟，通也。从爻，从疋，疋亦聲。”', '27.54C1': '《說文》：“品，眾庶也。从三口。”', '27.6241': '《說文》：“扁，署也。从戶、冊。戶冊者，署門戶之文也。”', '27.EC52': '《說文》：“舓，以舌取食也。从舌，易聲。𦧇，舓或从也。”', '27.8A02': '《說文》：“訂，平議也。从言，丁聲。”', '27.E1EF': '《說文》：“䚮，厚也。从言，乃聲。”', '27.8A08': '《說文》：“計，會也，筭也。从言，从十。”', '27.8A07': '《說文》：“訇，騃言聲。从言，勻省聲。漢中西城有訇鄉。又讀若玄。𧥻，籀文不省。”', '27.E215': '《說文》：“訆，大呼也。从言，丩聲。《春秋傳》曰：‘或訆于宋大廟。’”', '27.8A04': '《說文》：“訄，迫也。从言，九聲。讀若求。”', '27.97F3': '《說文》：“音，聲也。生於心有節於外謂之音；宮商角徵羽聲；絲竹金石匏土革木音也。从言，含一。”', '27.5950': '《說文》：“奐，取奐也，一曰大也。从廾，敻省。”', '27.5F07': '《說文》：“弇，蓋也。从廾，从合。𢍔，古文弇。”', '27.8981': '《說文》：“要，身中也，象人要自𦥑之形。从𦥑，交省聲。”', '27.9769': '《說文》：“革，獸皮治去其毛，革更之，象古文𠦶之形。𠦶，古文革，从三十，三十年為一世，而道更也。臼聲。”', '27.70BA': '《說文》：“爲，母猴也，其爲禽好爪，爪，母猴象也；下腹為母猴形。王育曰：‘爪，象形也。’𦥮，古文爲，象兩母猴相對形。”', '27.53DF': '《說文》：“叜，老也。从又，从灾。闕。𡨎，籀文仌寸。𠋢，𡨎或从人。”', '27.F5AE': '《說文》：“叚，借也。闕。𠖊，古文叚。𠭊，譚長說叚如此。”', '27.5EA6': '《說文》：“度，法制也。从又，庶省聲。”', '27.F0D2': '《說文》：“𦘔，聿飾也。从聿，从彡。俗語以書好為𦘔。讀若𣸁。”', '27.794B': '《說文》：“祋，殳也。从殳，示聲。或說城郭市里高縣羊皮，有不當入而欲入者，暫下以驚牛馬曰祋，故从示、殳。《詩》曰：‘何戈與祋。’”', '27.6BB5': '《說文》：“段，椎物也。从殳，耑省聲。”', '27.6543': '《說文》：“敃，彊也。从攴，民聲。”', '27.F126': '《說文》：“敄，彊也。从攴，矛聲。”', '27.E2B6': '《說文》：“敀，迮也。从攴，白聲。”', '27.6545': '《說文》：“故，使為之也。从攴，古聲。”', '27.653F': '《說文》：“政，正也。从攴，从正，正亦聲。”', '27.E2CC': '《說文》：“敂，擊也。从攴，句聲。”', '27.754B': '《說文》：“畋，平田也。从攴、田。《周書》曰：‘畋尒田。’”', '27.8C9E': '《說文》：“貞，卜問也。从卜，貝以為贄。一曰鼎省聲，京房所說。”', '27.E2D8': '《說文》：“𠧩，《易》卦之上體也。《商書》：‘曰貞，曰𠧩。’从卜，每聲。”', '27.F39E': '《說文》：“𥄎，舉目使人也。从攴，从目。讀若𩖶。”', '27.76FC': '《說文》：“盼，《詩》曰：‘美目盼兮。’从目，分聲。”', '27.7705': '《說文》：“眅，多白眼也。从目，反聲。《春秋傳》曰：‘鄭游眅，字子明。’”', '27.770A': '《說文》：“眊，目少精也。从目，毛聲。《虞書》耄字从此。”', '27.E2EB': '《說文》：“眂，眂皃。从目，氏聲。”', '27.7708': '《說文》：“眈，視近而志遠。从目，冘聲。《易》曰：‘虎視眈眈。’”', '27.E2EF': '《說文》：“䀛，目冥遠視也。从目，勿聲。一曰久也。一曰旦明也。”', '27.76F8': '《說文》：“相，省視也。从目，从木。《易》曰：‘地可觀者莫可觀於木。’《詩》曰：‘相鼠有皮。’”', '27.770B': '《說文》：“看，睎也。从手下目。𥉏，看或从倝。”', '27.E303': '《說文》：“䀗，涓目也。从目，夬聲。”', '27.7707': '《說文》：“眇，一目小也。从目，从少，少亦聲。”', '27.7704': '《說文》：“眄，目偏合也。一曰衺視也。秦語。从目，丏聲。”', '27.F0F0': '《說文》：“𥄗，捾目也。从目、㕚。”', '27.76FB': '《說文》：“盻，恨視也。从目，兮聲。”', '27.7709': '《說文》：“眉，目上毛也。从目，象眉之形，上象頟理也。”', '27.7701': '《說文》：“省，視也。从眉省，从屮。𡮀，古文从少，从囧。”', '27.76FE': '《說文》：“盾，瞂也，所以扞身蔽目。象形。”', '27.7686': '《說文》：“皆，俱詞也。从比，从白。”', '27.7FBF': '《說文》：“𦐧，羽之𦐧風。亦古諸侯也。一曰射師。从羽，幵聲。”', '27.E317': '《說文新附》：“𦏺，飛聲。从羽，工聲。”', '27.F10B': '《說文》：“𥄕，目不正也。从𦫳，从目。莧从此，讀若末。”', '27.7F8E': '《說文》：“美，甘也。从羊，从大。”', '27.7F91': '《說文》：“羑，進善也。从羊，久聲。文王拘羑里，在湯陰。”', '27.F5BD': '《說文》：“爯，并舉也。从爪，冓省。”', '27.5E7D': '《說文》：“幽，隱也。从山，中𢆶，𢆶亦聲。”', '27.7386': '《說文》：“玆，黑也。从二玄。”', '27.7230': '《說文》：“爰，引也。从𠬪，从于。籀文以為車轅字。”', '27.E36F': '《說文》：“𤔂，撮也。从𠬪，从己。”', '27.6B82': '《說文》：“殂，往死也。从歺，且聲。《虞書》曰：‘勛乃殂’。𡲡，古文殂从歺，从作。”', '27.6B86': '《說文》：“殆，危也。从歺，台聲。”', '27.6B83': '《說文》：“殃，咎也。从歺，央聲。”', '27.E381': '《說文》：“㱠，枯也。从歺，古聲。”', '27.80CE': '《說文》：“胎，婦孕三月也。从肉，台聲。”', '27.80C3': '《說文》：“胃，穀府也。从肉、。象形。”', '27.80CC': '《說文》：“背，𦟝也。从肉，北聲。”', '27.80C2': '《說文》：“胂，夾𦟝肉也。从肉，申聲。”', '27.80E0': '《說文》：“胠，亦下也。从肉，去聲。”', '27.80E4': '《說文》：“胤，子孫相承續也。从肉，从八，象其長也；从幺，象重累也。𦞩，古文胤。”', '27.80C4': '《說文》：“胄，胤也。从肉，由聲。”', '27.80D7': '《說文》：“胗，脣瘍也。从肉，㐱聲。疹，籀文胗从疒。”', '27.80DD': '《說文》：“胝，腄也。从肉，氐聲。”', '27.80C5': '《說文》：“胅，骨差也。从肉，失聲。讀與跌同。”', '27.80D9': '《說文》：“胙，祭福肉也。从肉，乍聲。”', '27.E39E': '《說文》：“䏟，𦘺肉也。从肉，必聲。”', '27.80E1': '《說文》：“胡，牛𩔞垂也。从肉，古聲。”', '27.80D8': '《說文》：“胘，牛百葉也。从肉，弦省聲。”', '27.80CA': '《說文》：“胊，脯挺也。从肉，句聲。”', '27.80E5': '《說文》：“胥，蟹醢也。从肉，疋聲。”', '27.80DC': '《說文》：“胜，犬膏臭也。从肉，生聲。一曰不孰也。”', '27.E3AF': '《說文》：“𦚙，食所遺也。从肉，仕聲。《易》曰：‘噬乾𦚙。’胏，揚雄說𦚙从𠂔。”', '27.E3B3': '《說文》：“䏣，蠅乳肉中也。从肉，且聲。”', '27.524A': '《說文》：“削，鞞也。一曰析也。从刀，肖聲。”', '27.5247': '《說文》：“則，等畫物也。从刀，从貝。貝，古之物貨也。𠟻，古文則。𠞋，亦古文則。𠟭，籀文則从鼎。”', '27.E3C8': '《說文》：“剈，挑取也。从刀，肙聲。一曰窐也。”', '27.5249': '《說文》：“剉，折傷也。从刀，坐聲。”', '27.5244': '《說文》：“剄，刑也。从刀，巠聲。”', '27.524E': '《說文新附》：“剎，柱也。从刀。未詳。殺省聲。”', '27.89D3': '《說文》：“觓，角皃。从角，丩聲。《詩》曰：‘兕觵其觓。’”', '27.7AFF': '《說文》：“竿，竹梃也。从竹，干聲。”', '27.7AFD': '《說文》：“竽，管三十六簧也。从竹，亏聲。”', '27.E41E': '《說文》：“𢌴，具也。从丌，𠨎聲。𢁅，古文巽。𢁌，篆文巽。”', '27.E425': '《說文》：“𣌧，告也。从曰，从冊，冊亦聲。”', '27.66F7': '《說文》：“曷，何也。从曰，匃聲。”', '27.58F4': '《說文》：“壴，陳樂立而上見也。从屮，从豆。”', '27.8650': '《說文》：“虐，殘也。从虍，虎足反爪人也。𧆱，古文虐如此。”', '27.76C4': '《說文》：“盄，器也。从皿，弔聲。”', '27.76C6': '《說文》：“盆，盎也。从皿，分聲。”', '27.76C8': '《說文》：“盈，滿器也。从皿、夃。”', '27.76C5': '《說文》：“盅，器虛也。从皿，中聲。《老子》曰：‘道盅而用之。’”', '27.8841': '《說文》：“衁，血也。从血，亡聲。《春秋傳》曰：‘士刲羊，亦無衁也。’”', '27.76CD': '《說文》：“𥁋，覆也。从血、大。”', '27.65E2': '《說文》：“旣，小食也。从皀，旡聲。《論語》曰：‘不使勝食旣。’”', '27.E466': '《說文》：“冟，飯剛柔不調相著。从皀，冖聲，讀若適。”', '27.6703': '《說文》：“會，合也。从亼，从曾省。曾，益也。，古文會如此。”', '27.7F38': '《說文》：“缸，瓨也。从缶，工聲。”', '27.4EAD': '《說文》：“亭，民所安定也。亭有樓，从高省，丁聲。”', '27.539A': '《說文》：“厚，山陵之厚也。从㫗，从厂。垕，古文厚，从后、土。”', '27.F568': '《說文》：“畐，滿也。从高省，象高厚之形。讀若伏。”', '27.590D': '《說文》：“𡕨，行故道也。从夊，畗省聲。”', '27.81F4': '《說文》：“致，送詣也。从夂，从至。”', '27.F388': '《說文》：“㚇，斂足也。鵲鵙〔鶪〕醜，其飛也㚇。从夊，兇聲。”', '27.821E': '《說文》：“舞，樂也。用足相背。从舛，舞聲。𦐀，古文舞从羽、亡。”', '27.97CB': '《說文》：“韋，相背也。从舛，囗聲。獸皮之韋可以束，枉戾相韋背，故借以為皮韋。𣍄，古文韋。”', '27.67DA': '《說文》：“柚，條也，似橙而酢。从木，由聲。《夏書》曰：‘厥包橘柚。’”', '27.67F0': '《說文》：“柰，果也。从木，示聲。”', '27.F038': '《說文》：“𣓀，果實如小栗。从木，辛聲。《春秋傳》曰：‘女摯不過𣓀栗。’”', '27.67CD': '《說文》：“柍，梅也。从木，央聲。一曰江南橦材，其實謂之柍。”', '27.67C0': '《說文》：“柀，檆也。从木，皮聲。一曰折也。”', '27.E4D8': '《說文》：“𣐊，山㯉也。从木，尻聲。”', '27.67DE': '《說文》：“柞，木也。从木，乍聲。”', '27.E4DC': '《說文》：“㭔，木。出橐山。从木，乎聲。”', '27.67C5': '《說文》：“柅，木也，實如棃。从木，尼聲。”', '27.67B8': '《說文》：“枸，木也，可為醬，出蜀。从木，句聲。”', '27.67F3': '《說文》：“柳，小楊也。从木，丣聲。丣，古文酉。”', '27.67B3': '《說文》：“枳，木似橘。从木，只聲。”', '27.67DC': '《說文》：“柜，木也。从木，巨聲。”', '27.696E': '《說文》：“楮，穀也。从木，者聲。柠，楮或从宁。”', '27.67D8': '《說文》：“柘，桑也。从木，石聲。”', '27.67CF': '《說文》：“柏，鞠也。从木，白聲。”', '27.67AE': '《說文》：“枮，木也。从木，占聲。”', '27.67D0': '《說文》：“某，酸果也。从木，从甘，闕。槑，古文某从口。”', '27.67E2': '《說文》：“柢，木根也。从木，氐聲。”', '27.67B5': '《說文》：“枵，木根也。从木，号聲。《春秋傳》曰：‘歲在玄枵。枵，虛也。’”', '27.E4FA': '《說文》：“柖，樹搖皃。从木，召聲。”', '27.67AF': '《說文》：“枯，槀也。从木，古聲。《夏書》曰‘唯箘輅枯’。木名也。”', '27.67D4': '《說文》：“柔，木曲直也。从木，矛聲。”', '27.67DD': '《說文》：“𣔳，判也。《易》曰：‘重門擊𣔳’。”', '27.67F1': '《說文》：“柱，楹也。从木，主聲。”', '27.67E4': '《說文》：“柤，木閑。从木，且聲。”', '27.67F5': '《說文》：“柵，編樹木也。从木，从冊，冊亦聲。”', '27.E50C': '《說文》：“㭒，臿也。从木，㠯聲。一曰徙土輂，齊人語也。梩，或从里。”', '27.E50D': '《說文》：“枱，耒耑也。从木，台聲。鈶，或从金。𨐠，籀文从辝。”', '27.67C3': '《說文》：“柃，木也。从木，令聲。”', '27.67EB': '《說文》：“柫，擊禾連枷也。从木，弗聲。”', '27.67B7': '《說文》：“枷，柫也。从木，加聲。淮南謂之柍。”', '27.67F6': '《說文》：“柶，《禮》有柶。柶，匕也。从木，四聲。”', '27.67ED': '《說文》：“柭，棓也。从木，犮聲。”', '27.67EF': '《說文》：“柯，斧柄也。从木，可聲。”', '27.67C4': '《說文》：“柄，柯也。从木，丙聲。棅，或从秉。”', '27.67F2': '《說文》：“柲，櫕也。从木，必聲。”', '27.67CE': '《說文》：“柎，闌足也。从木，付聲。”', '27.67B9': '《說文》：“枹，擊鼓杖也。从木，包聲。”', '27.67F7': '《說文》：“柷，樂，木空也，所以止音為節。从木，祝省聲。”', '27.E521': '《說文》：“㭕，极也。从木，去聲。”', '27.67E7': '《說文》：“柧，棱也。从木，瓜聲。又柧棱，殿堂上最高之處也。”', '27.67B0': '《說文》：“枰，平也。从木，从平，平亦聲。”', '27.67C6': '《說文》：“柆，折木也。从木，立聲。”', '27.67EE': '《說文》：“柮，斷也。从木，出聲。”', '27.F5C2': '《說文》：“枼，楄也；枼，薄也。从木，世聲。”', '27.67D9': '《說文》：“柙，檻也，以藏虎兕。从木，，古文柙。甲聲。”', '27.5357': '《說文》：“南，艸木至南方有枝任也。从𣎵，𢆉聲。𡴖，古文。”', '27.67EC': '《說文》：“柬，分別簡之也。从束，从八。八，分別也。”', '27.524C': '《說文》：“剌，戾也。从束，从刀。刀者，剌之也。”', '27.56FF': '《說文》：“囿，苑有垣也。从囗，有聲。一曰：禽獸曰囿。𡈹，籀文囿。”', '27.8CA0': '《說文》：“負，恃也。从人守貝有所恃也。一曰受貸不償。”', '27.90CA': '《說文》：“郊，距國百里為郊。从邑，交聲。”', '27.90C1': '《說文》：“郁，右扶風郁夷也。从邑，有聲。”', '27.90C3': '《說文》：“郃，左馮翊郃陽縣。从邑，合聲。《詩》曰：‘在郃之陽。’”', '27.E560': '《說文》：“𨚶，左馮翊谷口鄉。从邑，秊聲。讀若寕。”', '27.90BD': '《說文》：“邽，隴西上邽也。从邑，圭聲。”', '27.E565': '《說文》：“邼，河東聞喜鄉。从邑，匡聲。”', '27.90C7': '《說文》：“郇，周武王子所封國，在晉地。从邑，旬聲。讀若泓。”', '27.90C5': '《說文》：“郅，北地郁郅縣。从邑，至聲。”', '27.90CB': '《說文》：“郋，汝南邵陵里。从邑，自聲。讀若奚。”', '27.E56D': '《說文》：“䣁，南陽舞陰亭。从邑，羽聲。”', '27.90BE': '《說文》：“邾，江夏縣。从邑，朱聲。”', '27.E575': '《說文》：“䣂，今桂陽䣂陽縣。从邑，耒聲。”', '27.E579': '《說文》：“䢻，地名。从邑，臣聲。”', '27.90BF': '《說文》：“邿，附庸國。在東平亢父邿亭。从邑，寺聲。《春秋傳》曰：‘取邿’。”', '27.90D5': '《說文》：“郕，魯孟氏邑。从邑，成聲。”', '27.90CE': '《說文》：“郎，魯亭也。从邑，良聲。”', '27.90C8': '《說文》：“郈，東平無鹽鄉。从邑，后聲。”', '27.E580': '《說文》：“郂，陳留鄉。从邑，亥聲。”', '27.E582': '《說文》：“𨚴，地名。从邑，如聲。”', '27.90F1': '《說文》：“郱，地名。从邑，并聲。”', '27.F0C2': '《說文》：“𨞠，里中道。䢽，篆文。”', '27.6627': '《說文》：“昧爽，旦明也。从日，未聲。一曰闇也。”', '27.662D': '《說文》：“昭，日明也。从日，召聲。”', '27.662B': '《說文》：“昫，日出溫也。从日，句聲。”', '27.6634': '《說文》：“昴，白虎宿星。从日，卯聲。”', '27.6628': '《說文》：“昨，壘日也。从日，乍聲。”', '27.E59C': '《說文》：“昪，喜樂皃。从日，弁聲。”', '27.6631': '《說文》：“昱，明日也。从日，立聲。”', '27.66B1': '《說文》：“暱，日近也。从日，匿聲。《春秋傳》曰：‘私降暱燕。’昵，暱或从尼。”', '27.6636': '《說文新附》：“昶，日長也。从日、永，會意。”', '27.6620': '《說文新附》：“映，明也，隱也。从日，央聲。”', '27.6633': '《說文新附》：“昳，日昃也。从日，失聲。”', '27.65BD': '《說文》：“施，旗皃。从㫃，也聲。亝欒施字子旗，知施者旗也。”', '27.E5AD': '《說文》：“曐，萬物之精，上為列星。从晶，生聲。一曰象形，从口，古口復注中，故與日同。𠻖，古文星。星，曐或省。”', '27.670F': '《說文》：“朏，月未盛之明。从月、出。《周書》曰：‘丙午朏。’”', '27.F481': '《說文》：“𠧪，艸木實垂𠧪𠧪然。象形。𠨋，籀文三𠧪為𠧪。”', '27.E5D1': '《說文》：“秔，稻屬，从禾亢聲。稉，秔或从更聲。”', '27.79CF': '《說文》：“秏，稻屬。从禾，毛聲。伊尹曰：‘飯之美者，玄山之禾，南海之秏。’”', '27.F069': '《說文》：“𥝩，禾成秀也，人所以收。从禾、爪。穗，𥝩或从禾，惠聲。”', '27.79D2': '《說文》：“秒，禾芒也。从禾，少聲。”', '27.79D5': '《說文》：“秕，不成粟也。从禾，比聲。”', '27.79CB': '《說文》：“秋，禾穀孰也。从禾，𪚰省聲。𥤚，籀文不省。”', '27.79D1': '《說文》：“科，程也。从禾，从斗。斗者，量也。”', '27.9999': '《說文》：“香，芳也。从黍，从甘。《春秋傳》曰：‘黍稷馨香。’”', '27.E5FF': '《說文》：“䉺，陳臭米。从米，工聲。”', '27.7C79': '《說文新附》：“籹，粔籹也。从米，女聲。”', '27.81FF': '《說文》：“臿，舂去麥皮也。从臼，干，所以臿之。”', '27.67B2': '《說文》：“枲，麻也。从𣎳，台聲。䢄，籀文枲。从𣏕，从辝。”', '27.8011': '《說文》：“耑，物初生之題也。上象生形，下象其根也。”', '27.97ED': '《說文》：“韭，菜名。一穜而久者，故謂之韭。象形，在一之上。一，地也。此與耑同意。”', '27.5BA4': '《說文》：“室，實也。从宀，从至。至，所止也。”', '27.5BA3': '《說文》：“宣，天子宣室也。从宀，亘聲。”', '27.E614': '《說文》：“𡧮，戶樞聲也。室之東南隅。从宀，㫐聲。”', '27.E61C': '《說文》：“𡧯，無人聲。从宀，尗聲。”', '27.5BA6': '《說文》：“宦，仕也。从宀，从臣。”', '27.5BA5': '《說文》：“宥，寬也。从宀，有聲。”', '27.5BA2': '《說文》：“客，寄也。从宀，各聲。”', '27.7A7F': '《說文》：“穿，通也。从牙在穴中。”', '27.E635': '《說文》：“䆕，穿也。从穴，決省聲。”', '27.7A81': '《說文》：“突，犬从穴中暫出也。从犬在穴中。一曰滑也。”', '27.7A80': '《說文》：“窀，葬之厚夕。从穴，屯聲。《春秋傳》曰：‘窀穸从先君於地下。’”', '27.E64C': '《說文》：“疦，𤺉也。从疒，決省聲。”', '27.75A5': '《說文》：“疥，搔也。从疒，介聲。”', '27.E659': '《說文》：“𤴿，皮剝也。从疒，冄聲。𤵓，籀文从𠬝。”', '27.75A2': '《說文》：“疢，熱病也。从疒，从火。”', '27.75A7': '《說文》：“疧，病也。从疒，氏聲。”', '27.E65F': '《說文》：“㽺，病劣也。从疒，及聲。”', '27.75AB': '《說文》：“疫，民皆疾也。从疒，役省聲。”', '27.51A0': '《說文》：“冠，絭也。所以絭髮，弁冕之總名也。从冖，从元，元亦聲。冠有法制，从寸。”', '27.5191': '《說文》：“冑，兜鍪也。从冃，由聲。𩊄，《司馬法》冑从革。”', '27.5192': '《說文》：“冒，冡而前也。从冃，从目。𡈘，古文冒。”', '27.7F58': '《說文》：“𦊾，兔罟也。从网，否聲。”', '27.E674': '《說文》：“𦊂，罟也。从网，互聲。”', '27.5E25': '《說文》：“帥，佩巾也。从巾，𠂤。帨，帥或从兌。”', '27.5E24': '《說文》：“帤，巾帤也。从巾，如聲。一曰幣巾。”', '27.E67D': '《說文》：“㡃，設色之工，治絲練者。从巾，巟聲。一曰𢂩隔。讀若荒。”', '27.E67E': '《說文》：“㡄，領耑也。从巾，旬聲。”', '27.5E23': '《說文》：“帣，囊也。今鹽官三斛為一帣。从巾，𢍏聲。”', '27.5E2D': '《說文》：“席，籍也。《禮》：‘天子、諸侯席，有黼繡純飾。’从巾，庶省。𠩛，古文席，从石省。”', '27.5E1F': '《說文新附》：“帟，在上曰帟。从巾，亦聲。”', '27.F0E9': '《說文》：“皅，艸華之白也。从白，巴聲。”', '27.4FC5': '《說文》：“俅，冠飾皃。从人，求聲。《詩》曰：‘弁服俅俅。’”', '27.4FCA': '《說文》：“俊，材千人也。从人，夋聲。”', '27.4FDF': '《說文》：“俟，大也。从人，矣聲。《詩》曰：‘伾伾俟俟。’”', '27.4FC1': '《說文》：“俁，大也。从人，吳聲。”', '27.4FDA': '《說文》：“俚，聊也。从人，里聲。”', '27.4FB9': '《說文》：“侹，長皃。一曰箸地，一曰代也。从人，廷聲。”', '27.E6B5': '《說文》：“俌，輔也。从人，甫聲。”', '27.4FDC': '《說文》：“俜，使也。从人，甹聲。”', '27.4FE0': '《說文》：“俠，俜也。从人，夾聲。”', '27.E6B6': '《說文》：“侸，立也。从人，豆聲。讀若樹。”', '27.4FB3': '《說文》：“侳，安也。从人，坐聲。”', '27.4FB5': '《說文》：“侵，漸進也。从人、又，持帚若埽之進。又，手也。”', '27.4FBF': '《說文》：“便，安也。人有不便，更之。从人、更。”', '27.4FD4': '《說文》：“俔，譬諭也。一曰閒見。从人，从見。《詩》曰：‘俔天也妹。’”', '27.E6B8': '《說文》：“俒，完也。《逸周書》曰：‘朕實不明，以俒伯父’，从人，从完。”', '27.4FD7': '《說文》：“俗，習也。从人，谷聲。”', '27.EE75': '《說文》：“俆，緩也。从人，余聲。”', '27.4FC4': '《說文》：“俄，行頃也。从人，我聲。”', '27.4FD9': '《說文》：“俙，訟面相是。从人，希聲。”', '27.4FD1': '《說文》：“俑，痛也。从人，甬聲。”', '27.4FC3': '《說文》：“促，迫也。从人，足聲。”', '27.4FC2': '《說文》：“係，絜束也。从人，从系，系亦聲。”', '27.4FD8': '《說文》：“俘，軍所獲也。从人，孚聲。”', '27.E6CB': '《說文》：“㑗，神也。从人，身聲。”', '27.4FC7': '《說文》：“俇，遠行也。从人，狂聲。”', '27.4FB6': '《說文新附》：“侶，徒侶也。从人，呂聲。”', '27.4FB2': '《說文新附》：“侲，童子也。从人，辰聲。”', '27.E6CD': '《說文》：“𠤗，未定也。从匕，𠤕聲。𠤕，古文矢字。”', '27.6BD6': '《說文》：“毖，慎也。从比，必聲。”', '27.91CD': '《說文》：“重，厚也。从壬，東聲。”', '27.8867': '《說文》：“衧，諸衧也。从衣，于聲。”', '27.E6EC': '《說文》：“衦，摩展衣。从衣，干聲。”', '27.8870': '《說文》：“衰，艸雨衣。秦謂之萆。从衣象形。𠆂，古文衰。”', '27.886B': '《說文新附》：“衫，衣也。从衣，彡聲。”', '27.8007': '《說文》：“耇，老人面凍黎若垢。从老省，句聲。”', '27.E6FA': '《說文》：“𦒻，老人面如點也。从老省，占聲。讀若耿介之耿。”', '27.E702': '《說文》：“㞒，臥息也。从尸、自。”', '27.5C51': '《說文》：“㞕，動作切切也。从尸，䏌聲。”', '27.E705': '《說文》：“㞓，尻也。从尸，旨聲。”', '27.5C4D': '《說文》：“屍，終主。从尸，从死。”', '27.5C4B': '《說文》：“屋，居也。从尸，尸，所主也。一曰尸象屋形；从至，至，所至止。室、屋皆从至。𡲃，籀文屋，从厂。𦤼，古文屋。”', '27.5C4F': '《說文》：“屏，敝也。从尸，并聲。”', '27.54AB': '《說文》：“咫，中婦人手長八寸，謂之咫，周尺也。从尺，只聲。”', '27.4FDE': '《說文》：“兪，空中木為舟也。从亼，从舟，从。，水也。”', '27.F11D': '《說文》：“䑣，船行也。从舟，彡聲。”', '27.8996': '《說文》：“視，瞻也。从見、示。𥄙，古文視；眡，亦古文視。”', '27.6B28': '《說文》：“欨，吹也。一曰笑意。从欠，句聲。”', '27.E749': '《說文》：“欪，咄欪，無慙。一曰無腸意。从欠，出聲。讀若卉。”', '27.E750': '《說文》：“𠩗，歠也。从㳄，厂聲。讀若移。”', '27.9801': '《說文》：“頁，頭也。从𦣻，从儿。古文䭫如此。𦣻者䭫首字也。”', '27.982B': '《說文》：“頫，低頭也。从頁，逃省。太史卜書頫仰字如此。楊雄曰：‘人面頫。’俛，頫或从人、免。”', '27.E77A': '《說文》：“𩑣，顫也。从頁尤聲。疣，𩑣或从疣。”', '27.9762': '《說文》：“面，顏前也。从𦣻，象人面形。”', '27.9996': '《說文》：“首，𦣻同，古文𦣻也。巛象髮，謂之鬊，鬊即巛也。”', '27.F3AD': '《說文》：“𥄉，到首也。賈侍中說：此斷首到縣𥄉字。”', '27.5F65': '《說文》：“彥，美士有文，人所言也。从彣，厂聲。”', '27.E7A7': '《說文》：“㖃，厚怒聲。从口、后，后亦聲。”', '27.537B': '《說文》：“卻，節欲也。从卪，𧮫聲。”', '27.530D': '《說文》：“匍，手行也。从勹，甫聲。”', '27.80DE': '《說文》：“胞，兒生裹也。从肉，从包。”', '27.830D': '《說文》：“茍，自急敕也。从羊省，从包省，从口，口猶慎言也。从羊，羊與善美同意。𦰶，古文，羊不省。”', '27.79BA': '《說文》：“禺，母猴屬，頭似鬼。从甶，从禸。”', '27.5CCB': '《說文新附》：“峋，嶙峋也。从山，旬聲。”', '27.5EA0': '《說文》：“庠，禮官養老，夏曰校，殷曰庠，周曰序。从广，羊聲。”', '27.5EC4': '《說文》：“廄，馬舍也。从广，𣪘聲。《周禮》曰：‘馬有二百十四匹為廄，廄有僕夫。’𠤙，古文从九。”', '27.5EB0': '《說文》：“庰，蔽也。从广，幷聲。”', '27.5EA2': '《說文》：“庢，礙止也。从广，至聲。”', '27.5EA4': '《說文》：“庤，儲置屋下也。从广，寺聲。”', '27.F097': '《說文》：“㡿，郤屋也。从广，屰聲。”', '27.5397': '《說文》：“厗，唐厗，石也。从厂，屖省聲。”', '27.E7ED': '《說文》：“㕊，石閒見。从厂，甫聲，讀若敷。”', '27.5396': '《說文》：“厖，石大也。从厂，尨聲。”', '27.E7EF': '《說文》：“𠩘，𠪮也。从厂，夾聲。”', '27.E7F3': '《說文》：“䎠，丸之孰也。从丸，而聲。”', '27.7814': '《說文》：“研，䃺也。从石，幵聲。”', '27.780C': '《說文新附》：“砌，階甃也。从石，切聲。”', '27.661C': '《說文》：“昜，開也。一曰飛揚，一曰長也，一曰彊者眾皃。”', '27.800F': '《說文》：“耏，罪不至髡也。从而，从彡。耐，或从寸。諸法度字从寸。”', '27.5F56': '《說文》：“彖，豕走也。从彑从豕省。”', '27.72E1': '《說文》：“狡，少狗也。从犬，交聲。匈奴地有狡犬，巨口而黑身。”', '27.72CA': '《說文》：“狊，犬視皃。从犬、目。”', '27.72E0': '《說文》：“狠，吠鬭聲。从犬，艮聲。”', '27.E85C': '《說文》：“狧，犬食也。从犬，从舌。讀若比目魚鰈之鰈。”', '27.72DF': '《說文》：“狟，犬行也。从犬，亘聲。《周書》曰：‘尚狟狟。’”', '27.72E9': '《說文》：“狩，犬田也。从犬，守聲。《易》曰：‘明夷于南狩。’”', '27.709F': '《說文》：“炟，上諱。”', '27.E879': '《說文》：“炪，火光也。从火，出聲。《商書》曰：‘予亦炪謀。’讀若巧拙之拙。”', '27.E87B': '《說文》：“炥，火皃。从火，弗聲。”', '27.70AD': '《說文》：“炭，燒木餘也。从火，岸省聲。”', '27.E881': '《說文》：“炦，火氣也。从火，犮聲。”', '27.70B1': '《說文》：“炱，灰，炱媒也。从火，台聲。”', '27.70AE': '《說文》：“炮，毛炙肉也。从火，包聲。”', '27.70B3': '《說文》：“炳，明也。从火，丙聲。”', '27.70AF': '《說文》：“炯，光也。从火，冋聲。”', '27.70AB': '《說文》：“炫，燿燿也。从火，玄聲。”', '27.E8B1': '《說文》：“䞓，赤色也。从赤，巠聲。《詩》曰：‘魴魚䞓尾’。赬，䞓或从貞。𧹙，或从丁。”', '27.594E': '《說文》：“奎，兩髀之閒。从大，圭聲。”', '27.E8B4': '《說文》：“𡘍，奢𡘍也。从大，亘聲。”', '27.E8BA': '《說文》：“𡗼，瞋大也。从大，此聲。”', '27.5951': '《說文》：“契，大約也。从大，从㓞。《易》曰：‘後代聖人易之以書契。’”', '27.E8C2': '《說文繫傳》：“㞁，行不正也。从𡯁，㫐聲。”', '27.5962': '《說文》：“奢，張也。从大，者聲。奓，籀文。”', '27.594F': '《說文》：“奏，奏進也。从夲，从𠬞，从屮；屮，上進之義。𡲯，古文。𢽥，亦古文。”', '27.5955': '《說文》：“奕，大也。从大，亦聲。《詩》曰：‘奕奕梁山。’”', '27.800E': '《說文》：“耎，稍前大也。从大，而聲，讀若畏偄。”', '27.601D': '《說文》：“思，容也。从心，囟聲。”', '27.6049': '《說文》：“恉，意也。从心，旨聲。”', '27.614E': '《說文》：“慎，謹也。从心，真聲。昚，古文。”', '27.6024': '《說文》：“怤，思也。从心，付聲。”', '27.6054': '《說文》：“恔，憭也。从心，交聲。”', '27.606C': '《說文》：“恬，安也。从心，甛省聲。”', '27.6062': '《說文》：“恢，大也。从心，灰聲。”', '27.606E': '《說文》：“恮，謹也。从心，全聲。”', '27.6042': '《說文》：“恂，信心也。从心，旬聲。”', '27.6043': '《說文》：“恃，賴也。从心，寺聲。”', '27.E8F4': '《說文》：“𢘽，習也。从心，曳聲。”', '27.61CB': '《說文》：“懋，勉也。从心，楙聲。《虞書》曰：‘時惟懋哉。’ 𢘅，或省。”', '27.6064': '《說文》：“恤，憂也；收也。从心，血聲。”', '27.E8FD': '《說文》：“𢘼，疾利口也。从心，从𠕁。《詩》曰：‘相時𢘼民。’”', '27.E902': '《說文》：“𢘋，失常也。从心，代聲。”', '27.6020': '《說文》：“怠，慢也。从心，台聲。”', '27.E90A': '《說文》：“恑，變也。从心，危聲。”', '27.6012': '《說文》：“怒，恚也。从心，奴聲。”', '27.6068': '《說文》：“恨，怨也。从心，艮聲。”', '27.606B': '《說文》：“恫，痛也。一曰呻吟也。从心，同聲。”', '27.6047': '《說文》：“恇，怯也。从心、匡，匡亦聲。”', '27.E927': '《說文》：“㤨，戰慄也。从心，共聲。”', '27.E928': '《說文》：“㤥，苦也。从心，亥聲。”', '27.6070': '《說文新附》：“恰，用心也。从心，合聲。”', '27.6D2E': '《說文》：“洮，水。出隴西臨洮，東北入河。从水，兆聲。”', '27.6D1B': '《說文》：“洛，水。出左馮翊歸德北夷界中，東南入渭。从水，各聲。”', '27.6D08': '《說文》：“洈，水。出南群高城洈山，東入繇。从水，危聲。”', '27.6D2D': '《說文》：“洭，水。出桂陽縣盧聚，山洭浦關為桂水。从水，匡聲。”', '27.E934': '《說文》：“𣳦，水。出汝南新郪，入潁。从水，囟聲。”', '27.6D27': '《說文》：“洧，水。出潁川陽城山，東南入潁。从水，有聲。”', '27.6D39': '《說文》：“洹，水。在齊魯閒。从水，亘聲。”', '27.6D19': '《說文》：“洙，水。出泰山蓋臨樂山，北出泗。从水，朱聲。”', '27.6D0B': '《說文》：“洋，水。出齊臨朐高山，東北入鉅定。从水，羊聲。”', '27.6D28': '《說文》：“洨，水。出常山石邑井陘，東南入于泜。从水，交聲。𨙶國有洨縣。”', '27.6D35': '《說文》：“洵，過水中也。从水，旬聲。”', '27.6D07': '《說文》：“洇，水也。从水，因聲。”', '27.E93F': '《說文》：“洦，淺水也。从水，百聲。”', '27.6D2A': '《說文》：“洪，洚水也。从水，共聲。”', '27.6D1A': '《說文》：“洚，水不遵道。一曰下也。从水，夅聲。”', '27.884D': '《說文》：“衍，水朝宗于海也。从水，从行。”', '27.6D3B': '《說文》：“𣴠，水流聲。从水，𠯑聲。𣽅，𣴠或从𦕾。”', '27.6CDA': '《說文》：“泚，清也。从水，此聲。”', '27.6D38': '《說文》：“洸，水涌光也。从水，从光，光亦聲。《詩》曰：‘有洸有潰。’”', '27.6D1E': '《說文》：“洞，疾流也。从水，同聲。”', '27.6D36': '《說文》：“洶，涌也。从水，匈聲。”', '27.6D0C': '《說文》：“洌，水清也。从水，列聲。《易》曰：‘井𣸟寒泉，食。’”', '27.E949': '《說文》：“洔，水暫益，且止，未減也。从水，寺聲。”', '27.6D3E': '《說文》：“派，別水也。从水，从𠂢，𠂢亦聲。”', '27.6D3C': '《說文》：“洼，深池也。从水，圭聲。”', '27.6D2B': '《說文》：“洫，十里為成，成間廣八尺，深八尺，謂之洫。从水，血聲。《論語》：‘盡力于溝洫。’”', '27.6D10': '《說文》：“洐，溝水行也。从水，从行。”', '27.6D25': '《說文》：“津，水渡也。从水，𦘔聲。𦪉，古文𣸁从舟，从淮。”', '27.6D04': '《說文》：“洄，㴑洄也。从水，从回。”', '27.7805': '《說文》：“砅，履石渡水也。从水，从石。《詩》曰：‘深則砅。’濿，砅或从厲。”', '27.E959': '《說文》：“洓，小雨零皃。从水，朿聲。”', '27.E95B': '《說文》：“洅，雷震洅洅也。从水，再聲。”', '27.6D3D': '《說文》：“洽，霑也。从水，合聲。”', '27.6D3F': '《說文》：“洿，濁水不流也。一曰窳下也。从水，夸聲。”', '27.6D0E': '《說文》：“洎，灌釜也。从水，自聲。”', '27.6D1D': '《說文》：“洝，渜水也。从水，安聲。”', '27.6D0F': '《說文》：“洏，洝也。一曰煮孰也。从水，而聲。”', '27.6D12': '《說文》：“洒，滌也。从水，西聲。古文為灑埽字。”', '27.6D17': '《說文》：“洗，洒足也。从水，先聲。”', '27.67D3': '《說文》：“染，以繒染為色。从水，杂聲。”', '27.6D1F': '《說文》：“洟，鼻液也。从水，夷聲。”', '27.6D3A': '《說文新附》：“洺，水名。从水，名聲。”', '27.E971': '《說文》：“𣹭，水行也。从沝、㐬，㐬，突忽也。流，篆文从水。”', '27.9095': '《說文》：“邕，四方有水自邕城池者。从川，从邑。𡿷，籀文邕。”', '27.6CC9': '《說文》：“泉，水原也。象水流出成川形。”', '27.96E9': '《說文》：“雩，夏祭樂于赤帝以祈甘雨也。从雨，于（亏）聲。𦏻，或从羽。雩，羽舞也。”', '27.98DB': '《說文》：“飛，鳥翥也。象形。”', '27.E9DB': '《說文》：“㧁，閉也。从戶，劫省聲。”', '27.6243': '《說文》：“扃，外閉之關也。从戶，冋聲。”', '27.6307': '《說文》：“指，手指也。从手，旨聲。”', '27.62F1': '《說文》：“拱，斂手也。从手，共聲。”', '27.E9F9': '《說文》：“𢳎，首至地也。从手、𠦪。𠦪，音忽。拜，揚雄說，拜从兩手下。𣬓，古文拜。”', '27.6301': '《說文》：“持，握也。从手，寺聲。”', '27.62CF': '《說文》：“拏，牽引也。从手，奴聲。”', '27.6309': '《說文》：“按，下也。从手，安聲。”', '27.EA05': '《說文》：“𢫦，拊也，从手，百聲。”', '27.EA06': '《說文》：“㧗，捽也。从手，此聲。”', '27.630B': '《說文》：“挋，給也。从手，臣聲。一曰約也。”', '27.630F': '《說文》：“挏，𢹬引也。漢有挏馬官，作馬酒。从手，同聲。”', '27.6311': '《說文》：“挑，撓也。从手，兆聲。一曰摷也。《國語》曰：‘郤至挑夭。’”', '27.62F9': '《說文》：“拹，摺也。从手，劦聲。一曰拉也。”', '27.62FE': '《說文》：“拾，掇也。从手，合聲。”', '27.EA1F': '《說文》：“㧢，就也。从手，因聲。”', '27.62EC': '《說文》：“𢬸，絜也。从手，𠯑聲。”', '27.62EE': '《說文》：“拮，手口共有所作也。从手，吉聲。《詩》曰：‘予手拮据。’”', '27.6303': '《說文》：“挃，穫禾聲也。从手，至聲。《詩》曰：‘穫之挃挃。’”', '27.6302': '《說文》：“挂，畫也。从手，圭聲。”', '27.630C': '《說文》：“挌，擊也。从手，各聲。”', '27.59DC': '《說文》：“姜，神農居姜水，以為姓。从女，羊聲。”', '27.59DE': '《說文》：“姞，黃帝之後百䱔姓，后稷妃家也。从女，吉聲。”', '27.59DA': '《說文》：“姚，虞舜居姚虛，因以為姓。从女，兆聲。或以為姚，嬈也。《史篇》以為姚，易也。”', '27.59FA': '《說文》：“姺，殷諸侯為亂，疑姓也。从女，先聲。《春秋傳》曰：‘商有姺、邳。’”', '27.59FB': '《說文》：“姻，壻家也，女之所因，故曰姻。从女，从因，因亦聲。婣，籀文姻从𣶒。”', '27.5A01': '《說文》：“威，姑也。从女，从戌。《漢律》曰：‘婦告威姑。’”', '27.59EA': '《說文》：“姪，兄之女也。从女，至聲。”', '27.59E8': '《說文》：“姨，妻之女弟同出為姨。从女，夷聲。”', '27.5A00': '《說文》：“娀，帝高辛之妃，偰母號也。从女，戎聲。《詩》曰：‘有娀方將’。”', '27.EA40': '《說文》：“㛄，女字也。从女，衣聲。讀若衣。”', '27.59F6': '《說文》：“姶，女字也。从女，合聲。《春秋傳》曰：‘嬖人婤姶。’一曰無聲。”', '27.EA42': '《說文》：“㛅，女號也。从女，耳聲。”', '27.59DD': '《說文》：“姝，好也。从女，朱聲。”', '27.59E3': '《說文》：“姣，好也。从女，交聲。”', '27.59DB': '《說文》：“𡜝，直項皃。从女，同聲。”', '27.59FD': '《說文》：“姽，閑體也，行姽姽也。从女，危聲。”', '27.59E1': '《說文》：“𡜶，面醜也。”', '27.EA58': '《說文》：“姰，鈞適也。男女併也。从女，旬聲。”', '27.EA59': '《說文》：“姕，婦人小物也。从女，此聲。《詩》曰：‘屢舞姕姕’。”', '27.59FF': '《說文》：“姿，態也。从女，次聲。”', '27.EA61': '《說文》：“𡜂，𡜂鹵，貪也。从女，污聲。”', '27.EA63': '《說文》：“㛆，量也。从女，朵聲。”', '27.5A03': '《說文》：“娃，圜深目皃。或曰，吳楚之間謂好曰娃。从女，圭聲。”', '27.59D8': '《說文》：“姘，除也。漢律，齊人予妻婢姦曰姘。从女，幷聲。”', '27.59E6': '《說文》：“姦，私也。从三女。𢙶，古文姦，从心，旱聲。”', '27.59E4': '《說文新附》：“姤，偶也。从女，后聲。”', '27.533D': '《說文》：“匽，匿也。从匸，妟聲。”', '27.F0B4': '《說文》：“匧，藏也。篋，匧或从竹。”', '27.EA8D': '《說文》：“𠤼，田器也。从匚，攸聲。”', '27.67E9': '《說文》：“柩，棺也。从匚，从木，久聲。匶，籀文柩。”', '27.74EC': '《說文》：“瓬，周家搏埴之工也。从瓦，方聲。讀若㧚破之㧚。”', '27.74EE': '《說文》：“瓮，罌也。从瓦，公聲。”', '27.EA9F': '《說文》：“𤬯，治橐榦也。从瓦，今聲。”', '27.EAA1': '《說文》：“瓪，敗也。从瓦，反聲。”', '27.5F2D': '《說文》：“弭，弓無緣可以解轡紛者。从弓，耳聲。”', '27.EAAB': '《說文》：“𢏗，帝嚳䠶官，夏少康滅之。从弓，幵聲。”', '27.7385': '《說文》：“玅，急戾也，从弦省，少聲。”', '27.7D00': '《說文》：“紀，絲別也。从糸，己聲。”', '27.7D06': '《說文》：“紆，詘也。从糸，于聲。一曰縈也。”', '27.7D04': '《說文》：“約，纏束也。从糸，勺聲。”', '27.7D08': '《說文》：“紈，素也。从糸，丸聲。”', '27.7D05': '《說文》：“紅，帛赤白色。从糸，工聲。”', '27.7D03': '《說文》：“紃，圜采也。从糸，川聲。”', '27.7D09': '《說文》：“紉，繟繩也。从糸，刃聲。”', '27.7D02': '《說文》：“紂，馬緧也。从糸，肘省聲。”', '27.7DE6': '《說文》：“緦，十五升布也。一曰兩麻一絲布也。从糸，思聲。𢆿，古文緦从糸省。”', '27.867A': '《說文》：“虺，虺以注（咮）鳴。《詩》曰：‘胡為虺蜥。’以虫，兀聲。”', '27.F099': '《說文》：“𧈪，蟲曳行也。从虫，屮聲。讀若騁。”', '27.8679': '《說文》：“虹，螮蝀也。狀似蟲。从虫，工聲。《明堂》、《月令》曰：‘虹始見。’”', '27.8674': '《說文新附》：“虴，虴蜢，艸上蟲也。从虫，乇聲。”', '27.4E9F': '《說文》：“亟，敏疾也。从人，从口，从又，从二。二，天地也。”', '27.6046': '《說文》：“恆，常也。从心，从舟，在二之閒上下，心以舟施恆也。𠄨，古文恆从月。《詩》曰：‘如月之恆。’”', '27.5793': '《說文》：“垓，兼垓八極地也。《國語》曰：‘天子居九垓之田。’从土，亥聲。”', '27.57A3': '《說文》：“垣，牆也。从土，亘聲。𩫧，籀文垣从𩫏。”', '27.579B': '《說文》：“垛，堂塾也。从土，朵聲。”', '27.5C01': '《說文》：“封，爵諸矦之土也。从之，从土，从寸，守其制度也。公侯百里，伯七十里，子男五十里。𡉚，古文封省。𡉘，籀文从𡵄。”', '27.578B': '《說文》：“型，鑄器之法也。从土，刑聲。”', '27.57CE': '《說文》：“城，以盛民也。从土，从成，成亦聲。𩫨，籀文城从𩫏。”', '27.EB66': '《說文》：“垎，水乾也。一曰堅也。从土，各聲。”', '27.EB67': '《說文》：“垐，以土增大道上。从土，次聲。堲，古文垐从土、即。《虞書》曰：‘龍，朕堲讒說殄行。’堲，疾惡也。”', '27.EB69': '《說文》：“垍，堅土也。从土，自聲。”', '27.EB6C': '《說文》：“垑，恃也。从土，多聲。”', '27.579D': '《說文》：“垝，毀垣也。从土，危聲。《詩》曰：‘乘彼垝垣。’陒，垝或从𨸏。”', '27.5794': '《說文》：“垔，塞也。《尚書》曰：‘鯀垔洪水。’从土，西聲。𡎱，古文垔。”', '27.57A2': '《說文》：“垢，濁也。从土，后聲。”', '27.57A4': '《說文》：“垤，螘封也。《詩》曰：‘鸛鳴于垤。’从土，至聲。”', '27.5797': '《說文》：“垗，畔也，為四畤界，祭其中。《周禮》曰：‘垗五帝於四郊。’从土，兆聲。”', '27.5782': '《玉篇》：“𡍮，《說文》垂。”', '27.579A': '《說文》：“垚，土高也。从三土。”', '27.7587': '《說文》：“𤲮，耕治之田也。从田，象耕屈之形。𢏚，𤲮或省。”', '27.754C': '《說文》：“畍，境也。从田，介聲。”', '27.EB87': '《說文》：“㽘，境也。一曰陌也。趙魏謂陌為㽘。从田，亢聲。”', '27.52C1': '《說文》：“勁，彊也。从力，巠聲。”', '27.52C9': '《說文》：“勉，彊也。从力，免聲。”', '27.52C0': '《說文》：“勀，尤極也。从力，克聲。”', '27.52C7': '《說文》：“勇，气也。从力，甬聲。𢦨，勇或从戈、用。恿，古文勇从心。”', '27.52C3': '《說文》：“勃，排也。从力，孛聲。”', '27.EBA0': '《說文》：“恊，同心之和。从劦，从心。”', '27.4FCE': '《說文》：“俎，禮俎也。从半肉在且上。”', '27.65AB': '《說文》：“斫，擊也。从斤，石聲。”', '27.65AA': '《說文》：“斪，斫也。从斤，句聲。”', '27.EBCB': '《說文》：“㪵，量物分半也。从斗，从半，半亦聲。”', '27.77DC': '《說文》：“矜，矛柄也。从矛，今聲。”', '27.EBD3': '《說文》：“䂇，剌也。从矛，丑聲。”', '27.8ECD': '《說文》：“軍，圜圍也。四千人為軍。从車，从包省。軍，兵車也。”', '27.8ECC': '《說文》：“軌，車徹也。从車，九聲。”', '27.F08D': '《說文》：“𡴎，危高也。从𠂤，屮聲。讀若臬。”', '27.9650': '《說文》：“限，阻也。一曰門榍。从𨸏，艮聲。”', '27.964B': '《說文》：“𨹟，阨陜也。”', '27.964D': '《說文》：“降，下也。从𨸏，夅聲。”', '27.964A': '《說文》：“陊，落也。从𨸏，多聲。”', '27.EC56': '《說文》：“䧇，酒泉天依阪也。从𨸏，衣聲。”', '27.9654': '《說文》：“陔，階次也。从𨸏，亥聲。”', '27.EC17': '《說文》：“垒，絫墼也。从厽，从土。”', '27.79B9': '《說文》：“禹，蟲也。从厹，象形。𥜼，古文禹。”', '27.5DF9': '《說文》：“巹，謹身有所承也。从己，丞。讀若《詩》云：‘赤舄己己。’”', '27.7678': '《說文》：“癸，冬時水土平，可揆度也。象水從四方流入地中之形。癸承壬，象人足。𤼩，籀文从癶，从矢。”', '27.F109': '《說文》：“孨，謹也。从三子。”', '27.914A': '《說文新附》：“酊，酩酊也。从酉，丁聲。”', '27.914B': '《說文》：“酋，繹酒也。从酉，水半見於上。《禮》有‘大酋’，掌酒官也。”', '27.795C': '《說文》：“祜，上諱。”', '27.7950': '《說文》：“祐，助也。从示，右聲。”', '27.7957': '《說文》：“祗，敬也。从示，氐聲。”', '27.795E': '《說文》：“神，天神，引出萬物者也。从示、申。”', '27.7955': '《說文》：“祕，神也。从示，必聲。”', '27.7954': '《說文》：“祔，後死者合食於先祖。从示，付聲。”', '27.7956': '《說文》：“祖，始廟也。从示，且聲。”', '27.794F': '《說文》：“祏，宗廟主也。周禮有郊宗石室。一曰大夫以石為主。从示，从石，石亦聲。”', '27.7960': '《說文》：“祠，春祭曰祠，品物少，多文詞也。从示，司聲。仲春之月，祠不用犧牲，用圭璧及皮幣。”', '27.795D': '《說文》：“祝，祭主贊詞者。从示，从人、口。一曰从兌省。《易》曰：‘兌，為口為巫。’”', '27.7953': '《說文》：“祓，除惡祭也。从示，犮聲。”', '27.795F': '《說文》：“祟，神禍也。从示，从出。𥜱，籀文祟从𥜹省。”', '27.F0F2': '《說文》：“祘，明視以筭之。从二示。讀若筭。”', '27.795A': '《說文》：“祚，福也。从示，乍聲。”', '27.E01B': '《說文》：“珦，玉也。从玉，向聲。”', '27.73E3': '《說文》：“珣，醫無閭珣玗琪，《周書》所謂夷玉也。从玉，旬聲。一曰器。讀若宣。”', '27.73DB': '《說文》：“珛，朽玉也。从玉，有聲。讀若畜牧之畜。”', '27.73E9': '《說文》：“珩，佩上玉也，所以節行止也。从玉，行聲。”', '27.73E5': '《說文》：“珥，瑱也。从玉、耳，耳亦聲。”', '27.73BC': '《說文》：“玼，玉色鮮也。从玉，此聲。《詩》曰：‘新臺有玼。’”', '27.E02E': '《說文》：“珢，石之似玉者。从玉，艮聲。”', '27.E02F': '《說文》：“𤤺，石之似玉者。从玉，曳聲。”', '27.73E0': '《說文》：“珠，蚌之陰精。从玉，朱聲。《春秋國語》曰：‘珠以禦火灾。’是也。”', '27.E040': '《說文》：“珕，蜃屬。从玉，劦聲。《禮》：‘佩刀，士珕琫而珧珌。’”', '27.73E7': '《說文》：“珧，蜃甲也，所以飾物也。从玉，兆聲。《禮》云：‘佩刀，天子玉琫而珧珌。’”', '27.73DD': '《說文新附》：“珝，玉也。从玉，羽聲。”', '27.73D9': '《說文新附》：“珙，玉也。”', '27.73ED': '《說文》：“班，分瑞玉。从玨，从刀。”', '27.8345': '《說文》：“荅，小尗也。从艸，合聲。”', '27.834F': '《說文》：“荏，桂荏，蘇。从艸，任聲。”', '27.831E': '《說文》：“茞，艸也。从艸，臣聲。”', '27.833F': '《說文》：“𦯋，萹筑也。从艸，筑省聲。”', '27.8316': '《說文》：“茖，艸也。从艸，各聲。”', '27.834D': '《說文》：“荍，蚍𧉈也。从艸，收聲。”', '27.8351': '《說文》：“荑，艸也。从艸，夷聲。”', '27.8325': '《說文》：“茥，缺盆也。从艸，圭聲。”', '27.8353': '《說文》：“荓，馬帚也。从艸，幷聲。”', '27.834C': '《說文》：“荌，艸也。从艸，安聲。”', '27.8308': '《說文》：“茈，茈草也。从艸，此聲。”', '27.831C': '《說文》：“茜，茅蒐也。从艸，西聲。”', '27.8326': '《說文》：“茦，莿也。从艸，朿聲。”', '27.E07B': '《說文》：“䒷，䒷蔞，果蓏也。从艸，𠯑聲。”', '27.8329': '《說文》：“茩，薢茩也。从艸，后聲。”', '27.8322': '《說文》：“茢，芀也。从艸，列聲。”', '27.834E': '《說文》：“荎，荎藸，艸也。从艸，至聲。”', '27.8395': '《說文》：“莕，菨餘也。从艸，杏聲。荇，莕或从行同。”', '27.8331': '《說文》：“茱，茱萸，茮屬。从艸，朱聲。”', '27.E091': '《說文》：“茮，茮莍。从艸，尗聲。”', '27.834A': '《說文》：“荊，楚。木也。从艸，刑聲。𦮓，古文荊。”', '27.8344': '《說文》：“荄，艸根也。从艸，亥聲。”', '27.8332': '《說文》：“茲，艸木多益。从艸，茲省聲。”', '27.832C': '《說文》：“茬，艸皃。从艸，在聲。濟北有茬平縣。”', '27.8352': '《說文》：“荒，蕪也。从艸，巟聲。一曰艸淹地也。”', '27.8337': '《說文》：“茷，艸葉多。从艸，伐聲。《春秋傳》曰：晉糴茷。”', '27.834B': '《說文》：“荋，艸多葉皃。从艸，而聲。沛城父有楊荋亭。”', '27.E0A3': '《說文》：“䒹，耕多艸。从艸、耒，耒亦聲。”', '27.8350': '《說文》：“荐，薦蓆也。从艸，存聲。”', '27.8328': '《說文》：“茨，以茅葦蓋屋。从艸，次聲。”', '27.8343': '《說文》：“荃，芥脃也。从艸，全聲。”', '27.E0B3': '《說文》：“𦭮，以艸補缺。从艸，㐁聲。讀若陸。或以為綴。一曰約空也。”', '27.8335': '《說文》：“茵，車重席。从艸，因聲。鞇，司馬相如說茵从革。”', '27.82BB': '《說文》：“芻，刈艸也。象包束艸之形。”', '27.832D': '《說文》：“茭，乾芻。从艸，交聲。一曰牛蘄艸。”', '27.8339': '《說文》：“茹，飤馬也。从艸，如聲。”', '27.E0BB': '《說文》：“䒼，蠶薄也。从艸，曲聲。”', '27.84B8': '《說文》：“蒸，析麻中榦也。从艸，烝聲。䒱，蒸或省火。”', '27.8354': '《說文》：“荔，艸也。似蒲而小，根可作㕞。从艸，劦聲。”', '27.E0C5': '《說文》：“䒸，艸也。从艸，血聲。”', '27.8338': '《說文》：“茸，艸茸茸皃。从艸，聦省聲。”', '27.8349': '《說文》：“草，草斗，櫟實也。一曰象斗子。从艸，早聲。”', '27.8340': '《說文新附》：“荀，艸也。从艸，旬聲。”', '27.8317': '《說文新附》：“茗，茶芽也。从艸，名聲。”', '27.8585': '《說文》：“薅，拔去田艸也。从蓐，好省聲。𦵢，籀文薅省。茠，薅或从休。《詩》曰：‘既茠荼蓼。’”', '27.F127': '《說文》：“宷，悉也，知宷諦也。从宀，从釆。審，篆文宷从番。”', '27.7279': '《說文》：“特，朴特，牛父也。从牛，寺聲。”', '27.7277': '《說文》：“牷，牛純色。从牛，全聲。”', '27.6584': '《說文》：“斄，彊曲毛。可以箸起衣。从犛省，來聲。𠩬，古文斄省。”', '27.54FA': '《說文》：“哺，哺咀也。从口，甫聲。”', '27.54F2': '《說文》：“哲，知也。从口，折聲。悊，哲或从心。嚞，古文哲从三吉。”', '27.550F': '《說文》：“唏，笑也。从口，稀省聲。一曰哀痛不泣曰唏。”', '27.5509': '《說文》：“唉，譍也。从口，矣聲。”', '27.5510': '《說文》：“唐，大言也。从口，庚聲。𠴭，古文唐，从口、昜。”', '27.E0FB': '《說文》：“哯，不歐而吐也。从口，見聲。”', '27.54FD': '《說文》：“哽，語為舌所介也。从口，更聲。”', '27.550A': '《說文》：“唊，妄語也。从口，夾聲。”', '27.5507': '《說文》：“唇，驚也。从口，辰聲。”', '27.54E4': '《說文》：“哤，哤異之言。从口，尨聲。一曰雜語。”', '27.54E8': '《說文》：“哨，不容也。从口，肖聲。”', '27.5501': '《說文》：“唁，弔生也。从口，言聲。”', '27.54EE': '《說文》：“哮，豕驚聲也。从口，孝聲。”', '27.54E6': '《說文新附》：“哦，吟也。从口，我聲。”', '27.54ED': '《說文》：“哭，哀聲也。从吅，獄省聲。”', '27.E124': '《說文》：“䞗，疑之，等䞗而去也。从走，才聲。”', '27.E12C': '《說文》：“䞘，直行也。从走，气聲。”', '27.8D76': '《說文》：“赶，舉尾走也。从走，干聲。”', '27.6B6D': '《說文》：“歭，䠧也。从止，寺聲。”', '27.E165': '《說文》：“䢔，遝也。从辵，合聲。”', '27.9002': '《說文》：“𨓈，疾也。从辵，𠯑聲。讀與括同。”', '27.9006': '《說文》：“逆，迎也。从辵，屰聲。關東曰逆，關西曰迎。”', '27.E168': '《說文》：“䢒，會也。从辵，交聲。”', '27.8FFB': '《說文》：“迻，遷徙也。从辵，多聲。”', '27.9001': '《說文》：“送，遣也。从辵，㑞省。𨕩，籀文不省。”', '27.8FF5': '《說文》：“迵，迵迭也。从辵，同聲。”', '27.8FF7': '《說文》：“迷，或也。从辵，米聲。”', '27.9003': '《說文》：“逃，亡也。从辵，兆聲。”', '27.8FFD': '《說文》：“追，逐也。从辵，𠂤聲。”', '27.8FFE': '《說文》：“迾，遮也。从辵，𠛱聲。”', '27.9005': '《說文新附》：“逅，邂逅也。从辵，后聲。”', '27.8FF8': '《說文新附》：“逬，散走也。从走，并聲。”', '27.5F91': '《說文》：“徑，步道也。从彳，巠聲。”', '27.E18D': '《說文》：“徎，徑行也。从彳，呈聲。”', '27.5F90': '《說文》：“徐，安行也。从彳，余聲。”', '27.E193': '《說文》：“𢓱，使也。从彳，夆聲。”', '27.9F52': '《說文》：“齒，口齗骨也。象口齒之形。止聲。𠚒，古文齒字。”', '27.8DDF': '《說文》：“跟，足踵也。从足，㫐聲。𣥦，跟或从止。”', '27.E1D0': '《說文》：“跀，斷足也。从足，月聲。𧿁，跀或从兀。”', '27.8A13': '《說文》：“訓，說教也。从言，川聲。”', '27.8A0A': '《說文》：“訊，問也。从言，卂聲。䛜，古文訊从卥。”', '27.8A17': '《說文》：“託，寄也。从言，乇聲。”', '27.8A18': '《說文》：“記，疏也。从言，己聲。”', '27.8A16': '《說文》：“訖，止也。从言，乞聲。”', '27.8A12': '《說文》：“訒，頓也。从言，刃聲。《論語》曰：‘其言也訒。’”', '27.8A15': '《說文》：“訕，謗也。从言，山聲。”', '27.8A96': '《說文》：“誖，亂也。从言，孛聲。悖，誖或从心。𢨋，籀文誖从二或。”', '27.E20B': '《說文》：“𧥣，扣也。如求婦先𧥣叕之。从言，从口，口亦聲。”', '27.8A95': '《說文》：“誕，詞誕也。从言，延聲。𧥡，籀文省。”', '27.8A0C': '《說文》：“訌，䜋也。从言，工聲。《詩》曰：‘蟊賊內訌。’”', '27.8A0F': '《說文》：“訏，詭譌也。从言，于聲。一曰訏𧪰。齊楚謂信曰訏。”', '27.8A10': '《說文》：“訐，面相厈罪，相告訐也。从言，干聲。”', '27.8A0E': '《說文》：“討，治也。从言，从寸。”', '27.F483': '《說文》：“丵，叢生艸也。象丵嶽相竝出也。”', '27.F0DF': '《說文》：“𢍏，摶飯也。从廾，釆聲。釆，古文辦字。”', '27.8201': '《說文》：“舁，共舉也。从𦥑，从廾。讀若余。”', '27.9B32': '《說文》：“鬲，鼎屬，實五觳，斗二升曰觳。象腹交文，三足。䰛，鬲或从瓦。㽁，漢令鬲，从瓦，厤聲。”', '27.E26D': '《說文》：“鬴，鍑屬。从鬲，甫聲。釜，鬴或从金，父聲。”', '27.E281': '《說文》：“㧬，𢹬也。从手，巩聲。”', '27.9B25': '《說文》：“鬥，兩士相對，兵杖在後，象鬥之形。”', '27.66F8': '《說文》：“書，箸也。从聿，者聲。”', '27.F034': '《說文》：“㱿，从上擊下也。一曰素也。从殳，𡉉聲。段玉裁注：“俗作‘殼’，或作‘㲉’。”', '27.E2AA': '《說文》：“㱾，㱾攺，大剛卯也，以逐精鬼。从殳，亥聲。”', '27.5C03': '《說文》：“尃，布也。从寸，甫聲。”', '27.76B0': '《說文》：“皰，面生气也。从皮，包聲。”', '27.6548': '《說文》：“效，象也。从攴，交聲。”', '27.E2BE': '《說文》：“𦔼，使也。从攴，耴省聲。”', '27.6546': '《說文》：“㪉，合會也。从攴，从合。合亦聲。”', '27.8D66': '《說文》：“赦，置也。从攴，赤聲。𢼜，赦或从亦。”', '27.E2CE': '《說文》：“𢼟，放也。从攴，𡉚聲。”', '27.F0E4': '《說文》：“敇，擊馬也。从攴，朿聲。”', '27.F07E': '《說文》：“𤰈，具也。从用，茍省。”', '27.7729': '《說文》：“眩，目無常主也。从目，玄聲。”', '27.7A85': '《說文》：“窅，深目也。从穴中目。”', '27.E2E8': '《說文》：“䀣，直視也。从目，必聲。讀若《詩》云：‘泌彼泉水’。”', '27.7713': '《說文》：“眓，視高皃。从目，戉聲。讀若《詩》曰：‘施罛濊濊’。”', '27.7715': '《說文》：“眕，目有所恨而止也。从目，㐱聲。”', '27.F5C7': '《說文》：“眔，目相及也。从目，从隶省。”', '27.E2F2': '《說文》：“眜，目不明也。从目，末聲。”', '27.7722': '《說文》：“眢，目無明也。从目，夗聲。”', '27.771A': '《說文》：“眚，目病生翳也。从目，生聲。”', '27.771B': '《說文》：“眛，目不明也。从目，未聲。”', '27.7723': '《說文》：“眣，目不正也。从目，失聲。”', '27.7719': '《說文》：“眙，直視也。从目，台聲。”', '27.771D': '《說文》：“眝，長眙也。一曰張目也。从目，宁聲。”', '27.E30B': '《說文》：“𥄱，目不明也。从目，弗聲。”', '27.7728': '《說文新附》：“眨，動目也。从目，乏聲。”', '27.F128': '《說文》：“䀠，左右視也。从二目。讀若拘，又若良士瞿瞿。”', '27.7FC1': '《說文》：“翁，頸毛也。从羽，公聲。”', '27.7FC5': '《說文》：“翄，翼也。从羽，支聲。𦐊，翄或从氏。”', '27.F4A6': '《說文》：“𦐇，飛盛皃。从羽，从曰。”', '27.E315': '《說文》：“𦐉，飛盛皃。从羽，之聲。”', '27.E316': '《說文》：“䍿，樂舞。以羽自翳其首，以祀星辰也。从羽，王聲，讀若皇。”', '27.96BB': '《說文》：“隻，鳥一枚也。从又持隹。持一隹曰隻，二隹曰雙。”', '27.7F94': '《說文》：“羔，羊子也。从羊，照省聲。”', '27.7F92': '《說文》：“羒，牂羊也。从羊，分聲。”', '27.7242': '《說文》：“牂，牡羊也。从羊，爿聲。”', '27.7F96': '《說文》：“羖，夏羊牡曰羖。从羊，殳聲。”', '27.9D7B': '《說文》：“鵻，祝鳩也。从鳥，隹聲。隼，鵻或从隹、一。一曰鶉字。”', '27.5193': '《說文》：“冓，交積材也。象對交之形。”', '27.F642': '《說文》：“𤔌，有所依據也。从𠬪、工，讀與隱同。”', '27.6B8A': '《說文》：“殊，死也。从歺，朱聲。漢令曰：‘蠻夷長有罪，當殊之。’”', '27.9AA8': '《說文》：“骨，肉之覈也。从冎，有肉。”', '27.8105': '《說文》：“脅，兩𦜶也。从肉，劦聲。”', '27.80F3': '《說文》：“胳，亦下也。从肉，各聲。”', '27.80EF': '《說文》：“胯，股也。从肉，夸聲。”', '27.80FB': '《說文》：“胻，脛耑也。从肉，行聲。”', '27.80F2': '《說文》：“胲，足大指毛也。从肉，亥聲。”', '27.8100': '《說文》：“脀，騃也。从肉，丞聲。讀若丞。”', '27.8101': '《說文》：“脁，祭也。从肉，兆聲。”', '27.80F5': '《說文》：“胵，鳥胃也。从肉，至聲。一曰胵，五藏緫名也。”', '27.80F9': '《說文》：“胹，爛也。从肉，而聲。”', '27.8102': '《說文》：“脂，戴角者脂，無角者膏。从肉，旨聲。”', '27.E3AE': '《說文》：“脃，小耎易斷也。从肉、从絕省。”', '27.E3B7': '《說文新附》：“𦚧，𦚧䏰，蟲名。漢中有𦚧䏰縣，地下多此蟲，因以為名。从肉，旬聲。考其義當作潤蠢。”', '27.525E': '《說文》：“剞，剞𠜾，曲刀也。从刀，奇聲。”', '27.E3C0': '《說文》：“𠜾，剞𠜾也。从刀，屈聲。”', '27.5261': '《說文》：“剡，銳利也。从刀，炎聲。”', '27.5256': '《說文》：“剖，判也。从刀，咅聲。”', '27.525F': '《說文》：“剟，刊也。从刀，叕聲。”', '27.91D7': '《說文》：“釗，刓也。从刀，从金。周康王名。”', '27.5254': '《說文》：“剔，解骨也。从刀，易聲。”', '27.525C': '《說文新附》：“剜，削也。从刀，宛聲。”', '27.E3CF': '《說文》：“𠜵，齘𠜵，刮也。从㓞，夬聲。一曰：𠜵，畫堅也。”', '27.6814': '《說文》：“栔，刻也。从㓞，从木。”', '27.E3D0': '《說文》：“𠲱，枝𠲱也。从丰，各聲。”', '27.8015': '《說文》：“耕，犂也。从耒，井聲。一曰古者井田。”', '27.7B10': '《說文》：“笐，竹列也。从竹，亢聲。”', '27.7B04': '《說文》：“笄，簪也，从竹幵聲。”', '27.E401': '《說文》：“𥫱，篅也。从竹，屯聲。”', '27.E40E': '《說文》：“笍，羊車騶箠也。箸箴其耑，長半分。从竹，內聲。”', '27.7B11': '《說文新附》：“此字本闕。臣鉉等案：孫愐《唐韻》引《說文》云‘喜也，从竹，从犬’，而不述其義。今俗皆从犬。又案：李陽冰刊定《說文》‘从竹，从夭’，義云‘竹得風其體夭屈如人之笑’。未知其審。”', '27.7B0F': '《說文新附》：“笏，公及士所搢也。从竹，勿聲。”', '27.5DEE': '《說文》：“差，貳也，差不相值也。从左，从𠂹。，籀文𢀩从二。”', '27.F0A6': '《說文》：“𡫟，窒也。从㠭，从廾。㠭猶齊也。”', '27.54FF': '《說文》：“哿，可也。从可，加聲。”', '27.54E5': '《說文》：“哥，聲也。从二可。古文以為謌字。”', '27.F101': '《說文》：“𠣬，驚辭也。从兮，旬聲。𢞛，𠣬或从心。”', '27.8C48': '《說文》：“豈，還師振旅樂也。一曰欲也，登也。从豆，微省聲。”', '27.8654': '《說文》：“虔，虎行皃。从虍，文聲。讀若矜。”', '27.E447': '《說文》：“䖊，虎貌。从虎，乂聲。”', '27.8653': '《說文》：“虓，虎鳴也。一曰師子。从虎，九聲。”', '27.8652': '《說文》：“虒，委虒，虎之有角者也。从虎，𠂆聲。”', '27.E44D': '《說文》：“盌，小盂也。从皿，夗聲。”', '27.E44E': '《說文》：“䀁，小甌也。从皿，有聲。讀若賄。𥁓，䀁或从右。”', '27.76CE': '《說文》：“盎，盆也。从皿，央聲。㼜，盎或从瓦。”', '27.F0AB': '《說文》：“㿾，器也。从皿，宁聲。”', '27.F0DC': '《說文》：“𥁑，械器也。从皿，必聲。”', '27.76C9': '《說文》：“盉，調味也。从皿，禾聲。”', '27.76CA': '《說文》：“益，饒也。从水、皿。皿，益之意也。”', '27.F5EC': '《說文》：“𥁕，仁也。从皿，以食囚也。官溥說。”', '27.E454': '《說文新附》：“盋，盋器。盂屬。从皿，犮聲；或从金，从本。”', '27.8843': '《說文》：“衃，凝血也。从血，不聲。”', '27.8844': '《說文》：“衄，鼻出血也。从血，丑聲。”', '27.9B2F': '《說文》：“鬯，以秬釀鬱艸，芬芳攸服，以降神也。从凵，凵，器也；中象米；匕所以扱之。《易》曰：‘不喪匕鬯’。”', '27.E468': '《說文》：“𩰤，黑黍也。一稃二米以釀也。从鬯，矩聲。秬，𩰤或从禾。”', '27.6041': '《說文》：“恁，下齎也。从心，任聲。”', '27.990A': '《說文》：“養，供養也。从食，羊聲。𢼝，古文養。”', '27.EE13': '《說文》：“飤，糧也。从人、食。”', '27.98E2': '《說文》：“飢，餓也。从食，几聲。”', '27.F5EF': '《說文》：“䍃，瓦器也。从缶，肉聲。”', '27.7F3A': '《說文》：“缺，器破也。从缶，決省聲。”', '27.9AD8': '《說文》：“高，崇也，象臺觀高之形。从冂、口，與倉舍同意。”', '27.4EB3': '《說文》：“亳，京兆杜陵亭也。从高省，乇聲。”', '27.F61F': '《說文》：“隺，高至也。从隹上欲出冂。《易》曰：‘夫乾隺然’。”', '27.F3A1': '《說文》：“𣆪，厚也，从反亯。”', '27.E4AD': '《說文》：“𥏳，从來，矣聲。𢓪，𥏳或从彳。”', '27.9EB0': '《說文》：“麰，來麰，麥也。从麥，牟聲。𦭷，麰或从艸。”', '27.590F': '《說文》：“夏，中國之人也。从夊、从頁、从𦥑。𦥑，兩手；夊，兩足也。𠍺，古文𡕾（夏）。”', '27.755F': '《說文》：“畟，治稼畟畟進也。从田、人，从夂。《詩》曰：‘畟畟良耜。’”', '27.590E': '《說文新附》： “夎，拜失容也。从夊，坐聲。”', '27.6840': '《說文》：“桀，磔也。从舛在木上也。”', '27.4E58': '《說文》：“乘，覆也。从入、桀。桀，黠也。軍法曰乘。𠅞，古文乘从几。”', '27.6843': '《說文》：“桃，果也。从木，兆聲。”', '27.6842': '《說文》：“桂，江南木，百藥之長。从木，圭聲。”', '27.684F': '《說文》：“桏，椶椐木也。从木，邛聲。”', '27.684B': '《說文》：“桋，赤栜也。从木，夷聲。《詩》曰：‘隰有杞桋。’”', '27.681F': '《說文》：“栟，栟櫚也。从木，并聲。”', '27.6829': '《說文》：“栩，𣏗也。从木，羽聲。其皁一曰樣。”', '27.6854': '《說文》：“桔，桔梗，藥名。从木，吉聲。一曰直木。”', '27.6818': '《說文》：“栘，棠棣也。从木，多聲。”', '27.6850': '《說文》：“桐，榮也。从木，同聲。”', '27.6845': '《說文》：“桅，黄木可染者。从木，危聲。”', '27.6839': '《說文》：“根，木株也。从木，艮聲。”', '27.682A': '《說文》：“株，木根也。从木，朱聲。”', '27.E4F4': '《說文》：“𣓁，槎識也。从木、，闕。《夏書》曰：‘隨山𣓁木。’讀若刊。栞，篆文从幵。”', '27.6820': '《說文》：“栠，弱皃。从木，任聲。”', '27.683C': '《說文》：“格，木長皃。从木，各聲。”', '27.67F4': '《說文》：“柴，小木散材。从木，此聲。”', '27.683D': '《說文》：“栽，築牆長版也。从木，𢦒聲。《春秋傳》曰：‘楚圍蔡，里而栽。’”', '27.6835': '《說文》：“𣔜，栭也。从木，𠛱聲。《詩》曰：‘其灌其𣔜’。”', '27.682D': '《說文》：“栭，屋枅上標。从木，而聲。《爾雅》曰：‘栭謂之㮞。’”', '27.6853': '《說文》：“桓，亭郵表也。从木，亘聲。”', '27.68B3': '《說文》：“梳，理髮也。从木，疏省聲。”', '27.E50A': '《說文》：“㭘，劔柙也。从木，合聲。”', '27.6848': '《說文》：“案，几屬。从木，安聲。”', '27.E516': '《說文》：“㭙，槌也。从木，特省聲。”', '27.681A': '《說文》：“𣒁（栚），槌之橫者也，關西謂之㯢。从木，灷聲。”', '27.6838': '《說文》：“核，蠻夷以木皮為篋，狀如籨尊。从木，亥聲。”', '27.682B': '《說文》：“栫，以柴木𡓱也。从木，存聲。”', '27.E51B': '《說文》：“桊，牛鼻中環也。从木，𢍏聲。”', '27.E51F': '《說文》：“栙，栙雙也。从木，夅聲。”', '27.681D': '《說文》：“栝，炊竈木。从木，舌聲。”', '27.81EC': '《說文》：“臬，射準的也。从木，从自。”', '27.6821': '《說文》：“校，木囚也。从木，交聲。”', '27.6844': '《說文》：“桄，充也。从木，光聲。”', '27.684E': '《說文》：“桎，足械也。从木，至聲。”', '27.681C': '《說文新附》：“栜，桋也。从木，策省聲。”', '27.6851': '《說文》：“桑，蠶所食葉木。从叒、木。”', '27.5E2B': '《說文》：“師，二千五百人為師。从帀，从𠂤。𠂤，四帀眾意也。𠦵，古文師。”', '27.7D22': '《說文》：“索，艸有莖葉可作繩索。从𣎵糸。杜林說：𣎵，亦朱𣎵字。”', '27.7521': '《說文》：“甡，眾生並立之皃。从二生。《詩》曰：‘甡甡其鹿。’”', '27.F3A3': '《說文》：“𠌶，艸木華也。”', '27.E543': '《說文》：“㘣，規也。从囗，肙聲。”', '27.5703': '《說文》：“圃，穜菜曰圃。从囗，甫聲。”', '27.5704': '《說文》：“圄，守之也。从囗，吾聲。”', '27.5702': '《說文》：“圂，廁也。从囗，象豕在囗中也。會意。”', '27.54E1': '《說文》：“員，物數也。从貝，口聲。鼎，籀文从鼎。”', '27.F4A7': '《說文》：“𧴪，貝聲也。从小、貝。”', '27.8CA1': '《說文》：“財，人所寶也。从貝，才聲。”', '27.8CA2': '《說文》：“貢，獻功也。从貝，工聲。”', '27.8CA3': '《說文》：“貣，从人求物也。从貝，弋聲。”', '27.8CA4': '《說文》：“貤，重次弟物也。从貝，也聲。”', '27.90E1': '《說文》：“郡，周制，天子地方千里，分為百縣，縣有四郡。故《春秋傳》曰：‘上大夫受郡’是也。至秦初，置三十六郡以監其縣。从邑，君聲。”', '27.90DB': '《說文》：“郛，郭也。从邑，孚聲。”', '27.E553': '《說文》：“𨛍，國甸，大夫稍稍所食邑。从邑，肖聲。《周禮》曰：‘任𨛍地在天子三百里之內。’”', '27.90DD': '《說文》：“郝，右扶風鄠盩厔鄉。从邑，赤聲。”', '27.90D6': '《說文》：“郖，弘農縣庾地。从邑，豆聲。”', '27.90D7': '《說文》：“郗，周邑也，在河內。从邑，希聲。”', '27.90E4': '《說文》：“郤，晉大夫叔虎邑也。从邑，𧮫聲。”', '27.90DF': '《說文》：“郟，潁川縣。从邑，夾聲。”', '27.E56C': '《說文》：“𨛋，南陽西鄂亭。从邑，里聲。”', '27.90DC': '《說文》：“郜，周文王子所封國。从邑，告聲。”', '27.90E0': '《說文》：“郠，琅邪莒邑。从邑，更聲。《春秋傳》曰：‘取郠’。”', '27.E57A': '《說文》：“䣄，邾下邑地。从邑，余聲。魯東有䣄城。讀若塗。”', '27.90DA': '《說文》：“郚，東海縣，故紀侯之邑也。从邑，吾聲。”', '27.90E3': '《說文》：“郣，郣海地。从邑，孛聲。一曰地之起者曰郣。”', '27.E586': '《說文》：“䣇，地名。从邑，求聲。”', '27.E593': '《說文》：“𨛖，汝南安陽鄉。从邑，𦳋省聲。”', '27.90D9': '《說文》：“郙，汝南上蔡亭。从邑，甫聲。”', '27.6643': '《說文》：“晄，明也。从日，光聲。”', '27.6649': '《說文》：“㬜，進也，日出萬物進。从日，从臸。”', '27.664F': '《說文》：“晏，天清也。从日，安聲。”', '27.E5A4': '《說文》：“晐，兼晐也。从日，亥聲。”', '27.665F': '《說文新附》：“晟，明也。从日，成聲。”', '27.F4A5': '《說文》：“倝，日始出，光倝倝也。從旦，㫃聲。”', '27.65C6': '《說文》：“旆，繼旐之旗也，沛然而垂。从㫃，𣎵聲。”', '27.65C2': '《說文》：“旂，旗有眾鈴以令眾也。从㫃，斤聲。”', '27.65C3': '《說文》：“旃，旗曲柄也，所以旃表士眾。从㫃，丹聲。《周禮》曰：‘通帛為旃。’旜，旃或从亶。”', '27.6E38': '《說文》：“游，旌旗之流也。从㫃，汓聲。𨒰，古文游。”', '27.65C4': '《說文》：“旄，幢也。从㫃，从毛。毛亦聲。”', '27.51A5': '《說文》：“冥，幽也。从日，从六，冖聲。日數十，十六日而月始虧，幽也。”', '27.6714': '《說文》：“朔，月一日始蘇也。从月，屰聲。”', '27.6717': '《說文》：“朗，明也。从月，良聲。”', '27.6713': '《說文》：“朓，晦而月見西方謂之朓。从月，兆聲。”', '27.F3A7': '《說文》：“𣐺，木垂華實。从木、𢎘，𢎘亦聲。”', '27.6817': '《說文》：“㮚，木也。从木，其實下垂，故从𠧪。𣡷，古文㮚从西、从二𠧪。徐巡說。木至西方戰㮚。”', '27.79DC': '《說文》：“秜，稻今年落，來年自生謂之秜。从禾，尼聲。”', '27.79E0': '《說文》：“秠，一稃二米。从禾，丕聲。《詩》曰：‘誕降嘉穀，惟秬惟秠。’天賜后稷之嘉穀也。”', '27.E5D8': '《說文》：“秨，禾搖皃。从禾，乍聲。讀若昨。”', '27.79E9': '《說文》：“秩，積也。从禾，失聲。《詩》曰：‘積之秩秩。’”', '27.79E7': '《說文》：“秧，禾若秧穰也。从禾，央聲。”', '27.79DF': '《說文》：“租，田賦也。从禾，且聲。”', '27.79E6': '《說文》：“秦，伯益之後所封國，地宜禾。从禾，舂省。一曰秦，禾名。𥠼，籀文秦从秝。”', '27.79ED': '《說文》：“秭，五稯為秭。从禾，𠂔聲。一曰數億至萬曰秭。”', '27.E5EC': '《說文》：“䄷，百二十斤也。稻一䄷為粟二十升，禾黍一䄷為粟十六升大半斤。从禾，石聲。”', '27.79DD': '《說文》：“秝，稀疏適也。从二禾。讀若歷。”', '27.517C': '《說文》：“兼，并也。从又持秝。兼，持二禾。秉，持一禾。”', '27.7C88': '《說文》：“粈，雜飯也。从米，丑聲。”', '27.6C23': '《說文》：“氣，饋客芻米也。从米，气聲。《春秋傳》曰：‘齊人來氣諸矦。’䊠，氣或从既；餼，氣或从食。”', '27.7C89': '《說文》：“粉，傅面者也。从米，分聲。”', '27.E60A': '《說文》：“𢻃，配鹽幽尗也。从尗，支聲。豉，俗𢻃从豆。”', '27.74DE': '《說文》：“瓞，㼎也。从瓜，失聲。《詩》曰：‘緜緜瓜瓞。”', '27.F0ED': '《說文》：“㼌，本不勝末，微弱也。从二瓜，讀若庾。”', '27.5BB6': '《說文》：“家，居也。从宀，豭省聲。”', '27.5BA7': '《說文》：“宧，養也。室之東北隅，食所居。从宀，𦣞聲。”', '27.5BB8': '《說文》：“宸，屋宇也。从宀，辰聲。”', '27.9662': '《說文》：“院，堅也。从𨸏，完聲。”', '27.E61A': '《說文》：“㝗，㝩也。从宀，良聲。”', '27.5BAC': '《說文》：“宬，屋所容受也。从宀，成聲。”', '27.5BB4': '《說文》：“宴，安也。从宀，晏聲。”', '27.5BAD': '《說文》：“宭，羣居也。从宀，君聲。”', '27.5BB0': '《說文》：“宰，辠人在屋下執事者。从宀，从辛。辛，辠也。”', '27.5BB5': '《說文》：“宵，夜也。从宀，宀下冥也，肖聲。”', '27.5BD1': '《說文》：“寑，臥也。从宀，聲。”', '27.E626': '《說文》：“𡨂，寤也。从宀，吾聲。”', '27.5BB3': '《說文》：“害，傷也。从宀，从口。宀、口，言从家起也。丰聲。”', '27.5BAE': '《說文》：“宮，室也。从宀，躳省聲。”', '27.F4BB': '《說文》：“躳，身也。从身，从呂。躬，躳或从弓。”', '27.E630': '《說文》：“𥥊，北方謂地空，因以為土穴，為𥥊戶。从穴，皿聲。讀若猛。”', '27.F115': '《說文》：“𥥍，深也。一曰竈突。从穴，从火，从求省。”', '27.7A8A': '《說文》：“窊，污衺下也。从穴，瓜聲。”', '27.7A8C': '《說文》：“窌，窖也。从穴，卯聲。”', '27.7A8B': '《說文》：“窋，物在穴中皃。从穴中出。”', '27.7A88': '《說文》：“窈，深遠也。从穴，幼聲。”', '27.7A86': '《說文》：“窆，葬下棺也。从穴，乏聲。《周禮》曰：‘及窆執斧’。”', '27.E63B': '《說文》：“䆘，入衇刺穴謂之䆘。从穴，甲聲。”', '27.75BE': '《說文》：“疾，病也。从疒，矢聲。𤶅，古文疾。𥏦，籀文疾。”', '27.75C5': '《說文》：“病，疾加也。从疒，丙聲。”', '27.E643': '《說文》：“疴，病也。从疒，可聲。《五行傳》曰：‘時即有口痾。’”', '27.E646': '《說文》：“㽾，病也。从疒，出聲。”', '27.E651': '《說文》：“㾈，俛病也。从疒，付聲。”', '27.75C0': '《說文》：“痀，曲脊也。从疒，句聲。”', '27.761A': '《說文》：“瘚，屰气也。从疒，从屰，从欠。欮，瘚或省疒。”', '27.75BD': '《說文》：“疽，癰也。从疒，且聲。”', '27.75C2': '《說文》：“痂，疥也。从疒，加聲。”', '27.75C1': '《說文》：“痁，有熱瘧。从疒，占聲。《春秋傳》曰：‘齊侯疥，遂痁。’”', '27.75BB': '《說文》：“疻，毆傷也。从疒，只聲。”', '27.75B8': '《說文》：“疸，黃病也。从疒，旦聲。”', '27.E65D': '《說文》：“㾁，狂走也。从疒，朮聲。讀若欻。”', '27.75B2': '《說文》：“疲，勞也。从疒，皮聲。”', '27.E65E': '《說文》：“㾅，瑕也。从疒，𠂔聲。”', '27.E664': '《說文》：“㽽，久病也。从疒，古聲。”', '27.E666': '《說文》：“冣，積也。从冖，从取，取亦聲。”', '27.F5F6': '《說文》：“冡，覆也。从𠔼、豕。”', '27.7F5B': '《說文》：“罛，魚罟也。从网，瓜聲。《詩》曰：‘施罛濊濊。’”', '27.7F5F': '《說文》：“罟，网也。从网，古聲。”', '27.7F5C': '《說文》：“罜，罜䍡。魚罟也。从网，主聲。”', '27.7F60': '《說文》：“罠，釣也。从网，民聲。”', '27.E673': '《說文》：“䍖，覆車也。从网，包聲。《詩》曰：‘雉離于䍖。’罦，䍖或从孚。”', '27.7F5D': '《說文》：“罝，兔网也。从网，且聲。𦋽，罝或从糸；𦋾，籀文从虘。”', '27.E67F': '《說文》：“帬，下裳也。帬或从衣。”', '27.E699': '《說文》：“㡇，領耑也。从巾，耴聲。”', '27.F079': '《說文》：“𡭴，際見之白也。从白，上下小見。”', '27.5029': '《說文》：“倩，人字。从人，青聲。東齊壻謂之倩。”', '27.5013': '《說文》：“倓，安也。从人，炎聲。讀若談。𠋴，倓或从剡。”', '27.502D': '《說文》：“倭，順皃。从人，委聲。《詩》曰：‘周道倭遲。’”', '27.501E': '《說文》：“倞，彊也。从人，京聲。”', '27.5028': '《說文》：“倨，不遜也。从人，居聲。”', '27.4FFA': '《說文》：“俺，大也。从人，奄聲。”', '27.502C': '《說文》：“倬，箸大也。从人，卓聲。”', '27.5017': '《說文》：“倗，輔也。从人，朋聲。”', '27.4FF6': '《說文》：“俶，善也。从人，叔聲。《詩》曰：‘令終有俶。’一曰始也。”', '27.502B': '《說文》：“倫，輩也。从人，侖聲。一曰道也。”', '27.4FF1': '《說文》：“俱，偕也。从人，具聲。”', '27.501A': '《說文》：“倚，依也。从人，奇聲。”', '27.5022': '《說文》：“倢，佽也。从人，疌聲。”', '27.F114': '《說文》：“𣁋，妙也。从人，从攴。豈省聲。”', '27.501F': '《說文》：“借，假也。从人，昔聲。”', '27.5019': '《說文》：“𠊱，伺望也。从人，矦聲。”', '27.508D': '《說文》：“傍，近也。从人，旁聲。”', '27.4FFE': '《說文》：“俾，益也。从人，卑聲。一曰：俾，門侍人。”', '27.502A': '《說文》：“倪，俾也。从人，兒聲。”', '27.500C': '《說文》：“倌，小臣也。从人，从官。”', '27.500D': '《說文》：“倍，反也。从人，咅聲。”', '27.5000': '《說文》：“倀，狂也。从人，長聲。一曰什也。”', '27.4FF4': '《說文》：“俴，淺也。从人，戔聲。”', '27.5021': '《說文》：“倡，樂也。从人，昌聲。”', '27.4FF3': '《說文》：“俳，戲也。从人，非聲。”', '27.E6C7': '《說文》：“㑥，輕也。从人，易聲。一曰交㑥。”', '27.E6C8': '《說文》：“倄，剌也。从人，肴聲。一曰痛聲。”', '27.E6C9': '《說文》：“倃，毁也。从人，咎聲。”', '27.5020': '《說文》：“倠，仳倠，醜面。从人，隹聲。”', '27.503C': '《說文》：“值，措也。从人，直聲。”', '27.5026': '《說文》：“倦，罷也。从人，卷聲。”', '27.5005': '《說文新附》：“倅，副也。从人，卒聲。”', '27.501C': '《說文新附》：“倜，倜儻不羈也。从人，从周。未詳。”', '27.5012': '《說文新附》：“倒，仆也。从人，到聲。”', '27.771F': '《說文》：“真，僊人變形而登天也。从𠤎，从目，从𠃊。八，所乘載也。𡙊，古文真。”', '27.5C54': '《說文》：“屔，反頂受水丘。从丘，泥省聲。”', '27.6722': '《說文》：“朢，月滿與日相朢，以朝君也。从月，从臣，从𡈼。𡈼，朝廷也。𦣠，古文朢省。”', '27.6BB7': '《說文》：“殷，作樂之盛稱殷。从𠂣，从殳。《易》曰：‘殷薦之上帝。’”', '27.E6D9': '《說文》：“衮，天子享先王，卷龍繡於下幅，一龍蟠阿上鄉。从衣，公聲。”', '27.887D': '《說文》：“衽，衣䘳也。从衣，壬聲。”', '27.886D': '《說文》：“衭，襲衭也。从衣，夫聲。”', '27.8882': '《說文》：“袂，袖也。从衣，夬聲。”', '27.E6E3': '《說文》：“衸，袥也。从衣，介聲。”', '27.886F': '《說文》：“衯，長衣皃。从衣，分聲。”', '27.8881': '《說文》：“袁，長衣皃。从衣，叀省聲。”', '27.887E': '《說文》：“衾，大被。从衣，今聲。”', '27.8875': '《說文》：“衵，日日所常衣。从衣，从日，日亦聲。”', '27.8877': '《說文》：“衷，裏褻衣。从衣，中聲。《春秋傳》曰：‘皆衷其衵服。’”', '27.E6F0': '《說文》：“衺，𩏉也。从衣，牙聲。”', '27.E6F5': '《說文》：“䘟，棺中縑裏。从衣、弔。讀若雕。”徐鍇《繫傳》本作“从衣，弔聲”。', '27.E6F8': '《說文》：“耊，年八十曰耊。从老省，从至。”', '27.8006': '《說文》：“耆，老也。从老省，旨聲。”', '27.6BE8': '《說文》：“毨，仲秋鳥獸毛盛，可選取以為器用。从毛，先聲。讀若選。”', '27.6BE6': '《說文新附》：“毦，羽毛飾也。从毛，耳聲。”', '27.5C55': '《說文》：“展，轉也。从尸，𧝑省聲。”', '27.E708': '《說文》：“屒，伏皃。从尸，辰聲。一曰屋宇。”', '27.5C56': '《說文》：“屖，屖遟也。从尸，辛聲。”', '27.E70E': '《說文》：“𡱣，履屬。从履省，予聲。”', '27.5C50': '《說文》：“屐，屩也。从履省，支聲。”', '27.6715': '《說文》：“朕，我也。闕。”', '27.822B': '《說文》：“舫，船師也。《明堂月令》曰：‘舫人，習水者。’从舟，方聲。”', '27.822C': '《說文》：“般，辟也。象舟之旋，从舟，从殳。殳，所以旋也。𦨗，古文般从支。”', '27.E726': '《說文》：“𧠊，突前也。从見、𠔼。”', '27.6B2F': '《說文》：“欯，喜也。从欠，吉聲。”', '27.E737': '《說文》：“𣢰，惄然也。从欠，尗聲。《孟子》曰：‘曾西𣢰然。’”', '27.E73D': '《說文》：“㰣，歐也。从欠，此聲。”', '27.6B31': '《說文》：“欱，歠也。从欠，合聲。”', '27.6B2D': '《說文》：“欭，嚘也。从欠，因聲。”', '27.6B2C': '《說文》：“欬，屰气也。从欠，亥聲。”', '27.4FEE': '《說文》：“修，飾也。从彡，攸聲。”', '27.5F31': '《說文》：“弱，橈也，上象橈曲，彡象毛氂橈弱也。弱物并，故从二。”', '27.9ADF': '《說文》：“髟，長髮猋猋也。从長，从彡。”', '27.537F': '《說文》：“卿，章也。六卿：天官冢宰，地官司徒，春官宗伯，夏官司馬，秋官司寇，冬官司空。从卯，皀聲。”', '27.51A2': '《說文》：“冢，高墳也。从勹，豖聲。”', '27.9B3C': '《說文》：“鬼，人所歸為鬼。从人，象鬼頭。鬼陰氣賊害，从厶。𩲚，古文从示。”', '27.F105': '《說文》：“鬽，老精物也。从鬼、彡。彡，鬼毛。魅，或从未聲。𢑘，古文。𠃁，籀文，从彖首，从尾省聲。”', '27.5CF6': '《說文》：“㠀，海中往往有山可依止曰㠀。”', '27.5CF1': '《說文》：“峱，山。在齊地。从山，狃聲。《詩》曰：‘遭我于峱之間兮。’”', '27.E7CA': '《說文》：“𡺲，高也。从山，陖聲。峻，𡺲或省。”', '27.5CF0': '《說文》：“峯，山耑也。从山，夆聲。”', '27.E7CF': '《說文》：“𡷥，山皃。一曰山名。从山，告聲。”', '27.5CE8': '《說文》：“峨，嵯峨也。从山，我聲。”', '27.E7D1': '《說文》：“𡷨，谷也。从山，巠聲。”', '27.5EAD': '《說文》：“庭，宮中也。从广，廷聲。”', '27.5EAB': '《說文》：“庫，兵車藏也。从車，在广下。”', '27.5EAE': '《說文》：“庮，久屋朽木。从广，酉聲。”', '27.5EAA': '《說文新附》：“庪，祭山曰庪縣。从广，技聲。”', '27.E7EB': '《說文》：“𠩫，石地惡也。从厂，兒聲。”', '27.E7EC': '《說文》：“㕋，石地也。从厂，金聲。”', '27.539D': '《說文》：“厝，厲石也。从厂，㫺聲。”', '27.539E': '《說文》：“厞，隱也。从厂，非聲。”', '27.E7F4': '《說文》：“㩻，㩻䧢也。从危，支聲。”', '27.782E': '《說文》：“砮，石，可以為矢鏃。从石，奴聲。《夏書》曰：‘梁州貢砮丹。’《春秋》、《國語》曰：‘肅慎氏貢楛矢石砮。’”', '27.7834': '《說文》：“破，石碎也。从石，皮聲。”', '27.782D': '《說文》：“砭，以石刺病也。从石，乏聲。”', '27.7822': '《說文》：“砢，磊砢也。从石，可聲。”', '27.7827': '《說文新附》：“砧，石柎也。从石，占聲。”', '27.8C79': '《說文》：“豹，似虎，圜文。从豸，勺聲。”', '27.8C7A': '《說文》：“豺，狼屬，狗聲。从豸，才聲。”', '27.99AC': '《說文》：“馬，怒也；武也。象馬頭髦尾四足之形。𢒠，古文。𢒠，籀文馬與𢒠同，有髦。”', '27.99D5': '《說文》：“駕，馬在軛中。从馬，加聲。𤙑，籀文駕。”', '27.51A4': '《說文》：“冤，屈也。从兔，从冖。兔在冖下不得走，益屈折也。”', '27.E861': '《說文》：“𤞞，獨𤞞，獸也。从犬，谷聲。”', '27.81ED': '《說文》：“臭，禽走臭而知其迹者，犬也。从犬，从自。”', '27.72FE': '《說文》：“狾，狂犬也。从犬，折聲。《春秋傳》曰：‘狾犬入華臣氏之門。’”', '27.72FB': '《說文》：“狻，狻麑，如虦貓，食虎豹者。从犬，夋聲。見《爾雅》。”', '27.72FC': '《說文》：“狼，似犬，銳頭，白頰，高前，廣後。从犬，良聲。”', '27.72F7': '《說文新附》：“狷，褊急也。从犬，肙聲。”', '27.9F22': '《說文》：“鼢，地行鼠，伯勞所作也。一曰偃鼠。从鼠，分聲。蚡，或从虫、分。”', '27.80FD': '《說文》：“能，熊屬，足似鹿。从肉，㠯聲。能獸堅中，故稱賢能，而彊壯稱能傑也。”', '27.70C8': '《說文》：“烈，火猛也。从火，𠛱聲。”', '27.70DD': '《說文》：“烝，火气上行也。从火，丞聲。”', '27.E87E': '《說文》：“烄，交木然也。从火，交聲。”', '27.70D3': '《說文》：“烓，行竈也。从火，圭聲，讀若冋。”', '27.70D8': '《說文》：“烘，尞也。从火，共聲。”', '27.E883': '《說文》：“𤇯，炮肉，以微火溫肉也，从火，衣聲。”', '27.5C09': '《說文》：“尉，从上案下也。从𡰥、又，持火以尉申繒也。”', '27.F0A1': '《說文》：“㶳，火餘也。从火，聿聲。”', '27.7159': '《說文》：“煙，火气也。从火，垔聲。烟，或从因；𡨾，古文；𤎟，籀文从宀。”', '27.E892': '《說文》：“㶴，盛火也。从火，从多。徐鍇繫傳：“从火，多聲。”', '27.F610': '《說文》：“烕，滅也。从火，戌。火死於戌，陽氣至戌而盡。《詩》曰：‘赫赫宗周，褒似烕之。’”', '27.721F': '《說文》：“爟，取火於日。官名。舉火曰爟。《周禮》曰：‘司爟掌行火之政令。’从火，雚聲。烜，或从亘。”', '27.70D9': '《說文新附》：“烙，灼也。从火，各聲。”', '27.E8BD': '《說文》：“𡔣，頭傾也。从夨，吉聲。”', '27.594A': '《說文》：“奊，頭衺骩奊態也。从夨，圭聲。”', '27.768B': '《說文》：“皋，气皋白之進也。从夲，从白。《禮》祝曰皋，登謌曰奏，故皋奏皆从夲。《周禮》曰：‘詔來鼓皋舞。’皋，告之也。”', '27.5958': '《說文》：“奘，駔大也。从大，从壯，壯亦聲。”', '27.595A': '《說文》：“奚，大腹也。从大，𦃟省聲。𦃟，籀文系字。”', '27.7AD8': '《說文》：“竘，健也。一曰匠也。从立，句聲。讀若齲。《逸周書》有《竘匠》。”', '27.EDEF': '《說文》：“𣬈，人臍也。从囟，囟，取氣通也；从比聲。”', '27.606F': '《說文》：“息，喘也。从心，从自，自亦聲。”', '27.6083': '《說文》：“悃，愊也。从心，困聲。”', '27.606D': '《說文》：“恭，肅也。从心，共聲。”', '27.6069': '《說文》：“恩，惠也。从心，因聲。”', '27.6088': '《說文》：“悈，飾也。从心，戒聲。《司馬法》曰：‘有虞氏悈於中國。’”', '27.609F': '《說文》：“悟，覺也。从心，吾聲。𢛤，古文悟。”', '27.609B': '《說文》：“悛，止也。从心，夋聲。”', '27.E900': '《說文》：“𢙼，恨也。从心，巠聲。”', '27.6092': '《說文》：“悒，不安也。从心，邑聲。”', '27.608D': '《說文》：“悍，勇也。从心，旱聲。”', '27.6063': '《說文》：“恣，縱也。从心，次聲。”', '27.609D': '《說文》：“悝，啁也。从心，里聲。《春秋傳》有孔悝。一曰病也。”', '27.6081': '《說文》：“悁，忿也。从心，肙聲。一曰憂也。𢛋，籀文。”', '27.605A': '《說文》：“恚，恨也。从心，圭聲。”', '27.6094': '《說文》：“悔，悔恨也。从心，每聲。”', '27.6059': '《說文》：“恙，憂也。从心，羊聲。”', '27.6084': '《說文》：“悄，憂也。从心，肖聲。《詩》曰：‘憂心悄悄。’”', '27.6065': '《說文》：“恥，辱也。从心，耳聲。”', '27.6067': '《說文》：“恧，慙也。从心，而聲。”', '27.608C': '《說文新附》：“悌，善兄弟也。从心，弟聲。經典通用弟。”', '27.6D59': '《說文》：“浙，江水東至會稽山陰為浙江。从水，折聲。”', '27.6D90': '《說文》：“涐，水。出蜀汶江徼外，東南入江。从水，我聲。”', '27.6D82': '《說文》：“涂，水。出益州牧靡南山，西北入澠。从水，余聲。”', '27.6D87': '《說文》：“涇，水。出安定涇陽幵頭山，東南入渭，雝州之川也。从水，巠聲。”', '27.6D6A': '《說文》：“浪，滄浪水也。南入江。从水，良聲。”', '27.6DEF': '《說文》：“淯，水。出弘農盧氏山，東南入海。从水，育聲。或曰出酈山西。”', '27.6D6F': '《說文》：“浯，水。出琅邪靈門壺山東北，入濰。从水，吾聲。”', '27.6D78': '《說文》：“𡫏，水。出魏郡武安，東北入呼沱水。从水，𡩠聲；𡩠，籀文𡪢字。”', '27.6D7F': '《說文》：“浿，水。出樂浪鏤方，東入海。从水，貝聲。一曰出浿水縣。”', '27.F0B3': '《說文》：“浝，水也。从水，尨聲。”', '27.6D0D': '《說文》：“洍，水也。从水，𦣞聲。《詩》曰：‘江有洍。’”', '27.6D77': '《說文》：“海，天池也，以納百川者。从水，每聲。”', '27.6D93': '《說文》：“涓，小流也。从水，肙聲。《爾雅》曰：‘汝為涓。’”', '27.6D69': '《說文》：“浩，澆也。从水，告聲。《虞書》曰：‘洪水浩浩。’”', '27.6D6E': '《說文》：“浮，氾也。从水，孚聲。”', '27.6D8C': '《說文》：“涌，滕也。从水，甬聲。一曰涌水，在楚國。”', '27.E947': '《說文》：“㳬，回泉也。从水，旋省聲。”', '27.6D85': '《說文》：“涅，黑土在水中也。从水，从土，曰聲。”', '27.6D65': '《說文》：“浥，溼也。从水，邑聲。”', '27.6D98': '《說文》：“涘，水厓也。从水，矣聲。《周書》曰：‘王出涘。’”', '27.6D66': '《說文》：“浦，瀕也。从水，甫聲。”', '27.6D94': '《說文》：“涔，潰也。一曰涔陽渚，在郢中。从水，岑聲。”', '27.6D5E': '《說文》：“浞，濡也。从水，足聲。”', '27.6D88': '《說文》：“消，盡也。从水，肖聲。”', '27.6D7C': '《說文》：“浼，汙也。从水，免聲。《詩》曰：‘河水浼浼。’《孟子》曰：‘汝安能浼我？’”', '27.6D97': '《說文》：“涗，財溫水也。从水，兌聲。《周禮》曰：‘以涗漚其絲。’”', '27.6D5A': '《說文》：“浚，杼也。从水，夋聲。”', '27.6D92': '《說文》：“涒，食已而復吐之。从水，君聲。《爾雅》曰：‘太歲在申曰涒灘。’”', '27.6D74': '《說文》：“浴，洒身也。从水，谷聲。”', '27.E96B': '《說文》：“𤃬，濯衣垢也。从水，𧹳聲。浣，𤃬或从完。”', '27.6D91': '《說文》：“涑，𤃬也。从水，束聲。河東有涑水。”', '27.6D95': '《說文》：“涕，泣也。从水，弟聲。”', '27.6D79': '《說文新附》：“浹，洽也；从也。从水，夾聲。”', '27.E972': '《說文》：“𣻣，徒行厲水也。从沝，从步。涉，篆文从水。”', '27.F0F7': '《說文》：“𠫐，水泉本也。从灥出厂下。原，篆文从泉。”', '27.F0B2': '《說文》：“𧖴，血理分衺行體者，从𠂢从血。脈，𧖴或从肉。衇，籀文。”', '27.E97A': '《說文》：“谸，望山谷谸谸青也。从谷，千聲。”', '27.51CA': '《說文》：“凊，寒也。从仌，青聲。”', '27.51CD': '《說文》：“凍，仌也。从仌，東聲。”', '27.E97B': '《說文》：“𠗲，仌出也。从仌，朕聲。《詩》曰：‘納于𠗲陰。’凌，𠗲或从夌。”', '27.51CB': '《說文》：“凋，半傷也。从仌，周聲。”', '27.E97D': '《說文》：“𠗴，寒也。从仌，圅聲。”', '27.6247': '《說文》：“扇，扉也。从戶，从翄聲。”', '27.F4AA': '《說文》：“肁，始開也。从戶，从聿。”', '27.6246': '《說文》：“扆，戶牖之閒謂之扆。从戶，衣聲。”', '27.F4A4': '《說文》：“𨳌，登也。從門、𠄟。𠄟，古文下字。讀若軍敶之敶。”', '27.9583': '《說文》：“閃，闚頭門中也。从人在門中。”', '27.803D': '《說文》：“耽，耳大垂也。从耳，冘聲。《詩》曰：‘士之耽兮’。”', '27.8043': '《說文》：“聃，耳曼也。从耳，冉聲。𦕐，聃或从甘。”', '27.803F': '《說文》：“耿，耳箸頰也。从耳，烓省聲。杜林說，耿，光也。从光，聖省。凡字皆左形右聲，杜林非也。”', '27.E9F3': '《說文》：“䎳，𡐦耳也。从耳，月聲。”', '27.8039': '《說文》：“耹，《國語》曰：‘回祿信於耹遂。’闕。”', '27.62F3': '《說文》：“拳，手也。从手，聲。”', '27.6358': '《說文》：“捘，推也。《春秋傳》曰：‘捘衛侯之手。’从手，夋聲。”', '27.632B': '《說文》：“挫，摧也。从手，𡋲聲。”', '27.6308': '《說文》：“挈，縣持也。从手，㓞聲。”', '27.633E': '《說文》：“挾，俾持也。从手，夾聲。”', '27.EA04': '《說文》：“𢬴，拈也。从手，耴聲。”', '27.634B': '《說文》：“捋，取易也。从手，寽聲。”', '27.6349': '《說文》：“捉，搤也。从手，足聲。一曰握也。”', '27.63E4': '《說文》：“揤，捽也。从手，即聲。魏郡有揤裴侯國。”', '27.6336': '《說文》：“挶，𢧢持也。从手，局聲。”', '27.EA11': '《說文》：“㧘，積也。《詩》曰：‘助我舉㧘。’搣頰旁也。从手，此聲。”', '27.6340': '《說文》：“捀，奉也。从手，夆聲。”', '27.632F': '《說文》：“振，舉救也。从手，辰聲。一曰奮也。”', '27.634E': '《說文》：“捎，自關已西，凡取物之上者為撟捎。从手，肖聲。”', '27.6329': '《說文》：“捝，解挩也。从手，兌聲。”', '27.6339': '《說文》：“挹，抒也。从手，邑聲。”', '27.633A': '《說文》：“挺，拔也。从手，廷聲。”', '27.6347': '《說文》：“捇，裂也。从手，赤聲。”', '27.6344': '《說文》：“捄，盛土於梩中也。一曰擾也。《詩》曰：‘捄之陾陾。’从手，求聲。”', '27.6328': '《說文》：“挨，擊背也。从手，矣聲。”', '27.6355': '《說文》：“捕，取也。从手，甫聲。”', '27.6348': '《說文》：“捈，卧引也。从手，余聲。”', '27.6310': '《說文》：“挐，持也。从手，如聲。”', '27.62F2': '《說文》：“拲，兩手同械也。从手，从共，共亦聲。《周禮》：‘上辠梏拲而桎。’㭟，拲或从木。”', '27.6350': '《說文》：“捐，棄也。从手，肙聲。”', '27.634C': '《說文新附》：“捌，《方言》云‘無齒杷’。从手，別聲。”', '27.810A': '《說文》：“脊，背呂也。从𠦬，从肉。”', '27.59EC': '《說文》：“姬，黃帝居姬水以為姓。从女，𦣞聲。”', '27.5A20': '《說文》：“娠，女妊身動也。从女，辰聲。《春秋傳》曰：‘后緡方娠。’一曰：‘宮婢女隸謂之娠。’”', '27.5A23': '《說文》：“娣，女弟也。从女，从弟，弟亦聲。”', '27.EA36': '《說文》：“娒，女師也。从女，每聲。讀若母。”', '27.5A25': '《說文》：“娥，帝堯之女，舜妻。娥皇，字也。秦晉謂好曰娙娥。从女，我聲。”', '27.EA47': '《說文》：“娧，好也。从女，兑聲。”', '27.5A19': '《說文》：“娙，長好也。从女，巠聲。”', '27.5A1B': '《說文》：“娛，樂也。从女，吳聲。”', '27.5A2D': '《說文》：“娭，戲也。从女，矣聲。一曰卑賤名也。”', '27.5A13': '《說文》：“娓，順也。从女，尾聲。讀若媚。”', '27.5A15': '《說文》：“娕，謹也。从女，束聲。讀若謹敕數數。”', '27.5A11': '《說文》：“娑，舞也。从女，沙聲。《詩》曰：‘市也媻娑。’”', '27.5A09': '《說文》：“娉，問也。从女，甹聲。”', '27.EA62': '《說文》：“娋，小小侵也。从女，肖聲。”', '27.EA6D': '《說文》：“㛗，訬疾也。从女，坐聲。”', '27.EA71': '《說文》：“娝，不肖也。从女，否聲。讀若竹皮箁。”', '27.5A41': '《說文》：“婁，空也。从母中女，空之意也。一曰婁務也。𡜰，古文。”', '27.EA75': '《說文》：“娎，娎㛍也。从女，折聲。”', '27.EA76': '《說文》：“㛍，得志㛍㛍。一曰㛍息也。一曰少气也。从女，夾聲。”', '27.5A17': '《說文》：“娗，女出病也。从女，廷聲。”', '27.5A1F': '《說文新附》：“娟，嬋娟也。从女，肙聲。”', '27.EA82': '《說文》：“㲳，觸也。从氐，失聲。”', '27.7434': '《說文》：“琴，禁也。神農所作。洞越，練朱五弦，周加二弦。象形。”', '27.532A': '《說文》：“匪，器。似竹筐。从匚，非聲。《逸周書》曰：‘實玄黃于匪。’”', '27.EA8F': '《說文》：“匫，古器也。从匚，曶聲。”', '27.74F5': '《說文》：“瓵，甌瓿謂之瓵。从瓦，台聲。”', '27.EA99': '《說文》：“㼝，小盂也。从瓦，夗聲。”', '27.74F4': '《說文》：“瓴，瓮似瓶也。从瓦，令聲。”', '27.EAA4': '《說文》：“弲，角弓也。洛陽名弩曰弲。从弓，肙聲。”', '27.5B6B': '《說文》：“孫，子之子曰孫。从子，从系。系，續也。”', '27.7D14': '《說文》：“純，絲也。从糸，屯聲。《論語》曰：‘今也純儉。’”', '27.EAB7': '《說文》：“𥾨，絲下也。从糸，气聲。《春秋傳》有‘臧孫𥾨’。”', '27.7D1D': '《說文》：“紝，機縷也。从糸，壬聲。䋕，紝或从任。”', '27.7D0D': '《說文》：“納，絲溼納納也。从糸，內聲。”', '27.7D21': '《說文》：“紡，網絲也。从糸，方聲。”', '27.7D13': '《說文》：“紓，緩也。从糸，予聲。”', '27.7D0A': '《說文》：“紊，亂也。从糸，文聲。《商書》曰：‘有條而不紊。’”', '27.7D1A': '《說文》：“級，絲次弟也。从糸，及聲。”', '27.7DF9': '《說文》：“緹，帛丹黃色。从糸，是聲。衹，緹或从氏。”', '27.7D11': '《說文》：“紑，白鮮衣皃。从糸，不聲。《詩》曰：‘素衣其紑。’”', '27.7D18': '《說文》：“紘，冠卷也。从糸，厷聲。紭，紘或从弘。”', '27.7D1E': '《說文》：“紞，冕冠塞耳者。从糸，冘聲。”', '27.7D10': '《說文》：“紐，系也。一曰結而可解。从糸，丑聲。”', '27.7D1F': '《說文》：“紟，衣系也。从系，今聲。䋮，籀文从金。”', '27.EADF': '《說文》：“絥，車絥也。从糸，伏聲。茯，絥或从艸。鞴，絥或从革、𤰈聲。”', '27.7D1B': '《說文》：“紛，馬尾韜也。从糸，分聲。”', '27.7D16': '《說文》：“紖，牛系也。从糸，引聲。讀若矤。”', '27.7D19': '《說文》：“紙，絮一笘也。从糸，氏聲。”', '27.7D8C': '《說文》：“綌，粗葛也。从糸，𧮫聲。𢂲，綌或从巾。”', '27.EAF5': '《說文》：“䋀，履也。一曰青絲頭履也，讀若阡陌之陌。从糸，戶聲。”', '27.7D15': '《說文》：“紕，氐人𦇧也。讀若《禹貢》‘玭珠’。从糸，比聲。”', '27.7D20': '《說文》：“素，白緻繒也。从糸、𠂹，取其澤也。”', '27.7D72': '《說文》：“絲，蠶所吐也。从二糸。”', '27.F550': '《說文》：“𢇇，織絹从〔以〕糸貫杼也。从絲省，北聲。”', '27.86BA': '《說文》：“蚦，大蛇。可食。从虫，冄聲。”', '27.87BE': '《說文》：“螾，側行者。从虫，寅聲。蚓，螾或从引。”', '27.8696': '《說文》：“蚖，榮蚖，蛇醫。以注鳴者。从虫，元聲。”', '27.8694': '《說文》：“蚔，䖯也。从虫，氏聲。”', '27.869A': '《說文》：“蚚，強也。从虫，斤聲。”', '27.86A9': '《說文》：“蚩，蟲也。从虫，之聲。”', '27.EB11': '《說文》：“𧉅，𧉅威，委黍。委黍，鼠婦也。从虫，伊省聲。”', '27.8719': '《說文》：“蜙，蜙蝑。以股鳴者。从虫，松聲。蚣，蜙或省。”', '27.8697': '《說文》：“蚗，𧉅蚗，蛁蟟也。从虫，夬聲。”', '27.EB13': '《說文》：“𧉄，𧉅蚗。蟬屬。从虫，丏聲。”', '27.8691': '《說文》：“蚑，行也。从虫，支聲。”', '27.868C': '《說文》：“蚌，蜃屬。从虫，丰聲。”', '27.86A8': '《說文》：“蚨，青蚨，水蟲。可還錢。从虫，夫聲。”', '27.F0F1': '《說文》：“𧎮，齧人跳蟲。从䖵，㕚聲。㕚，古爪字。蚤，𧎮或从虫。”', '27.EB30': '《說文》：“蟁，齧人飛蟲。从䖵，民聲。𧓹，蟁或从昬，以昬時出也。蚊，俗蟁。从虫，从文。”', '27.EB39': '《說文》：“𧖕，蚍蜉，大螘也。从蟲，𣬈聲。蚍，𧖕或从虫，比聲。”', '27.58BA': '《說文》：“墺，四方土可居也。从土，奧聲。𡋸，古文墺。”', '27.57D2': '《說文》：“埒，卑垣也。从土，寽聲。”', '27.EB5C': '《說文》：“垷，涂也。从土，見聲。”', '27.57B8': '《說文》：“垸，以桼和灰而䰍也。从土，完聲。一曰補垸。”', '27.57D0': '《說文》：“埐，地也。从土，聲。”', '27.57C2': '《說文》：“埂，秦謂阬為埂。从土，更聲。”', '27.57C3': '《說文》：“埃，塵也。从土，矣聲。”', '27.57BD': '《說文》：“垽，澱也。从土，沂聲。”', '27.EB79': '《說文》：“埍，徒隸所居也。一曰女牢。一曰亭部。从土，肙聲。”', '27.582F': '《說文》：“堯，高也。从垚在兀上，高遠也。𡋰，古文堯。”', '27.5807': '《說文》：“堇，黏土也。从土，从黄省。𦻍、䒺皆古文堇。”', '27.EB86': '《說文》：“畮，六尺為步，步百為畮。从田，每聲。𤱑，畮或从田、十、久。”', '27.7554': '《說文》：“畔，田界也。从田，半聲。”', '27.755B': '《說文》：“畛，井田閒陌也。从田，㐱聲。”', '27.7559': '《說文》：“畱，止也。从田，丣聲。”', '27.755C': '《說文》：“畜，田畜也。《淮南子》曰：‘玄田為畜。𤲸，’《魯郊禮》畜从田、从茲。茲，益也。”', '27.F03D': '《說文》：“畕，比田也。从二田。”', '27.EE39': '《說文》：“勑，勞也。从力，來聲。”', '27.52CD': '《說文》：“勍，彊也。《春秋傳》曰：‘勍敵之人。’从力，京聲。”', '27.91D8': '《說文》：“釘，鍊鉼黄金。从金，丁聲。”', '27.65B7': '《說文》：“𣃔，截也。从斤，从𢇍。𢇍，古文絕。𠸿，古文𣃔从𠧢，𠧢，古文叀字。《周書》曰：‘𠸿𠸿猗無他技。’𠜷亦古文。”', '27.6599': '《說文》：“料，量也。从斗，米在其中。”', '27.8ED2': '《說文》：“軒，曲輈藩車。从車，干聲。”', '27.8ED3': '《說文》：“軓，車軾前也。从車，凡聲。《周禮》曰：‘立當前軓。’”', '27.EBDB': '《說文》：“䡅，車約䡅也。从車，川聲。《周禮》曰：‘孤乘夏䡅。’一曰下棺車曰䡅。”', '27.8ED4': '《說文》：“軔，礙車也。从車，刃聲。”', '27.F119': '《說文》：“軎，車軸耑也。从車，象形。杜林說。轊，軎或从彗。”', '27.8ED1': '《說文》：“軑，車輨也。从車，大聲。”', '27.EBFB': '《說文》：“陗，陖也。从𨸏，肖聲。”', '27.F0BA': '《說文》：“陖，陗高也。从𨸏，夋聲。”', '27.965C': '《說文》：“陝，隘也。从𨸏，夾聲。”', '27.965F': '《說文》：“陟，登也。从𨸏，从步。𠌹，古文陟。”', '27.9658': '《說文》：“陘，山絕坎也。从𨸏，巠聲。”', '27.965D': '《說文》：“陝，弘農陝也，古虢國王季之子所封也。从𨸏，㚒聲。”', '27.EC07': '《說文》：“䧊，大𨸏也。一曰右扶風郿有䧊𨸏。从𨸏，告聲。”', '27.9664': '《說文》：“除，殿陛也。从𨸏，余聲。”', '27.965B': '《說文》：“陛，升高階也。从𨸏，坒聲。”', '27.EC11': '《說文》：“陙，水𨸏也。从𨸏，辰聲。”', '27.EC25': '《說文》：“㝃，生子免身也。从子，从免。”', '27.EC28': '《說文》：“孴，盛皃。从孨，从日。讀若薿薿。一曰若存。𡥨，籀文孴从二子，一曰𡥨，即奇字㬜。”', '27.8FB1': '《說文》：“辱，耻也。从寸在辰下。失耕時，於封畺上戮之也。辰者，農之時也。故房星為辰，田候也。”', '27.9152': '《說文》：“酒，就也，所以就人性之善惡。从水、从酉，酉亦聲。一曰造也，吉凶所造也。古者儀狄作酒醪，禹嘗之而美，逐䟽儀狄。杜康作秫酒。”', '27.914E': '《說文》：“酎，三重醇酒也。从酉，从時省。《明堂．月令》曰：‘孟秋天子飲酎。’”', '27.914D': '《說文》：“配，酒色也。从酉，己聲。”', '27.EC37': '《說文》：“䣧，酒色也。从酒，弋聲。”', '27.914C': '《說文》：“酌，盛酒行觴也。从酉，勺聲。”', '27.914F': '《說文》：“酏，黍酒也。从酉，也聲。一曰甜也。賈侍中說，酏為鬻清。”', '27.7965': '《說文》：“祥，福也。从示，羊聲。一云善。”', '27.796D': '《說文》：“祭，祭祀也。从示，以手持肉。”', '27.7961': '《說文》：“祡，燒祡燓燎以祭天神。从示，此聲。《虞書》曰：‘至于岱宗，祡。’𥚨，古文祡从隋省。”', '27.796A': '《說文》：“祪，祔祪祖也。从示，危聲。”', '27.796B': '《說文》：“祫，大合祭先祖親疏遠近也。从示、合。《周禮》曰：‘三歲一祫。’”', '27.E00F': '《說文》：“䄆，祀也。从示，𠯑聲。”', '27.7967': '《說文新附》：“祧，遷廟也。从示，兆聲。”', '27.74CA': '《說文》：“瓊，赤玉也。从玉，敻聲。璚，瓊或从矞。瓗，瓊或从巂。琁，瓊或从旋省。”', '27.7403': '《說文》：“球，玉聲也。从玉，求聲。璆，球或从翏。”', '27.73FD': '《說文》：“珽，大圭，長三尺。抒上，終葵首。从玉，廷聲。”', '27.7406': '《說文》：“理，治玉也。从玉，里聲。”', '27.E02D': '《說文》：“㺿，石之似玉者。从玉，𦣝聲。讀若貽。”', '27.E037': '《說文》：“琂，石之似玉者。从玉，言聲。”', '27.7405': '《說文》：“琅，琅玕，似珠者。从玉，良聲。”', '27.7400': '《說文》：“琀，送死口中玉也。从玉，从含。含亦聲。”', '27.838A': '《說文》：“莊，上諱。𤖄，古文莊。”', '27.8386': '《說文》：“莆，萐莆也。从艸，甫聲。”', '27.83A5': '《說文》：“莥，鹿藿之實名也。从艸，狃聲。”', '27.83A0': '《說文》：“莠，禾粟下生莠。从艸，秀聲。讀若酉。”', '27.83A7': '《說文》：“莧，莧菜也。从艸，見聲。”', '27.8392': '《說文》：“莒，齊謂芋為莒。从艸，呂聲。”', '27.E05B': '《說文》：“茝，虈也。从艸，𦣞聲。”', '27.8375': '《說文》：“荵，荵冬艸。从艸，忍聲。”', '27.E060': '《說文》：“荲，艸也。从艸，里聲。讀若釐。”', '27.839E': '《說文》：“莞，艸也，可以作席。从艸，完聲。”', '27.8399': '《說文》：“莙，牛藻也。从艸，君聲。讀若威。”', '27.83A9': '《說文》：“莩，艸也。从艸，孚聲。”', '27.8383': '《說文》：“莃，兔葵也。从艸，稀省聲。”', '27.83A3': '《說文》：“𦯌，杜榮也。从艸，聲。”', '27.E081': '《說文》：“𦮺，茅秀也。从艸，私聲。”', '27.E084': '《說文》：“䓉，䒢䓉也。从艸，邪聲。”', '27.8377': '《說文》：“荷，芙蕖葉。从艸，何聲。”', '27.83AA': '《說文》：“莪，蘿莪，萵屬。从艸，我聲。”', '27.8394': '《說文》：“莔，貝母也。从艸，明省聲。”', '27.E08E': '《說文》：“𦱀，艸也。从艸，育聲。”', '27.83A8': '《說文》：“莨，艸也。从艸，良聲。”', '27.838D': '《說文》：“莍，茮、樧實，裏如表者。从艸，求聲。”', '27.8396': '《說文》：“莖，枝柱也。从艸，巠聲。”', '27.839B': '《說文》：“莛，莖也。从艸，廷聲。”', '27.83A2': '《說文》：“莢，艸實。从艸，夾聲。”', '27.837A': '《說文》：“荺，茇也，茅根也。从艸，均聲。”', '27.E099': '《說文》：“䓄，艸多皃。从艸，㹞聲。江夏平春有䓄亭。”', '27.83A6': '《說文》：“莦，惡艸皃。从艸，肖聲。”', '27.E0B5': '《說文》：“莜，艸田器。从艸，條省聲。《論語》曰：‘以杖荷莜。’”', '27.E0B8': '《說文》：“𦯈，覆也。从艸，㑴省聲。”', '27.E0BA': '《說文》：“荹，亂草。从艸，步聲。”', '27.839D': '《說文》：“莝，斬芻。从艸，坐聲。”', '27.838E': '《說文》：“莎，鎬侯也。从艸，沙聲。”', '27.E0C4': '《說文》：“䓊，艸也。从艸，吾聲。《楚詞》有䓊蕭艸。”', '27.837C': '《說文》：“荼，苦荼也。从艸，余聲。”', '27.84EC': '《說文》：“蓬，蒿也。从艸，逢聲。莑，籀文蓬省。”', '27.838B': '《說文新附》：“莋，越嶲縣名，見《史記》。从艸，作聲。”', '27.83AB': '《說文》：“莫，日且冥也。从日在茻中。”', '27.83BD': '《說文》：“莽，南昌謂犬善逐兔艸中為莽。从犬从茻，茻亦聲。”', '27.6089': '《說文》：“悉，詳盡也。从心，从釆。𢚊，古文悉。”', '27.727B': '《說文》：“牻，白黑雜毛牛。从牛，尨聲。”', '27.E0D6': '《說文》：“𤙛，黄牛虎文。从牛，余聲。讀若塗。”', '27.E0D7': '《說文》：“㸹，牛白脊也。从牛，寽聲。”', '27.727D': '《說文》：“牽，引前也。从牛，象引牛之縻也，玄聲。”', '27.727F': '《說文》：“牿，牛馬牢也。从牛，告聲。《周書》曰：‘今惟牿牛馬。’”', '27.727C': '《說文》：“牼，牛䣛下骨也。从牛，巠聲。《春秋傳》曰：‘宋司馬牼字牛。’”', '27.5534': '《說文》：“唴，秦晉謂兒泣不止曰唴。从口，羌聲。”', '27.555C': '《說文》：“啜，嘗也。从口，叕聲。一曰喙也。”', '27.5557': '《說文》：“啗，食也。从口，臽聲。讀與含同。”', '27.554D': '《說文》：“啍，口气也。从口，𦎧聲。《詩》曰：‘大車啍啍。’”', '27.E0EF': '《說文》：“唫，口急也。从口，金聲。”', '27.608A': '《說文》：“悊，敬也。从心，折聲。”', '27.554F': '《說文》：“問，訊也。从口，門聲。”', '27.552F': '《說文》：“唯，諾也。从口，隹聲。”', '27.5531': '《說文》：“唱，導也。从口，昌聲。”', '27.555E': '《說文》：“啞，笑也。从口，亞聲。”', '27.552A': '《說文》：“唪，大笑也。从口，奉聲。”', '27.5556': '《說文》：“啖，噍啖也。从口，炎聲。一曰噉。”', '27.5541': '《說文》：“啁，啁嘐也。从口，周聲。”', '27.5550': '《說文》：“啐，驚也。从口，卒聲。”', '27.5538': '《說文》：“唸㕧也。从口，念聲。《詩》曰：‘民之方唸㕧。’”', '27.550C': '《說文》：“唌，語唌嘆也。从口，延聲。”', '27.E109': '《說文》：“𠴫，嗼也。从口，叔聲。”', '27.5544': '《說文》：“啄，鳥食也。从口，豖聲。”', '27.552C': '《說文》：“唬，嗁聲也，一曰虎聲。从口，从虎。”', '27.552E': '《說文新附》：“售，賣去手也。从口，雔省聲。”', '27.5533': '《說文新附》：“唳，鶴鳴也。从口，戾聲。”', '27.E111': '《說文》：“䞚，緣大木也。一曰行皃。从走，支聲。”', '27.8D79': '《說文》：“赹，獨行也。从走，勻聲。讀若煢。”', '27.8D7D': '《說文》：“赽，踶也。从走，決省聲。”', '27.E130': '《說文》：“赾，行難也。从走，斤聲。讀若菫。”', '27.901D': '《說文》：“逝，往也。从辵，折聲。讀若誓。”', '27.9020': '《說文》：“造，就也。从辵，告聲。譚長說，造，上士也。艁，古文造从舟。”', '27.901F': '《說文》：“速，疾也。从辵，束聲。遬，籀文从欶。𧫣，古文人欶、从言。”', '27.9022': '《說文》：“逢，遇也。从辵，峯省聲。”', '27.901A': '《說文》：“通，達也。从辵，甬聲。”', '27.9017': '《說文》：“逗，止也。从辵，豆聲。”', '27.9021': '《說文》：“逡，復也。从辵，夋聲。”', '27.9023': '《說文》：“連，員連也。从辵，从車。”', '27.9011': '《說文》：“逑，斂聚也。从辵，求聲。《虞書》曰：‘㫄逑孱功。’又曰：‘怨匹曰逑。’”', '27.E176': '《說文》：“䢙，𣀩也。从辵，貝聲。《周書》曰：‘我興受其䢙。’”', '27.900B': '《說文》：“逋，亡也。从辵，甫聲。𨕝，籀文逋从捕。”', '27.9010': '《說文》：“逐，追也。从辵，从豚省。”', '27.E17A': '《說文》：“逎，迫也。从辵，酉聲。遒，逎或从酋。”', '27.901E': '《說文》：“逞，通也。从辵，呈聲。楚謂疾行為逞。《春秋傳》曰：‘何所不逞欲。’”', '27.9016': '《說文》：“逖，遠也。从辵，狄聲。逷，古文逖。”', '27.900F': '《說文新附》：“透，跳也；過也。从辵，秀聲。”', '27.900D': '《說文新附》：“逍，逍遙，猶翱翔也。从辵，肖聲。”', '27.E194': '《說文》：“㣤，迹也。从彳，戔聲。”', '27.5FAC': '《說文》：“徬，附行也。从彳，㫄聲。”', '27.5F9B': '《說文》：“徛，舉脛有渡也。从彳，奇聲。”', '27.5FA1': '《說文》：“御，使馬也。从彳，从卸。馭，古文御。从又，从馬。”', '27.8853': '《說文》：“術，邑中道也。从行，术聲。”', '27.E19F': '《說文》：“𧗳，行且賣也。从行，从言。衒，𧗳或从玄。”', '27.E1C0': '《說文》：“䟗，尌也。从足，氏聲。”', '27.8DBF': '《說文》：“趿，進足有所擷取也。从足，及聲。《爾雅》曰：‘趿謂之擷。’”', '27.E1D2': '《說文》：“趽，曲脛馬也。从足，方聲。讀與彭同。”', '27.8DB9': '《說文》：“趹，馬行皃。从足，決省聲。”', '27.8DBC': '《說文》：“趼，獸足企也。从足，幵聲。”', '27.8DC2': '《說文》：“跂，足多指也。从足，支聲。”', '27.5546': '《說文》：“商，从外知內也。从㕯，章省聲。𠿧，古文商。𠹧，亦古文商。𡅟，籀文商。”', '27.7B31': '《說文》：“笱，曲竹捕魚笱也。从竹，从句，句亦聲。”', '27.E1E5': '《說文》：“卙，卙卙，盛也。从十，从甚。汝南名蠶盛曰卙。”', '27.E1E6': '《說文》：“𠦫，詞之𠦫矣。从十，咠聲。”', '27.8A31': '《說文》：“許，聽也。从言，午聲。”', '27.8A69': '《說文》：“詩，志也。从言，寺聲。𧥳，古文詩省。”', '27.8A2A': '《說文》：“訪，汎謀曰訪。从言，方聲。”', '27.E1F1': '《說文》：“訦，燕、代、東齊謂信訦。从言，冘聲。”', '27.F0DD': '《說文》：“䚻，徒歌。从言，肉。”', '27.8A22': '《說文》：“訢，喜也。从言，斤聲。”', '27.8A2D': '《說文》：“設，施陳也。从言，从殳。殳，使人也。”', '27.8A25': '《說文》：“訥，言難也。从言，从內。”', '27.E1FB': '《說文》：“諎，大聲也。从言，昔聲。讀若笮。唶，諎或从口。”', '27.E205': '《說文》：“䛁，䛁䛁多語也。从言，冄聲。樂浪有䛁邯縣。”', '27.8A2C': '《說文》：“訬，訬擾也。一曰訬獪。从言，少聲。讀若毚。”', '27.E21D': '《說文》：“詾，說也。从言，匈聲。訩，或省。𧧗，詾或从兇。”', '27.8A1F': '《說文》：“訟，爭也。从言，公聲。曰謌訟。䛦，古文訟。”', '27.8A27': '《說文》：“訧，罪也。从言，尤聲。《周書》曰：‘報以庶訧。’”', '27.8A23': '《說文新附》：“訣，訣別也。一曰法也。从言，決省聲。”', '27.7AE0': '《說文》：“章，樂竟為一章。从音，从十。十，數之終也。”', '27.7ADF': '《說文》：“竟，樂曲盡為竟。从音，从人。”', '27.7570': '《說文》：“異，分也。从廾、从畀。畀，予也。”', '27.976A': '《說文》：“靪，補履下也。从革，丁聲。”', '27.52D2': '《說文》：“勒，馬頭絡銜也。从革，力聲。”', '27.E272': '《說文》：“𩱡，鬻也。餰，或从衍聲。”', '27.F06E': '《說文》：“𩱷，涼州謂鬻為𩱷，从䰜𥽘聲。粖，𩱷或省从末。”', '27.57F6': '《說文》：“埶，種也。从坴、𠃨，持亟種之。”', '27.5B70': '《說文》：“𦏧，食飪也。从𠃨，𦎫聲。《易》曰：‘孰飪。’”', '27.8C3B': '《說文》：“谻，相踦之也。从𠃨，𧮫聲。”', '27.66FC': '《說文》：“曼，引也。从又，冒聲。”', '27.E28B': '《說文》：“𠭙，引也。”', '27.5F57': '《說文》：“彗，掃竹也。从又持甡。篲，彗或从竹。𥱵，古文彗，从竹从習。”', '27.665D': '《說文》：“晝，日之出入，與夜為界。从畫省，从日。𦘘，籀文晝。”', '27.5805': '《說文》：“堅，剛也。从臤，从土。”', '27.E2A5': '《說文》：“𣪌，繇擊也。从殳，豆聲。古文祋如此。”', '27.F0F3': '《說文》：“𣪐，縣物𣪐擊。从殳，𠃬聲。”', '27.6BBF': '《說文》：“殿，擊聲也。从殳，𡱂聲。”', '27.F5E7': '《說文》：“殹，擊中聲也。从殳，医聲。”', '27.5C07': '《說文》：“將，帥也。从寸，𤖕省聲。”', '27.5C08': '《說文》：“專，六寸簿也。从寸，叀聲。一曰專，紡專。”', '27.555F': '《說文》：“啟，教也。从攴，启聲。《論語》曰：‘不憤不啟。’”', '27.654F': '《說文》：“敏，疾也。从攴，每聲。”', '27.E2BC': '《說文》：“㪋，止也。从攴，旱聲。《周書》曰：‘㪋我于艱。’”', '27.E2BD': '《說文》：“敒，理也。从攴，伸聲。”', '27.6555': '《說文》：“敕，誡也。臿地曰敕。从攴，束聲。”', '27.6551': '《說文》：“救，止也。从攴，求聲。”', '27.6553': '《說文》：“敓，彊取也。《周書》：‘敓攘矯虔。’从攴，兌聲。”', '27.6557': '《說文》：“敗，毁也。从攴、貝。敗賊皆从貝，會意。贁，籀文敗，从賏。”', '27.5BC7': '《說文》：“寇，暴也。从攴，完。”', '27.526B': '《說文》：“剫，判也。从刀，度聲。”', '27.F4AD': '《說文》：“𠩺，坼也。从攴，从厂。厂之性坼，果孰有味亦坼，故謂之𠩺。从未聲。”', '27.6554': '《說文》：“敔，禁也。一曰樂器，椌楬也，形如木虎。从攴，吾聲。”', '27.6558': '《說文》：“敍，次弟也。从攴，余聲。”', '27.5EB8': '《說文》：“庸，用也。从用，从庚。庚，更事也。《易》曰：‘先庚三日。’”', '27.723D': '《說文》：“爽，明也。从㸚，从大。𠁊，篆文爽。”', '27.773C': '《說文》：“眼，目也。从目，𥃩聲。”', '27.7725': '《說文》：“眥，目匡也。从目，此聲。”', '27.E2E7': '《說文》：“眮，吳、楚謂瞋目、顧視曰眮。从目，同聲。”', '27.773D': '《說文》：“眽，目財視也。从目，𠂢聲。”', '27.778B': '《說文》：“瞋，張目也。从目，真聲。𥅜，祕書瞋从戌。”', '27.7737': '《說文》：“眷，顧也。从目，聲。《詩》曰：‘乃眷西顧。’”', '27.7735': '《說文》：“眵，目傷眥也。从目，多聲。一曰瞢兜。”', '27.772F': '《說文》：“眯，艸入目中也。从目，米聲。”', '27.773A': '《說文》：“眺，目不正也。从目，兆聲。”', '27.E307': '《說文》：“䀩，眄也。从目，各聲。”', '27.772D': '《說文新附》：“眭，深目也。从目，圭聲。”', '27.7739': '《說文新附》：“眹，目精也。从目，灷聲。”', '27.7738': '《說文新附》：“眸，目童子也。从目，牟聲。”', '27.7FD2': '《說文》：“習，數飛也。从羽，从白。”', '27.E314': '《說文》：“𦐛，羽曲也。从羽，句聲。”', '27.7FCF': '《說文》：“翏，高飛也。从羽，从㐱。”', '27.7FCA': '《說文》：“翊，飛皃。从羽，立聲。”', '27.7FC7': '《說文》：“翇，樂舞執全羽以祀社稷也。从羽，犮聲。”', '27.7FCE': '《說文新附》：“翎，羽也。从羽，令聲。”', '27.96C0': '《說文》：“雀，依人小鳥也。从小、隹。讀與爵同。”', '27.E31A': '《說文》：“猚，鳥也。从隹，犬聲。雎陽有猚水。”', '27.E329': '《說文》：“𨾊，鳥肥大𨾊𨾊也。从隹，工聲。䲨，𨾊或从鳥。”', '27.96BF': '《說文》：“隿，繳射飛鳥也。从隹，弋聲。”', '27.F5F1': '《說文》：“奞，鳥張毛羽自奮也。从大，从隹。”', '27.7F9C': '《說文》：“羜，五月生羔也。从羊，宁聲。讀若煮。”', '27.7F9D': '《說文》：“羝，牡羊也。从羊，氐聲。”', '27.9CE5': '《說文》：“鳥，長尾禽緫名也。象形，鳥之足似匕，从匕。”', '27.7109': '《說文》：“焉，焉鳥，黃色，出於江淮。象形。”', '27.7562': '《說文》：“畢，田罔也。从𠦒，象畢形微也。或曰甶聲。”', '27.7388': '《說文新附》：“玈，黑色也。从玄，旅省聲。義當用黸。”', '27.6556': '《說文》：“敖，出游也。从出，从放。”', '27.F5B4': '《說文》：“𤔔，治也。幺子相亂，𠬪治之也。讀若亂同。一曰理也。𤔐，古文𤔔。”', '27.EE59': '《說文》：“𠭖，進取也。从𠬪，古聲。𣪏，籀文𠭖；𢽤，古文𠭖。”', '27.E372': '《說文》：“𠭗，坑也。从𣦼，从井，井亦聲。”', '27.6BAA': '《說文》：“殪，死也。从歺，壹聲。𣩉，古文殪从死。”', '27.8123': '《說文》：“脣，口耑也。从肉，辰聲。䫃，古文从頁。”', '27.8130': '《說文》：“脰，項也。从肉，豆聲。”', '27.812C': '《說文》：“脬，𦜶光也。从肉，孚聲。”', '27.811F': '《說文》：“脟，脅肉也。从肉，寽聲。一曰脟，腸間𦘺也。一曰膫也。”', '27.8122': '《說文》：“脢，背肉也。从肉，每聲。《易》曰：‘咸其脢。’”', '27.811B': '《說文》：“脛，胻也。从肉，巠聲。”', '27.812B': '《說文》：“脫，消肉臞也。从肉，兌聲。”', '27.8119': '《說文》：“脙，齊人謂臞脙也。从肉，求聲。讀若休止。”', '27.818C': '《說文》：“膌，瘦也。从肉，脊聲。㾊，古文膌从疒、从朿，朿亦聲。”', '27.E39A': '《說文》：“脪，創肉反出也。从肉，希聲。”', '27.812F': '《說文》：“脯，乾肉也。从肉，甫聲。”', '27.8129': '《說文》：“脩，脯也。从肉，攸聲。”', '27.8118': '《說文》：“脘，胃府也。从肉，完聲。讀若患。舊云脯。”', '27.8127': '《說文新附》：“脧，赤子陰也。从肉，夋聲。或从血。”', '27.E3B8': '《說文新附》：“䏰，𦚧䏰也。从肉，忍聲。”', '27.E3B9': '《說文》：“䇟，筋之本也。从筋，从夗省聲。腱，䇟或从肉、建。”', '27.E3BD': '《說文》：“㓵，刀劎刃也。”', '27.526A': '《說文》：“𣦃（剪），齊斷也。从刀，歬聲。”', '27.526C': '《說文》：“剬，斷齊也。从刀，耑聲。”', '27.526F': '《說文》：“副，判也。从刀，畐聲。《周禮》曰：‘副辜祭。’疈，籀文副。”', '27.E3D8': '《說文》：“𧢼，角長皃。从角，爿聲。”', '27.E3DA': '《說文》：“䚗，舉角也。从角，公聲。”', '27.89F6': '《說文》：“觶，鄉飲酒角也。《禮》曰：‘一人洗舉觶。’觶受四升。从角，單聲。𧣨，觶或从辰。觗，《禮經》觶。”', '27.7B22': '《說文》：“笢，竹膚也。从竹，民聲。”', '27.7B28': '《說文》：“笨，竹裏也。从竹，本聲。”', '27.7B35': '《說文》：“笵，法也。从竹，竹，簡書也；氾聲。古法有竹刑。”', '27.7B26': '《說文》：“符，信也。漢制以竹，長六寸，分而相合。从竹，付聲。”', '27.7B2E': '《說文》：“笮，迫也。在瓦之下棼上。从竹，乍聲。”', '27.7B2B': '《說文》：“笫，牀簣也。从竹，𠂔聲。”', '27.7B25': '《說文》：“笥，飯及衣之器也。从竹，司聲。”', '27.7B2F': '《說文》：“笯，鳥籠也。从竹，奴聲。”', '27.7B20': '《說文》：“笠，簦無柄也。从竹，立聲。”', '27.7B2D': '《說文》：“笭，車笭也。从竹，令聲。一曰：笭，籯也。”', '27.7B18': '《說文》：“笘，折竹箠也。从竹，占聲。潁川人名小兒所書寫為笘。”', '27.7B2A': '《說文》：“笪，笞也。从竹，旦聲。”', '27.7B1E': '《說文》：“笞，擊也。从竹，台聲。”', '27.7B19': '《說文》：“笙，十三簧，象鳳之身也。笙，正月之音。物生，故謂之笙。大者謂之巢，小者謂之和。从竹，生聲。古者，隨作笙。”', '27.7B1B': '《說文》：“笛，七孔筩也。从竹，由聲。羌笛三孔。”', '27.751C': '《說文》：“甛，美也。从甘，从舌。舌，知甘者。”', '27.66F9': '《說文》：𣍘，獄之兩曹也。在廷東，从㯥，治事者，从曰。”', '27.68AA': '《說文》：“梪，木豆謂之梪。从木、豆。”', '27.8659': '《說文》：“虙，虎皃。从虍，必聲。”', '27.F131': '《說文》：“虘，虎不柔不信也。从虍，且聲。讀若䣜縣。”', '27.8656': '《說文》：“虖，哮虖也。从虍，𠂞聲。”', '27.5F6A': '《說文》：“彪，虎文也。从虎，彡象其文也。”', '27.E448': '《說文》：“𧆦，虎皃。从虎，气聲。”', '27.76DB': '《說文》：“盛，黍稷在器中以祀者也。从皿，成聲。”', '27.7F3E': '《說文》：“缾，𦉥也。从缶，并聲。瓶，缾或从瓦。”', '27.E497': '《說文》：“䍇，下平缶也。从缶，乏聲。讀若𦐇。”', '27.E49B': '《說文》：“䍄，缺也。从缶，占聲。”', '27.F563': '《說文》：“啚，嗇也。从囗、㐭。㐭，受也。𠴿，古文啚如此。”', '27.9EA5': '《說文》：“麥，芒穀。秋穜厚薶，故謂之麥。麥，金也。金王而生，火王而死。从來，有穗者。从夕。”', '27.611B': '《說文》：“愛，行皃。从夊，㤅聲。”', '27.68A8': '《說文》：“棃，果名。从木，𥝢聲。𥝢，古文利。”', '27.68AC': '《說文》：“梬，棗也，似柹。从木，甹聲。”', '27.6885': '《說文》：“梅，枏也，可食。从木，每聲。楳，或从某。”', '27.68AB': '《說文》：“梫，桂也。从木，㑴省聲。”', '27.68A3': '《說文》：“梣，青皮木。从木，岑聲。𣘕，或从𡩠省。𡩠，籀文𡪢。”', '27.6893': '《說文》：“梓，楸也。从木，宰省聲。榟，或不省。”', '27.6875': '《說文》：“桵，白桵，棫。从木，妥聲。”', '27.68A2': '《說文》：“梢，木也。从木，肖聲。”', '27.E4E2': '《說文》：“㭩，木也。从木，寽聲。”', '27.68AD': '《說文》：“梭，木也。从木，夋聲。”', '27.68A4': '《說文》：“梤，香木也。从木，𡵳聲。段玉裁注：“形聲包會意也。”', '27.6882': '《說文》：“梂，櫟實。一曰鑿首。从木，求聲。”', '27.68A7': '《說文》：“梧，梧桐木。从木，吾聲。一名櫬。”', '27.6897': '《說文》：“梗，山枌榆。有朿，莢可為蕪荑者。从木，更聲。”', '27.6887': '《說文》：“梇，木也。从木，弄聲。益州有梇棟縣。”', '27.689D': '《說文》：“條，小枝也。从木，攸聲。”', '27.6883': '《說文》：“梃，一枚也。从木，廷聲。”', '27.6879': '《說文》：“桹，高木也。从木，良聲。”', '27.6874': '《說文》：“桴，棟名。从木，孚聲。”', '27.6877': '《說文》：“桷，榱也，椽方曰桷。从木，角聲。《春秋傳》曰：‘刻桓宮之桷。’”', '27.68A0': '《說文》：“梠，楣也。从木，呂聲。”', '27.6880': '《說文》：“梀，短椽也。从木，束聲。”', '27.68B1': '《說文》：“梱，門橛也。从木，困聲。”', '27.686F': '《說文》：“桯，牀前几。从木，呈聲。”', '27.6871': '《說文》：“桱，桱桯也，東方謂之蕩。从木，巠聲。”', '27.E50F': '《說文》：“𣒃，穜樓也。一曰燒麥柃𣒃。从木，役聲。”', '27.68AF': '《說文》：“梯，木階也。从木，弟聲。”', '27.68B2': '《說文》：“梲，木杖也。从木，兌聲。”', '27.E51E': '《說文》：“桰，𨽌也。从木，𠯑聲。一曰矢栝，築弦處。”', '27.6876': '《說文》：“桶，木方，受六升。从木，甬聲。”', '27.6890': '《說文》：“梐，梐枑也。从木，陛省聲。”', '27.6881': '《說文》：“梁，水橋也。从木，从水，刅聲。渿，古文。”', '27.689C': '《說文》：“梜，檢柙也。从木，夾聲。”', '27.68A1': '《說文》：“梡，㮯木薪也。从木，完聲。”', '27.68B0': '《說文》：“械，桎梏也。从木，戒聲。一曰器之緫名。一曰持也。一曰有盛為械，無盛為器。”', '27.688F': '《說文》：“梏，手械也。从木，告聲。”', '27.689F': '《說文》：“梟，不孝鳥也。日至，捕梟磔之。从鳥頭在木上。”', '27.6894': '《說文》：“梔，木，實可染。从木，巵聲。”', '27.68B5': '《說文新附》：“梵，出自西域釋書。未詳意義。”', '27.7522': '《說文》：“產，生也。从生，彥省聲。”', '27.5DE2': '《說文》：“巢，鳥在木上曰巢，在穴曰窠。从木，象形。”', '27.E53F': '《說文》：“𡬯，傾覆也。从寸，𦥑覆之。寸，人手也。从巢省。杜林說以為貶損之貶。”', '27.687C': '《說文》：“木汁，可以䰍物。象形，桼如水滴而下，凡桼之屬皆从桼。”', '27.570B': '《說文》：“國，邦也。从囗，从或。”', '27.5708': '《說文》：“圈，養畜之閑也。从囗，卷聲。”', '27.8CA8': '《說文》：“貨，財也。从貝，化聲。”', '27.8CAC': '《說文》：“責，求也。从貝，朿聲。”', '27.8CA9': '《說文》：“販，買賤賣貴者。从貝，反聲。”', '27.8CAA': '《說文》：“貪，欲物也。从貝，今聲。”', '27.8CB6': '《說文》：“貶，損也。从貝，从乏。”', '27.90FD': '《說文》：“都，有先君之舊宗廟曰都。从邑，者聲。《周禮》距國五百里為都。”', '27.90E8': '《說文》：“部，天水狄部。从邑，咅聲。”', '27.90EA': '《說文》：“郪，新郪，汝南縣。从邑，妻聲。”', '27.90EB': '《說文》：“郫，蜀縣也。从邑，卑聲。”', '27.90F4': '《說文》：“郴，桂陽縣。从邑，林聲。”', '27.90D4': '《說文》：“郔，鄭地。从邑，延聲。”', '27.90F0': '《說文》：“郰，魯下邑，孔子之鄉。从邑，取聲。”', '27.E57B': '《說文》：“䣍，周公所誅䣍國，在魯。从邑，奄聲。”', '27.90EF': '《說文》：“郯，東海縣，帝少昊之後所封。从邑，炎聲。”', '27.90ED': '《說文》：“郭，齊之郭氏虛。善善不能進，惡惡不能退，是以亡國也。从邑，𩫏聲。”', '27.90F3': '《說文》：“郳，齊地。从邑，兒聲。《春秋傳》曰：‘齊高厚定郳田。’”', '27.E588': '《說文》：“䣊，地名。从邑，尚聲。”', '27.E58C': '《說文》：“𨛭，地名。从邑，舍聲。”', '27.6662': '《說文》：“晢，昭晣，明也。从日，折聲。”', '27.6664': '《說文》：“晤，明也。从日，吾聲。”', '27.665B': '《說文》：“晛，日見也。从日，从見，見亦聲。”', '27.E599': '《說文》：“晧，日出皃。从日，告聲。”', '27.665A': '《說文》：“晚，莫也。从日，免聲。”', '27.6666': '《說文》：“晦，月盡也。从日，每聲。”', '27.E59E': '《說文》：“㫱，溫溼也。从日，赧省聲。”', '27.665E': '《說文》：“晞，乾也。从日，希聲。”', '27.6659': '《說文》：“晙，明也。从日，夋聲。”', '27.65CC': '《說文》：“旌，游車載旌，析羽注旄首，所以精進士卒。从㫃，生聲。”', '27.E5AC': '《說文》：“旇，旌旗披靡也。从㫃，皮聲。”', '27.65CB': '《說文》：“旋，周旋，旌旗之指麾也。从㫃，从疋。”', '27.65CF': '《說文》：“族，矢鋒也，束之族族也。从㫃，从矢。”', '27.F39A': '《說文》：“䢅，早昧爽也。从𦥑，从辰。辰，時也，辰亦聲。𠃨夕為𡖊，𦥑辰為䢅，皆同意。”', '27.E5B5': '《說文》：“朚，翌也。从明，亡聲。”', '27.E5BE': '《說文》：“𡌪，大也。从多，圣聲。”', '27.8CAB': '《說文》：“貫，錢貝之貫。从毌、貝。”', '27.E5CE': '《說文》：“𪗉，稷也。从禾，亝（齊）聲。秶，𪗉或从次。”', '27.79FB': '《說文》：“移，禾相倚移也。从禾，多聲。一曰禾名。”', '27.E5D9': '《說文》：“䅁，轢禾也。从禾，安聲。”', '27.E5DC': '《說文》：“秳，舂粟不漬也。从禾，𠯑聲。”', '27.7A03': '《說文》：“稃，𥢶也。从禾，孚聲。𥹃，稃或从米，付聲。”', '27.F092': '《說文》：“穅，穀皮也。从禾，从米，庚聲。康，穅或省。”', '27.E5E4': '《說文》：“𥞥，黍穰也。从禾，𠛱聲。”', '27.7A2F': '《說文》：“稯，布之八十縷為稯。从禾，㚇聲。𥞝，籀文稯省。”', '27.E5EF': '《說文》：“𪏻，黏也。从黍，古聲。䊀，黏或从米。”', '27.7C97': '《說文》：“粗，疏也。从米，且聲。”', '27.E5F5': '《說文》：“䉾，惡米也。从米，北聲。《周書》有《䉾誓》。”', '27.7C92': '《說文》：“粒，糂也。从米，立聲。”', '27.E5FB': '《說文》：“𥹆，潰米也。从米，尼聲。交阯有𥹆泠縣。”', '27.7C95': '《說文新附》：“粕，糟粕，酒滓也。从米，白聲。”', '27.7C94': '《說文新附》：“粔，粔籹，膏環也。从米，巨聲。”', '27.8202': '《說文》：“舂，擣粟也。从廾，持杵臨臼上。午，杵省也。古者雝父初作舂。”', '27.9EBB': '《說文》：“麻，與𣏟同。人所治，在屋下。从广，从𣏟。”', '27.E60E': '《說文》：“㼎，小瓜也。从瓜，交聲。”', '27.74E0': '《說文》：“瓠，匏也。从瓜，夸聲。”', '27.5BBF': '《說文》：“㝛，止也。从宀，𠈇聲。𠈇，古文夙。”', '27.5BC1': '《說文》：“寁，居之速也。从宀，疌聲。”', '27.5BC4': '《說文》：“寄，託也。从宀，奇聲。”', '27.5BC0': '《說文新附》：“宷，同地為宷。从宀，釆聲。”', '27.7A90': '《說文》：“窐，甑空也。从穴，圭聲。”', '27.7A92': '《說文》：“窒，塞也。从穴，至聲。”', '27.7A95': '《說文》：“窕，深肆極也。从穴，兆聲。讀若挑。”', '27.E63A': '《說文》：“䆞，冥也。从穴，㫐聲。”', '27.7A94': '《說文》：“窔，䆞窔，深也。从穴，交聲。”', '27.75B5': '《說文》：“疵，病也。从疒，此聲。”', '27.75D2': '《說文》：“痒，瘍也。从疒，羊聲。”', '27.75CE': '《說文》：“痎，二日一發瘧。从疒，亥聲。”', '27.75D4': '《說文》：“痔，後病也。从疒，寺聲。”', '27.75CF': '《說文》：“痏，疻痏也。从疒，有聲。”', '27.75CD': '《說文》：“痍，傷也。从疒，夷聲。”', '27.75D5': '《說文》：“痕，胝瘢也。从疒，艮聲。”', '27.75CB': '《說文》：“痋，動病也。从疒，蟲省聲。”', '27.7643': '《說文》：“癃，罷病也。从疒，隆聲。𤵸，籀文癃省。”', '27.75D1': '《說文》：“痑，馬病也。从疒，多聲。《詩》曰：‘痑痑駱馬。’”', '27.5195': '《說文》：“冕，大夫以上冠也，邃延垂瑬紞纊。从冃，免聲。古者黃帝初作冕。絻，冕或从糸。”', '27.F598': '《說文》：“㒼，平也。从廿，五行之數二十分為一辰。㒳，㒼平也。讀若蠻。”', '27.E670': '《說文》：“䍘，周行也。从网，米聲。《詩》曰：‘䍘入其阻。’𥹄，䍘或从𣦵。”', '27.8982': '《說文》：“覂，反覆也。从襾，乏聲。”', '27.5E36': '《說文》：“帶，紳也。男子鞶帶，婦人帶絲，象繫佩之形。佩必有巾，从巾。”', '27.5E38': '《說文》：“常，下帬也。从巾，尚聲。裳，常或从衣。”', '27.5E34': '《說文》：“帴，帬也。一曰帗也。一曰婦人脅衣。从巾，戔聲。”', '27.E681': '《說文》：“𢃭，㡓也。从巾，怱聲。一曰帙。𢃓，𢃭，或从松。”', '27.5E37': '《說文》：“帷，在旁曰帷。从巾，隹聲。𠥎，古文帷。”', '27.5E33': '《說文》：“帳，張也。从巾，長聲。”', '27.E697': '《說文》：“㡉，布，出東萊。从巾，弦聲。”', '27.E69C': '《說文》：“𢂷，士無巿有𢂷，制如榼，缺四角，爵弁服，其色韎，賤不得裳同。司農曰：‘裳纁色。’从巿，合聲。韐，𢂷或从韋。”', '27.768E': '《說文》：“皎，月之白也。从白，交聲。《詩》曰：月出皎兮。’”', '27.655D': '《說文》：“敝，帗也。一曰敗衣。从攴，从㡀。㡀亦聲。”', '27.E6A6': '《說文》：“㑮，人姓。从人，軍聲。”', '27.5070': '《說文》：“偰，高辛氏之子，堯司徒，殷之先。从人，契聲。”', '27.5049': '《說文》：“偉，奇也。从人，韋聲。”', '27.E6AC': '《說文》：“𠊩，具也。从人，孨聲。讀若汝南𣹏水。《虞書》曰：‘旁救𠊩功。’”', '27.5065': '《說文》：“健，伉也。从人，建聲。”', '27.5072': '《說文》：“偲，彊力也。从人，思聲。《詩》曰：‘其人美且偲。’”', '27.506B': '《說文》：“偫，待也。从人，从待。”', '27.5053': '《說文》：“偓，佺也。从人，屋聲。段玉裁注：“偓，偓佺，古仙人名也。”', '27.5055': '《說文》：“偕，彊也。从人，皆聲。《詩》曰：‘偕偕士子’。一曰俱也。”', '27.5074': '《說文》：“側，旁也。从人，則聲。”', '27.5041': '《說文》：“偁，揚也。从人，爯聲。”', '27.5047': '《說文》：“假，非真也。从人，叚聲。一曰至也。《虞書》曰：‘假于上下。’”', '27.5046': '《說文》：“偆，富也。从人，春聲。”', '27.506D': '《說文》：“偭，鄉也。从人，面聲。”', '27.E6B9': '《說文》：“𠊾，左右兩視。从人，癸聲。”', '27.504B': '《說文》：“偋，僻寠也。从人，屏聲。”', '27.E6BD': '《說文》：“偄，弱也。从人，从耎。”', '27.504F': '《說文》：“偏，頗也。从人，扁聲。”', '27.507D': '《說文》：“偽，詐也。从人，為聲。”', '27.E6C4': '《說文》：“𠊬，徼𠊬，受屈也。从人，卻聲。”', '27.5043': '《說文》：“偃，僵也。从人，匽聲。”', '27.5076': '《說文》：“偶，桐人也。从人，禺聲。”', '27.505C': '《說文新附》：“停，止也。从人，亭聲。”', '27.5075': '《說文新附》：“偵，問也。从人，貞聲。”', '27.5319': '《說文》：“匙，匕也。从匕，是聲。”', '27.9803': '《說文》：“頃，頭不正也。从匕，从頁。”', '27.E6D0': '《說文》：“匘，頭𩪦也。从匕，匕，相匕著也。巛象髮，囟象匘形。”', '27.865B': '《說文》：“虛，大丘也。崐崘丘謂之崐崘虛，古者九夫為井，四井為邑，四邑為丘，丘謂之虛。从丘，虍聲。”', '27.773E': '《說文》：“眾，多也，从㐺、目，眾意。”', '27.8897': '《說文》：“袗，玄服。从衣，㐱聲。裖，袗或从辰。”', '27.888D': '《說文》：“袍，襺也。从衣，包聲。《論語》曰：‘衣弊縕袍。’”', '27.88A4': '《說文》：“袤，衣帶以上。从衣，矛聲。一曰：南北曰袤，東西曰廣。𧝺，籀文袤从楙。”', '27.889B': '《說文》：“袛，袛裯，短衣。从衣，氐聲。”', '27.88AA': '《說文》：“袪，衣袪也。从衣，去聲。一曰：袪，褱也。褱者，袌也。袪尺二寸。《春秋傳》曰：‘披斬其袪。’”', '27.890E': '《說文》：“褎，袂也。从衣，𥝩聲。袖，俗褎从由。”', '27.888C': '《說文》：“袌，褱也。从衣，包聲。”', '27.E6E2': '《說文》：“袥，衣衸。从衣，石聲。”', '27.8889': '《說文》：“袉，裾也。从衣，它聲。《論語》曰：‘朝服袉紳。’”', '27.8891': '《說文》：“袑，絝上也。从衣，召聲。”', '27.88AB': '《說文》：“被，𡪢衣，長一身有半。从衣，皮聲。”', '27.8893': '《說文》：“袓，事好也。从衣，且聲。”', '27.88A2': '《說文》：“袢，無色也。从衣，半聲。一曰《詩》曰：‘是紲袢也。’讀若普。”', '27.E6ED': '《說文》：“𧘽，弊衣。从衣，奴聲。”', '27.8892': '《說文》：“袒，衣縫解也。从衣，旦聲。”', '27.889A': '《說文》：“袚，蠻夷衣。从衣，犮聲。一曰蔽厀。”', '27.88A8': '《說文新附》：“袨，盛服也。从衣，玄聲。”', '27.6BEC': '《說文新附》：“毬，鞠丸也。从毛，求聲。”', '27.5C5D': '《說文》：“屝，履也。从尸，非聲。”', '27.5C60': '《說文》：“屠，刳也。从尸，者聲。”', '27.8239': '《說文》：“船，舟也。从舟，鉛省聲。”', '27.8233': '《說文》：“舳，艫也。从舟，由聲。漢律名船方長為舳艫。一曰舟尾。”', '27.8238': '《說文新附》：“舸，舟也。从舟，可聲。”', '27.515C': '《說文》：“兜，兜鍪，首鎧也。从𠑹，从皃省。皃，象人頭也。”', '27.E71D': '《說文》：“𧠥，𧠥覰，闚觀也。从見，𠂔聲。”', '27.E72A': '《說文》：“覒，擇也。从見，毛聲。讀若苗。”', '27.6B32': '《說文》：“欲，貪欲也。从欠，谷聲。”', '27.6B38': '《說文》：“欸，訾也。从欠，矣聲。”', '27.6B37': '《說文》：“欷，歔也。从欠，稀省聲。”', '27.E743': '《說文》：“㰮，指而笑也。从欠，辰聲。讀若蜃。”', '27.6B36': '《說文》：“欶，吮也。从欠，束聲。”', '27.9802': '《說文》：“頂，顛也。从頁，丁聲。𩒆，或从作。𩕢，籀文从鼎。”', '27.E780': '《說文》：“脜，面和也。从𦣻，从肉。讀若柔。”', '27.5F6B': '《說文》：“彫，琢文也。从彡，周聲。”', '27.E78A': '《說文》：“𩇕，清飾也。从彡，青聲。”', '27.F0C1': '《說文》：“㣎，細文也。从彡，𡭴省聲。”', '27.5F69': '《說文新附》：“彩，文章也。从彡，采聲。”', '27.8274': '《說文》：“艴，色艴如也。从色，弗聲。《論語》曰：‘色艴如也。’”', '27.5310': '《說文》：“匐，伏地也。从勹，畐聲。”', '27.F037': '《說文》：“𠣾，重也。从勹，復聲。𠣴，或省彳。”', '27.530F': '《說文》：“匏，瓠也。从包，从夸聲。包，取其可包藏物也。”', '27.E7C3': '《說文》：“𦍶，相訹呼也。从厶，从羑。誘，或从言、秀。䛻或如此。羑，古文。”', '27.5D0B': '《說文》：“崋，山，在弘農華陰。从山，華省聲。”', '27.5D1E': '《說文》：“醇，山，在鴈門。从山，𩫏聲。”', '27.5D1F': '《說文》：“崟，山之岑崟也。从山，金聲。”', '27.5D12': '《說文》：“崒，崒危高也。从山，卒聲。”', '27.5BC6': '《說文》：“密，山如堂者。从山，宓聲。”', '27.5D1B': '《說文》：“崛，山短高也。从山，屈聲。”', '27.5D1D': '《說文》：“崝，嶸也。从山，青聲。”', '27.5D29': '《說文》：“𡹔，山壞也。”', '27.E7D4': '《說文》：“𡸤，山𡺲也。从，戕聲。”', '27.5D07': '《說文》：“崇，嵬高也。从山，宗聲。”', '27.5D14': '《說文》：“崔，大高也。从山，隹聲。”', '27.5D11': '《說文新附》：“崑，崑崙，山名。从山，昆聲。”', '27.5D19': '《說文新附》：“崙，崑崙也。从山，侖聲。”', '27.5D16': '《說文》：“崖，高邊也。从屵，圭聲。”', '27.5EBE': '《說文》：“庾，水槽倉也。从广，臾聲。一曰倉無屋者。”', '27.E7DD': '《說文》：“㢋，廣也。从广，侈聲。”', '27.E7DE': '《說文》：“㢉，開張屋也。从广，秅聲。濟隂有㢉縣。”', '27.5EB3': '《說文》：“庳，中伏舍。从广，卑聲。一曰屋庳。”', '27.5EB6': '《說文》：“庶，屋下眾也。从广、炗。炗，古文光字。”', '27.E7E0': '《說文》：“㢈，屋从上傾下也。从广，隹聲。”', '27.5EB1': '《說文新附》：“庱，地名。从广，未詳。”', '27.539C': '《說文》：“厜，厜㕒，山顛也。从厂，垂聲。”', '27.E7F8': '《說文》：“䂬，水邊石。从石，巩聲。《春秋傳》曰：‘闕䂬之甲。’”', '27.7848': '《說文》：“硈，石堅也。从石，吉聲。一曰突也。”', '27.8C5D': '《說文》：“豝，牝豕也。从豕，巴聲。一曰一歲能相把拏也。《詩》曰：‘一發五豝。’”', '27.8C5C': '《說文》：“豣，三歲豕，肩相及者。从豕，幵聲。《詩》曰：‘並驅兩豣兮。’”', '27.E809': '《說文》：“豛，上谷名豬豭。从豕，役省聲。”', '27.F0D3': '《說文》：“𧱏，豕怒毛豎也。一曰殘艾也。从豕、辛。”', '27.E813': '《說文》：“𧰲，豕也。从彑、从豕。讀若馳。”', '27.EDAA': '《說文》：“，小豕也。从彖省，象形。从又持肉，以給祠祀。豚，篆文从肉、豕。”', '27.8C94': '《說文》：“貔，豹屬，出貉國。从豸，𣬉聲。《詩》曰：‘獻其貔皮’，《周書》曰：‘如虎如貔’。貔，猛獸。豼，或从比。”', '27.F0B7': '《說文》：“𩡧，馬一歲也。从馬、一，絆其足。讀若弦，一曰若環。”', '27.9E7F': '《說文》：“鹿，獸也。象頭角四足之形。鳥、鹿足相似，从匕。”', '27.E84F': '《說文》：“婏，兔子也。婏疾也。从女、兔。”', '27.7308': '《說文》：“猈，短脛狗。从犬，卑聲。”', '27.7317': '《說文》：“猗，犗犬也。从犬，奇聲。”', '27.731D': '《說文》：“猝，犬从艸暴出逐人也。从犬，卒聲。”', '27.E859': '《說文》：“㹽，齧也。从犬，戔聲。”', '27.E85B': '《說文》：“𤞛，妄彊犬也。从犬，从壯，壯亦聲。”', '27.731C': '《說文》：“猜，恨賊也。从犬，青聲。”', '27.731B': '《說文》：“猛，健犬也。从犬，孟聲。”', '27.500F': '《說文》：“倏，走也。从犬，攸聲。”', '27.E860': '《說文》：“𤟍，犬張耳皃。从犬，易聲。”', '27.E878': '《說文》：“𤈦，火也。从火，尾聲。《詩》曰：‘王室如𤈦。’”', '27.710C': '《說文》：“焌，然火也。从火，夋聲。”', '27.70F0': '《說文》：“烰，烝也。从火，孚聲。”', '27.E87F': '《說文》：“𤈩，束炭也。从火，差省聲。”', '27.7968': '《說文》：“𤐫，火飛也。从火、。與𠨧同意。”', '27.7106': '《說文》：“焆，焆焆，煙皃。从火，肙聲。”', '27.E891': '《說文》：“𤈥，望火皃。从火，皂聲。”', '27.E897': '《說文》：“焅，旱气也。从火，告聲。”', '27.70FD': '《說文》：“㷭，燧，候表也。邊有警則舉火。从火，逢聲。”', '27.F555': '《說文》：“悤，多遽悤悤也。从心、囪，囪亦聲。”', '27.8D67': '《說文》：“赧，面慙赤也。从赤，𠬝聲。周失天下於赧王。”', '27.57F7': '《說文》：“執，捕罪人也。从丮，从㚔，㚔亦聲。”', '27.5709': '《說文》：“圉，囹圄，所以拘罪人。从㚔，从囗。一曰：圉，垂也。一曰：圉人，掌馬者。”', '27.E8C9': '《說文》：“𡕧，直項莽𡕧皃。从亢、从夋。夋，倨也。亢亦聲。”', '27.F085': '《說文》：“𠦪，疾也。从𠦍，卉聲。拜从此。”', '27.898F': '《說文》：“規，有法度也。从夫，从見。”', '27.60C5': '《說文》：“情，人之陰氣有欲者。从心，青聲。”', '27.60C7': '《說文》：“惇，厚也。从心，享聲。”', '27.60B0': '《說文》：“悰，樂也。从心，宗聲。”', '27.60DF': '《說文》：“惟，凡思也。从心，隹聲。”', '27.60C0': '《說文》：“惀，欲知之皃。从心，侖聲。”', '27.F084': '《說文》：“𢡃，滿也。从心，𠶷聲。一曰十萬曰𢡃。悥，籀文省。”', '27.E8F6': '《說文》：“㥆，肆也。从心，隶聲。”', '27.6086': '《說文》：“悆，忘也，嘾也。从心，余聲。《周書》曰：‘有疾不悆。’ 悆，喜也。”', '27.E903': '《說文》：“㥒，姦也。从心，采聲。”', '27.E909': '《說文》：“㤮，誤也。从心，狂聲。”', '27.60B8': '《說文》：“悸，心動也。从心，季聲。”', '27.60CF': '《說文》：“惏，河內之北謂貪曰惏。从心，林聲。”', '27.60DB': '《說文》：“惛，不憭也。从心，昬聲。”', '27.60C6': '《說文》：“惆，失意也。从心，周聲。”', '27.60B5': '《說文》：“悵，望恨也。从心，長聲。”', '27.60BD': '《說文》：“悽，痛也。从心，妻聲。”', '27.60DC': '《說文》：“惜，痛也。从心，昔聲。”', '27.60D4': '《說文》：“惔，憂也。从心，炎聲。《詩》曰：‘憂心如惔。’”', '27.60D9': '《說文》：“惙，憂也。从心，叕聲。《詩》曰：‘憂心惙惙。’一曰意不定也。”', '27.E920': '《說文》：“惂，憂困也。从心，臽聲。”', '27.60A0': '《說文》：“悠，憂也。从心，攸聲。”', '27.60B4': '《說文》：“悴，憂也。从心，卒聲。讀與《易》萃卦同。”', '27.60A3': '《說文》：“患，憂也。从心，上貫吅，吅亦聲。𨴮，古文从關省。𢤒，亦古文患。”', '27.E925': '《說文》：“㤲，思皃。从心，夾聲。”', '27.60BC': '《說文》：“悼，懼也。陳楚謂懼曰悼。从心，卓聲。”', '27.60D5': '《說文》：“惕，敬也。从心，易聲。悐，或从狄。”', '27.E92D': '《說文》：“㥏，青徐謂慙曰㥏。从心，典聲。”', '27.60B1': '《說文新附》：“悱，口悱悱也。从心，非聲。”', '27.6DB7': '《說文》：“涷，水。出發鳩山，入於河。从水，東聲。”', '27.6DAA': '《說文》：“涪，水。出廣漢剛邑道徼外，南入漢。从水，咅聲。”', '27.6DF9': '《說文》：“淹，水。出越巂徼外，東入若水。从水，奄聲。”', '27.6DC7': '《說文》：“淇，水。出河內共北山，東入河；或曰出隆慮西山。从水，其聲。”', '27.6DF1': '《說文》：“深，水。出桂陽南平，西入營道。从水，罙聲。”', '27.6DEE': '《說文》：“淮，水。出南陽平氏桐柏大復山，東南入海。从水，隹聲。”', '27.6DE0': '《說文》：“淠，水。出汝南弋陽垂山，東入淮。从水，畀聲。”', '27.6DE9': '《說文》：“淩，水。在臨淮。从水，夌聲。”', '27.6DE8': '《說文》：“淨，魯北城門池也。从水，爭聲。”', '27.6E1A': '《說文》：“渚，水。在常山中丘逢山，東入湡。从水，者聲。《爾雅》曰：‘小洲曰渚。’”', '27.6DF6': '《說文》：“淶，水。起北地廣昌，東入河。从水，來聲。并州浸。”', '27.6DBB': '《說文》：“涻，水。出北嚻山，入邙澤。从水，舍聲。”', '27.6DD4': '《說文》：“淔，水也。从水，直聲。”', '27.E93A': '《說文》：“淁，水也。从水，妾聲。”', '27.6DBA': '《說文》：“涺，水也。从水，居聲。”', '27.6DC9': '《說文》：“淉，水也。从水，果聲。”', '27.E93D': '《說文》：“㳶，水也。从水，乳聲。”', '27.EE03': '《說文》：“𣶃，水朝宗于海。从水，朝省。”', '27.6DF7': '《說文》：“混，豐流也。从水，昆聲。”', '27.6DF2': '《說文》：“淲，水流皃。从水，彪省聲。《詩》曰：‘淲沱北流。’”', '27.6DE2': '《說文》：“淢，疾流也。从水，或聲。”', '27.6EC2': '《說文》：“滂，沛也。从水，㫄聲。”', '27.6DEA': '《說文》：“淪，小波為淪。从水，侖聲。《詩》曰：‘河水清且淪漪。’一曰沒也。”', '27.6DD9': '《說文》：“淙，水聲也。从水，宗聲。”', '27.6DB3': '《說文》：“涳，直流也。从水，空聲。”', '27.6DD1': '《說文》：“淑，清湛也。从水，叔聲。”', '27.6E05': '《說文》：“清，朖也，澂水之皃。从水，青聲。”', '27.6DC8': '《說文》：“淈，濁也。从水，屈聲。一曰滒泥。一曰水出皃。”', '27.6DEB': '《說文》：“淫，侵淫隨理也。从水，㸒聲。一曰久雨為淫。”', '27.6DFA': '《說文》：“淺，不深也。从水，戔聲。”', '27.6DD6': '《說文》：“淖，泥也。从水，卓聲。”', '27.E94A': '《說文》：“㳷，青黑色。从水，曶聲。”', '27.E952': '《說文》：“㳻，所以𢹬水也。从水，昔聲。《漢律》曰：‘及其門首洒㳻。’”', '27.6DDC': '《說文》：“淜，無舟渡河也。从水，朋聲。”', '27.6DD2': '《說文》：“淒，雲雨起也。从水，妻聲。《詩》曰：‘有渰淒淒。’”', '27.6DCA': '《說文》：“淊，泥水淊淊也。一曰繅絲湯也。从水，臽聲。”', '27.6DB5': '《說文》：“𣹢，水澤多也，从水圅聲。《詩》曰：‘僭始既𣹢。’”', '27.6DB8': '《說文》：“涸，渴也。从水，固聲。讀若狐貈之貈。𤃯，涸亦从水、鹵、舟。”', '27.6DAB': '《說文》：“涫，𩰾也。从水，官聲。酒泉有樂涫縣。”', '27.6DBE': '《說文》：“涾，涫溢也。今河朔方言謂沸溢為涾。从水，沓聲。”', '27.6DC5': '《說文》：“淅，汏米也。从水，析聲。”', '27.6F09': '《說文》：“漉，浚也。从水，鹿聲。渌，漉或从录。”', '27.6DE4': '《說文》：“淤，澱滓濁泥。从水，於聲。”', '27.6DF0': '《說文》：“淰，濁也。从水，念聲。”', '27.6DBC': '《說文》：“涼，薄也。从水，京聲。”', '27.6DE1': '《說文》：“淡，薄味也。从水，炎聲。”', '27.6DB2': '《說文》：“液，𧗁也。从水，夜聲。”', '27.6DEC': '《說文》：“淬，滅火器也。从水，卒聲。”', '27.6DF3': '《說文》：“𤂸，渌也。从水，𦎧聲。”', '27.6DCB': '《說文》：“淋，以水𣵽也。从水，林聲。一曰淋淋，山下水皃。”', '27.6DAF': '《說文新附》：“涯，水邊也。从水，从厓，厓亦聲。”', '27.F093': '《說文》：“𡿿，水流也。从川，或聲。”', '27.7F95': '《說文》：“羕，水長也。从永，羊聲。《詩》曰：‘江之羕矣。’”', '27.8C39': '《說文》：“𧮯，谷中響也。从谷，厷聲。”', '27.F656': '《說文》：“屚，屋穿水下也。从雨在尸下，尸者，屋也。”', '27.9B5A': '《說文》：“魚，水蟲也。象形。魚尾與燕尾相似。”', '27.E9D3': '《說文》：“䨽，別也。从非，己聲。”', '27.9E75': '《說文》：“鹵，西方鹹地也。从西省，象鹽形。安定有鹵縣，東方謂之㡿，西方謂之鹵。”', '27.9588': '《說文》：“閈，門也。从門，干聲。汝南平輿里門曰閈。”', '27.9589': '《說文》：“閉，闔門也。从門，才所以距門也。”', '27.E9EA': '《說文》：“𦕒，小垂耳也。从耳，占聲。”', '27.804A': '《說文》：“聊，耳鳴也。从耳，卯聲。”', '27.8046': '《說文》：“聆，聽也。从耳，令聲。”', '27.E9F0': '《說文》：“聉，無知意也。从耳，出聲。讀若孽。”', '27.E9F2': '《說文》：“聅，軍法以矢貫耳也。从耳，从矢。司馬法曰：‘小罪聅，中罪刖，大罪剄。’”', '27.E9FB': '《說文》：“捾，搯捾也。从手，官聲。一曰援也。”', '27.63A8': '《說文》：“推，排也。从手，隹聲。”', '27.6392': '《說文》：“排，擠也。从手，非聲。”', '27.E9FF': '《說文》：“捦，急持衣䘳也。从手，金聲。㩒，捦或从禁。”', '27.636B': '《說文》：“捫，撫持也。从手，門聲。《詩》曰：‘莫捫朕舌。’”', '27.6368': '《說文》：“捨，釋也。从手，舍聲。”', '27.63A7': '《說文》：“控，引也。从手，空聲。《詩》曰：‘控于大邦。’匈奴名引弓控弦。”', '27.638A': '《說文》：“掊，把也。今鹽官入水取鹽為掊。从手，咅聲。”', '27.63AA': '《說文》：“措，置也。从手，昔聲。”', '27.6384': '《說文》：“掄，擇也。从手，侖聲。”', '27.633B': '《說文》：“挻，長也。从手，从延，延亦聲。”', '27.637D': '《說文》：“捽，持頭髮也。从手，卒聲。”', '27.6388': '《說文》：“授，予也。从手，从受，受亦聲。”', '27.63A5': '《說文》：“接，交也。从手，妾聲。”', '27.EA0D': '《說文》：“捪，撫也。从手，昏聲。一曰：摹也。”', '27.636E': '《說文》：“据，𢧢挶也。从手，居聲。”', '27.6389': '《說文》：“掉，搖也。从手，卓聲。《春秋傳》曰：‘尾大不掉。’”', '27.6380': '《說文》：“掀，舉出也。从手，欣聲。《春秋傳》曰‘掀公出於淖。’”', '27.6387': '《說文》：“掇，拾取也。从手，叕聲。”', '27.63A2': '《說文》：“𢲘，遠取之也。从手，𥥍聲。”', '27.637C': '《說文》：“捼，推也。从手，委聲。一曰兩手相切摩也。”', '27.638E': '《說文》：“掎，偏引也。从手，奇聲。”', '27.EA21': '《說文》：“㧺，縫指㧺也。一曰韜也。从手，沓聲。讀若眔。”', '27.6398': '《說文》：“𢶵，搰也。从手，屈聲。”', '27.63A9': '《說文》：“掩，斂也，小上曰掩。从手，奄聲。”', '27.EA26': '《說文》：“掕，止馬也。从手，夌聲。”', '27.6372': '《說文》：“捲，气勢也。从手，卷聲。《國語》曰：‘有捲勇。’一曰捲收也。”', '27.636D': '《說文》：“捭，兩手擊也。从手，卑聲。”', '27.6412': '《說文》：“搒，掩也。从手，旁聲。”', '27.63AB': '《說文》：“掫，夜戒守有所擊。从手，取聲。《春秋傳》曰：‘賓將掫。’”', '27.63A4': '《說文》：“掤，所以覆矢也。从手，朋聲。《詩》曰：‘抑釋掤忌。’”', '27.6377': '《說文》：“捷，獵也，軍獲得也。从手，疌聲。《春秋傳》曰：‘齊人來獻戎捷。’”', '27.638D': '《說文》：“掍，同也。从手，昆聲。”', '27.6396': '《說文》：“掖，以手持人臂投地也。从手，夜聲。一曰臂下也。”', '27.63A0': '《說文新附》：“掠，奪取也。从手，京聲。”', '27.6390': '《說文新附》：“掐，爪刺也。从手，臽聲。”', '27.637B': '《說文新附》：“捻，指捻也。从手，念聲。”', '27.F485': '《說文》：“𠦬，背吕也。象脅肋也。”', '27.5A38': '《說文》：“娸，人姓也。从女，其聲。杜林說：娸，醜也。”', '27.5A36': '《說文》：“娶，取婦也。从女，从取，取亦聲。”', '27.5A5A': '《說文》：“婚，婦家也。禮，娶婦以昏時。婦人陰也，故曰婚。从女，从昏，昏亦聲。𡕽，籀文婚。”', '27.5A66': '《說文》：“婦，服也。从女持帚，灑掃也。”', '27.5A57': '《說文》：“婗，嫛婗也。从女，兒聲。一曰婦人惡皃。”', '27.5A62': '《說文》：“婢，女之卑者也。从女，从卑，卑亦聲。”', '27.5A55': '《說文》：“婕，女字也。从女，疌聲。”', '27.5A64': '《說文》：“婤，女字也。从女，周聲。”', '27.5A60': '《說文》：“婠，體德好也。从女，官聲。讀若楚郤宛。”', '27.5A49': '《說文》：“婉，順也。从女，宛聲。《春秋傳》曰：‘太子痤婉’。”', '27.5A50': '《說文》：“婐，㛂也。一曰女侍曰婐。讀若騧或若委。从女，果聲。孟軻曰：‘舜為天子，二女婐。’”', '27.EA4C': '《說文》：“𡝫，妗也。从女，沾聲。”', '27.5A67': '《說文》：“婧，竦立也。从女，青聲。一曰有才也。讀若韭菁。”', '27.5A5C': '《說文》：“婜，美也。从女，臤聲。”', '27.EA57': '《說文》：“㛥，俛伏也。从女，沓聲。一曰伏意。”', '27.EA5B': '《說文》：“娽，隨從也。从女，彔聲。”', '27.5A5F': '《說文》：“婟，嫪也。从女，固聲。”', '27.5A5E': '《說文》：“婞，很也。从女，幸聲。《楚詞》曰：‘鯀婞直。’”', '27.EA65': '《說文》：“娺，疾悍也。从女，叕聲。讀若唾。”', '27.EA67': '《說文》：“娿，媕娿也。从女，阿聲。”', '27.EA6F': '《說文》：“婎，姿婎，姿也。从女，隹聲。一曰醜也。”', '27.5A39': '《說文》：“娹，有守也。从女，弦聲。”', '27.5A6A': '《說文》：“婪，貪也。从女，林聲。杜林說：卜者黨相詐驗為婪。讀若潭。”', '27.5A53': '《說文》：“婓，往來婓婓也。一曰醜皃。从女，非聲。”', '27.EA7B': '《說文》：“㛪，誣挐也。从女，奄聲。”', '27.5A6C': '《說文》：“婬，私逸也。从女，㸒聲。”', '27.5A65': '《說文》：“婥，女病也。从女，卓聲。”', '27.EA84': '《說文》：“𢧀，盾也。从戈，旱聲。”', '27.621B': '《說文》：“戛，戟也。从戈，从𦣻。讀若棘。”', '27.F08F': '《說文》：“戜，利也。一曰剔也。从戈，呈聲。”', '27.621A': '《說文》：“戚，戉也。从戉，尗聲。”', '27.7FA9': '《說文》：“義，己之威儀也。从我羊。羛，《墨翟書》義从弗。魏郡有羛陽鄉，讀若錡。今屬鄴，本內黃北二十里。”', '27.745F': '《說文》：“瑟，庖犧所作弦樂也。从珡，必聲。”', '27.671B': '《說文》：“望，出亡在外，望其還也。从亡，朢省聲。”', '27.5340': '《說文》：“區，踦區，藏匿也。从品在匸中。品，眾也。”', '27.533F': '《說文》：“匿，亡也。从匸，若聲，讀如羊騶箠。”', '27.EA90': '《說文》：“匬，甌，器也。从匚，俞聲。”', '27.F05C': '《說文》：“㻃，骫曲也。从曲，玉聲。”', '27.F087': '《說文》：“𧆣（𧇄），𦉈也。从甾，虍聲。讀若盧，同。𤴅，篆文𧇄；罏，籀文𧇄。”', '27.74F7': '《說文新附》：“瓷，瓦器。从瓦，次聲。”', '27.EAA2': '《說文》：“𢐻，畫弓也。从弓，𦎧聲。”', '27.5F35': '《說文》：“張，施弓弦也。从弓，長聲。”', '27.5F38': '《說文》：“弸，弓彊皃。从弓，朋聲。”', '27.EAB8': '《說文》：“𥿄，絲滓也。从糸，氐聲。”', '27.7D71': '《說文》：“統，紀也。从糸，充聲。”', '27.7D3F': '《說文》：“紿，絲勞即紿。从糸，台聲。”', '27.7D39': '《說文》：“紹，繼也。从糸，召聲。一曰紹緊糾也。綤，古文紹从邵。”', '27.7D30': '《說文》：“細，微也。从糸，囟聲。”', '27.7D3E': '《說文》：“紾，轉也。从糸，㐱聲。”', '27.7D45': '《說文》：“絅，急引也。从糸，冋聲。”', '27.7D42': '《說文》：“終，絿絲也。从糸，冬聲。𡦿，古文終。”', '27.7D2C': '《說文》：“紬，大絲繒也。从糸，由聲。”', '27.7D40': '《說文》：“絀，絳也。从糸，出聲。”', '27.7D3A': '《說文》：“紺，帛深青揚赤色。从糸，甘聲。”', '27.7D3B': '《說文》：“紻，纓卷也。从糸，央聲。”', '27.7D33': '《說文》：“紳，大帶也。从糸，申聲。”', '27.7D44': '《說文》：“組，綬屬。其小者，以為冕纓。从糸，且聲。”', '27.EAD4': '《說文》：“紴，絛屬。从糸，皮聲。讀若被，或讀若水波之波。”', '27.EAD5': '《說文》：“䋐，采彰也。一曰車馬飾。从糸，戉聲。”', '27.EAD9': '《說文》：“䋉，縷一枚也。从糸，穴聲。”', '27.7D29': '《說文》：“紩，縫也。从糸，失聲。”', '27.EADB': '《說文》：“䋎，補縫也。从糸，旦聲。”', '27.7D47': '《說文》：“絇，纑繩絇也。从糸，句聲。讀若鳩。”', '27.EAE1': '《說文》：“䋊，乘輿馬飾也。从糸，正聲。”', '27.7E41': '《說文》：“䋣，馬髦飾也。从糸，每聲。《春秋傳》曰：‘可以稱旌䋣乎。’䋣或从𢍍。𢍍，籀文弁。”', '27.7D46': '《說文》：“絆，馬縶也。从糸，半聲。”', '27.7D32': '《說文》：“紲，系也。从糸，世聲。《春秋傳》曰：‘臣負羈紲。’緤，紲或从枼。”', '27.EAEE': '《說文》：“䋈，絜縕也，一曰敝絮。从糸，奴聲。《易》曰：‘需有衣䋈。’”', '27.7D28': '《說文》：“紨，布也。一曰粗紬。从糸，付聲。”', '27.7D35': '《說文》：“紵，檾屬，細者為絟，粗者為紵。从糸，宁聲。𦂂，紵或从緒省。”', '27.7D3C': '《說文》：“紼，亂糸也。从糸，弗聲。”', '27.7387': '《說文》：“率，捕鳥畢也。象絲罔。上下其竿柄也。”', '27.86C1': '《說文》：“蛁，蟲也。从虫，召聲。”', '27.EB04': '《說文》：“䖦，蛣䖦也。从虫，出聲。”', '27.5F37': '《說文》：“強，蚚也。从虫，弘聲。𧖑，籀文強，从䖵从彊。”', '27.86C4': '《說文》：“蛄，螻蛄也。从虫，古聲。”', '27.86B3': '《說文》：“蚳，螘子也。从虫，氐聲。《周禮》有蚳醢，讀若祁。𧐏，籀文蚳从䖵。𧏁，古文蚳从辰土。”', '27.86C5': '《說文》：“蛅，蛅斯，墨也。从虫，占聲。”', '27.86C9': '《說文》：“蛉，蜻蛉也。从虫，令聲。一名桑桹。”', '27.86BC': '《說文》：“蚼，北方有蚼犬食人。从虫，句聲。”', '27.57F4': '《說文》：“埴，黏土也。从土，直聲。”', '27.57FA': '《說文》：“基，牆始也。从土，其聲。”', '27.5835': '《說文》：“堵，垣也。五版為一堵。从土，者聲。𩫭，籀文从𩫏。”', '27.5800': '《說文》：“堀，突也。《詩》曰：‘蜉蝣堀閱。’从土，屈省聲。”', '27.580A': '《說文》：“堊，白涂也。从土，亞聲。”', '27.57FD': '《說文》：“埽，棄也。从土，从帚。”', '27.57FB': '《說文》：“𡓑（埻），射臬也。讀若準。”', '27.57E4': '《說文》：“埤，增也。从土，卑聲。”', '27.57F1': '《說文》：“埱，气出土也。一曰始也。从土，叔聲。”', '27.EB6A': '《說文》：“埾，土積也。从土，从聚省。”', '27.57F9': '《說文》：“培，培墩，土田山川也。从土，咅聲。”', '27.57E9': '《說文》：“埩，治也。从土，爭聲。”', '27.EEE7': '《說文》：“𡌦，塵也。从土，非聲。”', '27.580B': '《說文》：“堋，喪葬下土也。从土，朋聲。《春秋傳》曰：‘朝而堋。’《禮》謂之封，《周官》謂之窆。《虞書》曰：‘堋淫于家。’”', '27.57CF': '《說文新附》：“埏，八方之地也。从土，延聲。”', '27.57F8': '《說文新附》：“埸，疆也。从土，易聲。”', '27.91CE': '《說文》：“野，郊外也。从里，予聲。𡐨，古文野，从里省，从林。”', '27.7566': '《說文》：“畦，田五十𤱑曰畦。从田，圭聲。”', '27.7564': '《說文》：“畤，天地五帝所基址祭地。从田，寺聲。右扶風有五畤。好畤鄜畤皆黃帝時祭。或曰秦文公立也。”', '27.7565': '《說文》：“略，經略土地也。从田，各聲。”', '27.9EC3': '《說文》：“黃，地之色也。从田，从炗，炗亦聲。炗，古文光。𡕛，古文黃。”', '27.52D9': '《說文》：“務，趣也。从力，敄聲。”', '27.52D6': '《說文》：“勖，勉也。《周書》曰：‘勖哉夫子！’从力，冒聲。”', '27.52D5': '《說文》：“動，作也。从力，重聲。𨔝，古文動从辵。”', '27.52D8': '《說文新附》：“勘，校也。从力，甚聲。”', '27.EBA9': '《說文》：“𨪐，酒器也。从金，𠁁象器形。𠁁，𨪐或省金。”', '27.91E6': '《說文》：“釦，金飾器口。从金，从口，口亦聲。”', '27.91F1': '《說文》：“釱，鐵鉗也。从金，大聲。”', '27.91EC': '《說文》：“釬，臂鎧也。从金，干聲。”', '27.91ED': '《說文》：“釭，車轂中鐵也。从金，工聲。”', '27.91F3': '《說文》：“釳，乘輿馬頭上防釳，插以翟尾鐵翮，象角，所以防網羅釳去之。从金，气聲。”', '27.91E3': '《說文》：“釣，鉤魚也。从金，勺聲。”', '27.91E7': '《說文新附》：“釧，臂環也。从金，川聲。”', '27.91F5': '《說文新附》：“釵，笄屬。从金，叉聲。”', '27.EBC9': '《說文》：“𣂞，柯擊也。从斤，良聲。”', '27.659B': '《說文》：“斛，十斗也。从斗，角聲。”', '27.659C': '《說文》：“斜，杼也。从斗，余聲。”', '27.8ED8': '《說文》：“軘，兵車也。从車，屯聲。”', '27.EBD8': '《說文》：“䡈，車騎上曲銅也。从車，爻聲。”', '27.EBD9': '《說文》：“䡊，車耳反出也。从車，从反，反亦聲。”', '27.8EDD': '《說文》：“軝，長轂之軝也。以朱約之。从車，氏聲。《詩》曰：‘約軝錯衡。’軝，或从革。”', '27.EBE4': '《說文》：“䡇，車轅耑持衡者。从車，元聲。”', '27.8EDC': '《說文》：“軜，驂馬內轡繫軾前者。从車，內聲。《詩》曰：‘𣵽以觼軜’。”', '27.EBF5': '《說文》：“軖，紡車也。一曰一輪車。从車，𡉚聲。讀若狂。”', '27.65AC': '《說文》：“斬，𢧵也。从車，从斤。斬法車裂也。”', '27.9675': '《說文》：“陵，大𨸏也。从𨸏，夌聲。”', '27.9670': '《說文》：“陰，闇也。水之南，山之北也。从𨸏，侌聲。”', '27.9678': '《說文》：“陸，高平地。从𨸏，从坴，坴亦聲。𨽰，籀文陸。”', '27.966C': '《說文》：“陬，阪隅也。从𨸏，取聲。”', '27.EBF9': '《說文》：“陮，陮隗，高也。从𨸏，隹聲。”', '27.9677': '《說文》：“陷，高下也。一曰陊也。从𨸏，从臽，臽亦聲。”', '27.EC06': '《說文》：“𨹵，河東安邑陬也。从𨸏，卷聲。”', '27.966D': '《說文》：“陭，上黨陭氏阪也。从𨸏，奇聲。”', '27.E077': '《說文》：“陚，丘名。从𨸏，武聲。”', '27.967C': '《說文》：“陼，如渚者。陼丘，水中高者也。从𨸏，者聲。”', '27.9676': '《說文》：“陶，再成丘也。在濟陰。从𨸏，匋聲。《夏書》曰：‘東至于陶丘。’陶丘有堯城，堯嘗所居，故堯號陶唐氏。”', '27.EC0D': '《說文》：“𨹸，耕以臿浚出下壚土也。一曰耕休田也。从𨸏，召聲。”', '27.966A': '《說文》：“陪，重土也。一曰滿也。从𨸏，咅聲。”', '27.9674': '《說文》：“陴，城上女牆俾倪也。从𨸏，卑聲。𩫫，籀文陴从𩫖。”', '27.966F': '《說文》：“陯，山𨸏陷也。从𨸏，侖聲。”', '27.EC12': '《說文》：“䧖，𨸏也。从𨸏，戔聲。”', '27.9997': '《說文》：“馗，九達道也。似龜背，故謂之馗。馗，高也。从九从首。逵，馗或从辵从坴。”', '27.79BB': '《說文》：“离，山神獸也。从禽頭，从厹，从屮。歐陽喬說：‘离，猛獸也。’”', '27.EDF5': '《說文》：“禼，蟲也。从厹，象形，讀與偰同。”', '27.4E7E': '《說文》：“乾，上出也。从乙。乙，物之達也。倝聲。𠄃，籀文乾。”', '27.EC1F': '《說文》：“㠱，長踞也。从己，其聲。讀若杞。”', '27.8F9C': '《說文》：“辜，辠也。从辛，古聲。𡲞，古文辜从死。”', '27.758F': '《說文》：“疏，通也。从㐬，从疋，疋亦聲。”', '27.7F9E': '《說文》：“羞，進獻也。从羊，羊所進也；从丑，丑亦聲。”', '27.5BC5': '《說文》：“寅，髕也，正月陽氣動，去黄泉欲上出，陰尚強，象宀不達，髕寅於下也。”', '27.554E': '《說文》：“啎，逆也。从午，吾聲。”', '27.EC36': '《說文》：“䣪，酒色也。从酉，巿聲。”', '27.EC3A': '《說文》：“𨟴，少少㱃也。从酉，勻聲。”', '27.9156': '《說文》：“酖，樂酒也。从酉，冘聲。”', '27.83A4': '《說文》：“莤，禮祭，束茅加于祼圭而灌鬯酒，是為莤，象神歆之也。一曰：莤，榼上塞也。从酉，从艸。《春秋傳》曰：‘尔貢包茅不入，王祭不供，無以莤酒。’”', '27.91AC': '《說文》：“𤖕，盬也。从肉，从酉。酒以和𤖕也。爿聲。𨟻，古文。𤖙，籀文。”', '27.7970': '《說文》：“祰，告祭也。从示，从告聲。”', '27.7973': '《說文》：“祳，社肉，盛以蜃，故謂之祳。天子所以親遺同姓。从示，辰聲。《春秋傳》曰：‘石尚來歸祳。’”', '27.7974': '《說文》：“祴，宗廟奏祴樂。从示，戒聲。”', '27.7972': '《說文》：“祲，精氣感祥。从示，㑴省聲。《春秋傳》曰：‘見赤黑之𥛆。’”', '27.958F': '《說文》：“閏，餘分之月，五歲再閏。告朔之禮，天子居宗廟，閏月居門中。从王在門中。《周禮》曰：‘閏月王居門中，終月也。’”', '27.7420': '《說文》：“琠，玉也。从玉，典聲。”', '27.7433': '《說文》：“琳，美玉也。从玉，林聲。”', '27.742E': '《說文》：“琮，瑞玉。大八寸，似車釭。从玉，宗聲。”', '27.7425': '《說文》：“琥，發兵瑞玉。為虎文。从玉，从虎，虎亦聲。《春秋傳》曰：‘賜子家雙琥。’”', '27.742C': '《說文》：“琬，圭有琬者。从玉，宛聲。”', '27.7430': '《說文》：“琰，璧上起美色也。从玉，炎聲。”', '27.742B': '《說文》：“琫，佩刀上飾。天子以玉，諸矦以金。从玉，奉聲。”', '27.7422': '《說文》：“琢，治玉也。从玉，豖聲。”', '27.7431': '《說文》：“琱，治玉也。一曰石似玉。从玉，周聲。”', '27.7424': '《說文》：“琤，玉聲也。从玉，爭聲。”', '27.741A': '《說文》：“琚，瓊琚。从玉，居聲。《詩》曰：‘報之以瓊琚。’”', '27.E038': '《說文》：“琟，石之似玉者。从玉，隹聲。讀若維。”', '27.7428': '《說文》：“琨，石之美者。从玉，昆聲。《虞書》曰：‘楊州貢瑤琨。’瑻，琨或从貫。”', '27.7416': '《說文新附》：“琖，玉爵也。夏曰琖，殷曰斝，周曰爵。从玉，戔聲。或从皿。”', '27.741B': '《說文新附》：“琛，寶也。从玉，深省聲。”', '27.7432': '《說文新附》：“琲，珠五百枚也。从玉，非聲。”', '27.7421': '《說文新附》：“琡，玉也。从玉，叔聲。”', '27.E047': '《說文》：“壻，夫也。从土，胥聲。《詩》曰：‘女也不爽，士貳其行。’士者，夫也。讀與細同。婿，壻或从女。”', '27.8410': '《說文》：“萐，萐莆，瑞艸也。堯時生於庖廚，扇暑而涼。从艸，疌聲。”', '27.8401': '《說文》：“萁，豆莖也。从艸，其聲。”', '27.E04D': '《說文》：“蓈，禾粟之采，生而不成者，謂之蕫蓈。从艸，郎聲。稂，蓈或从禾。”', '27.8409': '《說文》：“萉，枲實也。从艸，肥聲。𪎰，萉或从麻、賁。”', '27.E055': '《說文》：“菦，菜，類蒿。从艸，近聲。《周禮》有菦菹。”', '27.83CA': '《說文》：“菊，大菊，蘧麥。从艸，匊聲。”', '27.83C1': '《說文》：“菁，韭華也。从艸，青聲。”', '27.83D4': '《說文》：“菔，蘆菔，似蕪菁，實如小尗者。从艸，服聲。”', '27.8407': '《說文》：“萇，萇楚，跳弋。一曰羊桃。从艸，長聲。”', '27.E064': '《說文》：“䓞，艸也，可以染留黃。从艸，戾聲。”', '27.83E9': '《說文》：“菩，艸也。从艸，咅聲。”', '27.83C5': '《說文》：“菅，茅也。从艸，官聲。”', '27.8411': '《說文》：“雈，艸多皃。从艸，隹聲。”', '27.E06B': '《說文》：“䓢，艸也。从艸，固聲。”', '27.E070': '《說文》：“𦱁，艸也。从艸，弦聲。”', '27.83BF': '《說文》：“莿，茦也。从艸，刺聲。”', '27.83F3': '《說文》：“菳，黃菳也。从艸，金聲。”', '27.E082': '《說文》：“𦵹，雚之初生。一曰薍，一曰鵻。从艸，剡聲。菼，𦵹或从炎。”', '27.83E1': '《說文》：“䓿，䓿𧂄也。从艸，圅聲。”', '27.83E3': '《說文》：“菣，香蒿也。从艸，臤聲。𦸃，菣或从堅。”', '27.83FB': '《說文》：“菻，蒿屬。从艸，林聲。”', '27.83C0': '《說文》：“菀，茈菀，出漢中房陵。从艸，宛聲。”', '27.83CB': '《說文》：“菋，荎藸也。从艸，味聲。”', '27.83E8': '《說文》：“菨，菨餘也。从艸，妾聲。”', '27.83CC': '《說文》：“菌，地蕈也。从艸，囷聲。”', '27.8438': '《說文》：“萸，茱萸也。从艸，臾聲。”', '27.E093': '《說文》：“菭，水衣。从艸，治聲。”', '27.840C': '《說文》：“萌，艸芽也。从艸，明聲。”', '27.840B': '《說文》：“萋，艸盛。从艸，妻聲。《詩》曰：‘菶菶萋萋。’”', '27.83F6': '《說文》：“菶，艸盛。从艸，奉聲。”', '27.8403': '《說文》：“萃，艸皃。从艸，卒聲。讀若瘁。”', '27.E09F': '《說文》：“𦱊，𦱊𦺝皃。从艸，爭聲。”', '27.83F8': '《說文》：“菸，鬱也。从艸，於聲。一曰𣨙也。”', '27.83DC': '《說文》：“菜，艸之可食者。从艸，采聲。”', '27.E0A8': '《說文》：“䓛，刷也。从艸，屈聲。”', '27.83F9': '《說文》：“菹，酢菜也。从艸，沮聲。𦼬，或从皿。𧂚或从缶。”', '27.E0AC': '《說文》：“䓜，菹也。从艸，泜聲。𥁼，䓜或从皿。皿，器也。”', '27.8406': '《說文》：“萆，雨衣，一曰衰衣。从艸，卑聲。一曰萆藨，似烏韭。”', '27.840E': '《說文》：“萎，食牛也。从艸，委聲。”', '27.83F2': '《說文》：“菲，芴也。从艸，非聲。”', '27.840A': '《說文》：“萊，蔓華也。从艸，來聲。”', '27.83C9': '《說文》：“菉，王芻也。从艸，彔聲。《詩》曰：‘菉竹猗猗。’”', '27.83EC': '《說文》：“菬，艸也。从艸，沼聲。”', '27.8404': '《說文》：“萄，艸也。从艸，匋聲。”', '27.83C6': '《說文》：“菆，麻蒸也。从艸，取聲。一曰蓐也。”', '27.E0CB': '《說文》：“艸多皃。从艸，狐聲。江夏平春有𦱄亭。”', '27.83FF': '《說文》：“菿，艸木倒。从艸，到聲。”', '27.833B': '《說文》：“茻，眾艸也。从四屮。讀與冈同。”', '27.66FE': '《說文》：“曾，詞之舒也。从八，从曰，𡆧聲。”', '27.7285': '《說文》：“犅，特牛也。从牛，岡聲。”', '27.E0D5': '《說文》：“㹁，牻牛也。从牛，京聲。《春秋傳》曰：‘牻㹁。’”', '27.7289': '《說文》：“犉，黃牛黑脣也。从牛，𦎧聲。《詩》曰：‘九十其犉。’”', '27.E0DF': '《說文》：“㹃，兩壁耕也。从牛，非聲。一曰覆耕穜也。讀若匪。”', '27.E0E2': '《說文》：“㹂，牛很不從引也。从牛，从臤，臤亦聲。一曰大皃。讀若賢。”', '27.7280': '《說文》：“犀，南徼外牛，一角在鼻，一角在頂，似豕。从牛，㞑聲。”', '27.5599': '《說文》：“喙，口也。从口，彖聲。”', '27.5589': '《說文》：“喉，咽也。从口，侯聲。”', '27.E0E6': '《說文》：“喗，大口也。从口，軍聲。”', '27.557E': '《說文》：“啾，小兒聲也。从口，秋聲。”', '27.55A4': '《說文》：“喤，小兒聲。从口，皇聲。”', '27.5591': '《說文》：“喑，宋齊謂兒泣不止曰喑。从口，音聲。”', '27.553E': '《說文》：“唾，口液也。从口，垂聲。涶，唾或从水。”', '27.E0ED': '《說文》：“涶，河津也，在西河西。从水，𡍮聲。”', '27.5598': '《說文》：“喘，疾息也。从口，耑聲。”', '27.559F': '《說文》：“喟，大息也。从口，胃聲。嘳，喟或从貴。”', '27.E0F6': '《說文》：“喅，音聲喅喅然。从口，昱聲。”', '27.557B': '《說文》：“啻，語時，不啻也。从口，帝聲。一曰：啻，諟也。”', '27.EE06': '《說文》：“𠼡，誰也。从口、𢏚，又聲。𢏚，古文疇。”', '27.E105': '《說文》：“嗞，嗟也。从口，兹聲。”', '27.559D': '《說文》：“喝，㵣也。从口，曷聲。”', '27.5588': '《說文》：“喈，鳥鳴聲。从口，皆聲。一曰鳳皇鳴聲喈喈。”', '27.5594': '《說文》：“喔，雞聲也。从口，屋聲。”', '27.5581': '《說文》：“喁，魚口上見。从口，禺聲。”', '27.55AB': '《說文新附》：“喫，食也。从口，契聲。”', '27.559A': '《說文新附》：“喚，呼也。从口，奐聲。古通用奐。”', '27.55AE': '《說文》：“單，大也。从吅、，吅亦聲。闕。”', '27.558C': '《說文》：“喌，呼雞重言之。从吅，州聲。讀若祝。”', '27.55AA': '《說文》：“喪，亡也。从哭，从亡，會意。亡亦聲。”', '27.8D85': '《說文》：“超，跳也。从走，召聲。”', '27.8D8A': '《說文》：“越，度也。从走，戊聲。”', '27.8D81': '《說文》：“趁，𧾍也。从走，㐱聲。讀若塵。”', '27.8D80': '《說文》：“趀，蒼卒也。从走，𠂔聲。讀若資。”', '27.E12F': '《說文》：“趆，趨也。从走，氐聲。”', '27.8D89': '《說文》：“趉，走也。从走，出聲。讀若無尾之屈。”', '27.8D84': '《說文》：“趄，趑趄也。从走，且聲。”', '27.E141': '《說文》：“䞣，距也。从走，㡿省聲。《漢令》曰：‘䞣張百人。’”', '27.E149': '《說文》：“𣥺，歫也。从止，尚聲。”', '27.E14B': '《說文》：“𣥹，至也。从止，叔聲。”', '27.6B78': '《說文》：“歸，女嫁也。从止，从婦省，𠂤聲。㱕，籀文，省。”', '27.767B': '《說文》：“登，上車也。从癶、豆，象登車形。𤼷，籀文登从収。”', '27.E150': '《說文》：“啙，窳也，闕。”', '27.E151': '《說文》：“㭰，識也。从此，朿聲。一曰藏也。”', '27.97D9': '《說文》：“韙，是也。从是，韋聲。《春秋傳》曰：‘犯五不韙。’愇，籀文韙从心。”', '27.9032': '《說文》：“進，登也。从辵，閵省聲。”', '27.E166': '《說文》：“逪，迹逪也。从辵，昔聲。”', '27.902E': '《說文》：“逮，唐逮，及也。从辵，隶聲。”', '27.E171': '《說文》：“𨓯，行皃。从辵，𣶒聲。”', '27.9036': '《說文》：“逶，逶迆，衺去之皃。从辵，委聲。蟡，或从虫、為。”', '27.902F': '《說文》：“逯，行謹逯逯也。从辵，彔聲。”', '27.902D': '《說文》：“逭，逃也。从辵，官聲。𩁧，逭或从雚，从兆。”', '27.9042': '《說文》：“遂，亡也。从辵，㒸聲。𨓸，古文遂。”', '27.E180': '《說文》：“𨓲，過也。从辵，侃聲。”', '27.9034': '《說文》：“逴，遠也。从辵，卓聲。一曰蹇也。讀若棹苕之棹。”', '27.5FA9': '《說文》：“復，往來也。从彳，复聲。”', '27.E18C': '《說文》：“𢔟，復也。从彳，从柔，柔亦聲。”', '27.5FAA': '《說文》：“循，行順也。从彳，盾聲。”', '27.5FA5': '《說文》：“徥，徥徥，行皃。从彳，是聲。《爾雅》曰：‘徥，則也。’”', '27.E196': '《說文》：“徧，帀也。从彳，扁聲。”', '27.5FA6': '《說文》：“徦，至也。从彳，叚聲。”', '27.E19B': '《說文》：“㣫，相迹也。从彳，重聲。”', '27.8857': '《說文》：“街，四通道也。从行，圭聲。”', '27.8855': '《說文》：“衕，通街也。从行，同聲。”', '27.E1B9': '《說文》：“𤘌，武牙也。从牙，从奇，奇亦聲。”', '27.8DD6': '《說文》：“跖，足下也。从足，石聲。”', '27.E1BE': '《說文》：“䟠，輕也。从足，戉聲。”', '27.E1C4': '《說文》：“𧿳，跳也。从足，弗聲。”', '27.8DC7': '《說文》：“跇，述也。从足，世聲。”', '27.8DCB': '《說文》：“跋，蹎跋也。从足，犮聲。”', '27.8DCC': '《說文》：“跌，踼也。从足，失聲。一曰越也。”', '27.8DDB': '《說文》：“跛，行不正也。从足，皮聲。一曰足排之。讀若彼。”', '27.E1CA': '《說文》：“跔，天寒足跔也。从足，句聲。”', '27.8DDD': '《說文》：“距，雞距也。从足，巨聲。”', '27.8DCE': '《說文新附》：“跎，蹉跎也。从足，它聲。”', '27.E1D3': '《說文》：“𤴙，門戶疏䆫也。从疋，疋亦聲；囱象𤴙形。讀若疏。”', '27.55A6': '《說文》：“喦，多言也。从品相連。《春秋傳》曰：‘次於喦北。’讀與聶同。”', '27.F0FF': '《說文》：“㗊，眾口也。从四口。讀若戢，又讀若呶。”', '27.E1DF': '《說文》：“𠷓，聲也。从只，甹聲。讀若聲。”', '27.77DE': '《說文》：“矞，以錐有所穿也。从矛，从㕯。一曰滿有所出也。”', '27.535A': '《說文》：“博，大，通也。从十，从尃。尃，布也。”', '27.F4B0': '《說文》：“𠶷，快也。从言，从中。”', '27.E1E9': '《說文》：“詇，早知也。从言，央聲。”', '27.8A56': '《說文》：“詖，辯論也。古文以為頗字。从言，皮聲。”', '27.8A54': '《說文》：“詔，告也。从言，从召，召亦聲。”', '27.8A41': '《說文》：“詁，訓故言也。从言，古聲。《詩》曰：‘詁訓’。”', '27.8A3C': '《說文》：“証，諫也。从言，正聲。”', '27.E1F9': '《說文》：“𧦝，召也。从言，乎聲。”', '27.8A39': '《說文》：“訹，誘也。从言，术聲。”', '27.8A51': '《說文》：“詑，沇州謂欺曰詑。从言，它聲。”', '27.8A52': '《說文》：“詒，相欺詒也。一曰遺也。从言，台聲。”', '27.8A5B': '《說文》：“詛，詶也。从言，且聲。”', '27.E200': '《說文》：“䛆，詶也。从言，由聲。”', '27.8A4D': '《說文》：“詍，多言也。从言，世聲。《詩》曰：‘無然詍詍’。”', '27.E203': '《說文》：“䛬，往來言也。一曰小兒未能正言也。一曰祝也。从言，匋聲。䛌，䛬或从包。”', '27.8A44': '《說文》：“詄，忘也。从言，失聲。”', '27.8A50': '《說文》：“詐，欺也。从言，乍聲。”', '27.8A36': '《說文》：“訶，大言而怒也。从言，可聲。”', '27.8A34': '《說文》：“訴，告也。从言，厈省聲。《論語》曰：‘訴子路於季孫。’𧪜，訴或从言、朔。愬，訴或从朔、心。”', '27.8A58': '《說文》：“詘，詰詘也。一曰屈襞。从言，出聲。誳，詘或从屈。”', '27.E226': '《說文》：“䛄，尉也。从言，夗聲。”', '27.8A57': '《說文》：“詗，知處告言之。从言，冋聲。”', '27.8A46': '《說文》：“詆，苛也。一曰訶也。从言，氐聲。”', '27.8A3A': '《說文》：“診，視也。从言，㐱聲。”', '27.8A6C': '《說文》：“詬，謑詬，恥也。从言，后聲。訽，詬或从句。”', '27.8A4E': '《說文新附》：“詎，猶豈也。从言，巨聲。”', '27.F16C': '《說文》：“譱，吉也。从誩，从羊。此與義、美同意。𦎍，篆文𦎍从言。”', '27.7AE5': '《說文》：“童，男有辠曰奴，奴曰童。女曰妾。从䇂，重省聲。𥫍，籀文童，中與𥩓中同从𠥻。𠥻，以為古文疾字。”', '27.F341': '《說文》：“𡭊，譍無方也。从丵，从口，从寸。對，或从土。”', '27.976C': '《說文》：“靬，乾革也。武威有麗靬縣。从革，干聲。”', '27.E25A': '《說文》：“䩒，輨內環靼也。从革，于聲。”', '27.976E': '《說文新附》：“靮，馬羈也。从革，勺聲。”', '27.F10A': '《說文》：“䰞，孚也。从䰜，者聲。煮，䰞或从火；䰞，䰞或从水在其中。”', '27.F10E': '《說文》：“𠭥，楚人謂卜問吉凶曰𠭥，从又持祟，祟亦聲。”', '27.6532': '《說文》：“攲，持去也。从支，奇聲。”', '27.8085': '《說文》：“肅，持事振敬也。从𦘒在𣶒上，戰戰兢兢也。𦘡，古文肅。从心，从卪。”', '27.7B46': '《說文》：“筆，秦謂之筆。从聿，从竹。”', '27.756B': '《說文》：“畫，界也。象田四界，聿所以畫之。𨽶，古文畫省。𠟷亦古文畫。”', '27.81E6': '《說文》：“臦，乖也。从二臣相違。讀若誑。”', '27.E2A7': '《說文》：“𧰵，椎𣪠物也。从殳，豖聲。”', '27.6BBD': '《說文》：“殽，相雜錯也。从殳，肴聲。”', '27.F086': '《說文》：“㲃，揉屈也。从殳，从𠧢。𠧢，古文叀字。廏字从此。”', '27.5C0B': '《說文》：“尋，繹理也。从工，从口，从又，从寸。工、口，亂也；又、寸，分理之。彡聲。此與𤕦同意。度人之兩臂為尋，八尺也。”', '27.76B4': '《說文新附》：“皴，皮細起也。从皮，夋聲。”', '27.E2B9': '《說文》：“敟，主也。从攴，典聲。”', '27.655E': '《說文》：“敞，平治高土，可以遠望也。从攴，尚聲。”', '27.E2C3': '《說文》：“敡，侮也。从攴，从易，易亦聲。”', '27.6566': '《說文》：“敦，怒也，詆也。一曰誰何也。从攴，𦎧聲。”', '27.655C': '《說文》：“敜，塞也。从攴，念聲。”', '27.E2CD': '《說文》：“𢽚，擊也。从攴，豖聲。”', '27.6564': '《說文》：“敤，研治也。从攴，果聲。舜女弟名敤首。”', '27.9219': '《說文》：“鈙，持也。从攴，金聲。讀若琴。”', '27.E2D1': '《說文》：“㪏，毁也。从攴，卑聲。”', '27.E2D2': '《說文》：“㪒，㪏也。从攴，兒聲。”', '27.752F': '《說文》：“甯，所願也。从用，寧省聲。”', '27.F4B2': '《說文》：“棥，藩也。从爻，从林。”', '27.E2DC': '《說文》：“𡙐，大視也。从大、𥄎。”', '27.E2DF': '《說文》：“䀹，目旁毛也。从目，夾聲。”', '27.7745': '《說文》：“睅，大目也。从目，旱聲。睆，睅或从完。”', '27.774D': '《說文》：“睍，出目也。从目，見聲。”', '27.774C': '《說文》：“晚，晚䁂，目視皃。从目，免聲。”', '27.E2ED': '《說文》：“𢌨，相顧視而行也。从目，从㢟，㢟亦聲。”', '27.7766': '《說文》：“睦，目順也。从目，坴聲。一曰敬和也。𡻲，古文眭。”', '27.774A': '《說文》：“睊，視皃。从目，肙聲。”', '27.774E': '《說文》：“睎，望也。从目，稀省聲。海、岱之閒謂眄曰睎。”', '27.E304': '《說文》：“䀶，目病也。从目，良聲。”', '27.E30A': '《說文》：“睉，目小也。从目，坐聲。”', '27.7747': '《說文》：“睇，目小視也。从目，弟聲。南楚謂眄曰睇。”', '27.667A': '《說文》：“𥏼，識詞也。从白，从亏，从知。𥏾，古文𥏼。”', '27.7695': '《說文》：“皕，二百也。讀若祕。”', '27.7FD5': '《說文》：“翕，起也。从羽，合聲。”', '27.7FD4': '《說文》：“翔，回飛也。从羽，羊聲。”', '27.96C5': '《說文》：“雅，楚烏也。一名鸒，一名卑居，秦謂之雅。从隹，牙聲。”', '27.E319': '《說文》：“𨾔，鳥也。从隹，方聲。讀若方。”', '27.96C3': '《說文》：“雃，石鳥，一名雝𪆫，一曰精𠛱。从隹，幵聲。《春秋傳》秦有士雃。”', '27.96C2': '《說文》：“雂，鳥也。从隹，今聲。《春秋傳》有公子苦雂。”', '27.96C1': '《說文》：“雁，鳥也。从隹，从人，厂聲。讀若鴈。”', '27.96C7': '《說文》：“雇，九雇，農桑候鳥，扈民不婬者也。从隹，戶聲。春雇鳻盾，夏雇竊玄，秋雇竊藍，冬雇竊黃，棘雇竊丹，行雇唶唶，宵雇嘖嘖，桑雇竊脂，老雇鷃也。𪄮，雇或从雩，𩿇，籀文雇，从鳥。”', '27.E328': '《說文》：“䧴，鳥也。从隹，支聲。一曰䧴度。”', '27.96C4': '《說文》：“雄，鳥父也。从隹，厷聲。”', '27.96C8': '《說文》：“萑，鴟屬。从隹，从𦫳，有毛角。所鳴‘其民有旤’。讀若和。”', '27.E333': '《說文》：“䍮，羊未卒歲也。从羊，兆聲。或曰夷羊百斤左右為䍮，讀若《春秋》‘盟于洮’。”', '27.7FA0': '《說文》：“羠，騬羊也。从羊，夷聲。”', '27.E338': '《說文》：“𦍧，羊名。蹏皮可以割桼。从羊，此聲。”', '27.F122': '《說文》：“雧，羣鳥在木上也。从雥，从木。集，雧或省。”', '27.8204': '《說文》：“舄，䧿也。象形。䧿，篆文舄从隹、㫺。”', '27.5E7E': '《說文》：“幾，微也，殆也。从𢆶，从戍。戍，兵守也。𢆶而兵守者危也。”', '27.60E0': '《說文》：“惠，仁也。从心，从叀。𢡘，古文惠从芔。”', '27.8212': '《說文》：“舒，伸也。从舍，从予，予亦聲。一曰：舒，緩也。”', '27.E375': '《說文》：“𣨙，病也。从歺，委聲。”', '27.E377': '《說文》：“𣨛，大夫死曰𣨛。从歺，卒聲。”', '27.6B94': '《說文》：“殔，瘞也。从歺，隶聲。”', '27.6B98': '《說文》：“殘，賊也。从歺，戔聲。”', '27.6B96': '《說文》：“殖，脂膏久，殖也。从歺，直聲。”', '27.E382': '《說文》：“㱦，棄也。从歺，奇聲。俗謂死曰大㱦。”', '27.E384': '《說文》：“𣣌，戰見血曰傷，亂或為惽，死而復生為𣣌。从死，次聲。”', '27.814E': '《說文》：“腎，水藏也。从肉，臤聲。”', '27.813E': '《說文》：“脾，土藏也。从肉，卑聲。”', '27.8180': '《說文》：“膀，脅也。从肉，㫄聲。髈，膀或从骨。”', '27.8174': '《說文》：“腴，腹下𦘺也。从肉，臾聲。”', '27.813D': '《說文》：“脽，𡱂也。从肉，佳聲。”', '27.8153': '《說文》：“腓，脛腨也。从肉，非聲。”', '27.968B': '《說文》：“隋，裂肉也。从肉，从隓省。”', '27.8146': '《說文》：“腆，設膳腆。腆，多也。从肉，典聲。䐌，古文腆。”', '27.E3A2': '《說文》：“脼，膎肉也。从肉，兩聲。”', '27.8152': '《說文》：“腒，北方謂鳥腊曰腒。从肉，居聲。《傳》曰：‘堯如腊，舜如腒。’”', '27.E3A6': '《說文》：“脠，生肉醬也。从肉，延聲。”', '27.E3A7': '《說文》：“䏽，豕肉醬也。从肉，否聲。”', '27.80FE': '《說文》：“胾，大臠也。从肉，𢦒聲。”', '27.814C': '《說文》：“腌，漬肉也。从肉，奄聲。”', '27.6563': '《說文》：“𢿨，雜肉也。从肉，𢽳聲。”', '27.814F': '《說文》：“腏，挑取骨間肉也。从肉，叕聲。讀若《詩》曰‘啜其泣矣’。”', '27.E3B0': '《說文》：“䐄，食肉不猒也。从肉，臽聲。讀若陷。”', '27.E3B6': '《說文新附》：“䏿，肥腸也。从肉，啓省聲。”', '27.8154': '《說文新附》：“腔，內空也。从肉、从空，空亦聲。”', '27.7B4B': '《說文》：“筋，肉之力也。从力，从肉，从竹。竹，物之多筋者。”', '27.5274': '《說文》：“剴，大鎌也。一曰摩也。从刀，豈聲。”', '27.5272': '《說文》：“割，剝也。从刀，害聲。”', '27.E3CC': '《說文》：“㓷，刑鼻也。从刀，臬聲。《易》曰：‘其人天且㓷。’劓，臬或从鼻。”', '27.E3D1': '《說文》：“𦓯，冊又可以劃麥，河內用之。从耒，圭聲。”', '27.8861': '《說文》：“衡，牛觸，橫大木其角。从角，从大，行聲。《詩》曰：‘設其楅衡。’𡘻，古文衡如此。”', '27.89DB': '《說文》：“觛，小觶也。从角，旦聲。”', '27.89DA': '《說文》：“觚，鄉飲酒之爵也。一曰觴受三升者謂之觚。从角，瓜聲。”', '27.E3E3': '《說文》：“𧣚，調弓也。从角，弱省聲。”', '27.7B4D': '《說文》：“筍，竹胎也。从竹，旬聲。”', '27.7B49': '《說文》：“等，齊簡也。从竹，从寺。寺，官曹之等平也。”', '27.7C43': '《說文》：“籃，大篝也。从竹，監聲。𢉧，古文籃如此。”', '27.E3FA': '《說文》：“笿，桮笿也。从竹，各聲。”', '27.E3FB': '《說文》：“䇨，桮笿也。从竹，夅聲。或曰盛箸籠。”', '27.7B4A': '《說文》：“筊，竹索也。从竹，交聲。”', '27.7B56': '《說文》：“策，馬箠也。从竹，朿聲。”', '27.E40D': '《說文》：“𥬲，箠也。从竹，朵聲。”', '27.E40F': '《說文》：“䇬，栙雙也。从竹，朱聲。”', '27.7B52': '《說文》：“筒，通簫也。从竹，同聲。”', '27.7BA1': '《說文》：“管，如箎，六孔，十二月之音，物開地牙，故謂之管。从竹，官聲。琯，古者玉琯以玉。舜之時，西王母來獻其白琯。前零陵文學姓奚，於伶道舜祠下得笙玉琯。夫以玉作音，故神人以和，鳳皇來儀也。从玉，官聲。”', '27.7B51': '《說文》：“筑，以竹曲，五弦之樂也。从竹，从𢀜。𢀜，持之也。竹亦聲。”', '27.5960': '《說文》：“奠，置祭也。从酋，酋，酒也。下其丌也。《禮》有奠祭者。”', '27.F0C9': '《說文》：“㠭，極巧視之也。从四工。”', '27.7312': '《說文》：“猒，飽也，从甘，从肰。猒，或从㠯。”', '27.6701': '《說文》：“朁，曾也。从曰，兓聲。《詩》曰：‘朁不畏明。’”', '27.559C': '《說文》：“喜，樂也。从壴，从口。歖，古文喜从欠，與歡同。”', '27.5C0C': '《說文》：“尌，立也。从壴，从寸，持之也。讀若駐。”', '27.5F6D': '《說文》：“彭，鼓聲也。从壴，彡聲。”', '27.E43A': '《說文》：“𧯡，豆飴也。从豆，夗聲。”', '27.E445': '《說文》：“䖑，白虎也。从虎，昔省聲。讀若鼏。”', '27.E449': '《說文》：“䖐，虎聲也。从虎，斤聲。”', '27.7235': '《說文》：“爵，禮器也。象爵之形，中有鬯酒，又持之也，所以飲。器象爵者，取其鳴節節足足也。𥥼，古文爵，象形。”', '27.9908': '《說文》：“餈，稻餅也，从食，次聲。䭣，餈或从齊。粢，餈或从米。”', '27.98EF': '《說文》：“飯，食也。从食，反聲。”', '27.E476': '《說文》：“𩚖，雜飯也。从食，丑聲。”', '27.98E7': '《說文》：“𩚏，餔也。从夕、食。”', '27.9910': '《說文》：“餐，吞也。从食，𣦼聲。湌，餐或从水。”', '27.E481': '《說文》：“𩜈，燕食也。从食，芺聲。《詩》曰：‘飲酒之𩜈。’”', '27.7F3F': '《說文》：“缿，受錢器也。从缶，后聲。古以瓦，今以竹。”', '27.77ED': '《說文》：“短，有所長短，以矢為正。从矢，豆聲。”', '27.E49F': '《說文》：“䯧，小堂也。从高省，冋聲。廎，䯧或从广，頃聲。”', '27.5C31': '《說文》：“就，就高也。从京，从尤。尤，異於凡也。𡰗，籀文就。”', '27.8983': '《說文》：“𪉞，長味也。从㫗，鹹省聲。《詩》曰：‘實覃實吁。’𪉞，古文覃。𪉞，篆文覃省。”', '27.821C': '《說文》：“䑞，艸也。楚謂之葍，秦謂之藑。蔓地連華。象形。从舛，舛亦聲。𡐩，古文䑞。”', '27.97D8': '《說文》：“韘，射決也。所以拘弦，以象骨韋系著右巨指。从韋，枼聲。《詩》曰：‘童子佩韘。’弽，韘或从弓。”', '27.97CC': '《說文》：“韌，柔而固也。从韋，刃聲。”', '27.68E0': '《說文》：“棠，牡曰棠，牝曰杜。从木，尚聲。”', '27.68C6': '《說文》：“棆，毋杶也。从木，侖聲。讀若《易》卦‘屯’。”', '27.E4CB': '《說文》：“𣓌，木也。从木，咎聲。”', '27.6906': '《說文》：“椆，木也。从木，周聲。”', '27.68F3': '《說文》：“棳，木也。从木，叕聲。”', '27.68EA': '《說文》：“棪，遬其也。从木，炎聲。”', '27.690B': '《說文》：“椋，即來也。从木，京聲。”', '27.6905': '《說文》：“椅，梓也。从木，奇聲。”', '27.68EB': '《說文》：“棫，白桵也。从木，或聲。”', '27.6910': '《說文》：“椐，樻也。从木，居聲。”', '27.68E3': '《說文》：“棣，白棣也。从木，隶聲。”', '27.6970': '《說文》：“楰，鼠梓木。从木，臾聲。《詩》曰：‘北山有楰。’”', '27.E4FC': '《說文》：“𣓗，高皃，从木曶聲。”', '27.68B4': '《說文》：“梴，長木也。从木，延聲。《詩》曰：‘松桷有梴。’”', '27.68DF': '《說文》：“棟，極也。从木，東聲。”', '27.690D': '《說文》：“植，戶植也。从木，直聲。㯰，或从置。”', '27.6911': '《說文》：“椑，圜榼也。从木，卑聲。”', '27.E518': '《說文》：“㮂，舉食者。从木，具聲。”', '27.68DA': '《說文》：“棚，棧也。从木，朋聲。”', '27.68E7': '《說文》：“棧，棚也，竹木之車曰棧。从木，戔聲。”', '27.68D6': '《說文》：“棖，杖也。从木，長聲。一曰法也。”', '27.68D3': '《說文》：“棓，梲也。从木，咅聲。”', '27.690E': '《說文》：“椎，擊也，齊謂之終葵。从木，隹聲。”', '27.699C': '《說文》：“榜，所以輔弓弩。从木，旁聲。”', '27.68CB': '《說文》：“棊，博棊。从木，其聲。”', '27.6904': '《說文》：“椄，續木也。从木，妾聲。”', '27.690C': '《說文》：“椌，柷，樂也。从木，空聲。”', '27.68E8': '《說文》：“棨，傳，信也。从木，啟省聲。”', '27.68DD': '《說文》：“棝，棝斗，可射鼠。从木，固聲。”', '27.6913': '《說文》：“椓，擊也。从木，豖聲。”', '27.68F1': '《說文》：“棱，柧也。从木，夌聲。”', '27.68F7': '《說文》：“棷，木薪也。从木，取聲。”', '27.69F1': '《說文》：“槱，積火燎之也。从木，从火，酉聲。《詩》曰：‘薪之槱之。’《周禮》：‘以槱燎祠司中、司命。’ 𥙫，柴祭天神。或从示。”', '27.68FA': '《說文》：“棺，關也，所以掩尸。从木，官聲。”', '27.E530': '《說文》：“椁，葬有木𩫏也。从木，𩫏聲。”', '27.68D0': '《說文》：“棐，輔也。从木，非聲。”', '27.7121': '《說文》：“𣞤，豐也。从林、𡘲。或說規模字。从大；𠦜，數之積也；林者，木之多也。𠦜與庶同意。《商書》曰：｀庶草繁無’。”', '27.68FD': '《說文》：“棽，木枝條棽儷皃。从林，今聲。”', '27.68FC': '《說文》：“棼，複屋棟也。从林，分聲。”', '27.68EE': '《說文》：“森，木多皃。从林，从木。讀若曾參之參。”', '27.E536': '《說文》：“𢍚，艸木𢍚孛之皃。从𣎵，𢌿聲。”', '27.9686': '《說文》：“𨼇，豐大也。从生，降聲。”', '27.F0E7': '《說文》：“甤，草木實甤甤也。从生，豨省聲。讀若綏。”', '27.83EF': '《說文》：“華，榮也。从艸，从𠌶。”', '27.E53B': '《說文》：“䅓，䅩䅓也。从禾，从又，句聲。又者，从丑省。一曰木名。”', '27.570D': '《說文》：“圍，守也。从囗，韋聲。”', '27.8CC1': '《說文》：“賁，飾也。从貝，卉聲。”', '27.8CC0': '《說文》：“賀，以禮相奉慶也。从貝，加聲。”', '27.8CB8': '《說文》：“貸，施也。从貝，代聲。”', '27.E54B': '《說文》：“貱，迻予也。从貝，皮聲。”', '27.8CAF': '《說文》：“貯，積也。从貝，宁聲。”', '27.8CB3': '《說文》：“貳，副益也。从貝，弍聲。弍，古文二。”', '27.8CB0': '《說文》：“貰，貸也。从貝，世聲。”', '27.8CBF': '《說文》：“貿，易財也。从貝，丣聲。”', '27.8CBB': '《說文》：“費，散財用也。从貝，弗聲。”', '27.8CB7': '《說文》：“買，市也。从网、貝。《孟子》曰：‘登壟斷而网市利。’”', '27.E550': '《說文》：“䝪，齎財卜問為䝪。从貝，疋聲。讀若所。”', '27.8CB4': '《說文》：“䝿，物不賤也。从貝，臾聲。臾，古文蕢。”', '27.8CBA': '《說文新附》：“貺，賜也。从貝，兄聲。”', '27.8CBC': '《說文新附》：“貼，以物為質也。从貝，占聲。”', '27.8CBD': '《說文新附》：“貽，贈遺也。从馬，台聲。經典通用詒。”', '27.90F5': '《說文》：“郵，境上行書舍。从邑、垂。垂，邊也。”', '27.E555': '《說文》：“𨜒，周封黃帝之後於𨜒也。从邑，契聲。讀若薊。上谷有𨜒縣。”', '27.90FF': '《說文》：“郿，右扶風縣。从邑，眉聲。”', '27.9106': '《說文》：“鄆，河內沁水鄉。从邑，軍聲。魯有鄆地。”', '27.9107': '《說文》：“鄇，晉之溫地。从邑，侯聲。《春秋傳》：‘争𨜫田。’”', '27.9108': '《說文》：“鄈，河東臨汾地，即漢之所祭后土處。从邑，癸聲。”', '27.9103': '《說文》：“鄃，清河縣。从邑，俞聲。”', '27.910B': '《說文》：“鄋，北方長狄國也，在夏為防風氏，在殷為汪茫氏，从邑，叜聲。《春秋傳》曰：‘鄋瞞侵齊。’”', '27.90FE': '《說文》：“郾，穎川縣。从邑，匽聲。”', '27.90F9': '《說文》：“郹，蔡邑也。从邑，狊聲。《春秋傳》曰：‘郹陽封人之女奔之。’”', '27.9102': '《說文》：“鄂，江夏縣。从邑，㖾聲。”', '27.9104': '《說文》：“鄄，衛地。今濟陰鄄城。从邑，垔聲。”', '27.9105': '《說文》：“鄅，妘姓之國。从邑，禹聲。《春秋傳》曰：‘鄅人藉稻。’讀若規榘之榘。”', '27.912C': '《說文》：“鄬，地名。从邑，為聲。”', '27.E58D': '《說文》：“𨜴，地名。从邑，盍聲。”', '27.9109': '《說文》：“鄉，國離邑，民所封鄉也。嗇夫別治，封圻之內六鄉，六鄉治之。从𨛜，皀聲。”', '27.E598': '《說文》：“晵，雨而晝夝也。从日，啟省聲。”', '27.6679': '《說文》：“晹，日覆雲暫見也。从日，易聲。”', '27.666F': '《說文》：“景，光也。从日，京聲。”', '27.6677': '《說文》：“晷，日景也。从日，咎聲。”', '27.667B': '《說文》：“晻，不明也。从日，奄聲。”', '27.6680': '《說文》：“暀，光美也。从日，往聲。”', '27.6691': '《說文》：“暑，熱也。从日，者聲。”', '27.666E': '《說文》：“暜，日無色也。从日，从竝。”', '27.666C': '《說文新附》：“晬，周年也。从日，卒，卒亦聲。”', '27.671D': '《說文》：“朝，旦也。从倝，舟聲。”', '27.65D0': '《說文》：“旐，龜蛇四游，以象營室，游游而長。从㫃，兆聲。《周禮》曰：‘縣鄙建旐。’”', '27.6676': '《說文》：“晶，精光也。从三日。”', '27.9738': '《說文》：“霸，月始生霸然也，承大月二日，承小月三日。从月，䨣聲。《周書》曰：‘哉生霸。’𣍸，古文霸。”', '27.E5B6': '《說文》：“𥁰，《周禮》曰：‘國有疑則盟。諸侯再相與會，十二歲一𥁰，北面詔天之司慎司命。𥁰，殺牲歃血，朱盤玉敦，以立牛耳。’从囧，从血。𥂗，篆文，从朙。盟，古文从明。”', '27.7C9F': '《說文》：“𥻆（粟），嘉穀實也。从𠧪，从米。孔子曰：‘粟之為言續也。’𥾄，籀文𥻆。”', '27.68D7': '《說文》：“棗，羊棗也。从重朿。”', '27.68D8': '《說文》：“棘，小棗叢生者。从並朿。”', '27.7A00': '《說文》：“稀，疏也。从禾，希聲。”', '27.7A37': '《說文》：“稷，𪗉也，五穀之長。从禾，畟聲。𥞷，古文稷省。”', '27.7A0C': '《說文》：“稌，稻也。从禾，余聲。《周禮》曰：‘牛宜稌’。”', '27.E5E3': '《說文》：“䅌，麥莖也。从禾，肙聲。”', '27.7A05': '《說文》：“稅，租也。从禾，兌聲。”', '27.7A0D': '《說文》：“稍，出物有漸也。从禾，肖聲。”', '27.7A0B': '《說文》：“程，品也。十髮為程，十程為分，十分為寸。从禾，呈聲。”', '27.9ECD': '《說文》：“黍，禾屬而黏者也。以大暑而穜，故謂之黍。从禾，雨省聲。孔子曰：黍可為酒，禾入水也。”', '27.7CB2': '《說文》：“粲，稻重一䄷，為粟二十斗、為米十斗曰毇；為米六斗太半斗曰粲。从米，𣦼聲。”', '27.F0C0': '《說文》：“䊆，舂糗也。从臼、米。”', '27.E605': '《說文》：“𦥭，齊謂舂曰𦥭。从臼，屰聲。讀若膊。”', '27.F4B3': '《說文》：“㪔，分離也。从攴，从𣏟，𣏟，分㪔之意也。”', '27.E617': '《說文》：“寏，周垣也。从宀，奐聲。”', '27.5BEA': '《說文》：“寪，屋皃。从宀，為聲。”', '27.5BCD': '《說文》：“寍，安也。从宀，心在皿上。人之飲食器。所以安人。”', '27.5BD4': '《說文》：“寔，止也。从宀，是聲。”', '27.E61B': '《說文》：“㝣，靜也。从宀，契聲。”', '27.5BCC': '《說文》：“富，備也。一曰厚也。从宀，畐聲。”', '27.5BD3': '《說文》：“寓，寄也。从宀，禺聲。庽，寓或从广。”', '27.5BD2': '《說文》：“寒，凍也。从人在宀下，以茻薦覆之，下有仌。”', '27.E636': '《說文》：“䆢，深抉也。从穴，从抉。”', '27.E639': '《說文》：“𥥻，空也。从穴，巠聲。《詩》曰：‘瓶之𥥻矣。’”', '27.7A96': '《說文》：“窖，地藏也。从穴，告聲。”', '27.7A98': '《說文》：“窘，迫也。从穴，君聲。”', '27.5BD0': '《說文》：“寐，卧也。从㝱省，未聲。”', '27.5BCE': '《說文》：“寎，卧驚病也。从㝱省，丙聲。”', '27.75DB': '《說文》：“痛，病也。从疒，甬聲。”', '27.75E1': '《說文》：“痡，病也。从疒，甫聲。《詩》曰：‘我僕痡矣。’”', '27.E647': '《說文》：“㾕，寒病也。从疒，辛聲。”', '27.75DF': '《說文》：“痟，酸痟，頭痛。从疒，肖聲。《周禮》曰：‘春時有痟首疾。’”', '27.75E4': '《說文》：“痤，小腫也。从疒，坐聲。一曰族絫。”', '27.75D9': '《說文》：“痙，彊急也。从疒，巠聲。”', '27.F0BD': '《說文》：“㾜，病息也。从疒，夾聲。”', '27.75DE': '《說文》：“痞，痛也。从疒，否聲。”', '27.E662': '《說文》：“痥，馬脛瘍也。从疒，兌聲。一曰將傷。”', '27.E667': '《說文》：“㓃，奠爵酒也。从冖，託聲。”', '27.6700': '《說文》：“最，犯而取也。从冃，从取。”', '27.8A48': '《說文》：“詈，罵也。从网，从言。网辠人。”', '27.5E45': '《說文》：“幅，布帛廣也。从巾，畐聲。”', '27.E680': '《說文》：“㡓，𢃭也。从巾，軍聲。褌，㡓或从衣。”', '27.E688': '《說文》：“㡏，正耑裂也。从巾，俞聲。”', '27.E68A': '《說文》：“𢃬，幡幟也。从巾，前聲。”', '27.E68E': '《說文》：“𢃴，刜也。从巾，剌聲。”', '27.5E43': '《說文》：“幃，囊也。从巾，韋聲。”', '27.E694': '《說文》：“㡒，，載米𤲑也。从巾，盾聲。讀若《易》屯卦之屯。”', '27.E698': '《說文》：“㡔，䰍布也。一曰車上衡衣。从巾，敄聲。”', '27.9EF9': '《說文》：“黹，箴縷所紩衣。从㡀，丵省。”', '27.5091': '《說文》：“傑，傲也。从人，桀聲。”', '27.509B': '《說文》：“傛，不安也。从人，容聲。”', '27.5080': '《說文》：“傀，偉也。从人，鬼聲。《周禮》曰：‘大傀異。’𤪿，傀或从玉，褢聲。”', '27.E6AE': '《說文》：“傓，熾盛也。从人，扇聲。《詩》曰：‘豔妻傓方處。’”', '27.5085': '《說文》：“傅，相也。从人，尃聲。”', '27.E6B7': '《說文》：“傆，黠也。从人，原聲。”', '27.E6C1': '《說文》：“𠋺，𠋺驕也。从人，蚤聲。”', '27.509E': '《說文》：“醉舞皃。从人，差聲。《詩》曰：‘屢舞傞傞’。”', '27.E6C6': '《說文》：“㑵，妎也。从人，疾聲。一曰毒也。嫉，㑵或从女。”', '27.5094': '《說文新附》：“傔，從也。从人，兼聲。”', '27.81EE': '《說文》：“臮，眾詞與也。从㐺，自聲。《虞書》曰：‘臮咎繇。’𡮧，古文臮。”', '27.91CF': '《說文》：“量，稱輕重也。从重省，曏省聲。𨤦，古文量。”', '27.88C1': '《說文》：“裁，制衣也。从衣，𢦒聲。”', '27.88B2': '《說文》：“袳，衣張也。从衣，多聲。《春秋傳》曰：‘公會齊矦于袳。’”', '27.88B7': '《說文》：“袷，衣無絮。从衣，合聲。”', '27.88BE': '《說文》：“袾，好佳也。从衣，朱聲。《詩》曰：‘靜女其袾。’”', '27.88C2': '《說文》：“裂，繒餘也。从衣，𠛱聲。”', '27.88BA': '《說文》：“袺，執衽謂之袺。从衣，吉聲。”', '27.6BF3': '《說文》：“毳，獸細毛也。从三毛。”', '27.E706': '《說文》：“㞚，從後相臿也。从尸，从臿。”', '27.E709': '《說文》：“屟，履中薦也。从尸，枼聲。”', '27.515F': '《說文》：“兟，進也。从二先。贊从此。闕。”', '27.8998': '《說文》：“覘，窺也。从見，占聲。《春秋傳》曰：‘公使覘之，信。’”', '27.E723': '《說文》：“𧠟，病人視也。从見，氐聲。讀若迷。”', '27.8995': '《說文》：“覕，蔽不相見也。从見，必聲。”', '27.E72B': '《說文》：“䙾，司人也。从見，它聲。讀若馳。”', '27.6B3D': '《說文》：“欽，欠皃。从欠，金聲。”', '27.E730': '《說文》：“㰲，吹气也。从欠，或聲。”', '27.6B3E': '《說文》：“㱁，意有所欲也。从欠，省。歀，㱁或从柰。”', '27.6B3B': '《說文》：“欻，有所吹起。从欠，炎聲。讀若忽。”', '27.6B3F': '《說文》：“欿，欲得也。从欠，臽聲。讀若貪。”', '27.E747': '《說文》：“㰶，蹴鼻也。从欠，咎聲。讀若《爾雅》曰：‘麔豭短脰’。”', '27.6B3A': '《說文》：“欺，詐欺也。从欠，其聲。”', '27.76DC': '《說文》：“盜，私利物也。从㳄，㳄欲皿者。”', '27.E753': '《說文》：“𣄴，事有不善，言𣄴也。《爾雅》：‘𣄴，薄也。’从㒫，京聲。”', '27.E756': '《說文》：“𩑒，顱也。从頁，乇聲。”', '27.9805': '《說文》：“項，頭後也。从頁，工聲。”', '27.9806': '《說文》：“順，理也。从頁、从巛。”', '27.E776': '《說文》：“𩑡，禿也。从頁，气聲。”', '27.9808': '《說文》：“須，面毛也。从頁，从彡。”', '27.6590': '《說文》：“斐，分別文也。从文，非聲。《易》曰：‘君子豹變，其文斐也。’”', '27.8A5E': '《說文》：“詞，意內而言外也。从司，从言。”', '27.8275': '《說文》：“艵，縹色也。从色，并聲。”', '27.5D4E': '《說文》：“嵎，封嵎之山，在吳、楚之間，汪芒之國。从山，禺聲。”', '27.5D35': '《說文》：“崵，首崵山，在遼西。从山，昜聲。一曰嵎鐵崵谷也。”', '27.5D52': '《說文》：“嵒，山巖也。从山、品。”', '27.E7D3': '《說文》：“嵍，山名。从山，敄聲。”', '27.5D55': '《說文》：“嵏，九嵏山，在馮翊谷口。从山，㚇聲。”', '27.5D4C': '《說文新附》：“嵌，山深皃。从山，歁省聲。”', '27.5D50': '《說文新附》：“嵐，山名。从山，葻省聲。”', '27.5D47': '《說文新附》：“嵇，山名。从山，稽省聲。”', '27.5EC1': '《說文》：“廁，清也。从广，則聲。”', '27.5EDF': '《說文》：“廟，尊先祖皃也。从广，朝聲。庿，古文。”', '27.E7E3': '《說文》：“𢉥，屋迫也。从广，曷聲。”', '27.5ECA': '《說文新附》：“廊，東西序也。从广，郎聲。”', '27.5EC2': '《說文新附》：“廂，廊也。从广，相聲。”', '27.53A5': '《說文》：“厥，發石也。从厂，欮聲。”', '27.53A4': '《說文》：“厤，治也。从厂，秝聲。”', '27.E7F2': '《說文》：“𠷏，鷙鳥食已，吐其皮毛如丸。从丸，咼聲。”', '27.785E': '《說文》：“硞，石聲。从石，告聲。”', '27.7860': '《說文》：“硠，石聲。从石，良聲。”', '27.786E': '《說文》：“确，礊石也。从石，角聲。𥔳，确或从𣪊。”', '27.786A': '《說文》：“硪，石巖也。从石，我聲。”', '27.78EC': '《說文》：“磬，樂石也。从石，殸象縣虡之形。殳，擊之也。古者毋句氏作磬。殸，籀文省；硜，古文从巠。”', '27.7869': '《說文》：“硩，上摘巖空青、珊瑚墮之。从石，折聲。《周禮》有硩蔟氏。”', '27.E7FF': '《說文》：“硟，以石扞繒也。从石，延聲。”', '27.786F': '《說文》：“硯，石滑也。从石，見聲。”', '27.957B': '《說文》：“镻，蛇惡毒長也。从長，失聲。”', '27.E80C': '《說文》：“豠，豕屬。从豕，且聲。”', '27.E80F': '《說文》：“𢑢，豕屬。从㣇，聲。”', '27.5F58': '《說文》：“彘，豕也，後蹏廢謂之彘。从彑，矢聲，从二匕。彘足與鹿足同。”', '27.8C80': '《說文》：“貀，獸無前足。从豸，出聲。漢律，能捕豺貀，購百錢。”', '27.8C82': '《說文》：“貂，鼠屬。大而黃黑，出胡丁零國。从豸，召聲。”', '27.8C81': '《說文》：“貁，鼠屬，善旋。从豸，穴聲。”', '27.8C61': '《說文》：“象，長鼻牙，南越大獸，三年一乳。象耳牙四足之形。”', '27.8C6B': '《說文》：“豫，象之大者。賈侍中說：‘不害於物。’从象，予聲。𠄛，古文。”', '27.E81C': '《說文》：“𩡩，馬八歲也。从馬，从八。”', '27.99AE': '《說文》：“馮，馬行疾也。从馬，冫聲。”', '27.9038': '《說文》：“逸，失也。从辵、兔。兔謾訑善逃也。”', '27.F657': '《說文》：“萈，山羊細角者。从兔足，苜聲。讀若丸，寬字从此。”', '27.7340': '《說文》：“獀，南越名犬獿獀。从犬，叟聲。”', '27.7332': '《說文》：“猲，短喙犬也。从犬，曷聲。《詩》曰：‘載獫猲獢。’《爾雅》曰：‘短喙犬謂之猲獢。’”', '27.E854': '《說文》：“𤟟，竇中犬聲。从犬，从音，音亦聲。”', '27.7329': '《說文》：“猩，猩猩，犬吠聲。从犬，星聲。”', '27.7325': '《說文》：“猥，犬吠聲。从犬，畏聲。”', '27.734E': '《說文》：“𤟌，嗾犬厲之也。从犬，將省聲。”', '27.730C': '《說文》：“猌，犬張齗怒也。从犬，來聲。讀又若銀。”', '27.E862': '《說文》：“𤣗，秋田也。从犬，璽聲。”', '27.7336': '《說文》：“猶，玃屬。从犬，酋聲。一曰隴西謂犬子為猷。”', '27.7334': '《說文》：“㺅，夔也。从犬，矦聲。”', '27.7335': '《說文》：“猵，獺屬。从犬，扁聲。獱，或从賓。”', '27.730B': '《說文》：“猋，犬走皃。从三犬。”', '27.E869': '《說文新附》：“𤟤，獸名。从犬，軍聲。”', '27.7330': '《說文新附》：“猰，猰㺄，獸名。从犬，契聲。”', '27.F607': '《說文》：“尞，柴祭天也。从火，从眘。眘，古文慎字，祭天所以慎也。”', '27.7136': '《說文》：“然，燒也。从火，肰聲。䕼，或从艸、難。”', '27.711B': '《說文》：“焛，火皃。从火，𨳌省聲。”', '27.E880': '《說文》：“𤉧，交灼木也。从火，教省聲。”', '27.7120': '《說文》：“焠，堅刀刃也。从火，卒聲。”', '27.711A': '《說文》：“燓，燒田也。从火、棥，棥亦聲。”', '27.E88B': '《說文》：“𤓪，火所傷也。从火，雥聲。𤊙，或省。”', '27.711E': '《說文》：“𤑴，明也。从火，𦎧聲。《春秋傳》曰：‘焞燿天地。’”', '27.712F': '《說文》：“焯，明也。从火，卓聲。”', '27.711C': '《說文》：“焜，煌也。从火，昆聲。”', '27.F5CE': '《說文》：“㷠，兵死及牛馬之血為㷠。㷠，鬼火也。从炎、舛。”', '27.9ED1': '《說文》：“黑，火所熏之色也。从炎上出囦。囦古䆫字。”', '27.7131': '《說文》：“焱，火華也。从三火。”', '27.55AC': '《說文》：“喬，高而曲也。从夭，从高省。《詩》曰：‘南有喬木。’”', '27.7D5E': '《說文》：“絞，縊也。从交，从糸。”', '27.58FA': '《說文》：“壺，昆吾圜器也。象形。从大，象其蓋也。”', '27.E8C8': '《說文》：“㚃，壹㚃也。从凶，从壺。不得泄凶也。《易》曰：‘天地壹㚃。’段玉裁注：“不得泄也者，謂元氣渾然，吉凶未分，故其字从吉凶在壺中。會意。”', '27.58F9': '《說文》：“壹，專壹也。从壷，吉聲。”', '27.5831': '《說文》：“報，當罪人也。从㚔，从𠬝。𠬝，服罪也。”', '27.E8CA': '《說文》：“𡴞，進也。从夲，从屮，允聲。《易》曰：‘𡴞升大吉。’”', '27.5961': '《說文》：“奡，嫚也。从𦣻，从夰，夰亦聲。《虞書》曰：‘若丹朱奡。’讀若傲。《論語》：‘奡湯（盪）舟。’ ”', '27.7AE6': '《說文》：“竦，敬也。从立，从束。束，自申束也。”', '27.7AE3': '《說文》：“竣，偓竣也。从立，夋聲。《國語》曰：‘有司已事而竣。’”', '27.66FF': '《說文》：“𤾕，廢，一偏下也。从竝，白聲。暜，或从曰。㬱，或从兟，从曰。”', '27.F52B': '《說文》：“惪，外得於人，內得於己也。从直，从心。”', '27.611C': '《說文》：“㥦，快也。从心，匧聲。”', '27.E8E3': '《說文》：“𢝆，遲也。从心，重聲。”', '27.60F2': '《說文》：“惲，重厚也。从心，軍聲。”', '27.6168': '《說文》：“慨，忼慨，壯士不得志也。从心，既聲。”', '27.610A': '《說文》：“愊，誠志也。从心，畐聲。”', '27.6103': '《說文》：“愃，寬嫺心腹皃。从心，宣聲。《詩》曰：‘赫兮愃兮。’”', '27.E8EA': '《說文》：“㥞，深也。从心，㒸聲。”', '27.60B9': '《說文》：“悹，憂也。从心，官聲。”', '27.E8F0': '《說文》：“㥠，知也。从心，胥聲。”', '27.E8F3': '《說文》：“𢜮，𢜮撫也。从心，某聲。讀若侮。”', '27.6110': '《說文》：“愐，勉也。从心，面聲。”', '27.E8FA': '《說文》：“㥥，懽也。琅邪朱虛有㥥亭。从心，禺聲。”', '27.60C4': '《說文》：“惄，飢餓也。一曰憂也。从心，叔聲。《詩》曰：‘惄如朝飢。’”', '27.E8FB': '《說文》：“𢜭，勞也。从心，卻聲。”', '27.6112': '《說文》：“愒，息也。从心，曷聲。”', '27.E8FF': '《說文》：“㥛，疾也。从心，亟聲。一曰謹重皃。”', '27.E901': '《說文》：“𢛆，急也。从心，从弦，弦亦聲。河南密縣有𢛆亭。”', '27.6109': '《說文》：“愉，薄也。从心，俞聲。《論語》曰：‘私覿愉愉如也。’”', '27.614B': '《說文》：“態，意也。从心，从能。㑷，或从人。”', '27.F0B9': '《說文》：“憜，不敬也。从心，𡐦省。《春秋傳》曰：‘執玉憜。’惰，憜或省𨸏。媠，古文。”', '27.6113': '《說文》：“愓，放也。从心，昜聲。一曰平也。”', '27.60D1': '《說文》：“惑，亂也。从心，或聲。”', '27.614D': '《說文》：“愠，怒也。从心，昷聲。”', '27.60E1': '《說文》：“惡，過也。从心，亞聲。”', '27.E915': '《說文》：“㥟，怨恨也。从心，彖聲。讀若膎。”', '27.E916': '《說文》：“𢜳，小怒也。从心，壴聲。”', '27.60B6': '《說文》：“悶，懣也。从心，門聲。”', '27.60B2': '《說文》：“悲，痛也。从心，非聲。”', '27.60FB': '《說文》：“惻，痛也。从心，則聲。”', '27.E918': '《說文》：“㥋，痛聲也。从心，依聲。《孝經》曰：‘哭不㥋。’”', '27.E91B': '《說文》：“𢛃，怨仇也。从心，咎聲。”', '27.60F4': '《說文》：“惴，憂懼也。从心，耑聲。《詩》曰：‘惴惴其慄。’”', '27.60F6': '《說文》：“惶，恐也。从心，皇聲。”', '27.60CE': '《說文》：“惎，毒也。从心，其聲。《周書》曰：‘來就惎惎。’”', '27.E92F': '《說文》：“㥝，厲也。一曰止也。从心，弭聲。讀若沔。”', '27.60C9': '《說文新附》：“惉，惉懘，煩聲也。从心，沾聲。”', '27.60E2': '《說文》：“惢，心疑也。从三心。讀若《易》：‘旅瑣瑣’。”', '27.6E54': '《說文》：“湔，水。出蜀群緜虒玉壘山，東南入江。从水，前聲。一曰手𤃬之。”', '27.6EAB': '《說文》：“溫，水。出犍為涪，南入黔水。从水，𥁕聲。”', '27.6E2D': '《說文》：“渭，水。出隴西首陽渭首亭南谷，東入河。从水，胃聲。杜林說，《夏書》以為出鳥鼠山。雝州浸也。”', '27.6E5F': '《說文》：“湟，水。出金城臨羌塞外，東入河。从水，皇聲。”', '27.6E58': '《說文》：“湘，水。出零陵陽海山，北入江。从水，相聲。”', '27.6E5E': '《說文》：“湞，水。出南海龍川，西入溱。从水，貞聲。”', '27.6E2E': '《說文》：“渮，渮澤水在山陽胡陵。《禹貢》：‘浮于淮、泗，達于渮。’从水，苛聲。”', '27.6E89': '《說文》：“溉，水。出東海桑瀆覆甑山，東北入海。一曰灌注也。从水，既聲。”', '27.6E61': '《說文》：“湡，水。出趙國襄國之西山，東北入𣹦。从水，禺聲。”', '27.6E73': '《說文》：“湳，西河美稷𠈃東北水。从水，南聲。”', '27.6E19': '《說文》：“渙，流𢿱也。从水，奐聲。”', '27.6E5D': '《說文》：“湝，水流湝湝也。从水，皆聲。一曰湝湝，寒也。《詩》曰：‘風雨湝湝。’”', '27.6E4B': '《說文》：“湋，回也。从水，韋聲。”', '27.6E2C': '《說文》：“測，深所至也。从水，則聲。”', '27.6E4D': '《說文》：“湍，疾瀨也。从水，耑聲。”', '27.6E41': '《說文》：“湁，湁湒，𩰾也。从水，拾聲。”', '27.6E3E': '《說文》：“渾，混流聲也。从水，軍聲。一曰洿下皃。”', '27.6E5C': '《說文》：“湜，水清底見也。从水，是聲。《詩》曰：‘湜湜其止。’”', '27.6E3B': '《說文》：“渻，少減也。一曰水門。又水出丘前謂之渻丘。从水，省聲。”', '27.6ECB': '《說文》：“滋，益也。从水，茲聲。一曰滋水，出牛飲山白陘谷，東入呼沱。”', '27.6E40': '《說文》：“湀，湀辟，深水處也。从水，癸聲。”', '27.6E56': '《說文》：“湖，大陂也。从水，胡聲。揚州浸有五湖。浸，川澤所仰以灌溉也。”', '27.6E20': '《說文》：“渠，水所居。从水，榘省聲。”', '27.6E44': '《說文》：“湄，水艸交為湄。从水，眉聲。”', '27.6E21': '《說文》：“渡，濟也。从水，度聲。”', '27.6E4A': '《說文》：“湊，水上人所會也。从水，奏聲。”', '27.6E5B': '《說文》：“湛，沒也。从水，甚聲。一曰湛水，豫章浸。㴴，古文。”', '27.6E6E': '《說文》：“湮，沒也。从水，垔聲。”', '27.6E28': '《說文》：“渨，沒也。从水，畏聲。”', '27.6E30': '《說文》：“渰，雲雨皃。从水，弇聲。”', '27.6E52': '《說文》：“湒，雨下也。从水，咠聲。一曰沸涌皃。”', '27.6E3F': '《說文》：“渿，沛之也。从水，柰聲。”', '27.6E25': '《說文》：“渥，霑也。从水，屋聲。”', '27.6E34': '《說文》：“渴，盡也。从水，曷聲。”', '27.6E46': '《說文》：“湆，幽溼也。从水，音聲。”', '27.6E6B': '《說文》：“湫，隘下也。一曰有湫水，在周地。《春秋傳》曰‘晏子之宅秋〔湫〕隘。’安定朝那有湫泉。从水，秋聲。”', '27.6E6F': '《說文》：“湯，熱水也。从水，昜聲。”', '27.6E1C': '《說文》：“渜，湯也。从水，耎聲。”', '27.6EB2': '《說文》：“𣸈，浸𣵽也。从水，叜聲。”', '27.6E51': '《說文》：“湑，莤酒也。一曰浚也。一曰露皃。从水，胥聲。《詩》曰：‘有酒湑我。’又曰：‘零露湑兮。’”', '27.6E4E': '《說文》：“湎，沈於酒也。从水，面聲。《周書》曰：‘罔敢湎于酒。’”', '27.6E33': '《說文》：“渳，飲也。从水，弭聲。”', '27.6E2B': '《說文》：“渫，除去也。从水，枼聲。”', '27.6E69': '《說文》：“湩，乳汁也。从水，重聲。”', '27.6E45': '《說文》：“湅，㶕也。从水，柬聲。”', '27.6E1D': '《說文》：“渝，變汙也。从水，俞聲。一曰渝水，在遼西臨俞，東出塞。”', '27.6E1B': '《說文》：“減，損也。从水，咸聲。”', '27.840D': '《說文》：“萍，苹也，水艸也。从水、苹，苹亦聲。”', '27.6E72': '《說文新附》：“湲，潺湲，水聲。从水，爰聲。”', '27.6E2F': '《說文》：“𣿑，水派也，从水䢽聲。”', '27.6DFC': '《說文新附》：“淼，大水也，从三水。或作渺。”', '27.6E98': '《說文新附》：“溘，奄忽也。从水，盍聲。”', '27.F0B1': '《說文》：“䜭，深通川也。从谷，从𣦵；𣦵，殘地阮坎意也。《虞書》曰：‘䜭畎澮距川。’𣽊，䜭或从水。濬，古文䜭。”', '27.51D4': '《說文》：“凔，寒也。从仌，倉聲。”', '27.E97F': '《說文》：“凓，寒也。从仌，栗聲。”', '27.81F8': '《說文》：“臸，到也。从二至。”', '27.E9D7': '《說文》：“䙵，姓也。从西，圭聲。”', '27.6249': '《說文》：“扉，戶扇也。从戶，非聲。”', '27.958E': '《說文》：“閎，巷門也。从門，厷聲。”', '27.E9DD': '《說文》：“䦏，門扇也。从門，介聲。”', '27.95E2': '《說文》：“闢，開也。从門，辟聲。𨴔，《虞書》曰：‘闢四門’，从門，从廾。”', '27.958B': '《說文》：“開，張也。从門，从幵。𨴉，古文開。”', '27.9592': '《說文》：“閒，隟也。从門，从月。𨳿，古文閒。”', '27.9591': '《說文》：“閑，闌也。从門中有木。”', '27.9594': '《說文》：“閔，弔者在門也。从門，文聲。𢞰，古文閔。”', '27.958C': '《說文新附》：“閌，閌閬，高門也。从門，亢聲。”', '27.8052': '《說文》：“𦕾，驩語也。从耳，𠯑聲。”', '27.8051': '《說文》：“聑，安也。从二耳。”', '27.638C': '《說文》：“掌，手中也。从手，尚聲。”', '27.63D6': '《說文》：“揖，攘也。从手，咠聲。一曰手箸胷曰揖。”', '27.63F2': '《說文》：“揲，閱持也。从手，枼聲。”', '27.63E1': '《說文》：“握，搤持也。从手，屋聲。𦥆，古文握。”', '27.63D0': '《說文》：“提，挈也。从手，是聲。”', '27.63D7': '《說文》：“揗，摩也。从手，盾聲。”', '27.63BE': '《說文》：“掾，緣也。从手，彖聲。”', '27.63D2': '《說文》：“插，刺肉也。从手，从臿。”', '27.63C3': '《說文》：“揃，搣也。从手，前聲。”', '27.EA08': '《說文》：“摕，撮取也。从手，帶聲。讀若《詩》曰‘螮蝀在東’。𢰂，摕或从折从示，兩手急持人也。”', '27.63DC': '《說文》：“揜，自關以東謂取曰揜。一曰覆也。从手，弇聲。”', '27.63E3': '《說文》：“揣，量也。从手，耑聲。度高曰揣。一曰捶之。”', '27.63C2': '《說文》：“揂，聚也。从手，酋聲。”', '27.6394': '《說文》：“掔，固也。从手，臤聲。讀若《詩》：‘赤舄掔掔’。”', '27.63DA': '《說文》：“揚，飛舉也。从手，易聲。𠭲，古文。”', '27.63ED': '《說文》：“揭，高舉也。从手，曷聲。”', '27.63C4': '《說文》：“揄，引也。从手，俞聲。”', '27.63C6': '《說文》：“揆，葵也。从手，癸聲。”', '27.63EF': '《說文》：“揯，引急也。从手，恆聲。”', '27.63F4': '《說文》：“援，引也。从手，爰聲。”', '27.63E0': '《說文》：“揠，拔也。从手，匽聲。”', '27.EA1C': '《說文》：“㨔，搖也。从手，咸聲。”', '27.63EE': '《說文》：“揮，奮也。从手，軍聲。”', '27.649D': '《說文》：“撝，裂也。从手，為聲。一曰手指也。”', '27.6461': '《說文》：“摡，滌也。从手，既聲。《詩》曰：‘摡之釜鬵。’”', '27.63DF': '《說文》：“揟，取水沮也。从手，胥聲。武威有揟次縣。”', '27.EA24': '《說文》：“㨖，刺也。从手，致聲。一曰刺之財至也。”', '27.EA28': '《說文》：“㨐，衣上擊也。从手，保聲。”', '27.6376': '《說文》：“捶，以杖擊也。从手，垂聲。”', '27.63D9': '《說文》：“揙，撫也。从手，扁聲。”', '27.641C': '《說文》：“𢯱，眾意也。一曰求也。从手，叜聲。”', '27.63DB': '《說文》：“換，易也。从手，奐聲。”', '27.5AAF': '《說文》：“媯，虞舜居媯汭，因以為氏。从女，為聲。”', '27.5A92': '《說文》：“媒，謀也，謀合二姓。从女，某聲。”', '27.5AA6': '《說文》：“媦，楚人謂女弟曰媦。从女，胃聲。《公羊傳》曰：‘楚王之妻媦。’”', '27.5AC2': '《說文》：“㛮，兄妻也。从女，叜聲。”', '27.5A8A': '《說文》：“媊，甘氏《星經》曰：太白上公妻曰女媊。女媊居南斗，食厲，天下祭之，曰明星。从女，前聲。”', '27.5AA7': '《說文》：“媧，古之神聖女，化萬物者也。从女，咼聲。𡢓，籀文媧从𩰬。”', '27.5A9A': '《說文》：“媚，說也。从女，眉聲。”', '27.5A84': '《說文》：“媄，色好也。从女，从美，美亦聲。”', '27.5A8C': '《說文》：“媌，目裏好也。从女，苗聲。”', '27.5A9E': '《說文》：“媞，諦也。一曰妍黠也。一曰江淮之間謂母曰媞。从女，是聲。”', '27.5A7A': '《說文》：“婺，不繇也。从女，敄聲。”', '27.EA52': '《說文》：“媅，樂也。从女，甚聲。”', '27.5A95': '《說文》：“媕，女有心媕媕也。从女，弇聲。”', '27.EA54': '《說文》：“媣，諟也。从女，染聲。”', '27.5A9B': '《說文》：“媛，美女也，人所援也。从女，从爰。爰，引也。《詩》曰：‘邦之媛兮。’”', '27.5A9F': '《說文》：“媟，嬻也。从女，枼聲。”', '27.5AA2': '《說文》：“媢，夫妒婦也。从女，冒聲。一曰相視也。”', '27.5AAE': '《說文》：“媮，巧黠也。从女，俞聲。”', '27.EA64': '《說文》：“𡞞，減也。从女，省聲。”', '27.5A7C': '《說文》：“婼，不順也。从女，若聲。《春秋傳》曰叔孫婼。”', '27.EA6E': '《說文》：“媁，不說皃。从女，韋聲。”', '27.5AA5': '《說文》：“媥，輕皃。从女，扁聲。”', '27.EA70': '《說文》：“㛼，疾言失次也。从女，臿聲。讀若懾。”', '27.EA78': '《說文》：“𡞜，醜也。一曰老嫗也。从女，酋聲。讀若蹴。”', '27.EA7A': '《說文》：“媆，好皃。从女，耎聲。”', '27.5A37': '《說文》：“娷，諉也。从女，垂聲。”', '27.EA7E': '《說文》：“㛴，有所恨也。今汝南人有所恨曰㛴。”', '27.621F': '《說文》：“𢧢，有枝兵也。从戈、倝。《周禮》：𢧢長丈六尺。’讀若棘。”', '27.7435': '《說文新附》：“琵，琵琶，樂器。从珡，比聲。”', '27.7436': '《說文新附》：“琶，琵琶也。从珡，巴聲。”', '27.EA8C': '《說文》：“𠥐，古器也。从匚，倉聲。”', '27.74FB': '《說文新附》：“瓻，酒器。从瓦，稀省聲。”', '27.767C': '《說文》：“發，䠶發也。从弓，癹聲。”', '27.EAB6': '《說文》：“𥿪，絲曼延也。从糸，巟聲。”', '27.7D53': '《說文》：“絓，繭滓絓頭也。一曰以囊絮練也。从糸，圭聲。”', '27.EABA': '《說文》：“𥿮，樂浪挈令織。从糸，从式。”', '27.7D55': '《說文》：“絕，斷絲也。从糸，从刀，从卩。𢇍，古文絕，象不連體，絕二絲。”', '27.7D50': '《說文》：“結，締也。从糸，吉聲。”', '27.EAC4': '《說文》：“𥿯，散絲也。从糸，𠂢聲。”', '27.7D66': '《說文》：“給，相足也。从糸，合聲。”', '27.7D69': '《說文》：“絩，綺絲之數也。《漢律》曰：‘綺絲數謂之絩，布謂之總，綬組謂之首。’从糸，兆聲。”', '27.7D62': '《說文》：“絢，《詩》云：‘素以為絢兮。’从糸，旬聲。”', '27.EACA': '《說文》：“䋛，繡文如聚細米也。从糸，从米，米亦聲。”', '27.7D51': '《說文》：“絑，純赤也。《虞書》‘丹朱’如此。从糸，朱聲。”', '27.7D73': '《說文》：“絳，大赤也。从糸，夅聲。”', '27.7D2B': '《說文》：“紫，帛青赤色。从糸，此聲。”', '27.EACF': '《說文》：“絙，緩也。从糸，亘聲。”', '27.EAD2': '《說文》：“絝，脛衣也。从糸，夸聲。”', '27.EADC': '《說文》：“絬，《論語》曰：‘絬衣長，短右袂。’从糸，舌聲。”', '27.7D6D': '《說文》：“絭，攘臂繩也。从糸，聲。”', '27.7E3B': '《說文》：“縻，牛轡也。从糸，麻聲。𥿫，縻或从多。”', '27.EAEB': '《說文》：“絠，彈彄也。从糸，有聲。”', '27.7D6E': '《說文》：“絮，敝緜也。从糸，如聲。”', '27.7D61': '《說文》：“絡，絮也。一曰麻未漚也。从糸，各聲。”', '27.7E8A': '《說文》：“纊，絮也。从糸，廣聲。《春秋傳》曰：‘皆如挾纊。’絖，纊或从光。”', '27.7D58': '《說文》：“絘，績所緝也。从糸，次聲。”', '27.7D5F': '《說文》：“絟，細布也。从糸，全聲。”', '27.7D70': '《說文》：“絰，喪首戴也。从糸，至聲。”', '27.7D5C': '《說文》：“絜，麻一耑也。从糸，㓞聲。”', '27.7D63': '《說文》：“絣，氐人殊縷布也。从糸，并聲。”', '27.8801': '《說文》：“蠁，知聲蟲也。从虫，鄉聲。䖮，司馬相如嚮从向。”', '27.EB02': '《說文》：“蛕，腹中長蟲也。从虫，有聲。”', '27.86ED': '《說文》：“蛭，蟣也。从虫，至聲。”', '27.86E3': '《說文》：“蛣，蛣䖦，蝎也。从虫，吉聲。”', '27.86D3': '《說文》：“蛓，毛蟲也。从虫，𢦒聲。”', '27.86D9': '《說文》：“䖯，蠆也。从虫，圭聲。”', '27.86E2': '《說文》：“蛢，𧑐蟥，以翼鳴者。从虫，幷聲。”', '27.8729': '《說文》：“蜩，蟬也。从虫，周聲。《詩》曰：‘五月鳴蜩。’𧊓，蜩或从舟。”', '27.86DA': '《說文》：“蛚，蜻蛚也。从虫，列聲。”', '27.EB19': '《說文》：“𧊝，螫也。从虫，若省聲。”', '27.86D8': '《說文》：“蛘，搔蛘也。从虫，羊聲。”', '27.86DF': '《說文》：“蛟，龍之屬也。池魚滿三千六百，蛟來為之長，能率魚飛。置笱水中，即蛟去。从虫，交聲。”', '27.86E4': '《說文》：“𧊧，蜃屬。有三，皆生於海。千歲化為𧊧，秦謂之牡厲。又云，百歲燕所化。魁𧊧，一名復累，老服翼所化。从虫，合聲。”', '27.86EB': '《說文》：“蛫，蟹也。从虫，危聲。”', '27.EB21': '《說文》：“𧊜，似蜥易，長一丈，水潛，吞人即浮，出日南。从虫，屰聲。”', '27.EB22': '《說文》：“蛧，蛧蜽，山川之精物也。淮南王說蛧蜽狀如三歲小兒，赤黑色，赤目、長耳、美髮。从虫，网聲。《國語》曰：木石之怪夔、蛧蜽。”', '27.86E9': '《說文》：“蛩蛩，獸也。一曰，秦謂蟬蛻曰蛩。从虫，巩聲。”', '27.F0FD': '《說文》：“䖵，蟲之總名也。从二虫，讀若昆。”', '27.8821': '《說文》：“蠡，蟲齧木中也。从䖵，𧰲聲。𥯵，古文。”', '27.EDFA': '《說文》：“蝥，螌蝥也。从虫，敄聲。”', '27.9F9C': '《說文》：“龜，舊也，外骨內肉者也。从它，龜頭與它頭同，天地之性，廣肩無雄。龜鼈之類，以它為雄。象足、甲、尾之形。𠃾，古文龜。”', '27.EB4C': '《說文》：“鼄，䵹鼄也。从黽，朱聲。蛛，鼄或从虫。”', '27.5823': '《說文》：“堣，堣夷，在冀州陽谷，立春日，日值之而出。从土，禺聲。”', '27.EB52': '《說文》：“𡍦，土也。洛陽有大𡍦里。从土，軍聲。”', '27.581B': '《說文》：“堛，凷也。从土，畐聲。”', '27.EB54': '《說文》： “堫，穜也。一曰內其中也。从土，㚇聲。”', '27.5828': '《說文》：“堨，壁間隙也。从土，曷聲。”', '27.582A': '《說文》：“堪，地突也。从土，甚聲。”', '27.5848': '《說文》：“𡏲，仰涂也。”', '27.5824': '《說文》：“堤，滯也。从土，是聲。”', '27.57F5': '《說文》：“埵，堅土也。从土，𡍮聲。”', '27.EB6B': '《說文》：“𡍫，遏遮也。从土，則聲。”', '27.5834': '《說文》：“場，祭神道也；一曰田不耕；一曰治穀田也。从土，昜聲。”', '27.756C': '《說文》：“畬，三歲治田也。《易》曰：‘不葘畬田。’从田，余聲。”', '27.756F': '《說文》：“畯，農夫也。从田，夋聲。”', '27.7525': '《說文》：“甥，謂我𦥶（舅）者，吾謂之甥也。从男，生聲。”', '27.52F3': '《說文》：“勳，能成王功也。从力，熏聲。勛，古文勳从員。”', '27.52DD': '《說文》：“勝，任也。从力，朕聲。”', '27.52DE': '《說文》：“勞，劇也。从力，熒省。熒火燒冂，用力者勞。𢥒，古文勞从悉。”', '27.98ED': '《說文》：“飭，致堅也。从人，从力，食聲。讀若敕。”', '27.920F': '《說文》：“鈏，錫也。从金，引聲。”', '27.9203': '《說文》：“銒，似鍾而頸長。从金，幵聲。”', '27.9202': '《說文》：“鈂，臿屬。从金，冘聲。”', '27.9210': '《說文》：“鈐，鈐𨬍，大犂也。一曰類㭒。从金，今聲。”', '27.92B3': '《說文》：“銳，芒也。从金，兌聲。㓹，籀文銳，从厂、剡。”', '27.921E': '《說文》：“鈞，三十斤也。从金，勻聲。銞，古文鈞从旬。”', '27.9200': '《說文》：“鈀，兵車也。一曰鐵也。《司馬法》：‘晨夜內鈀車。’从金，巴聲。”', '27.9201': '《說文》：“鈁，方鐘也。从金，方聲。”', '27.EBB8': '《說文》：“釾，鏌釾也。从金，牙聲。”', '27.9212': '《說文》：“鈒，鋋也。从金，及聲。”', '27.9217': '《說文》：“鈗，侍臣所執兵也。从金、允聲。《周書》曰：‘一人冕，執鈗。’讀若允。”', '27.9207': '《說文》：“鈇，莝斫刀也。从金，夫聲。”', '27.9214': '《說文》：“鈔，叉取也。从金，少聲。”', '27.920C': '《說文》：“鈌，刺也。从金，夬聲。”', '27.EBBF': '《說文》：“鈋，吪圜也。从金，化聲。”', '27.920D': '《說文》：“鈍，錭也。从金，屯聲。”', '27.91FD': '《說文新附》：“釽，裂也。从金、爪。”', '27.91FF': '《說文》：“釿，劑斷也，从斤、金。”', '27.65AF': '《說文》：“斯，析也。从斤，其聲。《詩》曰：‘斧以斯之。’”', '27.65AE': '《說文》：“斮，斬也。从斤，昔聲。”', '27.659D': '《說文》：“斝，玉爵也。夏曰琖，殷曰斝，周曰爵。从吅，从斗，冂象形。”', '27.659E': '《說文》：“斞，量也。从斗，臾聲。”', '27.EBCC': '《說文》：“𣂆，量溢也。从斗，旁聲。”', '27.EBCF': '《說文》：“𣂀，斛旁有𣂀。从斗，𠩓聲。一曰突也。一曰利也。《尔疋》曰：‘𣂀謂之疀，古田器也。’”', '27.EBD1': '《說文》：“𥍫，矛屬。从矛，良聲。”', '27.8EFA': '《說文》：“軺，小車也。从車，召聲。”', '27.8EE8': '《說文》：“軨，車轖間橫木。从車，令聲。䡼，軨或从霝。司馬相如說。”', '27.8EEB': '《說文》：“軫，車後橫木也。从車，㐱聲。”', '27.8EF8': '《說文》：“軸，持輪也。从車，由聲。”', '27.8EF9': '《說文》：“軹，車輪小穿也。从車，只聲。”', '27.8EF6': '《說文》：“軶，轅前也。从車，戹聲。”', '27.8EE5': '《說文》：“軥，軶下曲者。从車，句聲。”', '27.8EF7': '《說文》：“軷，出將有事於道，必先告其神，立壇四通，樹茅以依神為軷。既祭軷，轢於牲而行為範軷。《詩》曰：‘取羝以軷。’从車，犮聲。”', '27.EBE9': '《說文》：“𨋚，轢也。从車，㞋聲。”', '27.8EFC': '《說文》：“軼，車相出也。从車，失聲。”', '27.8EFB': '《說文》：“軻，接軸車也。从車，可聲。”', '27.8EF5': '《說文》：“軵，反推車，令有所付也。从車，从付。讀若胥。”', '27.8F17': '《說文》：“輗，大車轅耑持衡者。从車，兒聲。𨌊，輗或从宐；棿，輗或从木。”', '27.8EE7': '《說文》：“軧，大車後也。从車，氐聲。”', '27.967D': '《說文》：“陽，高明也。从𨸏，昜聲。”', '27.9685': '《說文》：“隅，陬也。从𨸏，禺聲。”', '27.968A': '《說文》：“隊，從高隊也。从𨸏，㒸聲。”', '27.9689': '《說文》：“隉，危也。从𨸏，从毀省。徐巡以為：‘隉，凶也。’賈侍中說：‘隉，法度也。’班固說：‘不安也。’《周書》曰：‘邦之阢隉’。讀若虹蜺之蜺。”', '27.9684': '《說文》：“隄，唐也。从𨸏，是聲。”', '27.9688': '《說文》：“隈，水曲隩也。从𨸏，畏聲。”', '27.9683': '《說文》：“隃，北陵西隃鴈門是也。从𨸏，俞聲。”', '27.EC57': '《說文》：“𨺟，丘名。从𨸏，貞聲。”', '27.968E': '《說文》：“階，陛也。从𨸏，皆聲。”', '27.EF08': '《說文》：“䧘，道邊庳垣也。从𨸏，彖聲。”', '27.967E': '《說文》：“陾，築牆聲也。从𨸏，耎聲。《詩》云：‘捄之陾陾。’”', '27.968D': '《說文》：“隍，城池也。有水曰池；無水曰隍。从𨸏，皇聲。《易》曰：‘城復于隍。’”', '27.9672': '《說文》：“陲，危也。从𨸏，垂聲。”', '27.7D6B': '《說文》：“絫，增也。从厽，从糸。絫，十黍之重也。”', '27.EC20': '《說文》：“𢃳，𢱧擊也。从巴、帚。闕。”', '27.EC22': '《說文》：“辤，不受也。从辛，从受。受辛宜辤之。辝，籀文辭从台。”', '27.5B73': '《說文》：“孳，汲汲生也。从子，茲聲。𢀐，籀文孳从絲。”', '27.5B71': '《說文》：“孱，迮也。一曰呻吟也。从孨在尸下。”', '27.EC2F': '《說文》：“𨠒，酒疾孰也。从酉，弁聲。”', '27.9164': '《說文》：“酤，一宿酒也。一曰買酒也。从酉，古聲。”', '27.9163': '《說文》：“酣，酒樂也。从酉，从甘，甘亦聲。”', '27.91B5': '《說文》：“醵，會㱃酒也。从酉，豦聲。䣰，醵或从巨。”', '27.EC3E': '《說文》：“䣱，醉醟也。从酉，句聲。”', '27.9162': '《說文》：“酢，醶也。从酉，乍聲。”', '27.F05B': '《說文》：“𢍜，酒器也。从酋，廾以奉之。《周禮》六尊：犧尊、象尊、著尊、壺尊、太尊、山尊，以待祭祀賓客之禮。尊，或从寸。”', '27.797F': '《說文》：“祿，福也。从示，彔聲。”', '27.797A': '《說文》：“祺，吉也。从示，其聲。禥，籀文从基。”', '27.797C': '《說文》：“祼，灌祭也。从示，果聲。”', '27.7982': '《說文》：“禂，禱牲馬祭也。从示，周聲。《詩》曰：‘既禡既禂。’𩦑，或从馬，壽省聲。”', '27.7981': '《說文》：“禁，吉凶之忌也。从示，林聲。”', '27.745C': '《說文》：“瑜，瑾瑜，美玉也。从玉，俞聲。”', '27.E01A': '《說文》：“𤦃，𤦃瓄，玉也。从玉，來聲。”', '27.E01C': '《說文》：“㻝，玉也。从玉，剌聲。”', '27.745B': '《說文》：“瑛，玉光也。从玉，英聲。”', '27.7457': '《說文》：“瑗，大孔璧。人君上除陛以相引。从玉，爰聲。《爾雅》曰：‘好倍肉謂之瑗，肉倍好謂之璧。’”', '27.7452': '《說文》：“瑒，圭尺二寸，有瓚，以祠宗廟者也。从玉，昜聲。”', '27.745E': '《說文》：“瑞，以玉為信也。从玉、耑。”', '27.7451': '《說文》：“瑑，圭璧上起兆瑑也，从玉，篆省聲。《周禮》曰：‘瑑圭璧。’”', '27.7455': '《說文》：“瑕，玉小赤也。从玉，叚聲。”', '27.E029': '《說文》：“瑝，玉聲也。从玉，皇聲。”', '27.7440': '《說文》：“瑀，石之似玉者。从玉，禹聲。”', '27.7442': '《說文》：“瑂，石之似玉者。从玉，眉聲。讀若眉。”', '27.744E': '《說文》：“瑎，黑石似玉者。从玉，皆聲。讀若諧。”', '27.745A': '《說文》：“瑚，珊瑚也。从玉，胡聲。”', '27.7444': '《說文新附》：“瑄，璧六寸也。从玉，宣聲。”', '27.8475': '《說文》：“葵，菜也。从艸，癸聲。”', '27.8477': '《說文》：“葷，臭菜也。从艸，軍聲。”', '27.E058': '《說文》：“藼，令人亡憂艸也。从艸，憲聲。《詩》曰：‘安得藼艸。’蕿，或从煖；萱，或从宣。”', '27.844C': '《說文》：“葌，艸，出吳林山。从艸，姦聲。”', '27.8470': '《說文》：“葰，䕬屬，可以香口。从艸，俊聲。”', '27.8439': '《說文》：“菺，萹筑也，从艸扁聲。”', '27.E05F': '《說文》：“蒁，艸也。从艸，述聲。”', '27.8465': '《說文》：“葥，山苺也。从艸，歬聲。”', '27.E065': '《說文》：“𦳈，萵也。从艸，毗聲。”', '27.842D': '《說文》：“萭，艸也。从艸，禹聲。”', '27.842F': '《說文》：“萯，王萯也。从艸，負聲。”', '27.844D': '《說文》：“葍，䔰也。从艸，畐聲。”', '27.F0EC': '《說文》：“𦳝，艸。枝枝相值，葉葉相當。从艸，易聲。”', '27.8474': '《說文》：“葴，馬藍也。从艸，咸聲。”', '27.F0EB': '《說文》：“𦳋，艸也。从艸，㕟聲。”', '27.8434': '《說文》：“萴，烏喙也。从艸，則聲。”', '27.844E': '《說文》：“葎，艸也。从艸，律聲。”', '27.8451': '《說文》：“葑，須從也。从艸，封聲。”', '27.8429': '《說文》：“萩，蕭也。从艸，秋聲。”', '27.848D': '《說文》：“蒍，艸也。从艸，為聲。”', '27.845B': '《說文》：“葛，絺綌艸也。从艸，曷聲。”', '27.847D': '《說文》：“葽，艸也。从艸，要聲。《詩》曰：‘四月秀葽。’劉向說：此味苦，苦葽也。”', '27.E090': '《說文》：“䓴，木耳也。从艸，耎聲。一曰萮茈。”', '27.845A': '《說文》：“葚，桑實也。从艸，甚聲。”', '27.8449': '《說文》：“葉，艸木之葉也。从艸，枼聲。”', '27.8469': '《說文》：“葩，華也。从艸，皅聲。”', '27.E095': '《說文》：“葼，青、齊、沇、冀謂木細枝曰葼。从艸，㚇聲。”', '27.8507': '《說文》：“蔇，艸多皃。从艸，既聲。”', '27.E09D': '《說文》：“䓮，細草叢生也。从艸，敄聲。”', '27.F0E5': '《說文》：“葻，艸得風皃。从艸、風，讀若婪。”', '27.843D': '《說文》：“落，凡艸曰零，木曰落。从艸，洛聲。”', '27.E0A4': '《說文》：“𦳙，艸大也。从艸，致聲。”', '27.847A': '《說文》：“葺，茨也。从艸，咠聲。”', '27.84CB': '《說文》：“葢，苫也。从艸，盇聲。”', '27.E0B6': '《說文》：“𦳚，艸也。从艸，是聲。”', '27.E0BD': '《說文》：“𦳊，糞也。从艸，胃省。”', '27.8460': '《說文》：“𦺭，喪籍也。从艸，㑴聲。”', '27.84F1': '《說文》：“蓱，苹也。从艸，洴聲。”', '27.8466': '《說文》：“葦，大葭也。从艸，韋聲。”', '27.846D': '《說文》：“葭，葦之未秀者。从艸，叚聲。”', '27.843A': '《說文》：“萺，艸也。从艸，冒聲。”', '27.8446': '《說文》：“葆，艸盛皃。从艸，保聲。”', '27.E0C9': '《說文》：“葏，艸皃。从艸，津聲。”', '27.846C': '《說文》：“葬，藏也。从死在茻中。一其中，所以薦之。《易》曰：‘古之葬者，厚衣之以薪。’”', '27.8A79': '《說文》：“詹，多言也。从言，从八，从厃。”', '27.728D': '《說文》：“犍，犗牛也。从牛，建聲。亦郡名。”', '27.55CC': '《說文》：“嗌，咽也。从口，益聲。𠍳，籀文嗌，上象口，下象頸脈理也。”', '27.55DB': '《說文》：“嗛，口有所銜也。从口，兼聲。”', '27.E0EA': '《說文》：“㗘，噍皃。从口，尃聲。”', '27.55D4': '《說文》：“嗔，盛气也。从口，真聲。《詩》曰：‘振旅嗔嗔。’”', '27.55C2': '《說文》：“嗂，喜也。从口，䍃聲。”', '27.55E2': '《說文》：“嗢，咽也。从口，𥁕聲。”', '27.55DC': '《說文》：“嗜，嗜欲，喜之也。从口，耆聲。”', '27.55D1': '《說文》：“嗑，多言也。从口，盍聲。”', '27.55D9': '《說文》：“嗙，謌聲。嗙喻也。从口，旁聲。”', '27.E108': '《說文》：“嗁，號也。”', '27.55C0': '《說文》：“嗀，歐皃。从口，㱿聲。《春秋傳》曰：‘君將嗀之。’”', '27.55E5': '《說文》：“嗥，咆也。从口，臯聲。獆，譚長說嘷从犬。”', '27.55C3': '《說文新附》：“嗃，嗃嗃，嚴酷皃。从口，高聲。”', '27.E119': '《說文》：“䞪，行皃。从走，匠聲。讀如匠。”', '27.E120': '《說文》：“䞥，走也。从走，有聲，讀若又。”', '27.E125': '《說文》：“𧺼，淺渡也。从走，此聲。”', '27.8D8C': '《說文》：“趌，趌𧼨，怒走也。从走，吉聲。”', '27.8D8D': '《說文》：“趍，趍趙，久也。从走，多聲。”', '27.8D91': '《說文》：“趑，趑趄，行不進也。从走，次聲。”', '27.E13D': '《說文》：“趚，側行也。从走，朿聲。《詩》曰：‘謂地蓋厚，不敢不趚。’”', '27.E13E': '《說文》：“䞨，半步也。从走，圭聲。”', '27.E143': '《說文》：“𧻚，𧻚田，易居也。从走，亘聲。”', '27.8D92': '《說文》：“趒，雀行也。从走，兆聲。”', '27.E148': '《說文》：“歱，跟也。从止，重聲。”', '27.6B72': '《說文》：“歲，木星也。越歷二十八宿，宣徧陰陽，十二月一次。从步，戌聲。律歷書名五星為五步。”', '27.5C1F': '《說文》：“尟，是少也。尟俱存也。从是、少，賈侍中說。”', '27.904E': '《說文》：“過，度也。从辵，咼聲。”', '27.903E': '《說文》：“逾，𨒋進也。从辵，俞聲。《周書》曰：‘無敢昬逾。’”', '27.9044': '《說文》：“遄，往來數也。从辵，耑聲。《易》曰：‘㠯事遄往。’”', '27.9047': '《說文》：“遇，逢也。从辵，禺聲。”', '27.907B': '《說文》：“遻，相遇驚也。从㖾，㖾亦聲。”', '27.904B': '《說文》：“運，迻徙也。从辵，軍聲。”', '27.9041': '《說文》：“遁，遷也。一曰逃也。从辵，盾聲。”', '27.9055': '《說文》：“違，離也。从辵，韋聲。”', '27.904F': '《說文》：“遏，微止也。从辵，曷聲。讀若桑蟲之蝎。”', '27.E183': '《說文》：“𨔣，𨔣互，令不得行也。从辵，枷聲。”', '27.E187': '《說文》：“𨔥，目進極也。从辵，𦘔聲。”', '27.9053': '《說文》：“道，所行道也。从辵，从𩠐。一達謂之道。𡬹，古文道从𩠐、寸。”', '27.9051': '《說文新附》：“遑，急也。从辵，皇聲。或从彳。”', '27.903C': '《說文新附》：“逼，近也。从辵，畐聲。”', '27.9050': '《說文新附》：“遐，遠也。从辵，叚聲。”', '27.5FAE': '《說文》：“微，隱行也。从彳，𣁋聲。《春秋傳》曰：‘白公其徒微之。’”', '27.5FAF': '《說文》：“徯，待也。从彳，奚聲。蹊，徯或从足。”', '27.8859': '《說文》：“衙，行皃。从行，吾聲。”', '27.E1BA': '《說文》：“𤘐，齒蠹也。从牙，禹聲。齲，𤘐或从齒。”', '27.8DEA': '《說文》：“跪，拜也。从足，危聲。”', '27.8DE7': '《說文》：“跧，蹴也。一曰卑也；絭也。从足，全聲。”', '27.8DE8': '《說文》：“跨，渡也。从足，夸聲。”', '27.8DF3': '《說文》：“跳，蹶也。从足，兆聲。一曰躍也。”', '27.8DF2': '《說文》：“跲，躓也。从足，合聲。”', '27.8DE3': '《說文》：“跣，足親地也。从足，先聲。”', '27.8DEF': '《說文》：“路，道也。从足，从各。”', '27.55BF': '《說文》：“喿，鳥羣鳴也。从品在木上。”', '27.9264': '《說文》：“鉤，曲也。从金，从句，句亦聲。”', '27.8A75': '《說文》：“詵，致言也。从言，从先，先亦聲。《詩》曰：‘螽斯羽詵詵兮。’”', '27.8A7B': '《說文》：“詻，論訟也。傳曰：‘詻詻孔子容。’从言，各聲。”', '27.8A73': '《說文》：“詳，審議也。从言，羊聲。”', '27.E1EE': '《說文》：“詧，言微親詧也。从言，察省聲。”', '27.8AA0': '《說文》：“誠，信也。从言，成聲。”', '27.8AA5': '《說文》：“誥，告也。从言，告聲。𧧙，古文誥。”', '27.8A66': '《說文》：“試，用也。从言，式聲。《虞書》曰：‘明試以功。’”', '27.8A6E': '《說文》：“詮，具也。从言，全聲。”', '27.E1F4': '《說文》：“詥，諧也。从言，合聲。”', '27.8A71': '《說文》：“䛡，合會善言也。从言，𠯑聲。《傳》曰：‘告之話言。’譮，籀文䛡从會。”', '27.8A61': '《說文》：“詡，大言也。从言，羽聲。”', '27.8A77': '《說文》：“詷，共也。一曰譀也。从言，同聲。《周書》曰：‘在夏后之詷。’”', '27.8A63': '《說文》：“詣，𠋫至也。从言，旨聲。”', '27.8A76': '《說文》：“詶，譸也。从言，州聲。”', '27.8A83': '《說文》：“誃，離別也。从言，多聲。讀若《論語》‘跢予之足’。周景王作洛陽誃臺。”', '27.8A7F': '《說文》：“詿，誤也。从言，圭聲。”', '27.E202': '《說文》：“詯，膽氣滿，聲在人上。从言，自聲。讀若反目相睞。”', '27.8A3E': '《說文》：“訾，不思稱意也。从言，此聲。《詩》曰：‘翕翕訿訿’。”', '27.8A82': '《說文》：“誂，相呼誘也。从言，兆聲。”', '27.8A87': '《說文》：“誇，譀也。从言，夸聲。”', '27.E210': '《說文》：“詪，眼戾也。从言，𥃩聲。”', '27.E218': '《說文》：“詤，夢言也。从言，㠩聲。”', '27.E221': '《說文》：“䛗，訐也。从言，臣聲。讀若指。”', '27.E223': '《說文》：“𧧒，數諫也。从言，朿聲。”', '27.8A70': '《說文》：“詰，問也。从言，吉聲。”', '27.8A6D': '《說文》：“詭，責也。从言，危聲。”', '27.8A85': '《說文》：“誅，討也。从言，朱聲。”', '27.8A84': '《說文》：“誄，諡也。从言，耒聲。”', '27.8A72': '《說文》：“該，軍中約也。从言，亥聲。讀若‘心中滿該’。”', '27.8A62': '《說文新附》：“詢，謀也。从言，旬聲。”', '27.696D': '《說文》：“業，大版也，所以飾縣鍾鼓，捷業如鋸齒，以白畫之，象其鉏鋙相承也。从丵，从巾，巾象版。《詩》曰：‘巨業維樅。’𤑽，古文業。”', '27.8FB2': '《說文》：“䢉，耕也。从䢅，囟聲。𨑋，籀文䢉从林。𦦥，古文䢉；辳，亦古文䢉。”', '27.9778': '《說文》：“靸，小兒履也。从革，及聲。讀若沓。”', '27.E247': '《說文》：“䩕，䩕角，鞮屬。从革，卬聲。”', '27.9776': '《說文》：“靶，轡革也。从革，巴聲。”', '27.9773': '《說文》：“靳，當膺也。从革，斤聲。”', '27.9777': '《說文》：“靷，引軸也。从革，引聲。𩍫，籀文靷。”', '27.9772': '《說文》：“靲，鞮也。从革，今聲。”', '27.F0A0': '《說文》：“𩰫，秦名土釜曰𩰫。从鬲，㐄聲。”', '27.EC54': '《說文》：“𠭯，又𤰞也。从又，虘聲。”', '27.E28E': '《說文》：“𠭰，引也。从又，𠩺聲。”', '27.EDBD': '《說文》：“𢄥，習也。从𦘒，㣇聲。𨽼，籀文𢄥。肄，篆文𢄥。”', '27.6BC4': '《說文》：“毄，相擊中也。如車相擊，故从殳，从軎。”', '27.5F12': '《說文》：“弒，臣殺君也。《易》曰：‘臣弒其君。’从殺省，式聲。”', '27.9CE7': '《說文》：“鳧，舒鳧，鶩也。从鳥，几聲。”', '27.E2C4': '《說文》：“𢾁，戾也。从攴，韋聲。”', '27.E2C9': '《說文》：“𢾅，閉也。从攴，度聲。讀若杜。剫，𢾅或从刀。”', '27.EE8C': '《說文》：“鼔。擊鼓也。从攴，从壴，壴亦聲。”', '27.668B': '《說文》：“暋，冒也。从攴，昬聲。”', '27.E2E3': '《說文》：“𥇖，大目也。从目，非聲。”', '27.E2E4': '《說文》：“䁂，大目也。从目，臤聲。”', '27.7754': '《說文》：“睔，目大也。从目、侖。《春秋傳》有鄭伯睔。”', '27.7752': '《說文》：“睒，暫視皃。从目，炎聲。讀若白蓋謂之苫相似。”', '27.7768': '《說文》：“睨，衺視也。从目，兒聲。”', '27.778F': '《說文》：“瞏，目驚視也。从目，袁聲。《詩》曰：‘獨行瞏瞏。’”', '27.7779': '《說文》：“睹，見也。从目，者聲。覩，古文从見。”', '27.E2F6': '《說文》：“𥇜，謹鈍目也。从目，𦎧聲。”', '27.7762': '《說文》：“睢，仰目也。从目，隹聲。”', '27.E2FB': '《說文》：“䁈，省視也。从目，啟省聲。”', '27.EDBB': '《說文》：“睗，目疾視也。从目，易聲。”', '27.7763': '《說文》：“督，察也。一曰目痛也。从目，叔聲。”', '27.775E': '《說文》：“睞，目童子不正也。从目，來聲。”', '27.7769': '《說文》：“睩，目睞謹也。从目，彔聲。讀若鹿。”', '27.775A': '《說文新附》：“睚，目際也。从目、厓。”', '27.F4B4': '《說文》：“𥆞，目圍也。从䀠、。讀若書卷之卷，古文以為醜字。”', '27.F4B6': '《說文》：“𥇛，目衺也。从䀠，从大。大，人也。”', '27.7FDC': '《說文》：“翜，捷也，飛之疾也。从羽，夾聲。讀若濇，一曰俠也。”', '27.96C9': '《說文》：“雉，有十四種：盧諸雉、喬雉、鳪雉、鷩雉、秩秩海雉、翟山雉、翰雉、卓雉，伊洛而南曰翬，江淮而南曰搖，南方曰𢏚，東方曰甾，北方曰稀，西方曰蹲。从隹，矢聲。𨿘，古文雉，从弟。”', '27.96CA': '《說文》：“雊，雄雌鳴也。雷始動，雉鳴而雊其頸。从隹，从句，句亦聲。”', '27.EDED': '《說文》：“𨿳，鳥也。从隹，瘖省聲。或从人，人亦聲。𪇿，籀文𨿳从鳥。”', '27.E31E': '《說文》：“鴟，𨿠也。从隹，氐聲。鴟，籀文鴟从鳥。”', '27.96CD': '《說文》：“雝，雝𪆫也。”', '27.E321': '《說文》：“𨾯，牟母也。从隹，奴聲。鴑，𨾯或从鳥。”', '27.E32C': '《說文》：“䍜，覆鳥令不飛走也。从网、隹。讀若到。”', '27.96CB': '《說文》：“雋，肥肉也。从弓所以射隹。長沙有下雋縣。”', '27.596A': '《說文》：“𡙜，手持隹失之也。从又，从㚝。”', '27.E330': '《說文》：“𤊾，火不明也。从苜，从火，苜亦聲。”', '27.7FA5': '《說文》：“羥，羊名。从羊，巠聲。”', '27.7FA4': '《說文》：“羣，輩也。从羊，君聲。”', '27.9CE9': '《說文》：“鳩，鶻鵃也。从鳥，九聲。”', '27.F5F4': '《說文》：“敫，光景流也。从白，从放，讀若龠。”', '27.E376': '《說文》：“㱪，瞀也。从歺，昬聲。”', '27.6B9B': '《說文》：“殛，殊也。从歺，亟聲。《虞書》曰：‘殛于羽山。’”', '27.E385': '《說文》：“㗗，別也。从冎，卑聲。”', '27.9AAD': '《說文》：“骭，骹也。从骨，干聲。”', '27.9AAB': '《說文》：“骫，骨耑骫奊也。从骨，丸聲。”', '27.815C': '《說文》：“腜，婦始孕腜兆也。从肉，某聲。”', '27.8178': '《說文》：“腸，大小腸也。从肉，昜聲。”', '27.8179': '《說文》：“腹，厚也。从肉，复聲。”', '27.8173': '《說文》：“腳，脛也。从肉，卻聲。”', '27.E393': '《說文》：“腨，腓腸也。从肉，耑聲。”', '27.E396': '《說文》：“𦝨，臞也。从肉，皆聲。”', '27.8144': '《說文》：“腄，瘢胝也。从肉，垂聲。”', '27.816B': '《說文》：“腫，癰也。从肉，重聲。”', '27.E39C': '《說文》：“腬，嘉善肉也。从肉，柔聲。”', '27.816F': '《說文》：“腯，牛羊曰𦘺，豕曰腯。从肉，盾聲。”', '27.E3A0': '《說文》：“𦝭，血祭肉也。从肉，帥聲。膟，𦝭或从率。”', '27.E3A5': '《說文》：“腝，有骨醢也。从肉，耎聲。臡，腝或从難。”', '27.8165': '《說文》：“腥，星見食豕，令肉中生小息肉也。从肉，从星，星亦聲。”', '27.E3AD': '《說文》：“䐑，薄切肉也。从肉，枼聲。”', '27.F4B5': '《說文》：“𦝠，或曰嘼名。象形”', '27.527A': '《說文》：“剺，剝也；劃也。从刀，𠩺聲。”', '27.527D': '《說文》：“剽，砭刺也。从刀，𤐫聲。一曰剽，劫人也。”', '27.E3C9': '《說文》：“㓼，傷也。从刀，桼聲。”', '27.F4B9': '《說文》：“魝，楚人謂治魚也。从刀，从魚。讀如鍥。”', '27.8021': '《說文》：“耡，商人七十而耡。耡，耤，稅也。从耒，助聲。《周禮》曰：‘以興耡利萌。’”', '27.89E0': '《說文》：“觠，曲角也。从角，聲。”', '27.89E2': '《說文》：“觢，一角仰也。从角，㓞聲。《易》曰：‘瑯牛觢’。”', '27.89E4': '《說文》：“觤，羊角不齊也。从角，危聲。”', '27.89DF': '《說文》：“觟，牝牂羊生角者也。从角，圭聲。”', '27.89E1': '《說文》：“觡，骨角之名也。从角，各聲。”', '27.89DC': '《說文》：“觜，鴟舊頭上角觜也。一曰觜觿也。从角，此聲。”', '27.89E3': '《說文》：“解，判也。从刀判牛角。一曰解廌，獸也。”', '27.E3DD': '《說文》：“觵，兕牛角可以飲者也。从角，黃聲。其狀觵觵，故謂之觵。觥，俗觵从光。”', '27.E3E1': '《說文》：“䚙，角匕也。从角，亘聲。讀若讙。”', '27.7B71': '《說文》：“筱，箭屬，小竹也。从竹，攸聲。”', '27.7BC0': '《說文》：“節，竹約也。从竹，即聲。”', '27.7B61': '《說文》：“筡，折竹笢也。从竹，余聲。讀若絮。”', '27.7B6E': '《說文》：“𥷂，《易》卦用蓍也。从竹，从𢍮。𢍮，古文巫字。”', '27.E3F1': '《說文》：“䇫，取蟣比也。从竹，𦣞聲。”', '27.7B73': '《說文》：“筵，繀絲筦也。从竹，廷聲。”', '27.7B66': '《說文》：“筦，筟也。从竹，完聲。”', '27.E3F4': '《說文》：“筟，筳也。从竹，孚聲，讀若《春秋》‘魯公子彄’。”', '27.7B65': '《說文》：“筥，䈰也。从竹，呂聲。”', '27.7B64': '《說文》：“筤，籃也。从竹，良聲。”', '27.E3FD': '《說文》：“䈀，竹器也。从竹，刪聲。”', '27.7B69': '《說文》：“筩，斷竹也。从竹，甬聲。”', '27.7B70': '《說文》：“筰，筊也。从竹，作聲。”', '27.7BFD': '《說文》：“篽，禁苑也。从竹，御聲。《春秋傳》曰：‘澤之目篽。’𩵎，篽或从又，魚聲。”', '27.7B6D': '《說文》：“筭，長六寸，計歷數者。从竹，从弄。言常弄乃不誤也。”', '27.7B60': '《說文新附》：“筠，竹皮也。从竹，均聲。”', '27.865F': '《說文》：“號，呼也。从号，从虎。”', '27.7CB5': '《說文》：“粵，亏也。審慎之詞者。从亏，从宷。《周書》曰：‘粵三日丁亥。’”', '27.9F13': '《說文》：“鼓，郭也。春分之音，萬物郭皮甲而出，故謂之鼓。从壴。支，象其手擊之也。《周禮》：‘六鼓：靁鼓八面，靈鼓六面，路鼓四面，鼖鼓、皐鼓、晉鼓皆兩面。’𪔐，籀文鼓。从古聲。”', '27.6137': '《說文》：“愷，樂也。从心，豈聲。”', '27.E439': '《說文》：“𧯦，豆屬。从豆，𨤑聲。”', '27.8C4B': '《說文》：“豋，禮器也。从廾，持肉在豆上。讀若鐙同。”', '27.8C4A': '《說文》：“豊，行禮之器也。从豆，象形。讀與禮同。”', '27.F5C6': '《說文》：“䖒，古陶器也。从豆，虍聲。”', '27.865E': '《說文》：“虞，騶虞也。白虎黑文，尾長於身。仁獸，食自死之肉。从虍，吳聲。《詩》曰：‘于嗟乎騶虞’。”', '27.E446': '《說文》：“䖔，䖑屬。从虎，去聲。”', '27.E456': '《說文》：“𡕮，去也。从去，夌聲。讀若陵。”', '27.98F4': '《說文》：“飴，米糱煎也。从食，台聲。𩛛，籀文飴，从異省。”', '27.E47D': '《說文》：“飵，楚人相謁食麥曰飵。从食，乍聲。”', '27.E47E': '《說文》：“䬯，相謁食麥也。从食，占聲。”', '27.98F6': '《說文》：“飶，食之香也。从食，必聲。《詩》曰：‘有飶其香。’”', '27.98FD': '《說文》：“飽，猒也。从食，包聲。𩜿，古文飽，从𤓽。𩛁，亦古文飽，从卯聲。”', '27.E485': '《說文》：“飻，貪也。从食，殄省聲。《春秋傳》曰：‘謂之饕飻。’”', '27.E486': '《說文》：“𩚬，飢也。从食，戹聲。獨若楚人言恚人。”', '27.E489': '《說文》：“䬴，食馬穀也。从食，末聲。”', '27.50C9': '《說文》：“僉，皆也。从亼，从吅，从从。”', '27.77EE': '《說文新附》：“矮，短人也。从矢，委聲。”', '27.7A1F': '《說文》：“稟，賜穀也。从㐭，从禾。”', '27.4EB6': '《說文》：“亶，多穀也。从㐭，旦聲。”', '27.55C7': '《說文》：“嗇，愛濇也。从來，从㐭。來者㐭而藏之，故田夫謂之嗇夫。𤲷，古文嗇从田。”', '27.821D': '《說文》：“舝，車軸耑鍵也。兩穿相背，从舛，𥜿省聲。𥜿，古文偰字。”', '27.E4BC': '《說文》：“𤯷，華榮也。从舜，生聲。讀若皇。《爾雅》曰：‘𤯷華也。’葟，𤯷或从艸、皇。”', '27.63EB': '《說文》：“揫，束也。从手，秋聲。《詩》曰：‘百禄是揫。’”', '27.E4CA': '《說文》：“㮘，冬桃。从木，敄聲。讀若髦。”', '27.6977': '《說文》：“楷，木也，孔子冢蓋樹之者。从木，皆聲。”', '27.6932': '《說文》：“椲，木也，可屈為杅者。从木，韋聲。”', '27.6962': '《說文》：“楢，柔木也。工官以為耎輪。从木，酋聲。讀若糗。”', '27.6948': '《說文》：“楈，木也。从木，胥聲。讀若芟刈之芟。”', '27.6951': '《說文》：“楑，木也。从木，癸聲。又度也。”', '27.6940': '《說文》：“楀，木也。从木，禹聲。”', '27.E4D4': '《說文》：“椶，栟櫚也，可作萆。从木，㚇聲。”', '27.6978': '《說文》：“楸，梓也。从木，秋聲。”', '27.E4DD': '《說文》：“𣔾，羅也。从木，㒸聲。《詩》曰：‘隰有樹𣔾。’”', '27.6935': '《說文》：“椵，木，可作牀几。从木，叚聲。讀若賈。”', '27.695B': '《說文》：“楛，木也。从木，苦聲。《詩》曰：‘榛苦濟濟。’”', '27.694B': '《說文》：“楋，木也。从木，剌聲。”', '27.694A': '《說文》：“楊，木也。从木，昜聲。”', '27.6953': '《說文》：“楓，木也，厚葉，弱枝，善搖。一名𣠞。从木，風聲。”', '27.695D': '《說文》：“楝，木也。从木，柬聲。”', '27.6986': '《說文》：“榆，白枌。从木，俞聲。”', '27.6A39': '《說文》：“樹，生植之緫名。从木，尌聲。尌，籀文。”', '27.E4FD': '《說文》：“𣔵，木葉陊也，从木㲋聲，讀若薄。”', '27.6968': '《說文》：“楨，剛木也。从木，貞聲。上郡有楨林縣。”', '27.6975': '《說文》：“極，棟也。从木，亟聲。”', '27.6979': '《說文》：“楹，柱也。从木，盈聲。《春秋傳》曰：‘丹桓宮楹。’”', '27.6976': '《說文》：“㮞，欂櫨也。从木，咨聲。”', '27.693D': '《說文》：“椽，榱也。从木，彖聲。”', '27.6963': '《說文》：“楣，秦名屋𣝼聯也。齊謂之檐，楚謂之梠。从木，眉聲。”', '27.696F': '《說文》：“楯，闌檻也。从木，盾聲。”', '27.6933': '《說文》：“椳，門樞謂之椳。从木，畏聲。”', '27.E506': '《說文》：“𣔺，門樞之横梁。从木，冒聲。”', '27.698D': '《說文》：“𣕋，限也，从木㞕聲。”', '27.6957': '《說文》：“楗，限門也。从木，建聲。”', '27.6954': '《說文》：“楔，櫼也。从木，契聲。”', '27.E508': '《說文》：“楃，木帳也。从木，屋聲。”', '27.E509': '《說文》：“楲，楲窬，褻器也。从木，威聲。”', '27.694E': '《說文》：“楎，六叉犂。一曰犂上曲木，犂轅。从木，軍聲。讀若渾天之渾。”', '27.6982': '《說文》：“㮣，𣏙斗斛。从木，既聲。邵瑛羣經正字：“今經典多作概。”', '27.E510': '《說文》：“㮐，木參交以枝炊䉛者也。从木，省聲。讀若驪駕。”', '27.6937': '《說文》：“椷，篋也。从木，咸聲。”', '27.69BC': '《說文》：“榼，酒器也。从木，盍聲。”', '27.E51A': '《說文》：“椱，機持繒者。从木，复聲。”', '27.6965': '《說文》：“楥，履法也。从木，爰聲。讀若指撝。”', '27.692F': '《說文》：“椯，箠也。从木，耑聲。一曰椯度也，一曰剟也。”', '27.6958': '《說文》：“楘，車歷錄束文也。从木，敄聲。《詩》曰：‘五楘梁輈。’”', '27.E523': '《說文》：“楇，盛膏器。从木，咼聲。讀若過。”', '27.E526': '《說文》：“𣔱，船緫名。从木，叜聲。”', '27.696B': '《說文》：“楫，舟櫂也。从木，咠聲。”', '27.6944': '《說文》：“楄，楄部，方木也。从木，扁聲。《春秋傳》曰：‘楄部薦榦’。”', '27.6945': '《說文》：“楅，以木有所逼束也。从木，畐聲。《詩》曰：‘夏而楅衡。’”', '27.696C': '《說文》：“楬，楬桀也。从木，曷聲。《春秋傳》曰：‘楬而書之。’張文虎舒藝室隨筆：“‘楬’與‘桀’義通。疑說解以‘桀’訓‘楬’，衍一‘楬’字耳。段據《韵會》引及趙凡夫鈔本，近刻《五音韵譜》改為‘楬櫫’，不如兩存之。”', '27.6938': '《說文新附》：“椸，衣架也。从木，施聲。”', '27.695A': '《說文》：“楚，叢木。一名荊也。从林，疋聲。”', '27.6959': '《說文》：“楙，木盛也。从木，矛聲。“”', '27.E542': '《說文》：“𢆞，小束也。从束，幵聲。”', '27.5713': '《說文》：“圓，圜。全也。从囗，員聲，讀若員。”', '27.58FC': '《說文》：“𡈋，宮中道。从囗，象宮垣道上之形。《詩》曰：室家之壼。”', '27.5712': '《說文》：“園，所以樹果也。从囗，袁聲。”', '27.8CC4': '《說文》：“賄，財也。从貝，有聲。”', '27.8CC7': '《說文》：“資，貨也。从貝，次聲。”', '27.8CC2': '《說文》：“賂，遺也。从貝，各聲。”', '27.8CC8': '《說文》：“賈，賈市也。从貝，襾聲。一曰坐賣售也。”', '27.8CC3': '《說文》：“賃，庸也。从貝，任聲。”', '27.8CB2': '《說文》：“貲，小罰以財自贖也。从貝，此聲。漢律，民不繇貲錢二十二。”', '27.910F': '《說文》：“鄏，河南縣直城門官陌地也。从邑，辱聲。《春秋傳》曰：‘成王定鼎于郟鄏。’”', '27.910D': '《說文》：“鄍，晉邑也。从邑，冥聲。《春秋傳》曰：‘伐鄍三門。’”', '27.9110': '《說文》：“鄐，晉邢矦邑。从邑，畜聲。”', '27.E564': '《說文》：“𨜻，河東聞喜縣。从邑，虔聲。”', '27.9114': '《說文》：“鄔，太原縣。从邑，烏聲。”', '27.9117': '《說文》：“鄗，常山縣。世祖所即位，今為高邑。从邑，高聲。”', '27.910E': '《說文》：“鄎，姬姓之國。在淮北。从邑，息聲。今汝南新鄎。”', '27.E567': '《說文》：“𨜷，汝南鮦陽亭。从邑，旁聲。”', '27.9116': '《說文》：“鄖，漢南之國。从邑，員聲。漢中有鄖關。”', '27.E573': '《說文》：“䣕，存䣕，犍為縣。从邑，馬聲。”', '27.9111': '《說文》：“鄑，宋、魯間地。从邑，晉聲。”', '27.9112': '《說文》：“鄒，魯縣，古邾國，帝顓頊之後所封。从邑，芻聲。”', '27.E581': '《說文》：“𨚵，故國，在陳留。从邑，𢦒聲。”', '27.E597': '《說文》：“暏，旦明也。从日，者聲。”', '27.6698': '《說文》：“暘，日出也。从日，昜聲。”', '27.6689': '《說文》：“暉，光也。从日，軍聲。”', '27.6686': '《說文》：“暆，日行暆暆也。从日，施聲。”', '27.6697': '《說文》：“暗，日無光也。从日，音聲。”', '27.6687': '《說文》：“暇，閑也。从日，叚聲。”', '27.668D': '《說文》：“暍，傷暑也。从日，曷聲。”', '27.6688': '《說文新附》：“暈，日月气也。从日，軍聲。”', '27.E5A8': '《說文》：“㫍，旌旗之流也。从㫃，攸聲。”', '27.865C': '《說文》：“虜，獲也。从毌，从力，虍聲。”', '27.E5C7': '《說文》：“𤗚，判也。从片，畐聲。”', '27.7252': '《說文》：“牒，札也。从片，枼聲。”', '27.E5C8': '《說文》：“牑，牀版也。从片，扁聲。讀若邊。”', '27.724F': '《說文》：“牏，築牆短版也。从片，俞聲。讀若俞。一曰若紐。”', '27.9F0E': '《說文》：“鼎，三足兩耳，和五味之寶器也。昔禹收九牧之金，鑄鼎荊山之下。入山林川澤，螭魅蝄蜽，莫能逢之，以協承天休。《易》卦，巽木於（火）下者為鼎，象析木以炊也。籀文以鼎為貞字。”', '27.7A19': '《說文》：“稙，早穜也。从禾，直聲。《詩》曰：‘稙稚尗麥’。”', '27.7A11': '《說文》：“稑，疾孰也。从禾，坴聲。《詩》曰：‘黍稷種稑’。穋，稑或从翏。”', '27.7A20': '《說文》：“稠，多也。从禾，周聲。”', '27.7A17': '《說文》：“稗，禾別也。从禾，卑聲。琅邪有稗縣。”', '27.E5D3': '《說文》：“䅘，齊謂麥䅘也。从禾，來聲。”', '27.7A1B': '《說文》：“稛，絭束也。从禾，囷聲。”', '27.7A1E': '《說文》：“稞，穀之善者。从禾，果聲。一曰無皮穀。”', '27.7A14': '《說文》：“稔，穀孰也。从禾，念聲。《春秋傳》曰：‘鮮不五稔’。”', '27.7A18': '《說文》：“稘，復其時也。从禾，其聲。《虞書》曰：‘稘三百有六旬。’”', '27.7A15': '《說文新附》：“稕，束稈也。从禾，𦎧聲。”', '27.9ECE': '《說文》：“𪏯，履黏也。从黍，𥝢省聲。𥝢，古文利。作履黏以黍米。”', '27.7CB1': '《說文》：“粱，米名也。从米，梁省聲。”', '27.5967': '《說文》：“奧，宛也。室之西南隅。从宀，𢍏聲。”', '27.5BF6': '《說文》：“寶，珍也。从宀，从王，从貝，缶聲。寚，古文寶省貝。”', '27.E629': '《說文》：“𡩡，入家𢯱（搜）也。从宀，索聲。”', '27.5BD8': '《說文新附》：“寘，置也。从宀，真聲。”', '27.7AA0': '《說文》：“窠，空也。穴中曰窠，樹上曰巢。从穴，果聲。”', '27.7A9E': '《說文》：“窞，坎中小坎也。从穴，从臽，臽亦聲。《易》曰：‘入於坎窞。’一曰㫄入也。”', '27.F0E1': '《說文》：“窡，穴中見也。从穴，叕聲。”', '27.7AA3': '《說文》：“窣，从穴中卒出。从穴，卒聲。”', '27.E63F': '《說文》：“㝥，寐而未厭。从㝱省，米聲。”', '27.760F': '《說文》：“瘏，病也。从疒，者聲。《詩》曰：‘我馬瘏矣。’”', '27.E648': '《說文》：“𤷇，頭痛也。从疒，或聲。讀若溝洫之洫。”', '27.7600': '《說文》：“瘀，積血也。从疒，於聲。”', '27.75F5': '《說文》：“痵，气不定也。从疒，季聲。”', '27.75F1': '《說文》：“痱，風病也。从疒，非聲。”', '27.75F3': '《說文》：“痳，疝病。从疒，林聲。”', '27.75FF': '《說文》：“痿，痹也。从疒，委聲。”', '27.75F9': '《說文》：“痹，溼病也。从疒，畀聲。”', '27.7603': '《說文》：“瘃，中寒腫覈。从疒，豖聲。”', '27.E65C': '《說文》：“痬，脈痬也。从疒，易聲。”', '27.7F68': '《說文》：“罨，䍐也。从网，奄聲。”', '27.E66D': '《說文》：“䍙，网也。从网，每聲。”', '27.7F69': '《說文》：“罩，捕魚器也。从网，卓聲。”', '27.7F6A': '《說文》：“罪，捕魚竹网。从网、非。秦以罪為辠字。”', '27.7F67': '《說文》：“罧，積柴水中以聚魚也。从网，林聲。”', '27.7F6C': '《說文》：“罬，捕鳥覆車也。从网，叕聲。輟，罬或从車。”', '27.7F72': '《說文》：“署，部署，有所网屬。从网，者聲。”', '27.7F6E': '《說文》：“置，赦也。从网、直。”', '27.7F6D': '《說文新附》：“罭，魚網也。从网、或，或聲。”', '27.5E4B': '《說文》：“幋，覆衣大巾。从巾，般聲。或以為首鞶。”', '27.5E4E': '《說文》：“幎，幔也。从巾，冥聲。《周禮》有幎人。”', '27.E684': '《說文》：“㡘，帷也。从巾，兼聲。”', '27.E690': '《說文》：“𢄐，蓋衣也。从巾，冡聲。”', '27.98FE': '《說文》：“飾，㕞也。从巾、从人，食聲。一曰襐飾。”', '27.E692': '《說文》：“幐，囊也。从巾，朕聲。”', '27.5E4F': '《說文》：“幏，南郡蠻夷賨布。从巾，家聲。”', '27.7699': '《說文》：“皙，人色白也。从白，析聲。”', '27.50B2': '《說文》：“傲，倨也。从人，敖聲。”', '27.E6AD': '《說文》：“傪，好皃。从人，參聲。”', '27.50AD': '《說文》：“傭，均，直也。从人，庸聲。”', '27.50C1': '《說文》：“僁，聲也。从人，悉聲。”', '27.50BE': '《說文》：“傾，仄也。从人，从頃，頃亦聲。”', '27.50C5': '《說文》：“僅，材能也。从人，堇聲。”', '27.50B3': '《說文》：“傳，遽也。从人，專聲。”', '27.50BF': '《說文》：“傿，引為賈也。从人，焉聲。”', '27.50C4': '《說文》：“僄，輕也。从人，㶾聲。”', '27.E6C3': '《說文》：“㑾，喜也。从人，䚻聲。自關以西，物大小不同謂之㑾。”', '27.50B7': '《說文》：“傷，創也。从人，𥏻省聲。”', '27.50AC': '《說文》：“催，相儔也。从人，崔聲。”', '27.50B4': '《說文》：“傴，僂也。从人，區聲。”', '27.50C2': '《說文》：“僂，尫也。从人，婁聲。”', '27.50C7': '《說文》：“僇，癡行僇僇也。从人，翏聲。讀若雡。一曰且也。”', '27.50AE': '《說文》：“傮，終也。从人，曹聲。”', '27.50CA': '《說文》：“僊，長生僊去。从人，从䙴，䙴亦聲。”', '27.50B5': '《說文新附》：“債，債負也。从人、責，責亦聲。”', '27.88CF': '《說文》：“裏，衣內也。从衣，里聲。”', '27.88D5': '《說文》：“裕，衣物饒也。从衣，谷声。《易》曰：‘有孚裕無咎。’”', '27.88DC': '《說文》：“補，完衣也。从衣，甫聲。”', '27.88CE': '《說文》：“裎，袒也。从衣，呈聲。”', '27.88DD': '《說文》：“裝，裹也。从衣，壯聲。”', '27.88DB': '《說文》：“裛，書囊也。从衣，邑聲。”', '27.88CB': '《說文》：“裋，豎使布長襦。从衣，豆聲。”', '27.88DE': '《說文》：“裞，贈終者衣被曰裞。从衣，兌聲。”', '27.6BF9': '《說文新附》：“毹，氍毹也。从毛，俞聲。”', '27.8247': '《說文新附》：“艇，小舟也。从舟，廷聲。”', '27.8245': '《說文新附》：“艅，艅艎，舟名。从舟，余聲。”', '27.899C': '《說文》：“覜，諸矦三年大相聘曰覜。覜，視也。从見，兆聲。”', '27.6B47': '《說文》：“歇，息也。一曰气越泄。从欠，曷聲。”', '27.6B42': '《說文》：“歂，口气引也。从欠，耑聲。讀若車輇。”', '27.E73C': '《說文》：“㰻，卒喜也。从欠，从喜。”', '27.E73F': '《說文》：“㰾，所謌也。从欠，噭省聲。讀若叫呼之叫。”', '27.6B43': '《說文》：“歃，歠也。从欠，臿聲。《春秋傳》曰：‘歃而忘。’”', '27.6B41': '《說文》：“歁，食不滿也。从欠，甚聲。讀若坎。”', '27.6B46': '《說文》：“歆，神食气也。从欠，音聲。”', '27.6B48': '《說文新附》：“歈，歌也。从欠，俞聲。”', '27.7FA8': '《說文》：“羨，貪欲也。从㳄，从羑省。羑呼之羑，文王所拘羑里。”', '27.E752': '《說文》：“𣄸，屰惡驚詞也。从㒫，咼聲。讀若楚人名多夥。”', '27.980C': '《說文》：“頌，皃也。从頁，公聲。𩔜，籀文。”', '27.E75D': '《說文》：“䪴，項枕也。从頁，冘聲。”', '27.E75F': '《說文》：“𩑢，曲頤也。从頁，不聲。”', '27.E760': '《說文》：“䪳，面目不正皃。从頁，尹聲。”', '27.9812': '《說文》：“頒，大頭也。从頁，分聲。一曰鬢也。《詩》曰：有頒其首。’”', '27.9811': '《說文》：“頑，㮯頭也。从頁，元聲。”', '27.980D': '《說文》：“頍，舉頭也。从頁，支聲。《詩》：‘有頍者弁。’”', '27.E76D': '《說文》：“𩑦，內頭水中也。从頁、𠬸，𠬸亦聲。”', '27.980A': '《說文》：“頊，頭頊頊謹皃。从頁，玉聲。”', '27.9813': '《說文》：“頓，下首也。从頁，屯聲。”', '27.7169': '《說文》：“煩，熱頭痛也。从頁，从火。一曰焚省聲。”', '27.9810': '《說文新附》：“預，安也。案經典通用豫。从頁，未詳。”', '27.E785': '《說文》：“𩠹，𢧵也。从𩠐，从斷。剸，或从刀，專聲。”', '27.9AEE': '《說文》：“髮，根也。从髟，犮聲。𩠖，髮或从首。𩑛，古文。”', '27.9B04': '《說文》：“鬄，髲也。从髟，易聲。髢，鬄或从也聲。”', '27.9AE1': '《說文》：“髡，𩮜髮也。从髟，兀聲。髡，或从元。”', '27.F12F': '《說文》：“厀，脛頭卪也。从卪，桼聲。”', '27.8F9F': '《說文》：“辟，法也。从卩，从辛，節制其辠也；从口，用法者也。”', '27.656C': '《說文》：“敬，肅也。从攴、茍。”', '27.5D6C': '《說文》：“嵬，高不平也。从山，鬼聲。”', '27.5D6F': '《說文》：“嵯，山皃。从山，差聲。”', '27.5D69': '《說文新附》：“嵩，中岳，嵩高山也。从山，从高，亦从松。韋昭《國語》注云：‘古通用崇字。’”', '27.5D5E': '《說文》：“嵞，會稽山。一曰九江當嵞也。民以辛、壬、癸、甲之日嫁娶。从屾，余聲。”', '27.E7D5': '《說文》：“嵟，高也。从屵，隹聲。”', '27.E7D6': '《說文》：“𡺮，崩。从屵，肥聲。”', '27.5EC7': '《說文》：“廇，中庭也。从广，留聲。”', '27.5EC9': '《說文》：“廉，仄也。从广，兼聲。”', '27.5EC8': '《說文新附》：“廈，屋也。从广，夏聲。”', '27.F621': '《說文》：“𠪚，崟也。一曰地名。从厂，敢聲。”', '27.E7E8': '《說文》：“𠪙，石利也。从厂，異聲。”', '27.7891': '《說文》：“碑，豎石也。从石，卑聲。”', '27.E7FB': '《說文》：“䂹，碎石隕聲。从石，炙聲。”', '27.787B': '《說文》：“硻，餘堅者。从石，堅省。”', '27.788E': '《說文》：“碎，䃺也。从石，卒聲。”', '27.7893': '《說文》：“碓，舂也。从石，隹聲。”', '27.E801': '《說文》：“舂已復擣之曰䂿。从石，沓聲。”', '27.788F': '《說文》：“碏，《左氏傳》：‘衛大夫石碏。’《唐韻》云：‘敬也。’从石未詳昔聲。”', '27.788C': '《說文新附》：“碌，石皃。从石，彔聲。”', '27.8086': '《說文》：“𨽸，極陳也。从長，隶聲。𩭞，或从髟。”', '27.8C64': '《說文》：“豤，齧也。从豕，𥃩聲。”', '27.8C62': '《說文》：“豢，以穀圈養豕也。从豕，𢍏聲。”', '27.8C66': '《說文》：“豦，鬬相丮不解也。从豕、虍。豕虍之鬬不解也。讀若蘮蒘草之蘮。司馬相如說豦，封豕之屬。一曰虎兩足舉。”', '27.5F59': '《說文》：“𢑷，蟲似豪豬者。从㣇，𦞅省聲。蝟，或从虫。”', '27.E817': '《說文》：“貈，似狐，善睡獸。从豸，舟聲。《論語》曰：‘狐貈之厚以居。’”', '27.8C89': '《說文》：“貉，北方豸穜。从豸，各聲。孔子曰：‘貉之為言惡也。’”', '27.8C86': '《說文》：“貆，貉之類。从豸，亘聲。”', '27.99B0': '《說文》：“馰，馬白頟也。从馬，的省聲。一曰駿也。《易》曰：‘為的顙。’”', '27.99B5': '《說文》：“馵，馬後左足白也，从馬，二其足。讀若注。”', '27.99B3': '《說文》：“馳，大驅也。从馬，也聲。”', '27.99B4': '《說文》：“馴，馬順也。从馬，川聲。”', '27.99B1': '《說文新附》：“馱，負物也。从馬，大聲。”', '27.5ECC': '《說文》：“𢊁，解𢊁，獸也。似山牛，一角。古者决訟，令觸不直。象形，从豸省。”', '27.9E80': '《說文》：“麀，牝鹿也，从鹿，从牝省。𪋎，或从幽聲。”', '27.E84E': '《說文》：“𣬎，獸也，似牲牲。从㲋，夬聲。”', '27.E855': '《說文》：“㺌，犬吠不止也。从犬，兼聲。讀若檻。一曰兩犬爭也。”', '27.9F20': '《說文》：“鼠，穴蟲之總名也，象形。”', '27.7166': '《說文》：“煦，烝也。一曰赤皃。一曰溫潤也。从火，昫聲。”', '27.7168': '《說文》：“煨，盆中火。从火，畏聲。”', '27.7141': '《說文》：“煁，烓也。从火，甚聲。”', '27.714E': '《說文》：“煎，熬也。从火，前聲。”', '27.716C': '《說文》：“煬，炙燥也。从火，易聲。”', '27.7149': '《說文》：“煉，鑠治金也。从火，柬聲。”', '27.7163': '《說文》：“煣，屈申木也。从火、柔，柔亦聲。”', '27.7167': '《說文》：“照，明也。从火，昭聲。”', '27.7152': '《說文》：“煒，盛赤也。从火，韋聲。”', '27.715C': '《說文》：“煜，熠也。从火，昱聲。”', '27.7147': '《說文》：“煇，光也。从火，軍聲。”', '27.714C': '《說文》：“煌，煌煇也。从火，皇聲。”', '27.7156': '《說文》：“煖，溫也。从火，爰聲。”', '27.E896': '《說文》：“煗，溫也。从火，耎聲。”', '27.7165': '《說文新附》：“煥，火光也。从火，奐聲。”', '27.7154': '《說文》：“煔，火行也。从炎，占聲。”', '27.8D68': '《說文》：“赨，赤色也。从赤，蟲省聲。”', '27.8D69': '《說文》：“赩，大赤也。从赤、色，色亦聲。”', '27.F58D': '《說文》：“𢧤，大也。从大，𢧄聲。讀若《詩》：‘𢧤𢧤大猷’。”', '27.5C33': '《說文》：“尳，䣛病也。从尢，从骨，骨亦聲。”', '27.E8C3': '《說文》：“尲，不正也。从𡯁，兼聲。”', '27.776A': '《說文》：“睪，目視也。从橫目，从㚔，令吏將目捕罪人也。”', '27.E8CF': '《說文》：“䇐，臨也。从立，从隶。”', '27.E8D0': '《說文》：“䇏，磊䇏，重聚也。从立，𦎧聲。”', '27.7AEB': '《說文》：“竫，亭安也。从立，爭聲。”', '27.9756': '《說文》：“靖，立竫也。从立，青聲。一曰細皃。”', '27.E8D8': '《說文》：“𥪋，見鬼鬽皃。从立，从彔。彔，籀文鬽字。讀若虙羲氏之虙。”', '27.E8D9': '《說文》：“䇎，驚皃。从立，昔聲。”', '27.E8DA': '《說文》：“䇑，短人立䇑䇑皃。从立，卑聲。”', '27.610F': '《說文》：“意，志也。从心察言而知意也。从心，从音。”', '27.6148': '《說文》：“慈，愛也。从心，茲聲。”', '27.E8E6': '《說文》：“㥴，忯㥴，不憂事也。从心，虒聲。讀若移。”', '27.60F3': '《說文》：“想，冀思也。从心，相聲。”', '27.6149': '《說文》：“慉，起也。从心，畜聲。《詩》曰：‘能不我慉。’”', '27.E8EC': '《說文》：“愙，敬也。从心，客聲。”', '27.612F': '《說文》：“愯，懼也。从心，雙省聲。《春秋傳》曰：‘駟氏愯。’”', '27.6146': '《說文》：“慆，說也。从心，舀聲。”', '27.611A': '《說文》：“愚，戇也。从心，从禺。禺，猴屬，獸之愚者。”', '27.6106': '《說文》：“愆，過也。从心，衍聲。㥶，或从寒省。𠏘，籀文。”', '27.614A': '《說文》：“慊，疑也。从心，兼聲。”', '27.60F7': '《說文》：“惷，亂也。从心，春聲。《春秋傳》曰：‘王室曰惷惷焉。’一曰厚也。”', '27.613E': '《說文》：“愾，大息也。从心，从氣，氣亦聲。《詩》曰：‘愾我寤歎。’”', '27.6134': '《說文》：“愴，傷也。从心，倉聲。”', '27.610D': '《說文》：“愍，痛也。从心，敃聲。”', '27.6145': '《說文》：“慅，動也。从心，蚤聲。一曰起也。”', '27.611F': '《說文》：“感，動人心也。从心，咸聲。”', '27.E91C': '《說文》：“愪，憂皃。从心，員聲。”', '27.6101': '《說文》：“愁，憂也。从心，秋聲。”', '27.E91F': '《說文》：“愵，憂皃。从心，弱聲。讀如‘惄’同。”', '27.F0C5': '《說文》：“𢝊，愁也。从心，从頁。”', '27.E92B': '《說文》：“𢟡，𢢞也。从心，𤰈聲。𤸶，或从疒。”', '27.60F9': '《說文新附》：“惹，亂也。从心，若聲。”', '27.6EC7': '《說文》：“滇，益州池名。从水，真聲。”', '27.6EBA': '《說文》：“溺，水。自張掖刪丹西至酒泉合黎，餘波入于流沙。从水，弱聲。桑欽所說。”', '27.6EA0': '《說文》：“溠，水。在漢南。从水，差聲。荊州浸也。《春秋傳》曰：‘脩涂梁溠。’”', '27.6EA7': '《說文》：“溧，水。出丹陽溧陽縣。从水，栗聲。”', '27.6EB1': '《說文》：“溱，水。出桂陽臨武，入匯。从水，秦聲。”', '27.6E9C': '《說文》：“溜，水。出鬱林群。从水，留聲。”', '27.6ECD': '《說文》：“滍，水。出南陽魯陽堯山，東北入汝。从水，蚩聲。”', '27.6EB3': '《說文》：“溳，水。出南陽蔡陽，東入夏水。从水，員聲。”', '27.E935': '《說文》：“㴲，水。出趙國襄國，東入湡。从水，虒聲。”', '27.E93C': '《說文》：“溑，水也。从水，𧴪聲。讀若瑣。”', '27.6EA5': '《說文》：“溥，大也。从水，尃聲。”', '27.6ED4': '《說文》：“滔，水漫漫大皃。从水，舀聲。”', '27.6EB6': '《說文》：“溶，水盛也。从水，容聲。”', '27.6EB7': '《說文》：“溷，亂也。一曰水濁皃。从水，圂聲。”', '27.6ED1': '《說文》：“滑，利也。从水，骨聲。”', '27.6EBD': '《說文》：“溽，溼暑也。从水，辱聲。”', '27.6E9D': '《說文》：“溝，水瀆，廣四尺，深四尺。从水，冓聲。”', '27.6EC3': '《說文》：“滃，雲气起也。从水，翁聲。”', '27.6E9F': '《說文》：“溟，小雨溟溟也。从水，冥聲。”', '27.6EC8': '《說文》：“滈，久雨也。从水，高聲。”', '27.6EA6': '《說文》：“溦，小雨也。从水，微省聲。”', '27.E95C': '《說文》：“𣹤，漸溼也，从水，挐聲。”', '27.E95D': '《說文》：“㴶，灌也。从水，隺聲。”', '27.6E93': '《說文》：“溓，薄水也。一曰中絕小水。从水，兼聲。”', '27.6EBC': '《說文》：“溼，幽溼也。从水；一，所以覆也，覆而有土，故溼也；㬎省聲。”', '27.6E96': '《說文》：“準，平也。从水，隼聲。”', '27.6ED3': '《說文》：“滓，澱也。从水，宰聲。”', '27.6ED2': '《說文》：“滒，多汁也。从水，哥聲。讀若哥。”', '27.6EA2': '《說文》：“溢，器滿也。从水，益聲。”', '27.6EC4': '《說文》：“滄，寒也。从水，倉聲。”', '27.EB5B': '《說文》：“㙙，涂也。从土，浝聲。”', '27.6EC5': '《說文》：“滅，盡也。从水，烕聲。”', '27.6EC1': '《說文新附》：“滁，水名。从水，除聲。”', '27.899B': '《說文》：“覛，衺視也。从𠂢，从見。𧡒，籀文。”', '27.E97E': '《說文》：“㓖，風寒也。从仌。畢聲。”', '27.96F7': '《說文》：“靁，陰陽薄動，靁雨生物者也，从雨，畾象回轉形。𩂩，古文靁。𤴐，古文靁。𩇓，籀文，靁間有回，回，靁聲也。”', '27.96FB': '《說文》：“電，陰陽激燿也。从雨，从申。𩃿，古文電。”', '27.96F9': '《說文》：“雹，雨冰也。从雨，包聲。靁，古文雹。”', '27.96F6': '《說文》：“零，餘雨也。从雨，令聲。”', '27.E998': '《說文》：“霚，地氣發天不應。从雨，敄聲。”', '27.E9CD': '《說文》：“𩵏，魚名。从魚，𠤎聲。”', '27.7162': '《說文》：“煢，回疾也。从卂，營省聲。”', '27.959E': '《說文》：“閞，門𣝍櫨也。从門，弁聲。”', '27.959C': '《說文》：“閜，大開也。从門，可聲。大杯亦為閜。”', '27.9598': '《說文》：“閘，開閉門也。从門，甲聲。”', '27.959F': '《說文》：“閟，閉門也。从門，必聲。《春秋傳》曰：‘閟門而與之言。’”', '27.8056': '《說文》：“聖，通也。从耳，呈聲。”', '27.8058': '《說文》：“聘，訪也。从耳，甹聲。”', '27.8073': '《說文》：“𢕈，生而聾曰聳。从耳，從省聲。”', '27.E9F7': '《說文》：“𢯲，手𢯲也。揚雄曰：‘𢯲，握也。’从手，𥄗聲。”', '27.63F1': '《說文》：“揱，人臂皃。从手，削聲。《周禮》曰：‘輻欲其揱。’”', '27.642F': '《說文》：“搯，捾也。从手，舀聲。”', '27.640F': '《說文》：“搏，索持也。一曰至也。从手，尃聲。”', '27.6424': '《說文》：“搤，捉也。从手，益聲。”', '27.6423': '《說文》：“搣，㧗也。从手，烕聲。”', '27.6414': '《說文》：“搔，括也。从手，蚤聲。”', '27.6433': '《說文》：“搳，擖也。从手，害聲。”', '27.6416': '《說文》：“搖，動也。从手，䍃聲。”', '27.EA12': '《說文》：“搈，動搈也。从手，容聲。”', '27.640D': '《說文》：“損，減也。从手，員聲。”', '27.EA19': '《說文》：“㨜，相援也。从手，虔聲。”', '27.6426': '《說文》：“搦，按也。从手，弱聲。”', '27.EA1D': '《說文》：“𢱧，反手擊也。从手𣬉聲。”', '27.EA1E': '《說文》：“搑，推擣也。从手，茸聲。”', '27.EA22': '《說文》：“㨡，手推之也。从手，圂聲。”', '27.6430': '《說文》：“搰，掘也。从手，骨聲。”', '27.6409': '《說文》：“搉，敲擊也。从手，隺聲。”', '27.6435': '《說文》：“搵，沒也。从手，𥁕聲。”', '27.6422': '《說文新附》：“搢，插也。从手，晉聲。”', '27.5AC1': '《說文》：“嫁，女適人也。从女，家聲。”', '27.5AB2': '《說文》：“媲，妃也。从女，𣬉聲。”', '27.5AB0': '《說文》：“媰，婦人妊身也。从女，芻聲。《周書》曰：‘至于媰婦。’”', '27.5ABC': '《說文》：“媼，女老偁也。从女，昷聲。讀若奧。”', '27.5ABE': '《說文》：“媾，重㛰也。从女，冓聲。《易》曰：‘匪寇㛰媾。’”', '27.EA39': '《說文》：“㜎，女隸也。从女，奚聲。”', '27.5AC4': '《說文》：“嫄，台國之女，周棄母字也。从女，原聲。”', '27.EA44': '《說文》：“㜅，媚也。从女，畜聲。”', '27.5ACB': '《說文》：“嫋，㚩也。从女，从弱。”', '27.5AC7': '《說文》：“嫇，嬰嫇也。从女，冥聲。一曰嫇嫇，小人皃。”', '27.5AB1': '《說文》：“媱，曲肩行皃。从女，䍃聲。”', '27.5A90': '《說文》：“媐，說樂也。从女，巸聲。”', '27.EA53': '《說文》：“𡟰，宴𡟰也。从女，冤聲。”', '27.5ABB': '《說文》：“媻，奢也。从女，般聲。”', '27.5AC8': '《說文》：“嫈，小心態也。从女，熒省聲。”', '27.5ACC': '《說文》：“嫌，不平於心也。一曰疑也。从女，兼聲。”', '27.EA68': '《說文》：“𡟨，不媚，前却𡟨𡟨也。从女，陝聲。”', '27.EA6A': '《說文》：“㜇，不說也。从女，恚聲。”', '27.5ABF': '《說文》：“媿，慙也。从女，鬼聲。愧，媿或从恥省。”', '27.6223': '《說文》：“戣，《周禮》：‘侍臣執戣，立于東垂。’兵也。从戈，癸聲。”', '27.8CCA': '《說文》：“𧵪，敗也。从戈，則聲。”', '27.6221': '《說文》：“戡，刺也。从戈，甚聲。”', '27.6222': '《說文》：“戢，藏兵也。从戈，咠聲。《詩》曰：‘載戢干戈。’”', '27.6220': '《說文》：“戠，闕。从戈，从音。”', '27.EA8E': '《說文》：“㔴，田器也。从匚，異聲。”', '27.532F': '《說文》：“匯，器也。从匚，淮聲。”', '27.EA95': '《說文》：“𤲙，𤳊屬，蒲器也，所以盛穜。”', '27.74FD': '《說文》：“瓽，大盆也。从瓦，尚聲。”', '27.EA9A': '《說文》：“㼰，罌謂之㼰。从瓦，卑聲。”', '27.74FF': '《說文》：“瓿，甂也。从瓦，咅聲。”', '27.EAA0': '《說文》：“𤭢，破也。从瓦，卒聲。”', '27.5F40': '《說文》：“彀，張弩也。从弓，㱿聲。”', '27.7E6D': '《說文》：“繭，蠶衣也。从系，从虫，黹省。絸，古文繭，从系、見。”', '27.7D83': '《說文》：“綃，生絲也。从糸，肖聲。”', '27.7D93': '《說文》：“經，織也。从糸，巠聲。”', '27.EABE': '《說文》：“䋼，緩也。从糸，盈聲。讀與聽同。𦀚，䋼或从呈。”', '27.7D7F': '《說文》：“絿，急也。从糸，求聲。《詩》曰：‘不競不絿。’”', '27.7E52': '《說文》：“繒，帛也。从糸，曾聲。𦀓，籀文繒，从宰省。揚雄以為漢律祠宗廟丹書告。”', '27.7D88': '《說文》：“綈，厚繒也。从糸，弟聲。”', '27.7D79': '《說文》：“絹，繒如麥䅌。从糸，肙聲。”', '27.EACB': '《說文》：“䋭，帛青經縹緯。一曰育陽染也。从糸，育聲。”', '27.7D8E': '《說文》：“綎，系綬也。从糸，廷聲。”', '27.7D5B': '《說文》：“絛，扁緒也。从糸，攸聲。”', '27.7D85': '《說文》：“綅，絳綫也。从糸，侵省聲。《詩》曰：‘貝胄朱綅。’”', '27.EADD': '《說文》：“䋢，扁緒也。一曰弩腰鉤帶。从糸，折聲。”', '27.EAE2': '《說文》：“綊，䋊綊也。从糸，夾聲。”', '27.7D86': '《說文》：“綆，汲井綆也。从糸，更聲。”', '27.7D7A': '《說文》：“絺，細葛也。从糸，希聲。”', '27.7D8F': '《說文》：“綏，車中把也。从糸，从妥。”', '27.7D80': '《說文新附》：“綀，布屬。从糸，束聲。”', '27.EAFA': '《說文》：“𦅽，素屬。从素，収聲。”', '27.EAFB': '《說文》：“䋤，白約，縞也。从素，勺聲。”', '27.86F9': '《說文》：“蛹，繭蟲也。从虫，甬聲。”', '27.8713': '《說文》：“蜓，蝘蜓也。从虫，廷聲。一曰螾蜓。”', '27.86F5': '《說文》：“蛵，丁蛵，負勞也。从虫，巠聲。”', '27.8700': '《說文》：“蜀，葵中蠶也。从虫。上目象蜀頭形，中象其身蜎蜎。《詩》曰：‘蜎蜎者蜀。’”', '27.86FE': '《說文》：“蛾，羅也。从虫，我聲。”', '27.870B': '《說文》：“蜋，堂蜋也。从虫，良聲。一名蚚父。”', '27.86F8': '《說文》：“蛸，𧓎蛸，堂蜋子。从虫，肖聲。”', '27.8706': '《說文》：“蜆，縊女也。从虫，見聲。”', '27.86FA': '《說文》：“蛺，蛺蜨也。从虫，夾聲。”', '27.86F6': '《說文》：“蛶，商何也。从虫，寽聲。”', '27.86FB': '《說文》：“蛻，蛇蟬所解皮也。从虫，挩省。”', '27.8703': '《說文》：“蜃，雉入海化為蜃。从虫，辰聲。”', '27.870E': '《說文》：“蜎，蜎也。从虫，肙聲。”', '27.EB26': '《說文》：“𧒎，蠶化飛蟲。从䖵，我聲。”', '27.EB35': '《說文》：“𧒔，多足蟲也。从䖵，求聲。𧋛，𧒔或从虫。”', '27.EB36': '《說文》：“𧖚，蚍𧖚也。从䖵，㯱聲。蜉，𧖚或从虫，从孚。”', '27.EB41': '《說文》：“䫻，大風也。从風，日聲。”', '27.9EFD': '《說文》：“黽，鼃黽也。从它，象形。黽頭與它頭同。𪓕，籀文黽。”', '27.5859': '《說文》：“塙，堅不可拔也。从土，高聲。”', '27.EB51': '《說文》：“㙚，赤剛土也。从土，觲省聲。”', '27.584D': '《說文》：“塍，稻中畦也。从土，朕聲。”', '27.586B': '《說文》：“填，塞也。从土，真聲。”', '27.5852': '《說文》：“塒，雞棲垣為塒。从土，時聲。”', '27.585E': '《說文》：“塞，隔也。从土，从𡨄。”', '27.584F': '《說文》：“塏，高燥也。从土，豈聲。”', '27.6BC0': '《說文》：“毀，缺也。从土，毇省聲。𣪷，古文毀从壬。”', '27.58DE': '《說文》：“壞，敗也。从土，褱聲。𡎯，古文壞省。𣀤，籀文壞。”', '27.584B': '《說文》：“塋，墓也。从土，熒省聲。”', '27.5857': '《說文新附》：“塗，泥也。从土，涂聲。”', '27.5853': '《說文新附》：“塓，塗也。从土，冥聲。”', '27.5858': '《說文新附》：“塘，隄也。从土，唐聲。”', '27.5854': '《說文新附》：“塔，西域浮屠也。从土，答聲。”', '27.7578': '《說文》：“畸，殘田也。从田，奇聲。”', '27.7579': '《說文》：“畹，田三十𤱑也。从田，宛聲。”', '27.7577': '《說文》：“畷，兩陌閒道也，廣六尺。从田，叕聲。”', '27.7576': '《說文》：“當，田相值也。从田，尚聲。”', '27.F65C': '《說文》：“畺，界也。从畕、三，其界畫也。疆，畺或从彊、土。”', '27.8205': '《說文》：“𦥶，母之兄弟為𦥶，妻之父為外𦥶。从男，臼聲。”', '27.EB92': '《說文》：“勥，迫也。从力，強聲。勥，古文从彊。”', '27.EB96': '《說文》：“勠，并力也。从力，翏聲。”', '27.52E6': '《說文》：“勦，勞也。《春秋傳》曰：‘安用勦民。’从力，巢聲。”', '27.52E4': '《說文》：“勤，勞也。从力，堇聲。”', '27.EB9D': '《說文》：“𠢕，健也。从力，敖聲，讀若豪。”', '27.EB9F': '《說文》：“勡，劫也。从力，㶾聲。”', '27.52DF': '《說文》：“募，廣求也。从力，莫聲。”', '27.52E2': '《說文新附》：“勢，盛力，權也。从力，埶聲。”', '27.925B': '《說文》：“鉛，青金也。从金，㕣聲。”', '27.9249': '《說文》：“鉉，舉鼎也。《易》謂之鉉，《禮》謂之鼏。从金，玄聲。”', '27.9265': '《說文》：“鉥，綦鍼也。从金，朮聲。”', '27.9239': '《說文》：“鈹，大鍼也。一曰劒如刀裝者。从金，皮聲。”', '27.924F': '《說文》：“鉏，立薅所用也。从金，且聲。”', '27.924A': '《說文》：“鉊，大鐵也。从金，召聲。鎌謂之鉊，張徹說。”', '27.9246': '《說文》：“鉆，鐵銸也。从金，占聲。一曰膏車鐵鉆。”', '27.9257': '《說文》：“鉗，以鐵有所劫束也。从金，甘聲。”', '27.9234': '《說文》：“鈴，令丁也。从金，从令，令亦聲。”', '27.9266': '《說文》：“鉦，鐃。似鈴，柄中，上下通。从金，正聲。”', '27.9248': '《說文》：“鉈，短矛。从金，它聲。”', '27.925E': '《說文》：“鉞，車鑾聲也。从金，戉聲。《詩》曰：‘鑾聲鉞鉞。’”', '27.9263': '《說文》：“鉣，阻帶鐵也。从金，劫省聲。讀若劫。”', '27.9245': '《說文》：“鉅，大剛也。从金，巨聲。”', '27.EBC0': '《說文》：“𨥦，利也。从金，𠂔聲。讀若齊。”', '27.923F': '《說文新附》：“鈿，金華也。从金，田聲。”', '27.65B0': '《說文》：“新，取木也。从斤，新聲。”', '27.659F': '《說文》：“斟，勺也。从斗，甚聲。”', '27.77E0': '《說文》：“矠，矛屬。从矛，昔聲，讀若笮。”', '27.8EFF': '《說文》：“輧，輜車也。从車，并聲。”', '27.8EFE': '《說文》：“軾，車前也。从車，式聲。”', '27.8F05': '《說文》：“輅，車軨前橫木也。从車，各聲。”', '27.8F08': '《說文》：“輈，轅也。从車，舟聲。𨏺，籀文輈。”', '27.E04C': '《說文》：“䡓，車搖也。从車，从行。一曰衍省聲。”', '27.EBE7': '《說文》：“𨋬，軺車後登也。从車，丞聲。讀若《易》‘抍馬’之抍。”', '27.8F09': '《說文》：“載，乘也。从車，𢦒聲。”', '27.EBED': '《說文》：“軭，車戾也。从車，匡聲。”', '27.EBEE': '《說文》：“䡔，礙也。从車，多聲。”', '27.8F07': '《說文》：“輇，蕃車下庳輪也。一曰無輻也。从車，全聲。讀若饌。”', '27.8F02': '《說文》：“輂，大車駕馬也。从車，共聲。”', '27.8F00': '《說文》：“輀，喪車也。从車，而聲。”', '27.9697': '《說文》：“隗，陮隗也。从𨸏，鬼聲。”', '27.EBFA': '《說文》：“𨻌，磊也。从𨸏，𠂹聲。”', '27.9695': '《說文》：“隕，從高下也。从𨸏，員聲。《易》曰：‘有隕自天。’”', '27.9693': '《說文》：“隓，敗城𨸏曰隓，从𨸏，𢀡聲。𡐦，篆文。”', '27.9692': '《說文》：“隒，崖也。从𨸏，兼聲。讀若儼。”', '27.9694': '《說文》：“隔，障也。从𨸏，鬲聲。”', '27.9699': '《說文》：“隙，壁際孔也。从𨸏，从𡭴，𡭴亦聲。”', '27.EC10': '《說文》：“隖，小障也。一曰庳城也。从𨸏，烏聲。”', '27.EC14': '《說文》：“𨽝，𨹟也。从𨺅，聲，，籀文嗌字。隘，籀文𨽝，从𨸏、益。”', '27.EC18': '《說文》：“𤲑，㡒也，所以載盛米。从宁，从甾。甾，缶也。”', '27.79BD': '《說文》：“禽，走獸總名。从𠘯，象形，今聲。禽、离、兕，頭相似。”', '27.842C': '《說文》：“萬，蟲也。从厹，象形。”', '27.4E82': '《說文》：“亂，治也。从乙。乙，治之也。从𤔔。”', '27.F4B8': '《說文》：“辠，犯法也。从辛，从自。言辠人蹙鼻，苦辛之憂。秦以辠似皇字，改為罪。”', '27.EC26': '《說文》：“㝅，乳也。从子，㱿聲。一曰㝅瞀也。”', '27.EC3B': '《說文》：“醻，主人進客也。从酉，𠷎聲。酬，醻或从州。”', '27.9168': '《說文》：“酨，酢𤖅也。从酉，𢦒聲。”', '27.EC4B': '《說文》：“䣸，闕。”', '27.916A': '《說文新附》：“酪，乳漿也。从酉，各聲。”', '27.9169': '《說文新附》：“酩，酩酊，醉也。从酉，名聲。”', '27.E840': '《說文》：“𪊨，大麋也。狗足。从鹿，旨聲。麂，或从几。”', '27.798E': '《說文》：“禎，祥也。从示，貞聲。”', '27.798F': '《說文》：“福，祐也。从示，畐聲。”', '27.7994': '《說文》：“禔，安福也。从示，是聲也。《易》曰：‘禔既平’。”', '27.9F4B': '《說文》：“齋，戒潔也。从示，齊省聲。𪗒，籀文齋从𥜹省。”', '27.798B': '《說文》：“禋，潔祀也。一曰精意以享為禋。从示，垔聲。𠖦，籀文从宀。”', '27.7998': '《說文》：“禘，諦祭也。从示，帝聲。《周禮》曰：‘五歲一禘。’”', '27.79B1': '《說文》：“禱，告事求福也。从示，壽聲。𥛈，禱或省。𥜱，籀文禱。”', '27.7996': '《說文》：“禖，祭也。从示，某聲。”', '27.E010': '《說文》：“𥚩，祭具也。从示，胥聲。”', '27.7993': '《說文》：“禓，道上祭。从示，昜聲。”', '27.798D': '《說文》：“禍，害也，神不福也。从示，咼聲。”', '27.7471': '《說文》：“瑱，以玉充耳也。从玉，真聲。《詩》曰：‘玉之瑱兮。’𦗁，瑱或从耳。”', '27.7475': '《說文》：“瑵，車蓋玉瑵。从玉，蚤聲。”', '27.E025': '《說文》：“瑬，垂玉也，冕飾。从玉，流聲。”', '27.7473': '《說文》：“瑳，玉色鮮白，从玉，差聲。”', '27.746E': '《說文》：“𤩰，玉英華羅列秩秩。从玉，㮚聲。《逸論語》曰：‘玉粲之璱兮，其𤩰猛也。’”', '27.7472': '《說文》：“瑲，玉聲也。从玉，倉聲。《詩》曰：‘鞗革有瑲。’”', '27.7463': '《說文》：“瑣，玉聲也。从玉，𧴪聲。”', '27.E034': '《說文》：“𤧩，石之似玉者。从玉，𥄗聲。”', '27.E039': '《說文》：“瑦，石之似玉者。从玉，烏聲。”', '27.78A7': '《說文》：“碧，石之青美者。从玉、石，白聲。”', '27.7464': '《說文》：“瑤，玉之美者。从玉，䍃聲。《詩》曰：‘報之以瓊瑤。’”', '27.7470': '《說文》：“瑰，玫瑰。从玉，鬼聲。一曰圜好。”', '27.718F': '《說文》：“熏，火煙上出也。从屮，从黑。屮黑，熏黑也。”', '27.84CF': '《說文》：“蓏，在木曰果，在地曰蓏。从艸，从㼌。”', '27.E050': '《說文》：“䔇，菜之美者，雲夢之䔇。从艸，豈聲。”', '27.E052': '《說文》：“䔃，菜也。从艸，祖聲。”', '27.8587': '《說文》：“薇，菜也，似藿。从艸，微聲。𦵨，籀文薇省。”', '27.84A2': '《說文》：“蒢，黃蒢，職也。从艸，除聲。”', '27.84B2': '《說文》：“蒲，水艸也，可以作席。从艸，浦聲。”', '27.84BB': '《說文》：“蒻，蒲子，可以為平席。从艸，弱聲。”', '27.849A': '《說文》：“蒚，夫蘺上也。从艸，鬲聲。”', '27.84AC': '《說文》：“蒬，棘蒬也。从艸，冤聲。”', '27.8490': '《說文》：“蒐，茅蒐，茹藘。人血所生，可以染絳。从艸，从鬼。”', '27.E07F': '《說文》：“䕮，日精也，以秋華。从艸，𥶶省聲。𦶗，䕮或省。”', '27.84B9': '《說文》：“蒹，雚之未秀者。从艸，兼聲。”', '27.84CD': '《說文》：“蓍，蒿屬。生十歲，百莖。《易》以為數：天子蓍九尺，諸侯七尺，大夫五尺，士三尺。从艸，耆聲。”', '27.84C2': '《說文》：“蓂，析蓂，大薺也。从艸，冥聲。”', '27.E08B': '《說文》：“𦺆，葛屬，白華。从艸，臯聲。”', '27.849F': '《說文》：“蒟，果也。从艸，竘聲。”', '27.849D': '《說文》：“蒝，艸木形。从艸，原聲。”', '27.E09C': '《說文》：“𦵦，艸旱盡也。从艸，俶聲。《詩》曰：‘𦵦𦵦山川。’”', '27.84C1': '《說文》：“蓁，艸盛皃。从艸，秦聲。”', '27.84BC': '《說文》：“蒼，艸色也。从艸，倉聲。”', '27.8494': '《說文》：“蒔，更別穜。从艸，時聲。”', '27.84C6': '《說文》：“蓆，廣多也。从艸，席聲。”', '27.84A9': '《說文》：“蒩，茅藉也。从艸，租聲。《禮》曰：‘封諸侯以土，蒩以白茅。’”', '27.E0B2': '《說文》：“䔂，羹菜也。从艸，宰聲。”', '27.84DB': '《說文》：“蓛，以穀萎馬置莝中。从艸，敇聲。”', '27.849C': '《說文》：“蒜，葷菜。从艸，祘聲。”', '27.84AE': '《說文》：“蒮，艸也。从艸，隺聲。《詩》曰：‘食鬱及蒮。’”', '27.8499': '《說文》：“蒙，王女也。从艸，冡聲。”', '27.E0C3': '《說文》：“𦵵，艸也。从艸，𠧴聲。”', '27.84BF': '《說文》：“蒿，菣也。从艸，高聲。”', '27.84C4': '《說文》：“蓄，積也。从艸，畜聲。”', '27.84C9': '《說文新附》：“蓉，芙蓉也。从艸，容聲。”', '27.84C0': '《說文新附》：“蓀，香艸也。从艸，孫聲。”', '27.84D0': '《說文》：“蓐，陳艸復生也。从艸，辱聲。一曰蔟也。𦸳，籀文蓐从茻。”', '27.7297': '《說文》：“犗，騬牛也。從牛，害聲。”', '27.7296': '《說文》：“犖，駁牛也。从牛，勞省聲。”', '27.E0D9': '《說文》：“㹊，白牛也。从牛，隺聲。”', '27.7293': '《說文》：“犓，以芻莖養牛也。从牛、芻，芻亦聲。《春秋國語》曰：‘犓豢幾何。’”', '27.7295': '《說文》：“犕，《易》曰：‘犕牛乘馬。’从牛，𤰇聲。”', '27.E0E0': '《說文》：“𤛒，牛羊無子也。从牛，𠷎聲。讀若糗糧之糗。”', '27.E0E9': '《說文》：“𠻜，小㱃也。从口，率聲。”', '27.5604': '《說文》：“嘄，聲嘄嘄也。从口，梟聲。”', '27.5612': '《說文》：“嘒，小聲也。从口，彗聲。《詩》曰：‘嘒彼小星’。嚖，或从慧。”', '27.560C': '《說文》：“嘌，疾也。从口，𤐫聲。”', '27.E0F5': '《說文》：“嘑，唬也。从口，虖聲。”', '27.55FF': '《說文》：“嗿，聲也。从口，貪聲。《詩》曰：‘有嗿其饁。’”', '27.5610': '《說文》：“嘐，誇語也。从口，翏聲。”', '27.E0FE': '《說文》：“嗻，遮也。从口，庶聲。”', '27.5616': '《說文》：“嘖，大呼也。从口，責聲。謮，嘖或从言。”', '27.55F7': '《說文》：“嗷，眾口愁也。从口，嗷聲。《詩》曰：‘哀鳴嗷嗷。’”', '27.E106': '《說文》：“嘅，嘆也。从口，既聲。”', '27.5606': '《說文》：“嘆，吞歎也。从口，歎省聲。一曰太息也。”', '27.55FC': '《說文》：“嗼，𠴫嗼也。从口，莫聲。”', '27.55FE': '《說文》：“嗾，使犬聲。从口，族聲。《春秋傳》曰：‘公嗾夫獒。’”', '27.8D96': '《說文》：“趖，走意。从走，坐聲。”', '27.E128': '《說文》：“𧻲，留意也。从走，里聲。讀若小兒孩。”', '27.8D99': '《說文》：“趙，趨趙也。从走，肖聲。”', '27.E13C': '《說文》：“䞭，行趚䞭也。从走，夋聲。”', '27.E145': '《說文》：“𧻹，喪辟𧻹。从走，甬聲。”', '27.F4BC': '《說文》：“歰，不滑也。从四止。”', '27.905D': '《說文》：“遝，䢔也。从辵，眔聲。”', '27.9058': '《說文》：“遘，遇也。从辵，冓聲。”', '27.905E': '《說文》：“遞，更易也。从辵，虒聲。”', '27.905C': '《說文》：“遜，遁也。从辵，孫聲。”', '27.9063': '《說文》：“遣，縱也。从辵，𠳋聲。”', '27.9074': '《說文》：“遴，行難也。从辵，㷠聲。《易》曰：‘以往㷠。’僯，或从人。”', '27.9060': '《說文》：“遠，遼也。从辵，袁聲。𨖸，古文遠。”', '27.9059': '《說文新附》：“遙，逍遙也。又遠也。从辵，䍃聲。”', '27.E19E': '《說文》：“𧗸，迹也。从行，戔聲。”', '27.8DFD': '《說文》：“跽，長跪也。从足，忌聲。”', '27.8DFE': '《說文》：“跾，疾也，長也。从足，攸聲。”', '27.8E0A': '《說文》：“踊，跳也。从足，甬聲。”', '27.8E04': '《說文》：“踄，蹈也。从足，步聲。”', '27.E1C2': '《說文》：“䟴，動也。从足，辰聲。”', '27.E1C7': '《說文》：“䟺，步行獵跋也。从足，貝聲。”', '27.E1C9': '《說文》：“䟸，脛肉也。一曰曲脛也。从足，𢌳聲。讀若逵。”', '27.5602': '《說文》：“嘂，高聲也。一曰大呼也。从㗊，丩聲。《春秋公羊傳》曰：‘魯昭公叫然而哭。’”', '27.E1DC': '《說文》：“𦧥，歠也。从舌，沓聲。”', '27.E1E3': '《說文》：“𦱠，艸之相丩者。从茻，从丩，丩亦聲。”', '27.560F': '《說文》：“嘏，大、遠也。从古，叚聲。”', '27.8A9E': '《說文》：“語，論也。从言，吾聲。”', '27.8AA6': '《說文》：“誦，諷也。从言，甬聲。”', '27.8AA8': '《說文》：“誨，曉教也。从言，每聲。”', '27.8B28': '《說文》：“謨，議謀也。从言，莫聲。《虞書》曰：‘咎繇謨。’𠻚，古文謨从口。”', '27.8AA1': '《說文》：“誡，敕也。从言，戒聲。”', '27.8A8B': '《說文》：“誋，誡也。从言，忌聲。”', '27.8A93': '《說文》：“誓，約束也。从言，折聲。”', '27.E1F3': '《說文》：“誎，餔旋促也。从言，束聲。”', '27.8AAA': '《說文》：“說，說釋也。从言、兌。一曰談說。”', '27.8ABC': '《說文》：“誼，人所宜也。从言，从宜，宜亦聲。”', '27.E1F6': '《說文》：“誐，嘉善也。从言，我聲。《詩》曰：‘誐以溢我。’”', '27.8AA7': '《說文》：“誧，大也。一曰人相助也。从言，甫聲。讀若逋。”', '27.E1FA': '《說文》：“𧧹，待也。从言，伿聲。讀若䭆。”', '27.E1FD': '《說文》：“𧧻，慙語也。从言，作聲。”', '27.8A91': '《說文》：“誑，欺也。从言，狂聲。”', '27.8AA3': '《說文》：“誣，加也。从言，巫聲。”', '27.8AA4': '《說文》：“誤，謬也。从言，吳聲。”', '27.8A92': '《說文》：“誒，可惡之辭。从言，矣聲。一曰誒然。《春秋傳》曰：‘誒誒出出。’”', '27.8B40': '《說文》：“譀，誕也。从言，敢聲。𧧴，俗譀从忘。”', '27.8B59': '《說文》：“譙，嬈譊也。从言，焦聲。讀若嚼。誚，古文譙从肖。《周書》曰：‘亦未敢誚公。’”', '27.8A8C': '《說文新附》：“誌，記誌也。从言，志聲。”', '27.F0DB': '《說文》：“誩，競言也。从二言，讀若競。”', '27.97F6': '《說文》：“韶，虞舜樂也。《書》曰：‘簫韶九成，鳳皇來儀。’从音，召聲。”', '27.50D5': '《說文》：“僕，給事者。从人，从菐，菐亦聲。䑑，古文从臣。”', '27.E22F': '《說文》：“𠔯，賦事也。从菐，从八，八，分之也，八亦聲。讀若頒。一曰讀若非。”', '27.9784': '《說文》：“鞄，柔革工也。从革，包聲。讀若朴。《周禮》曰：‘柔皮之工，鮑氏。’ 鞄即鮑也。”', '27.977C': '《說文》：“靼，柔革也。从革，从旦聲。𩍕，古文靼从亶。”', '27.9780': '《說文》：“鞀，鞀遼也。从革，召聲。鞉，鞀或从兆；𪔛，鞀或从鼓，从兆；㲈，籀文鞀，从殸、召。”', '27.9783': '《說文》：“鞃，車軾也。从革，弘聲。《詩》曰：‘鞹鞃淺幭。’讀若穹。”', '27.E251': '《說文》：“䩛，車束也。从革，必聲。”', '27.9781': '《說文》：“鞁，車駕具也。从革，皮聲。”', '27.E25F': '《說文》：“䩞，鞌飾。从革，占聲。”', '27.9785': '《說文》：“鞅，頸靼也。从革，央聲。”', '27.E264': '《說文》：“𩉺，馬尾駝也。从革，它聲。今之般緧。”', '27.E269': '《說文》：“䰙，三足鍑也。一曰滫米器也。从鬲，支聲。”', '27.E279': '《說文》：“𩱓，粉餅也。从𩰲，耳聲。餌，𩱓或从食，耳聲。”', '27.E289': '《說文》：“𩰎，試力士錘也。从鬥，从戈，或从戰省。”', '27.7DCA': '《說文》：“緊，纏絲急也。从臤，从絲省。”', '27.81E7': '《說文》：“臧，善也。从臣，戕聲。𡒥，籀文。”', '27.6BC3': '《說文》：“毃，擊頭也。从殳，高聲。”', '27.E2A8': '《說文》：“𣪯，擊空聲也。从殳，宮聲。”', '27.76B8': '《說文新附》：“皸，足坼也。从皮，軍聲。”', '27.5FB9': '《說文》：“徹，通也。从彳，从攴，从育。𢖉，古文徹。”', '27.8087': '《說文》：“肇，擊也。从攴，肈省聲。”', '27.E2B8': '《說文》：“𢾭，𢻱也。从攴，尃聲。《周書》曰：‘用𢾭遺後人。’”', '27.6573': '《說文》：“敱，有所治也。从攴，豈聲。”', '27.E2C8': '《說文》：“𢾫，剌也。从攴，蚩聲。”', '27.6572': '《說文》：“敲，橫擿也。从攴，高聲。”', '27.723E': '《說文》：“爾，麗爾，猶靡麗也。从冂，从㸚，其孔㸚；尒聲。此與爽同意。”', '27.E2E5': '《說文》：“䁔，大目也。从目，爰聲。”', '27.E2E6': '《說文》：“睴，大目出也。从目，軍聲。”', '27.E2EC': '《說文》：“𥈆，低目視也。从目，冒聲。《周書》曰：‘武王惟𥈆。’”', '27.777D': '《說文》：“睽，目不相聽也。从目，癸聲。”', '27.7780': '《說文》：“瞀，氐目謹視也。从目，敄聲。”', '27.777C': '《說文》：“睼，迎視也。从目，是聲。讀若珥瑱之瑱。”', '27.E300': '《說文》：“䁊，短深目皃。从目，𥄗聲。”', '27.7761': '《說文》：“睡，坐寐也。从目、垂。”', '27.E308': '《說文》：“䁍，目陷也。从目，咸聲。”', '27.778D': '《說文》：“𥈟，無目也。从目，叜聲。”', '27.7782': '《說文》：“瞂，盾也。从盾，犮聲。”', '27.E30F': '《說文》：“𤾊，詞也。从白，𢏚聲。𢏚與疇同。《虞書》曰：‘帝曰𤾊咨。’”', '27.9F3B': '《說文》：“鼻，引气自畀也。从自、畀。”', '27.7FDF': '《說文》：“翟，山雉尾長者。从羽，从隹。”', '27.7FE1': '《說文》：“翡，赤羽雀也。出鬱林。从羽，非聲。”', '27.7FE0': '《說文》：“翠，青羽雀也，出鬱林。从羽，卒聲。”', '27.7FE5': '《說文》：“翥，飛舉也。从羽，者聲。”', '27.7FE3': '《說文》：“翣，棺羽飾也。天子八，諸侯六，大夫四，士二。下垂。从羽，妾聲。”', '27.96D2': '《說文》：“雒，鵋䳢也。从隹，各聲。”', '27.F647': '《說文》：“雐，鳥也。从隹，虍聲。”', '27.96CC': '《說文》：“雌，鳥母也。从隹，此聲。”', '27.F5C5': '《說文》：“蒦，規蒦，商也。从又持雈。一曰，視遽皃；一曰，蒦，度也。彠，蒦或从尋。尋亦度也。《楚詞》曰：‘求矩彠之所同。’”', '27.E335': '《說文》：“䍴，羊相𦎸也。从羊，委聲。”', '27.9D52': '《說文》：“鵒，鴝鵒也。从鳥，谷聲。古者鴝鵒不踰泲。𩀑，鵒或从隹、从臾。”', '27.9CF4': '《說文》：“鳴，鳥聲也。从鳥，从口。”', '27.9EBC': '《說文》：“麼，細也，从幺麻聲。”', '27.7590': '《說文》：“疐，礙不行也。从叀，引而止之也。叀者，如叀馬之鼻。从冂，此與牽同意。”', '27.F4BA': '《說文》：“㕡，溝也。从𣦼，从谷。讀若郝。壑，㕡或从土。”', '27.EBE6': '《說文》：“㕢，𣦼探堅意也。从𣦼，从貝。貝，堅寳也。”', '27.53E1': '《說文》：“叡，深明也；通也。从𣦼，从目，从谷省。睿，古文叡。壡，籀文叡从土。”', '27.6B9F': '《說文》：“殟，胎敗也。从歺，𥁕聲。”', '27.6BA0': '《說文》：“殠，腐气也。从歺，臭聲。”', '27.E37F': '《說文》：“㱯，殺羊出其胎也。从歺，豈聲。”', '27.818F': '《說文》：“膏，肥也。从肉，高聲。”', '27.81AB': '《說文》：“膫，牛腸脂也。从肉，尞聲。《詩》曰：‘取其血膫。’膋，膫或从勞省聲。”', '27.E3A1': '《說文》：“膎，脯也。从肉，奚聲。”', '27.818A': '《說文》：“膊，薄脯，膊之屋上。从肉，尃聲。”', '27.E3A8': '《說文》：“䐣，切孰肉內於血中和也。从肉，員聲。讀若遜。”', '27.E3A9': '《說文》：“䐝，觷也。从肉，𧴪聲。”', '27.E3AA': '《說文》：“䐞，肉表革裏也。从肉，弱聲。”', '27.E3AB': '《說文》：“𦞦，肉羹也。从肉，隺聲。”', '27.E3B2': '《說文》：“䐜，起也。从肉，真聲。”', '27.8150': '《說文》：“腐，爛也。从肉，府聲。”', '27.5283': '《說文》：“劃，錐刀曰劃。从刀，从畫，畫亦聲。”', '27.5280': '《說文》：“劀，刮去惡創肉也。从刀，矞聲。”', '27.7F70': '《說文》：“罰，辠之小者。从刀，从詈。未以刀有所賊，但持刀罵詈則應罰。”', '27.E3CD': '《說文》：“𠟃，減也。从刀，尊聲。”', '27.8024': '《說文》：“耤，帝耤千畝也。古者使民如借，故謂之耤。从耒，昔聲。”', '27.E3D2': '《說文》：“𦔐，除苗閒穢也。从耒，員聲。𦓷，𦔐或仌芸。”', '27.7B98': '《說文》：“箘，箘簬也。从竹，囷聲。一曰博棊也。”', '27.E3EB': '《說文》：“箁，竹箬也。从竹，咅聲。”', '27.7B8B': '《說文》：“箋，表識書也。从竹，戔聲。”', '27.7B75': '《說文》：“筵，竹席也。从竹，延聲。《周禮》曰：‘度堂以筵，筵一丈。’”', '27.7B85': '《說文》：“箅，蔽也。所以蔽甑底。从竹，畀聲。”', '27.7B84': '《說文》：“箄，簁箄也。从竹，卑聲。”', '27.7BB8': '《說文》：“箸，飯敧也。从竹，者聲。”', '27.7C0F': '《說文》：“簏，竹高篋也。从竹，鹿聲。箓，簏或从彔。”', '27.7B87': '《說文》：“箇，竹枚也。从竹，固聲。”', '27.E406': '《說文》：“𥮒，蔽絮簀也。从竹，沾聲。讀若錢。”', '27.7B91': '《說文》：“箑，扇也。从竹，疌聲。䈉，箑或从妾。”', '27.7B9D': '《說文》：“箝，籋也。从竹，拑聲。”', '27.7B99': '《說文》：“箙，弩矢箙也。从竹，服聲。《周禮》：‘仲秋獻矢箙。’”', '27.7B8F': '《說文》：“箏，鼓弦竹身樂也。从竹，爭聲。”', '27.7B9B': '《說文》：“箛，吹鞭也。从竹，孤聲。”', '27.7B97': '《說文》：“算，數也，从竹，从具，讀若筭。”', '27.89A1': '《說文》：“覡，能齋肅事神明也。在男曰覡，在女曰巫。从巫，从見。”', '27.5BE7': '《說文》：“寧，願詞也。从丂，寍聲。”', '27.5617': '《說文》：“嘗，口味之也。从旨，尚聲。”', '27.5609': '《說文》：“嘉，美也。从壴，加聲。”', '27.E441': '《說文》：“𧇽，鐘鼓之柎也。飾為猛獸。从虍，異象其下足。鐻，𧇽或从金，豦聲。虡，篆文𧇽省。”', '27.76E1': '《說文》：“盡，器中空也。从皿，㶳聲。”', '27.6705': '《說文》：“朅，去也。从去，曷聲。”', '27.E45A': '《說文》：“𧖺，血醢也。《禮》有𧖺醢，以牛乾脯粱麴鹽酒也。”', '27.F0C7': '《說文》：“䘓，羊凝血也。从血，臽聲。𧗜，䘓或从贛。”', '27.E463': '《說文》：“𤌌，深池也。从井，瑩省聲。”', '27.9905': '《說文》：“餅，麪餈也。从食，并聲。”', '27.9909': '《說文》：“餉，饟也。从食，向聲。”', '27.9900': '《說文》：“餀，食臭也。从食，艾聲。《爾雅》曰：‘餀謂之喙。’”', '27.7244': '《說文》：“牄，鳥獸來〔求〕食聲也。从倉，爿。《虞書》曰：‘鳥獸牄牄。’”', '27.E495': '《說文》：“䍌，小缶也。从缶，咅聲。”', '27.E498': '《說文》：“𦈸，瓦器也。从缶，或聲。”', '27.E49D': '《說文》：“𥏫，傷也。从矢，昜聲。”', '27.9EA7': '《說文》：“麧，堅麥也。从麥，气聲。”', '27.E4B7': '《說文》：“䴭，餅𥶶也。从麥，才聲。”', '27.97CE': '《說文》：“韎，茅蒐染韋也，一入曰韎。从韋，末聲。”', '27.699B': '《說文》：“榛，木也。从木，秦聲。一曰菆也。”', '27.E4DA': '《說文》：“㮩，木也。从木，息聲。”', '27.6997': '《說文》：“榗，木也。从木，晉聲。《書》曰：‘竹箭如榗。’”', '27.E4E5': '《說文》：“𣖼，大木。可為鉏柄。从木，𠣬聲。”', '27.69D0': '《說文》：“槐，木也。从木，鬼聲。”', '27.6996': '《說文》：“榖，楮也。从木，㱿聲。”', '27.69AE': '《說文》：“榮，桐木也。从木，熒省聲。一曰屋梠之兩頭起者為榮。”', '27.6999': '《說文》：“榙，榙𣝋，果似李。从木，荅聲。讀若嚃。”', '27.E4F2': '《說文》：“㮨，細理木也。从木，畟聲。”', '27.69D9': '《說文》：“槙，木頂也。从木，真聲。一曰仆木也。”', '27.69A3': '《說文》：“榣，樹動也。从木，䍃聲。”', '27.69C1': '《說文》：“槀，木枯也。从木，高聲。”', '27.6991': '《說文》：“榑，榑桑，神木，日所出也。从木，尃聲。”', '27.E4FF': '《說文》：“㮝，角械也。从木，郤聲。一曰木下白也。”', '27.69A6': '《說文》：“榦，築牆耑木也。从木，倝聲。”', '27.69CB': '《說文》：“構，蓋也。从木，冓聲。杜林以為椽桷字。”', '27.69B0': '《說文》：“榰，柱砥，古用木，今以石。从木，耆聲。《易》：‘榰恆凶。’”', '27.69B1': '《說文》：“榱，秦名為屋椽，周謂之榱，齊魯謂之桷。从木，衰聲。”', '27.E503': '《說文》：“㮰，梠也。从木，𣬉聲。讀若枇杷之枇。”', '27.69CF': '《說文》：“槏，戶也。从木，兼聲。”', '27.69CD': '《說文》：“槍，歫也。从木，倉聲。一曰槍欀也。”', '27.E50B': '《說文》：“槈，薅器也。从木，辱聲。鎒，或从金。”', '27.69C3': '《說文》：“槃，承槃也。从木，般聲。鎜，古文，从金。盤，籀文，从皿。”', '27.69B9': '《說文》：“榹，槃也。从木，虒聲。”', '27.69CC': '《說文》：“槌，關東謂之槌，關西謂之㭙。从木，追聲。”', '27.E519': '《說文》：“榺，機持經者。从木，朕聲。”', '27.E522': '《說文》：“槅，大車枙。从木，鬲聲。”', '27.69B7': '《說文》：“榷，水上横木所以渡者也。从木，隺聲。”', '27.69CE': '《說文》：“槎，衺斫也。从木，差聲。《春秋傳》曰：‘山不槎’。”', '27.E52B': '《說文》：“㮯，梡，木未析也。从木，圂聲。”', '27.69AD': '《說文新附》：“榭，臺有屋也。从木，䠶聲。”', '27.69CA': '《說文新附》：“槊，矛也。从木，朔聲。”', '27.69BB': '《說文新附》：“榻，牀也。从木，𦐇聲。”', '27.69D4': '《說文新附》：“槔，桔橰，汲水器也。从木，臯聲。”', '27.E53A': '《說文》：“䅩，多小意而止也。从𥝌，从支，只聲。一曰木也。”', '27.5718': '《說文》：“團，圜也。从囗，專聲。”', '27.5716': '《說文》：“圖，畫計難也。从口，从啚。啚，難意也。”', '27.E548': '《說文》：“𧶊，物數紛𧶊亂也。从員，云聲。讀若《春秋傳》曰：‘宋皇鄖。’”', '27.8CD1': '《說文》：“賬，富也。从貝，辰聲。”', '27.8CD3': '《說文》：“賓，所敬也。从貝，𡧍聲。𧶉，古文。”', '27.8CD2': '《說文》：“賒，貰買也。从貝，余聲。”', '27.8CD5': '《說文》：“賕，以財物枉法相謝也。从貝，求聲。一曰戴質也。”', '27.8CCF': '《說文》：“賏，頸飾也。从二貝。”', '27.9120': '《說文》：“鄠，右扶風縣名。从邑，雩聲。”', '27.E55A': '《說文》：“䣙，右扶風鄠鄉。从邑，崩聲。沛城父有䣙鄉。讀若陪。”', '27.911C': '《說文》：“𨞻，左馮翊縣。从邑，麃聲。”', '27.E55E': '《說文》：“䣝，左馮翊䣝陽亭。从邑，屠聲。”', '27.E561': '《說文》：“𨝋，周邑也。从邑，祭聲。”', '27.9121': '《說文》：“鄡，鉅鹿縣。从邑，梟聲。”', '27.911A': '《說文》：“鄚，涿郡縣。从邑，莫聲。”', '27.911B': '《說文》：“鄛，南陽棗陽鄉。从邑，巢聲。”', '27.E56B': '《說文》：“䣚，南陽穰鄉。从邑，婁聲。”', '27.9122': '《說文》：“鄢，南郡縣，孝惠三年改名宜城。从邑，焉聲。”', '27.9118': '《說文》：“鄘，南夷國。从邑，庸聲。”', '27.911E': '《說文》：“鄞，會稽縣。从邑，堇聲。”', '27.E577': '《說文》：“䣜，沛國縣。从邑，虘聲。”', '27.9123': '《說文》：“鄣，紀邑也。从邑，章聲。”', '27.E57D': '《說文》：“䣛，齊地也。从邑，桼聲。”', '27.E589': '《說文》：“𨝘，地名。从邑，虖聲。”', '27.911D': '《說文》：“鄝，地名。从邑，翏聲。”', '27.E58E': '《說文》：“𨝌，地名。从邑，乾聲。”', '27.E591': '《說文》：“䣘，地名。从邑，㙶聲。㙶，古堂字。”', '27.E594': '《說文》：“𨝍，地名。从邑，𠨧聲。”', '27.F3A6': '《說文》：“𨛜，鄰道也。从邑，从𨙨。闕。”', '27.E59A': '《說文》：“暤，晧旰也。从日，皋聲。”', '27.E59B': '《說文》：“𣉘，埃𣉘，日無光也。从日，能聲。”', '27.F5F8': '《說文》：“𣊡，眾微杪也。从日中視絲，古文以為顯字。或曰眾口皃。讀若唫唫。或以為繭。繭者，絮中往往有小繭也。”', '27.66A8': '《說文》：“暨，日頗見也。从旦，既聲。”', '27.65D7': '《說文》：“旗，熊旗五游，以象罰星，士卒以為期。从㫃，其聲。《周禮》曰：‘率都建旗。’”', '27.65D6': '《說文》：“旖，旗旖，施也。从㫃，奇聲。”', '27.5922': '《說文》：“夢，不明也。从夕，瞢省聲。”', '27.5924': '《說文》：“夤，敬惕也。从夕，寅聲。《易》曰：‘夕惕若夤。’”', '27.E5BC': '《說文》：“𡖶，𡧯也。从夕，莫聲。”', '27.5925': '《說文》：“㚌，齊謂多為㚌，从多，果聲。”', '27.E5BF': '《說文》：“㗬，厚脣皃。从多，从尚。”', '27.9F4A': '《說文》：“齊，禾麥吐穗上平也。象形。”', '27.7A2E': '《說文》：“種，先穜後孰也。从禾，重聲。”', '27.7A4A': '《說文》：“穊，稠也。从禾，既聲。”', '27.E5CF': '《說文》：“稬，沛國謂稻曰稬。从禾，耎聲。”', '27.E5D6': '《說文》：“𥠄，禾垂皃。从禾，耑聲。讀若端。”', '27.EEF7': '《說文》：“䅥，禾舉出苗也。从禾，曷聲。”', '27.E5E1': '《說文》：“稭，禾稾去其皮，祭天以為席。从禾，皆聲。”', '27.E5E6': '《說文》：“䅣，䅭䅣也。从禾，皇聲。”', '27.7A31': '《說文》：“稱，銓也。从禾，爯聲。春分而禾生，日夏至晷景可度，禾有秒，秋分而秒定。律數十二，秒而當一分，十分而寸。其以為重，十二粟為一分，十二分為一銖。故諸程品皆从禾。”', '27.7CBE': '《說文》：“精，擇也。从米，青聲。”', '27.7CBA': '《說文》：“粺，毇也。从米，卑聲。”', '27.7CB9': '《說文》：“粹，不雜也。从米，卒聲。”', '27.E600': '《說文》：“䊎，粉也。从米，卷聲。”', '27.7CBB': '《說文新附》：“粻，食米也。从米，長聲。”', '27.E619': '《說文》：“㝩，屋㝩㝗也。从宀，康聲。”', '27.5BDF': '《說文》：“察，覆也。从宀、祭。”', '27.5BE6': '《說文》：“實，富也。从宀，从貫。貫，貨貝也。”', '27.5BE1': '《說文》：“寡，少也。从宀，从頒。頒，分賦也，故為少。”', '27.5BE0': '《說文》：“寠，無禮居也。从宀，婁聲。”', '27.E62E': '《說文》：“㝪，屋傾下也。从宀，執聲。”', '27.7AA8': '《說文》：“窨，地室也。从穴，音聲。”', '27.7AAC': '《說文》：“窬，穿木戶也。从穴，俞聲。一曰空中也。”', '27.5BE2': '《說文》：“㝲，病卧也。从㝱省，𡩠省聲。”', '27.5BE4': '《說文》：“寤，寐覺而有信曰寤。从㝱省，吾聲。𡬑，籀文寤。”', '27.5BE3': '《說文》：“寣，卧驚也。一曰小兒號寣寣。一曰河內相𧦝也。从㝱省，从言。”', '27.760D': '《說文》：“瘍，頭創也。从疒，昜聲。”', '27.E64B': '《說文》：“𤺉，口咼也。从疒，為聲。”', '27.7616': '《說文》：“瘖，不能言也。从疒，音聲。”', '27.7615': '《說文》：“瘕，女病也。从疒，叚聲。”', '27.7627': '《說文》：“瘧，熱寒休作。从疒，从虐，虐亦聲。”', '27.E654': '《說文》：“㾫，半枯也。从疒，扁聲。”', '27.E657': '《說文》：“𤸱，跛病也。从疒，盍聲。讀若脅。又讀若掩。”', '27.7626': '《說文》：“𤸃，臞也。从疒，叜聲。”', '27.760C': '《說文》：“瘌，楚人謂藥毒曰痛瘌。从疒，剌聲。”', '27.7609': '《說文》：“瘉，病瘳也。从疒，俞聲。”', '27.E678': '《說文》：“罯，覆也。从网，音聲。”', '27.7F73': '《說文新附》：“罳，罘罳，屏也。从网，思聲。”', '27.E67B': '《說文》：“𢄢，禮巾也。从巾，从執。”', '27.5E63': '《說文》：“幣，帛也。从巾，敝聲。”', '27.5E58': '《說文》：“幘，髮有巾曰幘。从巾，責聲。”', '27.5E54': '《說文》：“幔，幕也。从巾，曼聲。”', '27.5E55': '《說文》：“幕，帷在上曰幕；覆食案亦曰幕。从巾，莫聲。”', '27.E687': '《說文》：“㡜，殘帛也。从巾，祭聲。”', '27.E68B': '《說文》：“幑，幟也。以絳幑帛箸於背。从巾，微省聲。《春秋傳》曰：‘揚幑者公徒。’”', '27.E68C': '《說文》：“幖，幟也。从巾，𤐫聲。”', '27.5E57': '《說文新附》：“幗，婦人首飾。从巾，國聲。”', '27.50EE': '《說文》：“僮，未冠也。从人，童聲。”', '27.50CE': '《說文》：“僎，具也。从人，巽聲。”', '27.50DA': '《說文》：“僚，好皃。从人，尞聲。”', '27.50D3': '《說文》：“僓，𡢃也。从人，貴聲。一曰長皃。”', '27.50D1': '《說文》：“僑，高也。从人，喬聲。”', '27.50E4': '《說文》：“僤，疾也。从人，單聲。《周禮》曰：句兵欲無僤。”', '27.50E9': '《說文》：“僩，武皃。从人，閒聲。《詩》曰：‘瑟兮僩兮。’”', '27.E6B0': '《說文》：“僟，精謹也。从人，幾聲。”', '27.50D6': '《說文》：“僖，樂也。从人，喜聲。”', '27.E6BC': '《說文》：“㒄，意膬也。从人，然聲。”', '27.50ED': '《說文》：“僭，假也。从人，朁聲。”', '27.E6C2': '《說文》：“僐，作姿也。从人，善聲。”', '27.50DB': '《說文》：“僛，醉舞皃。从人，欺聲。《詩》曰：屢舞僛僛。”', '27.50E8': '《說文》：“僨，僵也。从人，賁聲。”', '27.50D4': '《說文》：“僔，聚也。从人，尊聲。《詩》曰：僔沓背僧。”', '27.50CF': '《說文》：“像，象也。从人，从象，象亦聲。”', '27.50F0': '《說文》：“僰，犍為蠻夷。从人，棘聲。”', '27.50E5': '《說文》：“僥，南方有焦僥，人長三尺，短之極。从人，堯聲。”', '27.50E6': '《說文新附》：“僦，賃也。从人、就，就亦聲。”', '27.50E7': '《說文新附》：“僧，浮屠道人也。从人，曾聲。”', '27.805A': '《說文》：“聚，會也。从㐺，取聲。邑落云聚。”', '27.5FB5': '《說文》：“徵，召也。从微省，壬為徵，行於微而文達者即徵之。𢾷，古文徵。”', '27.76E3': '《說文》：“監，臨下也。从臥，䘓省聲。𧨭，古文監从言。”', '27.E6DC': '《說文》：“𧚨，䘳緣也。从衣，疌聲。”', '27.E6DD': '《說文》：“䘳，交衽也。从衣，金聲。”', '27.88EF': '《說文》：“裯，衣袂袛裯。从衣，周聲。”', '27.E6E1': '《說文》：“𧛔，衣躬縫。从衣，毒聲。讀若督。”', '27.88FE': '《說文》：“裾，衣袍也。从衣，居聲。讀與居同。”', '27.88FB': '《說文》：“裻，新衣聲。一曰背縫。从衣，叔聲。”', '27.88F4': '《說文》：“裴，長衣皃。从衣，非聲。”', '27.88E8': '《說文》：“裨，接益也。从衣，卑聲。”', '27.E6EF': '《說文》：“𧝹，袒也。从衣，𦝠聲。裸，或从果。”', '27.88FC': '《說文》：“裼，袒也。从衣，易聲。”', '27.88F9': '《說文》：“裹，纏也。从衣，果聲。”', '27.88FA': '《說文》：“裺，褗謂之裺。从衣，奄聲。”', '27.891A': '《說文》：“褚，卒也。从衣，者聲。一曰製衣。”', '27.88FD': '《說文》：“製，裁也。从衣，从制。”', '27.E6F6': '《說文》：“䘰，車溫也。从衣，延聲。”', '27.58FD': '《說文》：“壽，久也。从老省，𠷎聲。”', '27.E6FC': '《說文》：“𣯍，毛盛也。从毛，隼聲。《虞書》曰：‘鳥獸𣯍髦。’”', '27.E6FD': '《說文》：“㲦，獸豪也。从毛，倝聲。”', '27.6BFE': '《說文新附》：“毾，毾㲪也。从毛，𦐇聲。”', '27.5C62': '《說文新附》：“屢，數也。按今之婁字本是屢空字，此字後人所加，从尸未詳。”', '27.5162': '《說文》：“𠓆，競也。从二兄，二兄，競意。从丰聲。讀若矜。一曰：兢，敬也。”', '27.899D': '《說文》：“覝，察視也。从見，㶣聲。讀若鎌。”', '27.899E': '《說文》：“覞，竝視也。从二見。”', '27.E731': '《說文》：“𣣲，翕氣也。从欠，脅聲。”', '27.6B4C': '《說文》：“歌，詠也。从欠，哥聲。謌，謌（歌）或从言。”', '27.6B4D': '《說文》：“歍，心有所惡若吐也。从欠，烏聲。一曰口相就。”', '27.6B4B': '《說文》：“歋，人相笑相歋瘉。从欠，虒聲。”', '27.6B4A': '《說文》：“歊，歊歊，气出皃。从欠、高。高亦聲。”', '27.E73A': '《說文》：“𣣳，𣣳𣣳，气出皃。从欠，䍃聲。”', '27.F0EF': '《說文》：“𣣸，言意也。从欠，从𠧴，𠧴亦聲。讀若酉。”', '27.6B49': '《說文》：“歉，歉食不滿。从欠，兼聲。”', '27.E745': '《說文》：“䯉，咽中息不利也。从欠，骨聲。”', '27.9818': '《說文》：“領，項也。从頁，令聲。”', '27.78A9': '《說文》：“碩，頭大也。从頁，石聲。”', '27.E76E': '《說文》：“䪾，顏色䪾䫰慎事也。从頁，㐱聲。”', '27.E772': '《說文》：“䪼，頭頡䪼也。从頁，出聲。讀又若骨。”', '27.9817': '《說文》：“頗，頭偏也。从頁，皮聲。”', '27.9766': '《說文》：“靦，面見也。从面、見，見亦聲。《詩》曰：‘有靦面目’ 𩈍，或从旦。”', '27.5F70': '《說文》：“彰，文彰也。从彡，从章，章亦聲。”', '27.9AE6': '《說文》：“髦，髮也。从髟，从毛。”', '27.E79C': '《說文》：“䯰，簪結也。从髟，介聲。”', '27.E7A9': '《說文》：“𦓝，小巵也。从巵，耑聲。讀若捶擊之捶。”', '27.E7B6': '《說文》：“𠣿，飽也。从勹，㲃聲。民祭，祝曰：‘厭𠣿。’”', '27.9B42': '《說文》：“魂，陽氣也。从鬼，云聲。”', '27.9B3E': '《說文》：“鬾，鬼服也。一曰小兒鬼。从鬼，支聲。《韓詩》傳曰：‘鄭交甫逢二女，鬾服。’”', '27.E7BF': '《說文》：“𩲏，鬼變也。从鬼，化聲。”', '27.E7C8': '《說文》：“嶅，山多小石也。从山，敖聲。”', '27.E7DC': '《說文》：“𢊕，屋階中會也。从广，怱聲。”', '27.5ED9': '《說文》：“廙，行屋也。从广，異聲。”', '27.5ED4': '《說文》：“廔，屋麗廔也。从广，婁聲。一曰穜也。”', '27.5ED1': '《說文》：“廑，少劣之居。从广，堇聲。”', '27.5ED6': '《說文新附》：“廖，人姓。从广，未詳。當是省廫字尔。”', '27.53AC': '《說文》：“厬，仄出泉也。从厂，晷聲。”', '27.53AD': '《說文》：“厭，笮也。从厂，猒聲。一曰：合也。”', '27.78AD': '《說文》：“碭，文石也。从石，昜聲。”', '27.E7F5': '《說文》：“碝，石次玉者。从石，耎聲。”', '27.78A3': '《說文》：“碣，特立之石。東海有碣石山。从石，曷聲。𡄌，古文。”', '27.78AC': '《說文》：“碬，厲石也，从石叚聲。《春秋傳》曰：‘鄭公孫碬，字子石。’”', '27.E7F9': '《說文》：“䃍，陊也。从石，欮聲。”', '27.78D5': '《說文》：“磕，石聲。从石，盍聲。”', '27.789E': '《說文》：“碞，磛碞也。从石，品。《周書》曰：‘畏于民碞。’讀與巖同。”', '27.787E': '《說文新附》：“硾，擣也。从石，垂聲。”', '27.E80B': '《說文》：“豧，豕息也。从豕，甫聲。”', '27.8C68': '《說文》：“豨，豕走豨豨。从豕，希聲。古有封豨脩虵之害。”', '27.8C69': '《說文》：“豩，二豕也。豳从此。闕。”', '27.E810': '《說文》：“𩫚，豕，鬣如筆管者，出南郡。从㣇，高聲。𩫕，籀文从豕。”', '27.EEA5': '《說文》：“㣈，㣇屬，从二㣇。𠭾，古文㣈。《虞書》曰：‘㣈類于上帝’。”', '27.8C8D': '《說文》：“貍，伏獸，似貙。从豸，里聲。”', '27.99C1': '《說文》：“駁，馬色不純。从馬，爻聲。”', '27.E824': '《說文》：“馼，馬赤鬣縞身，目若黃金，名曰𩢌。吉皇之乘，周文王時犬戎獻之。从馬，从文，文亦聲。《春秋傳》曰：‘𩢌馬百駟。’畫馬也。西伯獻紂以全其身。”', '27.E825': '《說文》：“馶，馬彊也。从馬，支聲。”', '27.E828': '《說文》：“䭹，䭹䭹，馬怒皃。从馬，卬聲。”', '27.99BA': '《說文》：“馺，馬行相及也。从馬，从及。讀若《爾雅》‘小山馺大山，峘’。”', '27.E834': '《說文》：“𩡺，系馬尾也。从馬，介聲。”', '27.99BD': '《說文》：“馽，絆馬也。从馬，口其足。《春秋傳》曰：‘韓厥執馽前。’讀若輒。縶，馽或从糸，執聲。”', '27.99B9': '《說文》：“馹，驛傳也。从馬，日聲。”', '27.99C3': '《說文》：“駃，駃騠，馬父驘子也。从馬，夬聲。”', '27.E84A': '《說文》：“𪋻，鹿行揚土也。从麤，从土。”', '27.E857': '《說文》：“㺒，犬獿獿咳吠也。从犬，翏聲。”', '27.E858': '《說文》：“㺑，犬容頭進也。从犬，參聲。一曰賊疾也。”', '27.E866': '《說文》：“㺉，犬屬。𦝫已上黃，𦝫已下黑，食母猴。从犬，㱿聲，讀若構。或曰：㺉似牂羊，出蜀北嚻山中，犬首而馬尾。”', '27.734C': '《說文》：“獌，狼屬。从犬，曼聲。《爾雅》曰：‘貙獌似貍。’”', '27.E86A': '《說文》：“㺇，司空也。从㹜，臣聲。復說，獄司空。”', '27.7344': '《說文》：“獄，确也。从㹜，从言。二犬，所以守也。”', '27.718A': '《說文》：“熊，獸，似豕，山居，冬蟄。从能，炎省聲。”', '27.7187': '《說文》：“熇，火熱也。从火，高聲。”', '27.7184': '《說文》：“熄，畜火也。从火，息聲。亦曰滅火。”', '27.E887': '《說文》：“𤌍，灼也。从火，隺聲。”', '27.E889': '《說文》：“熑，火煣車網絕也。从火，兼聲。”', '27.7185': '《說文》：“熅，鬱煙也。从火，昷聲。”', '27.7199': '《說文》：“熙，燥也。从火，巸聲。”', '27.717D': '《說文新附》：“煽，熾盛也。从火，扇聲。”', '27.E899': '《說文》：“𦧡，火光也。从炎，舌聲。”', '27.9EE5': '《說文》：“黥，墨刑在面也。从黑，京聲。䵞，黥或从刀。”', '27.7192': '《說文》：“熒，屋下燈燭之光。从焱、冂。”', '27.8D6B': '《說文》：“赫，火赤皃。从二赤。”', '27.7AEF': '《說文》：“端，直也。从立，耑聲。”', '27.7AED': '《說文》：“竭，負舉也。从立，曷聲。”', '27.6128': '《說文》：“愨，謹也。从心，𣪊聲。”', '27.613F': '《說文》：“愿，謹也。从心，原聲。”', '27.F641': '《說文》：“㥯，謹也。从心，𤔌聲。”', '27.613B': '《說文》：“愻，順也。从心，孫聲。《唐書》曰：‘五品不愻。’”', '27.E8E9': '《說文》：“㥶，實也。从心，塞省聲。《虞書》曰：‘剛而㥶。’”', '27.6180': '《說文》：“憀，憀然也。从心，翏聲。”', '27.61FC': '《說文》：“懼，恐也。从心，瞿聲。愳，古文。”', '27.6152': '《說文》：“慒，慮也。从心，曹聲。”', '27.6154': '《說文》：“慔，勉也。从心，莫聲。”', '27.6153': '《說文》：“慓，疾也。从心，票聲。”', '27.6162': '《說文》：“慢，惰也。从心，曼聲。一曰慢，不畏也。”', '27.6172': '《說文》：“慲，忘也，慲兜也。从心，㒼聲。”', '27.6158': '《說文》：“慘，毒也。从心，參聲。”', '27.6147': '《說文》：“慇，痛也。从心，殷聲。”', '27.E91E': '《說文》：“傷，憂也。从心，殤省聲。”', '27.6141': '《說文》：“慁，憂也。从心，圂聲。一曰擾也。”', '27.617C': '《說文》：“慽，憂也。从心，戚聲。”', '27.6174': '《說文》：“慴，懼也。从心，習聲。讀若疊。”', '27.615A': '《說文》：“慙，媿也。从心，斬聲。”', '27.6175': '《說文新附》：“慵，嬾也。从心，庸聲。”', '27.615F': '《說文新附》：“慟，大哭也。从心，動聲。”', '27.6F3E': '《說文》：“漾，水。出隴西相道，東至武都為漢。从水，羕聲。瀁，古文从養。”', '27.6F22': '《說文》：“漢，漾也，東為滄浪水。从水，難省聲。㵄，古文。”', '27.6F06': '《說文》：“漆，水。出右扶風杜陵岐山，東入渭。一曰入洛。从水，桼聲。”', '27.6EFB': '《說文》：“滻，水。出京兆藍田谷，入霸。从水，產聲。”', '27.6F33': '《說文》：“漳，濁漳出上黨長子鹿谷山，東入清漳；清漳出沾山大要谷北入河；南漳出南郡臨沮。从水，章聲。”', '27.6F38': '《說文》：“漸，水。出丹陽黟南蠻中，東入海。从水，斬聲。”', '27.6EF6': '《說文》：“滶，水。出南陽魯陽，入城父。从水，敖聲。”', '27.6F37': '《說文》：“漷，水。在魯。从水，郭聲。”', '27.E937': '《說文》：“𣻐，水。出北地直路西，東入洛。从水，虘聲。”', '27.6EF1': '《說文》：“滱，水。起北地靈丘，東入河。从水，寇聲。滱水即漚夷水，幷州川也。”', '27.6F39': '《說文》：“漹，水。出西河中陽北沙，南入河。从水，焉聲。”', '27.6F20': '《說文》：“漠，北方流沙也。一曰清也。从水，莫聲。”', '27.6F14': '《說文》：“演，長流也。一曰水名。从水，寅聲。”', '27.6F3B': '《說文》：“漻，清深也。从水，翏聲。”', '27.703E': '《說文》：“瀾，大波為瀾。从水，闌聲。漣，瀾或从連。”', '27.6F02': '《說文》：“漂，浮也。从水，票聲。”', '27.6EF2': '《說文》：“滲，下漉也。从水，參聲。”', '27.6F3C': '《說文》：“漼，深也。从水，崔聲。《詩》曰：‘有漼者淵。’”', '27.6EFF': '《說文》：“滿，盈溢也。从水，㒼聲。”', '27.6F18': '《說文》：“漘，水厓也。从水，脣聲。《詩》曰：‘寘河之漘。’”', '27.6F40': '《說文》：“潨，小水入大水曰潨。从水，从眾。《詩》曰：‘鳧鷖在潨。’”', '27.6ECE': '《說文》：“滎，絕小水也。从水，熒省聲。”', '27.6F25': '《說文》：“漥，清水也。一曰窊也。从水，窐聲”', '27.6EF4': '《說文》：“滴，水注也。从水，啻聲。”', '27.6F0A': '《說文》：“漊，雨漊漊也。从水，婁聲。一曰汝南謂飲酒習之不醉為漊。”', '27.6F2C': '《說文》：“漬，漚也。从水，責聲。”', '27.6F1A': '《說文》：“漚，久漬也。从水，區聲。”', '27.6EEF': '《說文》：“滯，凝也。从水，帶聲。”', '27.6F2E': '《說文》：“漮，水虛也。从水，康聲。”', '27.E965': '《說文》：“滰，浚乾漬米也。从水，竟聲。《孟子》曰：‘夫子去齊，滰淅而行。’”', '27.6EEB': '《說文》：“滫，久泔也。从水，脩聲。”', '27.6ECC': '《說文》：“滌，洒也。从水，條聲。”', '27.6F31': '《說文》：“漱，盪口也。从水，欶聲。”', '27.6F4E': '《說文》：“潎，於水中擊絮也。从水，敝聲。”', '27.6F15': '《說文》：“漕，水轉轂（穀）也。一曰人之所乘及船也。从水，曹聲。”', '27.6F0F': '《說文》：“漏，以銅受水刻節，晝夜百刻。从水，屚聲。”', '27.6F19': '《說文新附》：“漙，露皃。从水，專聲。”', '27.6F35': '《說文新附》：“漵，水浦也。从水，敘聲。”', '27.7CBC': '《說文》：“粼，水生厓石間粼粼也。从巜，粦聲。”', '27.51D8': '《說文》：“凘，流仌也。从仌，斯聲。”', '27.E98B': '《說文》：“𩂣，雨零也。从雨，各聲。”', '27.E993': '《說文》：“𩂢，霖雨也。南陽謂霖𩂢。从雨，㐺聲。”', '27.9700': '《說文》：“需，𩓣也，遇雨不進止𩓣也。从雨，而聲。《易》曰：‘雲上於天，需。’”', '27.E99B': '《說文》：“䨒，水音也。从雨，羽聲。”', '27.9B60': '《說文》：“魠，哆口魚也。从魚，乇聲。”', '27.E9D0': '《說文》：“𩼪，捕魚也。从𩺰，从水。漁，篆文𩼪从魚。”', '27.E9D4': '《說文》：“𨻼，牢也，所以拘非也。从非，陛省聲。”', '27.81FA': '《說文》：“臺，觀，四方而高者。从至、从之、从高省。與室屋同意。”', '27.95A8': '《說文》：“閨，特立之戶，上圜下方，有似圭。从門，圭聲。”', '27.95A4': '《說文》：“閤，門旁戶也。从門，合聲。”', '27.95A3': '《說文》：“閣，所以止扉也。从門，各聲。”', '27.95A1': '《說文》：“閡，外閉也。从門，亥聲。”', '27.95A5': '《說文新附》：“閥，閥閱，自序也。从門，伐聲，義當通用伐。”', '27.805E': '《說文》：“聞，知聞也。从耳，門聲。䎽，古文从昏。”', '27.805D': '《說文》：“聝，軍戰斷耳也。《春秋傳》曰：‘以為俘聝。’从耳，或聲。馘，聝或从首。”', '27.6473': '《說文》：“摳，繑也。一曰摳衣升堂。从手，區聲。”', '27.6467': '《說文》：“摧，擠也。从手，崔聲。一曰挏也。一曰折也。”', '27.645B': '《說文》：“摛，舒也。从手，离聲。”', '27.EA07': '《說文》：“𢱬，撮也。从手，𥵱省聲。”', '27.EA0A': '《說文》：“㨷，拭也。从手，堇聲。”', '27.645C': '《說文》：“摜，習也。从手，貫聲。《春秋傳》曰：‘摜瀆鬼神。’”', '27.647D': '《說文》：“摽，擊也。从手，票聲。”', '27.6458': '《說文》：“摘，拓果樹實也。从手，啻聲。”', '27.647A': '《說文》：“摺，敗也。从手，習聲。”', '27.645F': '《說文》：“摟，曳聚也。从手，婁聲。”', '27.642B': '《說文》：“搫，搫擭，不正也。从手，般聲。”', '27.644D': '《說文》：“摍，蹴引也。从手，宿聲。”', '27.6487': '《說文》：“撆，別也；一曰擊也。从手，敝聲。”', '27.6476': '《說文》：“摶，圜也。从手，專聲。”', '27.644E': '《說文》：“摎，縛殺也。从手，翏聲。”', '27.6477': '《說文》：“摷，拘擊也。从手，巢聲。”', '27.646C': '《說文》：“摬，中擊也。从手，竟聲。”', '27.EA29': '《說文》：“摼，擣頭也。从手，堅聲。”', '27.6466': '《說文新附》：“摦，橫大也。从手，瓠聲。”', '27.6475': '《說文新附》：“摵，捎也。从手，戚聲。”', '27.6474': '《說文新附》：“摴，舒也。又摴蒲戲也。从手，雩聲。”', '27.5ADB': '《說文》：“嫛，婗也。从女，殹聲。”', '27.5AD7': '《說文》：“嫗，母也。从女，區聲。”', '27.5AE3': '《說文》：“嫣，長皃。从女，焉聲。”', '27.5AD9': '《說文》：“嫙，好也。从女，旋聲。”', '27.5AE2': '《說文》：“嫢，媞也。从女，規聲。讀若癸。秦晉謂細為嫢。”', '27.5AE1': '《說文》：“嫡，孎也。从女，啻聲。”', '27.5AE5': '《說文》：“嫥，壹也。从女，專聲。一曰嫥嫥。”', '27.EA55': '《說文》：“嫧，齊也。从女，責聲。”', '27.5AEA': '《說文》：“嫪，婟也。从女，翏聲。”', '27.EA60': '《說文》：“㜘，嬌也。从女，虘聲。”', '27.5AF3': '《說文》：“嫳，易使怒也。从女，敝聲。讀若擊撆。”', '27.EA66': '《說文》：“㜝，含怒也。一曰難知也。从女，酓聲。《詩》曰：‘碩大且㜝。’”', '27.5AD6': '《說文》：“嫖，輕也。从女，票聲。”', '27.5ADA': '《說文》：“嫚，侮易也。从女，曼聲。”', '27.EA73': '《說文》：“㜗，婪也。从女，參聲。”', '27.5AEB': '《說文》：“𡠜，𡠜母也，都醜也。从女，莫聲。”', '27.EA7D': '《說文》：“嫯，侮易也。从女，敖聲。”', '27.5AE0': '《說文新附》：“嫠，無夫也。从女，𠩺聲。”', '27.EA81': '《說文》：“𣱐，卧也。从氐，垔聲。”', '27.F111': '《說文》：“肈，上諱。”', '27.6229': '《說文》：“戩，滅也。从戈，晉聲。《詩》曰：‘實始戩商。’”', '27.5331': '《說文》：“匱，匣也。从匚，貴聲。”', '27.5330': '《說文》：“匰，宗廟盛主器也。《周禮》曰：‘祭祀共匰主。’从匚，單聲。”', '27.7504': '《說文》：“甄，匋也。从瓦，垔聲。”', '27.7502': '《說文》：“甂，似小瓿，大口而卑，用食。从瓦，扁聲。”', '27.7503': '《說文》：“甃，井壁也。从瓦，秋聲。”', '27.EEEF': '《說文》：“㼲，蹈瓦聲。从瓦，耎聲。”', '27.5F44': '《說文》：“彄，弓弩耑弦所居也。从弓，區聲。”', '27.5F43': '《說文》：“彃，䠶也。从弓，畢聲。”', '27.EAAF': '《說文》：“𤣨，不成遂，急戾也。从弦省，曷聲，讀若瘞葬。”', '27.7DBF': '《說文》：“緜，聯微也。从糸，从帛。”', '27.7DD2': '《說文》：“緒，絲耑也。从糸，者聲。”', '27.7D9C': '《說文》：“綜，機縷也。从糸，宗聲。”', '27.7DB9': '《說文》：“綹，緯十縷為綹。从糸，咎聲。讀若柳。”', '27.EAC1': '《說文》：“緈，直也。从糸，㚔聲。讀若陘。”', '27.EAC3': '《說文》：“䋰，約也。从糸，具聲。”', '27.7D9D': '《說文》：“綝，止也。从糸，林聲。讀若郴。”', '27.7DBA': '《說文》：“綺，文繒也。从糸，奇聲。”', '27.7DAE': '《說文》：“綮，㨖繒也。一曰幑幟信也，有齒。从糸，𢼄聲。”', '27.7DBE': '《說文》：“綾，東齊謂布帛之細曰綾。从糸，夌聲。”', '27.7DC0': '《說文》：“緀，白文皃。《詩》曰：‘緀兮斐兮，成是貝錦。’从糸，妻聲。”', '27.7DA0': '《說文》：“綠，帛青黃色也。从糸，彔聲。”', '27.7DB0': '《說文》：“綰，惡也，絳也。从糸，官聲。一曰綃也。讀若雞卵。”', '27.7DAA': '《說文》：“綪，赤繒也。从茜染，故謂之綪。从糸，青聲。”', '27.F064': '《說文》：“綥，帛蒼艾色。从糸，畀聲。《詩》曰：‘縞衣綥巾，未嫁女所服。’一曰不借綥。綦，綥或从其。”', '27.7DC7': '《說文》：“緇，帛黑色也。从糸，甾聲。”', '27.7D9F': '《說文》：“綟，帛戾艸染色。从糸，戾聲。”', '27.7DC2': '《說文》：“緂，白鮮衣皃。从糸，炎聲。謂衣采色鮮也。”', '27.7DCC': '《說文》：“緌，系冠纓也。从糸，委聲。”', '27.7DC4': '《說文》：“緄，織帶也。从糸，昆聲。”', '27.7DAC': '《說文》：“綬，韍維也。从糸，受聲。”', '27.7DB8': '《說文》：“綸，青絲綬也。从糸，侖聲。”', '27.EAD6': '《說文》：“緃，䋐屬。从糸，从從省聲。”', '27.EAD8': '《說文》：“綫，縷也。从糸，戔聲。線，古文綫。”', '27.7DC1': '《說文》：“緁，緶衣也。从糸，疌聲。䌌，緁或从習。”', '27.EADE': '《說文》：“䋫，䊸未縈繩。一曰急弦之聲。从糸，爭聲。讀若旌。”', '27.7DAD': '《說文》：“維，車蓋維也。从糸，隹聲。”', '27.EAEC': '《說文》：“緍，釣魚𦅾也。从糸，昏聲。吳人解衣相被謂之緍。”', '27.EAED': '《說文》：“䋨，治敝絮也。从糸，咅聲。”', '27.7DC6': '《說文》：“緆，細布也。从糸，易聲。𪎥，緆或从麻。”', '27.7DC9': '《說文》：“緉，履兩枚也。一曰絞也。从糸，从兩。兩亦聲。”', '27.7DA2': '《說文》：“綢，繆也。从糸，周聲。”', '27.5F5D': '《說文》：“彝，宗廟常器也。从糸，糸，綦也。廾，持。米，器中寶也。彑聲。此與爵相似。《周禮》：‘六彝：雞彝、鳥彝、黄彝、虎彝、蟲彝、斝彝，以待裸將之禮。’ 𦇚、𢇏，皆古文彝。”', '27.7DCB': '《說文新附》：“緋，帛赤色也。从糸，非聲。”', '27.7DC5': '《說文新附》：“緅，帛青赤色也。从糸，取聲。”', '27.7DA3': '《說文新附》：“綣，繾綣也。从糸，卷聲。”', '27.EAFD': '《說文》：“繛，𦅻也。从素，卓聲。綽，繛或省。”', '27.8725': '《說文》：“蜥，蜥易也。从虫，析聲。”', '27.872D': '《說文》：“蜭，毛蠹也。从虫，臽聲。”', '27.8730': '《說文》：“蜰，盧蜰也。从虫，肥聲。”', '27.EB0E': '《說文》：“𧒘，𧒘蠃，蒲盧，細要土蠭也。天地之性，細要純雄。《詩》曰：‘螟𧕅有字，𧒘蠃負之。’从虫，鬲聲。蜾，蜾或从果。”', '27.8728': '《說文》：“蜨，蛺蜨也。从虫，疌聲。”', '27.873A': '《說文》：“蜺，寒蜩也。从虫，兒聲。”', '27.873B': '《說文》：“蜻，蜻蛚也。从虫，青聲。”', '27.EB15': '《說文》：“蜹，秦晉謂之蜹，楚謂之蚊。从虫，芮聲。”', '27.8721': '《說文》：“蜡，蠅䏣也。《周禮》：‘蜡氏掌除骴。’从虫，昔聲。”', '27.8741': '《說文》：“蝁，镻也。从虫，亞聲。”', '27.8726': '《說文》：“蜦，蛇屬，黑色，潛于神淵，能興風雨。从虫，侖聲。讀若戾艸。蜧，蜦或从戾。”', '27.EB1E': '《說文》：“䗇，䗇鼀，詹諸。以脰鳴者。从虫，匊聲。”', '27.872E': '《說文》：“蜮，短狐也。似鼈，三足，以气䠶害人。从虫，或聲。蟈，蜮又从國。”', '27.EB23': '《說文》：“蜽，蛧蜽也。从虫，兩聲。”', '27.873C': '《說文》：“蜼，如母猴，卬鼻長尾。从虫，隹聲。”', '27.95A9': '《說文》：“閩，東南越。蛇穜。从虫，門聲。”', '27.8740': '《說文》：“蝀，螮蝀也。从虫，東聲。”', '27.8711': '《說文新附》：“蜑，南方夷也。从虫，延聲。”', '27.8722': '《說文新附》：“蜢，虴蜢也。从虫，孟聲。”', '27.EB2D': '《說文》：“𧓎，𧓎蛸也。从䖵，卑聲。𧌠，𧓎或从虫。”', '27.EB2F': '《說文》：“𧖅，蠭甘飴也。一曰螟子。从䖵，鼏聲。蜜，𧖅或从宓。”', '27.8822': '《說文》：“蠢，蟲動也。从䖵，春聲。古文蠢从𢦒。《周書》曰：‘我有𢧸于西。’”', '27.EB3B': '《說文》：“𧕿，臭蟲，負蠜也。从蟲，非聲。蜚，𧕿或从虫。”', '27.EB3E': '《說文》：“𩖶，小風也。从風，朮聲。”', '27.98C6': '《說文》：“飆，扶摇風也。从風，猋聲。颮，飆或从包。”', '27.98AF': '《說文》：“颯，翔風也。从風，立聲。”', '27.98AD': '《說文新附》：“颭，風吹浪動也。从風，占聲。”', '27.EB4B': '《說文》：“䵹，䵹鼄，蟊也。从黽，𣉻省聲。𧐉，或从虫。”', '27.5890': '《說文》：“墐，涂也。从土，堇聲。”', '27.5889': '《說文》：“墉，城垣也。从土，庸聲。𩫖，古文墉。”', '27.588A': '《說文》：“墊，下也。《春秋傳》曰‘墊隘’。从土，執聲。”', '27.5887': '《說文》：“墇，擁也。”', '27.5879': '《說文》：“塹，阬也；一曰大也。从土，斬聲。”', '27.EB73': '《說文》：“㙤，𡍩也。从土，虖聲。𨻲，㙤或从𨸏。”', '27.587A': '《說文》：“塺，塵也。从土，麻聲。”', '27.587F': '《說文》：“塿，塺土。从土，婁聲。”', '27.EB76': '《說文》：“㙠，塵埃也。从土，殹聲。”', '27.5893': '《說文》：“墓，丘也。从土，莫聲。”', '27.5883': '《說文新附》：“境，疆也。从土，竟聲。經典通用竟。”', '27.587E': '《說文新附》：“塾，門側堂也。从土，孰聲。”', '27.EB82': '《說文》：“𤲬，城下田也。一曰𤲬，郤也。从田，耎聲。”', '27.EB84': '《說文》：“㽥，和田也。从田，柔聲。”', '27.F0E6': '《說文》：“畼，不生也。从田，昜聲。”', '27.EB94': '《說文》：“𠢤，勥也。从力，厥聲。”', '27.EB97': '《說文》：“勨，繇緩也。从力，象聲。”', '27.52E9': '《說文》：“勩，勞也。《詩》曰：‘莫知我勩。’从力，貰聲。”', '27.9280': '《說文》：“銀，白金也。从金，艮聲。”', '27.9285': '《說文》：“銅，赤金也。从金，同聲。”', '27.9435': '《說文》：“鐵，黑金也。从金，𢧜聲。𨫓，鐵或省。銕，古文鐵从夷。”', '27.9291': '《說文》：“銑，金之澤者。一曰小鑿。一曰鐘兩角謂之銑。从金，先聲。”', '27.9279': '《說文》：“鉹，曲鉹也。从金，多聲。一曰鬵鼎。讀若𢴨，一曰《詩》云‘侈兮哆兮’。”', '27.9276': '《說文》：“鉶，器也。从金，刑聲。”', '27.929A': '《說文》：“銚，温器也。一曰田器。从金，兆聲。”', '27.928E': '《說文》：“銎，斤釜穿也。从金，巩聲。”', '27.922D': '《說文》：“鈭，鈭錍，釜也。从金，此聲。”', '27.929B': '《說文》：“銛，鍤屬。从金，舌聲。讀若棪，桑欽讀若鐮。”', '27.EBAF': '《說文》：“䤥，臿屬。从金，危聲。一曰瑩鐵也。讀若跛行。”', '27.EBB2': '《說文》：“鉵，㭒屬。从金，蟲省聲。讀若同。”', '27.928D': '《說文》：“銍，穫禾短鎌也。从金，至聲。”', '27.9293': '《說文》：“銓，衡也。从金，全聲。”', '27.9296': '《說文》：“銖，權十分黍之重也。从金，朱聲。”', '27.929C': '《說文》：“銜，馬勒口中。从金，从行。銜，行馬者也。”', '27.927B': '《說文》：“鉻，𩮜也。从金，各聲。”', '27.9298': '《說文新附》：“銘，記也。从金，名聲。”', '27.65A1': '《說文》：“斡，蠡柄也。从斗，倝聲。揚雄杜林說，皆以為軺車輪斡。”', '27.9B41': '《說文》：“魁，羹斗也，从斗。鬼聲。”', '27.65A0': '《說文》：“斠，平斗斛也。从斗，冓聲。”', '27.8F15': '《說文》：“輕，輕車也。从車，巠聲。”', '27.8F12': '《說文》：“輒，車兩輢也。从車，耴聲。”', '27.8F11': '《說文》：“輑，軺車前橫木也。从車，君聲。讀若帬，又讀若褌。”', '27.EBF4': '《說文》：“𨌅，連車也。一曰卻車抵堂為𨌅。从車，差省聲。讀若遟。”', '27.8F13': '《說文》：“輓，引之也。从車，免聲。”', '27.8F14': '《說文》：“輔，人頰車也。从車，甫聲。”', '27.EC55': '《說文》：“䧢，㩻也。从𨸏，區聲。”', '27.EBFF': '《說文》：“𨻺，仄也。从𨸏，从頃，頃亦聲。”', '27.969C': '《說文》：“障，隔也。从𨸏，章聲。”', '27.969B': '《說文》：“際，壁會也。从𨸏，祭聲。”', '27.7DB4': '《說文》：“綴，合箸也。从叕，从糸。”', '27.EC19': '《說文》：“𣉩，闕。”', '27.F0D0': '《說文》：“辡，辠人相與訟也。从二辛。”', '27.7591': '《說文》：“疑，惑也。从子、止、匕，矢聲。”', '27.6704': '《說文》：“𣍃，擊小鼓引樂聲也。从申，柬聲。”', '27.9174': '《說文》：“酴，酒母也。从酉，余聲。讀若廬。”', '27.EC30': '《說文》：“䣺，𨢌酒也。从酉，肙聲。”', '27.9177': '《說文》：“酷，酒厚味也。从酉，告聲。”', '27.917A': '《說文》：“酺，王德布，大㱃酒也。从酉，甫聲。”', '27.9172': '《說文》：“酲，病酒也。一曰醉而覺也。从酒，呈聲。”', '27.9178': '《說文》：“酸，酢也。从酉，夋聲。關東謂酢曰酸。𨢽，籀文酸从畯。”', '27.9179': '《說文》：“酹，餟祭也。从酉，寽聲。”', '27.799B': '《說文》：“禛，以真受福也。从示，真聲。”', '27.79A0': '《說文》：“禠，福也。从示，虒聲。”', '27.E00D': '《說文》：“𥛅，祝𥛅也。从示，留聲。”', '27.799C': '《說文》：“禜，設緜蕝為營，以禳風雨雪霜水旱癘疫於日月星辰山川也。从示，榮省聲。一曰禜，衛使灾不生。《禮記》曰：‘雩禜祭水旱。’”', '27.79A1': '《說文》：“禡，師行所止，恐有慢其神，下而祀之曰禡。从示，馬聲。《周禮》曰：‘禡於所征之地。’”', '27.747E': '《說文》：“瑾，瑾瑜，美玉也。从玉，堇聲。”', '27.748B': '《說文》：“璋，剡上為圭，半圭為璋。从玉，章聲。《禮》六幣：圭以馬，璋以皮，璧以帛，琮以錦，琥以繡，璜以黼。”', '27.E023': '《說文》：“𤪌，弁飾往往冒玉也。从玉，綦聲。璂，𤪌或从基。”', '27.7469': '《說文》：“瑩，玉色。从玉，熒省聲。一曰石之次玉者。《逸論語》曰：‘如玉之瑩。’”', '27.E02C': '《說文》：“璓，石之次玉者。从玉，莠聲。《詩》曰：‘充耳璓瑩。’”', '27.7485': '《說文》：“璅，石之似玉者。从玉，巢聲。”', '27.7481': '《說文》：“璁，石之似玉者。从玉，悤聲。讀若蔥。”', '27.7480': '《說文新附》：“璀，璀璨，玉光也。从玉，崔聲。”', '27.E046': '《說文》：“𨌥，車笭閒皮篋，古者使奉玉以藏之。从車、𤤴。讀與服同。”', '27.58FF': '《說文》：“壿，舞也。《詩》曰：‘壿壿舞我。’”', '27.E04E': '《說文》：“䔬，芓也。从艸，異聲。”', '27.84FC': '《說文》：“蓼，辛菜，薔虞也。从艸，翏聲。”', '27.84F6': '《說文》：“蓶，菜也。从艸，唯聲。”', '27.84E9': '《說文》：“蓩，卷耳也。从艸，務聲。”', '27.E067': '《說文》：“𦸂，蒲蒻之類也。从艸，深聲。”', '27.84F7': '《說文》：“蓷，雈也。从艸，推聲。《詩》曰：‘中谷有蓷。’”', '27.84F2': '《說文》：“蓲，艸也。从艸，區聲。”', '27.8517': '《說文》：“蔗，藷蔗也。从艸，庶聲。”', '27.8529': '《說文》：“蔩，兔苽也。从艸，寅聲。”', '27.84E8': '《說文》：“蓨，苖也。从艸，脩聲。”', '27.E075': '《說文》：“𧀦，艸也。可以束。从艸，魯聲。蓾，𧀦或从鹵。”', '27.851E': '《說文》：“蔞，艸也，可以亨魚。从艸，婁聲。”', '27.E078': '《說文》：“蔁，艸也。从艸，章聲。”', '27.8526': '《說文》：“蔦，寄生也。从艸，鳥聲。《詩》曰：‘蔦與女蘿。’樢，蔦或从木。”', '27.8506': '《說文》：“蔆，芰也，从艸，淩聲。楚謂之芰，秦謂之薢茩。𧁽，司馬相如說蔆从遴。”', '27.84EE': '《說文》：“蓮，芙蕖之實也。从艸，連聲。”', '27.8524': '《說文》：“蔤，芙蕖本。从艸，密聲。”', '27.851A': '《說文》：“蔚，牡蒿也。从艸，尉聲。”', '27.8513': '《說文》：“蔓，葛屬。从艸，曼聲。”', '27.8523': '《說文》：“蔣，苽蔣也。从艸，將聲。”', '27.8508': '《說文》：“蔈，苕之黃華也。从艸，𤐫聲。一曰末也。”', '27.E096': '《說文》：“䔟，艸萎䔟。从艸，移聲。”', '27.8515': '《說文》：“蔕，瓜當也。从艸，帶聲。”', '27.84FB': '《說文》：“蓻，艸木不生也。一曰茅芽。从艸，執聲。”', '27.852D': '《說文》：“蔭，艸陰地。从艸，陰聲。”', '27.E09B': '《說文》：“䔏，艸皃。从艸，造聲。”', '27.853D': '《說文》：“蔽，蔽蔽，小艸也。从艸，敝聲。”', '27.852B': '《說文》：“蔫，菸也。从艸，焉聲。”', '27.8521': '《說文》：“蔡，艸也。从艸，祭聲。”', '27.852A': '《說文》：“蔪，艸相蔪苞也。从艸，斬聲。《書》曰：‘艸木蔪苞。’𧀵、蔪或从槧。”', '27.850E': '《說文》：“蔎，香艸也。从艸，設聲。”', '27.84F4': '《說文》：“蓴，蒲叢也。从艸，專聲。”', '27.851F': '《說文》：“蔟，行蠶蓐。从艸，族聲。”', '27.8525': '《說文》：“蔥，菜也。从艸，囱聲。”', '27.84F3': '《說文》：“蓳，艸也，根如薺，葉如細柳。蒸食之，甘。从艸，堇聲。”', '27.E0C2': '《說文》：“蓸，艸也。从艸，曹聲。”', '27.852C': '《說文新附》：“蔬，菜也。从艸，疏聲。”', '27.E0D2': '《說文》：“犙，三歲牛。从牛，參聲。”', '27.E0DC': '《說文》：“㹌，畜牷也。从牛，產聲。”', '27.729B': '《說文》：“犛，西南夷長髦牛也。从牛，𠩺聲。”', '27.6C02': '《說文》：“氂，犛牛尾也。从犛省，从毛。”', '27.E0E8': '《說文》：“㗱，噍也。从口，集聲。”', '27.F0E2': '《說文》：“噍，齧也。从口，焦聲。嚼，噍或从爵。”', '27.5630': '《說文》：“嘰，小食也。从口，幾聲。”', '27.563D': '《說文》：“嘽，喘息也。一曰喜也。从口，單聲。”', '27.5653': '《說文》：“噓，吹也。从口，虛聲。”', '27.5642': '《說文》：“噂，聚語也。从口，尊聲。《詩》曰：‘噂沓背憎’。”', '27.E0F4': '《說文》：“嘫，語聲也。从口，然聲。”', '27.562F': '《說文》：“嘯，吹聲也。从口，肅聲。歗，籀文嘯从欠。”', '27.563E': '《說文》：“嘾，含深也。从口，覃聲。”', '27.564E': '《說文》：“噎，飯窒也。从口，壹聲。”', '27.562E': '《說文》：“嘮，嘮呶，讙也。从口，勞聲。”', '27.5674': '《說文》：“噴，吒也。从口，賁聲。一曰鼓鼻。”', '27.564A': '《說文》：“噊，危也。从口，矞聲。”', '27.5635': '《說文》：“嘵，懼也。从口，堯聲。《詩》曰：‘唯予音之嘵嘵。’”', '27.5646': '《說文》：“噆，嗛也。从口，朁聲。”', '27.5632': '《說文新附》：“嘲，謔也。从口，朝聲。《漢書》通用啁。”', '27.F4C0': '《說文》：“𤕦，亂也。从爻工交吅。一曰室𤕦，讀若禳。𤕧，籀文𤕦。”', '27.8DA3': '《說文》：“趣，疾也。从走，取聲。”', '27.E114': '《說文》：“趞，趞趞也。一曰行皃。从走，昔聲。”', '27.E115': '《說文》：“𧼏，急走也。从走，弦聲。”', '27.E117': '《說文》：“𧼒，行皃。从走，臤聲。讀若菣。”', '27.E11C': '《說文》：“𧼐，走意。从走，囷聲。”', '27.8D9B': '《說文》：“趛，低頭疾行也。从走，金聲。”', '27.8DA0': '《說文》：“趠，遠也。从走，卓聲。”', '27.E136': '《說文》：“𧼗，走也。从走，岪聲。”', '27.8D9C': '《說文》：“趜，窮也。从走，匊聲。”', '27.E13B': '《說文》：“趢，䟒趢也。从走，彔聲。”', '27.E140': '《說文》：“䞳，僵也。从走，咅聲。讀若匐。”', '27.8DA1': '《說文》：“趡，動也。从走，隹聲。《春秋傳》曰：‘盟于趡。’趡，地名。”', '27.E159': '《說文》：“䢦，先道也。从辵，率聲。”', '27.E15B': '《說文》：“𨖏，恭謹行也。从辵，㲃聲。讀若九。”', '27.9069': '《說文》：“適，之也。从辵，啻聲。適，宋、魯語。”', '27.E162': '《說文》：“遦，習也。从辵，貫聲。”', '27.906D': '《說文》：“遭，遇也。从辵，曹聲。一曰邐行。”', '27.9070': '《說文》：“遰，去也。从辵，帶聲。”', '27.906F': '《說文》：“遯，逃也。从辵，从豚。”', '27.906E': '《說文》：“遮，遏也。从辵，庶聲。”', '27.E181': '《說文》：“遱，連遱也。从辵，婁聲。”', '27.5FB7': '《說文》：“德，升也。从彳，𢛳聲。”', '27.5FB2': '《說文》：“徲，久也。从彳，犀聲。”', '27.885D': '《說文》：“𧘂，通道也。从行，童聲。《春秋傳》曰：‘及𧘂以戈擊之。’”', '27.885B': '《說文》：“衞，宿衞也。从韋、帀，从行。行，列衞也。”', '27.8E1D': '《說文》：“踝，足踝也。从足，果聲。”', '27.8E26': '《說文》：“踦，一足也。从足，奇聲。”', '27.8E27': '《說文》：“踧，行平易也。从足，叔聲。《詩》曰：‘踧踧周道。’”', '27.8E16': '《說文》：“踖，長脛行也。从足，㫺聲。一曰踧踖。”', '27.8E10': '《說文》：“踐，履也。从足，戔聲。”', '27.8E14': '《說文》：“踔，踶也。从足，卓聲。”', '27.8E24': '《說文》：“踤，觸也。从足，卒聲。一曰駭也。一曰蒼踤。”', '27.8E1E': '《說文》：“踞，蹲也。从足，居聲。”', '27.8E23': '《說文》：“踣，僵也。从足，咅聲。《春秋傳》曰：‘晉人踣之。’”', '27.8E12': '《說文》：“踒，足跌也。从足，委聲。”', '27.E1CB': '《說文》：“䠅，瘃足也。从足，囷聲。”', '27.E1CF': '《說文》：“䠊，跀也。从足，非聲。讀若匪。”', '27.56C2': '《說文》：“囂，聲也。气出頭上，从㗊，从頁。頁，首也。”', '27.8AC7': '《說文》：“談，語也。从言，炎聲。”', '27.8AD2': '《說文》：“諒，信也。从言，京聲。”', '27.8ACB': '《說文》：“請，謁也。从言，青聲。”', '27.8AF8': '《說文》：“諸，辯也。从言，者聲。”', '27.8AC4': '《說文》：“諄，告曉之孰也。从言，𦎧聲。讀若庉。”', '27.8ABE': '《說文》：“誾，和說而諍也。从言，門聲。”', '27.8ACF': '《說文》：“諏，聚謀也。从言，取聲。”', '27.8AD6': '《說文》：“論，議也。从言，侖聲。”', '27.8AD7': '《說文》：“諗，深諫也。从言，念聲。《春秋傳》曰：‘辛伯諗周桓公。’”', '27.8AB2': '《說文》：“課，試也。从言，果聲。”', '27.8ABF': '《說文》：“調，和也。从言，周聲。”', '27.8AC9': '《說文》：“諉，纍也。从言，委聲。”', '27.8AD3': '《說文》：“諓，善言也。从言，戔聲。一曰謔也。”', '27.8ACD': '《說文》：“諍，止也。从言，爭聲。”', '27.8ADB': '《說文》：“諛，諂也。从言，臾聲。”', '27.E1FC': '《說文》：“讇，諛也。从言，閻聲。諂，讇或省。”', '27.8AB9': '《說文》：“誹，謗也。从言，非聲。”', '27.8B17': '《說文》：“謗，毀也。从言，㫄聲。”', '27.F55F': '《說文》：“䜌，亂也。一曰治也，一曰不絕也。从言絲，𤔪，古文䜌。”', '27.8ABB': '《說文》：“誻，䜚誻也。从言，沓聲。”', '27.8ABD': '《說文》：“誽，言相誽司也。从言，兒聲。”', '27.8AC5': '《說文》：“諅，忌也。从言，其聲。《周書》曰：‘上不諅凶德。’”', '27.8AD5': '《說文》：“諕，號也。从言，从虎。”', '27.8AC6': '《說文》：“諆，欺也。从言，其聲。”', '27.E21A': '《說文》：“䛩，相毀也。从言，亞聲。一曰畏亞。”', '27.8AB6': '《說文》：“誶，讓也。从言，卒聲。《國語》曰：‘誶申胥’。”', '27.8AB0': '《說文》：“誰，何也。从言，隹聲。”', '27.6A0A': '《說文》：“樊，鷙不行也。从𠬜，从棥，棥亦聲。”', '27.E242': '《說文》：“𩊚，生革可以為縷束也。从革，各聲。”', '27.978F': '《說文》：“鞏，以韋束也。《易》曰：‘鞏用黃牛之革。’从革，巩聲。”', '27.978E': '《說文》：“鞎，車革前曰鞎。从革，艮聲。”', '27.E254': '《說文》：“𩊝，蓋杠絲也。从革，旨聲。”', '27.978D': '《說文》：“鞌，馬鞁具也。从革，从安。”', '27.9788': '《說文》：“鞈，防汗也。从革，合聲。”', '27.E278': '《說文》：“𩱫，鼎實。‘惟葦及蒲’，陳留謂鍵為𩱫。从𩰲，速聲。餗，𩱫或从食，束聲。”', '27.E27E': '《說文》：“𩛥設飪也。从𠃨，从食，才聲。讀若載。”', '27.9B27': '《說文新附》：“鬧，不静也。从市、鬥。”', '27.8C4E': '《說文》：“豎，豎立也。从臤，豆聲。豎，籀文豎从殳。”', '27.6BC6': '《說文》：“毆，捶毄物也。从殳，區聲。”', '27.6BC5': '《說文》：“毅，妄怒也。一曰有決也。从殳，豙聲。”', '27.6578': '《說文》：“數，計也。从攴，婁聲。”', '27.6579': '《說文》：“敹，擇也。从攴，𥹄聲。”', '27.6576': '《說文》：“敶，列也。从攴，陳聲。”', '27.6575': '《說文》：“敵，仇也。从攴，啻聲。”', '27.E2CA': '《說文》：“㪤，㪤盡也。从攴，畢聲。”', '27.657B': '《說文》：“敻，營求也。从𥄎，从人在穴上。《商書》曰：‘高宗夢得說，使百工敻求，得之傅巖。’巖，穴也。”', '27.E2F3': '《說文》：“𥈼，轉目視也。从目，般聲。”', '27.E2FE': '《說文》：“𥈾，目深皃。从目、窅。讀若《易》曰：‘勿䘏’之䘏。”', '27.E2FF': '《說文》：“䁙，目相戲也。从目，晏聲。《詩》曰：‘䁙婉之求。’”', '27.7791': '《說文》：“瞑，翕目也。从目、冥，冥亦聲。”', '27.E309': '《說文》：“䁝，惑也。从目，榮省聲。”', '27.E30E': '《說文》：“𡐠，盾握也。从盾，圭聲。”', '27.F078': '《說文》：“𦤝，宮不見也。闕。”', '27.9B6F': '《說文》：“魯，鈍詞也。从白，鮺省聲。《論語》曰：‘參也魯。’”', '27.596D': '《說文》：“奭，盛也。从大，从皕，皕亦聲。此燕召公名。讀若郝。《史篇》名醜。𡚐，古文奭。”', '27.7FEB': '《說文》：“翫，習猒也。从習，元聲。”', '27.7FE8': '《說文》：“翨，鳥之彊羽猛者。从羽，是聲。”', '27.7FE6': '《說文》：“翦，羽生也。一曰𠂕羽。从羽，前聲。”', '27.E313': '《說文》：“𦑜，翅也。从羽，革聲。”', '27.7FED': '《說文》：“𦑚，羽本也。一曰羽初生皃。从羽，矦聲。”', '27.7FEC': '《說文》：“翬，大飛也。从羽，軍聲。一曰：伊、雒而南，雉五采皆備曰翬。”', '27.7FE9': '《說文》：“翩，疾飛也。从羽，扁聲。”', '27.8511': '《說文》：“蔑，勞，目無精也。从𥄕，人勞則蔑然，从戍。”', '27.E331': '《說文》：“𦎦，六月生羔也。从羊，敄聲。讀若霧。”', '27.7FAD': '《說文》：“羭，夏羊牡曰羭。从羊，俞聲。”', '27.7FAF': '《說文》：“羯，羊羖犗也。从羊，曷聲。”', '27.E337': '《說文》：“𦎣，羣羊相𦎸也。一曰黑羊。从羊，垔聲。”', '27.9D03': '《說文》：“鴂，寧鴂也。从鳥，夬聲。”', '27.E340': '《說文》：“䲱，澤虞也。从鳥，方聲。”', '27.9D08': '《說文》：“鴈，䳘也。从鳥、人，厂聲。”', '27.9D07': '《說文》：“鴇，鳥也，肉出尺胾。从鳥，𠤏聲。䳈，鴇或从包。”', '27.9CFD': '《說文》：“鳽，𪁉𪂴也。从鳥，幵聲。”', '27.E363': '《說文》：“䲸，鳥似鶡而青，出羌中。从鳥，介聲。”', '27.9D06': '《說文》：“鴆，毒鳥也。从鳥，冘聲。一名運日。”', '27.E366': '《說文》：“𩿈，鳥聚皃。一曰飛皃。从鳥，分聲。”', '27.6BA4': '《說文》：“殤，不成人也。人年十九至十六死為長殤；十五至十二死為中殤；十一至八歲死為下殤。从歺，傷省聲。”', '27.E37A': '《說文》：“㱳，死𡧯㱳也。从歺，莫聲。”', '27.6BA3': '《說文》：“殣，道中死人，人所覆也。从歺，堇聲。《詩》曰：‘行有死人，尚或殣之。’”', '27.9AC0': '《說文》：“髀，股也。从骨，卑聲。䠋，古文髀。”', '27.81DA': '《說文》：“臚，皮也。从肉，盧聲。膚，籀文臚。”', '27.81A2': '《說文》：“膢，楚俗以二月祭飲食也。从肉，婁聲。一曰祈穀食新曰離膢。”', '27.8198': '《說文》：“膘，牛脅後髀前合革肉也。从肉，𤐫聲。”', '27.819C': '《說文》：“膜，肉間胲膜也。从肉，莫聲。”', '27.819E': '《說文》：“膞，切肉也。从肉，專聲。”', '27.81A0': '《說文》：“膠，昵也，作之以皮。从肉，翏聲。”', '27.528A': '《說文》：“劊，斷也。从刀，會聲。”', '27.528C': '《說文》：“劌，利傷也。从刀，歲聲。”', '27.5288': '《說文》：“劈，破也。从刀，辟聲。”', '27.528B': '《說文》：“劋，絕也。从刀，喿聲。《周書》曰：‘天用劋絕其命。’”', '27.5287': '《說文新附》：“劇，尤甚也。从刀，未詳，豦聲。”', '27.E3CE': '《說文》：“劒，人所帶兵也。从刃，僉聲。劍，籀文劒从刀。”', '27.8026': '《說文》：“耦，耒廣五寸為伐，二伐為耦。从耒，禺聲。”', '27.89EC': '《說文》：“觬，角觬曲也。从角，兒聲。西河有觬氏縣。”', '27.89ED': '《說文》：“觭，角一俛一仰也。从角，奇聲。”', '27.89F0': '《說文》：“觰，觰拏，獸也。从角，者聲。一曰下大者也。”', '27.7BAD': '《說文》：“箭，矢也。从竹，前聲。”', '27.E3EA': '《說文》：“䈚，竹萌也。从竹，怠聲。”', '27.7BAC': '《說文》：“箬，楚謂竹皮曰箬。从竹，若聲。”', '27.7BC6': '《說文》：“篆，引書也。从竹，彖聲。”', '27.7BC7': '《說文》：“篇，書也。一曰關西謂榜曰篇。从竹，扁聲。”', '27.7BC1': '《說文》：“篁，竹田也。从竹，皇聲。”', '27.E3EF': '《說文》：“䈎，籥也。从竹，枼聲。”', '27.E402': '《說文》：“篅，以判竹，圜以盛穀也。从竹，耑聲。”', '27.E404': '《說文》：“𥯕，大竹筩也。从竹，昜聲。”', '27.7BAF': '《說文》：“箯，竹輿也。从竹，便聲。”', '27.7BB1': '《說文》：“箱，大車牝服也。从竹，相聲。”', '27.7BA0': '《說文》：“箠，擊馬也。从竹，垂聲。”', '27.7BB4': '《說文》：“箴，綴衣箴也。从竹，咸聲。”', '27.7BBE': '《說文》：“箾，以竿擊人也。从竹，削聲。虞舜樂曰箾韶。”', '27.E411': '《說文》：“䈕，簧屬。从竹，是聲。”', '27.7BB9': '《說文》：“箹，小籟也。从竹，約聲。”', '27.7BCE': '《說文》：“篎，小管為之篎。从竹、眇聲。”', '27.E412': '《說文》：“篍，吹筩也。从竹，秋聲。”', '27.8C50': '《說文》：“豐，豆之豐滿者也。从豆，象形。一曰鄉飲酒有豐侯者。𧯮，古文豐。”', '27.8662': '《說文》：“虢，虎所攫畫明文也。从虎，寽聲。”', '27.E457': '《說文》：“𧗁，气液也。从血，𦘔聲。”', '27.9914': '《說文》：“餔，日加申時食也。从食，甫聲。𥂈，籀文餔，从皿，浦聲。”', '27.E483': '《說文》：“䬼，𤞣也。从食，肙聲。”', '27.9918': '《說文》：“餘，饒也。从食，余聲。”', '27.9913': '《說文》：“餓，飢也。从食，我聲。”', '27.E487': '《說文》：“䬽，小餟也。从食，兑聲。”', '27.9915': '《說文新附》：“餕，食之餘也。从食，夋聲。”', '27.F4BD': '《說文》：“𦎧，孰也。从亯，从羊。讀若純。一曰鬻也。𠆆，篆文𦎧。”', '27.E4A3': '《說文》：“䈞，厚也。从亯，竹聲。讀若篤。”', '27.E4A4': '《說文》：“𦤘，用也。从亯，从自。自知臭香所食也。讀若庸。”', '27.9EA9': '《說文》：“麩，小麥屑皮也。从麥，夫聲。麱，麩或从甫。”', '27.E4B3': '《說文》：“麪，麥末也。从麥，丏聲。”', '27.6182': '《說文》：“憂，和之行也。从夊，𢚧聲。《詩》曰：‘布政憂憂。’”', '27.E4C1': '《說文》：“𩏇，履後帖也。从韋，段聲。緞，𩏇或从糸。”', '27.97CF': '《說文》：“韏，革中辨謂之韏。从韋，聲。”', '27.78D4': '《說文》：“磔，辜也。从桀，石聲。”', '27.6A1D': '《說文》：“樝，果似棃而酢。从木，虘聲。”', '27.69E2': '《說文》：“槢，木也。从木，習聲。”', '27.6A15': '《說文》：“樕，樸樕，木。从木，欶聲。”', '27.E4CE': '《說文》：“𣘫，木也。从木，號省聲。”', '27.E4D1': '《說文》：“㯉，木也。从木，虖聲。”', '27.6A23': '《說文》：“樣，栩實。从木，羕聲。”', '27.E4E3': '《說文》：“㮿，木也。从木，畢聲。”', '27.E4E4': '《說文》：“樜，木。出發鳩山。从木，庶聲。”', '27.6A17': '《說文》：“樗，木也。以其皮裹松脂。从木，雩聲。讀若華。檴，或从蒦。”', '27.6A27': '《說文》：“樧，似茱萸，出淮南。从木，殺聲。”', '27.69ED': '《說文》：“槭，木，可作大車輮。从木，戚聲。”', '27.6A20': '《說文》：“樠，松心木。从木，㒼聲。”', '27.6A05': '《說文》：“樅，松葉柏身。从木，從聲。”', '27.6A19': '《說文》：“𣠙，木杪末也，从木𤐫聲。”', '27.6A1B': '《說文》：“樛，下句曰樛。从木，翏聲。”', '27.69EE': '《說文》：“槮，木長皃。从木，參聲。《詩》：‘槮差荇菜。’”', '27.69F8': '《說文》：“槸，木相摩也。从木，埶聲。𣞕，槸或从艸。”', '27.6A21': '《說文》：“模，法也。从木，莫聲。讀若嫫母之嫫。”', '27.6A18': '《說文》：“樘，衺柱也。从木，堂聲。”', '27.6A00': '《說文》：“樀，戶樀也。从木，啻聲。《爾雅》曰：‘檐謂之樀。’讀若滴。”', '27.6A1E': '《說文》：“樞，戶樞也。从木，區聲。”', '27.6A13': '《說文》：“樓，重屋也。从木，婁聲。”', '27.69FE': '《說文》：“槾，杇也。从木，曼聲。”', '27.69E4': '《說文》：“槤，瑚槤也。从木，連聲。”', '27.69F6': '《說文》：“槶，筐當也。从木，國聲。”', '27.69FD': '《說文》：“槽，畜獸之食器。从木，曹聲。”', '27.6AD3': '《說文》：“櫓，大盾也。从木，魯聲。樐，或从鹵。”', '27.6A02': '《說文》：“樂，五聲八音緫名。象鼓鞞。木，虡也。”', '27.69E7': '《說文》：“槧，牘樸也。从木，斬聲。”', '27.6A14': '《說文》：“樔，澤中守艸樓。从木，巢聲。”', '27.69E5': '《說文》：“槥，棺櫝也。从木，彗聲。”', '27.6A01': '《說文新附》：“樁，橛杙也。从木，舂聲。”', '27.8CE3': '《說文》：“𧷓，出物貨也。从出，从買。”', '27.E535': '《說文》：“𦤙，槷𦤙，不安也。从出，臬聲。《易》曰：‘槷𦤙。’”', '27.7A3D': '《說文》：“稽，留止也。从𥝌，从尤，旨聲。”', '27.8CE2': '《說文》：“賢，多才也。从貝，臤聲。”', '27.8CDA': '《說文》：“賚，賜也。从貝，來聲。《周書》曰：‘賚尒秬鬯。’”', '27.8CDE': '《說文》：“賞，賜有功也。从貝，尚聲。”', '27.8CDC': '《說文》：“賜，予也。从貝，易聲。”', '27.8CEA': '《說文》：“質，以物相贅，从貝，从斦。闕。”', '27.E54E': '《說文》：“𧶜，行賈也。从貝，商省聲。”', '27.8CE4': '《說文》：“賤，賈少也。从貝，戔聲。”', '27.8CE6': '《說文》：“賦，斂也。从貝，武聲。”', '27.8CE8': '《說文》：“賨，南蠻賦也。从貝，宗聲。”', '27.F056': '《說文》：“𧸇，衒也。从貝，𡍬聲。𡍬，古文睦。讀若育。”', '27.8CED': '《說文新附》：“賭，博簺也。从貝，者聲。”', '27.9130': '《說文》：“鄰，五家為鄰。从邑，粦聲。”', '27.912F': '《說文》：“鄯，鄯善，西胡國也。从邑，从善，善亦聲。”', '27.912D': '《說文》：“鄭，京兆縣。周厲王子友所封。从邑，奠聲。宗周之滅，鄭徙潧洧之上，今新鄭是也。”', '27.9129': '《說文》：“鄩，周邑也。从邑，尋聲。”', '27.E562': '《說文》：“𨛫，殷諸侯國。在上黨東北。从邑，𥝢聲。𥝢，古文利。《商書》‘西伯戡𨛫。’”', '27.E563': '《說文》：“𨛬，河東聞喜縣。从邑，非聲。”', '27.9132': '《說文》：“鄲，邯鄲縣。从邑，單聲。”', '27.9126': '《說文》：“鄦，炎帝太嶽之胤甫侯所封，在潁川。从邑，無聲。讀若許。”', '27.9127': '《說文》：“鄧，曼姓之國，今屬南陽。从邑，登聲。”', '27.9131': '《說文》：“鄱，鄱陽，豫章縣。从邑，番聲。”', '27.912E': '《說文》：“鄮，會稽縣。从邑，貿聲。”', '27.912B': '《說文》：“鄫，姒姓國，在東海。从邑，曾聲。”', '27.E57E': '《說文》：“𨝸，國也。齊桓公之所滅。从邑，覃聲。”', '27.E585': '《說文》：“𨝫，地名。从邑，翕聲。”', '27.E592': '《說文》：“𨝭，姬姓之國。从邑，馮聲。”', '27.66AB': '《說文》：“暫，不久也。从日，斬聲。”', '27.66B4': '《說文》：“㬥，晞也。从日，从出，从収，从米。𣋴，古文㬥。从日，麃聲。”', '27.66B5': '《說文》：“暵，乾也。耕㬥田曰暵。从日，堇聲。”', '27.E5A2': '《說文》：“暬，日狎習相慢也。从日，執聲。”', '27.E5A9': '《說文》：“㫏，旗屬。从㫃，要聲。”', '27.7256': '《說文》：“牖，穿壁以木為交窻也。从片、戶、甫。譚長以為‘甫’上‘日’也，非‘戶’也，牖所以見日。”', '27.9F10': '《說文》：“鼐，鼎之絕大者。从鼎，乃聲。《魯詩》說：鼐，小鼎。”', '27.9F0F': '《段注說文》：“鼏，鼎覆也。从鼎、冖，冖亦聲。”', '27.7A3C': '《說文》：“稼，禾之秀實為稼，莖節為禾。从禾，家聲。一曰稼，家事也。一曰在野曰稼。”', '27.EDEB': '《說文》：“稺，幼禾也。从禾，屖聲。”', '27.7A39': '《說文》：“稹，穜穊也。从禾，真聲。《周禮》曰：‘稹理而堅’。”', '27.7A3B': '《說文》：“稻，稌也。从禾，舀聲。”', '27.E5D0': '《說文》：“稴，稻不黏者。从禾，兼聲。讀若風廉之廉。”', '27.E5E0': '《說文》：“䅵，禾皮也。从禾，羔聲。”', '27.7A3F': '《說文》：“稾，稈也。从禾，高聲。”', '27.E5E5': '《說文》：“䅭，䅭䅣，穀名。从禾，旁聲。”', '27.7A40': '《說文》：“穀，續也，百穀之緫名。从禾，𣪊聲。”', '27.7A4C': '《說文》：“穌，把取禾若也。从禾，魚聲。”', '27.E5F1': '《說文》：“䵒，黏也。从黍，日聲。《春秋傳》曰：‘不義不䵒。’ 䵑，䵒或从刃。”', '27.E5F8': '《說文》：“糂，以米和羹也；一曰粒也。从米，甚聲。糣，籀文糂从朁。糝，古文糂从參。”', '27.7CC8': '《說文》：“糈，糧也。从米，胥聲。”', '27.E604': '《說文新附》：“糉，蘆葉裹米也。从米，㚇聲。”', '27.E610': '《說文》：“𤬐，小瓜也。从瓜，熒省聲。”', '27.5BEB': '《說文》：“寫，置物也。从宀，舄聲。”', '27.5BEC': '《說文》：“寬，屋寬大也。从宀，萈聲。”', '27.F103': '《說文》：“㝮，塞也。从宀，𠭥聲。讀若《虞書》曰‘㝮三苗’之㝮。”', '27.7AAF': '《說文》：“窯，燒瓦竈也。从穴，羔聲。”', '27.E634': '《說文》：“竂，穿也。从穴，尞聲。”', '27.7AB3': '《說文》：“窳，污窬也。从穴，㼌聲。朔方有窳渾縣。”', '27.7AB4': '《說文》：“𥧑，塞也。从穴，眞聲。”', '27.7AAE': '《說文》：“竆，極也。从穴，躳聲。”', '27.7623': '《說文》：“瘣，病也。从疒，鬼聲。《詩》曰：‘譬彼瘣木。’一曰腫旁出也。”', '27.7628': '《說文》：“瘨，病也。从疒，真聲。一曰腹張。”', '27.E645': '《說文》：“𤸫，病也。从疒，員聲。”', '27.E649': '《說文》：“㾺，目病。一曰惡氣箸身也。一曰蝕創。从疒，馬聲。”', '27.7624': '《說文》：“瘤（癅），腫也。从疒，畱聲。”', '27.761C': '《說文》：“瘜，寄肉也。从疒，息聲。”', '27.E655': '《說文》：“𤺄，脛气足腫。从疒，童聲。《詩》曰：‘既微且𤺄。’𡰕，籀文从尣。”', '27.7622': '《說文》：“瘢，痍也。从疒，般聲。”', '27.761B': '《說文》：“瘛，小兒瘛瘲病也。从疒，恝聲。”', '27.7625': '《說文》：“瘥，瘉也。从疒，差聲。”', '27.E665': '《說文》：“𤸬，減也。从疒，衰聲。一曰耗也。”', '27.7F76': '《說文》：“罶，曲梁，寡婦之笱，魚所留也。从网、留，留亦聲。𦌁，罶或从婁。”', '27.8F1F': '《說文》：“輟，車小缺復合者。从車，叕聲。”', '27.7F77': '《說文》：“罷，遣有辠也。从网、能，言有賢能而入网，而貰遣之。《周禮》曰：‘議能之辟。’”', '27.7F75': '《說文》：“罵，詈也。从网，馬聲。”', '27.5E6C': '《說文》：“幬，禪帳也。从巾，𠷎聲。”', '27.5E61': '《說文》：“幡，書兒拭觚布也。从巾，番聲。”', '27.5E5D': '《說文》：“幝，車弊皃。从巾，單聲。”', '27.5E60': '《說文》：“幠，覆也。从巾，無聲。”', '27.5E69': '《說文》：“幩，馬纏鑣扇汗也。从巾，賁聲。”', '27.5E62': '《說文新附》：“幢，旌旗之屬。从巾，童聲。”', '27.5E5F': '《說文新附》：“幟，旌旗之屬。从巾，戠聲。”', '27.E69B': '《說文新附》：“幞，帊也。从巾，菐聲。”', '27.E6A0': '《說文》：“㿥，鳥之白也。从白，隺聲。”', '27.769A': '《說文》：“皚，霜雪之白也。从白，豈聲。”', '27.769B': '《說文》：“皛，顯也。从三白。讀若皎。”', '27.5107': '《說文》：“儇，慧也。从人，睘聲。”', '27.E6AA': '《說文》：“僷，宋衛之間謂華僷僷。从人，葉聲。”', '27.5106': '《說文》：“儆，戒也。从人，敬聲。《春秋傳》曰：儆宮。”', '27.50FE': '《說文》：“僾，仿佛也。从人，愛聲。”', '27.510B': '《說文》：“儋，何也。从人，詹聲。”', '27.5103': '《說文》：“儃，儃何也。从人，亶聲。”', '27.5100': '《說文》：“儀，度也。从人，義聲。”', '27.5109': '《說文》：“儉，約也。从人，僉聲。”', '27.5104': '《說文》：“億，安也。从人，意聲。”', '27.50FB': '《說文》：“僻，避也。从人，辟聲。《詩》曰：‘宛如左僻。’一曰从旁牽也。”', '27.50F5': '《說文》：“僵，僨也。从人，畺聲。”', '27.5108': '《說文新附》：“儈，合市也。从人、會，會亦聲。”', '27.50F9': '《說文新附》：“價，物直也。从人、賈，賈亦聲。”', '27.8915': '《說文》：“褕，翟羽飾衣。从衣，俞聲。一曰直裾謂之襜褕。”', '27.8918': '《說文》：“褘，蔽厀也。从衣，韋聲。《周禮》曰：‘王后之服褘衣。’謂畫袍。”', '27.890B': '《說文》：“褋，南楚謂禪衣曰褋。从衣，枼聲。”', '27.E6E0': '《說文》：“䙃，無袂衣謂之䙃。从衣，惰省聲。”', '27.8912': '《說文》：“襃，衣博裾。从衣，𠌀省聲。𠌀，古文𠈃。”', '27.E6E5': '《說文》：“褍，衣正幅。从衣，耑聲。”', '27.8907': '《說文》：“複，重衣也。从衣，复聲。一曰褚衣。”', '27.8906': '《說文》：“褆，衣厚褆褆。从衣，是聲。”', '27.890A': '《說文》：“褊，衣小也。从衣，扁聲。”', '27.8910': '《說文》：“褐，編枲韤。一曰粗衣。从衣，曷聲。”', '27.8917': '《說文》：“褗，䙔領也。从衣，匽聲。”', '27.E6FE': '《說文》：“𣯩，以毳為𦇧，色如虋，故謂之𣯩。虋，禾之赤苗也。从毛，㒼聲。《詩》曰：‘毳衣如𣯩。’”', '27.E701': '《說文》：“㞟，偫也。从尸，奠聲。”', '27.5C64': '《說文》：“層，重屋也。从尸，曾聲。”', '27.5C65': '《說文》：“履，足所依也。从尸，从彳，从攵，舟象履形。一曰尸聲。𩕎，古文履从頁，从足。”', '27.8250': '《說文》：“艐，船著不行也。从舟，㚇聲。讀若䔂。”', '27.824E': '《說文新附》：“艎，艅艎也。从舟，皇聲。”', '27.89A3': '《說文》：“覣，好視也。从見，委聲。”', '27.E715': '《說文》：“𧡎，旁視也。从見，兒聲。”', '27.E716': '《說文》：“䚄，笑視也。从見，彔聲。”', '27.E71A': '《說文》：“䚅，內視也。从見，來聲。”', '27.89A2': '《說文》：“覢，暫見也。从見，炎聲。《春秋公羊傳》曰：‘覢然公子陽生。’”', '27.975A': '《說文》：“靚，召也。从見，青聲。”', '27.6B51': '《說文》：“歑，溫吹也。从欠，虖聲。”', '27.E736': '《說文》：“𣤶，歍𣤶也。从欠，鼀聲。噈，俗𣤶，从口，从就。”', '27.6B4E': '《說文》：“歎，吟也。从欠，𪅀省聲。𣥁，籀文歎不省。”', '27.6B50': '《說文》：“歐，吐也。从欠，區聲。”', '27.E74B': '《說文》：“㱂，飢虛也。从欠，康聲。”', '27.E75A': '《說文》：“頟，顙也。从頁，各聲。”', '27.981E': '《說文》：“頞，鼻莖也。从頁，安聲。齃，或从鼻、曷。”', '27.E75C': '《說文》：“𩓓，頰後也。从頁，𥃩聲。”', '27.981C': '《說文》：“頜，𩔞也。从頁，合聲。”', '27.E76A': '《說文》：“頢，短面也。从頁，𠯑聲。”', '27.9820': '《說文》：“頠，頭閑習也。从頁，危聲。”', '27.E770': '《說文》：“頣，舉目視人皃。从頁，臣聲。”', '27.9821': '《說文》：“頡，直項也。从頁，吉聲。”', '27.9828': '《說文》：“頨，頭妍也。从頁，翩省聲。讀若翩。”', '27.981B': '《說文》：“頛，頭不正也。从頁，从耒。耒，頭傾也。讀又若《春秋》‘陳夏齧’之齧。”', '27.F4BE': '《說文》：“頪，難曉也。从頁、米。一曰鮮白皃。从粉省。”', '27.9826': '《說文》：“頦，醜也。从頁，亥聲。”', '27.E784': '《說文》：“䭬，下首也。从𩠐，旨聲。”', '27.E78C': '《說文》：“𣁟，微畫也。从文，𠩺聲。”', '27.E795': '《說文》：“𩭾，髮至眉也。从髟，敄聲。《詩》曰：‘紞彼兩𩭾。’ 髳，𩭾或省。漢令有髳長。”', '27.9AF2': '《說文》：“髲，鬄也。从髟，皮聲。”', '27.E79A': '《說文》：“𩬙，結也。从髟，付聲。”', '27.E7A0': '《說文》：“髴，髴若似也。从髟，弗聲。”', '27.9AEB': '《說文新附》：“髫，小兒垂結也。从髟，召聲。”', '27.E7AF': '《說文》：“䢃，治也。从辟，乂聲。《虞書》曰：‘有能俾䢃。’”', '27.E7BA': '《說文》：“䰠，神也。从鬼，申聲。”', '27.9B44': '《說文》：“魄，陰神也。从鬼，白聲。”', '27.E7BB': '《說文》：“䰡，厲鬼也。从鬼，失聲。”', '27.9B43': '《說文》：“魃，旱鬼也。从鬼，犮聲。《周禮》有赤魃氏，除牆屋之物也。《詩》曰：‘旱魃為虐’”', '27.E7C5': '《說文》：“𡼐，𡼐山也，在蜀湔氏西徼外。”', '27.5D9E': '《說文》：“嶞，山之墮墮者。从山，从憜省聲。”', '27.E7CB': '《說文》：“嶘，尤高也。从山，棧聲。”', '27.E7CD': '《說文》：“𡼊，𡽕也。从山，絫聲。”', '27.5DA2': '《說文》：“嶢，焦嶢，山高皃。从山，堯聲。”', '27.5D99': '《說文新附》：“嶙，嶙峋，深崖皃。从山，粦聲。”', '27.5DA0': '《說文新附》：“嶠，山銳而高也。从山，喬聲。古通用喬。”', '27.E7D7': '《說文》：“嶏，崩聲。从屵，配聲，讀若費。”', '27.5EE1': '《說文》：“廡，堂下周屋。从广，無聲。𢋑，籀文从舞。”', '27.5EDA': '《說文》：“廚，庖屋也。从广，尌聲。”', '27.5EE3': '《說文》：“廣，殿之大屋也。从广，黄聲。”', '27.5EDB': '《說文》：“廛，一畝半，一家之居，从广、里、八、土。”', '27.5EE2': '《說文》：“廢，屋頓也。从广，發聲。”', '27.5EDE': '《說文》：“廞，陳輿服於庭也。从广，欽聲。”', '27.E7E5': '《說文》：“㕒，厜㕒也。从厂，義聲。”', '27.53B2': '《說文》：“厲，旱石也。从厂，蠆省聲。𧓽，或不省。”', '27.E7E7': '《說文》：“厱，厱諸，治玉石也。从厂，僉聲。”', '27.E7F1': '《說文》：“𠪮，仄也。从厂，辟聲。”', '27.78CF': '《說文》：“磏，厲石也。一曰赤色。从石，兼聲。讀若鎌。”', '27.E7FA': '《說文》：“磒，落也。从石，員聲。《春秋傳》曰：‘磒石于宋五。’”', '27.78D1': '《說文》：“磑，䃺也。从石，豈聲。古者公輸班作磑。”', '27.E803': '《說文》：“䃒，石也，惡也。从石，鬲聲。”', '27.78CA': '《說文》：“磊，眾石也。从三石。”', '27.8C6C': '《說文》：“豬，豕而三毛叢居者。从豕，者聲。”', '27.99D2': '《說文》：“駒，馬二歲曰駒，三歲曰駣。从馬，句聲。”', '27.99D3': '《說文》：“駓，黃馬白毛也。从馬，丕聲。”', '27.99DC': '《說文》：“駜，馬飽也。从馬，必聲。《詩》云：‘有駜有駜。’”', '27.99DF': '《說文》：“駟，一乘也。从馬，四聲。”', '27.99D9': '《說文》：“駙，副馬也。从馬，付聲。一曰近也。一曰疾也。”', '27.E82C': '《說文》：“駊，駊騀也。从馬，皮聲。”', '27.E830': '《說文》：“𩢛，馬疾走也。从馬，匈聲。”', '27.9A45': '《說文》：“驅，馬馳也。从馬，區聲。敺，古文驅从攴。”', '27.E832': '《說文》：“䭿，馬有疾足。从馬，失聲。”', '27.99D0': '《說文》：“駐，馬立也。从馬，主聲。”', '27.99D7': '《說文》：“駗，馬載重難也。从馬，㐱聲。”', '27.99D8': '《說文》：“駘，馬銜脫也。从馬，台聲。”', '27.99D4': '《說文》：“駔，牡馬也。从馬。且聲。一曰馬蹲駔也。”', '27.99C9': '《說文》：“駉，牧馬苑也。从馬，冋聲。《詩》曰：‘在駉之野。’”', '27.9E83': '《說文》：“麃，麠屬。从鹿，㶾省聲。”', '27.E851': '《說文新附》：“㕙，狡兔也。从兔，夋聲。”', '27.7362': '《說文》：“獢，猲獢也。从犬，喬聲。”', '27.E856': '《說文》：“㺖，小犬吠。从犬，敢聲。南陽新亭有㺖鄉。”', '27.E85A': '《說文》：“㺕，犬鬬聲。从犬，番聲。”', '27.7361': '《說文》：“獡，犬獡獡不附人也。从犬，舃聲。南楚謂相驚曰獡。讀若愬。”', '27.7352': '《說文》：“獒，犬如人心可使者。从犬，敖聲。《春秋傳》曰：‘公嗾夫獒。’”', '27.E85E': '《說文》：“獜，健也。从犬，粦聲。《詩》曰：‘盧獜獜。’”', '27.7360': '《說文》：“獠，獵也。从犬，尞聲。”', '27.7358': '《說文》：“獘，頓仆也。从犬，敝聲。《春秋傳》曰：‘與犬犬獘’。斃，獘或从死。”', '27.735F': '《說文》：“獟，𤜵犬也。从犬，堯聲。”', '27.7F86': '《說文》：“羆，如熊，黃白文。从熊，罷省聲。𥀍，古文从皮。”', '27.719A': '《說文》：“熚，熚𤒓，火皃。从火，畢聲。”', '27.71AF': '《說文》：“熯，乾皃。从火，漢省聲。”', '27.E87C': '《說文》：“熮，火皃。从火，翏聲。《逸周書》曰：‘味辛而不熮。’”', '27.71B2': '《說文》：“熲，火光也。从火，頃聲。”', '27.719B': '《說文》：“𤒾，火飛也。从火，㶾聲。讀若摽。”', '27.71AC': '《說文》：“熬，乾煎也。从火，敖聲。䵅，熬或从麥。”', '27.719C': '《說文》：“熜，然麻蒸也。从火，怱聲。”', '27.E88A': '《說文》：“㷮，焦也。从火，曹聲。”', '27.71A0': '《說文》：“熠，盛光也。从火，習聲。”', '27.71B1': '《說文》：“熱，溫也。从火，埶聲。”', '27.71BE': '《說文》：“熾，盛也。从火，戠聲。𢧾，古文熾。”', '27.E898': '《說文》：“熭，暴乾火也。从火，彗聲。”', '27.8D6D': '《說文》：“赭，赤土也。从赤，者聲。”', '27.E8BE': '《說文》：“𩎮，衺也。”', '27.E8CD': '《說文》：“𥉁，舉目驚𥉁然也。从夰，从䀠，䀠亦聲。”', '27.E8D5': '《說文》：“䇓，待也。从立，須聲。𥪥，或从芻聲。”', '27.F61B': '《說文》：“巤，毛巤也。象髮在囟上及毛髮巤巤之形。此與籀文子字同。”', '27.616E': '《說文》：“慮，謀思也。从思，虍聲。”', '27.E8E2': '《說文》：“憕，平也。从心，登聲。”', '27.6167': '《說文》：“慧，儇也。从心，彗聲。”', '27.61AD': '《說文》：“憭，慧也。从心，尞聲。”', '27.E8E7': '《說文》：“慸，高也。一曰極也。一曰困劣也。从心，帶聲。”', '27.6176': '《說文》：“慶，行賀人也。从心，从夊，吉禮以鹿皮為贄，故从鹿省。”', '27.61AE': '《說文》：“憮，愛也。韓、鄭曰憮。一曰不動。从心，無聲。”', '27.6170': '《說文》：“慰，安也。从心，尉聲。一曰恚怒也。”', '27.6155': '《說文》：“慕，習也。从心，莫聲。”', '27.61AA': '《說文》：“憪，愉也。从心，閒聲。”', '27.6183': '《說文》：“憃，愚也。从心，舂聲。”', '27.E906': '《說文》：“𢠽，放也。从心，象聲。”', '27.616B': '《說文》：“慫，驚也。从心，從聲。讀若悚。”', '27.61A7': '《說文》：“憧，意不定也。从心，童聲。”', '27.61B0': '《說文》：“憰，權詐也。从心，矞聲。”', '27.6192': '《說文》：“憒，亂也。从心，貴聲。”', '27.618E': '《說文》：“憎，惡也。从心，曾聲。”', '27.61A4': '《說文》：“憤，懣也。从心，賁聲。”', '27.61AF': '《說文》：“憯，痛也。从心，朁聲。”', '27.E921': '《說文》：“𢟤，楚潁之間謂憂曰𢟤。从心，𠩺聲。”', '27.619A': '《說文》：“憚，忌難也。从心，單聲。一曰難也。”', '27.6179': '《說文》：“慹，悑也。从心，執聲。”', '27.6190': '《說文》：“憐，哀也。从心，粦聲。”', '27.E92E': '《說文》：“㦁，泣下也。从心，連聲。《易》曰：‘泣涕㦁如。’”', '27.61AC': '《說文》：“憬，覺寤也。从心，景聲。《詩》曰：‘憬彼淮夷。’”', '27.6F7C': '《說文》：“潼，水。出廣漢梓潼北界，南入墊江。从水，童聲。”', '27.6F87': '《說文》：“澇，水。出扶風鄠，北入渭。从水，勞聲。”', '27.6F69': '《說文》：“潠，水。出河南密縣大隗山，南入潁。从水，異聲。”', '27.6F53': '《說文》：“潓，水。出廬江，入淮。从水，惠聲。”', '27.6F6D': '《說文》：“潭，水。出武陵鐔成玉山，東入鬱林。从水，覃聲。”', '27.E933': '《說文》：“㵋，水。出豫章艾縣，西入湘。从水，買聲。”', '27.6F55': '《說文》：“潕，水。出南陽舞陽，東入潁。从水，無聲。”', '27.6F41': '《說文》：“潁，水出潁川陽城乾山，東入淮。从水，頃聲。豫州浸。”', '27.6F67': '《說文》：“潧，水。出鄭國。从水，曾聲。《詩》曰：‘潧與洧，方渙渙兮。’”', '27.E93B': '《說文》：“𣽍，水也。从水，臮聲。”', '27.6F52': '《說文》：“潒，水潒瀁也。从水，象聲。讀若蕩。”', '27.6F26': '《說文》：“漦，順流也。一曰水名。从水，𠩺聲。”', '27.6F5A': '《說文》：“潚，深清也。从水，肅聲。”', '27.6F5D': '《說文》：“潝，水疾聲。从水，翕聲。”', '27.6ED5': '《說文》：“滕，水超涌也。从水，朕聲。”', '27.6F4F': '《說文》：“潏，涌出也。一曰水中坻，人所為為潏。一曰潏，水名。在京兆杜陵。从水，矞聲。”', '27.6F90': '《說文》：“澐，江水大波謂之澐。从水，雲聲。”', '27.6F82': '《說文》：“澂，清也。从水，徵省聲。”', '27.6F63': '《說文》：“潣，水流浼浼皃。从水，閔聲。”', '27.6F7F': '《說文》：“潿，不流濁也。从水，圍聲。”', '27.6F6F': '《說文》：“潯，旁深也。从水，尋聲。”', '27.6F6A': '《說文》：“𤁰，土得水沮也。从水，智聲。讀若䵂。”', '27.6F70': '《說文》：“潰，漏也。从水，貴聲。”', '27.6FC6': '《說文》：“濆，水厓也。从水，賁聲。《詩》曰：‘敦彼淮濆。’”', '27.6F62': '《說文》：“潢，積水池。从水，黃聲。”', '27.6F97': '《說文》：“㵎，山夾水也。从水，間聲。一曰㵎水。出弘農新安，東南入洛。”', '27.6F5B': '《說文》：“潛，涉水也。一曰藏也。一曰漢水為潛。从水，朁聲。”', '27.6F8D': '《說文》：“澍，時雨澍生萬物。从水，尌聲。”', '27.6F66': '《說文》：“潦，雨水大皃。从水，尞聲。”', '27.6F8C': '《說文》：“澌，水索也。从水，斯聲。”', '27.6F50': '《說文》：“潐，盡也。从水，焦聲。”', '27.6F64': '《說文》：“潤，水曰潤下。从水，閏聲。”', '27.6F58': '《說文》：“潘，淅米汁也。一曰水名，在河南滎陽。从水，番聲。”', '27.6FB1': '《說文》：“澱，滓滋也。从水，殿聲。”', '27.6F00': '《說文》：“漀，側出泉也。从水，殸聲。殸，籀文磬字。”', '27.6F86': '《說文》：“澆，𣵽也。从水，堯聲。”', '27.6F78': '《說文》：“潸，涕流皃。从水，𢿨省聲。《詩》曰：‘潸焉出涕。’”', '27.6F92': '《說文》：“澒，丹沙所化為水銀也。从水，項聲。”', '27.6F7A': '《說文新附》：“潺，水聲。从水，孱聲。”', '27.6F54': '《說文新附》：“潔，瀞也。从水，絜聲。”', '27.6F60': '《說文新附》：“潠，含水噴也。从水，巽聲。”', '27.51DC': '《說文》：“癛，寒也。”', '27.9706': '《說文》：“霆，雷餘聲也鈴鈴，所以挺出萬物。从雨，廷聲。”', '27.9705': '《說文》：“霅，霅霅。震電皃。一曰眾言也。从雨，譶省聲。”', '27.9707': '《說文》：“震，劈歷振物者。从雨，辰聲。《春秋傳》曰：‘震夷伯之廟。’ 𩇒，籀文震。”', '27.9704': '《說文》：“霄，雨䨘為霄。从雨，肖聲。齊語也。”', '27.9730': '《說文》：“䨷，稷雪也。”', '27.9702': '《說文》：“霂，霢霂也。从雨，沐聲。”', '27.E990': '《說文》：“霃，久陰也。从雨，沈聲。”', '27.9B74': '《說文》：“魴，赤尾魚。从魚，方聲。鰟，魴或从旁。”', '27.9B75': '《說文》：“魵，魚名，出薉邪頭國，从魚，分聲。”', '27.E9BE': '《說文》：“䰽，魚名，出樂浪潘國。从魚，巿聲。”', '27.9B66': '《說文》：“魦，魚名。出樂浪潘國。从魚，沙省聲。”', '27.E9C5': '《說文》：“䰼，鮺也。一曰大魚為鮺，小魚為䰼。从魚，今聲。”', '27.9B67': '《說文》：“魧，大貝也。一曰魚膏。从魚，亢聲。讀若岡。”', '27.E9CC': '《說文》：“𩵩，鯕魚，出東萊。从魚，夫聲。”', '27.E9CF': '《說文新附》：“魮，文魮，魚名。从魚，比聲。”', '27.9760': '《說文》：“靠，相違也。从非，告聲。”', '27.95AD': '《說文》：“閭，里門也。从門，呂聲。《周禮》：‘五家為比，五比為閭。閭，侶也，二十五家相羣侶也。’”', '27.95AC': '《說文》：“閬，門高也。从門，良聲。巴郡有閬中縣。”', '27.95B1': '《說文》：“閱，具數於門中也。从門，說省聲。”', '27.E9EC': '《說文》：“聥，張耳有所聞也。从耳，禹聲。”', '27.8075': '《說文》：“聵，聾也。从耳，貴聲。𦖥，聵或从㕟。”', '27.E9F8': '《說文》：“撎，舉手下手也。从手，壹聲。”', '27.646F': '《說文》：“摯，握持也。从手，从執。”', '27.64A3': '《說文》：“撣，提持也。从手，單聲。”', '27.64A9': '《說文》：“撩，理也。从手，尞聲。”', '27.64AE': '《說文》：“撮，四圭也。一曰兩指撮也。从手，最聲。”', '27.6493': '《說文》：“撓，擾也。从手，堯聲。”', '27.EA0F': '《說文》：“㨻，暫也。从手，斬聲。”', '27.EA10': '《說文》：“𤸪，引縱曰𤸪。从手，瘛省聲。”', '27.EA13': '《說文》：“𢴧，當也。从手，貳聲。”', '27.649F': '《說文》：“撟，舉手也。从手，喬聲。”', '27.64A5': '《說文》：“撥，治也。从手，發聲。”', '27.64E3': '《說文》：“𢶈，手椎也。一曰築也。从手，𠷎聲。”', '27.EC0A': '《說文》：“㩃，拔取也。南楚語。从手，寒聲。《楚詞》曰：‘朝㩃批之木蘭。’”', '27.64A2': '《說文》：“撢，探也。从手，覃聲。”', '27.6469': '《說文》：“摩，研也。从手，麻聲。”', '27.649E': '《說文》：“撞，卂擣也。从手，童聲。”', '27.6479': '《說文》：“摹，規也。从手，莫聲。”', '27.64AD': '《說文》：“播，穜也。一曰布也。从手，番聲。𢿥，古文播。”', '27.64B2': '《說文》：“撲，挨也。从手，菐聲。”', '27.649A': '《說文》：“撚，執也。从手，然聲。一曰蹂也。”', '27.6485': '《說文》：“撅，从手有所把也。从手，厥聲。”', '27.EA2F': '《說文》：“㜣，人姓也。从女，然聲。”', '27.5B14': '《說文》：“𡢎，生子齊均也。从女，从生，免聲。”', '27.5B03': '《說文》：“嬃，女字也。《楚詞》曰：‘女嬃之嬋媛。’賈侍中說。楚人謂姊為嬃。从女，須聲。”', '27.5AFD': '《說文》：“嫽，女字也。从女，尞聲。”', '27.5AF5': '《說文》：“嫵，媚也。从女，無聲。”', '27.5AF7': '《說文》：“嫷，南楚之外謂好曰嫷。从女，隋聲。”', '27.5AFF': '《說文》：“嫿，靜好也。从女，畫聲。”', '27.EA49': '《說文》：“𡡗，順也。从女，𤔔聲。《詩》曰：‘婉兮𡡗兮。’孌，籀文𡡗。”', '27.5AFA': '《說文》：“嫺，雅也。从女，閒聲。”', '27.5AF4': '《說文》：“嫴，保任也。从女，辜聲。”', '27.5AF8': '《說文》：“嫸，好枝格人語也。一曰靳也。从女，善聲。”', '27.EA6B': '《說文》：“嫼，怒皃。从女，黑聲。”', '27.EA72': '《說文》：“㜤，下志貪頑也。从女，覃聲。讀若深。”', '27.5B08': '《說文》：“嬈，苛也。一曰擾，戲弄也。一曰㜹。从女，堯聲。”', '27.5B0C': '《說文新附》：“嬌，姿也。从女，喬聲。”', '27.5B0B': '《說文新附》：“嬋，嬋娟，態也。从女，單聲。”', '27.F0CE': '《說文》：“𢧵，斷也。从戈，雀聲。”', '27.622E': '《說文》：“戮，殺也。从戈，翏聲。”', '27.622D': '《說文》：“戭，長槍也。从戈，寅聲。”', '27.EA93': '《說文》：“𠚜，古器也。从曲，舀聲。”', '27.EA9B': '《說文》：“㼸，器也。从瓦，容聲。”', '27.7508': '《說文》：“甈，康瓠；破罌。从瓦，臬聲。𤮅，甈或从埶。”', '27.5F49': '《說文》：“彉，弩滿也。从弓，黃聲。”', '27.7DEC': '《說文》：“緬，微絲也。从糸，面聲。”', '27.EAB5': '《說文》：“𦂄，大絲也。从糸，皆聲。”', '27.7DEF': '《說文》：“緯，織橫絲也。从糸，韋聲。”', '27.7DF7': '《說文》：“緷，緯也。从糸，軍聲。”', '27.7E8C': '《說文》：“續，連也。从糸，賣聲。賡，古文續从庚、貝。”', '27.EAC2': '《說文》：“緢，旄絲也。从糸，苗聲。《周書》曰：‘惟緢有稽。’”', '27.7DE0': '《說文》：“締，結不解也。从糸，帝聲。”', '27.EAC8': '《說文》：“緭，繒也。从糸，胃聲。”', '27.7DF4': '《說文》：“練，湅繒也。从糸，柬聲。”', '27.7DFA': '《說文》：“緺，綬紫青也。从糸，咼聲。”', '27.7DE3': '《說文》：“緣，衣純也。从糸，彖聲。”', '27.EAD3': '《說文》：“緥，小兒衣也。从糸，保聲。”', '27.7DDF': '《說文》：“緟，增益也。从糸，重聲。”', '27.7DDB': '《說文》：“緛，衣戚也。从糸，耎聲。”', '27.7DF1': '《說文》：“𦂐，刀劔緱也。从糸，矦聲。”', '27.7DD8': '《說文》：“緘，束篋也。从糸，咸聲。”', '27.7DE8': '《說文》：“編，次簡也。从糸，扁聲。”', '27.7DE7': '《說文》：“緧，馬紂也。从糸，酋聲。”', '27.7DEA': '《說文》：“緪，大索也。一曰急也。从糸，恒聲。”', '27.7DDD': '《說文》：“緝，績也。从糸，咠聲。”', '27.7DF0': '《說文》：“緰，緰貲，布也。从糸，俞聲。”', '27.7DF6': '《說文》：“緶，交枲也。一曰緁衣也。从糸，便聲。”', '27.EAF6': '《說文》：“䋽，枲履也。从糸，封聲。”', '27.7E15': '《說文》：“緼，紼也。从糸，昷聲。”', '27.7DFB': '《說文》：“緻，密也。从糸，致聲。”', '27.7DD7': '《說文新附》：“緗，帛淺黃色也。从糸，相聲。”', '27.EAFE': '《說文》：“𦅻，繛也。从素，爰聲。緩，𦅻或省。”', '27.876E': '《說文》：“蝮，虫也。从虫，复聲。”', '27.8758': '《說文》：“蝘，在壁上曰蝘蜓，在艸曰蜥易，从虫，匽聲。𧓱，蝘或从䖵。”', '27.875A': '《說文》：“蝚，蛭蝚，至掌也。从虫，柔聲。”', '27.8806': '《說文》：“𧍣，毒蟲也。象形。蠆或从䖵。”', '27.8764': '《說文》：“蝤，蝤𧓉也。从虫，酋聲。”', '27.874E': '《說文》：“蝎，蝤蠐也。从虫，曷聲。”', '27.875D': '《說文》：“蝝，復陶也。劉歆說：蝝，蚍蜉子；董仲舒說：蝗子也。从虫，彖聲。”', '27.EB0A': '《說文》：“𧍓，悉𧍓也。从虫，帥聲。”', '27.8752': '《說文》：“蝒，馬蜩也。从虫，面聲。”', '27.EB0C': '《說文》：“䗐，蛄䗐。強羋也。从虫，施聲。”', '27.EB0D': '《說文》：“䖼，渠䖼，一曰天社。从虫，却聲。”', '27.8765': '《說文》：“蝥，螌蝥也。从虫，敄聲。”', '27.8751': '《說文》：“蝑，蜙蝑也。从虫，胥聲。”', '27.8757': '《說文》：“蝗，螽也。从虫，皇聲。”', '27.EB17': '《說文》：“𧍖，蟲也。从虫，省聲。”', '27.8761': '《說文》：“蝡，動也。从虫，耎聲。”', '27.8778': '《說文》：“蝸，蝸蠃也。从虫，咼聲。”', '27.8753': '《說文》：“蝓，虒蝓也。从虫，俞聲。”', '27.EB1D': '《說文》：“𧍘，𧍘蟉也。从虫，幽聲。”', '27.8766': '《說文》：“蝦，蝦蟆也。从虫，叚聲。”', '27.876F': '《說文》：“蝯，善援，禺屬。从虫，爰聲。”', '27.8759': '《說文》：“蝙，蝙蝠也。从虫，扁聲。”', '27.8760': '《說文》：“蝠，蝙蝠。服翼也。从虫，畐聲。”', '27.8768': '《說文》：“蝨，齧人蟲。从䖵，卂聲。”', '27.87BD': '《說文》：“螽，蝗也。从䖵，夂聲。夂，古文終字。𧑄，螽或从虫，眾聲。”', '27.EB32': '《說文》：“蝱，齧人飛蟲。从䖵，亡聲。”', '27.98B2': '《說文》：“𩘛，烈風也。从風，𠛱聲。讀若𠛱。”', '27.EB59': '《說文》：“㙩，周垣也。从土，尞聲。”', '27.5880': '《說文》：“墀，涂地也。从土，犀聲。《禮》：‘天子赤墀。’”', '27.58A8': '《說文》：“墨，書墨也。从土，从黑，黑亦聲。”', '27.589E': '《說文》：“增，益也。从土，曾聲。”', '27.58D4': '《說文》：“𡑏，保也；高土也。从土，𠷎聲。”', '27.58A0': '《說文》：“墠，野土也。从土，單聲。”', '27.EB77': '《說文》：“㙪，天陰塵也。《詩》曰：‘㙪㙪其陰。’从土，壹聲。”', '27.761E': '《說文》：“瘞，幽薶也。从土，㾜聲。”', '27.58B3': '《說文》：“墳，墓也。从土，賁聲。”', '27.589C': '《說文新附》：“墜，陊也。从土，隊聲。古通用䃍。”', '27.EB85': '《說文》：“㽨，殘田也。《詩》曰：‘天方薦㽨。’从田，差聲。”', '27.757F': '《說文》：“畿，天子千里地。以遠近言之，則言畿也。从田，幾省聲。”', '27.52F1': '《說文》：“勱，勉力也。《周書》曰：‘用勱相我邦家。’八若萬。从力，萬聲。”', '27.EB9B': '《說文》：“勮，務也。从力，豦聲。”', '27.52F0': '《說文》：“𢣢，同思之和。从劦，从思。”', '27.92C8': '《說文》：“鋈，白金也。从金，𦰚省聲。”', '27.EBA4': '《說文》：“鋚，鐵也，一曰轡首銅。从金，攸聲。”', '27.92B7': '《說文》：“銷，鑠金也。从金，肖聲。”', '27.92CF': '《說文》：“鋏，可以持冶器鑄鎔者。从金，夾聲。讀若漁人莢魚之莢。一曰若挾持。”', '27.92CC': '《說文》：“鋌，銅鐵樸也。从金，廷聲。”', '27.92DE': '《說文》：“鋞，温器也，圜直上。从金，巠聲。”', '27.92BC': '《說文》：“銼，鍑也。从金，坐聲。”', '27.92D7': '《說文》：“鋗，小盆也。从金，肙聲。”', '27.92CA': '《說文》：“鋊，可以句鼎耳及鑪炭。从金，谷聲。一曰：銅屑。讀若浴。”', '27.EBAC': '《說文》：“䥏，鉏䥏也。从金，御聲。鋙，䥏或从吾。”', '27.EBB4': '《說文》：“銸，鉆也。从金，耴聲。”', '27.92DD': '《說文》：“鋝，十銖二十五分之十三也。从金，寽聲。《周禮》曰：‘重三鋝。’北方以二十兩為鋝。”', '27.9418': '《說文》：“鐘，樂鐘也。秋分之音，物穜成。从金，童聲。古者垂作鐘。銿，鐘或从甬。”', '27.92D2': '《說文》：“鏠，兵耑也。从金，逢聲。”', '27.92B4': '《說文》：“銴，車樘結也。一曰銅生五色也。从金，折聲。讀若誓。”', '27.92C3': '《說文》：“鋃，鋃鏜，瑣也。从金，良聲。”', '27.92C2': '《說文》：“鋂，大瑣也，一環貫二者。从金，每聲。《詩》曰：‘盧重鋂。’”', '27.92EA': '《說文》：“鋪，箸門鋪首也。从金，甫聲。”', '27.F0AD': '《說文》：“銽，斷也。从金，𠯑聲。”', '27.92BB': '《說文》：“銻，鎕銻也。从金，弟聲。”', '27.65B2': '《說文》：“斲，斫也。从斤、𠁁。𦘣，斲或从畫从丮。”', '27.EBD2': '《說文》：“𥎆，矛屬。从矛，害聲。”', '27.8F1C': '《說文》：“輜，軿車前、衣車後也。从車，甾聲。”', '27.8F2C': '《說文》：“輬，卧車也。从車，京聲。”', '27.8F23': '《說文》：“輣，兵車也。从車，朋聲。”', '27.EBDA': '《說文》：“輢，車旁也。从車，奇聲。”', '27.8F25': '《說文》：“輥，轂齊等皃。从車，昆聲。《周禮》曰：‘望其轂，欲其輥。’”', '27.EBE1': '《說文》：“輨，轂耑沓也。从車，官聲。”', '27.EBE3': '《說文》：“䡞，直轅車䡽也。从車，聲。”', '27.7BC4': '《說文》：“範，範軷也。从車，笵省聲。讀與犯同。”', '27.8F16': '《說文》：“輖，重也。从車，周聲。”', '27.8F29': '《說文》：“輩，若軍發車百兩為一輩。从車，非聲。”', '27.EBEA': '《說文》：“𨌰，車迹也。从車，從省聲。”', '27.8F2A': '《說文》：“輪，有輻曰輪，無輻曰輇。从車，侖聲。”', '27.EBF3': '《說文》：“䡝，大車後壓也。从車，宛聲。”', '27.8F26': '《說文》：“輦，輓車也。从車，从㚘在車前引之。”', '27.EBFC': '《說文》：“隥，仰也。从𨸏，登聲。”', '27.96A4': '《說文》：“隤，下隊也。从𨸏，貴聲。”', '27.EC05': '《說文》：“𨼊，弘農陝東陬也。从𨸏，無聲。”', '27.EC0B': '《說文》：“䧦，鄭地阪。从𨸏，為聲。《春秋傳》曰：‘將會鄭伯于䧦。’”', '27.F663': '《說文》：“嘼，㹌也。象耳、頭、足厹地之形。古文嘼下从厹。”', '27.9187': '《說文》：“醇，不澆酒也。从酉，𦎧聲。”', '27.9186': '《說文》：“醆，爵也。一曰酒濁而微清也。从酉，戔聲。”', '27.918B': '《說文》：“醋，客酌主人也。从酉，昔聲。”', '27.9185': '《說文》：“醅，醉飽也。从酉，咅聲。”', '27.9189': '《說文》：“醉，卒也。卒其度量，不至於亂也。一曰潰也。从酉，从卒。”', '27.EC49': '《說文》：“䣼，雜味也。从酉，京聲。”', '27.79A6': '《說文》：“禦，祀也。从示，御聲。”', '27.E017': '《說文》：“璙，玉也。从玉，尞聲。”', '27.74A0': '《說文》：“璠，璵璠，魯之寶玉。从玉，番聲。孔子曰：美哉璵璠！遠而望之，奐若也；近而視之，瑟若也。一則理勝，二則孚勝。”', '27.E01D': '《說文》：“璑，三采玉也。从玉，無聲。”', '27.74BF': '《說文》：“璿，美玉也。从玉，睿聲。《春秋傳》曰：‘璿弁玉纓’。𤩅，古文璿。叡，籀文璿。”', '27.749C': '《說文》：“璜，半璧也。从玉，黄聲。”', '27.E022': '《說文》：“璏，劍鼻玉也。从玉，彘聲。”', '27.E026': '《說文》：“璹，玉器也。从玉，𠷎聲。讀若淑。”', '27.E02B': '《說文》：“𤨙，玪𤨙也。从玉，勒聲。”', '27.74A1': '《說文》：“璡，石之似玉者。从玉，進聲。讀若津。”', '27.E031': '《說文》：“㻸，石之似玉者。从玉，朁聲。”', '27.7492': '《說文》：“璒，石之似玉者。从玉，登聲。”', '27.74A3': '《說文》：“璣，珠不圜也。从玉，幾聲。”', '27.E05C': '《說文》：“𦺇，水萹茿。从艸，从水，毒聲。讀若督。”', '27.E061': '《說文》：“𦺒，毒艸也。从艸，婺聲。”', '27.E066': '《說文》：“𦺳，薏苢。从艸，𠶷聲。一曰𦺳英。”', '27.E068': '《說文》：“𦺊，夫蘺也。从艸，睆聲。”', '27.8541': '《說文》：“蕁，䒞藩也。从艸，尋聲。𧂇，蕁或从爻。”', '27.8555': '《說文》：“蕕，水邊艸也。从艸，猶聲。”', '27.8567': '《說文》：“蕧，盜庚也。从艸，復聲。”', '27.E074': '《說文》：“䔰，葍也。从艸，富聲。”', '27.E07A': '《說文》：“䔴，艸也。从艸，𠭥聲。”', '27.856B': '《說文》：“蕫，鼎蕫也。从艸，童聲。杜林曰藕根。”', '27.E07C': '《說文》：“𦺋，艸也。从艸，㛮聲。”', '27.8545': '《說文》：“蕅，芙渠根。从艸、水，禺聲。”', '27.856D': '《說文》：“蕭，艾蒿也。从艸，肅聲。”', '27.E087': '《說文》：“𦺍，王彗也。从艸，湔聲。”', '27.855B': '《說文》：“蕛，蕛苵也。从艸，稊聲。”', '27.8548': '《說文》：“蕈，桑䓴。从艸，覃聲。”', '27.8563': '《說文》：“蕣，木堇，朝華暮落者。从艸，䑞聲。《詩》曰：‘顏如蕣華。’”', '27.E094': '《說文》：“𦺶，艸之小者。从艸，㓹聲。㓹，古文銳字。讀若芮。”', '27.8564': '《說文》：“蕤，艸木華垂貌。从艸，甤聲。”', '27.E097': '《說文》：“䔺，藍蓼秀。从艸，隨省聲。”', '27.E098': '《說文》：“𦺉，華葉布。从艸，傅聲。讀若傅。”', '27.856A': '《說文》：“蕪，薉也。从艸，無聲。”', '27.E09E': '《說文》：“𦺝，艸亂也。从艸，寍聲。杜林說：艸𦱊𦺝皃。”', '27.8561': '《說文》：“蕡，雜香艸。从艸，賁聲。”', '27.855D': '《說文》：“蕝，朝會束茅表位曰蕝。从艸，絕聲。《春秋國語》曰：‘致茅蕝表坐。’”', '27.E0A7': '《說文》：“䔽，蓋也。从艸，渴聲。”', '27.E0AB': '《說文》：“䔯，韭鬱也。从艸，酤聲。”', '27.E0B4': '《說文》：“䔿，叢艸也。从艸，尊聲。”', '27.8558': '《說文》：“蕘，薪也。从艸，堯聲。”', '27.8549': '《說文》：“蕉，生枲也。从艸，焦聲。”', '27.8547': '《說文》：“蕇，亭歷也。从艸，單聲。”', '27.8568': '《說文》：“蕨，鼈也。从艸，厥聲。”', '27.E0C0': '《說文》：“𦻃，薍也。从艸，雈聲。”', '27.8543': '《說文》：“蕃，艸茂也。从艸，番聲。”', '27.858C': '《說文新附》：“薌，穀氣也。从艸，鄉聲。”', '27.8546': '《說文新附》：“蕆，《左氏傳》：‘以蕆陳事。’杜預注云：‘蕆，敕也。’从艸，未詳。”', '27.729D': '《說文新附》：“犝，無角牛也。从牛，童聲。古通用僮。”', '27.566D': '《說文》：“噭，吼也。从口，敫聲。一曰噭，呼也。”', '27.5663': '《說文》：“噣，喙也。从口，蜀聲。”', '27.5672': '《說文》：“噲，咽也。从口，會聲。讀若快。一曰嚵噲也。”', '27.566C': '《說文》：“噬，啗也；喙也。从口，筮聲。”', '27.E0EC': '《說文》：“𠿡，口滿食。从口，窡聲。”', '27.566B': '《說文》：“噫，飽食息也。从口，意聲。”', '27.5664': '《說文》：“噤，口閉也。从口，禁聲。”', '27.5671': '《說文》：“噱，大笑也。从口，豦聲。”', '27.E0F7': '《說文》：“歗，吟也。从欠，肅聲。《詩》曰：‘其歗也謌’。”', '27.5666': '《說文》：“噦，气啎也。从口，歲聲。”', '27.E0FF': '《說文》：“噧，高气多言也。从口，蠆省聲。”', '27.5673': '《說文》：“噳，麋鹿羣口相聚皃。从口，虞聲。”', '27.565E': '《說文新附》：“噞，噞喁，魚口上見也。从口，僉聲。”', '27.8DA5': '《說文》：“趥，行皃。从走，酋聲。”', '27.E12A': '《說文》：“𧼨，趌𧼨也。从走，曷聲。”', '27.E134': '《說文》：“𧼪，超特也。从走，契聲。”', '27.8DA7': '《說文》：“趧，趧婁，四夷之舞，各自有曲。从走，是聲。”', '27.6B77': '《說文》：“歷，過也。从止，厤聲。”', '27.96A8': '《說文》：“隨，从也。从辵，𡐦省聲。”', '27.9075': '《說文》：“遵，循也。从辵，尊聲。”', '27.9078': '《說文》：“選，遣也。从辵、巽。巽遣之，巽亦聲。一曰選擇也。”', '27.9079': '《說文》：“遹，回避也。从辵，矞聲。”', '27.907A': '《說文》：“遺，亡也。从辵，䝿聲。”', '27.E17C': '《說文》：“𨖹，近也。从辵，聲。”', '27.907C': '《說文》：“遼，遠也。从辵，尞聲。”', '27.5FBC': '《說文》：“徼，循也。从彳，敫聲。”', '27.8E3D': '《說文》：“踽，疏行皃。从足，禹聲。《詩》曰：‘獨行踽踽。’”', '27.8E30': '《說文》：“踰，越也。从足，俞聲。”', '27.8E35': '《說文》：“踵，追也。从足，重聲。一曰往來皃。”', '27.8E36': '《說文》：“踶，躗也。从足，是聲。”', '27.8E3C': '《說文》：“踼，跌踼也。从足，昜聲。一曰搶也。”', '27.8E41': '《說文》：“蹁，足不正也。从足，扁聲。一曰拖後足馬。讀若苹，或曰徧。”', '27.E1CE': '《說文》：“䠍，足所履也。从足，叚聲。”', '27.8E38': '《說文新附》：“踸，踸踔，行無常皃。从足，甚聲。”', '27.E1D6': '《說文》：“䶵，管樂也。从龠，虒聲。篪，䶵或从竹。”', '27.5668': '《說文》：“器，皿也。象器之口，犬所以守之。”', '27.8B02': '《說文》：“謂，報也。从言，胃聲。”', '27.8B01': '《說文》：“謁，白也。从言，曷聲。”', '27.8AFE': '《說文》：“諾，𧭭也。从言，若聲。”', '27.8AF7': '《說文》：“諷，誦也。从言，風聲。”', '27.8AED': '《說文》：“諭，告也。从言，俞聲。”', '27.8ADF': '《說文》：“諟，理也。从言，是聲。”', '27.8AE6': '《說文》：“諦，審也。从言，帝聲。”', '27.8AF6': '《說文》：“諶，誠諦也。从言，甚聲。《詩》曰：‘天難諶斯。’”', '27.8AF1': '《說文》：“諱，誋也。从言，韋聲。”', '27.8ADD': '《說文》：“諝，知也。从言，胥聲。”', '27.8AEB': '《說文》：“諫，証也。从言，柬聲。”', '27.8AF4': '《說文》：“諴，和也。从言，咸聲。《周書》曰：‘不能諴于小民。’”', '27.8AE7': '《說文》：“諧，詥也。从言，皆聲。”', '27.8AC8': '《說文》：“諈，諈諉，纍也。从言，垂聲。”', '27.8AF0': '《說文》：“諰，思之意。从言，从思。”', '27.8AFA': '《說文》：“諺，傳言也。从言，彥聲。”', '27.8AFC': '《說文》：“諼，詐也。从言，爰聲。”', '27.8ADE': '《說文》：“諞，便巧言也。从言，扁聲。《周書》曰：‘𢧵𢧵善諞言。’《論語》曰：‘友諞佞。’”', '27.8B14': '《說文》：“謔，戲也。从言，虐聲。《詩》曰：‘善戲謔兮。’”', '27.E213': '《說文》：“諣，疾言也。从言，咼聲。”', '27.8AEF': '《說文》：“諯，數也。一曰相讓也。从言，耑聲。讀若專。”', '27.E227': '《說文》：“諽，飾也。一曰更也。从言，革聲。讀若戒。”', '27.8AF3': '《說文》：“諳，悉也。从言，音聲。”', '27.8AE1': '《說文》：“諡，行之迹也。从言、兮、皿，闕。”', '27.8ADC': '《說文》：“諜，軍中反閒也。从言，枼聲。”', '27.8B0F': '《說文新附》：“𧩮，小也；誘也。从言，叜聲。《禮記》曰：‘足以𧩮聞。’”', '27.EDBA': '《說文》：“𢍰，引給也。从廾，睪聲。”', '27.F052': '《說文》：“𢍱，升高也。从舁，囟聲。𠨧，𢍱或从卩。𦧂，古文𢍱。”', '27.8208': '《說文》：“興，起也。从舁，从同。同力也。”', '27.9794': '《說文》：“鞔，履空也。从革，免聲。”', '27.E248': '《說文》：“䩡，鞮，䩡沙也。从革，从夾，夾亦聲。”', '27.E259': '《說文》：“𩊪，車鞁具也。从革，豆聲。”', '27.9799': '《說文》：“鞙，大車縛軛靼。从革，肙聲。”', '27.E265': '《說文》：“䩤，繫牛脛也。从革，見聲。”', '27.9798': '《說文新附》：“鞘，刀室也。从革，肖聲。”', '27.9B33': '《說文》：“鬳，鬲屬。从鬲，虍聲。”', '27.878D': '《說文》：“融，炊气上出也。从鬲，蟲省聲。籀文融不省。”', '27.E270': '《集韻．陽韻》：“𩰱，《說文》：‘煮也。’或作鬺。”', '27.F39B': '《說文》：“䰜，㽁也。古文亦鬲字，象孰飪五味气上出也。”', '27.9B28': '《說文》：“鬨，鬭也。从鬥，共聲。《孟子》曰：‘鄒與魯鬨。’”', '27.5C0E': '《說文》：“導，導引也。从寸，道聲。”', '27.E2B3': '《說文》：“𤮪，羽獵韋絝。从㼱，灷聲。𧜈，或从衣，从朕。《虞書》：‘鳥獸𧜈毛。’”', '27.6574': '《說文》：“整，齊也。从攴，从束，从正。正亦聲。”', '27.E2BB': '《說文》：“𣿊，辟𣿊鐵也。从攴、从湅。”', '27.657F': '《說文》：“敿，繫連也。从攴，喬聲。”', '27.E2C7': '《說文》：“𢿢，煩也。从攴，𤔔。𢿢亦聲。”', '27.E2CF': '《說文》：“𢿟，棄也。从攴，𠷎聲。《周書》以為討。”', '27.E2D4': '《說文》：“𢿣，䚫田也。从攴，堯聲。”', '27.F0A8': '《說文》：“斆，覺悟也。从教，从冖，冖，尚矇也，臼聲。學，篆文斅省。”', '27.779E': '《說文》：“瞞，平目也。从目，㒼聲。”', '27.779F': '《說文》：“𥍌（瞟），𥉻也。从目，𤐫聲。”', '27.E2F0': '《說文》：“𥉻，察也。从目，祭聲。”', '27.E2F5': '《說文》：“𥉈，失意視也。从目，脩聲。”', '27.7797': '《說文》：“瞗，目孰視也。从目，鳥聲。讀若雕。”', '27.77A5': '《說文》：“瞥，過目也。又目翳也。从目，敝聲。一曰財見也。”', '27.779A': '《說文》：“瞚，開闔目數搖也。从目，寅聲。”', '27.9F3D': '《說文》：“鼽，病寒鼻窒也。从鼻，九聲。”', '27.7FF0': '《說文》：“翰，天雞，赤羽也。从羽，倝聲。”', '27.7FEE': '《說文》：“翮，羽莖也。从羽，鬲聲。”', '27.7FF1': '《說文》：“翺，翺翔也。从羽，臯聲。”', '27.7FEF': '《說文》：“翯，鳥白肥澤皃。从羽，高聲。《詩》云：‘白鳥翯翯。’”', '27.95B5': '《說文》：“閵，今閵，似鴝鵒而黄。从隹，𨳏省聲。𨶄，籀文不省。”', '27.96D5': '《說文》：“雕，鷻也。从隹，周聲。鵰，籀文雕从鳥。”', '27.E325': '《說文》：“𩁛，䨄屬。从隹，𦎧聲。”', '27.596E': '《說文》：“奮，翬也。从㚝在田上。《詩》曰：‘不能奮飛。’”', '27.77A2': '《說文》：“瞢，目不明也。从苜，从䀏。䀏，目數搖也。”', '27.96D4': '《說文》：“雔，雙鳥也。从二隹，讀若醻。”', '27.970D': '《說文》：“靃，飛聲也，雨而雙飛者其聲靃然。”', '27.9D20': '《說文》：“鴠，渴鴠也。从鳥，旦聲。”', '27.9D1E': '《說文》：“鴞，鴟鴞，寧鴂也。从鳥，号聲。”', '27.9D29': '《說文》：“䳀，鋪豉也。从鳥，失聲。”', '27.E34B': '《說文》：“𩿢，鳥也。从鳥，主聲。”', '27.9D1B': '《說文》：“鴛，鴛鴦也。从鳥，夗聲。”', '27.9D26': '《說文》：“鴦，鴛鴦也。从鳥，央聲。”', '27.E34F': '《說文》：“鴚，鴚鵝也。从鳥，可聲。”', '27.9D14': '《說文》：“𪀐，𪀐鵖也。从鳥，乏聲。”', '27.E357': '《說文》：“䳁，鳥也。从鳥，犮聲。讀若撥。”', '27.9D17': '《說文》：“鴗，天狗也。从鳥，立聲。”', '27.E35E': '《說文》：“鴡，王鴡也。从鳥，且聲。”', '27.9D25': '《說文》：“鴥，鸇飛皃。从鳥，穴聲。《詩》曰：‘鴥彼晨風。’”', '27.9D1D': '《說文》：“鴝，鴝鵒也。从鳥，句聲。”', '27.E364': '《說文》：“䳇，鸚䳇也。从鳥，母聲。”', '27.9D23': '《說文新附》：“鴣，鷓鴣也。从鳥，古聲。”', '27.9D28': '《說文新附》：“鴨，鶩也。俗謂之鴨。从鳥，甲聲。”', '27.E37B': '《說文》：“殨，爛也。从歺，貴聲。”', '27.6BAB': '《說文》：“殫，殛盡也。从歺，單聲。”', '27.9ABF': '《說文》：“骿，并脅也。从骨，并聲。‘晉文公骿脅。’”', '27.E389': '《說文》：“䯏，骨耑也。从骨，𠯑聲。”', '27.9AB9': '《說文》：“骹，脛也。从骨，交聲。”', '27.9AB8': '《說文》：“骸，脛骨也。从骨，亥聲。”', '27.9ABC': '《說文》：“骼，禽獸之骨曰骼。从骨，合聲。”', '27.9AB4': '《說文》：“骴，鳥獸殘骨曰骴。骴，可惡也。从骨，此聲。《明堂月令》曰：‘掩骼薶骴。’ 骴或从肉。”', '27.E38F': '《說文》：“𦠄，頰肉也。从肉，幾聲。讀若畿。”', '27.81B3': '《說文》：“膳，具食也。从肉，善聲。”', '27.81B4': '《說文》：“膴，無骨腊也。揚雄說，鳥腊也。从肉，無聲。”', '27.E3A4': '《說文》：“䐹，乾魚尾䐹䐹也。从肉，肅聲。《周禮》有腒䐹。”', '27.81AE': '《說文》：“膮，豕肉羹也。从肉，堯聲。”', '27.81A9': '《說文》：“膩，上肥也。从肉，貳聲。”', '27.81B9': '《說文》：“膹，𦞦也。从肉，賁聲。”', '27.81C7': '《說文》：“臇，𦞦也。从肉，雋聲。讀若纂。㷷，臇或从火巽。”', '27.81AC': '《說文》：“膬，耎易破也。从肉，毳聲。”', '27.8FA8': '《說文》：“辦，判也。从刀，辡聲。”', '27.5291': '《說文》：“劑，齊也。从刀，从齊，齊亦聲。”', '27.E3D5': '《說文》：“䚡，角中骨也。从角，思聲。”', '27.E3D7': '《說文》：“𧤖，角曲中也。从角，畏聲。”', '27.E3DC': '《說文》：“𧤗，角𧤗，獸也。狀似豕，角善為弓。出胡休多國。从角，耑聲。”', '27.89F4': '《說文》：“觴，觶實曰觴，虛曰觶。从角，𥏻省聲。𣝻，籀文觴从爵省。”', '27.E3E5': '《說文》：“𧤕，隿射收繳具。从角，酋聲。讀若鰌。”', '27.E3E8': '《說文》：“䉠，竹也。从竹，微聲。”', '27.E3ED': '《說文》：“䈵，竹皃。从竹，翁聲。”', '27.7BE8': '《說文》：“篨，籧篨也。从竹，除聲。”', '27.E3F8': '《說文》：“䈰，陳留謂飯帚曰䈰。从竹，捎聲。一曰飯器，容五升。一曰宋、魏謂箸筩為䈰。”', '27.7BDD': '《說文》：“篝，笿也，可熏衣。从竹，冓聲。宋、楚謂竹篝牆以居也。”', '27.7BDA': '《說文》：“篚，車笭也。从竹，匪聲。”', '27.E40C': '《說文》：“𥰨，搔馬也。从竹，剡聲。”', '27.7BE6': '《說文新附》：“篦，導也。今俗謂之篦。从竹，𣬉聲。”', '27.7BD9': '《說文新附》：“篙，所以進船也。从竹，高聲。”', '27.E422': '《說文》：“𤯌，和也。从甘，从麻。麻，調也。甘亦聲，讀若函。”', '27.7FB2': '《說文》：“羲，气也。从兮，義聲。”', '27.EC66': '《說文》：“憙，說也。从心，从喜，喜亦聲。”', '27.E438': '《說文》：“𧯷，蠡也。从豆，蒸省聲。”', '27.8665': '《說文》：“虦，虎竊毛謂之虦苗。从虎，戔聲。竊，淺也。”', '27.8663': '《說文新附》：“𧇭，虐也；急也。从虎，从武。見《周禮》。”', '27.E44B': '《說文新附》：“䖘，楚人謂虎為烏䖘。从虎，兔聲。”', '27.8664': '《說文》：“虤，虎怒也。从二虎。”', '27.76E7': '《說文》：“盧，飲器也。从皿，𧇄聲。𥃈，籀文盧。”', '27.E450': '《說文》：“䀇，器也。从皿，从缶，古聲。”', '27.76E6': '《說文》：“盦，覆蓋也。从皿，酓聲。”', '27.76E5': '《說文》：“盥，澡手也。从𦥑、水，臨皿。《春秋傳》曰：‘奉匜沃盥。’”', '27.975C': '《說文》：“靜，審也。从青，爭聲。”', '27.E469': '《說文》：“𩰢，列也。从鬯，吏聲。讀若迅。”', '27.EE95': '《說文》：“𩞑，滫飯也。从食，𠦪聲。饙，𩞑或从賁。𩝼，𩞑或从𢍃。”', '27.E46F': '《說文》：“𩛿，飴和饊者也。从食，易聲。”', '27.991E': '《說文》：“餞，送去也。从食，戔聲。《詩》曰：‘顯父餞之。’”', '27.9928': '《說文》：“館，客舍也。从食，官聲。《周禮》：‘五十里有市，市有館，館有積，以待朝聘之客。’”', '27.9927': '《說文》：“餧，飢也。从食，委聲。一曰魚敗曰餧。”', '27.991F': '《說文》：“餟，祭酹也。从食，叕聲。”', '27.E488': '《說文》：“𩜁，馬食穀多，气流四下也。从食，夌聲。”', '27.E493': '《說文》：“䍍，未燒瓦器也。从缶，㱿聲。讀若筩莩。”', '27.E494': '《說文》：“𦉈，小口罌也。从缶，𠂹聲。”', '27.7F43': '《說文》：“罃，備火長頸缾也。从缶，熒省聲。”', '27.F4C1': '《說文》：“𩫏，度也，民所度居也。从回，象城𩫏之重，兩亭相對也，或但从口。”', '27.9EAE': '《說文》：“麮，麥甘鬻也。从麥，去聲。”', '27.E4B6': '《說文》：“䴳，餅𥶶也。从麥，穴聲。”', '27.6A58': '《說文》：“橘，果，出江南。从木，矞聲。”', '27.6A59': '《說文》：“橙，橘屬。从木，登聲。”', '27.6A3F': '《說文》：“樿，木也，可以為櫛。从木，單聲。”', '27.E4D0': '《說文》：“𣙿，木也。从木，費聲。”', '27.E4D6': '《說文》：“𣚍，梓屬。大者可為棺椁，小者可為弓材。从木，𠶷聲。”', '27.6A41': '《說文》：“橁，杶也。从木，筍聲。”', '27.6A3B': '《說文》：“樻，椐也。从木，貴聲。”', '27.6A5E': '《說文》：“橞，木也。从木，惠聲。”', '27.6A32': '《說文》：“樲，酸棗也。从木，貳聲。”', '27.6A6A': '《說文》：“橪，酸小棗。从木，然聲。一曰染也。”', '27.6A4E': '《說文》：“橎，木也。从木，番聲。”', '27.6A35': '《說文》：“樵，𢿨也。从木，焦聲。”', '27.E4F3': '《說文》：“𣚎，木實也。从木，絫聲。”', '27.E4F9': '《說文》：“橌，大木皃。从木，閒聲。”', '27.6A48': '《說文》：“橈，曲木。从木，堯聲。”', '27.6A5A': '《說文》：“橚，長木皃。从木，肅聲。”', '27.6A38': '《說文》：“樸，木素也。从木，菐聲。”', '27.7BC9': '《說文》：“築，擣也。从木，筑聲。𥵭，古文。”', '27.6A51': '《說文》：“橑，椽也。从木，尞聲。”', '27.6A5D': '《說文》：“橝，屋梠前也。从木，覃聲。”', '27.6A66': '《說文》：“橦，帳柱也。从木，童聲。”', '27.F11C': '《說文》：“𣚏，㭉，臿也。从木、入，象形，䀠聲。”', '27.6A62': '《說文》：“橢，車笭中橢橢器也。从木，隋聲。”', '27.6A5F': '《說文》：“機，主發謂之機。从木，幾聲。”', '27.6A5B': '《說文》：“橜，戈也，从木厥聲。一曰門梱也。”', '27.6A34': '《說文》：“樴，弋也。从木，戠聲。”', '27.6A4B': '《說文》：“橋，水梁也。从木，喬聲。”', '27.E527': '《說文》：“橃，海中大船。从木，發聲。”', '27.6A6B': '《說文》：“横，闌木也。从木，黄聲。”', '27.6AAE': '《說文》：“𣚑，斷木也，从木𠷎聲。《春秋傳》曰：‘𣚑柮’。”', '27.E52F': '《說文》：“㯕，櫪㯕切。从木，斯聲。”', '27.F12C': '《說文》：“㯥，二東。曹从此。闕。”', '27.9E93': '《說文》：“麓，守山林吏也。从林，鹿聲。一曰林屬於山為麓。《春秋傳》曰：‘沙麓崩。’㯟，古文从彔。”', '27.E541': '《說文》：“㯡，桼垸已，復桼之。从桼，包聲。”', '27.6A50': '《說文》：“橐，囊也。从㯻省，石聲。”', '27.571C': '《說文》：“圜，天體也。从囗，睘聲。”', '27.571B': '《說文》：“圛，回行也。从囗，睪聲。《尚書》‘曰圛’。圛，升雲半有半無，讀若驛。”', '27.E549': '《說文》：“䞈，資也。从貝，為聲。或曰，此古貨字。讀若貴。”', '27.8CEE': '《說文》：“賮，會禮也。从貝，㶳聲。”', '27.8CF4': '《說文》：“賴，贏也。从貝，剌聲。”', '27.8CF5': '《說文新附》：“賵，贈死者。从貝，从冒。冒者，衣衾覆冒之意。”', '27.9134': '《說文》：“鄴，魏郡縣。从邑，業聲。”', '27.9133': '《說文》：“鄳，江夏縣。从邑，黽聲。”', '27.E56F': '《說文》：“𨞛，南陽陰鄉。从邑，葛聲。”', '27.9136': '《說文》：“鄶，祝融之後，妘姓所封。潧、洧之間，鄭滅之。从邑，會聲。”', '27.E57C': '《說文》：“䣡，臨淮徐地。从邑，義聲。《春秋傳》曰：‘徐䣡楚。’”', '27.66C4': '《說文》：“曄，光也。从日、𠌶。”', '27.66C0': '《說文》：“曀，陰而風也。从日，壹聲。《詩》曰：‘終風且曀。’”', '27.66CF': '《說文》：“曏，不久前。从日，鄉聲。”', '27.66C9': '《說文》：“曉，明也。从日，堯聲。”', '27.66C8': '《說文新附》：“曈，曈嚨，日欲明也。从日，童聲。”', '27.66C7': '《說文新附》：“曇，雲布也。从日、雲會意。”', '27.66C6': '《說文新附》：“曆，厤象也。从日，厤聲。《史記》通用歷。”', '27.9F12': '《說文》：“鼒，鼎之圜掩上者。从鼎，才聲。《詩》曰：鼐鼎及鼒。‘鎡，俗鼒。’ 从金，从玆。”', '27.7A46': '《說文》：“穆，禾也。从禾，㣎聲。”', '27.7A44': '《說文》：“穄，𪎭也。从禾，祭聲。”', '27.7A4E': '《說文》：“穎，禾末也。从禾，頃聲。”', '27.7A4D': '《說文》：“積，聚也。从禾。責聲。”', '27.7CD2': '《說文》：“糒，乾（飯）也。从米，𤰈聲。”', '27.7CD7': '《說文》：“糗，熬米麥也。从米，臭聲。”', '27.7CD6': '《說文新附》：“糖，飴也。从米，唐聲。”', '27.6BC7': '《說文》：“毇，米一斛舂為八斗也。从䊆，从殳。”', '27.E611': '《說文》：“𤬖，瓜也。从瓜，𤬍省聲。”', '27.74E2': '《說文》：“瓢，蠡也。从瓠省，票聲。”', '27.5BF0': '《說文新附》：“寰，王者封畿內縣也。从宀，睘聲。”', '27.E638': '《說文》：“䆫，通孔也。从穴，怱聲。”', '27.7AB5': '《說文》：“窵，窵窅，深也。从穴，鳥聲。”', '27.7ABA': '《說文》：“窺，小視也。从穴，規聲。”', '27.7AB1': '《說文》：“窱，杳窱也。从穴，條聲。”', '27.763D': '《說文》：“瘽，病也。从疒，堇聲。”', '27.7635': '《說文》：“瘵，病也。从疒，祭聲。”', '27.763C': '《說文》：“瘼，病也。从疒，莫聲。”', '27.7632': '《說文》：“瘲，病也。从疒，從聲。”', '27.E64D': '《說文》：“瘻，頸腫也。从疒，婁聲。”', '27.E653': '《說文》：“𤹝，足气不至也。从疒，畢聲。”', '27.E660': '《說文》：“㿄，劇聲也。从疒，殹聲。”', '27.7633': '《說文》：“瘳，疾瘉也。从疒，翏聲。”', '27.E672': '《說文》：“䍡，罜䍡也。从网，鹿聲。”', '27.7F7B': '《說文》：“罻，捕鳥网也。从网，尉聲。”', '27.7F79': '《說文新附》：“罹，心憂也。从网，未詳，古多通用離。”', '27.5E66': '《說文》：“幦，䰍布也。从布，辟聲。《周禮》曰：‘駹車大幦。’”', '27.5E67': '《說文新附》：“幧，斂髮也。从巾，喿聲。”', '27.9326': '《說文》：“錦，襄邑織文。从帛，金聲。”', '27.9EFA': '《說文》：“黺，袞衣山龍華蟲。黺，畫粉也。从黹，从粉省，衛宏說。”', '27.5112': '《說文》：“儒，柔也，術士之偁。从人，需聲。”', '27.5110': '《說文》：“儐，導也。从人，賓聲。擯，儐或从手。”', '27.5115': '《說文》：“儕，等輩也。从人，齊聲。”', '27.5117': '《說文》：“儗，僭也。一曰相疑。从人，从疑。”', '27.5114': '《說文》：“儔，翳也。从人，壽聲。”', '27.E6CC': '《說文》：“𠏮，币也。从人，對聲。”', '27.5180': '《說文》：“冀，北方州也。从北，異聲。”', '27.8927': '《說文》：“褧，檾也。《詩》曰：‘衣錦褧衣。’示反古。从衣，耿聲。”', '27.8922': '《說文》：“褢，袖也。一曰藏也。从衣，鬼聲。”', '27.8931': '《說文》：“褱，俠也。从衣，眔聲。一曰橐。”', '27.8930': '《說文》：“褰，絝也。从衣，寒省聲。《春秋傳》曰：‘徵褰與襦。’”', '27.892B': '《說文》：“褫，奪也。从衣，虒聲。讀若池。”', '27.892E': '《說文》：“褮，鬼衣。从衣，熒省聲。讀若《詩》曰：‘葛藟縈之’；一曰，若‘靜女其袾’之袾。”', '27.892D': '《說文》：“褭，以組帶馬也。从衣，从馬。”', '27.E6FF': '《說文新附》：“㲪，毾㲪也。从毛，登聲。”', '27.6C05': '《說文新附》：“氅，析鳥羽為旗纛之屬。从毛，敞聲。”', '27.E717': '《說文》：“𧡩，大視也。从見，爰聲。”', '27.E71B': '《說文》：“𧡨，顯也。从見，是聲。”', '27.E71F': '《說文》：“𧡪，內視也。从見，甚聲。”', '27.E725': '《說文》：“𧡬，私出頭視也。从見，䑣聲。讀若郴。”', '27.89A6': '《說文》：“覦，欲也。从見，俞聲。”', '27.89AA': '《說文》：“親，至也。从見，亲聲。”', '27.6B55': '《說文》：“歕，吹氣也。从欠，賁聲。”', '27.6B54': '《說文》：“歔，欷也。从欠，虛聲。一曰出气也。”', '27.E73E': '《說文》：“㵣，欲歠歠。从欠，渴聲。”', '27.6B59': '《說文》：“歙，縮鼻也。从欠，翕聲。丹陽有歙縣。”', '27.982D': '《說文》：“頭，首也。从頁，豆聲。”', '27.982F': '《說文》：“頯，權也。从頁，𢌳聲。”', '27.9830': '《說文》：“頰，面㫄也。从頁，夾聲。𩔯，籀文頰。”', '27.9838': '《說文》：“頸，頭莖也。从頁，巠聲。”', '27.9835': '《說文》：“頵，頭頵頵大也。从頁，君聲。”', '27.E766': '《說文》：“𩒳，昧前也。从頁，𡿯聲。讀若昧。”', '27.9832': '《說文》：“頲，狹頭頲也。从頁，廷聲。”', '27.9837': '《說文》：“頜，面黄也。从頁，含聲。”', '27.E782': '《說文》：“䩉，頰也。从面，甫聲。”', '27.7E23': '《說文》：“縣，繫也。从系持𥄉。”', '27.E787': '《說文》：“䫇，頰須也。从須，从冄，冄亦聲。”', '27.E798': '《說文》：“䯸，用梳比也。从髟，次聲。”', '27.9AFA': '《說文》：“䯺，潔髮也。从髟，𠯑聲。”', '27.9AF6': '《說文》：“髶，亂髮也。从髟，茸省聲。”', '27.9AFB': '《說文新附》：“髻，緫髮也。从髟，吉聲。古通用結。”', '27.E7B0': '《說文》：“𠤄，曲脊也。从勹，𥷚省聲。”', '27.7BE1': '《說文》：“篡，屰而奪取曰篡。从厶，算聲。”', '27.5DA7': '《說文》：“嶧，葛嶧山，在東海下邳。从山，睪聲。”', '27.5DA8': '《說文》：“嶨，山多大石也。从山，學省聲。”', '27.E7CE': '《說文》：“𡽕，山皃。”', '27.E7D0': '《說文》：“𡽃，山皃。从山，隓聲。”', '27.E7D9': '《說文》：“㢚，廡也。从广，虜聲。讀若鹵。”', '27.5EE6': '《說文》：“廦，牆也。从广，辟聲。”', '27.5EE5': '《說文》：“廥，芻藁之藏。从广，會聲。”', '27.78E7': '《說文》：“磧，水陼有石者。从石，責聲。”', '27.78DB': '《說文》：“磛，礹石也。从石，斬聲。”', '27.8C6D': '《說文》：“豭，牡豕也。从豕，叚聲。”', '27.8C90': '《說文》：“貐，猰貐，似貙，虎爪，食人，迅走。从豸，俞聲。”', '27.8C92': '《說文》：“貒，獸也。从豸，耑聲。讀若湍。”', '27.8C93': '《說文新附》：“貓，貍屬。从豸，苗聲。”', '27.99F1': '《說文》：“駱，馬白色黑鬣尾也。从馬，各聲。”', '27.99F0': '《說文》：“駰，馬陰白雜毛黑。从馬，因聲。《詩》曰：‘有駰有騢。’”', '27.E822': '《說文》：“𩢑，馬名。从馬，此聲。”', '27.E823': '《說文》：“𩢮，馬名。从馬，休聲。”', '27.E826': '《說文》：“駫，馬盛肥也。从馬，光聲。《詩》曰：‘四壯駫駫。’”', '27.99E2': '《說文》：“駢，駕二馬也。从馬，并聲。”', '27.7BE4': '《說文》：“篤，馬行頓遟。从馬，竹聲。”', '27.E831': '《說文》：“𩢾，次弟馳也。从馬，𠛱聲。”', '27.99E7': '《說文》：“駧，馳馬洞去也。从馬，同聲。”', '27.99ED': '《說文》：“駭，驚也。从馬，亥聲。”', '27.E833': '《說文》：“𩢯，馬奔也。从馬，巟聲。”', '27.99EA': '《說文》：“駪，馬衆多皃。从馬，先聲。”', '27.99EE': '《說文》：“駮，獸。如馬，倨牙，食虎豹。从馬，交聲。”', '27.E839': '《說文》：“𩢲，疾也，从馬吏聲。”', '27.99E5': '《說文新附》：“駥，馬高八尺。从馬，戎聲。”', '27.9E87': '《說文》：“麇，麞也。从鹿，囷省聲。麕，籀文不省。”', '27.9E88': '《說文》：“麈，麋屬。从鹿，主聲。”', '27.E84D': '《說文》：“𣬕，獸名。从㲋，吾聲。”', '27.736A': '《說文》：“獪，狡獪也。从犬，會聲。”', '27.E852': '《說文》：“㺜，犬惡毛也。从犬，農聲。”', '27.736B': '《說文》：“獫，長喙犬。一曰黑犬黄頭。从犬，僉聲。”', '27.9ED8': '《說文》：“默，犬暫逐人也。从犬，黑聲。讀若墨。”', '27.7367': '《說文》：“獧，疾跳也。一曰急也。从犬，瞏聲。”', '27.7368': '《說文》：“獨，犬相得而鬭也。从犬，蜀聲。羊為羣，犬為獨也。一曰北囂山有獨𤞞獸，如虎，白身，豕鬣，尾如馬。”', '27.71D4': '《說文》：“燔，爇也。从火，番聲。”', '27.71D2': '《說文》：“燒，爇也。从火，堯聲。”', '27.E87D': '《說文》：“㷳，火色也。从火，雁聲。”', '27.71CB': '《說文》：“燋，所以然持火也。从火，焦聲。”', '27.71C0': '《說文》：“燀，炊也。从火，單聲。”', '27.71B9': '《說文》：“熹，炙也。从火，喜聲。”', '27.E884': '《說文》：“𤎯，置魚筩中炙也。从火，曾聲。”', '27.721B': '《說文》：“爤，孰也。从火，蘭聲。燗，或从閒。”', '27.71CE': '《說文》：“燎，放火也。从火，尞聲。”', '27.71C2': '《說文》：“燂，火熱也。从火，覃聲。”', '27.71C4': '《說文》：“燄，火行微燄燄也。从炎，臽聲。”', '27.F0C3': '《說文》：“𤎭，侵火也。从炎，㐭聲。”', '27.71C5': '《說文》：“燅，於湯中爚肉。从炎，从熱省。𤏝，或从炙。”', '27.E8A1': '《說文》：“黗，黃濁黑。从黑，屯聲。”', '27.9ED4': '《說文》：“黔，黎也。从黑，今聲。秦謂民為黔首，謂黑色也。周謂之黎民。《易》曰：‘為黔喙。’”', '27.9ED5': '《說文》：“黕，滓垢也。从黑，冘聲。”', '27.71CA': '《說文》：“燊，盛皃。从焱在木上。”', '27.8D6E': '《說文》：“赮，赤色也。从赤，叚聲。”', '27.E8B6': '《說文》：“奯，空大也。从大，歲聲。讀若《詩》‘施罟泧泧。’”', '27.E8C4': '《說文》：“𡰖，㝿不能行，為人所引，曰𡰖𡰡。从𡯁，从爪，是聲。”', '27.F0DA': '《說文》：“𥷚，窮理罪人也。从幸、从人、从言，竹聲。𥱩，或省言。”', '27.F067': '《說文》：“𡚇，大皃。从大，𥆞聲。或曰：拳勇字。一曰：讀若傿。”', '27.E8D1': '《說文》：“竱，等也。从立，專聲。《春秋》、《國語》曰：‘竱本肇末。’”', '27.61B2': '《說文》：“憲，敏也。从心，从目，害省聲。”', '27.7631': '《說文》：“瘱，靜也。从心，㾜聲。”', '27.6196': '《說文》：“憖，問也；謹敬也。从心，猌聲。一曰說也。一曰甘也。《春秋傳》曰：‘昊天不猌。’又曰：‘兩君之士皆未憖。’”', '27.E8F1': '《說文》：“𢡈，謹也。从心，𠭥聲。讀若毳。”', '27.61BA': '《說文》：“憺，安也。从心，詹聲。”', '27.61B8': '《說文》：“憸，憸詖也。憸利於上，佞人也。从心，僉聲。”', '27.E8FC': '《說文》：“㦌，精戅也。从心，毳聲。”', '27.61C1': '《說文》：“懁，急也。从心，睘聲。讀若絹。”', '27.61C8': '《說文》：“懈，怠也。从心，解聲。”', '27.61BF': '《說文》：“憿，幸也。从心，敫聲。”', '27.619D': '《說文》：“憝，怨也。从心，敦聲。《周書》曰：‘凡民罔不憝。’”', '27.61C6': '《說文》：“懆，愁不安也。从心，喿聲。《詩》曰：‘念子懆懆。’”', '27.618C': '《說文》：“憌，憂也。从心，鈞聲。”', '27.61CC': '《說文新附》：“懌，說也。从心，睪聲。經典通用釋。”', '27.6FAE': '《說文》：“澮，水。出靃山，西南入汾。从水，會聲。”', '27.6F5E': '《說文》：“潞，冀州浸也，上黨有潞縣。从水，路聲。”', '27.8569': '《說文》：“蕩，水。出河內蕩陰，東入黃澤。从水，𦳝聲。”', '27.6FA7': '《說文》：“澧，水。出南陽雉衡山，東入汝。从水，豊聲。”', '27.6FBA': '《說文》：“澺，水。出汝南上蔡黑閭澗，入汝。从水，意聲。”', '27.6FC4': '《說文》：“濄，水。受淮陽扶溝浪湯渠，東入淮。从水，過聲。”', '27.7049': '《說文》：“灉，河灉水，在宋。从水，雝聲。”', '27.6FB6': '《說文》：“澶，澶淵，水。在宋。从水，亶聲。”', '27.6FC1': '《說文》：“濁，水。出齊郡厲媯山，東北入鉅定。从水，蜀聲。”', '27.6FA5': '《說文》：“澥，郣澥，海之別也。从水，解聲。一說澥即澥谷也。”', '27.6FC0': '《說文》：“激，水礙衺疾波也。从水，敫聲。一曰半遮也。”', '27.6FB9': '《說文》：“澹，水搖也。从水，詹聲。”', '27.6FC7': '《說文》：“濇，不滑也。从水，嗇聲。”', '27.6FA4': '《說文》：“澤，光潤也。从水，睪聲。”', '27.6FB3': '《說文》：“澳，隈厓也。其內曰澳，其外曰隈。从水，奧聲。”', '27.6FA8': '《說文》：“澨，埤增水邊土，人所止者。从水，筮聲。《夏書》曰：‘過三澨。’”', '27.6FAC': '《說文》：“澬，久雨涔資也。一曰水名。从水，資聲。”', '27.6FC3': '《說文》：“濃，露多也。从水，農聲。《詩》曰：‘零露濃濃。’”', '27.E962': '《說文》：“𣿒，新也。从水，辠聲。”', '27.6FC8': '《說文》：“濈，和也。从水，戢聲。”', '27.6FA1': '《說文》：“澡，洒手也。从水，喿聲。”', '27.E96E': '《說文》：“㵞，腹中有水氣也。从水，从愁，愁亦聲。”', '27.6FCA': '《說文》：“濊，水多皃。从水，歲聲。”', '27.E98E': '《說文》：“𩃔，微雨也。从雨，㦰聲。又讀若芟。”', '27.E992': '《說文》：“𩄙，久雨也。从雨，圅聲。”', '27.9716': '《說文》：“霖，雨三日已往。从雨，林聲。”', '27.9711': '《說文》：“霑，雨𩃵也。从雨，沾聲。”', '27.970B': '《說文》：“霋，霽謂之霋。从雨，妻聲。”', '27.9713': '《說文》：“霓，屈虹，青赤，或白色，陰气也。从雨，兒聲。”', '27.970F': '《說文新附》：“霏，雨雲皃。从雨，非聲。”', '27.970E': '《說文新附》：“霎，小雨也。从雨，妾聲。”', '27.9B7C': '《說文》：“魼，魚也。从魚，去聲。”', '27.E9AC': '《說文》：“鮍，魚名。从魚，皮聲。”', '27.E9AD': '《說文》：“䱂，魚名。从魚，幼聲。讀若幽。”', '27.9B92': '《說文》：“鮒，魚名。从魚，付聲。”', '27.9B7E': '《說文》：“魾，大鱯也。其小者名鮡。从魚，丕聲。”', '27.9B80': '《說文》：“鮀，鮎也。从魚，它聲。”', '27.E9B4': '《說文》：“鮎，𩷑也。从魚，占聲。”', '27.9B90': '《說文》：“鮐，海魚名。从魚，台聲。”', '27.E9C2': '《說文》：“鮊，海魚名。从魚，白聲。”', '27.E9C4': '《說文》：“鮏，魚臭也。从魚，生聲。”', '27.9B91': '《說文》：“鮑，饐魚也。从魚，包聲。”', '27.E9C6': '《說文》：“魿，蟲連行紆行者。从魚，令聲。”', '27.E9C8': '《說文》：“𩶁，蚌也。从魚，丙聲。”', '27.9B85': '《說文》：“鮅，魚名。从魚，必聲。”', '27.E9CB': '《說文》：“鮁，鱣鮪鮁鮁。从魚，犮聲。”', '27.71D5': '《說文》：“燕，玄鳥也。籋口，布翄，枝尾，象形。”', '27.9F8D': '《說文》：“龍，鱗蟲之長。能幽能明，能細能巨，能短能長，春分而登天，秋分而潛淵。从肉，飛之形，童省聲。”', '27.81FB': '《說文》：“臻，至也。从至，秦聲。”', '27.E9D6': '《說文》：“𦥊，忿戾也。从至，至而復遜。遜，遁也。《周書》曰：‘有夏氏之民叨𦥊。’𦥊，讀若摯。”', '27.95B6': '《說文》：“閶，天門也。从門，昌聲。楚人名門曰閶闔。”', '27.95BB': '《說文》：“閻，里中門也。从門，臽聲。壛，閻或从土。”', '27.95CD': '《說文》：“闍，闉闍也。从門，者聲。”', '27.95BE': '《說文》：“閾，門榍也。从門，或聲。《論語》曰：‘行不履閾。’ 𨵨，古文閾从洫。”', '27.E9E3': '《說文》：“𨵌，門傾也。从門，阿聲。”', '27.95BC': '《說文》：“閼，遮𢹬也。从門，於聲。”', '27.95B9': '《說文》：“閹，豎也。宮中奄閽閉門者。从門，奄聲。”', '27.95BD': '《說文》：“閽，常以昏閉門隸也。从門，从昏，昏亦聲。”', '27.E9EE': '《說文》：“䏁，益梁之州謂聾為䏁；秦晉聽而不聞、聞而不達謂之䏁。从耳，宰聲。”', '27.64BF': '《說文》：“撿，拱也。从手，僉聲。”', '27.64CD': '《說文》：“操，把持也。从手，喿聲。”', '27.64DA': '《說文》：“據，杖持也。从手，豦聲。”', '27.64C7': '《說文》：“擇，柬選也。从手，睪聲。”', '27.64D6': '《說文》：“擖，刮也。从手，葛聲。一曰撻也。”', '27.64C1': '《說文》：“𢹬，抱也。从手，雝聲。”', '27.64C5': '《說文》：“擅，專也。从手，亶聲。”', '27.64D0': '《說文》：“擐，貫也。从手，睘聲。《春秋傳》曰：‘擐甲執兵。’”', '27.64BB': '《說文》：“撻，鄉飲酒，罰不敬，撻其背。从手，達聲。𨘈，古文撻。《周書》曰：‘𨘈以記之。’”', '27.64BD': '《說文》：“𢶡，旁擊也。从手，敫聲。”', '27.5B34': '《說文》：“嬴，少昊氏之姓。从女，羸省聲。”', '27.5B1B': '《說文》：“𡣱，材緊也。从女，瞏聲。《春秋傳》曰：‘ 𡣱𡣱在疚。’”', '27.5B10': '《說文》：“嬐，敏疾也。一曰莊敬皃。从女，僉聲。”', '27.5B17': '《說文》：“嬗，緩也。从女，亶聲。一曰傳也。”', '27.EA5D': '《說文》：“䆯，短面也。从女，窡聲。”', '27.5B16': '《說文》：“嬖，便嬖，愛也。从女，辟聲。”', '27.EA5E': '《說文》：“𡢖，難也。从女，𣪠聲。”', '27.EA77': '《說文》：“𡢕，惡也。一曰人皃。从女，毀聲。”', '27.EA79': '《說文》：“嬒，女黑色也。从女，會聲。《詩》曰：‘嬒兮蔚兮。’”', '27.5B19': '《說文新附》：“嬙，婦官也。从女，牆省聲。”', '27.6230': '《說文》：“戰，鬭也。从戈，單聲。”', '27.5334': '《說文》：“匴，渌米籔也。从匚，算聲。”', '27.7580': '《說文》：“疀，𣂁也，古田器也。从甾，疌聲。”', '27.EA96': '《說文》：“𤳊，㠷也。从甾，幷聲。杜林以為竹筥，揚雄以為蒲器。讀若軿。”', '27.750D': '《說文》：“甍，屋棟也。从瓦，夢省聲。”', '27.750C': '《說文》：“甌，小盆也。从瓦，區聲。”', '27.EA9D': '《說文》：“㼽，瑳垢瓦石。从瓦，爽聲。”', '27.5F4A': '《說文》：“彊，弓有力也。从弓，畺聲。”', '27.7E12': '《說文》：“縒，參縒也。从糸，差聲。”', '27.7E0E': '《說文》：“縎，結也。从糸，骨聲。”', '27.7E1B': '《說文》：“縛，束也。从糸，尃聲。”', '27.7E20': '《說文》：“縠，細縳也。从糸，𣪊聲。”', '27.7E11': '《說文》：“縑，并絲繒也。从糸，兼聲。”', '27.7E1E': '《說文》：“縞，鮮色也。从糸，高聲。”', '27.7E09': '《說文》：“縉，帛赤色也。《春秋傳》‘縉雲氏’。《禮》有‘縉緣’。从糸，晉聲。”', '27.7E13': '《說文》：“縓，帛赤黃色。一染謂之縓，再染謂之䞓，三染謂之纁。从糸，原聲。”', '27.EACD': '《說文》：“𦃖，帛騅色也。从糸，剡聲。《詩》曰：‘毳衣如𦃖。’”', '27.7E1F': '《說文》：“縟，繁采色也。从糸，辱聲。”', '27.7E0C': '《說文》：“縌，綬維也。从糸，逆聲。”', '27.EAD0': '《說文》：“𦃙，頸連也。从糸，暴省聲。”', '27.7E1C': '《說文》：“縜，持綱紐也。从糸，員聲。《周禮》曰：‘縜寸。’”', '27.7E08': '《說文》：“縈，收韏也。从糸，熒省聲。”', '27.7E0B': '《說文》：“縋，以繩有所縣也。《春秋傳》曰：‘夜縋納師。’从糸，追聲。”', '27.7E22': '《說文》：“縢，緘也。从糸，朕聲。”', '27.EAEF': '《說文》：“𦃇，繫𦃇也。一曰維也。从糸，虒聲。”', '27.7E10': '《說文》：“縐，絺之細也。《詩》曰：‘蒙彼縐絺。’一曰蹴也。从糸，芻聲。”', '27.7E17': '《說文》：“縗，服衣。長六寸，博四寸，直心。从糸，衰聲。”', '27.7E0A': '《說文》：“縊，經也。从糸，益聲。《春秋傳》曰：‘夷姜縊。’”', '27.7E21': '《說文新附》：“縡，事也。从糸，宰聲。”', '27.87A3': '《說文》：“螣，神蛇也。从虫，朕聲。”', '27.8789': '《說文》：“螉，蟲在牛馬皮者。从虫，翁聲。”', '27.879D': '《說文》：“螝，蛹也。从虫，鬼聲。讀若潰。”', '27.879F': '《說文》：“螟，蟲食穀葉者。吏冥冥犯法即生螟。从虫，从冥。冥亦聲。”', '27.EB07': '《說文》：“螕，齧牛蟲也。从虫，𣬉聲。”', '27.8798': '《說文》：“螘，蚍蜉也。从虫，豈聲。”', '27.EB10': '《說文》：“螌，螌蝥，毒蟲也。从虫，般聲。”', '27.8787': '《說文》：“螇，螇鹿，蛁蟟也。从虫，奚聲。”', '27.EB14': '《說文》：“𧎾，螶𧎾也。一曰蜉游，朝生莫死者。从虫，𡭴聲。”', '27.EB18': '《說文》：“𧎥，蠅醜𧎥，搖翼也。从虫，扇聲。”', '27.EB1B': '《說文》：“螊，海蟲也。長寸而白，可食。从虫，兼聲。讀若嗛。”', '27.8839': '《說文》：“蠹，木中蟲，从䖵，橐聲。螙，蠹或从木，象蟲在水中形，譚長說。”', '27.EB42': '《說文》：“䬆，風雨暴疾也。从風，利聲。”', '27.6BC8': '《說文》：“毈，卵不孚也。从卵，段聲。”', '27.58BD': '《說文》：“墽，磽也。从土，敫聲。”', '27.58C1': '《說文》：“壁，垣也。从土，辟聲。”', '27.58BC': '《說文》：“墼，瓴適也；一曰未燒也。从土，毄聲。”', '27.EB62': '《說文》：“堞，城上女垣也。”', '27.58C7': '《說文》：“壇，祭場也。从土，亶聲。”', '27.EB7B': '《說文》：“𡒈，兔堀也。”', '27.58BE': '《說文新附》：“墾，耕也。从土，豤聲。”', '27.EB83': '《說文》：“疁，燒穜也。《漢律》曰：‘疁田茠艸。’从田，翏聲。”', '27.EB95': '《說文》：“勶，發也。从力，从徹，徹亦聲。”', '27.8FA6': '《說文新附》：“辦，致力也。从力，辡聲。”', '27.932B': '《說文》：“錫，銀鉛之間也。从金，易聲。”', '27.92FB': '《說文》：“鋻，刚也。从金，臤聲。”', '27.9304': '《說文》：“錄，金色也。从金，彔聲。”', '27.932E': '《說文》：“錮，鑄塞也。从金，固聲。”', '27.932A': '《說文》：“錪，朝鮮謂釜曰錪。从金，典聲。”', '27.9320': '《說文》：“錠，鐙也。从金，定聲。”', '27.932F': '《說文》：“錯，金涂也。从金，昔聲。”', '27.9321': '《說文》：“錡，鉏䥏也。从金，奇聲。江淮之間謂釜曰錡。”', '27.930D': '《說文》：“錍，鈭錍也。从金，卑聲。”', '27.9322': '《說文》：“錢，銚也，古田器。从金，戔聲。《詩》曰：‘庤乃錢鎛。’”', '27.92F8': '《說文》：“鋸，槍唐也。从金，居聲。”', '27.9310': '《說文》：“錐，銳也。从金，隹聲。”', '27.9319': '《說文》：“錙，六銖也。从金，甾聲。”', '27.931A': '《說文》：“錚，金聲也。从金，爭聲。”', '27.92CB': '《說文》：“鋋，小矛也。从金，延聲。”', '27.931F': '《說文》：“錟，長矛也。从金，炎聲。讀若老耼。”', '27.931E': '《說文》：“錞，矛𢧢柲下銅鐏也。从金，𦎧聲。《詩》曰：‘叴矛沃𨯢。’”', '27.930F': '《說文》：“錏，錏鍜，頸鎧也。从金，亞聲。”', '27.9314': '《說文》：“錔，以金有所冒也。从金，沓聲。”', '27.9309': '《說文》：“錉，業也，賈人占錉。从金，昏聲。”', '27.932D': '《說文》：“錭，鈍也。从金，周聲。”', '27.EBC1': '《說文》：“錗，側意。从金，委聲。”', '27.8F36': '《說文》：“輶，輕車也。从車，酋聲。《詩》曰：‘輶車鑾鑣’。”', '27.8F2F': '《說文》：“輯，車和輯也。从車，咠聲。”', '27.8F39': '《說文》：“輹，車軸縛也。从車，复聲。《易》曰：‘輿脫輹’。”', '27.8F2E': '《說文》：“輮，車軔也。从車，柔聲。”', '27.8F3B': '《說文》：“輻，輪轑也。从車，畐聲。”', '27.EBE5': '《說文》：“䡣，軶軥也。从車，軍聲。”', '27.8F38': '《說文》：“輸，委輸也。从車，俞聲。”', '27.96AA': '《說文》：“險，阻難也。从𨸏，僉聲。”', '27.96A9': '《說文》：“隩，水隈崖也。从𨸏，奧聲。”', '27.EC03': '《說文》：“𨼬，水衡官谷也。从𨸏，解聲。一曰小谿。”', '27.F3B3': '《說文》：“𨺅，兩𨸏之間也。从二𨸏。”', '27.EC15': '《說文》：“𨽵，塞上亭守㷭者也。从𨺅，从火，遂聲。𤎩，篆文省。”', '27.F0A3': '《說文》：“辥，辠也。从辛，𡴎聲。”', '27.EC2E': '《說文》：“䤁，孰𥶶也。从酉，甚聲。”', '27.EC45': '《說文》：“𨡭，𨡭䤅，榆𤖕也。从酉，敄聲。”', '27.EC46': '《說文》：“䤅，𨡭䤅也。从酉，俞聲。”', '27.9190': '《說文新附》：“醐，醍醐，酪之精者。从酉，胡聲。”', '27.9192': '《說文新附》：“醒，醉解也。从酉，星聲。”', '27.918D': '《說文新附》：“醍，清酒也。从酉，是聲。”', '27.79A7': '《說文》：“禧，禮吉也。从示，喜聲。”', '27.E00C': '《說文》：“䄟，數祭也。从示，毳聲。讀若舂麥為䄟之䄟。”', '27.79AA': '《說文》：“禪，祭天也。从示，單聲。”', '27.79AB': '《說文》：“禫，除服祭也。从示，覃聲。”', '27.74A5': '《說文》：“璥，玉也。从玉，敬聲。”', '27.E019': '《說文》：“𤩮，玉也。从玉，毄聲。讀若鬲。”', '27.7490': '《說文》：“璐，玉也。从玉，路聲。”', '27.74B0': '《說文》：“環，璧也。肉好若一謂之環。从玉，睘聲。”', '27.E020': '《說文》：“璬，玉佩。从玉，敫聲。”', '27.74AA': '《說文》：“璪，玉飾如水藻之文。从玉，喿聲。《虞書》曰：‘璪火黺米。’”', '27.74B1': '《說文》：“璱，玉英華相帶如瑟弦。从玉，瑟聲。《詩》曰：‘瑟彼玉瓚。’”', '27.E032': '《說文》：“𤩭，石之似玉者。从玉，號聲。讀若鎬。”', '27.7497': '《說文》：“璗，金之美者，與玉同色。从玉，湯聲。《禮》：‘佩刀，諸侯璗琫而璆珌。’”', '27.74A9': '《說文新附》：“璩，環屬。从玉，豦聲。見《山海經》。”', '27.74AB': '《說文新附》：“璫，華飾也。从玉，當聲。”', '27.74A8': '《說文新附》：“璨，玉光也。从玉，粲聲。”', '27.E053': '《說文》：“𦼫，菜也，似蘇者。从艸，豦聲。”', '27.E05D': '《說文》：“𦼰，芞輿也。从艸，楬聲。”', '27.858A': '《說文》：“薊，芺也。从艸，魝聲。”', '27.E062': '《說文》：“薓，人薓。藥艸，出上黨。从艸，𣹰聲。”', '27.859B': '《說文》：“𧀼，艸也。从艸，辥聲。”', '27.8581': '《說文》：“薁，嬰薁也。从艸，奧聲。”', '27.857C': '《說文》：“𧀳，赤𧀳也。从艸、𨽸。”', '27.859C': '《說文》：“薜，牡贊也。从艸，辟聲。”', '27.859F': '《說文》：“薟，白薟也。从艸，僉聲。蘞，薟或从斂。”', '27.85A2': '《說文》：“薢，薢茩也。从艸，解聲。”', '27.858D': '《說文》：“薍，𦵹也。从艸，亂聲。八月薍為葦也。”', '27.8595': '《說文》：“薕，蒹也。从艸，廉聲。”', '27.85A0': '《說文》：“薠，青薠，似莎者，从艸，煩聲。”', '27.8596': '《說文》：“薖，艸也。从艸，過聲。”', '27.858B': '《說文》：“薋，艸多皃。从艸，資聲。”', '27.8588': '《說文》：“薈，艸多皃。从艸，會聲。《詩》曰：‘薈兮蔚兮。’”', '27.8589': '《說文》：“薉，蕪也。从艸，歲聲。”', '27.8580': '《說文》：“薀，積也。从艸，溫聲。《春秋傳》‘薀利生孽。’”', '27.8584': '《說文》：“薄，林薄也。一曰蠶薄。从艸，溥聲。”', '27.8599': '《說文》：“薙，除艸也。《明堂月令》曰：‘季夏燒薙。’从艸，雉聲。”', '27.85AA': '《說文》：“薪，蕘也。从艸，新聲。”', '27.8594': '《說文》：“薔，薔虞，蓼。从艸，嗇聲。”', '27.E0C6': '《說文》：“𦼪，艸也。从艸，楙聲。”', '27.8629': '《說文》：“𦾴，白蒿也。从艸，繁聲。”', '27.E0DA': '《說文》：“㹔，牛長脊也。从牛，畺聲。”', '27.E0E7': '《說文》：“㘈，小兒有知也。从口，疑聲。《詩》曰：‘克岐克㘈。’”', '27.568C': '《說文》：“嚌，嘗也。从口，齊聲。《周書》曰：‘大保受同祭嚌。’”', '27.568F': '《說文》：“嚏，悟解气也。从口，疐聲。《詩》曰：‘願言則嚏。’”', '27.8DA8': '《說文》：“趨，走也。从走，芻聲。”', '27.E121': '《說文》：“𧽋，走輕也。从走，烏聲。讀若鄔。”', '27.E123': '《說文》：“䞿，走皃。从走，䞿省聲。”', '27.E129': '《說文》：“𧽒，行也。从走，臭聲。”', '27.E139': '《說文》：“𧽐，蹇行𧽐𧽐也。从走，虔聲。讀若愆。”', '27.E13F': '《說文》：“䞾，䞾騭，輕薄也。从走，虒聲。讀若池。”', '27.E144': '《說文》：“𧽍，走頓也。从走，真聲。讀若顛。”', '27.E14C': '《說文》：“𣦢，人不能行也。从止，辟聲。”', '27.9081': '《說文》：“邁，遠行也。从辵，蠆省聲。𨙚，邁或不省。”', '27.9084': '《說文》：“還，復也。从辵，睘聲。”', '27.907F': '《說文》：“避，回也。从辵，辟聲。”', '27.E17E': '《說文》：“䢭，遮䢭也。从辵，羨聲。”', '27.907D': '《說文》：“遽，傳也。一曰窘也。从辵，豦聲。”', '27.9082': '《說文新附》：“邂，邂逅，不期而遇也。从辵，解聲。”', '27.E190': '《說文》：“𢕬，行皃。从彳，歰聲。一曰此與馺同。”', '27.E192': '《說文》：“𢖊，使也。从彳，䛣聲。”', '27.E1A0': '《說文》：“𧗿，將衞也。从行，率聲。”', '27.9F54': '《說文》：“齔，毁齒也。男八月生齒，八歲而齔；女七月生齒，七歲而齔。从齒，从匕。”', '27.E1BB': '《說文》：“蹏，足也。从足，虒聲。”', '27.8E4C': '《說文》：“蹌，動也。从足，倉聲。”', '27.8E4B': '《說文》：“蹋，踐也。从足，𦐇聲。”', '27.8E48': '《說文》：“蹈，踐也。从足，舀聲。”', '27.E1C5': '《說文》：“𨃚，趿也。从足，荅聲。”', '27.E1C6': '《說文》：“䠛，跳也。从足，䍃聲。”', '27.8E4E': '《說文》：“蹎，跋也。从足，真聲。”', '27.8E50': '《說文》：“蹐，小步也。从足，𦟝聲。《詩》曰：‘不敢不蹐。’”', '27.E1C8': '《說文》：“𨃖，踞也。从足，荂聲。”', '27.8E47': '《說文》：“蹇，跛也。从足，寒省聲。”', '27.8E49': '《說文新附》：“蹉，蹉跎，失時也。从足，差聲。”', '27.9FA0': '《說文》：“龠，樂之竹管，三孔，以和衆聲也。从品、龠。侖，理也。”', '27.8B1C': '《說文》：“謜，徐語也。从言，原聲。《孟子》曰：‘故謜謜而來。’”', '27.8B18': '《說文》：“謘，語諄謘也。从言，屖聲。”', '27.8B10': '《說文》：“謐，靜語也。从言，𥁑聲。一曰無聲也。”', '27.8B19': '《說文》：“謙，敬也。从言，兼聲。”', '27.8B1D': '《說文》：“謝，辤去也。从言，䠶聲。”', '27.8B1B': '《說文》：“講，和解也。从言，冓聲。”', '27.8B04': '《說文》：“謄，迻書也。从言，朕聲。”', '27.8B0D': '《說文》：“謍，小聲也。从言，熒省聲。《詩》曰：‘謍謍青蠅。’”', '27.8B23': '《說文》：“謣，妄言也。从言，雩聲。𧪮，謣或从荂。”', '27.8B08': '《說文》：“謈，大呼自勉也。从言，暴省聲。”', '27.E0FA': '《說文》：“𧪰，咨也。一曰痛惜也。从言，差聲。”', '27.8B13': '《說文》：“謓，恚也。从言，真聲。賈侍中說：謓笑。一曰讀若振。”', '27.E228': '《說文》：“𧬊，悲聲也。从言，斯省聲。”', '27.8B11': '《說文》：“謑，恥心。从言，奚聲。䜁，謑或从奊。”', '27.8B1A': '《說文》：“謚，笑皃。从言，益聲。”', '27.8B0E': '《說文新附》：“謎，隱語也。从言、迷，迷亦聲。”', '27.6234': '《說文》：“戴，分物得增益曰戴。从異，𢦒聲。”', '27.7228': '《說文》：“爨，齊謂之炊爨。𦥑，象持甑；冂，為竈門口；廾，推林內火。𤏷，籀文，爨省。”', '27.97A0': '《說文》：“鞠，踏鞠也。从革，匊聲。𩍸，鞠或从䉅。”', '27.E24F': '《說文》：“𩌑，量物之𩌑。一曰抒井𩌑。古以革。从革，冤聲。䩩，𩌑或从宛。”', '27.979E': '《說文》：“鞞，刀室也。从革，卑聲。”', '27.E258': '《說文》：“䩪，車鞁具也。从革，官聲。”', '27.E25C': '《說文》：“𩋊，車具也。从革，奄聲。”', '27.E25D': '《說文》：“𩋁，車具也。从革，叕聲。”', '27.71EE': '《說文》：“燮，和也。从言，从又、炎。籀文𤎬从𢆉。”', '27.E2A0': '《說文》：“𨽿，及也。从隶，枲聲。《詩》曰：‘𨽿天之未陰雨。’”', '27.96B8': '《說文》：“隸，附箸也。从隶，柰聲。𨾀，篆文隸从古文之體。”', '27.6582': '《說文》：“斂，收也。从攴，僉聲。”', '27.6581': '《說文》：“斁，解也。从攴，睪聲。《詩》云：‘服之無斁。’斁，猒也。一曰終也。”', '27.6580': '《說文》：“斀，去陰之刑也。从攴，蜀聲。”', '27.95C5': '《說文》：“闅，低目視也。从𥄎，門聲。弘農湖縣有闅鄉。汝南西平有闅亭。”', '27.E2E1': '《說文》：“瞦，目童子精也。从目，喜聲。讀若禧。”', '27.77B5': '《說文》：“瞵，目精也。从目，粦聲。”', '27.77B4': '《說文》：“瞴，瞴婁，微視也。从目，無聲。”', '27.E2F7': '《說文》：“瞤，目動也。从目，閏聲。”', '27.E2F9': '《說文》：“䁲，小視也。从目，買聲。”', '27.77AB': '《說文》：“瞫，深視也。一曰下視也。又竊見也。从目，覃聲。”', '27.77B7': '《說文》：“瞯，戴目也。从目，閒聲。江淮之間謂眄曰瞯。”', '27.9F3E': '《說文》：“鼾，臥息也。从鼻，干聲。讀若汗。”', '27.7FF3': '《說文》：“翳，華蓋也。从羽，殹聲。”', '27.E31F': '《說文》：“𨿠，𨾦也。从隹，垂聲。”', '27.820A': '《說文》：“舊，𨾦舊，舊留也。从萑，臼聲。鵂，舊或从鳥，休聲。”', '27.E334': '《說文》：“𦎷，羊名。从羊，執聲。汝南平輿有𦎷亭，讀若晉。”', '27.E336': '《說文》：“𦎸，䍴𦎸也。从羊，責聲。”', '27.9D43': '《說文》：“鵃，鶻鵃也。从鳥，舟聲。”', '27.9D3F': '《說文》：“鴿，鳩屬。从鳥，合聲。”', '27.9DAA': '《說文》：“鶪，伯勞也。从鳥，狊聲。𩀎，鶪或从隹。”', '27.E34D': '《說文》：“鴲，瞑鴲也。从鳥，旨聲。”', '27.9D45': '《說文》：“鵅，烏鸔也。从鳥，各聲。”', '27.9D3B': '《說文》：“鴻，鴻鵠也。从鳥，江聲。”', '27.E34E': '《說文》：“𪀖，禿𪀖也。从鳥，尗聲。鶖，𪀖或从秋。”', '27.E359': '《說文》：“鴺，鴺胡，污澤也。从鳥，夷聲。鵜，鴺或从弟。”', '27.9D30': '《說文》：“鴰，麋鴰也。从鳥，𠯑聲。”', '27.9D41': '《說文》：“𪁉，𪁉𪂴也。从鳥，交聲。一曰𪁉𪈒也。”', '27.E35C': '《說文》：“鴜，𪇳鴜也。从鳥，此聲。”', '27.E35D': '《說文》：“𪀝，鷙鳥也。从鳥，屰聲。”', '27.9D33': '《說文》：“鴳，雇也。从鳥，安聲。”', '27.E367': '《說文新附》：“𪀦，谿𪀦，水鳥。从鳥，式聲。”', '27.7CDE': '《說文》：“糞，棄除也。从廾推𠦒糞采也。官溥說：似米而非米者，矢字。”', '27.E37D': '《說文》：“殬，敗也。从歺，睪聲。《商書》曰：‘彝倫攸殬。’”', '27.85A8': '《說文》：“薨，公矦𣨛也。从死，瞢省聲。”', '27.85A7': '《說文》：“薧，死人里也。从𣦸，蒿省聲。”', '27.9ABE': '《說文》：“骾，食骨留咽中也。从骨，更聲。”', '27.81BD': '《說文》：“膽，連肝之府。从肉，詹聲。”', '27.81BA': '《說文》：“膺，胷也。从肉，𤸰聲。”', '27.81C2': '《說文》：“臂，手上也。从肉，辟聲。”', '27.81BB': '《說文》：“膻，肉膻也。从肉，亶聲。《詩》曰：‘膻裼暴虎。’”', '27.81CA': '《說文》：“臊，豕膏臭也。从肉，喿聲。”', '27.81BE': '《說文》：“膾，細切肉也。从肉，會聲。”', '27.E3D6': '《說文》：“䚦，角傾也。从角，虒聲。”', '27.89F2': '《說文》：“觲，用角低仰便也，从羊、牛、角。《詩》曰：‘觲觲角弓。’”', '27.89F3': '《說文》：“觳，盛觵巵也。一曰射具。从角，𣪊聲。讀若斛。”', '27.7BF8': '《說文》：“篸，差也。从竹，參聲。”', '27.E3EE': '《說文》：“䉃，剖竹未去節謂之䉃。从竹，將聲。”', '27.7BF0': '《說文》：“篰，㒼爰也。从竹，部聲。”', '27.7C00': '《說文》：“簀，牀棧也。从竹，責聲。”', '27.7C01': '《說文》：“簁，簁箄，竹器也。从竹，徙聲。”', '27.7BFF': '《說文》：“篿，圜竹器也。从竹，專聲。”', '27.7C0D': '《說文》：“簍，竹籠也。从竹，婁聲。”', '27.7C69': '《說文》：“籩，竹豆也。从竹，邊聲。”', '27.E40A': '《說文》：“篼，飲馬器也。从竹，兜聲。”', '27.7BF3': '《說文》：“篳，藩落也。从竹，畢聲。《春秋傳》曰：‘篳門圭窬。’”', '27.7C03': '《說文新附》：“簃，閣邊小屋也。从竹，移聲。《說文》通用誃。”', '27.8667': '《說文》：“虧，气損也。从亏，雐聲。𧇾，虧或从兮。”', '27.8668': '《說文》：“虨，虎文彪也。从虍，彬聲。”', '27.E452': '《說文》：“盨，㯯盨，負戴器也。从皿，須聲。”', '27.76EA': '《說文》：“盪，滌器也。从皿，湯聲。”', '27.E459': '《說文》：“𧗕，腫血也。从血，䢉省聲。膿，俗𧗕。从肉，農聲。”', '27.9931': '《說文》：“𩝍，乾食也。从食，矦聲。《周書》曰：‘峙乃𩝍粻。’”', '27.9925': '《說文》：“餥，𩝍也。从食，非聲。陳、楚之間相謁食麥飯日餥。”', '27.9941': '《說文》：“饁，餉田也。从食，盍聲。《詩》曰：‘饁彼南畝。’”', '27.992C': '《說文》：“餬，寄食也。从食，胡聲。”', '27.992B': '《說文》：“餫，野饋曰餫。从食，軍聲。”', '27.9932': '《說文》：“餲，飯餲也。从食，曷聲。《論語》曰：‘食饐而餲。’”', '27.7F45': '《說文》：“罅，裂也。从缶，虖聲。缶燒善裂也。”', '27.7F44': '《說文》：“罄，器中空也。从缶，殸聲。殸，古文磬字。《詩》云：‘缾之罄矣。’”', '27.77EF': '《說文》：“矯，揉箭箝也。从矢，喬聲。”', '27.77F0': '《說文》：“矰，隿䠶矢也。从矢，曾聲。”', '27.7246': '《說文》：“牆，垣蔽也。从嗇，爿聲。𤖣，籀文从二禾；𤖧，籀文亦从二來。”', '27.97D4': '《說文》：“韔，弓衣也。从韋，長聲。《詩》曰：‘交韔二弓。’”', '27.97D3': '《說文》：“𩏑，井垣也。从韋，取其帀也，倝聲。”', '27.F09E': '《說文》：“𥊽，周人謂兄曰𥊽。从弟，从眔。”', '27.E4CF': '《說文》：“𣛹，木也。从木，遄聲。”', '27.6A8D': '《說文》：“檍，杶也。从木，意聲。”', '27.6A9F': '《說文》：“檟，楸也。从木，賈聲。《春秋傳》曰：‘樹六檟於蒲圃。’”', '27.E4D7': '《說文》：“檆，木也。”', '27.6A7F': '《說文》：“橿，枋也。从木，畺聲。一曰鉏柄名。”', '27.6A97': '《說文》：“檗，黃木也。从木，辟聲。”', '27.6A89': '《說文》：“檉，河柳也。从木，聖聲。”', '27.6A80': '《說文》：“檀，木也。从木，亶聲。”', '27.E4E9': '《說文》：“𣛺，木，可為杖。从木，厀聲。”', '27.6A9C': '《說文》：“檜，柏葉松身。从木，會聲。”', '27.6AA5': '《說文》：“檥，榦也。从木，義聲。”', '27.6A90': '《說文》：“檐，㮰也。从木，詹聲。”', '27.6ADB': '《說文》：“櫛，梳比之總名也。从木，節聲。”', '27.E513': '《說文》：“檈，圜案也。从木，瞏聲。”', '27.6A95': '《說文》：“檕，繘耑木也。从木，𣪠聲。”', '27.6AA0': '《說文》：“㯳，榜也，从木敬聲。”', '27.6A83': '《說文》：“檃，栝也。从木，隱省聲。”', '27.6AA2': '《說文》：“檢，書署也。从木，僉聲。”', '27.6A84': '《說文》：“檄，二尺書。从木，敫聲。”', '27.6A7E': '《說文》：“橾，車轂中空也。从木，喿聲。讀若藪。”', '27.6A87': '《說文》：“檇，以木有所擣也。从木，雋聲。《春秋傳》曰：‘越敗吳於檇李。’”', '27.E539': '《說文》：“皣，艸木白華也。从華，从白。”', '27.E53C': '《說文》：“𥢔，特止也。从稽省，卓聲。”', '27.E53D': '《說文》：“𥢑，𥢑䅓而止也。从稽省，咎聲，讀若皓。賈侍中說：稽、𥢔、𥢑，三字皆木名。”', '27.F11A': '《說文》：“㯱，囊張大皃。从㯻省，匋省聲。”', '27.8CF8': '《說文》：“賸，物相增加也。从貝，朕聲。一曰送也，副也。”', '27.8CFC': '《說文》：“購，以財有所求也。从貝，冓聲。”', '27.8CFD': '《說文新附》：“賽，報也。从貝，塞省聲。”', '27.8CFB': '《說文新附》：“賻，助也。从貝，尃聲。”', '27.E570': '《說文》：“𨞪，蜀江原地。从邑，壽聲。”', '27.E571': '《說文》：“䣢，蜀地也。从邑，耤聲。”', '27.66D9': '《說文新附》：“曙，曉也。从日，署聲。”', '27.65DA': '《說文》：“𣄪，旌旗旚繇也。从㫃，𤐫聲。”', '27.E5B3': '《說文》：“㦽，有文章也。从有，𡿿聲。”', '27.7A5C': '《說文》：“穜，埶也。从禾，童聲。”', '27.7A5F': '《說文》：“穟，禾𥝩之皃。从禾，遂聲。《詩》曰：‘禾穎穟穟。’𦼯，穟或从艸。”', '27.7A56': '《說文》：“穖，禾穖也。从禾，幾聲。”', '27.9ECF': '《說文》：“黏，相箸也。从黍，占聲。”', '27.7CDC': '《說文》：“糜，糝也。从米，麻聲。”', '27.7CDF': '《說文》：“糟，酒滓也。从米，曹聲。𨣹，籀文从酉。”', '27.E601': '《說文》：“䊝，𥻦也。从米，悉聲。”', '27.E602': '《說文》：“𥻦，䊝𥻦，散之也。从米，殺聲。”', '27.97F1': '《說文》：“韱，山韭也。从韭，㦰聲。”', '27.E621': '《說文》：“𡫛，𦤝𦤝，不見也。一曰，𦤝𦤝，不見省人。从宀，𦤝聲。”', '27.71DF': '《說文》：“營，市居也。从宮，熒省聲。”', '27.E631': '《說文》：“𥨍，地室也。从穴，復聲。《詩》曰：‘陶𥨍陶穴’。”', '27.E637': '《說文》：“䆷，空皃。从穴，矞聲。”', '27.7AC0': '《說文》：“竀，正視也。从穴中正見也。正亦聲。”', '27.7AC1': '《說文》：“竁，穿地也。从穴，毳聲。一曰小鼠聲。《周禮》曰：‘大喪甫竁’。”', '27.5BF1': '《說文》：“寱，瞑言也。从㝱省，臬聲。”', '27.7647': '《說文》：“癇，病也。从疒，閒聲。”', '27.7648': '《說文》：“癈，固病也。从疒，發聲。”', '27.E64A': '《說文》：“𤺊，散聲。从疒，斯聲。”', '27.7649': '《說文》：“癉，勞病也。从疒，單聲。”', '27.E663': '《說文》：“𤻲，治也。从疒，樂聲。療或从尞。”', '27.7646': '《說文》：“癆，朝鮮謂藥毒曰癆。从疒，勞聲。”', '27.E66E': '《說文》：“𦌔，网也。从网，巽聲。”', '27.7F7E': '《說文》：“罾，魚网也。从网，曾聲。”', '27.7F7D': '《說文》：“罽，魚网也。从网，㓹聲。㓹，籀文銳。”', '27.7F7F': '《說文》：“罿，罬也。从网，童聲。”', '27.E683': '《說文》：“𢅡，楚謂無緣衣也。从巾，監聲。”', '27.E69E': '《說文》：“皢，日之白也。从白，堯聲。”', '27.76A4': '《說文》：“皤，老人白也。从白，番聲。《易》曰：‘賁如皤如。’𩕏，皤或从頁。”', '27.9EFB': '《說文》：“黻，黑與青相次文。从黹，犮聲。”', '27.5120': '《說文》：“儠，長壯儠儠也。从人，巤聲。”', '27.5126': '《說文》：“儦，行皃。从人，麃聲。“”', '27.5132': '《說文》：“儲，偫也。从人，諸聲。”', '27.5125': '《說文》：“儥，賣也。从人，賣聲。”', '27.511F': '《說文》：“償，還也。从人，賞聲。”', '27.512A': '《說文》：“優，饒也。从人，憂聲。一曰倡也。”', '27.5121': '《說文》：“儡，相敗也。从人，畾聲。”', '27.81E8': '《說文》：“臨，監臨也。从臥，品聲。”', '27.E6D8': '《說文》：“䭆，楚謂小兒嬾䭆。从臥、食。”', '27.8941': '《說文》：“襁，負兒衣。从衣，強聲。”', '27.8938': '《說文》：“褸，衽也。从衣，婁聲。”', '27.893D': '《說文》：“褽，衽也。从衣，叞聲。”', '27.E6E8': '《說文》：“𧜣，短衣也。从衣，鳥聲。《春秋傳》曰：‘有空𧜣。’”', '27.E6E9': '《說文》：“褺，重衣也。从衣，執聲。巴郡有褺江縣。”', '27.8944': '《說文》：“襄，漢令：解衣耕謂之襄。从衣，𤕦聲。𡣿，古文襄。”', '27.893B': '《說文》：“褻，私服。从衣，埶聲。《詩》曰：‘是褻袢也。’”', '27.E6F1': '《說文》：“褿，帴也。从衣，曹聲。”', '27.E6F3': '《說文》：“䙔，編枲衣。从衣，區聲。一曰頭䙔；一曰㳄裹衣。”', '27.E6F9': '《說文》：“𦽡，年九十曰𦽡。从老，从蒿省。”', '27.6C08': '《說文》：“氈，撚毛也。从毛，亶聲。”', '27.5C68': '《說文》：“屨，履也。从履省，婁聲。一曰鞮也。”', '27.E718': '《說文》：“䚋，外博眾多視也。从見，員聲。讀若運。”', '27.89AD': '《說文》：“小見也。从見，冥聲。《爾雅》曰：‘覭髳，弗離。’”', '27.89AF': '《說文》：“覯，遇見也。从見，冓聲。”', '27.E724': '《說文》：“𧡹，下視深也。从見，𠧴聲。讀若攸。”', '27.89AC': '《說文》：“覬，㰟𡴘也。从見，豈聲。”', '27.6B5C': '《說文》：“歜，盛气怒也。从欠，蜀聲。”', '27.E740': '《說文》：“㱇，悲意。从欠，嗇聲。”', '27.E746': '《說文》：“𣤢，且唾聲。一曰小笑。从欠，𣪠聲。”', '27.9844': '《說文》：“𩔞，頤也。从頁，圅聲。”', '27.E75E': '《說文》：“顀，出頟也。从頁，隹聲。”', '27.E765': '《說文》：“𩓥，面前岳岳也。从頁，岳聲。”', '27.E769': '《說文》：“𩓸，小頭𩓸𩓸也。从頁，枝聲。讀若規。”', '27.9846': '《說文》：“顆，小頭也。从頁，果聲。”', '27.9849': '《說文》：“顉，低頭也。从頁，金聲。《春秋傳》曰：‘迎于門，顉之而已。’”', '27.E774': '《說文》：“𩓞，好皃。从頁，爭聲。《詩》所謂𩓞首。”', '27.9845': '《說文》：“顅，頭鬢少髮也。从頁，肩聲。《周禮》：‘數目顅脰。’”', '27.E775': '《說文》：“𩓽，無髮也。一曰耳門也。从頁，囷聲。”', '27.E777': '《說文》：“䫌，傾首也。从頁，卑聲。”', '27.E77D': '《說文》：“顇，顦顇也。从頁，卒聲。”', '27.E77E': '《說文》：“䫒，繫頭殟也。从頁，昏聲。”', '27.E77F': '《說文》：“䫏，醜也。从頁，其聲。今逐疫有䫏頭。”', '27.E794': '《說文》：“䯽，髮皃。从髟，咅聲。”', '27.E7A4': '《說文》：“鬀，𩮜髮也。从髟，弟聲。大人曰髠；小人曰鬀，盡及身毛曰𩮜。”', '27.9AFD': '《說文》：“髽，喪結。《禮》：女子髽衰，弔則不髽。魯臧武仲與齊戰于狐鮐，魯人迎喪者始髽。从髟，坐聲。”', '27.E7AE': '《說文》：“𨐨，治也。从辟，从井。《周書》曰：‘我之不𨐨。’”', '27.919C': '《說文》：“醜，可惡也。从鬼，酉聲。”', '27.5DB7': '《說文》：“嶷，九嶷山，舜所葬，在零陵營道。从山，疑聲。”', '27.5DB8': '《說文》：“嶸，崝嶸也。从山，榮聲。”', '27.5DBC': '《說文新附》：“嶼，㠀也。从山，與聲。”', '27.5DBA': '《說文新附》：“嶺，山道也。从山，領聲。”', '27.78FF': '《說文》：“磿，石聲也。从石，厤聲。”', '27.78FD': '《說文》：“磽，礊石也。从石，堯聲。”', '27.78FB': '《說文》：“磻，以石箸隿𦅾也。从石，番聲。”', '27.78EF': '《說文新附》：“磯，大石激水也。从石，幾聲。”', '27.8C70': '《說文》：“豰，小豚也。从豕，𣪊聲。”', '27.8C6F': '《說文》：“豯，生三月豚，腹豯豯皃也。从豕，奚聲。”', '27.8C72': '《說文》：“豲，逸也。从豕，原聲。《周書》：‘豲有爪而不敢以撅。’讀若桓。”', '27.99FD': '《說文》：“駽，青驪馬。从馬，肙聲。《詩》曰：‘駜彼乘駽。’”', '27.99F9': '《說文》：“駹，馬面顙皆白也。从馬，尨聲。”', '27.99FF': '《說文》：“駿，馬之良材者。从馬，夋聲。”', '27.E82B': '《說文》：“騀，馬摇頭也。从馬，我聲。”', '27.99F8': '《說文》：“𩤿，馬行疾也。从馬，㑴省聲。《詩》曰：‘載驟𩤿𩤿。’”', '27.E82F': '《說文》：“𩣘，馬步疾。从馬，耴聲。”', '27.9A03': '《說文》：“騃，馬行㐹㐹也。从馬，矣聲。”', '27.9A01': '《說文》：“騁，直馳也。从馬，甹聲。”', '27.99FE': '《說文》：“駾，馬行疾來皃。从馬，兌聲。《詩》曰：‘昆夷駾矣。’”', '27.99FB': '《說文》：“駻，馬突也。从馬，旱聲。”', '27.99FC': '《說文》：“駼，騊駼也。从馬，余聲。”', '27.85A6': '《說文》：“薦，獸之所食艸。从廌，从艸。古者神人以廌遺黃帝，帝曰：‘何食？何處？’曰：‘食薦；夏處水澤，冬處松柏。’”', '27.9E89': '《說文》：“麉，鹿之絕有力者。从鹿，幵聲。”', '27.9E8B': '《說文》：“麋，鹿屬。从鹿，米聲。麋，冬至解其角。”', '27.E845': '《說文》：“𪊧，鹿屬。从鹿，圭聲。”', '27.6BDA': '《說文》：“毚，狡兔也，兔之駿者。从㲋、兔。”', '27.7373': '《說文》：“獳，怒犬皃。从犬，需聲。讀若槈。”', '27.7372': '《說文》：“獲，獵所獲也。从犬，蒦聲。”', '27.9F28': '《說文》：“鼨，豹文鼠也。从鼠，冬聲。𪔻，籀文省。”', '27.E870': '《說文》：“𪕶，鼠屬。从鼠，益聲。貖，或从豸。”', '27.E872': '《說文》：“䶃，鼠屬。从鼠，今聲。讀若含。”', '27.71EC': '《說文》：“燬，火也。从火，毀聲。”', '27.71ED': '《說文》：“燭，庭燎，火燭也。从火，蜀聲。”', '27.71E0': '《說文》：“燠，熱在中也。从火，奧聲。”', '27.71E5': '《說文》：“燥，乾也。从火，喿聲。”', '27.71E6': '《說文新附》：“燦，燦爤，明瀞皃。从火，粲聲。”', '27.E89B': '《說文》：“𤏻，大熱也。”', '27.E89E': '《說文》：“䵣，白而有黑也。从黑，旦聲。五原有莫䵣縣。”', '27.9EDD': '《說文》：“黝，微青黑色。从黑，幼聲。《爾雅》曰：‘地謂之黝。’”', '27.9EDE': '《說文》：“點，小黑也。从黑，占聲。”', '27.9EDA': '《說文》：“黚，淺黃黑也。从黑，甘聲。讀若‘染繒中束緅黚’。”', '27.9EDC': '《說文》：“黜，貶下也。从黑，出聲。”', '27.E8B0': '《說文》：“𧹲，日出之赤。从赤，穀省聲。”', '27.F0B6': '《說文》：“𧹳，赤色也。从赤，倝聲。讀若浣。”', '27.76E9': '《說文》：“盩，引擊也。从㚔、攴，見血也。扶風有盩厔縣。”', '27.F060': '《說文》：“曓，疾有所趣也。从日出𠦍廾之。”', '27.81E9': '《說文》：“臩，驚走也。一曰往來也。从夰、臦。《周書》曰：‘伯臩’。古文臦古文囧字。”', '27.E8DB': '《說文》：“竲，北地高樓無屋者。从立，曾聲。”', '27.61C9': '《說文》：“應，當也。从心，𨿳聲。”', '27.61BC': '《說文》：“憼，敬也。从心，从敬，敬亦聲。”', '27.E8F2': '《說文》：“𥲅，𥲅箸也。从心，聲。”', '27.61E6': '《說文》：“懦，駑弱者也。从心，需聲。”', '27.E904': '《說文》：“懝，騃也。从心，从疑，疑亦聲。一曰惶也。”', '27.E90D': '《說文》：“懜，不明也。从心，夢聲。”', '27.E92A': '《說文》：“𢢞，𢞎也。从心，𣪠聲。”', '27.61C7': '《說文》：“𢡆，悃也。从心，豤聲。”', '27.E932': '《說文》：“㵺，水。在丹陽。从水，箄聲。”', '27.6FE6': '《說文》：“濦，水。出潁川陽城少室山，東入潁。从水，㥯聲。”', '27.6FEE': '《說文》：“濮，水。出東郡濮陽，南入鉅野。从水，僕聲。”', '27.6FD5': '《說文》：“濕，水。出東郡東武陽，入海。从水，㬎聲。桑欽云：出平原高唐。”', '27.6FF0': '《說文》：“濰，水。出琅邪箕屋山，東入海；徐州浸。《夏書》曰：‘濰，淄其道。’从水，維聲。”', '27.6FDF': '《說文》：“濟，水。出常山房子贊皇山，東入泜。从水，齊聲。”', '27.6FE1': '《說文》：“濡，水。出涿郡故安，東入漆涑。从水，需聲。”', '27.E943': '《說文》：“濥，水脈行地中濥濥也。从水，夤聲。”', '27.6FDE': '《說文》：“濞，水暴至聲。从水，鼻聲。”', '27.6FEB': '《說文》：“濫，氾也。从水，監聲。一曰濡上及下也。《詩》曰：‘𧥑沸濫泉。’一曰清也。”', '27.6FD4': '《說文》：“濔，滿也。从水，爾聲。”', '27.6FE2': '《說文》：“濢，小溼也。从水，翠聲。”', '27.6FD8': '《說文》：“濘，滎濘也。从水，寧聲。”', '27.6FA9': '《說文》：“澩，夏有水，冬無水曰澩。从水，學省聲。讀若學。㶅，澩或不省。”', '27.6FE9': '《說文》：“濩，雨流霤下。从水，蒦聲。”', '27.6FDB': '《說文》：“濛，微雨也。从水，蒙聲。”', '27.E968': '《說文》：“𤀤，飲歃也。一曰吮也。从水，算聲。”', '27.6FEF': '《說文》：“濯，𤃬也。从水，翟聲。”', '27.6FE4': '《說文新附》：“濤，大波也。从水，壽聲。”', '27.8C3F': '《說文》：“谿，山瀆無所通者。从谷，奚聲。”', '27.8C41': '《說文》：“𧯆，通谷也。从谷，害聲。”', '27.971D': '《說文》：“霝，雨零也。从雨，𠱠象𩂣形。《詩》曰：‘霝雨其濛。’”', '27.E995': '《說文》：“䨞，雨皃，方語也。从雨，禹聲。讀若禹。”', '27.E997': '《說文》：“𩃵，濡也。从雨，染聲。”', '27.971C': '《說文》：“霜，喪也，成物者。从雨，相聲。”', '27.971E': '《說文新附》：“霞，赤雲气也。从雨，叚聲。”', '27.9B9E': '《說文》：“鮞，魚子也。一日魚之美者，東海之鮞。从魚，而聲。讀若而。”', '27.9BAA': '《說文》：“鮪，鮥也。《周禮》：春獻王鮪，从魚，有聲。”', '27.E9A4': '《說文》：“𩶡，䱎𩶡也。从魚，巟聲。”', '27.9BA5': '《說文》：“鮥，叔鮪也。从魚，各聲。”', '27.9BA6': '《說文》：“鮦，魚名。从魚，同聲。一曰𩽵也。讀若絝襱。”', '27.9B86': '《說文》：“鮆，飲而不食，刀魚也，九江有之。从魚，此聲。”', '27.9BAE': '《說文》：“鮮，魚名，出貉國。从魚，羴省聲。”', '27.9BAB': '《說文》：“鮫，海魚，皮可飾刀。从魚，交聲。”', '27.9BA8': '《說文》：“鮨，魚䏽𤖕也，出蜀中。从魚，旨聲。一曰鮪魚名。”', '27.9B9A': '《說文》：“鮚，蚌也。从魚，吉聲。《漢律》會稽郡獻鮚𤖕。”', '27.9BA1': '《說文》：“鮡，魚名。从魚，兆聲。”', '27.F112': '《說文》：“𩙺，翄也。从飛，異聲。翼，篆文𩙺从羽。”', '27.9E7A': '《說文》：“𪉤，鹹也。从鹵，差省聲。河內謂之𪉤，沛人言若虘。”', '27.95C8': '《說文》：“闈，宮中之門也。从門，韋聲。”', '27.95C9': '《說文》：“闉，城內重門也。从門，垔聲。《詩》曰：‘出其闉闍。’”', '27.95D4': '《說文》：“闔，門扇也。一曰閉也。从門，盍聲。”', '27.E9E0': '《說文》：“䦱，闢門也。从門，為聲。《國語》曰：‘䦱門而與之言。’”', '27.E9E5': '《說文》：“䦪，門聲也。从門，曷聲。”', '27.95CC': '《說文》：“闌，門遮也。从門，柬聲。”', '27.95C7': '《說文》：“闇，閉門也。从門，音聲。”', '27.95CB': '《說文》：“闋，事已，閉門也。从門，癸聲。”', '27.95CA': '《說文》：“闊，疏也。从門，𣴠聲。”', '27.95C3': '《說文新附》：“闃，静也。从門，狊聲。”', '27.806F': '《說文》：“聯，連也。从耳，耳連於頰也；从絲，絲連不絕也。”', '27.8070': '《說文》：“聰，察也。从耳，怱聲。”', '27.8072': '《說文》：“聲，音也。从耳，殸聲。殸，籀文磬。”', '27.E9F4': '《說文》：“𦗕，乘輿金馬耳也。从耳，麻聲。讀若渳水，一曰若《月令》‘靡草’之靡。段玉裁本作“乘輿金耳也”', '27.8071': '《說文新附》：“聱，不聽也。从耳，敖聲。”', '27.64E0': '《說文》：“擠，排也。从手，齊聲。”', '27.64EB': '《說文》：“擪，一指按也。从手，厭聲。”', '27.8209': '《說文》：“擧，對舉也。从手，與聲。”', '27.64E9': '《說文》：“擩，染也。从手，需聲。《周禮》：‘六曰擩祭。’”', '27.64ED': '《說文》：“擭，搫擭也。一曰布擭也。一曰握也。从手，蒦聲。”', '27.64EC': '《說文》：“擬，度也。从手，疑聲。”', '27.64E2': '《說文》：“擢，引也。从手，翟聲。”', '27.64D8': '《說文》：“擘，撝也。从手，辟聲。”', '27.EA2A': '《說文》：“㩓，傷擊也。从手、毁，毁亦聲。”', '27.64CA': '《說文》：“擊，攴也。从手，𣪠聲。”', '27.7C0E': '《說文》：“簎，刺也。从手，籍省聲。《周禮》曰：‘簎魚鼈。’”', '27.EA3E': '《說文》：“嬩，女字也。从女，與聲。讀若余。”', '27.5B2E': '《說文》：“嬮，好也。从女，厭聲。”', '27.EA50': '《說文》：“䶒，材也。从女，齊聲。”', '27.5B25': '《說文》：“嬥，直好皃。一曰嬈也。从女，翟聲。”', '27.5B2A': '《說文》：“嬪，服也。从女，賓聲。”', '27.5B30': '《說文》：“嬰，頸飾也。从女、賏，賏，其連也。”', '27.5B2C': '《說文》：“嬬，弱也。一曰下妻也。从女，需聲。”', '27.5B2F': '《說文》：“嬯，遟鈍也。从女，臺聲。闒嬯亦如之。”', '27.EA7C': '《說文》：“㜮，過差也。从女，監聲。《論語》曰：‘小人窮斯㜮矣。’”', '27.6232': '《說文》：“戲，三軍之偏也。一曰兵也。从戈，䖒聲。”', '27.EA8A': '《說文》：“㔶，小桮也。从匚，贛聲。㯯，㔶或从木。”', '27.EA91': '《說文》：“匵，匱也。从匚，賣聲。”', '27.7511': '《說文》：“甑，甗也。从瓦，曾聲。𩱭，籀文甑，从䰜。”', '27.7E45': '《說文》：“繅，繹繭為絲也。从糸，巢聲。”', '27.7E40': '《說文》：“繀，著絲於筟車也。从糸，崔聲。”', '27.7E48': '《說文》：“繈，觕纇也。从糸，強聲。”', '27.7E31': '《說文》：“縱，緩也。一曰舍也。从糸，從聲。”', '27.7E2E': '《說文》：“縮，亂也。从糸，宿聲。一曰蹴也。”', '27.7E3D': '《說文》：“總，聚束也。从糸，悤聲。”', '27.7E43': '《說文》：“繃，束也。从糸，崩聲。《墨子》曰：‘禹葬會稽，桐棺三寸，葛以繃之。’”', '27.7E2A': '《說文》：“縪，止也。从糸，畢聲。”', '27.7E33': '《說文》：“縳，白鮮色也。从糸，專聲。”', '27.7E35': '《說文》：“縵，繒無文也。从糸，曼聲。《漢律》曰：‘賜衣者，縵表白裏。’”', '27.7E39': '《說文》：“縹，帛青白色也。从糸，票聲。”', '27.7E37': '《說文》：“縷，綫也。从糸，婁聲。”', '27.7E2B': '《說文》：“縫，以鍼紩衣也。从糸，逢聲。”', '27.7E2D': '《說文》：“縭，以絲介履也。从糸，离聲。”', '27.7E44': '《說文》：“繄，𢧢衣也。从糸，殹聲。一曰赤黑色繒。”', '27.7E3F': '《說文》：“縿，旌旗之斿也。从糸，參聲。”', '27.5FBD': '《說文》：“徽，衺幅也。一曰三糾繩也。从糸，微省聲。”', '27.7E3C': '《說文》：“縼，以長繩繫牛也。从糸，旋聲。”', '27.7E3E': '《說文》：“績，緝也。从糸，責聲。”', '27.EAF0': '《說文》：“𦄑，蜀細布也。从糸，彗聲。”', '27.7E46': '《說文》：“繆，枲之十絜也。一曰綢繆。从糸，翏聲。”', '27.87BC': '《說文》：“螼，螾也。从虫，堇聲。”', '27.EAFF': '《說文》：“䗥，螉䗥也。从虫從聲。”', '27.96D6': '《說文》：“雖，似蜥蜴而大。从虫，唯聲。”', '27.87BB': '《說文》：“螻，螻蛄也。从虫，婁聲。一曰𧏌天螻。”', '27.87C5': '《說文》：“蟅，蟲也，从虫庶聲。”', '27.87B8': '《說文》：“螸，螽醜螸，垂腴也。从虫，欲聲。”', '27.87AB': '《說文》：“螫，蟲行毒也。从虫，赦聲。”', '27.EB1A': '《說文》：“𧐂，敗創也。从虫、人、食。食亦聲。”', '27.87AD': '《說文》：“螭，若龍而黃，北方謂之地螻。从虫，离聲。或云無角曰螭。”', '27.87B7': '《說文》：“螷，階也。脩為螷，圜為蠇。从虫、庳。”', '27.87C9': '《說文》：“蟉，𧍘蟉也。从虫，翏聲。”', '27.87C4': '《說文》：“蟄，藏也。从虫，執聲。”', '27.87C6': '《說文》：“蟆，蝦蟆也。从虫，莫聲。”', '27.87B9': '《說文》：“螹，螹離也。从虫，漸省聲。”', '27.87AE': '《說文》：“螮，螮蝀，虹也。从虫，帶聲。”', '27.87CB': '《說文新附》：“蟋，蟋𧍓也。从虫，悉聲。”', '27.87B3': '《說文新附》：“螳，螳蜋也。从虫，堂聲。”', '27.87CA': '《說文》：“蟊，蠿蟊也。从䖵，矛聲。”', '27.87B6': '《說文》：“螶，螶𧎾也。从䖵，巨聲。”', '27.EB3D': '《說文》：“𩘁，北風謂之𩘁。从風，涼省聲。”', '27.EB3F': '《說文》：“䬍，疾風也。从風，从忽，忽亦聲。”', '27.9EFF': '《說文》：“黿，大鼈也。从黽，元聲。”', '27.58CE': '《說文》：“壎，樂器也。以土為之，六孔。从土，熏聲。”', '27.EB60': '《說文》：“壐，王者印也，所以主土。从土，爾聲。璽，籀文从玉。”', '27.EB65': '《說文》：“㙷，下入也。从土，㬎聲。”', '27.58D3': '《說文》：“壓，壞也。一曰塞補。从土，厭聲。”', '27.EB7A': '《說文》：“𧷎，囚突出也。从土，㕢聲。”', '27.58D2': '《說文新附》：“壒，塵也。”', '27.8271': '《說文》：“艱，土難治也。从堇，艮聲。囏，籀文艱从喜。”', '27.7584': '《說文》：“疄，轢田也。从田，粦聲。”', '27.EB89': '《說文》：“疃，禽獸所踐處也。《詩》曰：‘町疃鹿場。’从田，童聲。”', '27.EB8F': '《說文》：“黇，白黃色也。从黃，占聲。”', '27.EB99': '《說文》：“㔣，推也。从力，畾聲。”', '27.9347': '《說文》：“鍇，九江謂鐵曰鍇。从金，皆聲。”', '27.934A': '《說文》：“鍊，冶金也。从金，柬聲。”', '27.935B': '《說文》：“鍛，小冶也。从金，段聲。”', '27.937E': '《說文》：“鍾，酒器也。从金，重聲。”', '27.9351': '《說文》：“鍑，釜大口者。从金，复聲。”', '27.936A': '《說文》：“鍪，鍑屬。从金，敄聲。”', '27.9375': '《說文》：“鍵，鉉也。一曰車轄。从金，建聲。”', '27.93F6': '《說文》：“鏶，鍱也。从金，集聲。鍓，鏶或从咠。”', '27.9371': '《說文》：“鍱，鏶也。从金，枼聲。齊謂之鍱。”', '27.9364': '《說文》：“鍤，郭衣鍼也。从金，臿聲。”', '27.937C': '《說文》：“鍼，所以縫也。从金，咸聲。”', '27.9365': '《說文》：“鍥，鎌也。从金，契聲。”', '27.9370': '《說文》：“鍰，鋝也。从金，爰聲。《罰書》曰：‘列百鍰。’”', '27.9318': '《說文》：“錘，八銖也。从金，垂聲。”', '27.9360': '《說文》：“鍠，鐘聲也。从金，皇聲。《詩》曰：‘鐘鼓鍠鍠。’”', '27.93E6': '《說文》：“鏦，矛也。从金，從聲。䤸，鏦或从彖。”', '27.936D': '《說文》：“鍭，矢金鏃翦羽謂之鍭。从金，矦聲。”', '27.935C': '《說文》：“鍜，錏鍜也。从金，叚聲。”', '27.9361': '《說文》：“鍡，鍡鑸，不平也。从金，畏聲。”', '27.9352': '《說文》：“鍒，鐵之耎也。从金，从柔，柔亦聲。”', '27.EBCA': '《說文》：“㪺，挹也。从斗，𥇛聲。”', '27.EBCE': '《說文》：“斣，相易物俱等為斣。从斗，蜀聲。”', '27.8F40': '《說文》：“轀，卧車也。从車𥁕聲。”', '27.8F3F': '《說文》：“輿，車輿也。从車，舁聲。”', '27.EBDE': '《說文》：“𨍶，車輮規也。一曰一輪車。从車，熒省聲。讀若煢。”', '27.8F42': '《說文》：“轂，輻所湊也。从車，𣪊聲。”', '27.8F45': '《說文》：“轅，輈也。从車，袁聲。”', '27.8F44': '《說文》：“轄，車聲也。从車，害聲。一曰轄，鍵也。”', '27.EBEB': '《說文》：“䡩，車䡩𨥺也。从車，真聲。讀若《論語》：‘鏗爾舍瑟而作’。又讀若掔。”', '27.8F43': '《說文》：“轃，大車簀也。从車，秦聲。讀若臻。”', '27.96B0': '《說文》：“隰，阪下溼也。从𨸏，𣊡聲。”', '27.96B1': '《說文》：“隱，蔽也。从𨸏，㥯聲。”', '27.EDF4': '《說文》：“𨺫，𨺫商，小塊也。从𨸏，从臾。”', '27.8FAD': '《說文》：“辭，訟也。从𤔔，𤔔猶理辜也。𤔔，理也。𤔲，籀文辭从司。”', '27.5B7A': '《說文》：“孺，乳子也。一曰輸也，輸尚小也。从子，需聲。”', '27.EC2D': '《說文》：“𨢊，𥶶生衣也。从酉，冡聲。”', '27.919E': '《說文》：“醞，釀也。从酉，𥁕聲。”', '27.EC31': '《說文》：“𨢌，䣺也。从酉，鬲聲。”', '27.91A0': '《說文》：“醠，濁酒也。从酉，盎聲。”', '27.EC32': '《說文》：“䤊，酒也。从酉，茸聲。”', '27.91AE': '《說文》：“醮，冠娶禮祭。从酉，焦聲。𥛲，醮或从示。”', '27.EC3C': '《說文》：“䤉，㱃酒俱盡也。从酉，𥁑聲。”', '27.919F': '《說文》：“醟，䣱也。从酉，熒省聲。”', '27.91A2': '《說文》：“醢，肉𤖕也。从酉、𥁓。”', '27.79AC': '《說文》：“禬，會福祭也。从示、从會，會亦聲。《周禮》曰：‘禬之祝號。’”', '27.74B5': '《說文》：“璵，璵璠也。从玉，與聲。”', '27.74A7': '《說文》：“璧，瑞玉。圜也。从玉，辟聲。”', '27.E033': '《說文》：“𤪍，石之似玉者。从玉，舝聲。讀若曷。”', '27.74B6': '《說文》：“璶，石之似玉者。从玉，盡聲。”', '27.E057': '《說文》：“薲，大蓱也。从艸，賓聲。”', '27.85CD': '《說文》：“藍，染青草也。从艸，監聲。”', '27.85B0': '《說文》：“薰，香艸也。从艸，熏聲。”', '27.85CE': '《說文》：“藎，艸也。从艸，盡聲。”', '27.85CB': '《說文》：“藋，釐艸也。一曰拜商藋。从艸，翟聲。”', '27.E06A': '《說文》：“𦿓，艸也。从艸，毄聲。”', '27.E06C': '《說文》：“𦾮，艸也。从艸，榦聲。”', '27.85C4': '《說文》：“藄，月爾也。从艸，綦聲。”', '27.E072': '《說文》：“𦿏，灌渝。从艸，夢聲。讀若萌。”', '27.85BD': '《說文》：“薽，豕首也。从艸，甄聲。”', '27.85BA': '《說文》：“薺，蒺棃也。从艸，齊聲。《詩》曰：‘牆有薺。’”', '27.85BE': '《說文》：“薾，華盛。从艸，爾聲。《詩》曰：‘彼薾維何。’”', '27.85BF': '《說文》：“薿，茂也。从艸，疑聲。《詩》曰：‘黍稷薿薿。’”', '27.E09A': '《說文》：“𧀄，艸茂也。从艸，畼聲。”', '27.85C3': '《說文》：“藃，艸皃。从艸，歊聲。《周禮》曰：‘轂獘不藃。’”', '27.E0A0': '《說文》：“𦾵，艸旋皃也。从艸，榮聲。《詩》曰：‘葛纍𦾵之。’”', '27.85C9': '《說文》：“藉，祭藉也。一曰：艸不編，狼藉。从艸，耤聲。”', '27.85B6': '《說文》：“薶，瘞也。从艸，貍聲。”', '27.E0C1': '《說文》：“薻，水艸也。从艸，从水，巢聲。《詩》曰：‘于以采薻。’藻，薻或从澡。”', '27.85B3': '《說文新附》：“薳，艸也。《左氏傳》：‘楚大夫薳子馮。’从艸，遠聲。”', '27.85CF': '《說文新附》：“藏，匿也。”', '27.E0EB': '《說文》：“嚛，食辛嚛也。从口，樂聲。”', '27.E0EE': '《說文》：“𡂒，野人言之。从口，質聲。”', '27.5698': '《說文》：“嚘，語未定皃。从口，憂聲。”', '27.E116': '《說文》：“𧽤，輕行也。从走，票聲。”', '27.E12E': '《說文》：“趩，行聲也。一曰不行皃。从走，異聲。讀若敕。”', '27.E138': '《說文》：“䟂，行遲也。从走，曼聲。”', '27.E146': '《說文》：“䟆，止行也。一曰竈上祭名。从走，畢聲。”', '27.E147': '《說文》：“𧽯，進也。从走，斬聲。”', '27.E158': '《說文》：“𨘇，無違也。从辵，𤛉，讀若害。”', '27.E1AA': '《說文》：“𪗙，齒見皃。从齒，干聲。”', '27.9F55': '《說文》：“齕，齧也。从齒，气聲。”', '27.8E61': '《說文》：“𨄚，行皃。从足，將聲。《詩》曰：‘管磬蹡蹡。’”', '27.8E5B': '《說文》：“蹛，踶也。从足，帶聲。”', '27.8E69': '《說文》：“蹩，踶也。从足，敝聲。一曰跛也。”', '27.E1BF': '《說文》：“䠟，䠟足也。从足，執聲。”', '27.8E62': '《說文》：“蹢，住足也。从足，適省聲。或曰蹢躅。賈侍中說：足垢也。”', '27.E1C3': '《說文》：“䠧，歭䠧，不前也。从足，屠聲。”', '27.8E60': '《說文》：“蹠，楚人謂跳躍曰蹠。从足，庶聲。”', '27.8E59': '《說文新附》：“蹙，迫也。从足，戚聲。”', '27.569A': '《說文》：“嚚，語聲也。从㗊，臣聲。𡓶，古文嚚。”', '27.8B26': '《說文》：“謦，欬也。从言，殸聲。殸，籀文磬字。”', '27.8B39': '《說文》：“謹，慎也。从言，堇聲。”', '27.8B33': '《說文》：“謳，齊歌也。从言，區聲。”', '27.8B3C': '《說文》：“謼，𧦝謼也。从言，虖聲。”', '27.8B2F': '《說文》：“謯，謯娽也。从言，虘聲。”', '27.8B37': '《說文》：“謷，不肖人也。从言，敖聲。一曰哭不止，悲聲謷謷。”', '27.8B3E': '《說文》：“謾，欺也。从言，曼聲。”', '27.8B47': '《說文》：“譇，譇拏，羞窮也。从言，奢聲。”', '27.8B3A': '《說文》：“謺，謺讘也。从言，執聲。”', '27.8B30': '《說文》：“謰，謰謱也。从言，連聲。”', '27.8B31': '《說文》：“謱，謰謱也。从言，婁聲。”', '27.E1FE': '《說文》：“謲，相怒使也。从言，參聲。”', '27.8B27': '《說文》：“謧，謧詍，多言也。从言，离聲。”', '27.8B2C': '《說文》：“謬，狂者之妄言也。从言，翏聲。”', '27.8B35': '《說文》：“謵，言謵讋也。从言，習聲。”', '27.8B2B': '《說文》：“𧬍，罰也。从言，啻聲。”', '27.7AF6': '《說文》：“競，彊語也。一曰逐也。从誩，从二人。”', '27.53E2': '《說文》：“叢，聚也。从丵，取聲。”', '27.E243': '《說文》：“韗，攻皮治鼓工也。从革，軍聲。讀若運。韗，䩵或从韋。”', '27.97A3': '《說文》：“鞣，耎也。从革，从柔，柔亦聲。”', '27.97AE': '《說文》：“鞮，革履也。从革，是聲。”', '27.97AA': '《說文》：“鞪，車軸束也。从革，敄聲。”', '27.97A5': '《說文》：“鞥，轡鞥。从革，弇聲。讀若譍。一日龍頭繞者。”', '27.E256': '《說文》：“䩶，驂具也。从革，蚩聲。讀若騁蜃。”', '27.E260': '《說文》：“𩋠，勒靼也。从革，面聲。”', '27.97AC': '《說文》：“鞬，所以戢弓矢。从革，建聲。”', '27.E262': '《說文》：“䩯，急也。从革，亟聲。”', '27.9B35': '《說文》：“鬵，大釜也，一曰鼎大上小下若甑曰鬵，从鬲兓聲，讀若岑。𩱠，籀文鬵。”', '27.E271': '《說文》：“𩰾，涫也。从鬲，沸聲。”', '27.9B29': '《說文》：“鬩，恒訟也。《詩》云：‘兄弟鬩于牆。’从鬥，从兒。兒，善訟者也。”', '27.E2C5': '《說文》：“𣀄，朋侵也。从攴，从羣。羣亦聲。”', '27.E2D3': '《說文》：“𣀔，小舂也。从攴，算聲。”', '27.E2DE': '《說文》：“䁵（𥌡），兒初生瞥者。从目，瞏聲。”', '27.E2EE': '《說文》：“䁴，視而止也。从目，亶聲。”', '27.77BB': '《說文》：“瞻，臨視也。从目，詹聲。”', '27.E302': '《說文》：“𥋚，目眵也。从目，蔑省聲。”', '27.77BD': '《說文》：“瞽，目但有眹也。从目，鼓聲。”', '27.77BC': '《說文新附》：“瞼，目上下瞼也。从目，僉聲。”', '27.7FF9': '《說文》：“翹，尾長毛也。从羽，堯聲。”', '27.7FFB': '《說文新附》：“翻，飛也。从羽，番聲。或从飛。”', '27.5DC2': '《說文》：“巂，周燕也。从隹，屮象其冠也，冏聲。一曰：蜀王望帝婬其相妻，慙亡去，為子巂鳥，故蜀人聞子巂鳴，皆起云望帝。”', '27.96D7': '《說文》：“雗，雗鷽也。从隹，倝聲。”', '27.96DE': '《說文》：“雞，知時畜也。从隹，奚聲。鷄，籀文雞从鳥。”', '27.96DB': '《說文》：“雛，雞子也。从隹，芻聲。鶵，籀文雛，从鳥。”', '27.96E2': '《說文》：“離，離黃，倉庚也。鳴則蠶生。从隹，离聲。”', '27.96DA': '《說文》：“雚，小爵也。从萑，吅聲。《詩》曰：‘雚鳴于垤。’”', '27.7FB3': '《說文》：“羳，黃腹羊。从羊，番聲。”', '27.F123': '《說文》：“羴，羊臭也。从三羊。羶，羴或从亶。”', '27.77BF': '《說文》：“瞿，鷹隼之視也。从隹，从䀠，䀠亦聲。讀若章句之句。”', '27.96D9': '《說文》：“雙，隹二枚也。从雔，又持之。”', '27.E344': '《說文》：“䳔，鳥也。从鳥，臼聲。”', '27.F09A': '《說文》：“𪄿，鳥也。从鳥，堇聲。難，𪄿或从隹。”', '27.E34A': '《說文》：“𪁑，鳥也。从鳥，說省聲。”', '27.9D60': '《說文》：“鵠，鴻鵠也。从鳥，告聲。”', '27.9D5D': '《說文》：“䳘，鴚鵝也。从鳥，我聲。”', '27.9D56': '《說文》：“鵖，𪀐鵖也。从鳥，皀聲。”', '27.9D82': '《說文》：“鶃，鳥也。《春秋傳》曰：‘六鶃退飛’。”', '27.9DAC': '《說文》：“鶬，麋鴰也。从鳥，倉聲。𩀞，鶬或从隹。”', '27.9D54': '《說文》：“鵔，鵔鸃，鷩也。从鳥，夋聲。”', '27.6BAF': '《說文》：“殯，死在棺，將遷葬柩，賓遇之。从歺，从賓，賓亦聲。夏后殯於阼階；殷人殯於兩楹之閒；周人殯於賓階。”', '27.9AC1': '《說文》：“髁，髀骨也。从骨，果聲。”', '27.E38C': '《說文》：“䯜，骨間黃汁也。从骨，易聲。讀若《易》曰‘夕惕若厲’。”', '27.81D1': '《說文》：“臑，臂羊矢也。从肉，需聲。讀若襦。”', '27.81CD': '《說文》：“𪗇，肶𪗇也。从肉，齊聲。”', '27.E3C5': '《說文》：“㔎，斷也。从刀，辥聲。”', '27.7C1C': '《說文》：“簜，大竹也。从竹，湯聲。《夏天》曰：‘瑶琨筱簜。’簜可為幹，筱可為矢。”', '27.7C21': '《說文》：“簡，牒也。从竹，間聲。”', '27.7C1F': '《說文》：“簟，竹席也。从竹，𪉷聲。”', '27.E3F7': '《說文》：“𥳓，飯筥也。受五升。从竹，稍聲。秦謂筥曰𥳓。”', '27.7C1E': '《說文》：“簞，笥也。从竹，單聲。漢律令：‘簞，小筐也。’《傳》曰：‘簞食壺漿。’”', '27.7C1D': '《說文》：“簝，宗廟盛肉竹器也。从竹，尞聲。《周禮》：‘供盆簝以待事。’”', '27.7C26': '《說文》：“簦，笠蓋也。从竹，登聲。”', '27.7C27': '《說文》：“簧，笙中簧也。从竹，黃聲。”', '27.7C2B': '《說文》：“簫，參差，管樂。象鳳之翼。从竹，肅聲。”', '27.7C19': '《說文》：“簙，局戲也。六箸十二棊也。从竹，博聲。古者烏冑作簙。”', '27.9F16': '《說文》：“鼖，大鼓謂之鼖。鼖八尺而兩面，以鼓軍事。从鼓，賁省聲。䩿，鼖或从革，賁不省。”', '27.E43E': '《說文》：“𧇼，土鍪也。从䖒，号聲。讀若鎬。”', '27.8669': '《說文》：“虩，《易》‘履虎尾虩虩’，恐懼。一曰蠅虎也。从虎，𡭴聲。”', '27.91AF': '《說文》：“酼，酸也。作醯以𩱙、以酒。从𩱙、酒並省，从皿。皿，器也。”', '27.E45B': '《說文》：“𧗎，醢也。从血，菹聲。𧗘，𧗎或从缶。”', '27.E45D': '《說文》：“𧗒，以血有所刏涂祭也。从血，幾聲。”', '27.96D8': '《說文》：“雘，善丹也。从丹，蒦聲。《周書》曰：‘惟其𢾅丹雘。’讀若隺。”', '27.993E': '《說文》：“𩞷，飯氣蒸也。从食，畱聲。”', '27.994E': '《說文》：“饎，酒食也。从食，喜聲。《詩》曰：‘可以饙饎。’ 𩝮，饎或从巸。糦，饎或从米。”', '27.E47C': '《說文》：“䭑，嘰也。从食，兼聲。讀若風溓溓。一曰廉潔也。”', '27.E480': '《說文》：“䭓，䭡䭓也。从食，豈聲。”', '27.993D': '《說文》：“餽，吳人謂祭曰餽。从食，从鬼，鬼亦聲。”', '27.E48A': '《說文新附》：“餻，餌屬。从食，羔聲。”', '27.E4C0': '《說文》：“䪗，履也。从韋，叚聲。”', '27.6AC5': '《說文》：“櫅，木也，可以為大車軸。从木，齊聲。”', '27.E4E0': '《說文》：“㯷，棗也。从木，僕聲。”', '27.E4E7': '《說文》：“檵，枸杞也。从木，繼省聲。一曰監木也。”', '27.E4E8': '《說文》：“檿，山桑也。从木，厭聲。《詩》曰：‘其檿其柘。’”', '27.E4ED': '《說文》：“𣝋，㯚𣝋，木也。从木，遝聲。”', '27.6AB9': '《說文》：“檹，木檹椸。从木，旖聲。賈侍中說，檹即椅木，可作琴。”', '27.E501': '《說文》：“𦼭，壁柱也。从木，薄省聲。”', '27.E502': '《說文》：“檼，棼也。从木，㥯聲。”', '27.6ACB': '《說文》：“𣝼，屋𣝼䏈也。从木，𨘢省聲。”', '27.6AE1': '《說文》：“櫡，斫謂之櫡。从木，箸聲。”', '27.6AB7': '《說文》：“檷，絡絲檷。从木，爾聲。讀若柅。”', '27.6ABB': '《說文》：“檻，櫳也。从木，監聲。一曰圈。”', '27.6AC2': '《說文新附》：“櫂，所以進船也。从木，翟聲。或从卓。《史記》通用濯。”', '27.F3A5': '《說文》：“㯻，橐也。从束，圂聲。”', '27.8D05': '《說文》：“贅，以物質錢。从敖、貝。敖者，猶放貝當復取之也。”', '27.913B': '《說文》：“鄻，周邑也。从邑，輦聲。”', '27.913E': '《說文》：“鄾，鄧國地也。从邑，憂聲。《春秋傳》曰：‘鄧南鄙鄾人攻之。’”', '27.E572': '《說文》：“𨞼，蜀廣漢鄉也。从邑，蔓聲。讀若蔓。”', '27.9128': '《說文》：“鄨，䍧牱縣。从邑，敝聲。讀若鷩雉之鷩。”', '27.E5A5': '《說文》：“𠐱，闕。”', '27.E5AA': '《說文》：“𣄠，旌旗飛揚皃。从㫃，猋聲。”', '27.65DB': '《說文》：“旛，幅胡也。从㫃，番聲。”', '27.6726': '《說文新附》：“朦，月朦朧也。从月，蒙聲。”', '27.7A61': '《說文》：“穡，穀可收曰穡。从禾，嗇聲。”', '27.E5DB': '《說文》：“䆅，積禾也。从禾，資聲。《詩》曰：‘䆅之秩秩。’”', '27.E5DF': '《說文》：“𥢶，穅也。从禾，會聲。”', '27.E5E7': '《說文》：“䆃，禾也。从禾，道聲。司馬相如曰：‘䆃一莖六穗。’”', '27.99A5': '《說文新附》：“馥，香气芬馥也。从香，复聲。”', '27.F117': '《說文》：“𥼚，早取穀也。从米，焦聲。一曰小。”', '27.E5FA': '《說文》：“䊤，糜和也。从米，覃聲。讀若𨝸。”', '27.7CE7': '《說文》：“糧，穀也。从米，量聲。”', '27.E607': '《說文》：“檾，枲屬。从𣏟，熒省。《詩》曰：‘衣錦檾衣。’”', '27.E632': '《說文》：“，炊竈也。从穴，鼀省聲。𥩋，竈或不省。”', '27.7AC5': '《說文》：“竅，空也。从穴，敫聲。”', '27.7AC4': '《說文》：“竄，墜也。从鼠在穴中。”', '27.9083': '《說文》：“邃，深遠也。从穴，遂聲。”', '27.7670': '《說文》：“癰，腫也。从疒，雝聲。”', '27.7658': '《說文》：“癘，惡疾也。从疒，蠆省聲。”', '27.E65B': '《說文》：“癑，痛也。从疒，䢉聲。”', '27.8986': '《說文》：“覆，覂也。一曰蓋也。从襾，復聲。”', '27.5E6D': '《說文》：“幭，蓋幭也。从巾，蔑聲。一曰禪被。”', '27.76A6': '《說文》：“皦，玉石之白也。从白，敫聲。”', '27.8EC0': '《說文》：“軀，體也。从身，區聲。”', '27.F0BC': '《說文》：“𧝑，丹縠衣。从衣，㠭聲。”', '27.894B': '《說文》：“襋，衣領也。从衣，棘聲。《詩》曰：‘要之襋之。’”', '27.8951': '《說文》：“襑，衣博大。从衣，尋聲。”', '27.E6E4': '《說文》：“𧝐，緥也。从衣，啻聲。《詩》曰：‘載衣之𧝐。’”', '27.E6E6': '《說文》：“䙟，重衣皃。从衣，圍聲。《爾雅》曰：‘䙟䙟䙡䙡。’”', '27.894C': '《說文》：“襌，衣不重。从衣，單聲。”', '27.8950': '《說文》：“襐，飾也。从衣，象聲。”', '27.96DC': '《說文》：“雜，五彩相會。从衣，集聲。”', '27.E6EE': '《說文》：“𧝉，紩衣也。从衣、黹，黹亦聲。”', '27.896D': '《說文》：“襭，以衣衽扱物謂之襭。从衣，頡聲。擷，襭或从手。”', '27.5C69': '《說文》：“屩，屐也。从履省，喬聲。”', '27.E71C': '《說文》：“𧢄，目有察省見也。从見，票聲。”', '27.E71E': '《說文》：“覰，拘覰，未致密也。从見，虘聲。”', '27.E727': '《說文》：“𧢆，視不明也。一曰直視。从見，舂聲。”', '27.89B2': '《說文》：“覲，諸矦秋朝曰覲，勞王事。从見，堇聲。”', '27.E72C': '《說文》：“𧡸，目蔽垢也。从見，𠁁聲。讀若兜。”', '27.6B5F': '《說文》：“歟，安气也。从欠，與聲。”', '27.984F': '《說文》：“顏，眉目之閒也。从頁，彥聲。𩕝，籀文。”', '27.984C': '《說文》：“題，頟也。从頁，是聲。”', '27.9852': '《說文》：“顒，大頭也。从頁，禺聲。《詩》曰：‘其大有顒。’”', '27.E768': '《說文》：“𩔀，頭蔽𩔀也。从頁，㒸聲。”', '27.E76B': '《說文》：“𩔃，面不正也。从頁，爰聲。”', '27.9853': '《說文》：“顓，頭顓顓謹皃。从頁，耑聲。”', '27.E778': '《說文》：“䫔，司人也；一曰恐也。从頁，契聲。讀若禊。”', '27.9851': '《說文》：“顑，飯不飽面黄起行也。从頁，咸聲。讀若戇。”', '27.F0CA': '《說文》：“𩔊，選具也。从二頁。”', '27.E786': '《說文》：“頿，口上須也。从須，此聲。”', '27.E78B': '《說文》：“辬，駁文也。从文，辡聲。”', '27.9B08': '《說文》：“鬈，髮好也。从髟，卷聲。《詩》曰：‘其人美且鬈。’”', '27.E792': '《說文》：“䯾，髮多也。从髟，周聲。”', '27.E7A5': '《說文》：“𩮗，䰁也。从髟，竝聲。”', '27.E7A6': '《說文》：“䰁，𩮗也﹔忽見也。从髟，录聲。录，籀文魅，亦忽見意。”', '27.E7A8': '《說文》：“𡭐，小巵有耳蓋者。从巵，專聲。”', '27.E7BD': '《說文》：“䰧，鬼皃。从鬼，虎聲。”', '27.9B4B': '《說文》：“魋，神獸也。从鬼，隹聲。”', '27.5DC0': '《說文》：“巀，巀𡾦山，在馮翊池陽。从山，𢧵聲。”', '27.E7E4': '《說文》：“廫，空虛也。从广，膠聲。”', '27.7910': '《說文》：“礐，石聲。从石，學省聲。”', '27.E7FC': '《說文》：“礊，堅也。从石，𣪠聲。”', '27.790E': '《說文新附》：“礎，礩也。从石，楚聲。”', '27.8C75': '《說文》：“豵，生六月豚。从豕，從聲。一曰一歲豵，尚叢聚也。”', '27.8C99': '《說文》：“貙，貙獌似貍者。从豸，區聲。”', '27.8C98': '《說文》：“貘，熊而黃黑色，出蜀山。从豸，莫聲。”', '27.E816': '《說文》：“𧴄，猛獸也。从豸，庸聲。”', '27.9A0F': '《說文》：“騏，馬青驪文如博棊也。从馬，其聲。”', '27.9A05': '《說文》：“騅，馬蒼黑雜毛。从馬，隹聲。”', '27.E81F': '《說文》：“䮗，馬頭有發赤色者。从馬，岸聲。”', '27.9A0B': '《說文》：“騋，馬七尺為騋，八尺為龍。从馬，來聲。《詩》曰：‘騋牝驪牡。’”', '27.E827': '《說文》：“𩤐，馬盛也。从馬，㫄聲。《詩》曰：‘四牡𩤐𩤐。’”', '27.9A0E': '《說文》：“騎，跨馬也。从馬，奇聲。”', '27.9A11': '《說文》：“騑，驂，旁馬。从馬，非聲。”', '27.9A0A': '《說文》：“騊，騊駼，北野之良馬。从馬，匋聲。”', '27.E83F': '《說文》：“麐，牝麒也。从鹿吝聲。”', '27.9E8E': '《說文》：“麎，牝麋也。从鹿，辰聲。”', '27.7377': '《說文》：“獷，犬獷獷不可附也。从犬，廣聲。漁陽有獷平縣。”', '27.7375': '《說文》：“獵，放獵逐禽也。从犬，巤聲。”', '27.E86D': '《說文》：“䶄，䶄令鼠。从鼠，平聲。”', '27.E86E': '《說文》：“𪕚，竹鼠也，如犬。从鼠，畱省聲。”', '27.9F2B': '《說文》：“鼫，五技鼠也。能飛不能過屋，能緣不能窮木，能游不能渡谷，能穴不能掩身，能走不能先人。从鼠，石聲。”', '27.9F29': '《說文》：“鼩，精鼩鼠也。从鼠，句聲。”', '27.9F2C': '《說文》：“鼬，如鼠，赤黃而大，食鼠者。从鼠，由聲。”', '27.E874': '《說文》：“𪕎，鼠屬。从鼠，宂聲。”', '27.71F9': '《說文》：“燹，火也。从火，豩聲。”', '27.9F4C': '《說文》：“齌，炊餔疾也。从火，齊聲。”', '27.E885': '《說文》：“𤐧，以火乾肉。从火，稫聲。”', '27.71FF': '《說文》：“燿，照也。从火，翟聲。”', '27.71FE': '《說文》：“燾，溥覆照也。从火，壽聲。”', '27.E8A5': '《說文》：“䵤，黑皴也。从黑，幵聲。”', '27.9EE0': '《說文》：“黠，堅黑也。从黑，吉聲。”', '27.9EDF': '《說文》：“黟，黑木也。从黑，多聲。丹陽有黟縣。”', '27.5970': '《說文》：“𡚤，壯大也。从三大、三目。二目為𥆞，三目為𡚤，益大也。一曰迫也。讀若《易》虙羲氏。《詩》曰：‘不醉而怒謂之𡚤。’”', '27.E8D4': '《說文》：“竵，不正也。从立，𩰬聲。”', '27.E8D7': '《說文》：“䇔，痿也。从立，𦝠聲。”', '27.E8F7': '《說文》：“㦛，趣步㦛㦛也。从心，與聲。”', '27.E8F8': '《說文》：“懕，安也。从心，厭聲。《詩》曰：‘懕懕夜飲。’”', '27.E8FE': '《說文》：“㦚，憂也。从心，辡聲。一曰急也。”', '27.61F1': '《說文》：“懱，輕易也。从心，蔑聲。《商書》曰：‘以相陵懱’。”', '27.61D6': '《說文》：“懖，善自用之意也。从心，銛聲。《商書》曰：‘今汝懖懖。’𦗾，古文从耳。”', '27.61DF': '《說文》：“懟，怨也。从心，對聲。”', '27.61E3': '《說文》：“懣，煩也。从心，从滿。”', '27.E919': '《說文》：“䉍，䉍存也。从心，簡省聲。讀若簡。”', '27.61D8': '《說文新附》：“懘，惉懘也。从心，滯聲。”', '27.7E60': '《說文》：“繠，垂也。从惢，糸聲。”', '27.6FFC': '《說文》：“濼，齊魯間水也。从水，樂聲。《春秋傳》曰：‘公會齊侯于濼。’”', '27.700F': '《說文》：“瀏，流清皃。从水，劉聲。《詩》曰：‘瀏其清矣。’”', '27.7006': '《說文》：“瀆，溝也。从水，賣聲。一曰邑中溝。”', '27.7011': '《說文》：“瀑，疾雨也。一曰沫也。一曰瀑，資也。从水，暴聲。《詩》曰：‘終風且瀑。’”', '27.7000': '《說文》：“瀀，澤多也。从水，憂聲。《詩》曰：‘既瀀既渥。’”', '27.700C': '《說文》：“瀌，雨雪瀌瀌。从水，麃聲。”', '27.E95E': '《說文》：“㶁，水裂去也。从水，虢聲。”', '27.700E': '《說文》：“瀎，拭滅皃。从水，蔑聲。”', '27.700B': '《說文》：“瀋，汁也。从水，審聲。《春秋傳》：‘猶拾瀋。’”', '27.E969': '《說文》：“㵾，冷寒也。从水，靚聲。”', '27.7026': '《說文新附》：“瀦，水所亭也。从水，豬聲。”', '27.8C42': '《說文》：“豂，空谷也。从谷，翏聲。”', '27.E980': '《說文》：“𠘝，寒也。从仌，賴聲。”', '27.9723': '《說文》：“霣，雨也。齊人謂靁為霣。从雨，員聲。一曰雲轉起也。𩆹，古文霣。”', '27.9722': '《說文》：“霢，霢霂，小雨也。从雨，脈聲。”', '27.E991': '《說文》：“𩄡，久雨也。从雨，兼聲。”', '27.E994': '《說文》：“𩄚，雨聲。从雨，真聲。讀若資。”', '27.9724': '《說文》：“𩅸，屋水流也。从雨，畱聲。”', '27.9BC0': '《說文》：“鯀，魚也。从魚，系聲。”', '27.9BC9': '《說文》：“鯉，鱣也。从魚，里聲。”', '27.9BC8': '《說文》：“鯈，魚名。从魚，攸聲。”', '27.E9A8': '《說文》：“䱏，魚名。从魚，豆聲。”', '27.E9AE': '《說文》：“𩷏，魚名。从魚，巠聲。”', '27.9BC7': '《說文》：“鯇，魚名。从魚，完聲。”', '27.E9B5': '《說文》：“𩷑，鮀也。从魚，妟聲。鰋，𩷑或从匽。”', '27.E9B6': '《說文》：“鮷，大鮎也。从魚，弟聲。”', '27.9BB8': '《說文》：“鮸，魚名。出薉邪頭國。从魚，免聲。”', '27.E9C1': '《說文》：“鰂，烏鰂，魚名，則聲。鯽，鰂或从即。”', '27.9BC1': '《說文》：“鯁，魚骨也。从魚，更聲。”', '27.F0D1': '《說文》：“鮺，藏魚也。南方謂之黔，北方謂之鮺。从魚，差省聲。”', '27.76EC': '《說文》：“盬，河東鹽池。袤五十一里，廣七里，周百十六里。从鹽省，古聲。”', '27.95D2': '《說文》：“闒，樓上戶也。从門，𦐇聲。”', '27.95D5': '《說文》：“闕，門觀也。从門，欮聲。”', '27.95D1': '《說文》：“闑，門梱也。从門，臬聲。”', '27.95D3': '《說文》：“闓，開也。从門，豈聲。”', '27.95DC': '《說文》：“關，以木橫持門戶也。从門，𢇇聲。”', '27.95D0': '《說文》：“闐，盛皃。从門，真聲。”', '27.95D6': '《說文》：“闖，馬出門皃。从馬在門中。讀若郴。”', '27.8077': '《說文》：“職，記微也。从耳，戠聲。”', '27.8076': '《說文》：“聶，附耳私小語也。从三耳。”', '27.EA01': '《說文》：“擥，撮持也。从手，監聲。”', '27.64F8': '《說文》：“擸，理持也。从手，巤聲。”', '27.64FF': '《說文》：“擿，搔也。从手，適聲。一曰投也。”', '27.64FE': '《說文》：“𢹎，煩也。从手，夒聲。”', '27.EA5C': '《說文》：“嬻，媟嬻也。从女，賣聲。”', '27.EA83': '《說文》：“𣱓，闕。”', '27.7513': '《說文》：“甓，瓴甓也。从瓦，辟聲。《詩》曰：‘中唐有甓。’”', '27.F089': '《說文》：“䌛，隨從也。从糸，䚻聲。”', '27.7E54': '《說文》：“織，作布帛之總名也。从糸，戠聲。”', '27.7E62': '《說文》：“繢，織餘也。从糸，貴聲。”', '27.EAC0': '《說文》：“繎，絲勞也。从糸，然聲。”', '27.7E59': '《說文》：“繙，冕也。从糸，番聲。”', '27.7E5A': '《說文》：“繚，纏也。从糸，尞聲。”', '27.7E5E': '《說文》：“繞，纏也。从糸，堯聲。”', '27.EAC6': '《說文》：“䌖，合也。从糸，从集。讀若捷。”', '27.7E61': '《說文》：“繡，五采備也。从系，肅聲。”', '27.7E5F': '《說文》：“繟，帶緩也。从糸，單聲。”', '27.7E50': '《說文》：“繐，細疏布也。从糸，惠聲。”', '27.7E51': '《說文》：“繑，絝紐也。从糸，喬聲。”', '27.7E5C': '《說文》：“繜，薉貉中女子無絝，以帛為脛空，用絮補核，名曰繜衣，狀如襜褕。从糸，尊聲。”', '27.7E55': '《說文》：“繕，補也。从糸，善聲。”', '27.EAE8': '《說文》：“𦄿，索也。从糸，黑聲。”', '27.7E58': '《說文》：“繘，綆也。从糸，矞聲。𦇹，古文从絲。𦈇，籀文繘。”', '27.7E56': '《說文新附》：“繖，蓋也。从糸，散聲。”', '27.EB01': '《說文》：“𧑎，蟲也。从虫，𠭥聲。”', '27.87EF': '《說文》：“蟯，腹中短蟲也。从虫，堯聲。”', '27.87D8': '《說文》：“蟘，蟲食苗葉者。吏乞貸則生蟘。从虫，从貸，貸亦聲。《詩》曰：‘去其螟蟘。’”', '27.87E3': '《說文》：“蟣，蝨子也。一曰齊謂蛭曰蟣。从虫，幾聲。”', '27.87EB': '《說文》：“蟫，白魚也。从虫，覃聲。”', '27.87DC': '《說文》：“蟜，蟲也。从虫，喬聲。”', '27.EB0B': '《說文》：“𧑐，𧑐蟥也。从虫，矞聲。”', '27.87E5': '《說文》：“蟥，𧑐蟥也。从虫，黃聲。”', '27.87E0': '《說文》：“蟠，鼠婦也。从虫，番聲。”', '27.87EC': '《說文》：“蟬，以旁鳴者。从虫，單聲。”', '27.EB16': '《說文》：“蟰，蟰蛸。長股者。从虫，肅聲。”', '27.87E8': '《說文》：“蟨，鼠也。一曰西方有獸，前足短，與蛩蛩巨虛比，其名謂之蟨。从虫，厥聲。”', '27.87EA': '《說文新附》：“蟪，蟪蛄，蟬也。从虫，惠聲。”', '27.87F2': '《說文》：“蟲，有足謂之蟲，無足謂之豸。从三虫。”', '27.EB40': '《說文》：“䬑，大風也。从風，胃聲。”', '27.98BA': '《說文》：“颺，風所飛揚也。从風，昜聲。”', '27.98B8': '《說文》：“颸，涼風也。从風，思聲。”', '27.98BC': '《說文新附》：“䬒，䬒飂也。从風，叜聲。”', '27.9F00': '《說文》：“鼀，圥鼀，詹諸也。其鳴詹諸，其皮鼀鼀，其行圥圥。从黽，从圥，圥亦聲。𪓰，鼀或从酋。”', '27.EB4A': '《說文》：“䵶，𪓷屬，頭有兩角，出遼東。从黽，句聲。”', '27.EB4D': '《說文》：“鼂，匽鼂也。讀若朝。揚雄說：匽鼂，蟲名。杜林以為朝旦，非是。从黽，从旦。𪓨，篆文从皂。”', '27.58D8': '《說文》：“壘，軍壁也。从土，畾聲。”', '27.58D9': '《說文》：“壙，塹穴也。一曰大也。从土，廣聲。”', '27.91D0': '《說文》：“釐，家福也。从里，𠩺聲。”', '27.EB8E': '《說文》：“䵋，青黃色也。从黃，有聲。”', '27.F0E8': '《說文》：“黊，鮮明黃也。从黃，圭聲。”', '27.9394': '《說文》：“鎔，冶器法也。从金，容聲。”', '27.93AC': '《說文》：“鎬，温器也。从金，高聲。武王所都，在長安西上林苑中，字亦如此。”', '27.93A3': '《說文》：“鎣，器也。从金，熒省聲。讀若銑。”', '27.EBAB': '《說文》：“𨪉，器也。从金，虒聲。”', '27.938C': '《說文》：“鎌，鍥也。从金，兼聲。”', '27.93AE': '《說文》：“鎮，博壓也。从金，真聲。”', '27.939B': '《說文》：“鎛，鎛鱗也。鐘上橫木上金華也。一曰田器。从金，尃聲。《詩》曰：‘庤乃錢鎛。’”', '27.9397': '《說文》：“鎗，鐘聲也。从金，倉聲。”', '27.93A7': '《說文》：“鎧，甲也。从金，豈聲。”', '27.938E': '《說文》：“鎎，怒戰也。从金，氣聲。《春秋傳》曰：‘諸矦敵王所鎎。’”', '27.93A6': '《說文》：“鐂，殺也。”', '27.9395': '《說文》：“鎕，鎕銻，火齊。从金，唐聲。”', '27.9396': '《說文新附》：“鎖，鐵鎖，門鍵也。从金，𧴪聲。”', '27.EBC5': '《說文》：“𧇿，且往也。从且，豦聲。”', '27.8F48': '《說文》：“轈，兵高車加巢以望敵也。从車，巢聲。《春秋傳》曰：‘楚子登轈車。’”', '27.EBD7': '《說文》：“䡬，衣車蓋也。从車，曼聲。”', '27.8F49': '《說文》：“轉，運也。从車，專聲。”', '27.EBEC': '《說文》：“𨎌，抵也。从車，執聲。”', '27.EBF0': '《說文》：“䡰，車堅也。从車，殸聲。”', '27.8F4D': '《說文新附》：“轍，車迹也。从車，徹省聲。本通用徹，後人所加。”', '27.EC00': '《說文》：“𨽍，通溝也。从𨸏，賣聲。讀若瀆。豄，古文𨽍从谷。”', '27.91AA': '《說文》：“汁滓酒也。从酉，翏聲。”', '27.EC33': '《說文》：“𨢮，酒也。从酉，𣉻省。”', '27.91A7': '《說文》：“醧，私宴㱃也。从酉，區聲。”', '27.91AB': '《說文》：“醫，治病工也。殹，惡姿也，醫之性然。得酒而使。从酉。王育說。一曰殹，病聲。酒，所以治病也。《周禮》有醫酒。古者巫彭初作醫。”', '27.91A8': '《說文》：“醨，薄酒也。从酉，离聲。讀若離。”', '27.EC47': '《說文》：“𨢡，擣榆𤖕也。从酉，畢聲。”', '27.79B0': '《說文新附》：“禰，親廟也。从示，爾聲。”', '27.74C3': '《說文》：“瓃，玉器也。从玉，畾聲。”', '27.74C5': '《說文》：“瓅，玓瓅。从玉，樂聲。”', '27.E042': '《說文》：“𤪎，遺玉也。从玉，𣣸聲。”', '27.85ED': '《說文》：“藭，营藭也。从艸，窮聲。”', '27.85F7': '《說文》：“藷，藷蔗也。从艸，諸聲。”', '27.E06E': '《說文》：“𧀩，艸也。从艸，賜聲。”', '27.85D1': '《說文》：“𧁰，茅葍也。一名蕣。从艸，𢿌聲。”', '27.85DF': '《說文》：“藟，艸也。从艸，畾聲。《詩》曰：‘莫莫葛藟。’一曰秬鬯也。”', '27.85E8': '《說文》：“藨，鹿藿也。从艸，麃聲，讀若剽。一曰𦳋屬。”', '27.85D7': '《說文》：“藗，牡茅也。从艸，遬聲。遬，籀文速。”', '27.85F8': '《說文》：“藸，荎藸也。从艸；豬聲。”', '27.85E3': '《說文》：“藣，艸也。从艸，罷聲。”', '27.85EA': '《說文》：“藪，大澤也。从艸，數聲。九州之藪：楊州具區，荆州雲夢，豫州甫田，青州孟諸，沇州大野，雝州弦圃，幽州奚養，冀州楊紆，并州昭餘祁是也。”', '27.85E5': '《說文》：“藥，治病艸。从艸，樂聲。”', '27.85E9': '《說文》：“藩，屏也。从艸，潘聲。”', '27.E0AE': '《說文》：“䕩，乾梅之屬。从艸，橑聲。《周禮》曰：‘饋食之籩，其實乾䕩。’後漢長沙王始煮艸為䕩。𧀪，䕩或从潦。”', '27.85DA': '《說文》：“藚，水舄也。从艸，賣聲。《詩》曰：‘言采其藚。’”', '27.85DC': '《說文》：“藜，艸也。从艸，黎聲。”', '27.72A2': '《說文》：“犢，牛子也。从牛，瀆省聲。”', '27.72A1': '《說文》：“犡，牛白脊也。从牛，厲聲。”', '27.72A5': '《說文》：“犥，牛黄白色。从牛，麃聲。”', '27.E0DE': '《說文》：“𤛿，耕也。从牛，黎聲。”', '27.E0E1': '《說文》：“𤜂，牛踶𤜂也。从牛，衛聲。”', '27.56A8': '《說文》：“嚨，喉也。从口，龍聲。”', '27.56B4': '《說文》：“嚴，教命急也。从吅，𠪚聲。𡅮，古文。”', '27.8DAB': '《說文》：“趫，善緣木走之才。从走，喬聲。讀若王子蹻。”', '27.E112': '《說文》：“𧽸，蹠也。从走，厥聲。”', '27.8DAC': '《說文》：“趬，行輕皃。一曰趬，舉足也。从走，堯聲。”', '27.E135': '《說文》：“䟇，走也。从走，幾聲。”', '27.E137': '《說文》：“𧽻，狂走也。从走，矞聲。”', '27.E163': '《說文》：“䢱，媟䢱也。从辵，𧸇聲。”', '27.E170': '《說文》：“邌，徐也。从辵，黎聲。”', '27.908B': '《說文》：“邋，搚也。从辵，鼠聲。”', '27.908A': '《說文》：“𨘢，行垂崖也。从辵，𦤝聲。”', '27.9F57': '《說文》：“齗，齒本也。从齒，斤聲。”', '27.9F58': '《說文》：“齘，齒相切也。从齒，介聲。”', '27.8E7B': '《說文》：“蹻，舉足行高也。从足，喬聲。《詩》曰：‘小子蹻蹻。’”', '27.8E74': '《說文》：“蹴，躡也。从足，就聲。”', '27.8E76': '《說文》：“蹶，僵也。从足，厥聲。一曰跳也。亦讀若橜。𨇮，蹶或从闕。”', '27.8E72': '《說文》：“蹲，踞也。从足，尊聲。”', '27.8E78': '《說文》：“𨆴，轢也。从足，㷠聲。”', '27.8E9A': '《說文新附》：“蹮，蹁蹮，旋行。从足，䙴聲。”', '27.8E6D': '《說文新附》：“蹭，蹭蹬，失道也。从足，曾聲。”', '27.8E6C': '《說文新附》：“蹬，蹭蹬也。从足，登聲。”', '27.8B54': '《說文》：“譔，專教也。从言，巽聲。”', '27.8B58': '《說文》：“識，常也。一曰知也。从言，戠聲。”', '27.8B52': '《說文》：“譒，𢾭也。从言，番聲。《商書》曰：‘王譒告之。’”', '27.8B4A': '《說文》：“譊，恚呼也。从言，堯聲。”', '27.8B4F': '《說文》：“譏，誹也。从言，幾聲。”', '27.8B46': '《說文》：“譆，痛也。从言，喜聲。”', '27.E20C': '《說文》：“譄，加也。从言，曾聲。”', '27.E211': '《說文》：“䜋，中止也。从言，貴聲。《司馬法》曰：‘師多則人䜋。’䜋，止也。”', '27.8B41': '《說文》：“譁，讙也。从言，華聲。𧪮，謣（譁）或从荂。”', '27.E217': '《說文》：“譌，譌言也。从言，為聲。《詩》曰：‘民之譌言’。”', '27.8B4E': '《說文》：“譎，權詐也。益梁曰：‘謬欺天下曰譎。’从言，矞聲。”', '27.E21B': '《說文》：“䜐，相毀也。从言，隨省聲。”', '27.8B56': '《說文》：“譖，愬也。从言，朁聲。”', '27.8B49': '《說文》：“證，告也。从言，登聲。”', '27.8B95': '《說文》：“讕，怟讕也。从言，闌聲。譋，讕或从閒。”', '27.8B5C': '《說文新附》：“譜，籍錄也。从言，普聲。《史記》从並。”', '27.97FB': '《說文新附》：“韻，和也。从音，員聲。裴光遠云：‘古與均同。’未知其審。”', '27.EE86': '《說文》：“龏，𢡱也。从廾，龍聲。”', '27.E240': '《說文》：“𦦧，所以枝鬲者。从爨省，鬲省。”', '27.97B6': '《說文》：“鞶，大帶也。《易》曰：‘或錫之鞶帶。’男子帶鞶，婦人帶絲。从革，般聲。”', '27.E24A': '《說文》：“鞵，革生鞮也。从革，奚聲。”', '27.E25B': '《說文》：“𩌏，車下索也。从革，尃聲。”', '27.E25E': '《說文》：“䩸，鞌毳飾也。从革，茸聲。”', '27.9B37': '《說文》：“鬷，釜屬。从鬲，㚇聲。”', '27.F0D8': '《說文》：“𩱧，五味盉羹也。从𩰲，从羔。《詩》曰：‘亦有和𩱧。’𩱋，𩱧或省。𢑌，或从美𩱧省。羹，小篆从羔从美。”', '27.77CF': '《說文》：“𥌗（矈），目旁薄緻宀宀也。从目，𦤝聲。”', '27.E2F4': '《說文》：“𥌊，小兒白眼也。从目，辡聲。”', '27.77C9': '《說文》：“矉，恨張目也。从目，賓聲。《詩》曰：‘國步斯矉。’”', '27.E2F8': '《說文》：“矆，大視也。从目，蒦聲。”', '27.E2FA': '《說文》：“𥌈，視也。从目，監聲。”', '27.77C7': '《說文》：“矇，童矇也。一曰不明也。从目，蒙聲。”', '27.7FFE': '《說文》：“翾，小飛也。从羽，睘聲。”', '27.7FFD': '《說文》：“翽，飛聲也。从羽，歲聲。《詩》曰：‘鳳皇于飛，翽翽其羽。’”', '27.96E1': '《說文》：“雡，鳥大雛也。从隹，翏聲。一曰雉之莫子為雡。”', '27.E326': '《說文》：“䨄，𨿡屬。从隹，酓聲。䳺，籀文䨄从鳥。”', '27.7FB8': '《說文》：“羸，瘦也。从羊，𦝠聲。”', '27.9D8C': '《說文》：“鶌，鶌鳩也。从鳥，屈聲。”', '27.E343': '《說文》：“𪁾，鳥也。从鳥，芺聲。”', '27.E34C': '《說文》：“𪂆，鳥也。从鳥，昏聲。”', '27.9D7D': '《說文》：“鵽，鵽鳩也。从鳥，叕聲。”', '27.9D71': '《說文》：“𪂚，蔞鵝也。从鳥，坴聲。”', '27.9D84': '《說文》：“𪂴，𪁉𪂴也。从鳥，青聲。”', '27.6BB0': '《說文》：“殰，胎敗也。从歺，賣聲。”', '27.E386': '《說文》：“髃，肩前也。从骨，禺聲。”', '27.81D8': '《說文》：“臘，冬至後三戌，臘祭百神。从肉，巤聲。”', '27.5296': '《說文》：“劖，斷也。从刀，毚聲。一曰剽也；釗也。”', '27.E3D9': '《說文》：“鱖，角有所觸發也。从角，厥聲。”', '27.E3E4': '《說文》：“䚨，隿射收繳具也。从角，發聲。”', '27.7C2C': '《說文》：“簬，箘簬也。从竹，路聲。《夏書》曰：‘惟箘簬楛。’簵，古文簬，从輅。”', '27.E3EC': '《說文》：“𥵨，筡也。从竹，臱聲。”', '27.7C40': '《說文》：“籀，讀書也。从竹，㨨聲。《春秋傳》曰‘卜籀’云。”', '27.E3F2': '《說文》：“籆，收絲者也。从竹，蒦聲。𧤽，籆或从角从閒。”', '27.7C3E': '《說文》：“簾，堂簾也。从竹，廉聲。”', '27.E3F6': '《說文》：“䉛，漉米籔也。从竹，奧聲。”', '27.E409': '《說文》：“𥴧，飲牛筐也。从竹，豦聲。方曰筐，圜曰𥴧。”', '27.E410': '《說文》：“𥴫，榜也。从竹，殿聲。”', '27.E413': '《說文》：“簺，行棊相塞謂之簺。从竹，从塞，塞亦聲。”', '27.E414': '《說文》：“𥴨，蔽不見也。从竹，愛聲。”', '27.7C38': '《說文》：“簸，揚米去糠也。从箕，皮聲。”', '27.56AD': '《說文》：“嚭，大也。从喜，否聲。”', '27.E42F': '《說文》：“𧒕，夜戒守鼓也。从壴，蚤聲。《禮》：‘昬鼓四通為大鼓，夜半三通為戒晨，旦明五通為發明。’讀若戚。”', '27.E433': '《說文》：“䶀，鼓聲也。从鼓，合聲。鞈，古文䶀从革。”', '27.E435': '《說文》：“𪔕，鼓鼙聲。从鼓，缶聲。”', '27.9F4D': '《說文》：“齍，黍稷在器以祀者。从皿，齊聲。”', '27.E453': '《說文》：“䀊，器也。从皿，漻聲。”', '27.E478': '《說文》：“𩞧，晝食也。从食，象聲。𩞃，𩞧或从傷省聲。”', '27.9949': '《說文》：“饉，蔬不孰為饉。从食，堇聲。”', '27.7F4B': '《說文》：“𦉥，汲缾也。仌缶，雝聲。”', '27.7F4A': '《說文》：“罊，器中盡也。从缶，𣪠聲。”', '27.5912': '《說文》：“夒，貪獸也。一曰母猴，似人。从頁，已、止、夊，其手、足。”', '27.97DC': '《說文》：“韜，劔衣也。从韋，舀聲。”', '27.97DD': '《說文》：“韝，射臂決也。从韋，冓聲。”', '27.E4C3': '《說文》：“䪙，軶裏也。从韋，尃聲。”', '27.6ADF': '《說文》：“櫟，木也。从木，樂聲。”', '27.6ADD': '《說文》：“櫝，匱也。从木，賣聲。一曰木名。又曰大梡也。”', '27.6ACC': '《說文》：“櫌，摩田器，从木憂聲。《論語》曰：‘櫌而不輟。’”', '27.6AD1': '《說文》：“櫑，龜目酒尊，刻木作雲雷象，象施不窮也。从木，畾聲。罍，櫑或从缶。𥃇，櫑或从皿。𦉩，籀文櫑。”', '27.E517': '《說文》：“櫎，所以几器。从木，廣聲。一曰帷屏風之屬。”', '27.6ACD': '《說文新附》：“櫍，柎也。从木，質聲。”', '27.6ADC': '《說文》：“櫜，車上大橐。从㯻省，咎聲。《詩》曰：‘載櫜弓矢。’”', '27.8D0A': '《說文》：“贊，見也。从貝，从兟。”', '27.8D08': '《說文》：“贈，玩好相送也。从貝，曾聲。”', '27.E554': '《說文》：“𥨪，夏后時諸矦夷羿國也。从邑，窮省聲。”', '27.9140': '《說文》：“酀，地名。从邑，燕聲。”', '27.E58F': '《說文》：“顲，地名。从邑，𤎭聲。讀若淫。”', '27.66E0': '《說文》：“曠，明也。从日，廣聲。”', '27.65DE': '《說文》：“旞，導車所以載，全羽以為允。允，進也。从㫃，遂聲。𣄧，旞或从遺。”', '27.65DD': '《說文》：“旝，建大木置石其上，發以機，以追敵也。从㫃，會聲。《春秋傳》曰：‘旝動而鼓。’《詩》曰：‘其旝如林。’”', '27.758A': '《說文》：“曡，揚雄說以為，古理官决罪，三日得其宜，乃行之。从晶，从宜。亡新以為，曡从三日太盛，改為三田。”', '27.E5C2': '《說文》：“𩏏，束也。从𣐺韋聲。”', '27.7258': '《說文》：“牘，書版也。从片，賣聲。”', '27.7A67': '《說文》：“穧，穫刈也。一曰撮也。从禾，齊聲。”', '27.7A6B': '《說文》：“穫，刈穀也。从禾，蒦聲。”', '27.7A69': '《說文新附》：“穩，蹂穀聚也。一曰安也。从禾，隱省。古通用安隱。”', '27.E5F4': '《說文》：“䊪，粟重一䄷，為十六斗太半斗，舂為米一斛曰䊪。从米，萬聲。”', '27.E5F7': '《說文》：“𥼶，潰米也。从米，睪聲。”', '27.7CEA': '《說文》：“糪，炊米者謂之糪。从米，辟聲。”', '27.9EC0': '《說文》：“黀，麻䕸也。从麻，取聲。”', '27.E60C': '《說文》：“䪡，墜也。从韭、次、𠂔，皆聲。齏，䪡或从齊。”', '27.74E3': '《說文》：“瓣，瓜中實。从瓜，辡聲。”', '27.E61E': '《說文》：“寴，至也。从宀，親聲。”', '27.5BF5': '《說文》：“寵，尊居也。从宀，龍聲。”', '27.E62A': '《說文》：“𡫬，窮也。从宀，𥱩聲。𥩁，𡫬或从穴。”', '27.7661': '《說文》：“癡，不慧也。从疒，疑聲。”', '27.7F85': '《說文》：“羅，以絲罟鳥也。从网，从維。古者芒氏初作羅。”', '27.E677': '《說文》：“𦌬，牖中网也。从网，舞聲。”', '27.F06A': '《說文》：“𦌭，馬絡頭也。从网，从馽。馽，馬絆也。𦍈，𦌭或从革。”', '27.8988': '《說文》：“覈，實也，考事襾笮，邀遮其辤，得實曰覈。从襾，敫聲。”', '27.E693': '《說文》：“𢅯，以囊盛穀，大滿而裂也。从巾，奮聲。”', '27.5E70': '《說文新附》：“幰，車幔也。从巾，憲聲。”', '27.9EFC': '《說文》：“黼，白與黑相次文。从黹，甫聲。”', '27.E6BE': '《說文》：“𠐿，惽也。从人，薨聲。”', '27.5133': '《說文》：“儳，儳互，不齊也。从人，毚聲。”', '27.8958': '《說文》：“襘，帶所結也。从衣，會聲。《春秋傳》曰：‘衣有襘。’”', '27.895C': '《說文》：“襜，衣蔽前。从衣，詹聲。”', '27.8957': '《說文》：“襗，絝也。从衣，睪聲。”', '27.895B': '《說文》：“襛，衣厚皃。从衣，農聲。《詩》曰：‘何彼襛矣。’”', '27.8961': '《說文》：“襡，短衣也。从衣，蜀聲。讀若蜀。”', '27.895E': '《說文》：“襞，韏衣也。从衣，辟聲。”', '27.895A': '《說文》：“襚，衣死人也。从衣，遂聲。《春秋傳》曰：‘楚使公親襚。’”', '27.8956': '《說文新附》：“襖，裘屬。从衣，奧聲。”', '27.7A68': '《說文》：“穨，禿皃。从禿，貴聲。”', '27.89B6': '《說文》：“覶，好視也。从見，𤔔聲。”', '27.E729': '《說文》：“䚐，目赤也。从見，𣉻省聲。”', '27.E742': '《說文》：“䌠，監持意，口閉也。从欠，緘聲。”', '27.985B': '《說文》：“顚，頂也。从頁，眞聲。”', '27.9859': '《說文》：“顙，頟也。从頁，桑聲。”', '27.E761': '《說文》：“䫟，面色顚䫟皃。从頁，員聲。讀若隕。”', '27.E762': '《說文》：“䫡，頭頰長也。从頁，兼聲。”', '27.E763': '《說文》：“䫞，大頭也。从頁，羔聲。”', '27.985D': '《說文》：“顝，大頭也。从頁，骨聲。讀若魁。”', '27.9858': '《說文》：“願，大頭也。从頁，原聲。”', '27.9857': '《說文》：“顗，謹莊皃。从頁，豈聲。”', '27.E779': '《說文》：“䫥，頭不正也。从頁，鬼聲。”', '27.E789': '《說文》：“䫠，短須髮皃。从須，否聲。”', '27.9B0B': '《說文》：“鬋，女鬢垂皃。从髟，前聲。”', '27.9B23': '《說文》：“鬣，髮鬣鬣也。从髟，巤聲。㲱，鬣或从毛；䝓，或從豕。”', '27.9B0C': '《說文》：“鬌，髮隋也。从髟，隋省。”', '27.9B0A': '《說文》：“鬊，鬢髮也。从髟，春聲。”', '27.E7C7': '《說文》：“𡾦，巀𡾦，山也。从山，辥聲。”', '27.5EEC': '《說文》：“廬，寄也。秋冬去，春夏居。从广，盧聲。”', '27.9F90': '《說文》：“龐，高屋也。从广，龍聲。”', '27.791C': '《說文》：“礜，毒石也，出漢中。从石，與聲。”', '27.7919': '《說文》：“礙，止也。从石，疑聲。”', '27.E802': '《說文》：“𥗁，斫也。从石，箸聲。”', '27.8C76': '《說文》：“豶，羠豕也。从豕，賁聲。”', '27.E80A': '《說文》：“䝐，豶也。从豕，隋聲。”', '27.8C77': '《說文》：“豷，豕息也。从豕，壹聲。《春秋傳》曰：‘生敖及豷。’”', '27.8C9A': '《說文》：“貚，貙屬也。从豸，單聲。”', '27.9A22': '《說文》：“騢，馬赤白雜毛。从馬，叚聲。謂色似鰕魚也。”', '27.9A27': '《說文》：“騧，黃馬黑喙。从馬，咼聲。，籀文騧。”', '27.9A1B': '《說文》：“騛，馬逸足也。从馬，从飛。《司馬法》曰：‘飛衛斯輿。’”', '27.F071': '《說文》：“䮔，馬小皃。从馬，垂聲。讀若箠。𩥗，籀文从𠂹。”', '27.E82A': '《說文》：“𩤠，馬和也。从馬，皆聲。”', '27.9A24': '《說文》：“騤，馬行威儀也。从馬，癸聲。《詩》曰：‘四牡騤騤。’”', '27.98BF': '《說文》：“䬚，馬疾步也。从馬，風聲。”', '27.9A16': '《說文》：“鶩，亂馳也。从馬，敄聲。”', '27.9A20': '《說文》：“騠，駃騠也。从馬，是聲。”', '27.9A23': '《說文新附》：“騣，馬鬣也。从馬，㚇聲。”', '27.9E92': '《說文》：“麒，仁獸也。麋身，牛尾，一角。从鹿，其聲。”', '27.9E94': '《說文》：“麔，麋牝者。从鹿，咎聲。”', '27.9EA0': '《說文》：“麠，大鹿也。牛尾，一角。从鹿，畺聲。麖，或从京。”', '27.9E91': '《說文》：“麑，狻麑獸也。从鹿，兒聲。”', '27.985E': '《說文》：“類，種類相似，唯犬為甚。从犬，頪聲。”', '27.737A': '《說文》：“獺，如小狗也，水居食魚。从犬，賴聲。”', '27.E86C': '《說文》：“䶅，鼠，出胡地，皮可作裘。从鼠，各聲。”', '27.E875': '《說文》：“𪕊，鼠，似雞，鼠尾。从鼠，此聲。”', '27.7207': '《說文》：“爇，燒也。从火，蓺聲。《春秋傳》曰：‘爇僖負覉。’”', '27.7206': '《說文》：“爆，灼也。从火，暴聲。”', '27.720D': '《說文新附》：“爍，灼爍，光也。从火，樂聲。”', '27.5135': '《說文》：“儵，青黑繒縫白色也。从黑，攸聲。”', '27.E8E8': '《說文》：“懬，闊也。一曰廣也，大也。一曰寬也。从心，从廣，廣亦聲。”', '27.61F7': '《說文》：“懷，念思也。从心，褱聲。”', '27.E90F': '《說文》：“㦣，㝱言不慧也。从心，衛聲。”', '27.E911': '《說文》：“𢤂，恨也。从心，黎聲。一曰怠也。”', '27.61F2': '《說文》：“懲，㣻也。从心，徵聲。”', '27.7019': '《說文》：“瀙，水。出南陽舞陽中陽山，入潁。从水，親聲。”', '27.7024': '《說文》：“瀤，北方水也。从水，褱聲。”', '27.7028': '《說文》：“瀨，水流沙上也。从水，賴聲。”', '27.E954': '《說文》：“㶇，水津也。从水，橫聲。一曰以船渡也。”', '27.7027': '《說文》：“瀧，雨瀧瀧皃。从水，龍聲。”', '27.E963': '《說文》：“瀞，無垢薉也。从水，靜聲。”', '27.701D': '《說文》：“瀝，浚也。从水，歷聲。一曰水下滴瀝。”', '27.E96D': '《說文》：“㶄，海岱之間謂相汙曰㶄。从水，閻聲。”', '27.7023': '《說文新附》：“瀣，沆瀣，气也。从水，䪥省聲。”', '27.7018': '《說文新附》：“瀘，水名。从水，盧聲。”', '27.701F': '《說文新附》：“瀟，水名。从水，蕭聲。”', '27.701B': '《說文新附》：“瀛，水名。从水，嬴聲。”', '27.7015': '《說文》：“瀕，水厓，人所賓附，頻蹙不前而止。从頁，从涉。”', '27.9729': '《說文》：“霩，雨止雲罷皃。从雨，郭聲。”', '27.E999': '《說文》：“𩅀，寒也。从雨，執聲。或曰早霜。讀若《春秋傳》‘墊阨’。”', '27.E99E': '《說文》：“䲊，魚子已生者。从魚，憜省聲。𩷷，籀文。”', '27.E9B1': '《說文》：“𩸄，鱧也。从魚，果聲。”', '27.9BE2': '《說文》：“鯢，刺魚也。从魚，兒聲。”', '27.E9BA': '《說文》：“䱤，魚名。从魚，臽聲。”', '27.9BEB': '《說文》：“鯫，白魚也。从魚，取聲。”', '27.9BDC': '《說文》：“鯜，魚名。出樂浪潘國。从魚，妾聲。”', '27.E9BF': '《說文》：“䱡，魚名，出樂浪潘國。从魚，匊聲。一曰䱡魚，出江東，有兩乳。”', '27.E9C3': '《說文》：“䲔，海大魚也。从魚，畺聲。《春秋傳》曰：‘取其䲔鯢。’鯨，䲔或从京。”', '27.9BE6': '《說文》：“鯦，當互也。从魚，咎聲。”', '27.9BDB': '《說文》：“鯛，骨耑脆也。从魚，周聲。”', '27.E9CA': '《說文》：“𩷹，烝然𩷹𩷹。从魚，卓聲。”', '27.9BD5': '《說文》：“鯕，魚名。从魚，其聲。”', '27.9761': '《說文》：“靡，披靡也。从非，麻聲。”', '27.95DB': '《說文》：“闛，闛闛，盛皃。从門，堂聲。”', '27.95DA': '《說文》：“闚，閃也。从門，規聲。”', '27.8078': '《說文》：“聸，垂耳也。从耳，詹聲。南方聸耳之國。”', '27.6510': '《說文》：“攐，摳衣也。从手，褰聲。”', '27.EA18': '《說文》：“攈，拾也。从手，麇聲。”', '27.650E': '《說文》：“攎，挐持也。从手，盧聲。”', '27.5B3F': '《說文》：“嬿，女字也。从女，燕聲。”', '27.EA45': '《說文》：“嬹，說也。从女，興聲。”', '27.5B3D': '《說文》：“嬽，好也。从女，𡚇聲。讀若蜀郡布名。”', '27.5B3E': '《說文》：“嬾，懈也，怠也，一曰卧也。仌女，賴聲。”', '27.7E79': '《說文》：“繹，抽絲也。从糸，睪聲。”', '27.EABD': '《說文》：“𦆀，偏緩也。从糸，羨聲。”', '27.7E6F': '《說文》：“繯，落也，从糸睘聲。”', '27.7E6A': '《說文》：“繪，會五采繡也。《虞書》曰：‘山龍華蟲作繪。’《論語》曰：‘繪事後素。’从糸，會聲。”', '27.7E70': '《說文》：“繰，帛如紺色，或曰深繒。从糸，喿聲。讀若喿。”', '27.7E69': '《說文》：“繩，索也。从糸，蠅省聲。”', '27.EAE4': '《說文》：“繮，馬紲也。从糸，畺聲。”', '27.7E73': '《說文》：“𦅾，生絲縷也。从糸，敫聲。”', '27.7E74': '《說文》：“繴，繴謂之罿，罿謂之罬，罬謂之罦，捕鳥覆車也。从糸，辟聲。”', '27.7E6B': '《說文》：“繫，繫𦃇也。一曰惡絮。从糸，𣪠聲。”', '27.87F7': '《說文》：“𧒾，𧒾蠰，不過也。从虫，當聲。”', '27.8803': '《說文》：“蠃，蜾蠃也。从虫，𦝠聲。一曰虒蝓。”', '27.8809': '《說文》：“蠉，蟲行也。从虫，瞏聲。”', '27.EB1C': '《說文》：“蠇，蚌屬。似螊微大，出海中，今民食之。从虫，萬聲。讀若賴。”', '27.87FA': '《說文》：“蟺，夗蟺也。从虫，亶聲。”', '27.87F9': '《說文》：“蠏，有二敖八足，旁行，非蛇鮮之穴無所態。从虫，解聲。”', '27.EB2E': '《說文》：“蠭，飛蟲螫人者。从䖵，逢聲。”', '27.EB43': '《說文》：“𪚪，龜名。从龜，夂聲。古文終字。”', '27.EB46': '《說文》：“鼃，蝦蟇也。从黽，圭聲。”', '27.8805': '《說文》：“蠅，營營青蠅，蟲之大腹者。从黽，从虫。”', '27.58DA': '《說文》：“壚，剛土也。从土，盧聲。”', '27.58DF': '《說文》：“壠，丘壠也。从土，龍聲。”', '27.EB8C': '《說文》：“䵌，赤黃也。一曰輕易人䵌姁也。从黃，夾聲。”', '27.93C8': '《說文》：“鏈，銅屬。从金，連聲。”', '27.93E4': '《說文》：“鏤，剛鐵可以刻鏤。从金，婁聲。《夏書》曰：‘梁州貢鏤。’一曰鏤，釜也。”', '27.93E1': '《說文》：“鏡，景也。从金，竟聲。”', '27.93CF': '《說文》：“鏏，鼎也。从金，彗聲。讀若彗。”', '27.93DF': '《說文》：“鏟，鏶也。一日平鐵。从金，產聲。”', '27.93C7': '《說文》：“鏇，圜鑪也。从金，旋聲。”', '27.93A9': '《說文》：“鎩，鈹有鐸也。从金，殺聲。”', '27.93E8': '《說文》：“鏨，小鑿也。从金，从斬，斬亦聲。”', '27.93DD': '《說文》：“鏝，鐵杇也。从金，曼聲。槾，鏝或从木。”', '27.93DE': '《說文》：“鏞，大鐘謂之鏞。从金，庸聲。”', '27.EBB7': '《說文》：“鏓，鎗鍯也。一曰大鑿平木者。从金，悤聲。”', '27.93DC': '《說文》：“鏜，鐘鼓之聲。从金，堂聲。《詩》曰：‘擊鼓其鏜。’”', '27.93CC': '《說文》：“鏌，鏌釾也。从金，莫聲。”', '27.93E2': '《說文》：“鏢，刀削末銅也。从金，㶾聲。”', '27.93D0': '《說文》：“鏐，弩眉也。一曰黃金之美者。从金，翏聲。”', '27.93D1': '《說文》：“鏑，矢鏠也。从金，啻聲。”', '27.EBBC': '《說文》：“𨫔，羊箠耑有鐵。从金，埶聲。讀若至。”', '27.93C3': '《說文》：“鏃，利也。从金，族聲。”', '27.EBBE': '《說文》：“𨫾，利也。从金，敕聲。”', '27.EBD5': '《說文》：“䡴，陷敶車也。从車，童聲。”', '27.8F50': '《說文》：“轐，車伏兔也。从車，菐聲。《周禮》曰：‘加軫與轐焉。’”', '27.8F51': '《說文》：“轑，葢弓也。一曰輻也。从車，尞聲。”', '27.8F52': '《說文》：“轒，淮陽名車穹隆轒。从車，賁聲。”', '27.8F4F': '《說文新附》：“轏，車名。从車，孱聲。”', '27.8F54': '《說文》：“轔，車聲。从車，粦聲。”', '27.96B4': '《說文》：“隴，天水大阪也。从𨸏，龍聲。”', '27.7378': '《說文》：“獸，守備者。从嘼，从犬。”', '27.5B7D': '《說文》：“孼，庶子也。从子，辥聲。”', '27.91B0': '《說文》：“醰，酒味苦也。从酉，覃聲。”', '27.EC39': '《說文》：“䤐，歃酒也。从酉，朁聲。”', '27.EC48': '《說文》：“䤎，𤖕也。从酉，矞聲。”', '27.74CF': '《說文》：“瓏，禱旱玉，龍文。从玉，从龍。龍亦聲。”', '27.85FF': '《說文》：“𧆑，尗之少也。从艸，靃聲。”', '27.8607': '《說文》：“蘇，桂荏也。从艸，穌聲。”', '27.E051': '《說文》：“䕬，禦溼之菜也。从艸，彊聲。”', '27.8606': '《說文》：“蘆，蘆菔也。一曰薺根。从艸，盧聲。”', '27.8604': '《說文》：“蘄，艸也。从艸，聲。江夏有蘄春亭。”', '27.85FA': '《說文》：“藺，莞屬。从艸，閵聲。”', '27.E076': '《說文》：“𧂀，茈艸也。从艸，䫉聲。”', '27.E085': '《說文》：“𧂄，䓿𧂄，芙蓉華未發為䓿𧂄，已發為芙蓉。从艸，閻聲。”', '27.8622': '《說文》：“蘢，天蘥也。从艸，龍聲。”', '27.8600': '《說文》：“蘀，艸木凡皮葉落，陊地為蘀。从艸，擇聲。《詩》曰：‘十月隕蘀。’”', '27.91CB': '《說文》：“釋，解也。从釆，釆，取其分別物也。从睪聲。”', '27.72A8': '《說文》：“犨，牛息聲。从牛，雔聲。一曰牛名。”', '27.56B3': '《說文》：“嚳，急告之甚也。从告，學省聲。”', '27.56B5': '《說文》：“嚵，小𠻜也。从口，毚聲。一日喙也。”', '27.56B6': '《說文》：“嚶，鳥鳴也。从口，嬰聲。”', '27.8DAE': '《說文》：“趮，疾也。从走，喿聲。”', '27.E113': '《說文》：“𧾍，趁也。从走，亶聲。”', '27.E118': '《說文》：“䟉，行皃。从走，蜀聲。讀若燭。”', '27.E11F': '《說文》：“䟈，走也。从走，𢧜聲。讀若《詩》：‘威儀秩秩。’”', '27.E12B': '《說文》：“𧾎，疾也。从走，睘聲。讀若讙。”', '27.908D': '《說文》：“邍，高平之野。人所登，从辵、备、彔，闕。”', '27.E18B': '《說文新附》：“𨘷，遠也。从辵，䫉聲。”', '27.9F5E': '《說文》：“齞，口張齒見。从齒，只聲。”', '27.E1A6': '《說文》：“䶙，齗腫也。从齒，巨聲。”', '27.E1A7': '《說文》：“𪗨，齚齒也。从齒，出聲。”', '27.9F70': '《說文》：“齰，齧也。从齒，昔聲。齚，齰或从乍。”', '27.9F5D': '《說文》：“齝，吐而噍也。从齒，台聲。《爾雅》曰：‘牛曰齝。’”', '27.9F5B': '《說文》：“齛，羊粻也。从齒，世聲。”', '27.9F61': '《說文新附》：“齡，年也。从齒，令聲。”', '27.8E85': '《說文》：“躅，蹢躅也。从足，蜀聲。”', '27.E1E7': '《說文》：“譍，以言對也。从言，𨿳聲。”', '27.8B6C': '《說文》：“譬，諭也。从言，辟聲。”', '27.8B70': '《說文》：“議，語也。从言，義聲。”', '27.8B63': '《說文》：“譣，問也。从言，僉聲。《周書》曰：‘勿以譣人。’”', '27.85F9': '《說文》：“藹，臣盡力之美，从言葛聲。《詩》曰：‘譪譪王多吉士。’”', '27.8B66': '《說文》：“警，戒也。从言，从敬，敬亦聲。”', '27.E1F7': '《說文》：“𧭴，慧也。从言，瞏聲。”', '27.8B65': '《說文》：“譥，痛呼也。从言，敫聲。”', '27.E1FF': '《說文》：“𧬮，相誤也。从言，𥈀聲。”', '27.E20F': '《說文》：“䜕，譀也。从言，萬聲。”', '27.E212': '《說文》：“𧬨，聲也。从言，歲聲。《詩》曰：‘有𧬨其聲。’”', '27.8B5F': '《說文》：“譟，擾也。从言，喿聲。”', '27.8B6F': '《說文》：“譯，傳譯四夷之言者。从言，睪聲。”', '27.97FD': '《說文》：“韽，下徹聲。从音，酓聲。”', '27.97B9': '《說文》：“鞹，去毛皮也。《論語》曰：‘虎豹之鞹。’从革，郭聲。”', '27.E249': '《說文》：“𩌦，鞮屬。从革，徙聲。”', '27.7FFF': '《說文》：“𦒇，翳也。所以舞也。从羽，𣪐聲。《詩》曰：‘左執翿。’”', '27.E32B': '《說文》：“𣀧，繳𣀧也。从隹，𢽳聲。一曰飛𣀧也。”', '27.77CD': '《說文》：“矍，隹欲逸走也。从又，持之矍矍也。讀若《詩》云：‘穬彼淮夷之穬。’一曰視遽貌。”', '27.9DEB': '《說文》：“鷫，鷫鷞也。五方神鳥也。東方發明，南方焦明，西方鷫鷞，北方幽昌，中央鳳皇。从鳥，肅聲。𪂸，司馬相如說从叜聲。”', '27.9DA4': '《說文》：“鶤，鶤鷄也。从鳥，軍聲。讀若運。”', '27.E345': '《說文》：“𪃐，𪆄𪃐也。从鳥，眇聲。”', '27.9DA8': '《說文》：“鶨，欺老也。从鳥，彖聲。”', '27.9DA0': '《說文》：“鳥也，其雌皇。从鳥，匽聲。一曰鳳皇也。”', '27.9DA9': '《說文》：“鶩，舒鳧也。从鳥，敄聲。”', '27.E350': '《說文》：“𪃈，𪃈𪇷，鳧屬。从鳥，契聲。”', '27.9E1E': '《說文》：“鸞，亦神靈之精也。赤色，五采，雞形，鳴中五音，頌聲作則至。从鳥，䜌聲。周成王時氐羌獻鸞鳥。”', '27.9DA1': '《說文》：“鶡，似雉，出上黨。从鳥，曷聲。”', '27.9AC6': '《說文》：“髆，肩甲也。从骨，尃聲。”', '27.89F8': '《說文》：“觸，抵也。从角，蜀聲。”', '27.89F7': '《說文》：“觷，治角也。从角，學省聲。”', '27.E3E2': '《說文》：“䚫，更耑角也。从角，敫聲。”', '27.89FC': '《說文》：“觼，環之有舌者。从角，敻聲。鐍，觼或从金、矞。”', '27.7C4D': '《說文》：“籍，簿書也。从竹，耤聲。”', '27.E40B': '《說文》：“籋，箝也。从竹，爾聲。”', '27.7C4C': '《說文》：“籌，壺矢也。从竹，壽聲。”', '27.E43C': '《說文》：“豑，爵之次弟也。从豊，从弟。《虞書》曰：‘平豑東作。’”', '27.E44C': '《說文》：“䖜，兩虎爭聲。从虤，从曰。讀若憖。”', '27.E470': '《說文》：“饊，熬稻粻䅣也。从食，散聲。”', '27.E474': '《說文》：“䉵，具食也。从食，算聲。饌，䉵或从巽。”', '27.994B': '《說文》：“饋，餉也。从食，貴聲。”', '27.9952': '《說文》：“饒，飽也。从食，堯聲。”', '27.9950': '《說文》：“饐，飯傷溼也。从食，壹聲。”', '27.9951': '《說文》：“饑，穀不孰為饑。从食，幾聲。”', '27.E48E': '《說文》：“䢈，日月合宿从（為）辰。从會，从辰，辰亦聲。”', '27.7F4C': '《說文》：“罌，缶也。从缶，賏聲。”', '27.E4A0': '《說文》：“𩫠，缺也，古者城闕其南方謂之𩫠。从𩫏，缺省。”', '27.7AF7': '《說文》：“竷，繇也，舞也。樂有章，从章，从夅，从夊。《詩》曰：‘竷竷舞我’。”', '27.E4BD': '《說文》：“韠，韍也。所以蔽前，以韋，下廣二尺，上廣一尺，其頸五寸。一命緼韠，再命赤韠。从韋，畢聲。”', '27.E4DF': '《說文》：“㰋，木也。从木，頻聲。”', '27.E4E1': '《說文》：“𣟌，木也。从木，隷聲。”', '27.6AE8': '《說文》：“櫨，柱上柎也。从木，盧聲。”', '27.E505': '《說文》：“㰍，房室之疏也，从木，龍聲。”', '27.E507': '《說文》：“𣟄，夜行所擊者。从木，橐聲。《易》曰：‘重門擊𣟄。’”', '27.6AEA': '《說文》：“櫪，櫪㯕，椑指也。从木，歷聲。”', '27.6AF3': '《說文》：“櫳，檻也。从木，龍聲。”', '27.6AEC': '《說文》：“櫬，棺也。从木，親聲。”', '27.E54A': '《說文》：“贎，貨也。从貝，萬聲。”', '27.8D0F': '《說文》：“贏，有餘賈利也。从貝，𦝠聲。”', '27.E551': '《說文新附》：“𧸖，重買也，錯也。从貝，廉聲。”', '27.8D0D': '《說文新附》：“贍，給也。从貝，詹聲。”', '27.E56A': '《說文》：“𨟚，今南陽穰縣是。从邑，襄聲。”', '27.9143': '《說文》：“酃，長沙縣。从邑，霝聲。”', '27.9141': '《說文》：“酁，宋地也。从吧，毚聲，讀若讒。”', '27.E587': '《說文》：“𨟙，地名。从邑，嬰聲。”', '27.66E3': '《說文》：“㬫，星無雲也。从日，燕聲。”', '27.66E8': '《說文新附》：“曨，曈曨也。从日，龍聲。”', '27.65DF': '《說文》：“旟，錯革畫鳥其上，所以進士眾。旟旟，眾也。从㫃，與聲。”', '27.6727': '《說文新附》：“朧，朦朧也。从月，龍聲。”', '27.E5CB': '《說文》：“𥣫，禾也。从禾，蔑聲。”', '27.7A6C': '《說文》：“穬，芒粟也。从禾，廣聲。”', '27.7A6E': '《說文》：“穮，耕禾閒也。从禾，麃聲。《春秋傳》曰：‘是穮是袞’。”', '27.E5EE': '《說文》：“𪐄，黍屬。从黍，卑聲。”', '27.99A8': '《說文》：“馨，香之遠聞者。从香、殸聲。殸，籀文磬。”', '27.F0C6': '《說文》：“䊮，穀也。从米，翟聲。”', '27.E608': '《說文》：“䵈，未練治纑也。从麻，後聲。”', '27.E609': '《說文》：“𪎨，檾屬。从麻，俞聲。”', '27.7AC7': '《說文》：“竇，空也。从穴，瀆省聲。”', '27.E68F': '《說文》：“㡨，拭也。从巾，韱聲。”', '27.E6A3': '《說文》：“𪓌，會五彩繒色。从黹，綷省聲。”', '27.E6B2': '《說文》：“㒤，心服也。从人，聶聲。”', '27.8964': '《說文》：“襤，裯謂之襤。褸，襤，無緣也。从衣，監聲。”', '27.8966': '《說文》：“襦，短衣也。从衣，需聲。一曰㬮衣。”', '27.E6F2': '《說文》：“𪗋，緶也。从衣，齊聲。”', '27.E700': '《說文》：“䩁，毛紛紛也。从毳，非聲。”', '27.89B9': '《說文》：“覹，司也。从見，微聲。”', '27.89BA': '《說文》：“覺，寤也。从見，學省聲。一曰發也。”', '27.E764': '《說文》：“𩕀，𩕀顤，高也。从頁，敖聲。”', '27.EDEE': '《說文》：“顡，癡不聦明也。从頁，豙聲。”', '27.E788': '《說文》：“𩔹，須髮半白也。从須，卑聲。”', '27.E790': '《說文》：“䰈，髮好也。从髟、差。”', '27.9B11': '《說文》：“鬑，鬋也。一曰長皃。从髟，兼聲。讀若慊。”', '27.E799': '《說文》：“䰉，臥結也。从髟，般聲。讀若槃。”', '27.E7A2': '《說文》：“𩮜，鬀髮也。从髟，从刀，易聲。”', '27.9B10': '《說文新附》：“鬐，馬鬣也。从髟，耆聲。”', '27.5EEE': '《說文》：“廮，安止也。从广，嬰聲。鉅鹿有廮陶縣。”', '27.792B': '《說文》：“礫，小石也。从石，樂聲。”', '27.792A': '《說文新附》：“礪，䃺也。从石，厲聲。”', '27.7929': '《說文新附》：“礩，柱下石也。从石，質聲。”', '27.9A2D': '《說文》：“騭，牡馬也。从馬，陟聲。讀若郅。”', '27.9A29': '《說文》：“騩，馬淺黑色。从馬，鬼聲。”', '27.9A2E': '《說文》：“驑，赤馬黑毛尾也。从馬，畱聲。”', '27.E820': '《說文》：“䮧，馬毛長也。从馬，倝聲。”', '27.E82D': '《說文》：“𩥅，馬行皃。从馬，舀聲。”', '27.9A2B': '《說文》：“騫，馬腹縶也。从馬，寒省聲。”', '27.9A2C': '《說文》：“騬，犗馬也。从馬，乘聲。”', '27.9A37': '《說文》：“騷，擾也。一曰摩馬。从馬，蚤聲。”', '27.9A36': '《說文》：“騶，廏御也。从馬，芻聲。”', '27.9A30': '《說文》：“騰，傳也。从馬，朕聲。一曰：騰，犗馬也。”', '27.E835': '《說文》：“䮤，苑名。一曰馬白頟。从馬，隺聲。”', '27.E838': '《說文》：“𩥃，驢子也，从馬冡聲。”', '27.9A31': '《說文》：“騱，驒騱馬也。从馬，奚聲。”', '27.E83A': '《說文新附》：“𩥍，馬赤色也。从馬，觲省聲。”', '27.E83B': '《說文》：“𡦴，解𢊁屬。从𢊁，𡥈聲。闕。”', '27.9E9A': '《說文》：“麚，牡鹿也。从鹿，叚聲。以夏至解角。”', '27.E83D': '《說文》：“𪋐，鹿麛也。从鹿，耎聲。讀若偄弱之偄。”', '27.9E9B': '《說文》：“麛，鹿子也。从鹿，弭聲。”', '27.9E99': '《說文》：“麙，山羊而大者，細角。从鹿，咸聲。”', '27.737B': '《說文》：“獻，宗廟犬名羹獻，犬肥者以獻之。从犬，鬳聲。”', '27.E87A': '《說文》：“𤒓，熚𤒓也。”', '27.F107': '《說文》：“𪚰，灼龜不兆也。从火，从龜。《春秋傳》曰：‘龜𪚰不兆。’讀若焦。”', '27.E893': '《說文》：“爗，盛也。从火，𣊚聲。《詩》曰：‘爗爗震電。’”', '27.7213': '《說文》：“爓，火門也。从火，閻聲。”', '27.9EE4': '《說文》：“黤，青黑也。从黑，奄聲。”', '27.E8A2': '《說文》：“𪑙，黃黑也。从黑，金聲。”', '27.9EE8': '《說文》：“黨，不鮮也。从黑，尚聲。”', '27.E8A8': '《說文》：“𪑝，羔裘之縫。从黑，或聲。”', '27.E8A9': '《說文》：“𪑩，𪑩謂之垽。垽，滓也。从黑，殿省聲。”', '27.E8AD': '《說文》：“㸋，宗廟火孰肉。从炙，番聲。《春秋傳》曰：‘天子有事㸋焉，以饋同族諸矦。’”', '27.E8AE': '《說文》：“爒，炙也。从火，尞聲。讀若𪚰燎。”', '27.61FF': '《說文》：“懿，專久而美也，从壹，从恣省聲。”', '27.E8E1': '《說文》：“𢤧，美也。从心，䫉聲。”', '27.7037': '《說文》：“瀷，水。出河南密縣，東入潁。从水，翼聲。”', '27.E941': '《說文》：“𤃷，水大至也。从水，闇聲。”', '27.E945': '《說文》：“𤃴，礙流也。从水，薉聲。《詩》云：‘施罟𤃴𤃴。’”', '27.7042': '《說文》：“灂，水小聲。从水，爵聲。”', '27.7031': '《說文》：“瀱，井一有水一無水謂之瀱汋。从水，罽聲。”', '27.7033': '《說文》：“瀳，水至也。从水，薦聲。讀若尊。”', '27.7038': '《說文》：“瀸，漬也。从水，韱聲。《爾雅》曰：‘泉一見一否為瀸。’”', '27.E94C': '《說文》：“瀶，谷也。从水，臨聲。讀若林。一曰寒也。”', '27.7035': '《說文》：“瀵，水浸也。从水，糞聲。《爾雅》曰：‘瀵，大出尾下。’”', '27.7039': '《說文》：“瀹，漬也。从水，龠聲。”', '27.E966': '《說文》：“𤃭，釃酒也。一曰浚也。从网，从水，焦聲。讀若《夏書》‘天用勦絕。’”', '27.703C': '《說文新附》：“瀼，露濃皃。从水，襄聲。”', '27.E98F': '《說文》：“𩅧，小雨也。从雨，眾聲。《明堂月令》曰𩅧雨。”', '27.E9A2': '《說文》：“䱬，魚也。从魚，胥聲。”', '27.E9A3': '《說文》：“䱭，𩶶。《周禮》謂之䱭。从魚，恆聲。”', '27.E9A9': '《說文》：“鯾，魚名。从魚，便聲。鯿，鯾又从扁。”', '27.E9B3': '《說文》：“鰌，鰼也。从魚，酋聲。”', '27.9C05': '《說文》：“鰅，魚名。皮有文。出樂浪、東暆。神爵四年初，捕收輪考工。周成王時，揚州獻鰅。从魚，禺聲。”', '27.9C12': '《說文》：“鰒，海魚名。从魚，复聲。”', '27.E9C7': '《說文》：“鰕，魵也。从魚，叚聲。”', '27.9BF8': '《說文》：“鯸，魚名。从魚，侯聲。”', '27.9C08': '《說文新附》：“鰈，比目魚也。从魚，枼聲。”', '27.9E79': '《說文》：“鹹，銜也。北方味也。从鹵，咸聲。”', '27.95E0': '《說文》：“闠，市外門也。从門，貴聲。”', '27.95E1': '《說文》：“闡，開也。从門，單聲。《易》曰：‘闡幽。’”', '27.E9E6': '《說文》：“䦳，門響也。从門，鄉聲。”', '27.95DE': '《說文》：“闞，望也。从門，敢聲。”', '27.6515': '《說文》：“攕，好手皃。《詩》曰：‘攕攕女手。’从手，韱聲。”', '27.6518': '《說文》：“攘，推也。从手，襄聲。”', '27.6519': '《說文新附》：“攙，刺也。从手，毚聲。”', '27.EA3F': '《說文》：“孁，女字也。从女，霝聲。”', '27.5B45': '《說文》：“孅，銳細也。从女，韱聲。”', '27.EA4D': '《說文》：“孂，竦身也。从女，簋聲。讀若《詩》‘糾糾葛屨’。”', '27.5B43': '《說文》：“孃，煩擾也。一曰肥大也。从女，襄聲。”', '27.76ED': '《說文》：“盭，𢐀戾也。从弦省，从盩。讀若戾。”', '27.7E7C': '《說文》：“繼，續也。从糸、㡭。一曰反𢇍為繼。”', '27.8FAE': '《說文》：“辮，交也。从糸，辡聲。”', '27.7E81': '《說文》：“纁，淺絳也。从糸，熏聲。”', '27.7E7B': '《說文》：“繻，繒采色。从糸，需聲。讀若《易》：‘繻有衣’。”', '27.7E82': '《說文》：“纂，似組而赤。从糸，算聲。”', '27.7E80': '《說文》：“纀，裳削幅謂之纀。从糸，僕聲。”', '27.7E7E': '《說文新附》：“繾，繾綣，不相離也。从糸，遣聲。”', '27.8810': '《說文》：“𧓉，𧓉䘍也。从虫，齊聲。”', '27.8816': '《說文》：“蠖，尺蠖，屈申蟲。从虫，蒦聲。”', '27.8813': '《說文》：“蠓，蠛蠓也。从虫，蒙聲。”', '27.8817': '《說文》：“蠗，禺屬。从虫，翟聲。”', '27.98C4': '《說文》：“飄，回風也。从風，䙳聲。”', '27.98C2': '《說文》：“飂，高風也。从風，翏聲。”', '27.EB44': '《說文》：“𪚮，龜甲邊也。从龜，冄聲。天子巨𪚮尺有二寸，諸侯尺，大夫八寸，士六寸。”', '27.58E4': '《說文》：“壤，柔土也。从土，襄聲。”', '27.52F8': '《說文》：“勸，勉也。从力，雚聲。”', '27.9410': '《說文》：“鐐，白金也。从金，尞聲。”', '27.943C': '《說文》：“鐼，鐵屬。从金，賁聲。讀若熏。”', '27.EBA6': '《說文》：“鐈，似鼎而長足。从金，喬聲。”', '27.9406': '《說文》：“䥙，陽䥙也。从金，隊聲。”', '27.940E': '《說文》：“鐎，鐎斗也。从金，焦聲。”', '27.9419': '《說文》：“鐙，錠也。从金，登聲。”', '27.EBB0': '《說文》：“鐅，河內謂臿頭金也。从金，敝聲。”', '27.EBB1': '《說文》：“𨬍，鈐𨬍也。从金，隋聲。”', '27.93FA': '《說文》：“鏺，兩刃，木柄，可以刈艸。从金，發聲。讀若撥。”', '27.9415': '《說文》：“鐕，可以綴著物者。从金，朁聲。”', '27.9403': '《說文》：“鐃，小鉦也。軍法：卒長執鐃。从金，堯聲。”', '27.9414': '《說文》：“鐔，劍鼻也。从金，覃聲。”', '27.940F': '《說文》：“鐏，柲下銅也。从金，尊聲。”', '27.EBBA': '《說文》：“鐗，車軸鐵也。从金，閒聲。”', '27.940A': '《說文》：“鐊，馬頭飾也。从金，陽聲。”', '27.9409': '《說文》：“鐉，所以鉤門戶樞也。一曰治門戶器也。从金，巽聲。”', '27.9413': '《說文》：“鐜，下垂也。一曰千斤椎。从金，敦聲。”', '27.8F56': '《說文》：“轖，車籍交錯也。从車，嗇聲。”', '27.8F59': '《說文》：“轙，車衡載轡者。从車，義聲。钀，轙或从金、从獻。”', '27.8F5A': '《說文》：“轚，車轄相擊也。从車，从毄，毄亦聲。《周禮》曰：‘舟輿擊互者。’”', '27.8F58': '《說文》：“轘，車裂人也。从車，睘聲。《春秋傳》曰：‘轘諸栗門。’”', '27.EC13': '《說文》：“𨼱，𨸏䆕也。从𨺅，決省聲。”', '27.91B4': '《說文》：“醴，酒一宿孰也。从酉，豊聲。”', '27.91B2': '《說文》：“醲，厚酒也。从酉，農聲。”', '27.EC41': '《說文》：“醶，酢𤖅也。从酉，僉聲。”', '27.E035': '《說文》：“𤫉，石之次玉者。从玉，燮聲。”', '27.E043': '《說文》：“𩆜，靈巫，以玉事神。从玉，霝聲。靈，𤫊或从巫。”', '27.8627': '《說文》：“蘧，蘧麥也。从艸，遽聲。”', '27.8618': '《說文》：“蘘，蘘荷也。一名葍蒩。从艸，襄聲。”', '27.862D': '《說文》：“蘭，香艸也。从艸，闌聲。”', '27.862A': '《說文》：“蘪，蘪蕪也。从艸，麋聲。”', '27.E06D': '《說文》：“𧃱，牂𧃱，可以作縻綆。从艸，𤕦聲。”', '27.8625': '《說文》：“蘥，爵麥也。从艸，龠聲。”', '27.861C': '《說文》：“蘜，治牆也。从艸，鞠聲。”', '27.8620': '《說文》：“蘠，蘠靡，虋冬也。从艸，牆聲。”', '27.E08C': '《說文》：“𧃣，艸也。从艸，𥊽聲。”', '27.8626': '《說文》：“蘦，大苦也。从艸，霝聲。”', '27.72A7': '《說文》：“犧，宗廟之牲也。从牛，羲聲。賈侍中說，此非古字。”', '27.8DAF': '《說文》：“趯，踊也。从走，翟聲。”', '27.E11A': '《說文》：“𧾝，走皃。从走，㕡聲。讀若紃。”', '27.E126': '《說文》：“𧾚，安行也。从走，與聲。”', '27.E18F': '《說文》：“忂，行皃。从彳，瞿聲。”', '27.9F5C': '《說文》：“齜，齒相齗也。一曰開口見齒之皃。从齒，柴省聲。讀若柴。”', '27.9F64': '《說文》：“齤，缺齒也。一曰曲齒。从齒，𢍏聲。讀若權。”', '27.9F66': '《說文》：“齦，齧也。从齒，艮聲。”', '27.E1AC': '《說文》：“𪗿，齒分骨聲。从齒，列聲，讀若剌。”', '27.E1AD': '《說文》：“齩，齧骨也。从齒，交聲。”', '27.E1AF': '《說文》：“𪗾，齒堅聲。从齒，吉聲。”', '27.9F67': '《說文》：“齧，噬也。从齒，㓞聲。”', '27.E1B3': '《說文》：“齨，老人齒，如臼也。一曰馬八歲齒臼也。从齒，从臼，臼亦聲。”', '27.E1B4': '《說文》：“𪗻，齒堅也。从齒，至聲。”', '27.E1B6': '《說文》：“𪗽，噍聲。从齒，𠯑聲。”', '27.8E96': '《說文》：“䠪，踐處也。从足，斷省聲。”', '27.8E8B': '《說文》：“躋，登也。从足，齊聲。《商書》曰：‘予顛躋。’”', '27.8E8D': '《說文》：“躍，迅也。从足，翟聲。”', '27.8B7B': '《說文》：“譻，聲也。从言，賏聲。”', '27.8B77': '《說文》：“護，救視也。从言，蒦聲。”', '27.8B7D': '《說文》：“譽，也。从言，與聲。”', '27.8B7A': '《說文》：“譺，騃也。从言，疑聲。”', '27.8B78': '《說文》：“譸，詶也。从言，壽聲。讀若醻。《周書》曰：‘無或醻張為幻。’”', '27.E206': '《說文》：“䜚，語相反䜚也。从言，遝聲。”', '27.8B74': '《說文》：“譴，謫問也。从言，遣聲。”', '27.E224': '《說文》：“𧭅，責望也。从言，望聲。”', '27.EDFE': '《說文》：“譶，疾言也。从三言。讀若沓。”', '27.97FF': '《說文》：“響，聲也。从音，鄉聲。”', '27.E245': '《說文》：“鞼，韋繡也。从革，貴聲。”', '27.E266': '《說文新附》：“鞾，鞮屬。从革，華聲。”', '27.E26A': '《說文》：“鬹，三足釜也，有柄、喙。讀若媯。从鬲，規聲。”', '27.E275': '《說文》：“𩱍，䭈也。从𩰲，古聲。”', '27.E285': '《說文》：“䰘，經繆殺也。从鬥，翏聲。”', '27.E288': '《說文》：“𩰗，鬭也。从鬥，賓省聲。讀若賓。”', '27.E2E0': '《說文》：“𥌭，盧童子也。从目，縣聲。”', '27.E32D': '《說文》：“𩁌，飛也。从隹，隓聲。”', '27.7FBC': '《說文》：“羼，羊相厠也。从羴在尸下。尸，屋也。一曰相出前也。”', '27.9DBB': '《說文》：“鶻，鶻鵃也。从鳥，骨聲。”', '27.9DFD': '《說文》：“鷽，雗鷽，山鵲，知來事鳥也。从鳥，學省聲。雤，鷽或从隹。”', '27.E33F': '《說文》：“䳳，鳥也。从鳥，祟聲。”', '27.9DB9': '《說文》：“𪅳，鳥少美長醜為𪅳離。从鳥，畱聲。”', '27.9DB4': '《說文》：“鶴，鳴九臯，聲聞于天。从鳥，隺聲。”', '27.9DC8': '《說文》：“鷈，鸊鷈也。从鳥，虒聲。”', '27.9DC2': '《說文》：“鷂，鷙鳥也。从鳥，䍃聲。”', '27.9DAF': '《說文》：“鶯，鳥也。从鳥，榮省聲。《詩》曰：‘有鶯其羽。’”', '27.9DBE': '《說文》：“鶾，雉肥鶾音者也。从鳥，倝聲。魯郊以丹雞祝曰：‘以斯鶾音赤羽，去魯侯之咎。’”', '27.9DC7': '《說文》：“鷇，鳥子生哺者。从鳥，𣪊聲。”', '27.9DB1': '《說文》：“鶱，飛皃。从鳥，寒省聲。”', '27.6BB2': '《說文》：“殲，微盡也。从歺，韱聲。《春秋傳》曰：‘齊人殲于遂’。”', '27.9ACF': '《說文》：“髏，髑髏也。从骨，婁聲。”', '27.9ACD': '《說文》：“髍，㾫病也。从骨，麻聲。”', '27.E395': '《說文》：“䑋，益州鄙言人盛，諱其肥，謂之䑋。从肉，襄聲。”', '27.E3F0': '《說文》：“䉧，竹聲也。从竹，劉聲。”', '27.7C53': '《說文》：“籓，大箕也。从竹，潘聲。一曰蔽也。”', '27.7C54': '《說文》：“籔，炊䉛也。从竹，數聲。”', '27.E41D': '《說文》：“顨，巽也。从丌，从𩔊。此《易》‘顨卦為長女為風’者。”', '27.9F1B': '《說文》：“鼛，大鼓也。从鼓，咎聲。《詩》曰：‘鼛鼓不勝。’”', '27.9F19': '《說文》：“鼙，騎鼓也。从鼓，卑聲。”', '27.9F18': '《說文》：“鼘，鼓聲也。从鼓，𣶒聲。《詩》曰：‘鼗鼓鼘鼘’。”', '27.E444': '《說文》：“𧈖，虎聲也。从虎，𣪠聲。讀若隔。”', '27.884A': '《說文》：“衊，污血也。从血，蔑聲。”', '27.9958': '《說文》：“饘，糜也。从食，亶聲。周謂之饘，宋謂之餬。”', '27.9957': '《說文》：“饗，鄉人飲酒也。从食，从鄉，鄉亦聲。”', '27.9956': '《說文》：“饖，飯傷熱也。从食，歲聲。”', '27.E48D': '《說文》：“朇，益也。从會，卑聲。”', '27.E4B0': '《說文》：“䵀，小麥屑之覈。从麥，𧴪聲。”', '27.E4B1': '《說文》：“䴾，䃺麥也。从麥，差聲。一曰擣也。”', '27.E4B5': '《說文》：“𪍠，餅𥶶也。从麥，𣪊聲。讀若庫。”', '27.5914': '《說文》：“夔，神魖也。如龍，一足，从夊，象有角、手、人面之形。”', '27.E4BE': '《說文》：“韢，櫜紐也。从韋，惠聲。一曰盛虜頭橐也。”', '27.E4EA': '《說文》：“𣟳，𣟳味，稔棗。从木，還聲。”', '27.E4EF': '《說文》：“櫾，崐崘河隅之長木也。从木，繇聲。”', '27.6AFA': '《說文》：“櫺，楯間子也。从木，霝聲。”', '27.6AFC': '《說文》：“櫼，楔也。从木，韱聲。”', '27.6AFB': '《說文新附》：“櫻，果也。从木，嬰聲。”', '27.97E1': '《說文》：“𩏬，盛也。从𠌶，韋聲。《詩》曰：‘萼不𩏬𩏬。’”', '27.E540': '《說文》：“䰍，桼也，从桼髟聲。”', '27.9F4E': '《說文》：“齎，持遺也。从貝，齊聲。”', '27.9146': '《說文》：“酆，周文王所都，在京兆杜陵西南。从邑，豐聲。”', '27.9144': '《說文》：“酄，魯下邑。从邑，雚聲。《春秋傳》：曰‘齊人來歸酄。’”', '27.9145': '《說文》：“酅，東海之邑。从邑，巂聲。”', '27.66E9': '《說文》：“曩，曏也。从日，襄聲。”', '27.E5F3': '《說文》：“䵗，治黍、禾、豆下潰葉。从黍，畐聲。”', '27.F098': '《說文》：“𥽘，麩也。从米，蔑聲。”', '27.E60B': '《說文》：“𩐌，齏也。从韭，隊聲。”', '27.E60D': '《說文》：“䪤，小蒜也。从韭，番聲。”', '27.E616': '《說文》：“寷，大屋也。从宀，豐聲。”', '27.F3A9': '《說文》：“㝱，寐而有覺也。从宀，从疒，夢聲。”', '27.E63E': '《說文》：“𡫽，楚人謂寐曰𡫽。从㝱省，女聲。”', '27.513A': '《說文》：“儺，行人節也。从人，難聲。”', '27.5139': '《說文》：“儹，最也。从人，贊聲。”', '27.5137': '《說文》：“儷，棽儷也。从人，麗聲。”', '27.896E': '《說文》：“𧟊，黼領也。从衣，㬥聲。《詩》曰：‘素衣朱𧟊。’”', '27.8971': '《說文》：“襱，絝踦也。从衣，龍聲。襩，襱或从賣。”', '27.E6EA': '《說文》：“𧞐，衣至地也。从衣，斲聲。”', '27.5C6C': '《說文》：“屬，連也。从尾，蜀聲。”', '27.89BD': '《說文》：“覽，觀也。从見、監，監亦聲。”', '27.E721': '《說文》：“䚔，暫見也。从見，賓聲。”', '27.9864': '《說文》：“顤，高長頭。从頁。堯聲。”', '27.9867': '《說文》：“顧，還視也。从頁，雇聲。”', '27.E76F': '《說文》：“䫰，䪾䫰也。从頁，粦聲。一曰頭少髮。”', '27.E771': '《說文》：“𩕊，倨視人也。从頁，善聲。”', '27.9865': '《說文》：“顥，白皃。从頁，从景。《楚詞》曰：‘天白顥顥’，南山四顥，白首人也。”', '27.E77C': '《說文》：“顦，顦顇也。从頁，焦聲。”', '27.E783': '《說文》：“䩌，面焦枯小也。从面、焦。”', '27.9B17': '《說文》：“鬗，髮長也。从髟，㒼聲。讀若蔓。”', '27.9B15': '《說文》：“鬕，帶結飾也。从髟，莫聲。”', '27.E7C0': '《說文》：“𩴓，見鬼驚詞。从鬼，難省聲。讀若《詩》‘受福不儺’。”', '27.9B51': '《說文新附》：“魑，鬼屬。从鬼，从离。离亦聲。”', '27.9B54': '《說文新附》：“魔，鬼也。从鬼，麻聲。”', '27.5DCD': '《說文》：“巍，高也。从嵬，委聲。”', '27.5EF1': '《說文》：“廱，天子鄉飲辟廱。从广，雝聲。”', '27.7931': '《說文》：“礱，䃺也。从石，龍聲。天子之桷椓而礱之。”', '27.F0F6': '《說文》：“镾，久長也。从長，爾聲。”', '27.9A44': '《說文》：“驄，馬青白雜毛也。从馬，悤聲。”', '27.9A43': '《說文》：“驃，黃馬發白色。一曰白髦尾也。从馬，𤐫聲。”', '27.9A3D': '《說文》：“騽，馬豪骭也。从馬，習聲。”', '27.9A41': '《說文》：“䮯，駿馬，以壬申日死乘馬忌之，从馬敖聲。”', '27.9A40': '《說文》：“驀，上馬也。从馬，莫聲。”', '27.9A42': '《說文》：“驂，駕三馬也。从馬，參聲。”', '27.9A3A': '《說文》：“騺，馬重皃。从馬，執聲。”', '27.E842': '《說文》：“麞，麋屬。从鹿，章聲。”', '27.9E9D': '《說文》：“𪋧，如小麋，臍有香。从鹿，䠶聲。”', '27.721A': '《說文》：“爚，火飛也。从火，龠聲。一曰𤑔也。”', '27.721D': '《說文》：“爝，苣火祓也。从火，爵聲。呂不韋曰：‘湯得伊尹，爝以爟火，釁以犧豭。’”', '27.9EEF': '《說文》：“黯，深黑也。从黑，音聲。”', '27.E8A0': '《說文》：“䵮，赤黑也。从黑，昜聲。讀若煬。”', '27.9EEE': '《說文》：“黮，桑葚之黑也。从黑，甚聲。”', '27.9EED': '《說文》：“黭，果實黭黯，黑也。从黑，弇聲。”', '27.61FD': '《說文》：“懽，喜㱁也。从心，雚聲。《爾雅》曰：‘懽懽愮愮，憂無告也。’”', '27.E90B': '《說文》：“𢥘，有二心也。从心，巂聲。”', '27.61FE': '《說文》：“懾，失气也。从心，聶聲。一曰服也。”', '27.704A': '《說文》：“灊，水。出巴郡宕渠，西南入江。从水，鬵聲。”', '27.704C': '《說文》：“灌，水。出廬江雩婁，北入淮。从水，雚聲。”', '27.7048': '《說文》：“灈，水。出汝南吳房入瀙。从水，瞿聲。”', '27.7045': '《說文》：“灅，水。出右北平浚靡，東南入庚。从水，壘聲。”', '27.E946': '《說文》：“𤄫，大波也。从水，旛聲。”', '27.E964': '《說文》：“𤄒，淅也。从水，𥳑聲。”', '27.E976': '《說文》：“㶗，泉水也。从泉，䋣聲。讀若飯。”', '27.E996': '《說文》：“𩅼，小雨也。从雨，僉聲。”', '27.9732': '《說文》：“露，潤澤也。从雨，路聲。”', '27.E9A0': '《說文》：“𩹾，魚，似鼈，無甲，有尾，無足，口在腹下。从魚，納聲。”', '27.9C28': '《說文》：“鰨，虛鰨也。从魚，𦐇聲。”', '27.9C2B': '《說文》：“鰫，魚也。从魚，容聲。”', '27.9C25': '《說文》：“鰥，魚也。从魚，眔聲。”', '27.9C1C': '《說文》：“鰜，魚名。从魚，兼聲。”', '27.E9AF': '《說文》：“𩺀，魚名。从魚，脊聲。”', '27.E9B9': '《說文》：“䱵，魚名。从魚，翁聲。”', '27.9C1D': '《說文》：“鰝，大鰕也。从魚，高聲。”', '27.9C29': '《說文新附》：“鰩，文鰩，魚名。从魚，䍃聲。”', '27.E9DC': '《說文》：“䦲，䦲謂之樀。樀，廟門也。从門，詹聲。”', '27.95E4': '《說文新附》：“闤，市垣也。从門，瞏聲。”', '27.95E5': '《說文新附》：“闥，門也。从門，達聲。”', '27.E9FE': '《說文》：“㩴，爪持也。从手，瞿聲。”', '27.651D': '《說文》：“攝，引持也。从手，聶聲。”', '27.651C': '《說文》：“攜，提也。从手，巂聲。”', '27.EA14': '《說文》：“𢹏，對舉也。从手，輿聲。”', '27.5B48': '《說文》：“孈，愚戇多態也。从女，巂聲。讀若隓。”', '27.7517': '《說文》：“甗，甑也。一曰穿也。从瓦，鬳聲。讀若言。”', '27.EEFE': '《說文》：“𢑆，弓曲也。从弓，雚聲。”', '27.EAA6': '《說文》：“𢑈，弓便利也。从弓，䌛聲。讀若燒。”', '27.EAA8': '《說文》：“㣆，弛弓也。从弓，璽聲。”', '27.EAB9': '《說文》：“纅，絲色也。从糸，樂聲。”', '27.7E87': '《說文》：“纇，絲節也。从糸，頪聲。”', '27.7E8F': '《說文》：“纏，繞也。从糸，廛聲。”', '27.EACC': '《說文》：“𦇎，帛青色。从糸，蔥聲。”', '27.7E8D': '《說文》：“纍，綴得理也。一曰大索也。从糸，畾聲。”', '27.EAFC': '《說文》：“𦆾，素屬。从素，率聲。”', '27.881C': '《說文》：“蠜，𨸏蠜也。从虫，樊聲。”', '27.8835': '《說文》：“蠵，大龜也。以胃鳴者。从虫、巂聲。𧓬，司馬相如說：蠵从敻。”', '27.881B': '《說文新附》：“蠛，蠛蠓，細蟲也。从虫，蔑聲。”', '27.EB8D': '《說文》：“䵎，黃黑色也。从黃，耑聲。”', '27.EBA8': '《說文》：“䥝，温器也。一曰金器。从金，麀聲。”', '27.942A': '《說文》：“鐪，煎膠器也。从金，虜聲。”', '27.942B': '《說文》：“鐫，穿木鐫也。从金，雋聲。一曰琢石也。讀若瀸。”', '27.9432': '《說文》：“鐲，鉦也。从金，蜀聲。軍法：司馬執鐲。”', '27.9438': '《說文》：“鐸，大鈴也。軍法：五人為伍，五伍為兩，兩司馬執鐸。从金，睪聲。”', '27.943A': '《說文》：“鐺，鋃鐺也。从金，當聲。”', '27.EBBD': '《說文》：“𨭖，伐擊也。从金，亶聲。”', '27.8F5B': '《說文》：“轛，車橫軨也。从車，對聲。《周禮》：‘參分軹圍，去一以為轛圍。’”', '27.EC53': '《說文》：“𨏉，治車軸也。从車，算聲。”', '27.8F5F': '《說文》：“轟，羣車聲也。从三車。”', '27.EBF7': '《說文》：“䧰，大𨸏也。从𨸏，鯀聲。”', '27.8FAF': '《說文》：“辯，治也。从言在辡之間。”', '27.91B9': '《說文》：“醹，厚酒也。从酉，需聲。《詩》曰：‘酒體惟醹。’”', '27.EC34': '《說文》：“𨣨，泛齊，行酒也。从酉，監聲。”', '27.91BA': '《說文》：“醺，醉也。从酉，熏聲。《詩》曰：‘公尸來燕醺醺。’”', '27.EC4A': '《說文》：“䤔，闕。”', '27.79B3': '《說文》：“禳，磔禳祀，除癘殃也。古者燧人禜子所造。从示，襄聲。”', '27.74D8': '《說文》：“瓘，玉也。从玉，雚聲。《春秋傳》曰：‘瓘斝。’”', '27.8633': '《說文》：“蘳，黃華。从艸，黊聲。讀若壞。”', '27.E0A2': '《說文》：“𧄎，艸盛皃。从艸，䌛聲。《夏書》曰：‘厥艸惟𧄎。’”', '27.862C': '《說文》：“蘬，薺實也。从艸，歸聲。”', '27.E0CA': '《說文》：“䕺，艸叢生皃。从艸，叢聲。”', '27.E11E': '《說文》：“䟍，走意。从走，臱聲。”', '27.E131': '《說文》：“𧾣，走意也。从走，敻聲。讀若繘。”', '27.E142': '《說文》：“䟏，動也。从走，樂聲。讀若《春秋傳》曰：‘輔䟏’。”', '27.E15C': '《說文》：“邎，行邎徑也。从辵，䌛聲。”', '27.E1A4': '《說文》：“𪘓，齒差跌皃。从齒，佐聲。《春秋傳》曰：‘鄭有子𪘓。’”', '27.9F6C': '《說文》：“齬，齒不相值也。从齒，吾聲。”', '27.8E94': '《說文》：“躔，踐也。从足，廛聲。”', '27.8E97': '《說文》：“躗，衞也。从足，衞聲。”', '27.8E93': '《說文》：“躓，跲也。从足，質聲。《詩》曰：‘裁質其尾。’”', '27.9FA2': '《說文》：“龢，謂也。讀與和同。”', '27.8B80': '《說文》：“讀，誦書也。从言，賣聲。”', '27.8B82': '《說文》：“讂，流言也。从言，敻聲。”', '27.8B84': '《說文》：“讄，禱也。累功德以求福。《論語》云：‘讄曰：禱尔于上下神祇。’从言，纍省聲。𧮢，或不省。”', '27.5971': '《說文》：“奱，樊也。从𠬜，䜌聲。”', '27.9F94': '《說文》：“龔，給也。从共，龍聲。”', '27.E26C': '《說文》：“䰝，鬵屬，从鬲曾聲。”', '27.9B3B': '《說文》：“鬻，䭈也。从𩰲，米聲。”', '27.F0D6': '《說文》：“𩱯，鬻也。从𩰲，毓聲。𩱙，𩱯或省从米。”', '27.9F42': '《說文》：“齂，臥息也。从鼻，隶聲。讀若虺。”', '27.9DDF': '《說文》：“鷟，鸑鷟也。从鳥，族聲。”', '27.9DDE': '《說文》：“鷞，鷫鷞也。从鳥，爽聲。”', '27.9DDA': '《說文》：“𪅡，天龠也。从鳥，翏聲。”', '27.E342': '《說文》：“𪄭，鳥也。从鳥，桼聲。”', '27.9DD6': '《說文》：“鷖，鳧屬。从鳥，殹聲。《詩》曰：‘鳧鷖在梁。’”', '27.9DD7': '《說文》：“䳼，水鴞也。从鳥，區聲。”', '27.9DDB': '《說文》：“𪅟，鳥也。从鳥，庸聲。”', '27.9DD0': '《說文》：“鷐，鷐風也。从鳥，晨聲。”', '27.9DD9': '《說文》：“鷙，擊殺鳥也。从鳥，執聲。”', '27.9DE9': '《說文》：“鷩，赤雉也。从鳥，敝聲。《周禮》曰：‘孤服鷩冕。’”', '27.E362': '《說文》：“𪄱，雉屬，戇鳥也。从鳥，𨗁省聲。”', '27.9DD5': '《說文》：“𪄼，雌雉鳴也。从鳥，唯聲。《詩》曰：‘有鷕雉鳴。’”', '27.9DD3': '《說文新附》：“鷓，鷓鴣，鳥名。从鳥，庶聲。”', '27.E388': '《說文》：“𩪗，𩪡骨也。从骨，厥聲。”', '27.E38A': '《說文》：“䯣，厀脛間骨也。从骨，貴聲。”', '27.81DE': '《說文》：“臞，少肉也。从肉，瞿聲。”', '27.89FB': '《說文》：“觻，角也。从角，樂聲。張掖有觻得縣。”', '27.E405': '《說文》：“籱，罩魚者也。从竹，靃聲。籗，籱或省。”', '27.7C60': '《說文》：“籠，舉土器也。一曰笭也。从竹，龍聲。”', '27.7C5A': '《說文》：“籚，積竹，矛𢧢矜也。从竹，盧聲。《春秋國語》曰：‘朱儒扶籚。’”', '27.7C5F': '《說文》：“籟，三孔龠也。大者謂之笙，其中謂之籟，小者謂之葯。从竹，賴聲。”', '27.E434': '《說文》：“𪔪，鼓無聲也。从鼓，咠聲。”', '27.E436': '《說文》：“𧰙，也，訖事之樂也。从豈，幾聲。”', '27.9954': '《說文》：“𩟷，孰食也。从食，雝聲。”', '27.995B': '《說文》：“饛，盛器滿皃。从食，蒙聲。《詩》曰：‘有饛簋飧。’”', '27.E47F': '《說文》：“䭡，秦人謂相謁而食麥曰䭡䭓。从食，㥯聲。”', '27.7CF4': '《說文》：“糴，市穀也。从入，从䊮。”', '27.E4B4': '《說文》：“䵂，麥覈屑也。十斤為三斗。从麥，啻聲。”', '27.97E3': '《說文》：“韣，弓衣也。从韋，蜀聲。”', '27.E4CC': '《說文》：“㰘，木也。从木，彝聲。”', '27.6B0A': '《說文》：“權，黃華木。从木，雚聲。一曰反常。”', '27.E4F6': '《說文》：“𣠞，木葉榣白也。从木，聶聲。”', '27.56CA': '《說文》：“囊，橐也。从㯻省，襄省聲。”', '27.8D16': '《說文》：“𧹎，貿也。从貝，𧸇聲。”', '27.9147': '《說文》：“酇，百家為酇。酇，聚也。从邑，贊聲。南陽有酇縣。”', '27.E55D': '《說文》：“𨟄，京兆杜陵鄉。从邑，樊聲。”', '27.9148': '《說文》：“酈，南陽縣。从邑，麗聲。”', '27.E5B4': '《說文》：“龓，兼有也。从有，龍聲。讀若聾。”', '27.E5C6': '《說文》：“𪗍，等也。从齊，妻聲。”', '27.E5CC': '《說文》：“䆏，稻紫莖不黏也。从禾，糞聲。讀若靡。”', '27.7A70': '《說文》：“穰，黍𥞥已治者。从禾，襄聲。”', '27.7CF1': '《說文》：“糱，牙米也。从米，辥聲。”', '27.F0EA': '《說文》：“𥶶，酒母也。从米，𥷚省聲。”', '27.E640': '《說文》：“𡬄，孰寐也。从㝱省，水聲。”', '27.766D': '《說文》：“癭，頸瘤也。从疒，嬰聲。”', '27.766C': '《說文》：“癬，乾瘍也。从疒，鮮聲。”', '27.E696': '《說文》：“𢅼，𡎰地以巾𢵢之。从巾，夒聲。讀若水溫㬮。一曰箸也。”', '27.513C': '《說文》：“儼，昂頭也。从人，嚴聲。”', '27.513B': '《說文新附》：“儻，倜儻也。从人，黨聲。”', '27.8972': '《說文》：“襲，左衽袍。从衣，龖省聲。𧟟，籀文襲不省。”', '27.6C0D': '《說文新附》：“氍，氍毹、毾㲪，皆氈緂之屬，蓋方言也。从毛，瞿聲。”', '27.E70D': '《說文》：“𡳸，履下也。从履省，歷聲。”', '27.826B': '《說文》：“艫，舳艫也。一曰船頭。从舟，盧聲。”', '27.E722': '《說文》：“𧢜，䚔𧢜也。从見，樊聲。讀若幡。”', '27.89BF': '《說文新附》：“覿，見也。从見，賣聲。”', '27.E72D': '《說文》：“𧢞，很視也。从覞，肩聲。齊景公之勇臣有成𧢞者。”', '27.E72E': '《說文》：“䨳，見雨而比息。从覞，从雨。讀若欷。”', '27.6B61': '《說文》：“歡，喜樂也。从欠，雚聲。”', '27.E741': '《說文》：“𣤹，盡酒也。从欠，樵聲。”', '27.9869': '《說文》：“顩，𪙊皃。从頁，僉聲。”', '27.986B': '《說文》：“顫、頭不正也。从頁，亶聲。”', '27.E79B': '《說文》：“䰎，屈髮也。从髟，貴聲。”', '27.E7A1': '《說文》：“鬜，鬢禿也。从髟，閒聲。”', '27.9B56': '《說文》：“魖，耗神也。从鬼，虛聲。”', '27.9B55': '《說文》：“𩴪，鬼俗也。从鬼，幾聲。《淮南傳》曰：‘吳人鬼，越人𩴪。’”', '27.5DD2': '《說文》：“巒，山小而銳。从山，䜌聲。”', '27.E7CC': '《說文》：“𡿋，巍高也。从山，蠆聲。”', '27.E81D': '《說文》：“𩦂，馬一目白曰𩦂，二目白曰魚。从馬，閒聲。”', '27.9A48': '《說文》：“驈，驪馬白胯也。从馬，矞聲。《詩》曰：‘有驈有騜。’”', '27.9A54': '《說文》：“驔，驪馬黃脊。从馬，覃聲。讀若簟。”', '27.9A4D': '《說文》：“驍，良馬也。从馬，堯聲。”', '27.9A55': '《說文》：“驕，馬高六尺為驕。从馬，喬聲。《詩》曰：‘我馬唯驕。’一曰野馬。”', '27.9A52': '《說文》：“驒，驒騱，野馬也。从馬，單聲。一曰青驪白鱗，文如鼉魚。”', '27.E83E': '《說文》：“𪋝，鹿迹也。从鹿，速聲。”', '27.737F': '《說文》：“獿，獿㺒也。从犬、夒。”', '27.9F32': '《說文》：“鼲，鼠，出丁零胡，皮可作裘。从鼠，軍聲。”', '27.E876': '《說文》：“𪕮，斬𪕮鼠。黑身，白腰若帶。手有長白毛，似握版之狀，類蝯蜼之屬。从鼠，胡聲。”', '27.721E': '《說文新附》：“爞，旱气也。从火，蟲聲。”', '27.E8A3': '《說文》：“𪑲，黑有文也。从黑，冤聲。”', '27.E8A6': '《說文》：“𪒀，𪒀姍，下哂。从黑，般聲。”', '27.E8A7': '《說文》：“黱，畫眉也。从黑，朕聲。”', '27.E8C7': '《說文》：“𡰠，䣛中病也。从尣，从羸。”', '27.E94F': '《說文》：“𤅩，水濡而乾也。从水，𪄿聲。《詩》曰：‘𤅩其乾矣。’灘，俗𤅩从隹。”', '27.7051': '《說文》：“灑，汛也。从水，麗聲。”', '27.7052': '《說文》：“灒，汙灑也。一曰水中人。从水，贊聲。”', '27.E98D': '《說文》：“𩆑，小雨也。从雨，酸聲。”', '27.973D': '《說文》：“霽，雨止也。从雨，齊聲。”', '27.973E': '《說文》：“霾，風雨土也。从雨，貍聲。《詩》曰：‘終風且霾。’”', '27.973F': '《說文》：“霿，天气下地不應曰霿。霿，晦也。从雨，瞀聲。”', '27.E99C': '《說文新附》：“䨴，黮䨴，雲黑皃。从雨，對聲。”', '27.9C44': '《說文》：“鱄，魚也。从魚，專聲。”', '27.E9A7': '《說文》：“䱾，魚名。一名鯉，一名鰜。从魚，婁聲。”', '27.9C31': '《說文》：“鰱，魚名。从魚，連聲。”', '27.9C3B': '《說文》：“鰻，魚名。从魚，曼聲。”', '27.9C3C': '《說文》：“鰼，鰌也。从魚，習聲。”', '27.E9BD': '《說文》：“鰸，魚名。狀似蝦，無足，長寸，大如叉股。出遼東。从魚，區聲。”', '27.E9C0': '《說文》：“鱅，魚名。从魚，庸聲。”', '27.F0AF': '《說文》：“𩺰，二魚也。”', '27.9F95': '《說文》：“龕，龍皃。从龍，合聲。”', '27.E9D2': '《說文》：“䶬，龍耆脊上䶬䶬。从龍，幵聲。”', '27.807D': '《說文》：“聽，聆也。从耳、𢛳，𡈼声。”', '27.807E': '《說文》：“聾，無聞也。从耳，龍聲。”', '27.6524': '《說文新附》：“攤，開也。从手，難聲。”', '27.EA48': '《說文》：“㜺，白好也。从女，贊聲。”', '27.5B4C': '《說文》：“孌，慕也。从女，䜌聲。”', '27.5F4E': '《說文》：“彎，持弓關矢也。从弓，䜌聲。”', '27.7E91': '《說文》：“纑，布縷也。从糸，盧聲。”', '27.8F61': '《說文》：“轡，馬轡也。从絲，从軎。與連同意。《詩》曰：‘六轡如絲’”', '27.882A': '《說文》：“蠪，丁螘也。从虫，龍聲。”', '27.8825': '《說文》：“蠥，衣服歌謠艸木之怪謂之䄏，禽獸蟲蝗之怪謂之蠥。从虫，辥聲。”', '27.9444': '《說文》：“鑄，銷金也。从金，壽聲。”', '27.9451': '《說文》：“鑑，大盆也。一曰監諸，可以取明水於月。从金，監聲。”', '27.944A': '《說文》：“鑊，鑴也。从金，蒦聲。”', '27.944B': '《說文》：“鑋，金聲也。从金，輕聲。讀若《春秋傳》曰‘𨆪而乘它車’。”', '27.9463': '《說文》：“鑣，馬銜也。从金，麃聲。𧥍，鑣或从角。”', '27.8F62': '《說文》：“轢，車所踐也。从車，樂聲。”', '27.5B7F': '《說文》：“孿，一乳兩子也。从子，䜌聲。”', '27.E018': '《說文》：“𤫕，玉也。从玉，夒聲。讀若柔。”', '27.74DA': '《說文》：“瓚，三玉、二石也。从玉，贊聲。《禮》：‘天子用全，純玉也；上公用駹，四玉、一石；侯用瓚；伯用埒，玉、石半相埒也。’”', '27.863A': '《說文》：“蘺，江蘺，蘼蕪。从艸，離聲。”', '27.863B': '《說文》：“蘻，狗毒也。从艸，繫聲。”', '27.863F': '《說文》：“蘿，莪也。从艸，羅聲。”', '27.E08F': '《說文》：“䕼，艸也。从艸，難聲。”', '27.E0A6': '《說文》：“䕻，艸木相附䕻土而生。从艸，麗聲。《易》曰：‘百穀艸木䕻於地。’”', '27.8638': '《說文新附》：“蘸，以物沒水也。此蓋俗語。从艸，未詳。”', '27.E0DD': '《說文》：“㹛，牛柔謹也。从牛，夒聲。”', '27.E102': '《說文》：“㘙，呻也。从口，嚴聲。”', '27.E11D': '《說文》：“𧾨，走意。从走，憲聲。”', '27.9090': '《說文》：“邐，行邐邐也。从辵，麗聲。”', '27.E172': '《說文》：“𨙔，不行也。从辵，𩦛聲。讀若住。”', '27.908F': '《說文新附》：“邏，巡也。从辵，羅聲。”', '27.9F71': '《說文》：“齱，齵也。从齒，取聲。”', '27.9F6F': '《說文》：“齯，老人齒。从齒，兒聲。”', '27.9F6E': '《說文》：“齮，齧也。从齒，奇聲。”', '27.E1AB': '《說文》：“𪘧，𪘧齚也。从齒，卒聲。”', '27.E1B2': '《說文》：“齭，齒傷酢也。从齒，所聲。”', '27.8B8E': '《說文》：“讎，猶𧭭也。从言，雔聲。”', '27.E20A': '《說文》：“𧭹，匹也。从言，頻聲。”', '27.8B8B': '《說文》：“讋，失氣言。一曰不止也。从言，龖省聲。傅毅讀若慴。𧮩，籀文讋不省。”', '27.97C5': '《說文》：“𩎍，著掖鞥也。从革，顯聲。”', '27.97C4': '《說文》：“韄，佩刀絲也。从革，蒦聲。”', '27.E27D': '《說文》：“𩱚，吹聲沸也。从𩰲，孛聲。”', '27.E2BA': '《說文》：“𣀷，數也。从攴，麗聲。”', '27.8B8A': '《說文》：“變，更也。从攴，䜌聲。”', '27.77D4': '《說文》：“矔，目多睛也。从目，雚聲。益州謂瞋目曰矔。”', '27.E320': '《說文》：“𩁟，𩁟黃也。从隹，黎聲。一曰楚雀也，其色黎黑而黃。”', '27.9DF2': '《說文》：“𪆩，鳥黑色多子。師曠曰：‘南方有鳥，名曰羌𪆩，黃頭赤目，五色皆備。’从鳥，就聲。”', '27.9DE6': '《說文》：“𪆄，𪆄𪃐，桃蟲也。从鳥，焦聲。”', '27.9DEF': '《說文》：“鷯，刀鷯，剖葦，食其中蟲。从鳥，尞聲。”', '27.9DF8': '《說文》：“鷸，知天將雨鳥也。从鳥，矞聲。《禮記》曰：‘知天文者冠鷸。’ 𪈄，鷸或从遹。”', '27.E354': '《說文》：“𪆖，鷀也。从鳥，壹聲。”', '27.E356': '《說文》：“𪆫，雝𪆫也。从鳥，渠聲。”', '27.9DFB': '《說文》：“鷻，雕也。从鳥，敦聲。《詩》曰：‘匪鷻匪𪀝。’”', '27.9DF3': '《說文》：“鷳，鴟也。从鳥，閒聲。”', '27.9DE2': '《說文》：“鷢，白鷢，王鴡也。从鳥，厥聲。”', '27.9DEE': '《說文》：“鷮，走鳴長尾雉也。乘輿以為防釳，著馬頭上。从鳥，喬聲。”', '27.E37E': '《說文》：“㱻，畜產疫病也。从歺，从羸。”', '27.9AD1': '《說文》：“髑，髑髏，頂也。从骨，蜀聲。”', '27.E38B': '《說文》：“𩪦，骨中脂也。从骨，隓聲。”', '27.9AD4': '《說文》：“體，總十二屬也。从骨，豊聲。”', '27.E38D': '《說文》：“䯤，骨擿之可會髮者。从骨，會聲。《詩》曰：‘䯤弁如星。’”', '27.E3E6': '《說文》：“𧥑，羌人所吹角屠𧥑，以驚馬也。从角，𢨋聲。𢨋，古文誖字。”', '27.7C65': '《說文》：“籥，書僮竹笘也。从竹，龠聲。”', '27.7C67': '《說文》：“籧，籧篨，粗竹席也。从竹，遽聲。”', '27.E3FC': '《說文》：“籢，鏡籢也。从竹，斂聲。”', '27.E408': '《說文》：“䉴，袌也。从竹，襄聲。”', '27.7C63': '《說文》：“籣，所以盛弩矢。人所負也。从竹，闌聲。”', '27.7C64': '《說文》：“籤，驗也。一曰銳也，貫也。从竹，韱聲。”', '27.E43F': '《說文》：“𧈚，器也。从䖒、㿾，㿾亦聲。”', '27.8D19': '《說文》：“贙，分別也。从虤對爭貝。讀若迴。”', '27.E499': '《說文》：“䍎，瓦器也。从缶，薦聲。”', '27.E49A': '《說文》：“𦉢，瓦器也。从缶，霝聲。”', '27.E4D2': '《說文》：“蘽，木也。从木，藟聲。𣡺，籀文。”', '27.6B12': '《說文》：“欒，木，似欄。从木，䜌聲。”', '27.6B11': '《說文》：“欑，積竹杖也。从木，贊聲。一曰穿也；一曰叢木。”', '27.8D1B': '《說文》：“贛，賜也。从貝，贛省聲。”', '27.66EB': '《說文》：“曫，日旦昏時。从日，䜌聲。”', '27.E59F': '《說文》：“㬮，安㬮，溫也。从日，難聲。”', '27.66EC': '《說文》：“曬，㬥也。从日，麗聲。”', '27.9F06': '《說文》：“鼆，冥也。从冥，黽聲。讀若黽蛙之黽。”', '27.E5ED': '《說文》：“𪎭，穄也。从黍，麻聲。”', '27.7ACA': '《說文》：“竊，盜自中出曰竊。从穴、从米，𠨄、廿皆聲。廿，古文疾；𠨄，古文偰。”', '27.F0BE': '《說文》：“䪥，菜也，葉似韭。从韭，㕢聲。”', '27.E658': '《說文》：“𤼒，創裂也。一曰疾𤼒。从疒，巂聲。”', '27.E6A2': '《說文》：“𪓐，合五采鮮色。从黹，虘聲。《詩》曰：‘衣裳𪓐𪓐。’ ”', '27.513D': '《說文》：“儽，垂皃。从人，纍聲。一曰嬾解。”', '27.E6F7': '《說文》：“𩱝，𧚍裏也。从𧚍，鬲聲。讀若擊。”', '27.E72F': '《說文》：“㱍，欠皃。从欠，䜌聲。”', '27.986F': '《說文》：“顯，頭明飾也。从頁，㬎聲。”', '27.9768': '《說文新附》：“靨，姿也。从面，厭聲。”', '27.9B1F': '《說文新附》：“鬟，緫髮也。从髟，睘聲。”', '27.5DD6': '《說文》：“巖，岸也。从山，嚴聲。”', '27.9A56': '《說文》：“驖，馬赤黑色。从馬，𢧜聲。《詩》曰：‘四驖孔阜。’”', '27.9A57': '《說文》：“驗，馬名。从馬，僉聲。”', '27.E82E': '《說文》：“䮸，馬行徐而疾也。从馬，學省聲。”', '27.9A5A': '《說文》：“驚，馬駭也。从馬，敬聲。”', '27.9A59': '《說文》：“驙，駗驙也。从馬，亶聲。《易》曰：‘乘馬驙如。’”', '27.9A5B': '《說文》：“驛，置騎也。从馬，睪聲。”', '27.E836': '《說文》：“驘，驢父馬母。从馬，𦝠聲。”', '27.9E9F': '《說文》：“麟，大牝鹿也。从鹿，粦聲。”', '27.7383': '《說文》：“玃，母猴也。从犬，矍聲。《爾雅》云：‘玃父善顧，攫持人也。’”', '27.9F36': '《說文》：“鼶，鼠也。从鼠，虒聲。”', '27.9F37': '《說文》：“鼷，小鼠也。从鼠，奚聲。”', '27.9F38': '《說文》：“鼸，䶃也。从鼠，兼聲。”', '27.7222': '《說文》：“爢，爛也。从火，靡聲。”', '27.9EF3': '《說文》：“黳，小黑子。从黑，殹聲。”', '27.9EF2': '《說文》：“黲，淺青黑也。从黑，參聲。”', '27.9EF4': '《說文》：“黴，中久雨青黑。从黑，微省聲。”', '27.5972': '《說文》：“奲，富奲奲皃。从奢，單聲。”', '27.6201': '《說文》：“戁，敬也。从心，難聲。”', '27.E938': '《說文》：“㶛，水也。从水，旟聲。”', '27.E951': '《說文》：“灓，漏流也。从水，䜌聲。”', '27.E96F': '《說文》：“𤅊，議辠也。从水、獻。與法同意。”', '27.8C45': '《說文》：“豅，大長谷也。从谷，龍聲。讀若聾。”', '27.9C52': '《說文》：“鱒，赤目魚。从魚，尊聲。”', '27.E9A1': '《說文》：“𩻜，魚也。从魚，猌聲。”', '27.E9B2': '《說文》：“鱏，魚名。从魚，覃聲。《傳》曰：‘伯牙鼓琴，鱏魚出聽。’”', '27.E9B8': '《說文》：“𩻛，魚名。从魚，朁聲。”', '27.9C56': '《說文》：“鱖，魚名。从魚，厥聲。”', '27.E9BB': '《說文》：“鱓，魚名。皮可為鼓。从魚，單聲。”', '27.9C57': '《說文》：“鱗，魚甲也。从魚，粦聲。”', '27.E9F1': '《說文》：“𦘍，吳楚之外，凡無耳者謂之𦘍，言若斷耳為盟。从耳，闋聲。”', '27.6529': '《說文》：“攩，朋羣也。从手，黨聲。”', '27.652B': '《說文》：“攫，扟也。从手，矍聲。”', '27.6523': '《說文》：“攣，係也。从手，䜌聲。”', '27.652A': '《說文》：“攪，亂也。从手，覺聲。《詩》曰：‘祇攪我心。’”', '27.EA2D': '《說文》：“𪎮，旌旗，所以指麾也。从手，靡聲。”', '27.5F4F': '《說文》：“彏，弓急張也。从弓，矍聲。”', '27.7E96': '《說文》：“纖，細也。从糸，韱聲。”', '27.7E94': '《說文》：“纔，帛雀頭色。一曰微黑色如紺。纔，淺也。讀若讒。从糸，毚聲。”', '27.7E93': '《說文》：“纓，冠系也。从糸，嬰聲。”', '27.7E95': '《說文》：“纕，援臂也。从糸，襄聲。”', '27.EAF7': '《說文》：“𦇧，西胡毳布也。从糸，罽聲。”', '27.8832': '《說文》：“蠲，馬蠲也。从虫、目，益聲，了象形。《明堂．月令》曰：‘腐艸為蠲。’”', '27.8830': '《說文》：“蠰，𧒾蠰也。从虫，襄聲。”', '27.EB0F': '《說文》：“𧕅，螟𧕅，桑蟲也。从虫，霝聲。”', '27.EB2B': '《說文》：“𧕐，𧓉𧕐也，从䖵，曹聲。”', '27.8831': '《說文》：“蠱，腹中蟲也。《春秋》傳曰：‘皿蟲為蠱。’晦淫之所生也。臬桀死之鬼亦為蠱。从蟲、从皿。皿，物之用也。”', '27.EB49': '《說文》：“𪓷，水蟲也。薉貉之民食之。从黽，奚聲。”', '27.9457': '《說文》：“鑗，金屬。一曰剥也。从金，黎聲。”', '27.9460': '《說文》：“鑠，銷金也。从金，樂聲。”', '27.EBB3': '《說文》：“䥯，㭒屬。从金，罷聲。讀若媯。”', '27.9462': '《說文》：“鑢，錯銅鐵也。从金，慮聲。”', '27.EBCD': '《說文》：“㪻，杼滿也。从斗，䜌聲。”', '27.79B7': '《說文》：“禷，以事類祭天神。从示，類聲。”', '27.74DB': '《說文》：“瓛，桓圭，公所執。从玉，獻聲。”', '27.E07D': '《說文》：“𧅖，綬也。从艸，鶪聲。《詩》曰：‘卭有旨𧅖。’是。”', '27.E0B1': '《說文》：“𧆈，煎茱萸。从艸，𦅨聲。漢律：會稽獻𧆈一斗。”', '27.E11B': '《說文》：“𧾯，走意。从走，薊聲。讀若髽結之結。”', '27.E12D': '《說文》：“𧾰，趨進𧾰如也。从走，翼聲。”', '27.E132': '《說文》：“䟑，趠䟑也。从走，龠聲。”', '27.8862': '《說文》：“衢，四達謂之衢。从行，瞿聲。”', '27.9F75': '《說文》：“齵，齒不正也。从齒，禺聲。”', '27.E1A5': '《說文》：“齳，無齒也。从齒，軍聲。”', '27.E1A9': '《說文》：“䶢，齧也。从齒，咸聲。”', '27.E1AE': '《說文》：“𪙌，齒差也。从齒，屑聲。讀若切。”', '27.E1DB': '《說文》：“𡅻，呼也。从㗊，莧聲。讀若讙。”', '27.8B96': '《說文》：“讖，驗也。从言，韱聲。”', '27.8B92': '《說文》：“讒，譖也。从言，毚聲。”', '27.8B93': '《說文》：“讓，相責讓。从言，襄聲。”', '27.97C7': '《說文》：“韇，弓矢韇也。从革，賣聲。”', '27.E286': '《說文》：“𩰞，智少力劣也。从鬥，爾聲。”', '27.77D5': '《說文》：“矕，目矕矕也。从目，䜌聲。”', '27.E311': '《說文》：“齅，以鼻就臭也。从鼻，从臭，臭亦聲。”', '27.96E5': '《說文》：“雥，羣鳥也。从三隹。”', '27.9DFA': '《說文》：“鷺，白鷺也。从鳥，路聲。”', '27.9DFF': '《說文》：“𪇊，鸊鷈也。从鳥，辟聲。”', '27.9E07': '《說文》：“鸇，鷐風也。从鳥，亶聲。𪇮，籀文鸇从廛。”', '27.9E03': '《說文》：“鸃，鵔鸃也。从鳥，義聲。秦漢之初，侍中冠鵔鸃冠。”', '27.9AD5': '《說文》：“髕，厀耑也。从骨，賓聲。”', '27.9F1E': '《說文》：“鼞，鼓聲也。从鼓，堂聲。《詩》曰：‘擊鼓其鼞。’”', '27.884B': '《說文》：“衋，傷痛也。从血聿，皕聲。《周書》曰：‘民冈〔罔〕不衋傷心。’”', '27.7F50': '《說文新附》：“罐，器也。从缶，雚聲。”', '27.E4C2': '《說文》：“韤，足衣也。从韋，蔑聲。”', '27.E652': '《說文》：“㿛，癰也。从疒，麗聲。一曰𤸃黑。讀若隸。”', '27.E66C': '《說文》：“𦌾，网也。从网繯，繯亦聲。一曰綰也。”', '27.E728': '《說文》：“𧢢，視誤也。从見，龠聲。”', '27.E757': '《說文》：“𩕾，顛頂也。从頁，𡙷聲。”', '27.E773': '《說文》：“䫶，大醜皃。从頁，樊聲。”', '27.9B22': '《說文》：“鬢，頰髮也。从髟，賓聲。”', '27.E78F': '《說文》：“䰐，髮長也。从髟，鹽聲。讀若《春秋》：黑肱以濫來奔。”', '27.E793': '《說文》：“𩯨，髮皃。从髟，爾聲。讀若江南謂酢母為𩯨。”', '27.E7BE': '《說文》：“䰰，鬼鬽聲，䰰䰰不止也。从鬼，需聲。”', '27.E7C1': '《說文》：“𩴱，鬼皃。从鬼，賓聲。”', '27.9B58': '《說文新附》：“魘，㝱驚也。从鬼，厭聲。”', '27.E800': '《說文》：“䃺，石磑也。”', '27.9A5F': '《說文》：“驟，馬疾步也。从馬，聚聲。”', '27.E850': '《說文》：“𠓗，疾也。从三兔。闕。”', '27.E8AB': '《說文》：“𪒠，𪒠者，忘而息也。从黑，敢聲。”', '27.E936': '《說文》：“㶟，水。出鴈門陰館累頭山，東入海。或曰治水也。从水，纍聲。”', '27.7061': '《說文》：“灡，潘也。从水，蘭聲。”', '27.705D': '《說文》：“灝，豆汁也。从水，顥聲。”', '27.E970': '《說文新附》：“𤅤，大水也。从水，镾聲。”', '27.9870': '《說文》：“顰，涉水顰蹙。从頻，卑聲。”', '27.9744': '《說文新附》：“靄，雲皃。从雨，藹省聲。”', '27.9C63': '《說文》：“鱣，鯉也。从魚，亶聲。𩽱，籀文鱣。”', '27.9C67': '《說文》：“鱧，鱯也。从魚，豊聲。”', '27.E9BC': '《說文》：“䲐，魚名。出樂浪潘國。从魚，虜聲。”', '27.9C62': '《說文》：“鱢，鮏臭也。从魚，喿聲。《周禮》曰：‘膳膏鱢。’”', '27.9E7D': '《說文》：“鹽，鹹也。从鹵，監聲。古者宿沙初作煮海鹽。”', '27.9E7C': '《說文》：“鹼，鹵也。从鹽省，僉聲。”', '27.5B4E': '《說文》：“孎，謹也。从女，屬聲。讀若人不孫為孎。”', '27.7E97': '《說文》：“纗，維綱中繩。从糸，巂聲。讀若畫，或讀若維。”', '27.8838': '《說文》：“蠸，蟲也。一曰大螫也。讀若蜀都布名。从虫，雚聲。”', '27.8836': '《說文》：“蠶，任絲也。从䖵，朁聲。”', '27.EB2A': '《說文》：“𧕝，蟲也，从䖵，寍聲。”', '27.EB37': '《說文》：“𧕲，蟲食也。从䖵，雋聲。”', '27.9F07': '《說文新附》：“鼇，海大鼈也。从黽，敖聲。”', '27.EBA5': '《說文》：“䥵，鐵文也。从金，曉聲。”', '27.946A': '《說文》：“鑪，方鑪也。从金，盧聲。”', '27.91C0': '《說文》：“釀，醞也，作酒曰釀。从酉，襄聲。”', '27.EC35': '《說文》：“䤗，酒味淫也。从酉，竷省聲。讀若《春秋傳》曰：‘美而豔。’”', '27.91C2': '《說文》：“釂，㱃酒盡也。从酉，嚼省聲。段玉裁注：“酒當作爵，此形聲包會意字也。”', '27.EC3F': '《說文》：“䤘，酢也。从酉，韱聲。”', '27.8648': '《說文》：“虈，楚謂之蘺，晉謂之虈，齊謂之茝。从艸，嚻聲。”', '27.E071': '《說文》：“𧅲，艸也。从艸，𡈹聲。𡈹，籀文囿。”', '27.E122': '《說文》：“𧾱，走顧皃。从走，瞿聲。讀若劬。”', '27.E13A': '《說文》：“䟒，行䟒趢也。一曰行曲脊皃。从走，雚聲。”', '27.E1A2': '《說文》：“𪙊，齒差也。从齒，兼聲。”', '27.9F7A': '《說文》：“齺，齒搚也。一曰齰也。一曰馬中糜也。从齒，芻聲。”', '27.9F79': '《說文》：“𪙉，齒參差。从齒，差聲。”', '27.E1B0': '《說文》：“䶣，𪙌牙也。从齒，豈聲。”', '27.9F78': '《說文》：“齸，鹿麋粻。从齒，益聲。”', '27.E1B5': '《說文》：“䶤，齧骨聲。从齒，从骨，骨亦聲。”', '27.E1B7': '《說文》：“𪙍，噍堅也。从齒，博省聲。”', '27.8EA3': '《說文》：“躣，行皃。从足，瞿聲。”', '27.8EA1': '《說文》：“躡，蹈也。从足，聶聲。”', '27.E1D5': '《說文》：“䶴，䶴音律管壎之樂也。从龠，炊聲。”', '27.E208': '《說文》：“讗，言壯皃。一曰數相怒也。从言，巂聲。讀若畫。”', '27.E214': '《說文》：“𧮓，譟也。从言，魋聲。”', '27.8B99': '《說文》：“讙，譁也。从言，雚聲。”', '27.E21C': '《說文》：“𧮑，嗑也。从言，𦐇聲。”', '27.8B98': '《說文》：“讘，多言也。从言，聶聲。河東有狐讘縣。”', '27.91C1': '《說文》：“釁，血祭也。象祭竈也。从爨省，从酉。酉，所以祭也。从分，分亦聲。”', '27.E284': '《說文》：“鬭，遇也。从鬥，斲聲。”', '27.77D8': '《說文》：“矘，目無精直視也。从目，黨聲。”', '27.9E11': '《說文》：“鸑，鸑鷟，鳳屬神鳥也。从鳥，獄聲。《春秋國語》曰：‘周之興也，鸑鷟鳴於岐山。’江中有鸑鷟，似鳧而大，赤目。”', '27.9E12': '《說文》：“𪇬，卑居也。从鳥，與聲。”', '27.E352': '《說文》：“䴌，水鳥也。从鳥，蒙聲。”', '27.9AD6': '《說文》：“髖，髀上也。从骨，寬聲。”', '27.81E0': '《說文》：“臠，臞也。从肉，䜌聲。一曰切肉臠也。《詩》曰：‘棘人臠臠兮。’”', '27.E3D4': '《說文》：“䚭，揮角皃。从角，雚聲。梁𨻳縣有䚭亭。又讀若𦄑。”', '27.89FF': '《說文》：“觿，佩角銳耑可以解結。从角，巂聲。《詩》曰：‘童子佩觿。’”', '27.E3F5': '《說文》：“籭，竹器也，可以取粗去細。从竹，麗聲。”', '27.7C6B': '《說文》：“籫，竹器也。从竹，贊聲。讀若纂。一曰叢。”', '27.E415': '《說文》：“䉷，隿射所蔽者也。从竹，嚴聲。”', '27.E432': '《說文》：“𪔳，鼓聲也。从鼓，隆聲。”', '27.995F': '《說文》：“饟，周人謂餉曰饟。从食，襄聲。”', '27.6B18': '《說文》：“欘，斫也。齊謂之鎡錤。一曰斤柄，性自曲者。从木，屬聲。”', '27.6B19': '《說文》：“欙，山行所乘者。从木，纍聲。”', '27.6B1A': '《說文》：“欚，江中大船名。从木，蠡聲。”', '27.7CF6': '《說文》：“糶，出穀也。从出，从䊮。䊮亦聲。”', '27.E603': '《說文》：“䊳，碎也。从米，靡聲。”', '27.897A': '《說文》：“襺，袍衣也。从衣，繭聲。以絮曰襺，以褞曰袍。《春秋傳》曰：‘盛夏重襺。’”', '27.89C0': '《說文》：“觀，諦視也。从見，雚聲。𥸑，古文觀从囧。”', '27.E720': '《說文》：“𧢦，注目視也。从見，歸聲。”', '27.E744': '《說文》：“㱎，昆干，不可知也。从欠，鰥聲。”', '27.9871': '《說文》：“顱，𩑒顱，首骨也。从頁，盧聲。”', '27.9872': '《說文》：“顲，面䫲顲皃。从頁，𤎭聲。”', '27.E791': '《說文》：“䰓，髮皃。从髟，臱聲。讀若宀。”', '27.E796': '《說文》：“𩯰，束髮少也。从髟，截聲。”', '27.7939': '《說文》：“礹，石山也。从石，嚴聲。”', '27.E818': '《說文》：“貛，野豕也。从豸，雚聲。”', '27.E846': '《說文》：“𪋮，似鹿而大也。从鹿，與聲。”', '27.E86B': '《說文》：“𪖇，鼠也。从鼠，番聲。讀若樊。或曰鼠婦。”', '27.E89D': '《說文》：“䵳，沃黑也。从黑，會聲。”', '27.9EF5': '《說文》：“黵，大污也。从黑，詹聲。”', '27.E8C5': '《說文》：“𡰡，𡰖𡰡也。从𡯁，从爪，巂聲。”', '27.E98C': '《說文》：“𩆵，小雨財𩂣也。从雨，鮮聲。讀若斯。”', '27.9C6E': '《說文》：“鱮，魚名。从魚，與聲。”', '27.E9B0': '《說文》：“鱯，魚名。从魚，蒦聲。”', '27.9C68': '《說文》：“鱨，揚也。从魚，嘗聲。”', '27.E9E4': '《說文》：“𨷱，開閉門利也。从門，繇聲。一曰縷十紘也。”', '27.E9E7': '《說文》：“𨷲，關下牡也。从門，龠聲。”', '27.7E98': '《說文》：“纘，繼也。从糸，贊聲。”', '27.EAC5': '《說文》：“䌴，不均也。从糸，羸聲。”', '27.EAC9': '《說文》：“䌳，粗緒也。从糸，璽聲。”', '27.7E9A': '《說文》：“纚，冠織也。从糸，麗聲。”', '27.883B': '《說文》：“蠻，南蠻，蛇穜。从虫，䜌聲。”', '27.EB2C': '《說文》：“𧕱，螻蛄也。从䖵，舝聲。”', '27.EBEF': '《說文》：“鼈，甲蟲也。从黽，敝聲。”', '27.9F09': '《說文》：“鼉，水蟲，似蜥易，長大。从黽，單聲。”', '27.EB90': '《說文》：“𠣊，助也。从力，从非，慮聲。”', '27.9472': '《說文》：“鑲，作型中膓也。从金，襄聲。”', '27.946F': '《說文》：“鑯，鐵器也。一曰鑴也。从金，韱聲。”', '27.9471': '《說文》：“鑱，銳也。从金，毚聲。”', '27.946E': '《說文》：“鑮，大鐘，湻于之屬，所以應鐘磬也。堵以二，金樂則鼓鎛應之。从金，薄聲。”', '27.65B8': '《說文》：“斸，斫也。从斤，屬聲。”', '27.F0AC': '《說文》：“𥝋，周成王時州靡國獻𥝋，人身，反踵，自笑，笑即上脣掩其目，食人。北方謂之土螻。《尔疋》云：𥝋𥝋如人，被髮。一名䲷陽，从厹，象形。”', '27.E0BF': '《說文》：“䕿，艸也。从艸，𪄿聲。”', '27.E1A1': '《說文》：“䶦，齒相值也。一曰齧也。从齒，責聲。《春秋傳》曰：晳䶦。”', '27.E1A3': '《說文》：“䶥，齬齒也。从齒，虘聲。”', '27.E1CC': '《說文》：“躧，舞履也。从足，麗聲。𩎉，或从革。”', '27.9FA4': '《說文》：“龤，樂和龤也。从龠，皆聲。《虞書》曰：‘八音克龤。’”', '27.97C9': '《說文新附》：“韉，馬鞁具也。从革，薦聲。”', '27.E27A': '《說文》：“𩱦，𤎅也。从𩰲，芻聲。”', '27.9B2E': '《說文》：“鬮，鬭取也，从鬥，龜聲。讀若三合繩糾。”', '27.E341': '《說文》：“𪇲，鳥也。从鳥，𢧵聲。”', '27.9E14': '《說文》：“鸔，烏鸔也。从鳥，暴聲。”', '27.E351': '《說文》：“𪇷，𪃈𪇷也。从鳥，辥聲。”', '27.E35B': '《說文》：“𪇳，𪇳鴜也。从鳥，箴聲。”', '27.9E13': '《說文》：“䴎，鼠形，飛走且乳之鳥也。从鳥，畾聲。”', '27.7C6F': '《說文》：“籯，笭也。从竹，贏聲。”', '27.F06B': '《說文》：“𥽿，䊪米一斛舂為九斗曰𥽿。从毇，丵聲。”', '27.E714': '《說文》：“䚕，求也。从見，麗聲。讀若池。”', '27.E767': '《說文》：“𩖊，面瘦淺𩖊𩖊也。从頁，霝聲。”', '27.E79F': '《說文》：“䰕，鬣也。从髟，盧聲。”', '27.E814': '《說文》：“𧲝，豚屬。从豚，衛聲。讀若罽。”', '27.9A60': '《說文》：“驠，馬白州也。从馬，燕聲。”', '27.9A65': '《說文》：“驥，千里馬也，孫陽所相者。从馬，冀聲。天水有驥縣。”', '27.9A62': '《說文》：“驢，似馬，長耳。从馬，盧聲。”', '27.9EF6': '《說文》：“黶，申黑也。从黑，厭聲。”', '27.E8A4': '《說文》：“䵵，黃黑而白也。从黑，算聲。一曰短黑。讀若以芥為齏，名曰芥荃也。”', '27.9C73': '《說文》：“鱳，魚名。出樂浪潘國。从魚，樂聲。”', '27.9474': '《說文》：“鑴，瓽也。从金，巂聲。”', '27.9478': '《說文》：“鑸，鍡鑸也。从金，壘聲。”', '27.EBC2': '《說文新附》：“鑺，兵器也。从金，瞿聲。”', '27.EBDD': '《說文》：“𨏵，車伏兔下革也。从車，𤔿聲。𤔿，古昏字。讀若閔。”', '27.91C3': '《說文》：“釃，下酒也。一曰醇也。从酉，麗聲。”', '27.E063': '《說文》：“䖂，鳧葵也。从艸，攣聲。”', '27.E133': '《說文》：“𧾵，大步也。从走，矍聲。”', '27.8EA9': '《說文》：“躩，足躩如也。从足，矍聲。”', '27.8B9C': '《說文新附》：“讜，直言也。从言，黨聲。”', '27.E261': '《說文》：“䪎，緌也。从革，巂聲。”', '27.E33C': '《說文》：“𪈓，秸𪈓，尸鳩。从鳥，𥱩聲。”', '27.9E15': '《說文》：“𪈒，𪈒鷀也。从鳥，盧聲。”', '27.8C54': '《說文》：“豔，好而長也。从豐，豐，大也，盇聲。《春秋傳》曰：‘美而豔’。”', '27.866A': '《說文》：“虪，黑虎也。从虎，鯈聲。”', '27.9961': '《說文》：“饡，以羹澆飯也。从食，贊聲。”', '27.E4C4': '《說文》：“揫，束也。从手，秋聲。《詩》曰：‘百禄是揫。’”', '27.8C9C': '《說文》：“貜，𤠼玃也。从豸，矍聲。”', '27.9A64': '《說文》：“驤，馬之低仰也。从馬，襄聲。”', '27.9A67': '《說文》：“驧，馬曲脊也。从馬，鞠聲。”', '27.E89F': '《說文》：“𪒹，雖皙而黑也。从黑，箴聲。古人名𪒹，字皙。”', '27.9EF7': '《說文》：“黷，握持垢也。从黑，賣聲。《易》曰：‘再三黷’。”', '27.7065': '《說文》：“灥，三泉也。闕。”', '27.E9B7': '《說文》：“䲚，魚名。从魚，賴聲。”', '27.E9E8': '《說文》：“𨷻，妄入宮掖也。从門，䜌聲。讀如闌。”', '27.EB29': '《說文》：“𧖉，蟲也。从䖵，展省聲。”', '27.883D': '《說文》：“蠽，小蟬，蜩也。从䖵，𢧵聲。”', '27.883F': '《說文》：“蠿，蠿蟊，作罔蛛蟊也。从虫，𢇍聲。𢇍，古絕字。”', '27.EB48': '《說文》：“𪓿，𪓰𪓿，詹諸也。《詩》曰：‘得此𪓰𪓿’，言其行𪓿𪓿。从黽，爾聲。”', '27.EBA7': '《說文》：“𨰠，銼𨰠也。从金，羸聲。”', '27.947D': '《說文》：“鑽，所以穿也。从金，贊聲。”', '27.947E': '《說文》：“鑾，人君乘車，四馬鑣，八鑾鈴，象鸞鳥聲，和則敬也，从金，从鸞省。”', '27.EBE8': '《說文》：“䡾，載高皃。从車，𣡌省聲。”', '27.E056': '《說文》：“䖆，菜也。从艸，釀聲。”', '27.E073': '《說文》：“𧆐，艸也。从艸，贛聲。一曰薏苢。”', '27.E252': '《說文》：“𩎑，車衡三束也，曲轅𩎈縛，直轅𨏉（按：當從《繫傳》作䡞）縛。从革，爨聲。讀若《論語》‘鑚燧’之鑚。䡽，𩎑或从革、贊。”', '27.E287': '《說文》：“𩰟，鬭，連結𩰝紛相牽也。从鬥，燹聲。”', '27.9E1A': '《說文》：“鸚，鸚䳇，能言鳥也。从鳥，嬰聲。”', '27.E44A': '《說文》：“𧈜，黑虎也。从虎，騰聲。”', '27.F4C4': '《說文》：“𩰪，芳艸也。十葉為貫，百廾貫築以煮之為𩰪。从𦥑、冖、缶、鬯。彡，其飾也。一曰𩰪鬯，百艸之華，遠方𩰪人所貢芳艸，合釀之以降神。𩰪，今𩰪林郡也。”', '27.9A69': '《說文》：“驩，馬名。从馬，雚聲。”', '27.E844': '《說文》：“麢，大羊而細角。从鹿，霝聲。”', '27.E89C': '《說文》：“黸，齊謂黑為黸。从黑，盧聲。”', '27.6207': '《說文》：“戇，愚也。从心，贛聲。”', '27.EB3A': '《說文》：“𧖔，蟁也。从蟲，𨳌聲。”', '27.947F': '《說文》：“鑿，穿木也。从金。𥽿省聲。”', '27.9481': '《說文》：“钁，大鉏也。从金，矍聲。”', '27.864B': '《說文》：“虋，赤苗嘉穀也。从艸，釁聲。”', '27.8B9F': '《說文》：“讟，痛怨也。从誩，賣聲。《春秋傳》曰：‘民無怨讟。’”', '27.E35F': '《說文》：“𪈩，𪈩專，畐蹂，如䧿短尾，射之銜矢射人。从鳥，雚聲。”', '27.9EB7': '《說文》：“麷，煑麥也。从麥，豐聲。讀若馮。”', '27.9B31': '《說文》：“鬱，木叢生者。从林，𩰪省聲。”', '27.E650': '《說文》：“𤼤，滿也。从疒，𡚤聲。”', '27.9A6A': '《說文》：“驪，馬深黑色。从馬，麗聲。”', '27.E9C9': '《說文》：“𩽩，魚名。从魚，瞿聲。”', '27.E27B': '《說文》：“𩱲，內肉及菜湯中薄出之。从鬲，翟聲。”', '27.9A6B': '《說文》：“驫，衆馬也。从三馬。”', '27.9C7A': '《說文》：“鱺，魚名。从魚。麗聲。”', '27.E26F': '《說文》：“𩱴，炊气皃。从鬲，嚻聲。”', '27.E1B1': '《說文》：“𪚁，齒見皃。从齒，聯聲。”', '27.E33A': '《說文》：“䨊，鳥羣也。从雥，𣶒聲。”', '27.7C72': '《說文》：“𥸤，呼也。从頁，籥聲，讀與籥同。《商書》曰：‘率𥸤眾戚。’”', '27.E9A6': '《說文》：“𩽵，鮦也。从魚，蠡聲。”', '27.F137': '《說文》：“龖，飛龍也。从二龍。讀若沓。”', '27.EDE6': '《說文》：“鱻，新魚精也。从三魚不變魚。”', '27.E9D1': '《說文》：“龗，龍也。从龍，霝聲。”', '27.E4F8': '《說文》：“䯂，衆盛也。从木，驫聲。《逸周書》曰：‘疑沮事闕。’”', '27.9F7E': '《說文》：“齾，缺齒也。从齒，獻聲。”', '27.E0B7': '《說文》：“𧆓，艸履也。从艸，麤聲。”'};
